            migrationBuilder.InsertData(
                table: "RollableEffect",
                columns: new[] { "Id", "CriticalFailure", "CriticalSuccess", "Failure", "Name", "OwnerId", "SpellId", "Success" },
                values: new object[,]
                {
                    { new Guid("24f9c42e-230d-405f-85ba-63183ffa983c"), "The target makes no progress toward escape, and if it was on the right path, it no longer is.", "The target escapes and the spell ends.", "The target makes no progress toward escape.", null, new Guid("1f7e556d-254c-4761-aac0-d891fe93671e"), null, "The target is on the right path to the exit. If the target was already on the right path, it escapes the maze and the spell ends." },
                    { new Guid("8fee38a9-d7b7-4ee7-8a84-975c797b5fc7"), "As failure, and the target takes a –4 circumstance penalty to Deception checks against your questions.", null, "Each round of the spell’s duration, you can Sustain the Spell to ask a different question and attempt to uncover the answer. For each question, the target can attempt a Deception check against your spell DC; if the target succeeds, you don’t learn the answer, and on a critical success, the target gives you a false answer that you believe is truthful Once you’ve asked the target a given question, asking it again, even with a separate casting of mind probe, produces the same result.", null, new Guid("50520c01-24e6-4434-a687-b324bcd0fe85"), null, "The target is unaffected." },
                    { new Guid("9747a77f-9379-49ef-b1ca-6f88ef931879"), "As failure, and for the duration of the spell, you can Sustain the Spell to detect the target’s surface thoughts again. The target doesn’t receive any additional saves.", "The target perceives vague surface thoughts from you when you Cast the Spell.", "You perceive vague surface thoughts from the target when you Cast the Spell, and you find out whether its Intelligence modifier is higher than, equal to, or lower than yours.", null, new Guid("92db312e-0dc1-4fa8-badb-8e5ab99951f4"), null, "You find out whether the target’s Intelligence modifier is higher than, equal to, or lower than yours." },
                    { new Guid("ddabf3d4-886e-4c34-a66e-6378e631e5ba"), null, "The target is unaffected and realizes you tried to alter its memory.", "During the first 5 minutes of the spell’s duration, you can Sustain the Spell to modify a memory once each round. When you do, you imagine up to 6 seconds of memory to modify, to a maximum of 5 continuous minutes of memory.", null, new Guid("fc4b9cfa-3ce9-4135-a9dc-0314313dfb80"), null, "The target is unaffected but thinks your spell was something harmless instead of modify memory, unless it identifies the spell." },
                    { new Guid("55a57c6f-b102-46fd-a986-cd5ce3e32a7c"), "The target experiences the nightmares, awakens fatigued, and is drained 2 until it is no longer fatigued.", "The target suffers no adverse effects and is temporarily immune for 1 week.", "The target experiences the nightmares and awakens fatigued.", null, new Guid("083d1186-7e18-46d7-81c1-baceb222ef4b"), null, "The target experiences the nightmares but suffers no adverse effects other than unpleasant memories." },
                    { new Guid("f4173fcb-2339-4f3b-9a54-ef7ec5ef089e"), "As failure, and creatures that the target encounters have an initial attitude toward them of two steps worse.", "The target is unaffected.", "As success, but the effect is permanent.", null, new Guid("4462f1ea-ffe2-4087-b1c2-7d3a56afbb3e"), null, "For 10 minutes, the target must roll twice and use the worse result whenever attempting a Deception, Diplomacy, Intimidation, or Performance check, and creatures they encounter have an initial attitude toward them of one step worse (for instance, unfriendly instead of indifferent)." },
                    { new Guid("78383ab1-1c94-4bf0-95ce-3137de0f5c25"), "As failure, and the target must spend all its actions paying tribute if possible.", "The target is unaffected.", "The target must pay tribute six times.", null, new Guid("1f6026bc-7381-477d-a61c-70769fbf8fab"), null, "The target must pay tribute twice." },
                    { new Guid("877d6e02-66b4-49ec-aab0-5b3e83727095"), "The target is paralyzed for 4 rounds. At the end of each of its turns, it can attempt a new Will save to reduce the remaining duration by 1 round, or end it entirely on a critical success.", "The target is unaffected.", "The target is paralyzed for 1 round.", null, new Guid("a99f55f3-63c7-4db8-8b0f-9f452a58e240"), null, "The target is stunned 1." },
                    { new Guid("8e82d049-9724-436b-b4ea-1308c590bf5a"), "As failure, except the target believes that everyone it sees is a mortal enemy. It uses its reactions and free actions against everyone, regardless of whether they were previously its allies, as determined by the GM. It otherwise acts as rationally as it normally does and likely prefers to attack creatures that are actively attacking or hindering it over those leaving it alone.", "The target is unaffected.", "As success, but the effect lasts 1 minute.", null, new Guid("4ef54f62-e2b5-4230-9279-82e61be830a8"), null, "The target believes everyone it sees is a potential threat. It becomes unfriendly to all creatures to which it wasn’t already hostile, even those that were previously allies. It treats no one as an ally. The spell ends after 1 round." },
                    { new Guid("ec39a4cc-fde3-43d1-aa3c-dfb9033d793a"), "The target is so afraid it might die. It must attempt a Fortitude save; if the target fails, it dies. On a successful Fortitude save, the target takes 12d6 mental damage, is fleeing until the end of its next turn, and is frightened 4. This effect has the incapacitation trait.", "The target is unaffected.", "The target takes 8d6 mental damage and is frightened 2.", null, new Guid("e0288efb-73eb-4baf-97fa-fe63518290a5"), null, "The target takes 4d6 mental damage and is frightened 1." },
                    { new Guid("e4d0b50f-ef5c-4f0c-9447-aead23e6bd42"), null, "The target takes double damage and is drained 2.", null, null, new Guid("d38967b5-1db4-4d11-b804-196bf9dcc574"), null, "The target takes full damage and is drained 2." },
                    { new Guid("4849d02a-26d0-41f3-8828-2c33f84e4a05"), "As failure, but the target is sickened 2.", "The target is unaffected.", "The target takes full initial and persistent damage, and the target is sickened 1. If the target recovers from being sickened, the persistent damage ends and the spell ends.", null, new Guid("ece946f0-28b2-4b5c-a886-0bfd5d2e00b8"), null, "The target takes full initial damage but no persistent damage, and the spell ends immediately." },
                    { new Guid("1adbe63b-021b-4ded-a2a9-2e089012f210"), "The creature dies.", "The creature is unaffected.", "The creature takes 100 negative damage.", null, new Guid("e51bf1f2-92f8-4c61-89c0-1350472a8bd5"), null, "The creature takes 9d6 negative damage." },
                    { new Guid("ffa77e27-aab6-4a06-9599-c9a1b8ab5920"), "You possess the target fully, and it can only watch as you manipulate it like a puppet. The target is controlled by you.", "The target is unaffected.", "You possess the target and take partial control of it. You no longer have a separate turn; instead, you might control the target. At the start of each of the target’s turns, it attempts another Will save. If it fails, it’s controlled by you on that turn; if it succeeds, it chooses its own actions; and if it critically succeeds, it forces you out and the spell ends.", null, new Guid("de5f1b30-7c64-4cb3-94d6-78a70ec916e5"), null, "You possess the target but can’t control it. You ride along in the body while the spell lasts." },
                    { new Guid("205a4736-540f-4fd2-9f14-7dcffbe73565"), "The creature takes double damage and is pushed 10 feet away from you.", "The creature is unaffected.", "The creature takes full damage and is pushed 5 feet away from you.", null, new Guid("a3135b79-cbae-4247-9498-c673d0ef1f19"), null, "The creature takes half damage." },
                    { new Guid("ef911985-73d9-4a11-930f-5d96e5cfc265"), "The target is afflicted with purple worm venom at stage 2.", "The target is unaffected.", "The target is afflicted with purple worm venom at stage 1.", null, new Guid("c4507279-ec9c-4506-8f37-94e94744dbda"), null, "The target takes 3d6 poison damage." },
                    { new Guid("3ffbe429-d204-46b8-bc69-565db6989569"), "The creature is blinded for 1 minute.", "The creature is unaffected.", "The creature is blinded until the end of its next turn.", "Fireworks", new Guid("2d9fa0b3-c9ba-4e4f-8c95-79a6366fdb61"), null, "The creature is dazzled until the end of its next turn." },
                    { new Guid("8a41f419-f41a-4550-92e7-717874aad150"), "The creature is sickened 1 and cannot recover from the sickened condition while in the area of the smoke cloud.", null, "The creature is sickened 1.", "Smoke Cloud", new Guid("2d9fa0b3-c9ba-4e4f-8c95-79a6366fdb61"), null, " The creature is unaffected." },
                    { new Guid("d6d65b6d-25c7-4dcd-8a1c-75b405293c66"), "The target becomes enfeebled 3.", "The target is unaffected.", "The target becomes enfeebled 2.", null, new Guid("f0d15a0d-0fe1-4bfc-a63e-1f4937d34871"), null, "The target becomes enfeebled 1." },
                    { new Guid("cd83db63-1ac8-4760-aba4-11267e981565"), null, "The target takes double damage and takes a –10-foot status penalty to its Speeds for 1 round.", null, null, new Guid("c5479bd0-14c5-4df7-bca5-017566cfd5b5"), null, "The target takes normal damage." },
                    { new Guid("115958ba-5c52-463c-8a4d-3f27eb519e56"), null, "The creature’s movement is not restricted.", "The creature can’t move closer to you within the area.", null, new Guid("2e2c7320-6610-44fe-8e06-18950089fce1"), null, "The creature treats each square in the area as difficult terrain when moving closer to you." },
                    { new Guid("89882a94-d0eb-419a-911a-a1d1be27abdf"), "As success, but the duration is 1 minute. The target finds the treasure so appealing that until the spell ends, it must spend each action focused on it. This can include moving toward the treasure if the target isn’t next to it, and Interacting with the treasure if the target is next to it. (If the illusion appears to be a person or the like, the target can also Interact to converse with it.)", "The target is unaffected.", "As success, but the duration is 1 minute.", null, new Guid("e3c259f7-11a8-4b23-a512-29afd7cffe68"), null, "The target becomes fascinated with the treasure, and the duration is until the end of its turn. The target can also try to disbelieve the illusion if it touches the treasure, Seeks to examine it, or speaks to it if the illusion appears to be a person or the like. If the target disbelieves the illusion, the spell ends." },
                    { new Guid("789c5dfe-3724-43a4-8b0d-d8dd68dadf10"), "The creature becomes frightened 2, and its action fails and is wasted.", null, "The creature becomes frightened 2 before using its action.", null, new Guid("3710ee0e-bee7-42fa-8469-cce73389e447"), null, "The creature is unaffected." },
                    { new Guid("e6533949-41a5-4cb4-b737-beecbe93d16e"), "The creature is deafened for 1 minute.", "The creature is unaffected and is temporarily immune for 10 minutes.", "The creature is deafened for 1 round.", "Raucous Din", new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), null, "The creature is unaffected." },
                    { new Guid("4dc30cf7-914e-4c4d-9381-14e702584b9f"), "As failure, but the monkeys cling to the creature tenaciously, and the effect lasts until the spell ends, even if the creature leaves the spell’s area.", "The creature is unaffected and is temporarily immune for 10 minutes.", "For 1 round, the creature must succeed at a DC 5 flat check whenever it attempts a manipulate action. If it fails this check, the creature loses that action.", "Tumultuous Gymnastics", new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), null, "The creature is unaffected." },
                    { new Guid("4d977be1-3d58-4391-8185-77a3037f3b1d"), "As failure, but the target can’t attempt a save to end the fascination if it disagrees with you.", "The target is unaffected and notices that you tried to use magic.", "The target is fascinated with you. It can attempt another Will save if it witnesses actions or speech with which it disagrees. If it succeeds, it’s no longer fascinated and is temporarily immune for 1 hour. If the target is subject to a hostile act, or if another creature succeeds at a Diplomacy or Intimidation check against it, the fascination ends immediately.", null, new Guid("bb133e97-c0be-4c85-bce1-efd4f4cee979"), null, "The target needn’t pay attention but doesn’t notice you tried to use magic(it might notice others are enthralled)." },
                    { new Guid("d37202d3-ccf1-4481-bf63-e93d564bd61c"), "The target believes the statement with unlimited duration.", "The target doesn’t believe the statement, and it knows you tried to trick it.", "The target believes the statement for a duration of 1 week.", null, new Guid("5c62dfd4-3483-4fbd-84b0-e3482e32a63c"), null, "The target doesn’t believe the statement or realize you tried to trick it." },
                    { new Guid("197e6d0c-3dfe-49bb-8dd2-a570a3bf405b"), "The target is frightened 3 and fleeing for 1 round.", "The target is unaffected.", "The target is frightened 2.", null, new Guid("eee187bd-5654-4215-b042-56e537a49410"), null, "The target is frightened 1." },
                    { new Guid("c7e8c8ee-cc60-4a75-ba5e-f5d4f4a4dee1"), "The target’s intellect is permanently reduced below that of an animal, and it treats its Charisma, Intelligence, and Wisdom modifiers as –5. It loses all class abilities that require mental faculties, including all spellcasting. If the target is a PC, they become an NPC under the GM’s control.", "The target is unaffected.", "The target is stupefied 4 with an unlimited duration.", null, new Guid("20718a32-54fb-47d6-a948-6d4c006633ec"), null, "The target is stupefied 2 for 1 round." },
                    { new Guid("775df469-be19-45a1-91c1-dfa8b0b1d576"), "As failure, but the target is initially slowed 2.", "The target is unaffected.", "The target is slowed 1 and must attempt a Fortitude save at the end of each of its turns; this ongoing save has the incapacitation trait. On a failed save, the slowed condition increases by 1 (or 2 on a critical failure). A successful save reduces the slowed condition by 1. When a creature is unable to act due to the slowed condition from flesh to stone, the creature is permanently non-magically petrified. The spell ends if the creature is petrified or the slowed condition is removed.", null, new Guid("03533db6-d74d-43cc-84e0-ec5f1c0177b8"), null, "The target is slowed 1 for 1 round." },
                    { new Guid("1e7d9528-0419-4cb9-8b8f-3035fa188cd6"), "As failure, but double the persistent poison damage. While it is taking this persistent poison damage, it has weakness 2 to fire and weakness 2 to slashing.", "The creature is unaffected.", "The target takes the full persistent poison damage. While it is taking this persistent poison damage, it has weakness 1 to fire and weakness 1 to slashing.", null, new Guid("4d55fa92-d467-461b-9788-2b0d9e803677"), null, "The target takes half the persistent poison damage." },
                    { new Guid("92cb1893-1442-4550-b81e-80f18be6e53e"), "The target is afflicted with ghoul fever at stage 3.", "The target is unaffected.", "The target is afflicted with ghoul fever at stage 2.", null, new Guid("a0084011-a907-40e8-bdc9-928161a4f95e"), null, "The target is afflicted with ghoul fever at stage 1." },
                    { new Guid("77be37d5-c650-4476-a511-d3bacf4798c5"), "The target is blinded for 1 round and dazzled for 10 minutes.Its invisibility is negated for 10 minutes.", "The target is unaffected.", "The target is dazzled for 1 minute and its invisibility is negated for 1 minute.", null, new Guid("58aae6ec-5f9a-4e70-bc80-c1e40d093d62"), null, "The target’s invisibility is negated for 2 rounds." },
                    { new Guid("e80e0812-b7f4-464c-886b-a82c835c842e"), "The target is afflicted with goblin pox at stage 2.", "The target is unaffected.", "The target is afflicted with goblin pox at stage 1.", null, new Guid("4e7cb1a5-efac-4f03-96a4-525c1892dff2"), null, "The target is sickened 1." },
                    { new Guid("f24db306-7a97-4518-9ddf-e10c12d359ad"), "The creature takes double negative damage and double persistent bleed damage.", "The creature is unaffected.", "The creature takes full damage.", null, new Guid("dee50182-70ca-460e-8610-91cf21943170"), null, "The creature takes half the negative damage and no persistent bleed damage." },
                    { new Guid("345724d0-1b40-44c3-82f1-894cfd8f3fbb"), "As failure, but the target becomes sickened 2.", "The target is unaffected.", "The target becomes sickened 1 and can’t reduce its sickened condition below 1 while the curse remains. The curse can be lifted by remove curse or similar magic. Whenever the target is sickened and on the water at least a mile from shore, it is also slowed 1.", null, new Guid("117860b5-a1af-46fc-80fb-26d7e2bc6fb1"), null, "The target becomes sickened 1. Reducing its sickened condition to 0 ends the curse." },
                    { new Guid("13777386-f4f9-44ef-8a48-d8afe3361718"), "The character is sickened 2.", null, "The creature is sickened 1.", null, new Guid("f029e544-0b60-4ea9-9278-279be637acb1"), null, "The creature is unaffected." },
                    { new Guid("953de49c-c10b-4456-a387-f27ff371db76"), "The creature perceives what you chose until it disbelieves, and it trusts its false senses, taking a –4 circumstance penalty to saves to disbelieve.", "The creature is unaffected.", "The creature perceives what you chose until it disbelieves.", null, new Guid("ba088a8d-3acd-4ae3-b661-9043201478b5"), null, "The creature perceives what you chose until it disbelieves, but it knows what the hallucination is." },
                    { new Guid("91e56a2f-2979-40b0-b292-d0fa922fc13e"), "As failure, but the creature takes double damage and the object deals double persistent damage.", "The creature is unaffected.", "The creature takes full damage and the object deals full persistent damage.", null, new Guid("1a02e573-b5c3-4c90-a480-b5bfbb84cfac"), null, "The creature takes half damage and the object deals no persistent fire damage." },
                    { new Guid("12dbb027-58d4-4b3f-84aa-b1bd660434e9"), "The target falls prone and can’t use actions or reactions for 1 round.It then suffers the failure effects.", "The target is unaffected.", "The target is slowed 1 and can’t use reactions.", null, new Guid("3f5aac9a-03cd-4c4b-8504-d6d3597e95a8"), null, "The target is plagued with uncontrollable laugher. It can’t use reactions." },
                    { new Guid("8a8af738-6de8-475e-b0eb-f18bf5191629"), null, "The target takes 6d6 bludgeoning damage and is knocked back 10 feet.", null, null, new Guid("39319090-baf5-4ecf-89e9-151a26522d3d"), null, "The target takes 3d6 bludgeoning damage and is knocked back 5 feet." },
                    { new Guid("2890e308-e217-42f9-8bdc-f4d51602e67a"), "The target is fascinated by the pattern. While it remains fascinated, it can’t use reactions.", null, "The target is fascinated by the pattern.", null, new Guid("b8e5314c-6a86-4dba-88ec-26ca65b8edb3"), null, "The target is unaffected." },
                    { new Guid("d4c1badc-b7e8-45d8-beb4-c63d1386406f"), "Every time during the duration that the target attempts an attack roll or skill check, it must roll twice and use the worse result.", null, "The first time during the duration that the target attempts an attack roll or skill check, it must roll twice and use the worse result.", null, new Guid("6e6315c3-5c27-44a5-9127-fad940826632"), null, "The target is unaffected." },
                    { new Guid("29119fe4-5510-438e-892b-e0a354fbbb03"), "The creature takes 4d8 persistent negative damage and becomes drained 2 and doomed 1.", "The creature is unaffected.", "The creature takes 4d8 persistent negative damage and becomes drained 1.", null, new Guid("d63d0e3a-03d7-4cd1-9aea-b47a2b61ad77"), null, "The creature takes 2d8 persistent negative damage." },
                    { new Guid("a31094d0-f8ed-4c86-b16d-ff4875cd7cff"), "As failure, but the creature is impaled through a vital organ or its center of mass, taking double damage, and it is flat-footed as long as it’s impaled.", "The target dodges the spike and is unaffected.", "The target is impaled through a leg or another non-vital body part. The creature takes full damage and, if it’s standing on solid ground, becomes immobilized. It can attempt to Escape (the DC is your spell DC). While it remains impaled, it takes damage from any weakness to cold iron it has at the end of each of its turns.", null, new Guid("021b449e-942e-4664-84d3-ecd2827d701c"), null, "The target is struck by the spike and takes half damage." },
                    { new Guid("6df3c6d2-a4d6-41bc-b096-72159874cc41"), "The target is afflicted with imp venom at stage 2.", "The target is unaffected.", "The target is afflicted with imp venom at stage 1.", null, new Guid("ff6c68a1-e60a-4f3a-8e3d-54c119af4841"), null, "The target takes 1d6 poison damage." },
                    { new Guid("01b06dbe-0d2e-4f94-af09-883d2a79e058"), null, "The target disrupts the sphere’s integrity, causing it to collapse entirely.", "The sphere has its normal effect.", null, new Guid("6007e524-204d-451d-87b1-7f3fc7646ee5"), null, "The sphere functions normally but has only 10 Hit Points instead of 40." },
                    { new Guid("f301d0a7-d720-41f4-8f76-d7b419a731cb"), "The creature is pushed 30 feet in the wind’s direction, knocked prone, and takes 2d6 bludgeoning damage.", "The creature is unaffected.", "The creature is knocked prone. If it was flying, it suffers the effects of critical failure instead.", null, new Guid("182823a4-0b66-4bfe-a4fa-79dfd4fb5abf"), null, "The creature can’t move against the wind." },
                    { new Guid("c607b915-9901-4fc2-8538-786b7f1a015b"), "The creature wastes the action and can’t attempt to attack the target for the rest of sanctuary’s duration.", "Sanctuary ends.", "The creature can’t attack the target and wastes the action. It can’t attempt further attacks against the target this turn.", null, new Guid("86dabd01-ccd5-45e6-adac-c7677bb0000c"), null, "The creature can attempt its attack and any other attacks against the target this turn." },
                    { new Guid("344ce0bd-a1f3-4082-8199-7213834d216e"), "The creature takes double damage and is encased.", "The creature is unaffected.", "The creature takes full damage and is encased.", null, new Guid("120f7798-342f-42f8-a213-8053fbc4f6bf"), null, "The creature takes half damage." },
                    { new Guid("f9a064c1-aa84-4a18-8070-bd215138b6b0"), "The spell succeeds, and the eye follows the target if it moves, traveling up to 60 feet per round.", "The spell fails and the target is temporarily immune for 1 week. The target also gains a glimpse of you and learns its rough distance and direction from you.", "The spell succeeds.", null, new Guid("a6a36041-739b-4107-b7fe-a00d7790f455"), null, "The spell fails and the target is temporarily immune for 1 day." },
                    { new Guid("c996defa-3d10-477e-adc5-29e777f0e77f"), "The target takes double damage and is immobilized by the vampiric maiden for 1 round or until it Escapes (the DC is your spell DC), whichever comes first.", "The target is unaffected.", "The target is briefly trapped within the vampiric maiden. The target takes full damage and is immobilized by the iron maiden for 1 round or until it uses an Interact action to extricate itself, whichever comes first.", null, new Guid("2dcb92ab-b738-415b-9213-6ccb9b8d9e89"), null, "The target takes half damage." },
                    { new Guid("48f59a2c-c88a-4691-a845-ce2560099c6f"), "The creature is blinded for 1 minute.", "", "The creature is blinded by the pattern. If it exits the pattern, it can attempt a new save to recover from the blinded condition at the end of each of its turns, to a maximum duration of 1 minute.", null, new Guid("f6c126fd-db6b-49bf-8439-7da6cf8b442f"), null, "The creature is unaffected." },
                    { new Guid("4bc5c356-6e60-462d-823c-facc3daf52a2"), "The creature takes double damage and is drained 4.", "The creature is unaffected.", "The creature takes full damage and is drained 1d4.", null, new Guid("26e26a2a-c825-4d3c-91d4-abf053a5a19c"), null, "The creature takes full damage." },
                    { new Guid("3f555f1e-6a41-4d6f-80aa-b6719b4fc842"), "The creature is restrained by the wall for 1 round or until it Escapes against your spell DC, whichever comes first.", null, "The creature is grabbed by the wall for 1 round or until it Escapes against your spell DC, whichever comes first.", null, new Guid("7b672b18-9650-4808-92ba-fcab53f51b94"), null, "The creature is unaffected." },
                    { new Guid("a437792d-be5e-4889-a6d6-209bd489e3c4"), "As failure, and the creature is pushed 10 feet away from the wall.", "The creature can move through the wall normally this turn.", "The wall stops the movement of the flying creature, and any remaining movement from its current action is wasted.", null, new Guid("82285375-7f60-4f6e-953c-747f79584516"), null, "The flying creature can move through the wall this turn, but the wall is difficult terrain." },
                    { new Guid("aa8513c6-e602-4f03-9c9d-2d864b66ad8a"), "The target is confused permanently.", "The target is unaffected.", "The target is confused for 1 minute.", null, new Guid("ec9aaa24-7288-4ab5-9f9f-f8c964f554b8"), null, "The target spends the first action on its next turn with the confused condition." },
                    { new Guid("ee2623a2-56b5-48d9-ba56-64dfc6bb3a73"), "The target takes double damage and is subject to the weapon’s critical specialization effect.", "The creature is unaffected.", "The target takes full damage.", null, new Guid("68cc985a-d2bb-4d53-8f2c-afc1911c887f"), null, "The target takes half damage." },
                    { new Guid("4803d77d-c61f-4d85-9a81-89b1b6ba9e2b"), "The creature is immobilized until the start of its next turn, after which it takes a –10-foot circumstance penalty to its Speeds for 1 round. It can attempt to Escape to remove its immobilized condition.", "The creature is unaffected, and it doesn’t need to attempt further Athletics checks or saving throws against the web this turn. If it used an Athletics check, it clears the web from every square it leaves after leaving the square.", "The creature takes a –10-foot circumstance penalty to its Speeds until the start of its next turn.", null, new Guid("d1767a35-390b-496c-b78d-b2dae7e06391"), null, "The creature is unaffected during its action. If it used an Athletics check, it clears the web from every square it leaves after leaving the square." },
                    { new Guid("95e2034a-500d-4ca5-8eb2-447b2b6a8292"), "The target is so afraid, it might instantly die. It must attempt a Fortitude saving throw. If the target succeeds, it takes double damage and is frightened 2, and it’s also fleeing until the end of its next turn unless it critically succeeded. If it fails, it is reduced to 0 Hit Points and dies.", "The target is unaffected.", "The target takes full damage and is frightened 2.", null, new Guid("695c1bb5-5c88-4344-902a-d02e6ab7ce45"), null, "The target takes half damage and is frightened 1." },
                    { new Guid("450c7565-cdd5-43e5-8684-556be2933a2a"), "The target can’t speak any deliberate and intentional lies and takes a –4 status penalty to Deception checks.", "The target is unaffected.", "The target can’t speak any deliberate and intentional lies, and it takes a –2 status penalty to Deception checks.", null, new Guid("a1dc26d2-2300-40b1-a592-8e002bdad6f5"), null, "The target takes a –2 status penalty to Deception checks." },
                    { new Guid("58e988a4-3ded-4ab8-929d-66b2332d713e"), "The target takes double damage and a –10-foot circumstance penalty to its Speeds until the spell ends.", "The target is unaffected.", "The target takes full damage, and takes a –5-foot circumstance penalty to its Speeds until the spell ends.", null, new Guid("8a559f6c-9fa7-49d8-bd98-29ff051260cd"), null, "The target takes half damage." },
                    { new Guid("d3ac62e5-f081-4c83-8c0d-37a3455254bf"), "The target is afflicted with the curse of death at stage 2.", "The target is unaffected.", "The target is afflicted with the curse of death at stage 1.", null, new Guid("6ca21150-65e1-4ef9-892d-9bda656316af"), null, "The target is afflicted with the curse of death at stage 1, and the stage of the curse can’t increase beyond stage 1." },
                    { new Guid("98d96fc4-6fcf-47fb-bfa0-6ac47b882188"), "Critical Failure The target is frightened 2.", null, "The target is frightened 1.", null, new Guid("5357885a-fcae-43c9-bfa0-61e6e41a2e6e"), null, "The target is unaffected." },
                    { new Guid("c4fc6718-9756-49f1-919b-2b393818ac76"), "As failure, but both the cold damage and the persistent cold damage increase to 2d6.", "The target is unaffected.", "The target takes 1d6 cold damage and 1d6 persistent cold damage. (The persistent damage automatically ends when the spell ends.) It is concealed to other creatures, and other creatures are concealed to it.", null, new Guid("09174920-3fb3-4bf3-a380-7779901e35af"), null, "The target takes 1d6 cold damage, and the spell ends." },
                    { new Guid("a9cd0968-05e4-42d5-9f30-09abbdad067f"), null, null, "The target is shrouded in murky darkness. Unless the target has darkvision, other creatures are concealed to it.", null, new Guid("5bc3a789-1e57-4e0a-b1a2-c495e1fa3942"), null, "The target is unaffected." },
                    { new Guid("89c97ffd-580b-42c2-8bba-7d76162dc651"), null, "The target is unaffected.", "As success, and any time the target uses a concentrate action, it must succeed at a DC 5 flat check or the action is disrupted.", null, new Guid("4563a251-40f7-4063-8615-9ad2f3fa79b9"), null, "The target takes a –1 status penalty to Perception, attack rolls, and Will saves. This penalty increases to –2 for Will saves against sleep effects." },
                    { new Guid("5bd3b44a-1c0d-47ac-9254-56f9c3434c8b"), "As success, but the target also becomes sickened 2 each time it damages you.", "The target is unaffected.", "As success, but the target also becomes sickened 1 each time it damages you.", null, new Guid("629c7f74-0650-4646-8ff9-71e6fb5d4ec2"), null, "When the target attempts an attack roll or skill check that would harm you, it takes a –2 status penalty to its roll." },
                    { new Guid("1e1da503-72b1-4262-bd9f-5e0875a6180e"), null, "The target becomes sickened 2 and slowed 1 as long as it’s sickened.", "The target is unaffected.", null, new Guid("2fed231b-fe88-4fdb-92b9-ab355e578dcc"), null, "The target becomes sickened 1." },
                    { new Guid("4d9bf000-8786-44e4-b628-9b3ce4de498d"), "The target is stunned 1 and can’t use hostile actions against you.", "The target is unaffected.", "The target can’t use hostile actions against you.", null, new Guid("ae7b3742-f94d-46e5-9a3f-858748bdc91d"), null, "The target takes a –1 circumstance penalty to attack rolls and damage rolls against you." },
                    { new Guid("ad329a6e-7b83-49d8-8df6-2f29902844aa"), "It’s destroyed.", "It’s enfeebled 1 until the end of your next turn.", "It’s enfeebled 3 until the end of your next turn.", null, new Guid("76aadc75-c6fe-4a63-9fce-78bc73f54dd2"), null, "It’s enfeebled 2 until the end of your next turn." },
                    { new Guid("c93b5272-9676-492d-9049-39dca3948fb5"), "The creature takes double damage and becomes blinded by the darkness for an unlimited duration.", "The creature is unaffected.", "The creature takes full damage.", null, new Guid("72bb1ec1-42b6-4da3-9109-00a1475da7cb"), null, "The creature takes half damage." },
                    { new Guid("c9736656-e141-4f35-b0e8-6e458a8b7ae8"), null, "The creature or object is unaffected.", "As described, and the duration is 1 hour.", null, new Guid("a8a04331-d5c1-4fa7-b1d1-33dd89f0106e"), null, "As described, and the duration is 1 minute." },
                    { new Guid("8c7748ec-96f1-4ab0-b4a9-efb4a39e8e90"), "Roll 1d4+1 on the table above.", "The target is unaffected, can’t be affected on subsequent rounds, and is temporarily immune for 1 minute.", "Roll 1d4 on the table above.", null, new Guid("71731631-7fb9-4bea-8b7e-d2c4ddcd655c"), null, "The target is unaffected this round, but it can be affected on subsequent rounds." },
                    { new Guid("0a3edc60-9bad-48fd-9541-0be947aec7d6"), "The spell’s duration is 1 minute, and the target must spend all its actions each turn dancing.", "The target is unaffected.", "The spell’s duration is 1 minute, and the target must spend at least 2 actions each turn dancing.", null, new Guid("4ee5fbc3-1c55-45fb-be27-97de76109c27"), null, "The spell’s duration is 3 rounds, and the target must spend at least 1 action each turn dancing." },
                    { new Guid("943003f0-b96a-4523-87c3-d1a03064552a"), "The creature is entirely stuck. It is restrained for 1 round or until it Escapes, whichever comes first.", "The creature escapes the mud and is atop the stone, unaffected.", "The creature is partially stuck in the mud and is grabbed for 1 round or until it Escapes, whichever comes first.", "Mud to Rock", new Guid("82a0f171-2478-45fe-8e98-5c7a355a26fa"), null, "The creature climbs out of the mud as it turns to rock and is prone atop the stone." },
                    { new Guid("4ed5faae-d4f7-4835-b64e-ef4fdd708b6b"), "The affected sound from the creature is altered and the target becomes stupefied 2 for 1 minute as it struggles with the disorienting effects of its altered sound.", null, "The affected sound from the creature is altered in the way you determine.", null, new Guid("5921d0aa-6dd2-4dae-bb5e-ee4bf98bda81"), null, "The affected sound from the creature isn’t altered." },
                    { new Guid("fc94608c-6b9b-4ea8-9bf4-8cc5e6e0014a"), "As failure, but the duration is unlimited.", "The target is unaffected.", "As success, but the duration is 1 minute. If the creature is reduced to 0 HP by the chosen damage and its level is 7 or less, it dies.", null, new Guid("c7f662a7-c1ae-42dd-b213-909077f87f5d"), null, "The target gains weakness 2 to the chosen damage type until the end of your next turn." },
                    { new Guid("43ac2ddb-19d1-4f13-8d5e-42a6da377e9e"), null, "The target takes double fire damage, as well as double good damage if a fiend or undead.", null, null, new Guid("20b5399e-43d6-4d0b-8ab4-182f32d3b72b"), null, "The target takes full damage." },
                    { new Guid("dfb6b0ce-f6fb-4113-aaf8-6d04e3c0dd14"), "The creature falls off the stone (if applicable) and lands prone.", null, "The creature falls prone atop the stone.", null, new Guid("49d1911d-7153-4a01-9e0e-cb89bb62d0ab"), null, "The creature is unaffected." },
                    { new Guid("5ffadddc-181f-40b7-abee-214ed2d489a4"), "The creature falls unconscious. If it’s still unconscious after 1 hour, it wakes up automatically.", "The creature is unaffected.", "The creature falls unconscious. If it’s still unconscious after 1 minute, it wakes up automatically.", null, new Guid("a2b0b58b-19a9-454d-9cf0-81c74d1301a2"), null, "The creature takes a –1 status penalty to Perception checks for 1 round." },
                    { new Guid("2f914f80-bb1e-40fa-babd-95dc1b8d7a52"), "The target is slowed 2 for 1 minute.", "The target is unaffected.", "The target is slowed 1 for 1 minute.", null, new Guid("5f8ef3e1-99e9-44c8-b043-c4fa50c98b4e"), null, "The target is slowed 1 for 1 round." },
                    { new Guid("f603ead2-0a9f-4f7c-8ad5-cc7f154a49a9"), "The creature takes double damage, is deafened for 1 minute, and is stunned 1.", "The creature is unaffected.", "The creature takes full damage and is deafened for 1 round.", null, new Guid("039ee5fe-341b-4de5-bdec-462a495fce1d"), null, "The creature takes half damage." },
                    { new Guid("01e10e04-f894-47fd-9d79-be3f58279db0"), "As failure, but the persistent force damage is 4d12.", "The target is unaffected.", "As success, but the curse and persistent damage do not end on their own.", null, new Guid("174f6b71-7b37-4563-8912-b13434bf930b"), null, "Whenever the target becomes affected by a spell with a duration, the target takes 2d12 persistent force damage. Each time it takes persistent force damage from spellwrack, it reduces the remaining duration of spells affecting it by 1 round. Only a successful Arcana check against your spell DC can help the target recover from the persistent damage; the curse and the persistent damage end after 1 minute." },
                    { new Guid("b9fec79c-a369-47e6-8dca-2935a1ecba9c"), "The target is afflicted with spider venom at stage 2.", "The target is unaffected.", "The target is afflicted with spider venom at stage 1.", null, new Guid("a8a90053-90d2-4969-a70f-4724b37f7a57"), null, "The target takes 1d4 poison damage." },
                    { new Guid("f338e1c6-03c7-4e99-abbc-47a3a0bcd872"), "The target is enfeebled 3 and stupefied 3 for 1 minute and enfeebled 2 and stupefied 2 permanently.", "The target is unaffected.", "The target is enfeebled 2 and stupefied 2 for 1 minute and enfeebled 1 and stupefied 1 permanently.", null, new Guid("b501a600-3a18-4ce7-8cf7-12ae21ab2c78"), null, "The target is enfeebled 2 and stupefied 2 for 1 round." },
                    { new Guid("8d2841ea-2885-46d2-a331-9b0a8463f3da"), "The creature is stunned for 1d4 rounds. After the stunned condition ends, the creature is confused for the remaining duration of the spell.", null, "The creature is confused for 1d4 rounds.", null, new Guid("b4565c07-e74e-4651-be58-dee1715a470b"), null, "The creature is unaffected." },
                    { new Guid("7c2163bf-b443-460f-a0ee-9fbdd2c1e08e"), "The creature is sickened 2 and slowed 1 until it leaves the cloud.", "The creature is unaffected.", "The creature is sickened 1 and slowed 1 while in the cloud.", null, new Guid("f460a7f0-7171-4fcd-973f-1a96b47d00ef"), null, "The creature is sickened 1." },
                    { new Guid("71b9e690-1ce6-40f2-aa77-5ad68fb80e9d"), "As failure, but the duration is 1 hour.", "The target is unaffected and knows you tried to control it.", "The suggestion remains in the target’s subconscious until the next time you prepare. If the trigger occurs before then, the target immediately follows your suggestion. The effect has a duration of 1 minute, or until the target has completed a finite suggestion or the suggestion becomes self-destructive or has other obvious negative effects.", null, new Guid("fd5cb944-c8a1-45b5-88b3-169c48550720"), null, "The target is unaffected and thinks you were talking to them normally, not casting a spell on them." },
                    { new Guid("974e98d4-5080-4555-9683-a7a6854d5494"), "As failure, but the base duration is 1 hour.", "The target is unaffected and knows you tried to control it.", "The target immediately follows your suggestion. The spell has a duration of 1 minute, or until the target has completed a finite suggestion or the suggestion becomes self-destructive or has other obvious negative effects.", null, new Guid("e3535989-0eca-4992-84dc-48515ad2edf3"), null, "The target is unaffected and thinks you were talking to them normally, not casting a spell on them." },
                    { new Guid("ed1eb2e5-9344-45c9-83b5-a79f13af9869"), "The creature takes full damage and becomes blinded permanently.", "The creature is unaffected.", "The creature takes full damage.", null, new Guid("4c4f275c-b1e8-448b-a1aa-66bb2af4fe08"), null, "The creature takes half damage." },
                    { new Guid("48633973-efa3-405e-b4e3-7a049c8bf683"), "The target is afflicted with swarming wasp venom at stage 2.", "The target is unaffected.", "The target is afflicted with swarming wasp venom at stage 1.", null, new Guid("8aa7ba58-13b1-4589-8d66-0e88a6083e7d"), null, "The target takes 2d6 poison damage." },
                    { new Guid("9ec7ddc4-b0cb-4f5e-8792-d9ea199f8021"), "The creature is stunned for 1 round.", "The creature is unaffected.", "The creature is stunned 2.", null, new Guid("2c83b759-23b2-4368-a7a5-a451c3f85b76"), null, "The creature is stunned 1." },
                    { new Guid("d8181a73-2e35-4039-92af-28c813e3a74e"), "As failure, and the target is stunned 2 as it attempts to process the sensory shifts.", "The target is unaffected.", "The target is affected for 1 minute.", null, new Guid("c2da85e4-3cdb-4f3c-8ad9-dc19db1341d6"), null, "The target is affected for 1 round." },
                    { new Guid("36b5db8b-9b37-4874-a6e2-9a6abab19adb"), "As failure, but the target’s answers are more direct and less repetitive, though still cryptic. It takes a –2 status penalty to Deception checks to deceive or mislead you.", "The target can lie or refuse to answer your questions, and the target’s spirit haunts you for 24 hours, bothering you and causing you to be unable to gain any rest for that time.", "The target must answer truthfully, but its answers can be brief, cryptic, and repetitive. It can still mislead you or attempt to stall so that the spell’s duration runs out before you can ask all your questions.", null, new Guid("5269d2c0-e102-469d-b5ba-b48c7fc38ab4"), null, "The target can provide false information or refuse to answer your questions." },
                    { new Guid("dbb78319-267a-4e77-96b4-2be7660aa0f8"), null, "The target gains the immobilized condition and takes a –10-foot circumstance penalty to its Speeds for 1 round. It can attempt to Escape against your spell DC to remove the penalty and the immobilized condition.", "The target is unaffected.", null, new Guid("22b530d2-3cf0-40d3-8833-5c85a8e981d7"), null, "The target takes a –10-foot circumstance penalty to its Speeds for 1 round. It can attempt to Escape against your spell DC to remove the penalty." },
                    { new Guid("7b44239f-8610-4de4-848b-2f372fd45c21"), null, "You deal double damage.", null, null, new Guid("ab61bcac-bdca-4fb7-825d-c0529831b049"), null, "You deal full damage." },
                    { new Guid("9488d8e8-b090-4ceb-8453-83f832e73374"), "The target is stupefied 4.", null, "The target is stupefied 2.", null, new Guid("9374514e-bdad-4483-9123-7267445ba464"), null, "The target is unaffected." },
                    { new Guid("334c8395-9147-4d5e-a857-e91f361b5797"), null, null, "All terrain in the cubes is difficult terrain for the creature, including the air if the creature is flying, walls if it’s climbing, and so on. When the creature would exit one of the cubes, it exits from one randomly determined by the GM. This is a teleportation effect. It can exit from any edge of that cube it chooses. When selecting a random cube, the GM excludes any that don’t match the creature’s terrain; for instance, if the creature were exiting along the ground, the GM would exclude any cube that didn’t have an exit on the ground.", null, new Guid("378b0c20-9a8b-43cb-a1c6-b669b301dbdf"), null, "The creature disbelieves the illusion." },
                    { new Guid("ff7f9657-5fc6-4465-b51e-a012d2bb57f6"), "The creature takes the full collapse damage and falls into a fissure.", "The creature takes half the collapse damage.", "The creature takes the full collapse damage and falls prone.", null, new Guid("92b36046-a4b4-40ab-97c4-9df1bd3f4281"), null, "The creature takes half the collapse damage and falls prone." },
                    { new Guid("078b2af8-41ba-4ada-933d-b8eb222e9b45"), "The target is controlled for 1 round.", "The target is unaffected.", "On the target’s next turn, it’s stunned 1 and you partially control it, causing it to take a single action of your choice. If it has actions left, it can act normally.", null, new Guid("19e92d7b-67bf-4f5b-9085-1bef9545602e"), null, "The target is stunned 1." },
                    { new Guid("ffae5bc6-9a4e-4072-9ea7-7c57a4182b13"), null, "You fail to create a duplicate.", "The duplicate works as described.", null, new Guid("8d0dae0a-a031-4fd3-87e8-8e15da2d633a"), null, "The duplicate deals half damage with its Strikes and the duration is reduced to a maximum of 2 rounds." },
                    { new Guid("cd7a460f-3985-4ab9-a876-7da31b5f83e6"), null, null, "The target gains a +2 status bonus to attack rolls, Perception checks, saving throws, and skill checks. The target can’t Aid other creatures, consider any creature an ally, or use spells or abilities that directly benefit another creature (as determined by the GM), even if they also benefit the target. Other creatures allied with the spell’s target can still consider the target an ally and affect it accordingly.", null, new Guid("3000a92d-b7e9-477e-8d60-06bec208fbe2"), null, "The target is unaffected." },
                    { new Guid("c39c3f55-551d-4c8f-b87d-a30e4cb10ff0"), null, "The creature disbelieves the illusion and is unaffected by it.", "The creature is fascinated by the illusion.", null, new Guid("87972b11-0738-4bfe-8ce2-54a9a1353e43"), null, "The creature is fascinated by the wealth until it has completed its first action on its next turn." },
                    { new Guid("df20e7cc-c455-4c47-b308-208876fbf5ad"), "The target is overcome with ambition, taking whatever actions would advance its own agenda over those of anyone else, even without attempts to convince it.", "The target is unaffected.", "As success, but the penalty is –2.", null, new Guid("a77e9671-1f54-4594-8b24-6dbfe6f9ddae"), null, "The target takes a –1 status penalty to its saving throws and other defenses against attempts to Coerce it, Request something of it, or use mental effects to convince it to do something (such as a suggestion spell). This penalty applies only if the target is being encouraged to advance its own ambitions." },
                    { new Guid("5fdcb111-4315-42b1-a309-22953326528f"), "The creature is fascinated with you, and its attitude toward you improves by one step.", "The creature is unaffected and temporarily immune for 1 hour.", "The creature is fascinated with you.", null, new Guid("dc2be0a2-7409-4d88-8449-8b9557854c1a"), null, "The creature is fascinated with you for its next action, then is temporarily immune for 1 hour." },
                    { new Guid("33a7490e-7b63-4dde-8b90-c6ab5ba62326"), "The target is helpful and can’t use hostile actions against you.", "The target is unaffected and aware you tried to charm it.", "The target’s attitude becomes friendly toward you. If it was friendly, it becomes helpful. It can’t use hostile actions against you.", null, new Guid("0441689e-2d5a-48fc-ae13-2ce811e11a1a"), null, "The target is unaffected but thinks your spell was something harmless instead of charming touch, unless it identifies the spell (see Identifying Spells on page 305)." },
                    { new Guid("324ced5a-220f-4874-b0d2-7b829b0ee113"), "As success, but the duration is 1 minute, and the target is also blinded for the duration. It can attempt a new save at the end of each of its turns. If it succeeds, it’s no longer blinded, but its darkvision or low-light vision remains suppressed.", "The target is unaffected.", "As success, but the duration is 1 minute.", null, new Guid("b84325e2-a86f-4202-b268-ab755204d7e1"), null, "The target’s darkvision or low-light vision is suppressed for 1 round." },
                    { new Guid("669b975b-0026-4e04-9e56-80cff29b8c54"), "The creature is blinded for 1 round and dazzled for 1 hour.", "The creature is unaffected.", "The creature is blinded for 1 round and dazzled for 1 minute. The creature can spend an Interact action rubbing its eyes to end the blinded condition.", null, new Guid("dd619009-2808-4069-8d47-f65cafe32de7"), null, "The creature is dazzled for 1 round." },
                    { new Guid("1c505e85-bf84-444b-9d12-ed3614ad8745"), "The duration is 24 hours.", "The target is unaffected.", "The duration is 10 minutes.", null, new Guid("965001ca-132d-4647-94c7-5502677056df"), null, "The duration is 1 round." },
                    { new Guid("749c528f-62ef-4e65-bbef-ce951ddd121b"), "As failure, but the target follows the course of action for as many actions as possible for the spell’s duration, and it does nothing else.", "The target is unaffected.", "As success, except that you appear in the dream and give a suggestion. This can be to approach you, run away (as if it had the fleeing condition), Release what it’s holding, Drop Prone, or stand in place. The creature follows this course of action as its first action after you Cast the Spell.", null, new Guid("43383a1a-43cb-4de9-aa14-6d1915175e62"), null, "The target’s attention wavers. It becomes flat-footed and fascinated by its daydreams." },
                    { new Guid("72fcfdb9-2202-461b-b322-afb311ce136f"), null, "The ray deals double damage and 1d4 persistent fire damage.", null, null, new Guid("790901b2-edb3-46e3-bfcc-fdef8c10efaf"), null, "The ray deals full damage" },
                    { new Guid("3065599c-d572-4c62-9730-7c46227fd207"), "The duration is 10 minutes.", "The target is unaffected.", "The duration is 1 minute.", null, new Guid("0c342b5d-8f99-466b-8f45-dc92f0c539cd"), null, "The duration is 1 round." },
                    { new Guid("efbea13b-47b4-4857-a5c4-ffe92966f6ff"), null, "The stone deals double damage.", null, null, new Guid("0808dc98-d5f9-4a23-b82e-7d7161418675"), null, "The stone deals full damage." },
                    { new Guid("d6384f91-0c99-4f4a-bd51-f4148c410baf"), "The creature takes double damage and falls prone.", "The creature is unaffected.", "The creature takes full damage and falls prone.", null, new Guid("192b652f-92d5-4fd6-83b8-9001e2d7ae3e"), null, "The creature takes half damage." },
                    { new Guid("c67881ff-350a-41d8-b0c6-a3ab5078c1b4"), null, "The beam deals double damage, and the target is dazzled for 1 minute.", null, null, new Guid("cfbc43c2-20e0-4693-bb22-6cea19de9663"), null, "The beam deals full damage, and the target is dazzled for 1 round." },
                    { new Guid("6a254fa3-badb-4315-88c6-32ba3e737bc9"), "The target is sickened 2.", "The target is unaffected.", "The target is sickened 1.", null, new Guid("ed10a7d4-1078-4d14-af96-b4ed9a03a5ab"), null, "The target is sickened 1, but if it spends an action to end the condition, it succeeds automatically." },
                    { new Guid("7448f1d4-f500-4a12-9f94-66cca30061bd"), "The target is pushed 10 feet away from you and knocked prone.", "The target is unaffected.", "The target is pushed 10 feet away from you.", null, new Guid("8ba9e8e6-7902-49c0-8d3a-aff76bcd8a9b"), null, "The target is pushed 5 feet away from you." },
                    { new Guid("191dc645-26f1-47cd-a6ae-b767b51fa988"), "The target takes double initial and persistent damage.", "The target is unaffected.", "The target takes full initial and persistent damage.", null, new Guid("2ae88ff7-9177-406b-99ec-05fdd4263943"), null, "The target takes half damage and no persistent damage." },
                    { new Guid("d3c6de44-d9cf-46d1-abc4-589bec0edb75"), "The target is confused for 1 minute.", "You are confused for 1 round.", "As success, but the target is affected instead of you, spending its first action each turn confused. The duration is 1 minute.", null, new Guid("c481cb2f-cd45-4d1c-9088-ecc88e2cdd5d"), null, "At the start of your next turn, you spend your first action with the confused condition, then act normally." },
                    { new Guid("1baa4525-6eef-4b9f-adeb-60df5497edc8"), "You move the target up to 10 feet in any direction along the ground or 20 feet in any direction through a body of water.", null, "You move the target 5 feet in any direction along the ground or 10 feet in any direction through a body of water.", null, new Guid("b81a1364-8a8a-45b6-9a13-5f6432dda10b"), null, null },
                    { new Guid("e8883cb7-9d0f-48e3-a7d8-9223974c55eb"), "The target is stupefied 1 for 1 minute.", "The target is unaffected.", "The target is stupefied 1 until the end of your next turn.", null, new Guid("f8843f30-1ace-4783-8eab-1cd5c4ab752e"), null, "The target is stupefied 1 until the end of your current turn." },
                    { new Guid("07a1805d-508c-48de-953a-4767d7587532"), "The target takes double damage, and positive effects heal it only half as much as normal for 1 minute.", "The target is unaffected.", "The target takes full damage, and positive effects heal it only half as much as normal for 1 round.", null, new Guid("7cdc2806-fe9a-4f0d-98ba-d4f8a1a406d0"), null, "The target takes half damage." },
                    { new Guid("b1b916b4-2c4b-4dcf-982a-9795d148f1f2"), "The target is enfeebled 2. Each time it uses an action that deals damage to at least one good creature, the target takes 3d6 good damage.", "The target is unaffected.", "Each time the target uses an action that deals damage to at least one good creature, the target takes 3d6 good damage.", null, new Guid("3c9d8bd6-264b-42d3-8e6f-1639918cf707"), null, "The first time the target uses an action that deals damage to at least one good creature, the target takes 3d6 good damage." },
                    { new Guid("0390d36a-cce7-4616-a177-867fea818690"), "As success, but the target must critically succeed at a Will save to disbelieve when one of the listed events occurs.", "The target is unaffected.", "As success, but the target must succeed at a Will save to disbelieve the illusion when one of the listed events occurs.", null, new Guid("4842cf39-f574-4e0e-b473-216cb4abfc46"), null, "The target believes you’re in the designated location and can’t see you in your actual location. The target automatically disbelieves the illusion when you use an action that doesn’t make sense in the illusion’s position, or if the target attacks, touches, Seeks, or otherwise engages with the illusion. If you use a hostile action against the target, the spell ends." },
                    { new Guid("fa6ffabd-4c44-4885-a596-641a0fcbbd2c"), "The target gains the minion trait and is controlled by you. This effect ends if a hostile action is used against the affected creature, or if you direct the creature to use any action that causes it harm.", "The creature is unaffected.", "The creature uses all its actions to move toward you and compliment your performance. This effect ends if a hostile action is used against the affected creature.", null, new Guid("64ec1a63-ef3c-4461-bab0-7a3ea3f6a598"), null, "The creature is fascinated with you." },
                    { new Guid("e31f9efe-e0aa-4e78-835d-8d0b1b558410"), null, "The status bonus from your inspire courage or inspire defense increases to +3.", "Your inspire courage or inspire defense provides only its normal bonus of +1, but you don’t spend the Focus Point for casting this spell.", null, new Guid("d6c30411-708d-4f50-ad18-ff30380f2138"), null, "The status bonus from inspire courage or inspire defense increases to +2." },
                    { new Guid("5c94d039-e421-42b3-af86-d33a8f266410"), "Your ally takes a –1 circumstance penalty to the triggering check.", " You grant your ally a +2 circumstance bonus to the triggering check. If you’re a master with the check you attempted, the bonus is +3, and if you’re legendary, it’s +4.", null, null, new Guid("185abe1a-6c43-4884-bb8a-4f596e75442f"), null, "You grant your ally a +1 circumstance bonus to the triggering check." },
                    { new Guid("3d116422-8cc0-11eb-8dcd-0242ac130003"), null, null, null, null, new Guid("3367ce7a-8cc0-11eb-8dcd-0242ac130003"), null, "You fall gently, taking no damage from the fall." },
                    { new Guid("42f02449-6552-40db-adea-e635cb50c071"), "You don’t get free, and you can’t attempt to Escape again until your next turn.", "You get free and remove the grabbed, immobilized, and restrained conditions imposed by your chosen target. You can then Stride up to 5 feet.", null, null, new Guid("c2bcb0d1-7feb-4f52-8046-d630a6c8f09f"), null, "You get free and remove the grabbed, immobilized, and restrained conditions imposed by your chosen target." },
                    { new Guid("f5c01f9a-15de-47c0-8f65-470f0c4442dd"), "You continue to fall, and if you’ve fallen 20 feet or more before you use this reaction, you take 10 bludgeoning damage from the impact for every 20 feet fallen.", "You grab the edge or handhold, whether or not you have a hand free, typically by using a suitable held item to catch yourself (catching a battle axe on a ledge, for example). You still take damage from the distance fallen so far, but you treat the fall as though it were 30 feet shorter.", null, null, new Guid("90d27bd9-31ed-46f4-a174-467e165ed1b9"), null, "If you have at least one hand free, you grab the edge or handhold, stopping your fall. You still take damage from the distance fallen so far, but you treat the fall as though it were 20 feet shorter. If you have no hands free, you continue to fall as if you had failed the check." },
                    { new Guid("c6c59505-6b03-46fe-b154-1c303d7176e4"), null, "If you were searching for creatures, any undetected or hidden creature you critically succeeded against becomes observed by you. If you were searching for an object, you learn its location.", null, null, new Guid("ada1f776-2e98-4e7d-96e1-2166837fab6b"), null, "If you were searching for creatures, any undetected creature you succeeded against becomes hidden from you instead of undetected, and any hidden creature you succeeded against becomes observed by you. If you were searching for an object, you learn its location or get a clue to its whereabouts, as determined by the GM." },
                    { new Guid("e83cff43-911b-41f0-a5d3-e67bed0ca36b"), "You get a false sense of the creature’s intentions.", "You determine the creature’s true intentions and get a solid idea of any mental magic affecting it.", "You detect what a deceptive creature wants you to believe. If they’re not being deceptive, you believe they’re behaving normally.", null, new Guid("f715d730-9ad4-4922-b893-cda88fe25ea4"), null, "You can tell whether the creature is behaving normally, but you don’t know its exact intentions or what magic might be affecting it." },
                    { new Guid("9dab564c-885e-492a-a52e-af745342c53d"), null, "As success, but you deal double damage (page 451).", null, null, new Guid("577e96ba-5bf3-46e7-9f4b-eb5b71546bfd"), null, "You deal damage according to the weapon or unarmed attack, including any modifiers, bonuses, and penalties you have to damage." },
                    { new Guid("7030a780-545c-490c-a24b-e60f4107cf00"), "As failure, but hostile actions don’t end the dragon’s stun.", "The dragon is unaffected.", "The dragon is stunned for as long as the orb’s wielder Sustains the Activation.", null, new Guid("166a6ae1-4c1a-4942-8fe5-6cd825b31538"), null, "The dragon is stunned 3." },
                    { new Guid("3cc0c624-61bf-468d-bebb-0e34aba28189"), "As failure, and the target can't be brought back to life until the Radiant Spark is destroyed.", "The target is unaffected.", "The target dies and its essence is trapped within the Radiant Spark. It can be brought back to life only with powerful magic such as wish or miracle.", null, new Guid("3ea00a55-9847-4305-b64f-0213e3b41698"), null, "The target is drained 2." },
                    { new Guid("9e8de994-dbcb-446a-b539-7bb5cca5d953"), "The creature is transported to the First Vault. Unless it is capable of eluding Abadar’s precautions, it is likely unable to escape the Vault on its own.", "The creature is unaffected.", "The creature is transported to a random location on the plane of Axis.", null, new Guid("f7d637df-294b-418d-b058-6de02620a003"), null, "The creature is moved 1d20×50 feet in the direction you fired. If this causes it to hit a solid object, it takes 50 bludgeoning damage." },
                    { new Guid("ab1082ab-df6b-4a9d-880f-7ab186891b2f"), "You misidentify the spell as another spell entirely, of the GM’s choice.", "You correctly recognize the spell and gain a +1 circumstance bonus to your saving throw or your AC against it.", "You fail to recognize the spell.", null, new Guid("30763d23-d261-4295-b636-f94bca378bec"), null, "You correctly recognize the spell." },
                    { new Guid("a2a1dedd-eaa8-49bd-9189-7ce92039987e"), "The target is unaffected.", "The target must succeed at a Fortitude save against your Intimidation DC or die. If the target succeeds at its save, it becomes frightened 2 and is fleeing for 1 round; it suffers no effect on a critical success.", "The target becomes frightened 1.", null, new Guid("045ae2b1-ef9d-44a3-898d-8feb0832b94c"), null, "The target becomes frightened 2." },
                    { new Guid("e2d96fa8-70a4-45cf-b7a1-010a8790b583"), null, null, "The animal doesn’t learn the trick.", null, new Guid("d1d5b37b-2fcd-4699-892f-5c81cc437323"), null, "The animal learns the action. If it was an action the animal already knew, you can Command the Animal to take that action without attempting a Nature check. If it was a new basic action, add that action to the actions the animal can take when Commanded, but you must still roll." },
                    { new Guid("14481cdc-273c-4a73-9c45-58d2db7309f4"), "You can’t use the item, and you can’t try to trick it again until your next daily preparations.", null, "You can’t use the item or try to trick it again this turn, but you can try again on subsequent turns.", null, new Guid("219b84b9-cb31-44df-b37e-6bf4916e5dfb"), null, "For the rest of the current turn, you can spend actions to activate the item as if you could normally use it." },
                    { new Guid("6283d467-0532-441d-ac09-6a261d78d347"), "The target is confused.", null, "The target is stupefied 2.", null, new Guid("455a8767-4d85-45aa-a6eb-e39ad05640fe"), null, "The target is unaffected." },
                    { new Guid("e891f741-047b-440d-a5eb-78887054d97b"), "As failure, and the creature also takes a –1 status penalty to Perception checks and Will saves for 1 minute.", null, "The creature can’t use reactions and takes a –2 status penalty to Perception checks and Will saves.", null, new Guid("f7bb400c-ad59-4d72-8623-0de050005121"), null, "The creature is unaffected." },
                    { new Guid("92a9d6a3-3159-40c4-bbba-cb82adc5fb7b"), "The creature takes double damage and is immobilized for 1 round or until it Escapes.", "The creature is unaffected.", "The creature takes full damage and a –10-foot circumstance penalty to its Speeds for 1 round.", null, new Guid("1fc9723e-f16c-408e-bbc6-bb3f2640d92f"), null, "The creature takes half damage." },
                    { new Guid("f012fe31-9755-45e7-b53b-3700880cd2b6"), "The foe is frightened 2.", null, "The foe is frightened 1.", null, new Guid("4f04b1d5-321d-4271-a93d-6049c64883c8"), null, "The foe is unaffected." },
                    { new Guid("264f257d-1f6e-4fae-855b-e51857547510"), "The condition’s value is 2.", null, "The condition’s value is 1.", null, new Guid("ec613e4a-7d8a-4081-822f-cb21d81bcbcc"), null, "The target is unaffected." },
                    { new Guid("42976bf4-1071-4396-96d2-816420011f37"), null, "The target is unaffected.", "Effects as described in the text.", null, new Guid("85845094-40e3-40cf-8295-8c8e49a4b6fd"), null, "The target heals half as much from heal and takes half as much damage from harm for 1 round." },
                    { new Guid("651afaa5-1173-4e8f-94a3-aec89cbfcada"), "The target falls safely up to 120 feet. If it hits the ground, it can’t Fly, levitate, or otherwise leave the ground for 1 minute.", "The target is unaffected.", "The target falls safely up to 120 feet. If it hits the ground, it can’t Fly, levitate, or otherwise leave the ground for 1 round.", null, new Guid("e5258901-d960-4efd-ba40-638b73841ccb"), null, "The target falls safely up to 120 feet." },
                    { new Guid("66178f73-c84d-45fe-8d92-60e9b9b440e5"), null, "The composition lasts 4 rounds.", "The composition lasts 1 round, but you don’t spend the Focus Point for casting this spell.", null, new Guid("0e4908a4-698a-4010-8598-333efc7d6acd"), null, "The composition lasts 3 rounds." },
                    { new Guid("7fe9d37a-eb08-4599-b1b4-c8170c0d0f5a"), "The target is frightened 3.", "The target is unaffected.", "The target is frightened 2.", null, new Guid("5563c71a-59ae-42d3-8d5a-a6d70106135b"), null, "The target is frightened 1." },
                    { new Guid("8f4531ff-e507-44b7-8e9c-e2e2d08de426"), "The target can’t use reactions and is slowed 2.", "The target is unaffected.", "The target can’t use reactions and is slowed 1.", null, new Guid("43cd8c45-8865-4690-bddd-0f8401e88ba9"), null, "The target can’t use reactions." },
                    { new Guid("17932042-701a-4d9e-a3f9-951982d7c114"), null, "The target is slowed 2 and must attempt a Fortitude save at the end of each of its turns; this ongoing save has the incapacitation trait. On a failed save, the slowed condition increases by 1 (2 on a critical failure). A successful save reduces the slowed condition by 1. When a creature is unable to act due to the slowed condition from medusa’s wrath, it is petrified permanently. The spell ends if the creature is petrified or the slowed condition is removed.", null, null, new Guid("a5609f28-d70a-4ee1-a530-dfbd26dd4102"), null, "As critical success, but the target is initially slowed 1." },
                    { new Guid("63369615-2e19-41d2-9129-df4eb043120c"), "As failure, but the target takes double the persistent bleed damage.", "The target is unaffected.", "The target takes the full persistent bleed damage. Until the bleeding stops, the target has weakness 1 to piercing and slashing damage.", null, new Guid("4857d481-64c1-48ab-a938-c879775e6904"), null, "The target takes half the persistent bleed damage." },
                    { new Guid("ca435a76-e666-4d33-8087-ca973e4cd537"), "As failure, but hostility doesn’t end the effect.", "The creature is unaffected.", "Any emotion effects that would affect the creature are suppressed and the creature can’t use hostile actions. If the target is subject to hostility from any other creature, it ceases to be affected by calm emotions.", null, new Guid("3a2a1f6e-f8d9-465d-94cc-1253a5c42062"), null, "Calming urges impose a –1 status penalty to the creature’s attack rolls." },
                    { new Guid("078d384d-d0b9-4622-bd2e-80b7c4f3498b"), "As failure, except the duration is 4 rounds, and the target must repeat the effects of failure on each of its turns. At the end of each of its turns, the target can attempt a new Will save to reduce the remaining duration by 1 round, ending it entirely on a critical success.", "The target is unaffected.", "On its next turn, before it does anything else, the target must present the nearest creature with an item in its possession; the target chooses which item to give, and if the only item it has is one that it's currently using to defend itself, such as a weapon during a combat encounter, it can choose to be stunned for 1 round instead of giving up the item. This might require the target to Interact to retrieve an item or move to reach the nearest creature, and handing the item to the target always requires an Interact action.", null, new Guid("55c19e3c-6035-49cd-adf7-4de4f6a72961"), null, "The target is stunned 1 as it wrestles with the urge." },
                    { new Guid("ace65902-0a3b-4cec-acb6-6f8282687977"), "The target’s attitude becomes helpful toward you, and it can’t use hostile actions against you.", "The target is unaffected and aware you tried to charm it.", "The target’s attitude becomes friendly toward you. If it was friendly, it becomes helpful. It can’t use hostile actions against you.", null, new Guid("41b3515e-c59f-4ac6-92a2-ef16195cd647"), null, "The target is unaffected but thinks your spell was something harmless instead of charm, unless it identifies the spell (see Identifying Spells on page 305)." },
                    { new Guid("c067daf9-15b6-4f2a-9bac-303584f7f85d"), null, "The target takes double damage.", null, null, new Guid("fc8ec088-6c8d-4d90-9293-9fc0720a3855"), null, "The target takes full damage." },
                    { new Guid("d2565fe3-8343-45fe-bd54-acdd4449f4ad"), "The creature takes double damage and takes a –10-foot status penalty to its Speeds for 2 rounds.", "The creature is unaffected.", "The creature takes full damage and takes a –5-foot status penalty to its Speeds for 2 rounds.", null, new Guid("99025d40-d031-4e17-8f6e-4c1f95732557"), null, "The creature takes half damage." },
                    { new Guid("1b55e18e-951e-4911-9a9e-a6c1a65f7c7d"), "As failure, but the creature is permanently enfeebled 2 and drained 2 (although magic such as restoration can reduce or remove these conditions).", "The target is unaffected.", "The target is enfeebled 2 for 1 minute and drained 1. The target is also filled with listlessness and ennui. For 1 round, if the target tries to use a move action, it must succeed at a Will save against your spell DC or the action is lost; this effect has the mental and emotion traits.", null, new Guid("b0e36984-8d28-4b95-a9af-fd163fb1b05c"), null, "The target is enfeebled 2 for 1 round." },
                    { new Guid("1396db52-7879-4bee-afcb-71cc424a3726"), "The attacker is stunned for 1 round. The creature is temporarily immune until the end of its turn; this effect has the incapacitation trait.", null, "The attacker is blinded for 1 round.", null, new Guid("2c2d2218-3a46-4075-899c-c4e9353aaec3"), null, "The attacker is unaffected." },
                    { new Guid("1220f4e1-8504-4702-9fcc-5318b162bb12"), null, "The target can teleport if it wants, but it chooses the destination within range.", "You teleport the target and choose its destination.", null, new Guid("f3fa6c93-ee1d-4da1-982d-55c015c0eeaa"), null, "The target is unaffected." },
                    { new Guid("c5391ad6-09cd-42a9-ac94-74f04f4efc97"), "The creature is stunned for 1 round and blinded for 1 minute.", "The creature is unaffected.", "The creature is stunned 1, blinded for 1 round, and dazzled for 1 minute.", null, new Guid("060ba321-f5b9-4ac8-907c-fec7bb740713"), null, "The creature is dazzled for 1 round." },
                    { new Guid("45c9b2e8-2604-494e-a500-7f16a680eb4c"), "The target must use all its actions on its next turn to obey your command.", null, "For the first action on its next turn, the creature must use a single action to do as you command.", null, new Guid("4d709d69-ddde-487c-94a3-c876b4e79969"), null, "The creature is unaffected." },
                    { new Guid("c52f431c-b8b3-4c0b-946d-1491a8e5168f"), "The target is confused for 1 minute, with no save to end early.", "The target is unaffected.", "The target is confused for 1 minute. It can attempt a new save at the end of each of its turns to end the confusion.", null, new Guid("068fc3bd-e1ac-4069-8a29-13bd1a0b92f2"), null, "The target babbles incoherently and is stunned 1." },
                    { new Guid("6a073760-7f3c-41ea-adbc-276607b88ece"), "The target takes double damage, is stupefied 1 for 1 round, and can’t cast divine spells for 1 round.", "The target is unaffected.", "The target takes full damage; if the target can cast divine spells, it’s stupefied 1 for 1 round.", null, new Guid("b7157338-c1de-4e79-a90c-e0f62abd709c"), null, "The target takes half damage." },
                    { new Guid("48a3785a-a84b-4290-9316-b41d51744c0a"), "As failure, and the creature is automatically slowed 1 for 1 minute.", "The creature is unaffected.", "As success, but the duration is 1 minute.", null, new Guid("2665ca32-131c-43cd-b30b-c763eb024a08"), null, "For 1 round, the creature can’t use reactions and must attempt another save at the start of its turn; on a failure, it is slowed 1 for that turn as it sobs uncontrollably." },
                    { new Guid("66aa3c5c-3343-4b3e-9c38-4456a9c4f3e1"), "As success, with an unlimited duration.", "The living creature is unaffected.", "As success, with a duration of 1 hour.", null, new Guid("ddb80bc6-bafe-4cd7-8005-b490eccf9b82"), null, "The living creature briefly ages, becoming clumsy 1 and enfeebled 1 for 1 round." },
                    { new Guid("fa67be43-2108-4e4d-ab58-18edad117031"), "The target is deafened permanently.", "The target is unaffected.", "The target is deafened for 10 minutes.", null, new Guid("509c9a55-433c-4f99-8a7a-609d38f23ed1"), null, "The target is deafened for 1 round." },
                    { new Guid("1d97f155-61d4-4e3e-b56a-5db39776f857"), null, "The target is unaffected.", "The target dies.", null, new Guid("236cd0a3-a07b-4c9f-ba11-e3c113d91634"), null, "The target’s dying value increases by 1." },
                    { new Guid("7a397e05-ef94-4531-a4d8-24e4596d37c7"), "The effect’s duration is 1 hour.", "The target is unaffected.", "The effect’s duration is 10 minutes.", null, new Guid("c1546cbd-ec60-459f-b7f5-e29d51beb5f2"), null, "The effect’s duration is 1 minute." },
                    { new Guid("7c7d9f59-2899-4af7-9596-cf6a7711da5a"), "The creature is also enfeebled 1 for 1 round.", null, null, null, new Guid("db143e7b-8212-4350-a09f-09205811470e"), null, null },
                    { new Guid("1d9d9b1c-7036-46dd-9067-f132780d776c"), "The creature takes double damage and is enfeebled 2 for 1 minute. On your home plane, a creature that critically fails is banished with the effect of a failed banishment save. A 10th-level creature or lower must attempt a Will save. On a failure, it’s paralyzed for 1 minute; on a critical failure, it dies.", "The creature is unaffected.", "The creature takes full damage and is enfeebled 2 for 1 minute.", null, new Guid("7ebf76e9-a8fb-49a1-956c-f97f784dcbb9"), null, "The creature takes half damage." },
                    { new Guid("ceca903c-5829-4492-986c-aa6c1cfbd56a"), "The creature takes full damage and is sickened 2; while it is sickened, it is also slowed 1.", "The creature is unaffected.", "The creature takes full damage and is sickened 1.", null, new Guid("ca290cb0-c098-416f-b5dd-186fae2d6e18"), null, "The creature takes half damage." },
                    { new Guid("498c833f-4067-49b1-92f5-efdaf10c41fa"), "The target becomes frightened 2 and takes double the persistent fire damage.", "The target is unaffected.", "The target becomes frightened 1 and takes the full persistent fire damage.", null, new Guid("9ad5da73-93c5-4435-9cae-ad6c62ddccf9"), null, "The target takes half the persistent fire damage." },
                    { new Guid("54cb3487-b80d-41af-b5e0-12d932bd7f54"), "As success, but the target grows four blisters.", "The target is unaffected.", "As success, but the target grows two blisters.", null, new Guid("94850785-73d1-4280-a54b-a9db22a2f46b"), null, "The target grows one blister. You can spend a single action, which has the concentrate trait, to pop a blister. The target and each creature in a 15-foot cone originating from the target takes 7d6 acid damage (basic Fortitude save). You choose the direction of the cone, which can’t include the target. When no blisters are left, the spell ends." },
                    { new Guid("d73baad1-0303-486e-a14d-60401dc5e779"), "The creature takes double damage and is pushed 10 feet.", "The creature is unaffected.", "The creature takes full damage and is pushed 5 feet.", null, new Guid("534d8987-816c-49a1-a46f-08887f855b83"), null, "The creature takes half damage." },
                    { new Guid("2130dd1b-4239-4b15-9565-f962a6bf3cee"), "The target is blinded permanently.", "The target is unaffected.", "The target is blinded for 1 minute.", null, new Guid("3a320d74-73e9-40ab-a972-eb6b571f21fd"), null, "The target is blinded until its next turn begins." },
                    { new Guid("3dc15c3d-d43c-4c69-9433-7252c704376a"), "The target dies.", "The target survives, the spell ends, and the target is then temporarily immune for 24 hours.", "The target is stunned 3 and takes 80 damage. The spell’s duration continues, but the target is then temporarily immune for 24 hours against being killed by quivering palm.", null, new Guid("a0300663-253b-4a61-a986-adfc0dd8022f"), null, "The target is stunned 1 and takes 40 damage, the spell ends, and the target is then temporarily immune for 24 hours." },
                    { new Guid("35de6101-4e70-4304-ac09-f031d17edb34"), "The creature takes double damage and is stunned 1, enfeebled 2 for 1 round, and immobilized for 1 round or until it Escapes, whichever comes first.", "The creature is unaffected.", "The creature takes full damage and is enfeebled 2 for 1 round.", null, new Guid("0a2a8d57-780a-4221-9135-44163b82d0a3"), null, "The creature takes half damage and is enfeebled 1 for 1 round." },
                    { new Guid("27601d94-91eb-4324-bfec-4edd01ab326f"), "The target is frightened 2 and takes double damage.", "The target is unaffected.", "The target is frightened 1 and takes full damage.", null, new Guid("161689fc-881b-4888-b108-46f0bab8373c"), null, "The target takes half damage." },
                    { new Guid("4d991e1a-9a88-4e78-8f30-ee8dbcfbc38a"), "As failure, but the target (or the creature previously controlling it) receives a new save only if you give it a new order that is against its nature.", "The target is unaffected.", "The target becomes controlled by you and follows your orders. It (or the creature previously controlling it) can attempt a new Will save at the end of each of its turns, and the spell ends on a success. If you issue an obviously self-destructive order, the target doesn’t act until you issue a new order.", null, new Guid("669facf8-143b-42c8-8ffe-07f6461fce0a"), null, "The target is stunned 1 as it fights off your commands." },
                    { new Guid("ecfdb38b-83db-4a76-abaf-223a38c2c202"), "As failure, except the creature is frightened 3.", "The creature is unaffected.", "As success, and the creature becomes frightened 1 from the revelation of its dread secret.", null, new Guid("1ff088f8-98f6-4a8e-b15d-bedfe91cb20c"), null, "The creature takes 1 damage of the type of weakness you chose (thus triggering the creature’s weakness), or loses its resistance until the end of your next turn if you chose a resistance." },
                    { new Guid("ce1a6ed1-c1cd-4761-a376-417ebc3de70f"), "The creature takes double damage and becomes drained 2.", "The creature is unaffected.", "The creature takes full damage and becomes drained 1.", null, new Guid("de8437fe-a9a2-4e25-b69a-9af413281871"), null, "The creature takes half damage." },
                    { new Guid("86e51afa-81ff-42ec-afb2-5bd6265ac87e"), "The creature takes double damage and is dazzled for 1 minute.", "The creature is unaffected.", "The creature takes full damage and is dazzled for 3 rounds.", null, new Guid("849ede9e-7dd9-434e-89e7-a2f10636bb08"), null, "The creature takes half damage and is dazzled for 1 round." },
                    { new Guid("72f653df-221d-4d57-b0bc-e8a367e2344a"), "As failure, but the target takes double damage.", "The target is unaffected.", "The target takes full damage and a –10-foot circumstance penalty to its Speeds until the end of your next turn.", null, new Guid("63252b43-57d0-40fc-a734-b871d24d7fef"), null, "The target takes half damage and a –5-foot circumstance penalty to its Speeds until the end of your next turn." },
                    { new Guid("312a93b8-0a85-4dc6-b0df-3c5c453aa656"), "The creature takes double damage and is deafened for 1 hour.", "The creature is unaffected.", "The creature takes full damage and is deafened for 1 minute.", null, new Guid("d9b56679-1f96-415d-aa40-a833baf1cfea"), null, "The creature takes half damage." },
                    { new Guid("452a348a-c5c8-44eb-8ebd-9febeee168ac"), "The creature is blinded for 1 minute.", "The creature is unaffected.", "The creature is blinded until the start of its next turn.", null, new Guid("23bf8fed-66e0-4e3b-b0bc-629ddf8dddfc"), null, "The creature is dazzled until the start of its next turn." },
                    { new Guid("cbe04376-fd3e-4efa-8a70-e4b123ea307a"), "As a failure, but the target receives a new save only if you give it a new order that is against its nature, such as killing its allies.", "The target is unaffected.", "You control the target. It gains the controlled condition, but it can attempt a Will save at the end of each of its turns. On a success, the spell ends.", null, new Guid("f60c59d1-d117-4f9a-8ef1-ef4defab2bf8"), null, "The target is stunned 1 as it fights off your commands." },
                    { new Guid("d8588315-b375-4717-b515-40bbf1ef0132"), "The creature is absorbed into the shadows, where it can be seen below the surface; it takes double damage and is immobilized for 1 round or until it Escapes.", "The creature is unaffected.", "As success, but the creature takes full damage and a –10-foot circumstance penalty.", null, new Guid("7012c0eb-05c1-453e-8b87-411bcde2ec1a"), null, "The creature sinks partially into the shadow, taking half damage and a –5-foot circumstance penalty to its Speeds for as long it remains in the area." },
                    { new Guid("f7a2ba9f-e7ad-4cb2-9bba-2b2b8e60eb71"), "The creature takes double damage and a –1 status penalty to Will saves against emotion effects for 1 minute.", "The creature is unaffected.", "The creature takes full damage and takes a –1 status penalty to Will saves against emotion effects for 1 round.", null, new Guid("7d43752d-dbc7-4401-8260-0f3db0d3eb6f"), null, "The creature takes half damage." },
                    { new Guid("a44af360-dbd7-4b76-b745-99d0229b8d44"), "As failure, but the target is enfeebled 2.", "The target is unaffected.", "The target takes 3d4 negative damage and is enfeebled 1 for the spell’s duration as you tear its shadow away, collecting it in your hand. On subsequent rounds, when you Sustain the Spell, you can throttle the shadow to deal 3d4 negative damage to the target (basic Fortitude save). Until the spell ends, the target doesn’t cast a shadow.", null, new Guid("da0e4506-bacf-4e0d-9f16-508d69f27450"), null, "The target is enfeebled 1 for 1 round." },
                    { new Guid("574e5ece-6cd8-4d6e-9fdd-4a410f3feccc"), "As failure, and the target takes a –1 status penalty to AC for the duration.", "The target is unaffected.", "The target takes the penalties for 1 minute.", null, new Guid("b7240ad4-33a6-4720-848e-ef942b1139d7"), null, "The target takes the penalties for 1 round." },
                    { new Guid("0450af9d-7660-403b-8970-5515635a7779"), "The target is afflicted with Abyssal plague at stage 2.", "The target is unaffected.", "The target is afflicted with Abyssal plague at stage 1.", null, new Guid("328dda55-0bc8-461f-a3d3-686df512438c"), null, "The target takes 2 evil damage per spell level, and takes a –2 status penalty to saves against Abyssal plague for 1 day or until the target contracts it, whichever comes first." },
                    { new Guid("6b99906a-3610-4acc-8352-a9220d0ca336"), "The target takes double damage and becomes frightened 3.", "The target is unaffected.", "The target takes full damage and becomes frightened 2.", null, new Guid("28398964-187e-44ff-89e7-8d58042832c7"), null, "The target takes half damage and becomes frightened 1." },
                    { new Guid("f5e8d362-20e3-4342-bd65-73ca29c1825b"), "The target is transformed into the chosen harmless animal, body and mind, for an unlimited duration.", "The target is unaffected.", "The target transforms for 1 minute but keeps its mind. If it spends all its actions on its turn concentrating on its original form, it can attempt a Will save to end the effect immediately.", null, new Guid("79fbdd8a-c496-4974-af00-14c3640841ab"), null, "The target’s body gains minor features of the harmless animal. Its insides churn as they partially transform, causing it to be sickened 1. When it recovers from the sickened condition, its features revert to normal." },
                    { new Guid("dd05b759-b382-42f9-bfef-e8600b2b28f9"), "The target is banished and can’t return by any means to the plane it’s banished from for 1 week.", "The target resists being banished and you are stunned 1.", "The target is banished.", null, new Guid("3a8c5edf-e86c-431a-a25a-bb90d590eb35"), null, "The target resists being banished." },
                    { new Guid("0e84ac8e-2c42-4bab-9493-9d3622462f91"), "As failure, but the duration is unlimited.", "The target is unaffected.", "The target transforms into a bestial form for 1 hour. The target becomes clumsy 1 and gains weakness 1 to silver. It gains a claw, hoof, horn, or jaws Strike (your choice) that uses the target’s unarmed Strike statistics except that the damage type changes to bludgeoning, piercing, or slashing, as appropriate. Whenever the target attempts to use any manipulate action, it must succeed at a DC 5 flat check or the action is lost.", null, new Guid("8aa48e8c-3054-445f-93e4-d45c5f8dfce3"), null, "The target’s body gains minor bestial features. Its insides churn as they partially transform, causing it to be clumsy 1 for 1 round. When it recovers from the clumsy condition, its features revert to normal and the spell ends." },
                    { new Guid("5cee3e8b-6f4f-4578-b8f7-64e4296ef481"), "The creature is confused and dazzled until the end of its next turn.", null, "The creature is dazzled until the end of its next turn.", null, new Guid("757e9c07-44df-4da9-8f1a-746fb2f7b296"), null, "The creature is unaffected." },
                    { new Guid("5bacd27a-8198-40b0-bc38-b183a2e7c0f4"), "As success, and for an unlimited duration, the first time each round the target damages a creature, it can’t observe that creature until the end of its turn. If it damages several creatures at once, the creature it can’t perceive is chosen randomly among those creatures.", "The target is unaffected.", "As success, and for 1 minute, every time the target damages you, it can’t observe you until the end of its turn.", null, new Guid("3cf65deb-73f3-4696-b6ef-f117c2c84297"), null, "The target can’t observe you until the end of its turn, and if you’re currently observed by it, you become hidden to it." },
                    { new Guid("81ea4c1f-1fa0-446f-9154-8f58665f5e10"), "As failure, and all spaces are difficult terrain for the target.", "The target disbelieves the illusion and is unaffected.", "For 1 minute, the target is stupefied 2 and can’t use reactions.", null, new Guid("12b35d4a-e05c-476d-a7d6-57a7beddeb28"), null, "For 1 round, the target is stupefied 2 and takes a –2 status penalty to any checks it makes to determine the effects of reactions." }
                });

