                {
                    { new Guid("3b6fc2fa-73ab-4b02-b435-a6a9ae683458"), 0, new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), "Fortitude saving throws allow you to reduce the effects of abilities and afflictions that can debilitate the body. They use your Constitution modifier and are calculated as shown in the formula below.", 0 },
                    { new Guid("44536dd5-2014-4d02-8216-094b8d14bc9f"), 1, new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), "Fortitude Saving Throw = d20 + Constitution Modifier + Proficiency Bonus + Other Bonuses + Other Penalties", 4 },
                    { new Guid("0247a36f-161f-4faf-8486-cc48fd55b554"), 0, new Guid("5048e38a-a47c-4832-b37f-fd3818eced35"), "Reflex saving throws measure how well you can respond quickly to a situation and how gracefully you can avoid effects that have been thrown at you. They use your Dexterity modifier and are calculated as shown in the formula below.", 0 },
                    { new Guid("e26a1fa8-a6b7-4703-9618-ce10204b5e1e"), 1, new Guid("5048e38a-a47c-4832-b37f-fd3818eced35"), "Reflex Saving Throw = d20 + Dexterity Modifier + Proficiency Bonus + Other Bonuses + Other Penalties", 4 },
                    { new Guid("c6213214-61d9-4f42-b3bd-6cad3d69df09"), 0, new Guid("a71929b0-9dff-492a-9bf9-8f9cadda198c"), "Will saving throws measure how well you can resist attacks to your mind and spirit. They use your Wisdom modifier and are calculated as shown in the formula below.", 0 },
                    { new Guid("78900027-b7dc-42e8-b5bd-e2da081f7356"), 1, new Guid("a71929b0-9dff-492a-9bf9-8f9cadda198c"), "Will Saving Throw = d20 + Wisdom Modifier + Proficiency Bonus + Other Bonuses + Other Penalties", 4 }
