                    { new Guid("10192375-7fe6-45b3-8c71-ba115631c971"), 0, new Guid("3d5bb8ea-5071-42ce-ad9e-de1d493d8f9c"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("b44bbbd7-63e5-4cde-886d-348ecf2ce823"), 0, new Guid("b6d05ce6-7316-478b-a1ba-7c6b0ef1f06f"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("9d48c25b-89dd-44bc-82d3-44df6be0f993"), 0, new Guid("8cf2dfea-4a24-42e9-8f92-6be9ac797bf1"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("25c89229-8277-4af1-b998-b4ad29360b0e"), 0, new Guid("bdf4316c-c274-4000-a465-f405a5a7304d"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("73e7a40d-f292-481e-a082-833f779be334"), 0, new Guid("30add66f-49ba-4c5c-8508-0bda08373780"), "The spell has a range of 30 feet. If you’re healing a living creature, increase the Hit Points restored by 8.", 0 },
                    { new Guid("8c462a78-74de-4210-9089-1835cf1efbaa"), 0, new Guid("b292a617-3d9c-4710-88dd-a9320974309e"), "The spell has a range of 30 feet. If you’re healing an undead creature, increase the Hit Points restored by 8.", 0 },
                    { new Guid("205f4382-e480-4865-84cf-f741a359cbd8"), 0, new Guid("4a82a596-b44d-49bc-b868-2ec563762e4f"), "You disperse positive energy in a 30-foot emanation. This targets all living and undead creatures in the burst.", 0 },
                    { new Guid("e50a00f4-7d4c-4adb-a70a-051a94492341"), 0, new Guid("126dfa60-527a-447c-9a44-85995e3f002f"), "You disperse negative energy in a 30-foot emanation. This targets all living and undead creatures in the area.", 0 },
                    { new Guid("a3089104-350f-42f5-a70a-7caff03af46e"), 0, new Guid("83d81777-aa02-4e02-8901-dc3d8217d152"), "If the hostile creature or danger forces the target to roll dice (a saving throw, for example), the target rolls twice and uses the higher result, and this spell gains the fortune trait. But if the hostile creature or danger is rolling against the target (an attack roll or skill check, for example), that hostile creature or danger rolls twice and uses the lower result, and this spell gains the misfortune trait.", 0 },
                    { new Guid("2c4f1310-5048-41ce-9a63-fded872ddb5b"), 0, new Guid("8bdd02a6-8dda-497a-ba4a-12add37c6fe7"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("fd9f6edb-53b8-4e8a-8848-d18c81f94428"), 0, new Guid("bebc6ba4-7e9e-42c5-b297-1d52a819747c"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("34d44bb3-61a3-47f1-9287-4b020d7d4b03"), 0, new Guid("d3cc5d05-cecf-4892-88ce-7996b01093e6"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("1b823b5c-97b9-4c4f-847a-bb023839f63a"), 0, new Guid("bd888bb8-4d74-488b-bf3a-7cf4801b7848"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("c0bafe58-4b72-4fb0-8b6a-1c3f40666859"), 0, new Guid("de97cc77-6c77-44ff-b110-1bcea84c127e"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("dc02bbc9-9d8f-4ece-963f-8581bb6634c3"), 0, new Guid("12086751-cbc3-4014-9acc-62c17315edf5"), "You expend a number of charges from the staff to cast a spell from its list.", 0 },
                    { new Guid("7bad1204-090d-49c9-9715-2c67e3f65046"), 0, new Guid("918fda0b-82ce-4626-933d-e0043019b088"), "You expend a number of charges from the staff to cast a spell from its list.", 0 }
