            migrationBuilder.InsertData(
                table: "Actions_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("386cc768-8cc0-11eb-8dcd-0242ac130003"), 0, new Guid("3367ce7a-8cc0-11eb-8dcd-0242ac130003"), "You attempt an Acrobatics check to slow your fall. The DC is typically 15, but it might be higher due to air turbulence or other circumstances.", 0 },
                    { new Guid("cb5d193c-21b9-44a4-8370-766b898ceae9"), 0, new Guid("185abe1a-6c43-4884-bb8a-4f596e75442f"), "You try to help your ally with a task. To use this reaction, you must first prepare to help, usually by using an action during your turn. You must explain to the GM exactly how you’re trying to help, and they determine whether you can Aid your ally.", 0 },
                    { new Guid("1a320b87-a7f6-4d18-b4e2-3ea5dd7008a6"), 0, new Guid("56d03917-ff05-4b95-9455-4cb2ccbc9a60"), "You prepare to use an action that will occur outside your turn. Choose a single action or free action you can use, and designate a trigger. Your turn then ends. If the trigger you designated occurs before the start of your next turn, you can use the chosen action as a reaction (provided you still meet the requirements to use it). You can’t Ready a free action that already has a trigger.", 0 },
                    { new Guid("23ce08c6-58c9-43a0-8028-aa462b266f98"), 1, new Guid("56d03917-ff05-4b95-9455-4cb2ccbc9a60"), "If you have a multiple attack penalty and your readied action is an attack action, your readied attack takes the multiple attack penalty you had at the time you used Ready. This is one of the few times the multiple attack penalty applies when it’s not your turn.", 0 },
                    { new Guid("60fe2d98-ba32-435e-ac1c-1abb6e8a5691"), 1, new Guid("185abe1a-6c43-4884-bb8a-4f596e75442f"), "When you use your Aid reaction, attempt a skill check or attack roll of a type decided by the GM. The typical DC is 20, but the GM might adjust this DC for particularly hard or easy tasks. The GM can add any relevant traits to your preparatory action or to your Aid reaction depending on the situation, or even allow you to Aid checks other than skill checks and attack rolls.", 0 },
                    { new Guid("135aadcd-6eaf-4401-909d-de2414c5ccbc"), 0, new Guid("90d27bd9-31ed-46f4-a174-467e165ed1b9"), "When you fall off or past an edge or other handhold, you can try to grab it, potentially stopping your fall. You must succeed at a Reflex save, usually at the Climb DC. If you grab the edge or handhold, you can then Climb up using Athletics.", 0 },
                    { new Guid("f2def960-90a3-4293-9649-24a380ce33e5"), 0, new Guid("4163f1f7-245b-4989-b4a9-8638d75f2cdc"), "You wait for the right moment to act. The rest of your turn doesn’t happen yet. Instead, you’re removed from the initiative order. You can return to the initiative order as a free action triggered by the end of any other creature’s turn. This permanently changes your initiative to the new position. You can’t use reactions until you return to the initiative order. If you Delay an entire round without returning to the initiative order, the actions from the Delayed turn are lost, your initiative doesn’t change, and your next turn occurs at your original position in the initiative order.", 0 },
                    { new Guid("36548991-704d-4a82-a2c4-0622eb57f728"), 0, new Guid("577e96ba-5bf3-46e7-9f4b-eb5b71546bfd"), "You attack with a weapon you’re wielding or with an unarmed attack, targeting one creature within your reach (for a melee attack) or within range (for a ranged attack). Roll the attack roll for the weapon or unarmed attack you are using, and compare the result to the target creature’s AC to determine the effect. See Attack Rolls on page 446 and Damage on page 450 for details on calculating your attack and damage rolls.", 0 },
                    { new Guid("4014c48b-23f3-4382-81c7-3b9e7c1eec47"), 0, new Guid("ed94ef79-c37c-4591-a520-557916925352"), "You release something you’re holding in your hand or hands. This might mean dropping an item, removing one hand from your weapon while continuing to hold it in another hand, releasing a rope suspending a chandelier, or performing a similar action. Unlike most manipulate actions, Release does not trigger reactions that can be triggered by actions with the manipulate trait (such as Attack of Opportunity).", 0 },
                    { new Guid("168a4329-2ae8-48a5-8fa6-a5508a9b1b86"), 1, new Guid("ed94ef79-c37c-4591-a520-557916925352"), "If you want to prepare to Release something outside of your turn, use the Ready activity.", 0 },
                    { new Guid("1345cbb1-4a0d-47e6-918f-f09fa0bd859b"), 0, new Guid("4384a058-8cc0-11eb-8dcd-0242ac130003"), "You avert your gaze from danger. You gain a +2 circumstance bonus to saves against visual abilities that require you to look at a creature or object, such as a medusa’s petrifying gaze. Your gaze remains averted until the start of your next turn.", 0 },
                    { new Guid("015a016b-90ec-42b1-9e9b-28c230d06999"), 0, new Guid("eb1f9f32-3d35-479a-a3e2-bf965e32fc3d"), "You dig your way through dirt, sand, or a similar loose material at a rate up to your burrow Speed. You can’t burrow through rock or other substances denser than dirt unless you have an ability that allows you to do so.", 0 },
                    { new Guid("ea4b9697-2a26-4b33-aa9d-f6908ab082e3"), 0, new Guid("5f770553-dac1-4377-8416-1a2a2e8f43be"), "You move 5 feet by crawling and continue to stay prone.", 0 },
                    { new Guid("609e4ef2-f376-48d0-8f70-620733c8b8d5"), 0, new Guid("e5d48006-5153-4ebf-a71e-401cc0bc3d4a"), "You fall prone.", 0 },
                    { new Guid("3fb46634-1f05-49e3-afbc-4cc2c1553980"), 0, new Guid("55bca308-af52-4da5-a1e4-a6c1059c5321"), "You press yourself against a wall or duck behind an obstacle to take better advantage of cover (page 477). If you would have standard cover, you instead gain greater cover, which provides a +4 circumstance bonus to AC; to Reflex saves against area effects; and to Stealth checks to Hide, Sneak, or otherwise avoid detection. Otherwise, you gain the benefits of standard cover (a +2 circumstance bonus instead). This lasts until you move from your current space, use an attack action, become unconscious, or end this effect as a free action.", 0 },
                    { new Guid("5055a0f7-a922-4b49-b57f-40938f30d803"), 0, new Guid("c2bcb0d1-7feb-4f52-8046-d630a6c8f09f"), "You attempt to escape from being grabbed, immobilized, or restrained. Choose one creature, object, spell effect, hazard, or other impediment imposing any of those conditions on you. Attempt a check using your unarmed attack modifier against the DC of the effect. This is typically the Athletics DC of a creature grabbing you, the Thievery DC of a creature who tied you up, the spell DC for a spell effect, or the listed Escape DC of an object, hazard, or other impediment. You can attempt an Acrobatics or Athletics check instead of using your attack modifier if you choose (but this action still has the attack trait).", 0 },
                    { new Guid("a92602b3-303e-448f-91a1-8cf3dbce6c5a"), 0, new Guid("31fb2827-6ed7-455e-b135-9f4893b298fb"), "You move through the air up to your fly Speed. Moving upward (straight up or diagonally) uses the rules for moving through difficult terrain. You can move straight down 10 feet for every 5 feet of movement you spend. If you Fly to the ground, you don’t take falling damage. You can use an action to Fly 0 feet to hover in place. If you’re airborne at the end of your turn and didn’t use a Fly action this round, you fall.", 0 },
                    { new Guid("2e208301-e15b-4adc-9929-d35835141a08"), 0, new Guid("99ab25a7-a541-4074-ae20-fb25b87520cd"), "You take a careful, short jump. You can Leap up to 10 feet horizontally if your Speed is at least 15 feet, or up to 15 feet horizontally if your Speed is at least 30 feet. You land in the space where your Leap ends (meaning you can typically clear a 5-foot gap, or a 10-foot gap if your Speed is 30 feet or more).", 0 },
                    { new Guid("d4aeb760-f7a2-4095-bc96-e2f70ab49b80"), 1, new Guid("99ab25a7-a541-4074-ae20-fb25b87520cd"), "If you Leap vertically, you can move up to 3 feet vertically and 5 feet horizontally onto an elevated surface.", 0 },
                    { new Guid("3628f76a-d2f7-4391-9282-f7812e69ae26"), 0, new Guid("b66bad20-3677-47eb-9344-c78e538adcd3"), "You use your hand or hands to manipulate an object or the terrain. You can grab an unattended or stored object, open a door, or produce some similar effect. You might have to attempt a skill check to determine if your Interact action was successful.", 0 },
                    { new Guid("37cbf292-bc7b-46d3-909a-0bf344afe97b"), 0, new Guid("ab48c6d8-a194-4595-8358-c751fdc934d8"), "You move onto the creature and ride it. If you’re already mounted, you can instead use this action to dismount, moving off the mount into a space adjacent to it.", 0 },
                    { new Guid("e9c5de9d-eef6-46d4-ae1b-0dee8958af0c"), 0, new Guid("187ebb2b-c829-4d40-81dd-414a48ea766e"), "You indicate a creature that you can see to one or more allies, gesturing in a direction and describing the distance verbally. That creature is hidden to your allies, rather than undetected (page 466). This works only for allies who can see you and are in a position where they could potentially detect the target. If your allies can’t hear or understand you, they must succeed at a Perception check against the creature’s Stealth DC or they misunderstand and believe the target is in a different location.", 0 },
                    { new Guid("e2a4876a-0d17-4bca-9874-8a0f708e39c3"), 0, new Guid("ada1f776-2e98-4e7d-96e1-2166837fab6b"), "You scan an area for signs of creatures or objects. If you’re looking for creatures, choose an area you’re scanning. If precision is necessary, the GM can have you select a 30-foot cone or a 15-foot burst within line of sight. You might take a penalty if you choose an area that’s far away.", 0 },
                    { new Guid("722290ac-d0fa-43f9-9406-291d071f0fc9"), 1, new Guid("ada1f776-2e98-4e7d-96e1-2166837fab6b"), "If you’re using Seek to search for objects (including secret doors and hazards), you search up to a 10-foot square adjacent to you. The GM might determine you need to Seek as an activity, taking more actions or even minutes or hours if you’re searching a particularly cluttered area.", 0 },
                    { new Guid("d666a8f0-877c-4b2d-8bac-7c3cbe35b525"), 2, new Guid("ada1f776-2e98-4e7d-96e1-2166837fab6b"), "The GM attempts a single secret Perception check for you and compares the result to the Stealth DCs of any undetected or hidden creatures in the area or the DC to detect each object in the area (as determined by the GM or by someone Concealing the Object). A creature you detect might remain hidden, rather than becoming observed, if you’re using an imprecise sense or if an effect (such as invisibility) prevents the subject from being observed.", 0 },
                    { new Guid("65547cff-999a-493d-a6c1-4f56d3f0662a"), 0, new Guid("f715d730-9ad4-4922-b893-cda88fe25ea4"), "You try to tell whether a creature’s behavior is abnormal. Choose one creature, and assess it for odd body language, signs of nervousness, and other indicators that it might be trying to deceive someone. The GM attempts a single secret Perception check for you and compares the result to the Deception DC of the creature, the DC of a spell affecting the creature’s mental state, or another appropriate DC determined by the GM. You typically can’t try to Sense the Motive of the same creature again until the situation changes significantly.", 0 },
                    { new Guid("d04ec0db-0e06-4422-963e-1161dcbc2ba9"), 0, new Guid("4deb6d4d-0808-4755-897e-412a0d6e1f21"), "You stand up from prone.", 0 },
                    { new Guid("1bf68b96-2ca3-4353-ab9a-657394acdadc"), 0, new Guid("1e0c25df-54a1-41f0-8f21-2f6cdc08f59a"), "You carefully move 5 feet. Unlike most types of movement, Stepping doesn’t trigger reactions, such as Attacks of Opportunity, that can be triggered by move actions or upon leaving or entering a square.", 0 },
                    { new Guid("9aea3dfc-ee32-48c0-b420-1e9ffbd3d318"), 1, new Guid("1e0c25df-54a1-41f0-8f21-2f6cdc08f59a"), "You can’t Step into difficult terrain (page 475), and you can’t Step using a Speed other than your land Speed.", 0 },
                    { new Guid("829f3140-7228-4996-8315-8302402acf15"), 0, new Guid("4293eca5-4b6c-42f2-8e22-cd09796984fd"), "You move up to your Speed.", 0 },
                    { new Guid("6a431cbd-e07c-41e9-b824-179847fe0207"), 2, new Guid("99ab25a7-a541-4074-ae20-fb25b87520cd"), "Jumping a greater distance requires using the Athletics skill.", 0 },
                    { new Guid("c9a4cd10-fd21-4bb9-a356-a47d4837599a"), 1, new Guid("4163f1f7-245b-4989-b4a9-8638d75f2cdc"), "When you Delay, any persistent damage or other negative effects that normally occur at the start or end of your turn occur immediately when you use the Delay action. Any beneficial effects that would end at any point during your turn also end. The GM might determine that other effects end when you Delay as well. Essentially, you can’t Delay to avoid negative consequences that would happen on your turn or to extend beneficial effects that would end on your turn.", 0 }
                });

