                    { new Guid("765217f4-2500-4b7c-aa75-073e48df6735"), 3, new Guid("e4a210a5-fee2-41fb-97bc-6244a9c79333"), "Non-cantrip spells without a duration gain a status bonus to their damage and healing equal to the spell's level." },
