                    { new Guid("aad5596d-15e7-4858-92bf-90426d94c329"), 0, new Guid("27d3bf9f-c660-45df-9e89-492027a410f1"), "2" },
                    { new Guid("c89542bb-4f57-4443-8f68-9663596f81c2"), 0, new Guid("a6d13064-96bc-4ef8-9c10-f355b69a773b"), "Gold or red." },
                    { new Guid("ba302e6a-e058-4f06-893e-98e2bf35cc21"), 2, new Guid("1799cadc-8298-4e3f-a2c9-855595bc24ad"), "Reflex." },
