                    { new Guid("dde93aa0-7bc6-414d-9ae0-81c68aae7d47"), 0, new Guid("1799cadc-8298-4e3f-a2c9-855595bc24ad"), "Black or copper." },
                    { new Guid("fbb1b6e3-847b-4514-9d04-bcad5b86a4de"), 1, new Guid("f24670a8-4ad0-4d3a-80e4-d1a17e8808ba"), "Skies" },
                    { new Guid("a343affe-523e-4573-b6bc-e960eeab1e43"), 2, new Guid("f24670a8-4ad0-4d3a-80e4-d1a17e8808ba"), "Bolts of lightning and flying debris." },
                    { new Guid("95dc97f6-d9a3-44fb-94e2-c216ee845a5a"), 3, new Guid("f24670a8-4ad0-4d3a-80e4-d1a17e8808ba"), "Bluedgeoning and electricity." },
