                    { new Guid("c7dbb56a-1236-4b69-88e9-059d65b05c6b"), 2, new Guid("59d365af-56c7-43f3-8361-c928974ff538"), "Acid and demonic shells." },
                    { new Guid("b044f702-6f8f-4353-b9cf-a15e2382aa3d"), 3, new Guid("59d365af-56c7-43f3-8361-c928974ff538"), "Acid and slashing" },
                    { new Guid("1a98ad22-efd6-40a2-83cd-defc27c90d1b"), 0, new Guid("0a1cbdb3-cc9e-4b91-ae08-9c9dc9425185"), "3" },
                    { new Guid("5e651b0d-93da-4ce2-aa39-4c378290acce"), 1, new Guid("0a1cbdb3-cc9e-4b91-ae08-9c9dc9425185"), "Frozen" },
                    { new Guid("3c5693c0-b521-487c-854e-575faef48671"), 2, new Guid("0a1cbdb3-cc9e-4b91-ae08-9c9dc9425185"), "Frigid air and ice." },
                    { new Guid("806a9c8f-b6b1-4e35-9788-ad2ee9edb58b"), 3, new Guid("0a1cbdb3-cc9e-4b91-ae08-9c9dc9425185"), "Bludgeoning and cold." },
                    { new Guid("419cda7d-5946-47e1-9be1-ca59c362c856"), 0, new Guid("c637f33b-5924-4cc6-85a2-cb75d7b5add9"), "4" },
                    { new Guid("5e0fbbd7-11cf-4926-ae54-4ebfd800e9dd"), 1, new Guid("c637f33b-5924-4cc6-85a2-cb75d7b5add9"), "Volcanic" },
                    { new Guid("e9630bd0-a5e6-4ebd-bc5d-f69c3ae3a0cb"), 2, new Guid("c637f33b-5924-4cc6-85a2-cb75d7b5add9"), "Jagged volcanic rocks and magma." },
                    { new Guid("048af3d4-dc26-4a3f-951e-59c5416cad93"), 3, new Guid("c637f33b-5924-4cc6-85a2-cb75d7b5add9"), "Fire and piercing." },
