            migrationBuilder.InsertData(
                table: "Creature",
                columns: new[] { "Id", "AlignmentId", "ArmorClass", "BurrowingSpeed", "CharismaModifier", "ConstitutionModifier", "DexterityModifier", "FlyingSpeed", "FortitudeAddendum", "FortitudeModifier", "HitPoints", "ImmunitiesId", "IntelligenceModifier", "LanguageAddendum", "LanguagesId", "Level", "Name", "PerceptionAddendum", "PerceptionModifier", "RaceId", "RarityId", "RecallKnowledgeId", "ReflexAddendum", "ReflexModifier", "Resistances", "SizeId", "SourcePageId", "StrengthModifier", "SummonedById", "TraitsId", "WalkingSpeed", "WillAddendum", "WillModifier", "WisdomModifier" },
