                    { new Guid("342e6d20-16d7-46bd-ac63-8d4669d81aec"), new Guid("dea91016-311a-4e85-9672-aa9bc2b5da99"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "Sterling artisan's tools give you a +1 item bonus to the check.", 2, 3, "Sterling", 50, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("b64044b3-3e0b-4f59-91e2-d6e5e70591f9"), new Guid("517b246c-ab2a-495b-8702-62e266d2251b"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "You gain a +1 item bonus to Athletics checks to Climb while using an extreme climbing kit.", 2, 3, "Extreme", 4000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("049b9e51-c47c-4c19-a731-5f9870b6bbd3"), new Guid("727c9745-f0dd-4c3d-b76f-ae806792d762"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "Explorer’s clothing is sturdy enough that it can be reinforced to protect you, even though it isn’t a suit of armor. It comes in many forms, though the most common sorts look like clerical vestments, monk’s garments, or wizard’s robes, as members of all three classes are likely to avoid wearing armor. For more information on explorer’s clothing, see its entry in the armor category.", 0, 0, "Explorer's", 10, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("8ef0365d-06c3-4dee-8a95-969554e85466"), new Guid("727c9745-f0dd-4c3d-b76f-ae806792d762"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "Fine clothing, suitable for a noble or royal, is made with expensive fabrics, precious metals, and intricate patterns. You can wear only one tool set of light Bulk with fine clothing, instead of the normal limit of 2 Bulk.", 0, 0, "Fine", 200, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("647baa6b-6932-45e7-bf06-e49d5770c68e"), new Guid("727c9745-f0dd-4c3d-b76f-ae806792d762"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "You gain a +1 item bonus to checks to Make an Impression on upper-class folk while wearing high-fashion fine clothing.", 0, 3, "High-Fashion Fine", 5500, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("6c3264fe-5dc2-495a-b742-27a5d5757c52"), new Guid("727c9745-f0dd-4c3d-b76f-ae806792d762"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "Winter clothing allows you to negate the damage from severe environmental cold and reduce the damage from extreme cold to that of severe cold.", 0, 0, "Winter", 40, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("b9d16599-0d0b-4db0-97b6-86043675f8d4"), new Guid("dde8580a-9312-438f-b404-125e1229dc4b"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "A levered crowbar grants you a +1 item bonus to Athletics checks to Force Open anything that can be pried open.", 2, 3, "Levered", 2000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("f9040db4-e4df-429a-9970-e1fe53d90f12"), new Guid("e428fd54-cd8a-4d30-b6e2-3c48a2490910"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "If you've crafted a large number of disguises, you can replenish your cosmetics supply with replacement cosmetics suitable for the type of your disguise kit.", null, 0, "Replacement Cosmetics", 10, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("2aa5120f-4773-407e-9347-0aced34e5780"), new Guid("e428fd54-cd8a-4d30-b6e2-3c48a2490910"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "An elite disguise kit adds a +1 item bonus to relevant checks.", null, 3, "Elite", 4000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("4560c10a-7046-4951-92d5-1b0d358e3ce4"), new Guid("e428fd54-cd8a-4d30-b6e2-3c48a2490910"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "If you've crafted a large number of disguises, you can replenish your cosmetics supply with replacement cosmetics suitable for the type of your disguise kit.", null, 3, "Elite Replacement Cosmetics", 50, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("d542a4a9-c904-4f82-a535-381329b4378d"), new Guid("48f8e6d1-38dd-4ae7-966b-d85778977991"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "Professional fishing tackle grants a +1 item bonus to checks to fish.", 2, 3, "Professional", 2000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("3f1f65a3-9956-4a35-8ff4-15c6e6e9a97b"), new Guid("00629e82-1fc3-4f7f-b81e-7750bdd86840"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "A virtuoso instrument gives a +1 item bonus to Performance checks using that instrument.", 2, 3, "Virtuoso", 5000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("297cce48-9ff9-42ab-b9a3-94a490f029bf"), new Guid("b65586b9-cfee-42b5-ab60-881766c60c2e"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "Expanded healer's tools provide a +1 item bonus to such checks.", 2, 3, "Expanded", 5000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("7a695b7c-0d9e-410e-a048-912ef33e8193"), new Guid("c39b02a3-8ad1-4b2a-99c9-a141e174f52f"), new Guid("bcd4ffa2-a04b-4a74-ae12-c839667caa71"), "A virtuoso instrument gives a +1 item bonus to Performance checks using that instrument.", 2, 3, "Virtuoso", 10000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("a33954b8-34d4-47bc-8a43-d7999bf649fa"), new Guid("6c60bda0-dcce-4507-980b-370cb919c9ed"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "A hooded lantern sheds light in a 30-foot radius (and dim light in the next 30 feet) and is equipped with shutters, which you can close to block the light. Closing or opening the shutters takes an Interact action.", 1, 0, "Hooded", 70, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("5ae2a0fc-0840-44a9-a9af-044ab1412416"), new Guid("6c60bda0-dcce-4507-980b-370cb919c9ed"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "A bull’s-eye lantern emits its light in a 60-foot cone (and dim light in the next 60 feet).", 1, 0, "Bull's Eye", 100, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("657fb33a-533a-4138-a4e1-b348704713d8"), new Guid("93f381c5-9d0f-4b47-a652-7ae50f5d5fb5"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Picking a poor lock requires two successful DC 15 Thievery checks.", 2, 0, "Poor", 20, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("40e0eb38-8162-4562-b875-743e53276321"), new Guid("93f381c5-9d0f-4b47-a652-7ae50f5d5fb5"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Picking a simple lock requires three successful DC 20 Thievery checks.", 2, 1, "Simple", 200, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("007d34fc-a615-4980-9e52-a48ad6380eeb"), new Guid("93f381c5-9d0f-4b47-a652-7ae50f5d5fb5"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Picking a good lock requires five successful DC 30 Thievery checks.", 2, 9, "Good", 20000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("8cc2785d-d1e9-4c35-8b60-3b9b7cc4dfcc"), new Guid("93f381c5-9d0f-4b47-a652-7ae50f5d5fb5"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Picking a superior lock requires six successful DC 40 Thievery checks.", 2, 17, "Superior", 450000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("ab61c34e-6bab-4c85-ad11-7cfaeaa20ac4"), new Guid("2ee4c581-edef-47ed-8654-086ee333d890"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Freeing a creature from poor manacles requires two successful DC 17 Thievery checks.", 2, 0, "Poor", 30, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("696b25d5-5498-4850-a214-dbb752e11696"), new Guid("2ee4c581-edef-47ed-8654-086ee333d890"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Freeing a creature from simple manacles three successful DC 22 Thievery checks.", 2, 1, "Simple", 300, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("0e173d1a-f0d6-48ef-99ad-2fa55099305e"), new Guid("2ee4c581-edef-47ed-8654-086ee333d890"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Freeing a creature from average manacles four successful DC 27 Thievery checks.", 2, 3, "Average", 2000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("2c92133b-cce0-431a-89dd-9cfb260387ce"), new Guid("2ee4c581-edef-47ed-8654-086ee333d890"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Freeing a creature from good manacles six successful DC 42 Thievery checks.", 2, 17, "Superior", 500000, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("fb9a0eb4-e301-45ff-a99f-5b1d3f129fea"), new Guid("19f6384c-7ccb-48a7-ba5a-610a8477aeb2"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), null, 1, 0, "Silver", 200, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("86ff25f4-1577-428f-b220-c271c58b8437"), new Guid("93f381c5-9d0f-4b47-a652-7ae50f5d5fb5"), new Guid("b5de3410-d051-4dfe-be54-dde62ee45bc1"), "Picking an average lock requires four successful DC 25 Thievery checks.", 2, 3, "Average", 1500, new Guid("52091c82-7a39-4a66-919e-ac268375b792") },
                    { new Guid("c35dfbc6-d401-45bc-bddd-7bba379f115d"), new Guid("473b09f6-8087-4fda-97df-103983c75d44"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "A hoe, shovel, or sledgehammer is a long tool. A tool can usually be used as an improvised weapon, dealing 1d6 for a long tool.", 2, 0, "Long", 100, new Guid("52091c82-7a39-4a66-919e-ac268375b792") }
                });

            migrationBuilder.InsertData(
                table: "AdventuringGear_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("9c6fea82-da67-4969-9ada-c5624a22b86c"), 0, new Guid("ca17eabb-a025-4f95-9f26-f5b4a6aeef15"), "Scholarly journals are uncommon. Each scholarly journal is a folio on a very specific topic, such as vampires or the history of a single town or neighborhood of a city. If you spend 1 minute referencing an academic journal before attempting a skill check to Recall Knowledge about the subject, you gain a +1 item bonus to the check. The GM determines what scholarly journals are available in any location.", 0 },
                    { new Guid("3911900e-01f1-4550-8aff-1ef5a08e45d1"), 0, new Guid("b9442cf7-650e-4ccc-aff0-26283af75863"), "You can use a net either on its own or attached to a rope. When attached to a rope, you can use the net to Grapple a Medium or smaller creature up to 10 feet away (instead of only adjacent creatures). You can continue to Grapple to keep your hold on the target so long as the target remains within 10 feet and you continue to hold the net. The grabbed creature gains a +2 circumstance bonus to Escape unless you are adjacent to them, and it can attempt a DC 16 Athletics check to Force Open the net entirely. Once the target is no longer grabbed, the net is unwieldy until refolded as a Concentrate action that requires two hands; if used without being refolded, Grapple checks made with the net take a –2 penalty.", 0 },
                    { new Guid("23946c49-c1db-4427-a817-c957a609b2d4"), 1, new Guid("b9442cf7-650e-4ccc-aff0-26283af75863"), "When the net is unattached, you can attempt a ranged attack roll against a Medium or smaller creature within 20 feet. On a hit, the target is flat-footed and takes a –10- foot circumstance penalty to its Speeds until it Escapes, and on a critical hit, it's also immobilized until it Escapes. The Escape DC is 16. A creature adjacent to the target can Interact to remove the net.", 0 },
                    { new Guid("13b0edc2-2f01-41b7-b409-812959ca0a25"), 0, new Guid("a905c052-59af-4d59-8e6b-3dddbe09675a"), "This is a 2-foot-long tube with two angled mirrors, one at each end. When the mirrors are aligned correctly, you can look around obstacles while remaining behind cover. This doesn't provide a sufficient line of effect to target creatures around corners.", 0 },
                    { new Guid("167bcff2-2a0d-4a34-acce-b5597857fc87"), 0, new Guid("727c9745-f0dd-4c3d-b76f-ae806792d762"), "Ordinary clothing is functional with basic tailoring, such as peasant garb, monk’s robes, or work clothes.", 0 },
                    { new Guid("3970cbc1-20a2-40c0-a96e-76985d7daec4"), 0, new Guid("15b26889-6851-4ce7-8387-3728a52158b5"), "A compass helps you Sense Direction or navigate, provided you're in a location with uniform magnetic fields. Without a compass, you take a –2 item penalty to these checks (similar to using a shoddy item).", 0 },
                    { new Guid("31ada62d-9058-48e4-bdb6-a90ed71e3026"), 0, new Guid("63c40f21-1e8c-4273-9bec-79fdbaaaa225"), "A lensatic compass gives you a + 1 item bonus to these checks.", 0 },
                    { new Guid("5a30e3c9-b0ed-4904-8b32-91fba52708b5"), 0, new Guid("e52c7a7c-7032-4cbf-8200-662ccaf96062"), "While the rulebooks do not explicitly mention the contents of 'cookware', it seems to be generally accepted that it contains generic items such as some pots and pans, plates, cutlery, a kettle, and perhaps a wooden board.", 0 },
                    { new Guid("12b0241f-8698-49f6-b434-bf1f664da277"), 0, new Guid("dde8580a-9312-438f-b404-125e1229dc4b"), "When Forcing Open an object that doesn't have an easy grip, a crowbar makes it easier to gain the necessary leverage. Without a crowbar, prying something open takes a –2 item penalty to the Athletics check to Force Open (similar to using a shoddy item).", 0 },
                    { new Guid("dff4bfc6-9f41-44aa-9d99-6139c02bfdf8"), 0, new Guid("e428fd54-cd8a-4d30-b6e2-3c48a2490910"), "This small wooden box contains cosmetics, false facial hair, spirit gum, and a few simple wigs. You usually need a disguise kit to set up a disguise in order to Impersonate someone using the Deception skill. You can draw and replace a worn disguise kit as part of the action that uses it.", 0 },
                    { new Guid("f46a0e3c-1746-40bc-8f13-fd6c86e3bd18"), 0, new Guid("48f8e6d1-38dd-4ae7-966b-d85778977991"), "This kit include a collapsible fishing pole, fishhooks, line, lures, and a fishing net.", 0 },
                    { new Guid("b03dccdb-ca14-4dea-b932-a6c3ec425c7d"), 0, new Guid("e4eb94ea-b8f5-4a36-936f-081fd7c559d4"), "Flint and steel are useful in creating a fire if you have the time to catch a spark, though using them is typically too time-consuming to be practical during an encounter. Even in ideal conditions, using flint and steel to light a flame requires using at least 3 actions, and often significantly longer.", 0 },
                    { new Guid("0c14c2f1-0917-475e-94bd-362b01cc6b05"), 0, new Guid("c2ab81a5-73f9-473d-ac8e-7d8f7008d7be"), "A formula book holds the formulas necessary to make items other than the common equipment from this chapter; alchemists typically get one for free. Each formula book can hold the formulas for up to 100 different items. Formulas can also appear on parchment sheets, tablets, and almost any other medium; there's no need for you to copy them into a specific book as long as you can keep them on hand to reference them.", 0 },
                    { new Guid("250c575e-96cb-4a61-abc9-5b431ba51640"), 0, new Guid("8bc78d1b-a9fb-4d45-8dd5-fe065566e23e"), "You can throw a grappling hook with a rope tied to it to make a climb easier. To anchor a grappling hook, make an attack roll with the secret trait against a DC depending on the target, typically at least DC 20. On a success, your hook has a firm hold, but on a critical failure, the hook seems like it will hold but actually falls when you're partway up.", 0 },
                    { new Guid("839bec74-61d4-4ff1-a907-aa13c8795bf4"), 0, new Guid("fc62d9dd-f547-49d9-9606-1cc49bb30621"), "A hammer is a tool, most often a hand tool, consisting of a weighted 'head' fixed to a long handle that is swung to deliver an impact to a small area of an object. This can be, for example, to drive nails into wood, to shape metal (as with a forge), or to crush rock. Hammers are used for a wide range of driving, shaping, breaking and non-destructive striking applications. Traditional disciplines include carpentry, blacksmithing, warfare, and percussive musicianship (as with a gong).", 0 },
                    { new Guid("0a91cfd8-1dbd-44e4-87a5-06ad81444ef7"), 0, new Guid("37411366-33fe-469f-93bb-02f2fed76911"), "This leather mat bears intricate designs and symbols embossed into them to enhance the mystique of a harrow reading. The mat provides a +1 item bonus to Deception, Diplomacy, and relevant Lore checks (such as Fortune-Telling Lore or Harrow Lore) to convince a creature that a harrow reading was accurate.", 0 },
                    { new Guid("ea4b6a3b-df9c-49e3-bce8-533e2c21c4de"), 0, new Guid("00629e82-1fc3-4f7f-b81e-7750bdd86840"), "Handheld instruments include bagpipes, a small set of chimes, small drums, fiddles and viols, flutes and recorders, small harps, lutes, trumpets, and similarly sized instruments. The GM might rule that an especially large handheld instrument (like a tuba) has greater Bulk.", 0 },
                    { new Guid("909f1c28-5412-4c02-ab01-e3b604adb323"), 0, new Guid("0674b7e7-35f2-4d29-96b6-c98ad8f99422"), "Used by gamblers and seers alike, this deck of cards comes in several varieties. Simple harrow decks are made from low-quality paper and typically have only an icon and a number to signify the suit and alignment. These simple decks are mostly used for games of chance, as the actual image and significance of the cards are irrelevant for such games.", 0 },
                    { new Guid("767ec192-efd1-4f95-b869-5754be5142b4"), 0, new Guid("e2e6da71-2f98-46c2-80eb-adb3ba10fcaa"), "You can pull a dueling cape you're wearing from your shoulder and wrap it around your arm with an Interact action. While wielding the dueling cape this way, the cape uses that arm and hand, and you can't hold anything else in that hand. While you do so, you can spend an action to hold it in a protective position, giving you a +1 circumstance bonus to AC and to Deception checks to Feint until the start of your next turn.", 0 },
                    { new Guid("89f73e16-1bc9-4b3e-8d80-bc2879ac23ac"), 0, new Guid("b65586b9-cfee-42b5-ab60-881766c60c2e"), "This kit of bandages, herbs, and suturing tools is necessary for Medicine checks to Administer First Aid, Treat Disease, Treat Poison, or Treat Wounds. If you wear your healer's tools, you can draw and replace them as part of the action that uses them.", 0 },
                    { new Guid("ccb1bc2d-5cf3-495b-b677-19dcfc8b54d8"), 0, new Guid("e4eeffb1-68b5-4846-be37-62118863014e"), "This leather satchel contains empty vials, a pair of tweezers, a supply of small linen cloths, a set of brass calipers and a knotted string for measuring distances, several pieces of chalk, a pen, and a blank notebook for keeping notes. Every component of a detective's kit is of exceeding quality, and thus a detective's kit adds a +1 item bonus to checks to investigate a crime scene, a clue, or similar details.", 0 },
                    { new Guid("e1ddcf8f-c273-4e3d-b8ad-976bd53e0fde"), 0, new Guid("2f13c997-9bf3-4722-8a85-c683c9867756"), "A brass ear is a short, flared tube with one end narrow enough to comfortably fit against the ear canal. When using a brass ear to listen through a door, window, thin wall, or similar barrier, if the barrier would normally increase the DC of your Perception check to hear sounds on the other side, the DC increases by only half as much as normal.", 0 },
                    { new Guid("f0165037-edad-4df1-997e-81daf61a4399"), 1, new Guid("29638790-400f-407e-8b44-0b25aff858cd"), "When worn with a breastplate, chain shirt, chain mail, or scale mail, an armored skirt increases the armor’s item bonus to AC by 1, worsens the armor’s check penalty by 1, reduces the armor’s Dex cap by 1, increases the Strength score required to ignore the check penalty and reduce the Speed penalty by 2, and adds the noisy trait. This also makes the armor one step heavier (from light to medium, or medium to heavy), and you use the proficiency bonus appropriate to this adjusted armor type.", 0 },
                    { new Guid("b47ed716-9fe1-4fa9-80be-b68a2c7dcc53"), 2, new Guid("29638790-400f-407e-8b44-0b25aff858cd"), "Alternatively, when wearing an armored skirt to replace appropriate portions of a set of half plate or full plate, reduce the armor’s item bonus to AC by 1, lessen the check penalty by 1, decrease the Strength score required to ignore the check penalty and reduce the Speed penalty by 2, increase the armor’s Dex cap by 1, and add the noisy trait to the armor. An armored skirt grants no benefit when worn by itself or with armors other than those listed here.", 0 },
                    { new Guid("1b9cbcf2-db94-447d-9633-d74ee300ce47"), 0, new Guid("0f20c6ab-6c7a-4f5c-9237-d83ed9bd3f19"), "This item is uncommon, but characters who are members of the Pathfinder Society have access to it.", 0 },
                    { new Guid("dd0c0f1c-cabe-41be-bed7-1ea9368d0150"), 1, new Guid("0f20c6ab-6c7a-4f5c-9237-d83ed9bd3f19"), "Numerous volumes and editions of the Pathfinder Chronicles exist, each cataloging different adventures. Pathfinder Chronicles are a type of scholarly journal that specifically devotes topics to Pathfinder discoveries, rather than more theoretical academic topics. Because Pathfinders have better access to these chronicles than other scholarly journals, they are particularly common among Pathfinder agents building a library of reference texts.", 0 },
                    { new Guid("da790c29-3bb6-4262-a3e8-bc4058fc18bc"), 0, new Guid("97f361db-58be-487f-a5aa-ced5e1a2197f"), "This item is the starter kit for an adventurer, containing the essential items for exploration and survival. The Bulk value is for the entire pack together, but see the descriptions of individual items as necessary.", 0 },
                    { new Guid("01d7deb6-06a4-4e24-88bb-145bf823125b"), 1, new Guid("97f361db-58be-487f-a5aa-ced5e1a2197f"), "The pack contains the following items: backpack (containing the other goods), bedroll, 10 pieces of chalk, flint and steel, 50 feet of rope, 2 weeks' rations, soap, 5 torches, and a waterskin.", 0 },
                    { new Guid("a6c0e44b-e2c7-46d4-92ce-cbaccf522278"), 0, new Guid("8f6a633a-5b05-499b-bcf7-459f0a4710f1"), "You need an alchemist's lab to Craft alchemical items during downtime.", 0 },
                    { new Guid("bfb8773e-71f4-42ee-bd96-b8dd4ed2630a"), 0, new Guid("9fbc54ea-d3f5-4fd8-8b5d-1b1cd539745e"), "This mobile collection of vials and chemicals can be used for simple alchemical tasks. If you wear your alchemist's tools, you can draw and replace them as part of the action that uses them.", 0 },
                    { new Guid("89e2759c-4a2d-41aa-8bdb-d1bfe921a06e"), 0, new Guid("dea91016-311a-4e85-9672-aa9bc2b5da99"), "You need these tools to create items from raw materials with the Craft skill. Different sets are needed for different work, as determined by the GM; for example, blacksmith's tools differ from woodworker's tools. If you wear your artisan's tools, you can draw and replace them as part of the action that uses them.", 0 },
                    { new Guid("e33ba36b-fe08-4558-80ff-a386ac5904cc"), 0, new Guid("4ca4df89-46d6-41aa-8467-078b97c85852"), "A backpack holds up to 4 Bulk of items. and the first 2 Bulk of these items don't count against your Bulk limits. If you're carrying or stowing the pack rather than wearing it on your back, its Bulk is light instead of negligible.", 0 },
                    { new Guid("333536c8-6a6d-4462-a8f7-67a8e5758830"), 0, new Guid("45716613-931a-42c5-8cb0-ce77190b1cb8"), "This book contains formulas for Crafting common items.", 0 },
                    { new Guid("d680c63c-d31e-4133-859e-7c464cb0fce9"), 0, new Guid("2e760e65-7138-4baf-8b51-9d7d08d02195"), "This consists of two woolen sheets sewn together along the bottom and one side to create a bag for sleeping in. Some have cloth straps along the open side so the bedroll can be tied closed while you are sleeping. It can be rolled and tied into a tight coil for storage or transport. Most people use a blanket with the bedroll to stay warm or provide a ground cushion.", 0 },
                    { new Guid("772aa19a-25d2-438a-a551-ad4f5c0091f6"), 0, new Guid("e6026e0d-1fe6-42c1-964b-767e0748b927"), "These four-pronged metal spikes can cause damage to a creature's feet. You can scatter caltrops in an empty square adjacent to you with an Interact action. The first creature that moves into that square must succeed at a DC 14 Acrobatics check or take 1d4 piercing damage and 1 persistent bleed damage. A creature taking persistent bleed damage from caltrops takes a –5-foot penalty to its Speed. Spending an Interact action to pluck the caltrops free reduces the DC to stop the bleeding. Once a creature takes damage from caltrops, enough caltrops are ruined that other creatures moving into the square are safe. Deployed caltrops can be salvaged and reused if no creatures took damage from them.Otherwise, enough caltrops are ruined that they can't be salvaged.", 0 },
                    { new Guid("128ea756-3037-4a98-9f85-e5ef0c7932e2"), 0, new Guid("bbf20e5e-8af9-46f4-9429-b7582e34eda4"), "A lit candle sheds dim light in a 10-foot radius for 8 hours.", 0 },
                    { new Guid("1359695a-751d-41a5-a4bc-31f1cd8baa62"), 0, new Guid("86a1f1d8-b158-4ec2-ab49-dc7795b59b48"), "A chain is a serial assembly of connected pieces, called links, typically made of metal, with an overall character similar to that of a rope in that it is flexible and curved in compression but linear, rigid, and load-bearing in tension. A chain may consist of two or more links.", 0 },
                    { new Guid("436c7e69-5810-4a56-902b-d7d7f9b47f2a"), 0, new Guid("aafa026c-7a02-4479-a20a-ddae6fbcd0b8"), "Chalk is a soft, white, porous, sedimentary carbonate rock, a form of limestone composed of the mineral calcite and originally formed deep under the sea by the compression of sub-microscopic plankton which had fallen to the sea floor.", 0 },
                    { new Guid("71f0bd1c-87f2-4c78-8d78-95e05d085bbe"), 0, new Guid("02af87d2-7224-4e7b-8b77-f10fec77b4e9"), "A wooden chest can hold up to 8 Bulk of items.", 0 },
                    { new Guid("426aa14e-ebd0-432b-b404-c2c10af93013"), 0, new Guid("68bb619b-f10d-4d94-a5a7-0cb71cc4ed69"), "This leather sheath is large enough to hold an item of up to light Bulk and is typically used for daggers, wands, thieves' tools, and similar objects. You can affix it to the inside of a boot, under a bracer or sleeve, or in other inconspicuous locations to gain a +1 item bonus to Stealth checks and DCs to hide or conceal the item within.", 0 },
                    { new Guid("ca009fd2-28f9-4c72-9f0e-4994134aec58"), 0, new Guid("c39b02a3-8ad1-4b2a-99c9-a141e174f52f"), "Heavy instruments such as large drums, a full set of chimes, and keyboard instruments are less portable and generally need to be stationary while being played.", 0 },
                    { new Guid("7b3f776e-63f5-412d-83c0-33b11f2c35c6"), 0, new Guid("ba1e620a-1e7f-49c8-904d-52ed144470f8"), "Plants of supernatural significance provide a primal focus for primal spellcasters, such as druids, when using certain abilities and casting some spells. A bundle of holly and mistletoe must be held in one hand to use it. Other primal foci exist for druids focused on other aspects of nature.", 0 },
                    { new Guid("01b9cb99-ab85-49ec-93ee-06f9b75b1c8f"), 0, new Guid("3e2b8309-41fd-4258-a236-ed5bbdcefec0"), "An hourglass (or sandglass, sand timer, or sand clock) is a device used to measure the passage of time. It comprises two glass bulbs connected vertically by a narrow neck that allows a regulated flow of a substance (historically sand) from the upper bulb to the lower one. Typically the upper and lower bulbs are symmetric so that the hourglass will measure the same duration regardless of orientation. The specific duration of time a given hourglass measures is determined by factors including the quantity and coarseness of the particulate matter, the bulb size, and the neck width.", 0 },
                    { new Guid("4e1e1d35-9b89-462d-a981-baa50eddd958"), 0, new Guid("53af75a3-f02a-4a31-8a6c-63c292192228"), "Saddlebags come in a pair. Each can hold up to 3 Bulk of items, and the first 1 Bulk of items in each doesn't count against your mount's Bulk limit. The Bulk value given is for saddlebags worn by a mount. If you are carrying or stowing saddlebags, they count as 1 Bulk instead of light Bulk.", 0 },
                    { new Guid("3caa046c-fb10-414e-993a-b6f2516f2133"), 0, new Guid("a4a36408-ce6b-4f60-b6eb-fe4dfb274319"), "Using a writing set, you can draft correspondence and scribe scrolls. A set includes stationery, including a variety of paper and parchment, as well as ink, a quill or inkpen, sealing wax, and a simple seal.", 0 },
                    { new Guid("79fefac6-d163-4598-aa5f-b74521c02b83"), 1, new Guid("ca17eabb-a025-4f95-9f26-f5b4a6aeef15"), "All characters have access to the scholarly journal, scholarly journal compendium, survey map, and survey map atlas.", 0 },
                    { new Guid("364a65b0-7803-4df4-8b77-6850ddbae75f"), 0, new Guid("6f279ee2-bc01-424a-b17e-458c8d58b303"), "When sounded, a signal whistle can be heard clearly up to half a mile away across open terrain.", 0 },
                    { new Guid("97e6acf4-927d-48af-bc1f-2771b9f6a96b"), 0, new Guid("9262e9cf-8696-45b1-9612-88a1a91fd7cc"), "This kit contains tools and materials for creating snares. A snare kit allows you to Craft snares using the Crafting skill. You can draw and replace a worn snare kit as part of the action to use it.", 0 },
                    { new Guid("5c282672-4682-48a9-acbc-390174e39d36"), 0, new Guid("bc8f44fc-727d-4528-a277-bcc88c5f6028"), "Soap is a salt of a fatty acid used in a variety of cleansing and lubricating products. In a domestic setting, soaps are surfactants usually used for washing, bathing, and other types of housekeeping. In industrial settings, soaps are used as thickeners, components of some lubricants, and precursors to catalysts.", 0 },
                    { new Guid("6bb4e722-12ee-4eb4-a867-b9f1861876db"), 0, new Guid("7787539a-8ec2-461f-9c9a-92b7f8e090b2"), "When it’s full, a waterskin contains roughly 1 day’s worth of water for a Small or Medium creature.", 0 },
                    { new Guid("b4b6d8b8-e2aa-41d4-a74a-e8b6c910b5fc"), 0, new Guid("e71752ce-5078-41c3-a4bd-8313073efd3d"), "A torch sheds bright light in a 20-foot radius (and dim light to the next 20 feet) for 1 hour. It can be used as an improvised weapon that deals 1d4 bludgeoning damage plus 1 fire damage.", 0 },
                    { new Guid("ba51c149-5e99-44be-8fe4-6941b41d481a"), 0, new Guid("473b09f6-8087-4fda-97df-103983c75d44"), "This entry is a catchall for basic hand tools that don’t have a specific adventuring purpose. A hoe, shovel, or sledgehammer is a long tool, and a hand drill, ice hook, or trowel is a short tool. A tool can usually be used as an improvised weapon, dealing 1d4 damage for a short tool or 1d6 for a long tool. The GM determines the damage type that’s appropriate or adjusts the damage if needed.", 0 },
                    { new Guid("78ddb9c5-934d-4a09-90f1-c88dbc1b38f1"), 0, new Guid("b14bf18a-759f-4e77-9d24-b631f31797e5"), "A spellbook holds the written knowledge necessary to learn and prepare various spells, a necessity for wizards (who typically get one for free) and a useful luxury for other spellcasters looking to learn additional spells. Each spellbook can hold up to 100 spells. The Price listed is for a blank spellbook.", 0 },
                    { new Guid("08f152c3-8c0e-4c63-a26b-67db03030021"), 0, new Guid("6afd5c23-72ad-48e0-bb63-6dec160c3e73"), "A typical spyglass lets you see eight times farther than normal.", 0 },
                    { new Guid("ea003b92-0cfb-48a6-926b-af438b7df2e9"), 0, new Guid("3b87d2b2-c05c-42b1-a7d5-9682e65aff87"), "Maps are uncommon. Most maps you can find are simple and functional. A survey map details a single location in excellent detail. One of these maps gives you a +1 item bonus to Survival checks and any skill checks to Recall Knowledge, provided the checks are related to the location detailed on the map.", 0 },
                    { new Guid("1c23e4bd-0eb1-49f8-a154-ef25ccb88a61"), 1, new Guid("3b87d2b2-c05c-42b1-a7d5-9682e65aff87"), "The GM determines what maps are available in any location.", 0 },
                    { new Guid("b136ce98-72fc-4270-a6e8-55a8f4fe90e8"), 0, new Guid("ef7d64e3-04b3-4af5-9c92-47885fc41838"), "Tack includes all the gear required to outfit a riding animal, including a saddle, bit and bridle, and stirrups if necessary. Especially large or oddly shaped animals might require specialty saddles. These can be more expensive or hard to find, as determined by the GM. The Bulk value given is for tack worn by a creature. If carried, the Bulk increases to 2.", 0 },
                    { new Guid("0415e3bc-5c72-4d38-aaca-4e00ae630b54"), 0, new Guid("ed04caf1-99ba-4aec-ac16-ca08057f7d22"), "You need thieves' tools to Pick Locks or Disable Devices (of some types) using the Thievery skill. If your thieves' tools are broken, you can repair them by replacing the lock picks with replacement picks appropriate to your tools; this doesn't require using the Repair action. If you wear your thieves' tools, you can draw and replace them as part of the action that uses them.", 0 },
                    { new Guid("4276b9ed-b141-4625-b3db-acdb095eb4b5"), 0, new Guid("8969e927-035e-4927-a554-96ced3b112d0"), "When wielding this long pole, you can use Seek to search a square up to 10 feet away. The pole is not sturdy enough to use as a weapon.", 0 },
                    { new Guid("a150023c-4541-4e5b-af10-6a40a23928f6"), 0, new Guid("b0ab7469-92c8-40c9-a159-6c677814a54d"), "Tents provide comfortable rest during the night, preventing the inhabitants from taking penalties or condition effects.", 0 },
                    { new Guid("bba92ca0-01d2-4111-a6bc-b3ec6103db7f"), 0, new Guid("f2913e46-d954-49e8-82b2-76d1c13e8172"), "A sack can hold up to 8 Bulk worth of items. A sack containing 2 Bulk or less can be worn on the body, usually tucked into a belt. You can carry a sack with one hand, but must use two hands to transfer items in and out.", 0 },
                    { new Guid("fb65e32e-5654-4edc-8d8d-15afd05e9378"), 0, new Guid("6e9cb8a6-3ecb-49c2-b660-e6d9bc70709a"), "A rope is a group of yarns, plies, fibers or strands that are twisted or braided together into a larger and stronger form. Ropes have tensile strength and so can be used for dragging and lifting.", 0 },
                    { new Guid("137fea30-babf-4f5e-be3f-d6fad27923f8"), 0, new Guid("2857c2fb-c0a6-4b9a-99f4-c6fd1c7e8f33"), "A repair kit allows you to perform simple repairs while traveling. It contains a portable anvil, tongs, woodworking tools, a whetstone, and oils for conditioning leather and wood. You can use a repair kit to Repair items using the Crafting skill. You can draw and replace a worn repair kit as part of the action that uses it.", 0 },
                    { new Guid("83c25aee-3ec2-46aa-bdc7-b7c122829968"), 0, new Guid("81704384-9bf8-495f-8afd-18c68b8074b8"), "This manuscript contains scripture of a particular religion. Some divine spellcasters, such as clerics, can use a religious text as a divine focus to use certain abilities and cast some spells. A religious text must be held in one hand to use it.", 0 },
                    { new Guid("bd148448-e5fd-4cf8-aeba-6f6914b94f1e"), 0, new Guid("7769a9fc-e764-47c3-a34a-1eba746e293a"), "A piece of equipment consisting of a series of bars or steps between two upright lengths of wood, metal, or rope, used for climbing up or down something.", 0 },
                    { new Guid("4fd60da6-f092-412a-9481-c5583ba16d35"), 0, new Guid("0f0bf997-7653-4941-af5f-375d4f5786a3"), "This elegant wooden case contains a recessed section to hold a simple or common harrow deck and a harrow mat. The case features a watertight seal to protect its contents from the elements and everyday wear and tear.", 0 },
                    { new Guid("74e5c5e5-3303-4bb6-a982-281e89cd6149"), 0, new Guid("6c60bda0-dcce-4507-980b-370cb919c9ed"), "A lantern sheds bright light and requires 1 pint of oil to function for 6 hours.", 0 },
                    { new Guid("515187c9-f8ee-4fc0-9742-6180ecbad31b"), 2, new Guid("ff7fb3c9-3f56-4260-9aa3-77bf06844661"), "The second part of the kit is a small sheaf of paper and a pad soaked in ink. By forcing a humanoid creature with fingerprints to roll a finger across the pad and then press it to the paper, you can obtain an image of the unique whorls in that creature's fingerprints. These can then be compared to any prints found at a crime scene. Successfully determining whether or not two prints match requires a DC 15 Perception check—the GM should roll this check secretly as well, since a failed check may result in false information.", 0 },
                    { new Guid("12967d10-82b4-4f9f-9a23-6f9efd9942cf"), 1, new Guid("ff7fb3c9-3f56-4260-9aa3-77bf06844661"), "The kit consists of two parts. The first, a delicate brush and a jar of extremely fine dust, is used to reveal fingerprints left behind by most humanoid creatures. The dust sticks to the natural oils left behind on smooth surfaces. When you use the kit to determine whether or not creatures left behind a fingerprint at a crime scene, the GM rolls a secret Thievery check against the Thievery DC of every creature capable of leaving prints that has interacted with the scene. On a success, you locate a clear print from that creature and carefully transfer it to a special sheet of sticky paper. (Note that fingerprints can last for days, and prints collected in this manner often include those of victims, witnesses, and unrelated passersby.) At the GM's discretion, the print-leaving creature might get a bonus to its Thievery DC for taking special precautions. In other cases, finding a print might be impossible (such as if the creature was wearing gloves or if the location has been significantly compromised).", 0 },
                    { new Guid("91545dab-c971-4e6e-a899-b5910fec53a3"), 0, new Guid("ff7fb3c9-3f56-4260-9aa3-77bf06844661"), "Rarely found outside of major metropolises, fingerprinting kits are a state-of-the-art, non-magical means of linking suspects to the scene of a crime.", 0 },
                    { new Guid("9b4cdbfb-ef66-4252-8abc-3333ba9be0da"), 0, new Guid("93f381c5-9d0f-4b47-a652-7ae50f5d5fb5"), "A lock can be used to secure chests, rooms, trapdoors, hatches or other kinds of stowing fascilities.", 0 },
                    { new Guid("302c42ec-e59f-4f42-8e90-0073770e9f95"), 0, new Guid("9417ac00-4b72-460a-a6dc-ad961c03ab14"), "This quality handheld lens gives you a +1 item bonus to Perception checks to notice minute details of documents, fabric, and the like.", 0 },
                    { new Guid("cd9831c4-0711-4425-8858-18cc1d989a7a"), 0, new Guid("29638790-400f-407e-8b44-0b25aff858cd"), "These armor-plated skirts, which are also known as armored kilts, are favored by Knights of Lastwall for their versatility and aesthetic appeal. An armored skirt can be donned with 2 Interact actions when it’s worn with light or medium armor, or as part of donning heavy armor.", 0 },
                    { new Guid("c3dfc079-a58c-4c0d-a8f5-75cbc07121ab"), 0, new Guid("2ee4c581-edef-47ed-8654-086ee333d890"), "You can manacle someone who is willing or otherwise at your mercy as an exploration activity taking 10-30 seconds depending on the creature's size and how many manacles you apply. A two-legged creature with its legs bound takes a -15-foot circumstance penalty to its Speeds, and a two-handed creature with its wrists bound has to succeed at a DC 5 flat check any time it uses a manipulate action or else that action fails. This DC may be higher depending on how tightly the manacles constrain the hands. A creature bound to a stationary object is immobilized. For creatures with more or fewer limbs, the GM determines what effect manacles have, if any.", 0 },
                    { new Guid("92f5b23c-e923-4cf9-ac34-50d89ee149be"), 0, new Guid("7befcd2d-6e94-4956-af49-2d7206a44d13"), "A merchant's scale grants a +2 circumstance bonus on Appraise checks involving items that are valued by weight, including anything made of precious metals.", 0 },
                    { new Guid("fc4cf241-1aba-44df-b8d7-a25edc47257f"), 0, new Guid("25290e17-81bd-4b8d-89b4-fb9228d33d7b"), "A mirror is an object that reflects an image. Light that bounces off a mirror will show an image of whatever is in front of it, when focused through the lens of the eye or a camera. Mirrors reverse the direction of the image in an equal yet opposite angle from which the light shines upon it.", 0 },
                    { new Guid("839dfc4c-cf39-43c7-9381-aa05b4816143"), 0, new Guid("2ac8cf6c-028f-4418-96ba-4092b85e5fa5"), "A mug is a type of cup typically used for drinking hot drinks, such as coffee, hot chocolate, or tea. Mugs usually have handles and hold a larger amount of fluid than other types of cup.", 0 },
                    { new Guid("a31be45d-e190-43d7-84a6-5a45416d25a5"), 0, new Guid("cc4d4621-bf02-484a-93ad-9b14f6e93b0b"), "You can use oil to fuel lanterns, but you can also set a pint of oil aflame and throw it. You must first spend an Interact action preparing the oil, then throw it with another action as a ranged attack. If you hit, it splatters on the creature or in a single 5-foot square you target. You must succeed at a DC 10 flat check for the oil to ignite successfully when it hits. If the oil ignites, the target takes 1d6 fire damage.", 0 },
                    { new Guid("2a189668-ef0a-422a-8ff2-4e2e6ab74228"), 0, new Guid("901f8786-d591-43a5-b8cd-8cd049434d65"), "You can draw this reinforced sheath during the same Interact action you use to draw the weapon it holds, wielding the weapon in one hand and the scabbard in your other. A parrying scabbard can be used for your defense much like a weapon with the parry trait: you can spend an action to position it defensively, gaining a +1 circumstance bonus to AC until the start of your next turn. Parrying scabbards are available for any sword that can be wielded in one hand.", 0 },
                    { new Guid("f5aac716-bbf7-4b8d-b00c-98c0fc2ad901"), 0, new Guid("1a6ef531-3bb2-45ea-8946-b6234ff93796"), "These small spikes can be used as anchors to make climbing easier. To affix a piton, you must hold it in one hand and use a hammer to drive it in with your other hand. You can attach a rope to the hammered piton so that you don't fall all the way to the ground on a critical failure while Climbing.", 0 },
                    { new Guid("b667fbce-b973-490e-858c-eb442b49fcd5"), 0, new Guid("a11b6ffd-1981-406c-8dc4-e535f00773e1"), "Contains a week's worth of food and drink.", 0 },
                    { new Guid("eb2f18d5-6185-4cc9-82c9-8d2b3b9bc3ed"), 0, new Guid("19f6384c-7ccb-48a7-ba5a-610a8477aeb2"), "This piece of wood or silver is emblazoned with an image representing a deity. Some divine spellcasters, such as clerics, can use a religious symbol of their deity as a divine focus to use certain abilities and cast some spells. A religious symbol must be held in one hand to use it.", 0 },
                    { new Guid("4258e9e5-c57e-437c-8591-41ccc400e9b1"), 0, new Guid("f0ee4a34-407e-410b-bae1-e84dfe9bef81"), "This pouch contains material components for those spells that require them. Though the components are used up over time, you can refill spent components during your daily preparations.", 0 },
                    { new Guid("d446cfa5-dfb4-4091-a7ca-5e048df92bf8"), 0, new Guid("4070e631-7074-48fe-8bb7-00372e865dea"), "This leather bandolier holds up to three repeating hand crossbow magazines in leather pockets that pop open with the quick flick of a thumb. You reduce the reload time for a repeating hand crossbow magazine from the bandolier by 1, to a total of 2 actions. You can wear only one shootist bandolier at a time.", 0 },
                    { new Guid("e81c9277-3a5f-4edf-b66e-a10171abc5ef"), 0, new Guid("517b246c-ab2a-495b-8702-62e266d2251b"), "This satchel includes 50 feet of rope, pulleys, a dozen pitons, a hammer, a grappling hook, and one set of crampons. Climbing kits allow you to attach yourself to the wall you're Climbing, moving half as quickly as usual (minimum 5 feet) but letting you attempt a DC 5 flat check whenever you critically fail to prevent a fall. A single kit has only enough materials for one climber; each climber needs their own kit. If you wear your climbing kit, you can access it as part of a Climb action.", 0 },
                    { new Guid("d3a01d58-9cd0-4eb5-b585-042eb605c6a4"), 0, new Guid("4167d470-b6fb-40e1-826f-e3ff02ae8732"), "This simple tool consists of a small iron weight attached to a thin rope that is marked at regular intervals (typically every foot). It can be used to measure the depth of a hole or body of water by dropping the weight down into unknown depths and counting the markings on the rope. It can also be used as a plumb bob.", 0 },
                    { new Guid("ed20f43a-e3cf-4c2b-a5c0-47993f534e0f"), 0, new Guid("9eaa4740-ca64-457f-b20e-94cbada90b59"), "Players can gain access to faction-specific gear by taking the corresponding Faction Gear Access Game Reward, available when they reach 20 reputation with the respective faction.", 0 },
                    { new Guid("066484ea-92fd-4672-b69e-12e0cbba8a2d"), 0, new Guid("1e2cf39c-7aa0-47df-93cd-81dae8de27a3"), "This armored case is made to protect any Tiny or smaller creature contained within. It includes air holes (which can be plugged with cork stoppers for underwater travel) and two receptacles for food and water. Any creature inside has neither line of sight nor line of effect to the outside world but also cannot be targeted by attacks that require a line of effect while in the satchel. However, an area effect that deals enough damage to break the case also damages the creature inside. The satchel is made of leather (Hardness 4, HP 16, BT 8). A creature can enter or exit the satchel by using a total of 2 actions: an Interact action to open the satchel and a single action with the move trait to enter or exit.", 0 },
                    { new Guid("c4d3e330-3877-4a08-8352-9b44a3b7091e"), 0, new Guid("aa28dbfb-0480-494f-afc1-bbe71b70b19b"), "This canvas vest has been filled with cork shavings, tightly folded, and sewn shut. Wearing a buoyancy vest allows you to float in water with a lowered risk of sinking. If you end your turn in water while wearing a buoyancy vest and haven't succeeded at a Swim action that turn, attempt a DC 5 flat check. On a success, you do not sink, though you can still get moved by the current, as determined by the GM. The GM can also determine whether the vest is more or less effective in different weather conditions, raising the DC in rough waters or lowering the DC in calm water.", 0 },
                    { new Guid("d79d1424-cbbc-4837-8090-7728b9ff80e6"), 0, new Guid("9ed3bf9d-c04e-4e0b-8b24-cdd6ca326dc9"), "This small timepiece allows you to accurately track time, useful for coordinating attacks, cooking, and all other sorts of activities, without the steadiness or care necessary to use an hourglass. As always, spell durations are too inexact to be reliably tracked, as they don't last precisely the duration listed. Protected within a brass or steel case, the clockwork mechanism of this device is turned using a small key. Most dials have a maximum duration of 1 hour, with each turn of the key adding 10 minutes to the timer, though some are crafted with longer or shorter durations and intervals. Setting the timer requires one free hand and an Interact action.", 0 },
                    { new Guid("2deb8586-5120-45bf-ad34-d01af497b2a8"), 0, new Guid("783370e3-5de6-4fb7-8bf2-6b1ea444727d"), "This small rod has a tiny, sharp cutting wheel made of steel on one end and a thick bulb on the other. You can use the glass cutter's wheel to score ordinary glass and use the bulb to break the piece along your scoring. It typically takes 1 minute of work to cut a hole large enough to fit your hand. If you are attempting to break the glass quietly, you must attempt a Thievery check against the Perception DC of nearby creatures to go unnoticed.", 0 },
                    { new Guid("375853c1-8977-445e-ad4c-b5874d6cddb8"), 0, new Guid("ee932950-fb59-4926-beee-dab8ef1c74f4"), "Smaller and made of stronger materials than most sets of thieves' tools, the items in this kit are much easier to conceal. You gain a +1 item bonus to Stealth checks to Conceal these tools. They otherwise function as infiltrator thieves' tools.", 0 },
                    { new Guid("2ff0b4c1-8895-462d-a784-386dcd22387c"), 0, new Guid("0bb0ef67-0618-4537-9772-fcb3e22c83af"), "This small grappling hook is designed to be tied to a rope and fired from a bow. When fired, it has half the normal range increment for the weapon.", 0 },
                    { new Guid("e335ff59-4f92-405d-b0b1-5a6bafb68bc8"), 0, new Guid("6f3dd7dc-f4b6-4425-b6bb-97775aeeabda"), "The book is leather-bound and decorated with the symbol of the Lantern Lodge. Red and gold cords wrap around the book and tie to keep it shut. Each volume offers translation for a different language. When working with a book of translation, you can attempt Diplomacy checks to Gather Information or to Make an Impression with creatures that speak the language featured in the book, even if you do not speak the language. Such checks take 10 times longer to complete and you take a –2 circumstance penalty to the check due to your limited communication capabilities.", 0 },
                    { new Guid("ef46aa6a-f84f-44d8-b248-c1d47c7d237f"), 0, new Guid("bdec1ae5-66cd-40ab-8761-5ce6ba1eb9f1"), "This small grappling hook is designed to be tied to a rope and fired from a crossbow. When fired, it has half the normal range increment for the weapon.", 0 },
                    { new Guid("9613ef6a-8da8-42bf-82b2-4e37e8accba0"), 0, new Guid("64de129b-3287-4f24-b01a-b50c5a2123be"), "A standard deck of cards consists of 54 cards made from thick paper contained within a paper sleeve. The most common deck used for games and gambling is known as the Old Mage deck and features four suits themed with the four essences of magic, each with 13 cards, as well as two wildcards. The name and appearance of the deck varies from region to region, such as the Magician's Deck in Taldor or the Deck of Masks in the Shackles.", 0 },
                    { new Guid("ea5b68fe-35b4-4280-aada-20a4780839e1"), 0, new Guid("fa034d2e-aa2d-4bea-92d8-fde658807406"), "Astrolabes can be used for navigation in unfamiliar or featureless locations. To use an astrolabe, the holder must be trained in Survival. By spending 1 minute to measure the height of the stars and planets, a holder who knows the time and date can determine the latitude, and a holder who knows their latitude can determine the date and time. An astrolabe also grants a +1 item bonus on checks to identify celestial bodies. A standard astrolabe only functions on steady ground.", 0 },
                    { new Guid("a267c15c-7486-4a13-af92-fc6e9d034e7b"), 0, new Guid("2f83877d-1461-4ea7-b630-72ab935a19de"), "These manacles are nearly indistinguishable from real manacles upon inspection, but contain a hidden release that enables a wearer who knows the location of the release to free themselves with a single Interact action. An observer who examines the manacles and succeeds at a DC 20 Perception check notices their false nature. On a critical success, the observer finds the location of the hidden catch as well.", 0 },
                    { new Guid("36a20efa-fdb6-4611-a536-4dd539b2bd3f"), 0, new Guid("be4541a0-3103-4718-b398-cd2a4dfc9295"), "A ruler is a straight-edged object used for measuring small distances accurately and drawing straight lines.", 0 },
                    { new Guid("0ee06297-4994-4219-9e6b-fce7d990f21a"), 0, new Guid("784f13b8-c6eb-461f-a423-34b56f16204e"), "This carefully balanced metal bracket can be attached to the front or top of a shield or tower shield (but not a buckler), allowing you to carry a torch without giving up your shield or holding it in your other hand. While carrying a torch in this way, you must attempt a DC 11 flat check every time you use the Shield Block reaction; on a failure, the torch is extinguished.", 0 },
                    { new Guid("71593858-9d82-46ff-8893-c1d0f62a6c19"), 0, new Guid("361e8665-4225-4915-a3fa-f75b9a619b6b"), "These specialized pieces of footwear are designed to distribute the wearer's weight over a larger area to prevent them from sinking while walking on snow. They are typically made with a wood frame and rawhide lacings that are tied over the wearer's other footwear. While wearing snowshoes, you ignore the effects of non-magical difficult terrain caused by snow (reducing greater difficult terrain from snow to ordinary difficult terrain). You take a –10-foot item penalty to your Speed if wearing snowshoes while walking on any surface other than snow.", 0 },
                    { new Guid("865d7423-d1f3-406b-adf2-1bc81dd9ee39"), 0, new Guid("929665f3-dc26-4cd4-aa4b-01c2fee66be2"), "By using a rubbing set, you can quickly make a copy of carvings or etchings you find during your explorations, making them easier to accurately reproduce. This kit consists of a roll of thin onion-skin paper in a waterproof leather case, several thick wax crayons, and a bar of sealing wax that can be melted and used to temporarily hold the paper in place while you take the rubbing. Using the kit consumes the materials and provides a +1 item bonus on checks to document or reproduce artwork or writing that has been carved, etched, or otherwise physically added to a surface.", 0 },
                    { new Guid("9b7aa45e-5267-4c5f-ac3e-571f6d998dd4"), 1, new Guid("0ff1b0d8-a30c-41ed-86b7-e56aec6d93fd"), "If you pour a liquid other than water, such as a potion or beverage, into the purifier, the filtration process negates the liquid's effects and ruins the taste. The center of the tube can be unscrewed from the ends to access and replace the chambers of purifying agents. Each filter can be used to cleanse up to 10 gallons of water at a rate of about 1 gallon every 20 minutes.", 0 },
                    { new Guid("946cabe1-a23c-442f-8bba-767d17af7ec8"), 0, new Guid("7214321a-e14d-4c1b-bcf5-642d0b1bb41c"), "Made of waxed cotton or cork, earplugs give you a +1 item bonus to saves against effects with the auditory trait. The earplugs make it difficult to hear, however, imposing a –2 item penalty on Perception checks involving sound. Inserting or removing the earplugs requires an Interact action.", 0 },
                    { new Guid("4482f6cb-0808-4a4a-b543-a15fe80c1ccf"), 0, new Guid("0dc8ba27-c35d-430b-ac20-5ae0e659ca86"), "These flippers attach to your feet like tight shoes—donning or removing them requires three Interact actions. While worn, you gain a +5-foot item bonus to the distance you move when rolling Athletics to Swim, not when using a swim Speed, and you take a –10-foot item penalty to your Speed.", 0 },
                    { new Guid("f0ddbeaf-7171-4f19-9897-745d636ecd50"), 0, new Guid("16e8493f-7a41-495c-9cf4-c4ecc788d5f9"), "These bioluminescent jellyfish are as bright as candles, come in a variety of colors, and can act as living lanterns. They dry up and die if removed from the water for more than 1 hour, but as long as they’re allowed access to seawater, they can usually survive for up to 1 year by feeding on micronutrients. Rarely, a well-treated jellyfish lamp might live longer and potentially develop stronger light or additional abilities.", 0 },
                    { new Guid("f8b9c763-7c67-4231-aefd-64a32cde6ff3"), 0, new Guid("a06f430b-4080-4d4c-bd01-d162e3aacee5"), "A typical Pathfinder writ of authenticity confirms the holder's status as a member of the Pathfinder Society and their intended business. Most writs are pieces of fine parchment folded, bound with gold cord, and sealed with three wax seals. The top seal is always the Glyph of the Open Road and the middle one is the Envoy's Alliance open door emblem. The bottom seal uses the preparer's personal sigil. Inside, the text describes a specific instance of a legitimate business activity, with blanks for the Pathfinder to fill in and personalize the writ to the persons and activity desired. Presenting a writ of authenticity grants a +2 item bonus to Make a Request for the associated business, assuming the writ is legitimate and the viewer expects to work with the Pathfinder Society for that activity.", 0 },
                    { new Guid("3ab90d6b-d457-4262-9379-23a8783398b7"), 0, new Guid("5c7c6a0d-bfc6-42b1-a265-9509e0ea7fad"), "This simple brass ring is meant to be worn as an ornamentation piece to an outfit, oftentimes as a bangle on the wrist, as the ring closure of a scarf or sash, or as an ornamentation piece of a headdress. While decorative, this serves a cover for the bangle's function as a message bearer. Messages can be coded into the bangle, either through a series of raised dots and dashes or a pattern of notches of different depths and spacings. A bangle is large enough to hold a simple message consisting of a few words like “Danger. Flee.” or “Meeting. Sunset. Fountain.” Coding a message into a bangle requires 1 minute of time. All Pathfinders with access to communication bangles are taught how to code and read most basic messages, but anyone with a bangle can develop their own communication system. A creature inspecting a bangle can discover its true purpose by succeeding at a DC 20 Perception check. Deciphering a message requires a creature to succeed at a Society check against the coder's Deception DC.", 0 },
                    { new Guid("37835ad8-2962-40ab-a1c1-20e5199754ae"), 0, new Guid("0b6cd783-f3bb-43b9-9d2d-fce9d8fa50f6"), "This small wooden or metal box is slightly larger than a typical large key and folds open along a hinge, revealing two halves filled with wax. When a key is placed within and the box closed, the wax is displaced by the key, leaving an accurate impression of its shape. Once the key is removed, the impression left behind will remain indefinitely and can later be used to cast a duplicate key. Inserting, impressing, or removing a key each requires an Interact action. The wax inside this blank can be reused, though it must be smoothed over between uses, erasing any previous impression.", 0 },
                    { new Guid("9575701a-4c38-4ee0-bd43-9f6291ca9b2f"), 0, new Guid("a22483eb-0db6-4677-9097-babb09ab0460"), "This heavy backpack of alchemically treated cloth layered over a metal mesh protects its contents from water damage and other harmful effects. It holds up to 4 Bulk of items, and the first 2 Bulk contained within the sturdy satchel do not count against your Bulk limits. The bag has Hardness 5 and 20 Hit Points. As long as the bag remains closed and is not broken, water and other liquids can't seep into it.", 0 },
                    { new Guid("1523eb79-8ae5-41ea-be4d-6c41c7143134"), 0, new Guid("0ff1b0d8-a30c-41ed-86b7-e56aec6d93fd"), "This small tube of metal and glass has an opening at one end into which water can be poured, leading to a series of interconnected chambers filled with purifying agents contained between various perforated walls. The purifier attempts to counteract poisons and other toxins present in water or any other liquid poured into it. Alchemically-treated replacement filters can be purchased to more effectively filter out more dangerous substances, using the filter's listed level as the counteract level.", 0 },
                    { new Guid("7630b480-2289-4c24-ae0f-ffcb8bb3d30e"), 1, new Guid("9eaa4740-ca64-457f-b20e-94cbada90b59"), "This kit includes a writing set, a compass, a standard astrolabe, a ruler, and a survey map.", 0 },
                    { new Guid("f7b95429-bc12-4034-811d-809d37c4a8b9"), 0, new Guid("085cf660-739c-422e-a019-9d821a31e394"), "This portable winch consists of a length of cable or chain, two hooks, and a ratcheting drum with a handle. When used with two sections of rope or chain, it allows you to pull a heavy load along a flat surface.", 0 },
                    { new Guid("95c90f90-5864-4c66-bb03-94a7200c29f5"), 0, new Guid("008da8ab-fa02-4ad0-9ba2-40dca2c5e0be"), "This leather-bound tome is specially treated to protect from water damage and comes with a key and a treated slipcase that bears a simple lock to keep the tome secure. This journal is commonly used by adventuring scholars and ship navigators for recording their journeys.", 0 }
                });

