            migrationBuilder.InsertData(
                table: "AlchemicalElixirs_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("743b8c94-0516-4c3d-9c02-6e54afceab7d"), 0, new Guid("c0369185-db16-46ad-9ac7-c4e269e9a0a8"), "Antiplague can fortify the body’s defenses against diseases. Upon drinking an antiplague, you gain an item bonus to Fortitude saving throws against diseases for 24 hours; this applies to your daily save against a disease’s progression.", 0 },
                    { new Guid("029c1cd3-93f2-472e-90a1-7f67847a6752"), 0, new Guid("1a2e2a1c-f468-48ec-b023-e81756740a11"), "Your features transform into something bestial and you take on muscle mass, but your lumbering form is clumsy.", 0 },
                    { new Guid("5c24f746-2f04-48a2-9b74-ab5c70e42203"), 0, new Guid("f8b7608f-3330-494d-8203-64cb7aeaa477"), "Favored by spies and tricksters, an infiltrator’s elixir is used to alter your appearance. When imbibed, you take the shape of a humanoid creature of your size, but different enough so you might be unrecognizable. If you aren’t a humanoid, you might take on a form more similar to your own, at the GM’s discretion.", 0 },
                    { new Guid("47c254c1-8659-4363-8818-143300056126"), 0, new Guid("c1fbd9e7-e36e-49d7-b3c2-772400e1fc5e"), "This tincture lets you pinpoint your foes. For the next 5 minutes, your alchemical bomb Strikes reduce the circumstance bonus to AC your targets gain from cover.", 0 },
                    { new Guid("7b92f530-d78e-4683-b967-9de524ac2063"), 0, new Guid("b28f4309-cc04-4522-8837-b653995b3028"), "This elixir warms your core and improves your circulation. For 24 hours, you are protected from the effects of severe cold.", 0 },
                    { new Guid("cdcd2d5b-5901-4d52-81b9-7645684928c0"), 0, new Guid("58f3f7fd-4244-4a42-b684-d995220d4ade"), "Your fists become hard as stone. For 1 hour, your fists deal 1d6 bludgeoning damage and lose the nonlethal trait.", 0 },
                    { new Guid("5d023119-60ec-4f88-9056-c3b81e0af2bf"), 0, new Guid("ceaaac90-8340-4e2a-aa97-effc5848f12d"), "This briny concoction alters the skin on your hands and feet. The spaces between your fingers and toes become webbed, granting you a swim Speed of 20 feet for the listed duration.", 0 },
                    { new Guid("bed0c6dc-af90-431a-93a5-f6a126f7e4d2"), 0, new Guid("8d0d85f9-d1bf-49c2-ab32-d6caa627de83"), "This flask of foaming beer grants courage. For the next hour after drinking this elixir, you gain an item bonus to Will saves, which is greater when attempting Will saves against fear.", 0 },
                    { new Guid("7ea16d23-375f-4b4e-8400-35d31a29f574"), 2, new Guid("f8b7608f-3330-494d-8203-64cb7aeaa477"), "Drinking this elixir counts as setting up a disguise to Impersonate. You gain a +4 status bonus to your Deception DC to avoid others seeing through your disguise, and you add your level to this DC even if untrained.", 0 },
                    { new Guid("1bc9c603-c18b-4898-add5-8e6533dbbeb0"), 1, new Guid("c9715348-c813-422b-af5b-e2c9a11884a9"), "You can instead administer this elixir to a creature that has been dead for a week or less. When you do, that creature is instantly brought back to life with 1 Hit Point and no spell slots, Focus Points, or other daily resources.", 0 },
                    { new Guid("5b3a9903-a51c-4a10-b932-ee51026807ff"), 0, new Guid("c9715348-c813-422b-af5b-e2c9a11884a9"), "The elixir of rejuvenation restores a creature to full health and eradicates toxins affecting it. When you drink this elixir, you’re restored to your maximum Hit Points, and all afflictions of 20th level or lower affecting you are removed.", 0 },
                    { new Guid("04d5224a-86f5-4533-a931-a1b465cbac1c"), 0, new Guid("64cc1e8c-d5c1-4e58-9306-3be2e06a95b9"), "After you drink this mutagen, your body becomes thick and sturdy. You exhibit a healthy glow, though you tend to be ponderous and unobservant.", 0 },
                    { new Guid("150dac7f-5e0c-461a-91ea-1d6b6cb5fda9"), 0, new Guid("479d0265-a1a4-41f3-afd0-8ad618bdb7a6"), "Elixirs of life accelerate a living creature’s natural healing processes and immune system. Upon drinking this elixir, you regain the listed number of Hit Points and gain an item bonus to saving throws against diseases and poisons for 10 minutes.", 0 },
                    { new Guid("fc565a61-6754-4bea-bdc6-768b53993621"), 0, new Guid("e81eb16e-db86-4869-9cc7-1b5dfa3ba787"), "After you drink this elixir, you notice subtle visual details. For the next hour, you gain an item bonus to Perception checks that is greater when attempting to find secret doors and traps.", 0 },
                    { new Guid("47860fc7-facb-4704-b219-ff432eb33b73"), 0, new Guid("82b662fa-09dc-4cc6-a7e1-13085af44f63"), "After you drink this elixir, your sight becomes sharper in darkness.You gain darkvision for the listed duration.", 0 },
                    { new Guid("99f4909b-5fd9-4602-abb9-84a2309b4879"), 0, new Guid("787a099b-e070-4e58-b0b7-89c5e2f0aac9"), "This bitter draft opens your mind to the potential of the written word. For the listed duration after drinking this elixir, you can understand any words you read, so long as they are written in a common language. This elixir doesn’t automatically allow you to understand codes or extremely esoteric passages—you still need to attempt a skill check to Decipher Writing.", 0 },
                    { new Guid("e0308f62-e9c4-49b4-ab1e-864a77807cd9"), 0, new Guid("4ef08665-b07b-4ced-8876-ef6a15229e17"), "Your mind becomes clear and cognition flows freely, but physical matters seem ephemeral.", 0 },
                    { new Guid("c3d0b8fa-4656-44c2-86ad-2247cc2326fd"), 0, new Guid("7a89776c-ffcc-4766-8ddb-d0d6f2227c30"), "Enzymatic compounds in this elixir strengthen and excite the muscles in your legs. You gain a status bonus to your Speed for the listed duration.", 0 },
                    { new Guid("83785b35-3536-4517-8ad1-e06c530cba25"), 0, new Guid("fce1d931-7808-4e03-8615-f9f0210c405a"), "This tingly solution increases the elasticity and contraction of your leg muscles. For 1 minute after drinking this elixir, you can High Jump or Long Jump as a single action instead of 2 actions. If you do, you don’t perform the initial Stride (nor do you fail if you don’t Stride 10 feet).", 0 },
                    { new Guid("518dfefb-b42e-457a-a7f2-df253f733f15"), 0, new Guid("87e2ed9e-5358-493d-be9f-0f96150b5b7a"), "A faint mist emanates from your skin, making you concealed for the listed duration. As usual, if you become concealed when your position is still obvious, you can’t use this concealment to Hide or Sneak.", 0 },
                    { new Guid("70db1dfe-abca-4416-b8ba-8825604c77d9"), 0, new Guid("9273e6ad-3f3c-4e7d-9b9c-4a8faec61145"), "After you consume this elixir, your vision sharpens and you become sensitive to even the most minute movements. For the next minute, you reduce the flat check to target hidden creatures to 5, and you don’t need to attempt a flat check to target concealed creatures. These benefits apply only against creatures within 30 feet of you.", 0 },
                    { new Guid("e5afe368-8abd-4cc4-b15a-fe449c96daac"), 0, new Guid("edf0d3e8-4400-4feb-8326-7d98976ebae7"), "This elixir is made from salamander scales to withstand fire. For 24 hours, you are protected from the effects of severe heat.", 0 },
                    { new Guid("26d53eae-b1d3-4e3c-81d1-83d6d86633df"), 0, new Guid("baf67e26-cdcd-48fc-b64a-2e68c08bef03"), "You gain inner serenity, focused on fine details and steeled against mental assaults, but you find violence off-putting.", 0 },
                    { new Guid("9b681339-c92a-45b5-9bed-aebedf317e72"), 0, new Guid("a4700423-ee77-4ed2-ac68-682da90db27b"), "Your features become striking and your voice becomes musical and commanding, though facts and figures become hazy for you and emotion clouds your ability to reason.", 0 },
                    { new Guid("ad64a881-6dc8-4752-8c71-e3486b4977bc"), 0, new Guid("eeca589b-c156-4a4a-8614-d78cc53934c1"), "Your features become thin and angular. You become swifter and nimbler, but your body also becomes fragile.", 0 },
                    { new Guid("1e77fd3e-28cf-47ca-a2e5-085bf9673e30"), 1, new Guid("f8b7608f-3330-494d-8203-64cb7aeaa477"), "The creator of the elixir decides the basics of the appearance you transform into when you imbibe the elixir, including eye color, skin tone, and hair color. The elixir can’t change your form into that of a specific person. After the form takes hold, you retain it for the next 10 minutes.", 0 }
                });

