                    { new Guid("8fa28249-b9cf-45b0-a5c9-fc721aa278df"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "You change the shape and appearance of this armor to appear as ordinary or fine clothes of your imagining. The armor’s statistics do not change. Only a creature that is benefiting from true seeing or a similar effect can attempt to disbelieve this illusion, with a DC of 25.", null, "Envision", new Guid("0b5a1049-2565-40ac-8364-1a040cc62375"), null, null },
                    { new Guid("13ef1f89-bd03-400e-960f-2cf2ffc951d5"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "You gain the effects of an ethereal jaunt spell. This doesn’t require concentration and lasts for 10 minutes or until you choose to return to material form as a free action.", "Once per day.", "Command", new Guid("76e3db46-6f8a-4a56-9459-58d0b14e2059"), null, null },
                    { new Guid("750c0b06-8779-4b81-a4f2-0c00e93afe0e"), new Guid("668ed964-cf7f-43df-b4b3-6a89c28551aa"), "The armor attempts to counteract the triggering spell with the effect of a 7th-level dispel magic spell and a counteract modifier of +26.", "Once per day.", "Command", new Guid("aaaa1bfc-1a6f-4a5a-b2e7-3b9c779aa014"), "A spell targets you or includes you in its area.", null },
                    { new Guid("f5538309-abd0-4e0d-9464-4ef93a0de3ff"), new Guid("26ab8b82-ea91-4247-934b-618c724aca8b"), "With a thought, the wearer activates a disguise. While the sinister knight armor’s disguise is active, any identifying insignia or aesthetic of the armor is replaced by generic malevolent aesthetics such as spikes or demonic faces. While in the disguise, the wearer is always considered to be taking precautions against lifesense, and even a creature that successfully notices the wearer with its lifesense mistakes the wearer for an undead unless it critically succeeds at its Perception check or the wearer critically fails a Deception or Stealth check. Finally, while in the disguise, the rune attempts to counteract any effects that would reveal your alignment; on a successful counteract check, rather than negate the effect, the rune causes the effect to perceive your alignment as evil (maintaining any lawful or chaotic component of your alignment).", null, "Envision", new Guid("a134a0b4-5255-41c8-8a0d-179e943a4ef4"), null, null },
                    { new Guid("c3acb77d-f7f9-4724-ba3a-1a595c620e50"), new Guid("fe122850-b449-482d-8350-ac21e8985594"), "You trace the rune on the front of the breastplate and the armor's ephemeral wings grow tangible, granting you a fly Speed of 25 feet or your land Speed, whichever is slower.", "Once per hour.", "Command and Interact", new Guid("8adaa470-41e9-4308-bd26-d8d3188d02f4"), null, null }
                });

