                    { new Guid("778a70f9-da88-4674-aa15-250c3d5da5c2"), 0, new Guid("a134a0b4-5255-41c8-8a0d-179e943a4ef4"), "Sinister knight armor shrouds the wearer’s identity in secrecy, allowing Crimson Reclaimers to pass among foes without being immediately unmasked.", 0 },
                    { new Guid("9b5141e5-b893-4888-9173-33d15860de6c"), 0, new Guid("2dcf90ee-e52e-4e69-a809-6790cf49a622"), "A ready rune draws component pieces of a suit of armor toward one another, making it easier and faster to get into.", 0 },
                    { new Guid("429f0b0a-7865-4ed3-8236-0ad1c5e4f673"), 1, new Guid("a134a0b4-5255-41c8-8a0d-179e943a4ef4"), "The wearer can Dismiss the disguise, and if the wearer’s armor is removed, the disguise deactivates automatically.", 0 },
                    { new Guid("8f63efb2-6386-411c-999e-d0344722aae9"), 0, new Guid("aaaa1bfc-1a6f-4a5a-b2e7-3b9c779aa014"), "This intricate rune displaces spell energy.", 0 },
                    { new Guid("575329d6-6e3b-4bf0-af7c-a2f4f2598a35"), 0, new Guid("d21ec6e1-b491-49e8-ba45-64abfdce9da8"), "These symbols convey protective forces from the Elemental Planes. You gain resistance 5 to acid, cold, electricity, or fire. The crafter chooses the damage type when creating the rune. Multiple energy-resistant runes can be etched onto a suit of armor; rather than using only the highest-level effect, each must provide resistance to a different damage type. For instance, a +2 acid-resistant greater fire-resistant breastplate would give you acid resistance 5 and fire resistance 10.", 0 },
