            migrationBuilder.InsertData(
                table: "Artifacts_DestructionDetails",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("2590674b-8f7f-4b05-8cb0-2f0178a42333"), 0, new Guid("f0a73799-c5d5-4f5f-b530-aada27ca8baa"), "An orb shard is extraordinarily resilient, but it can be damaged or even destroyed by mundane attacks (Hardness 40, HP 50, BT 25). It has weakness 30 to the Breath Weapons and Strikes of gold dragons.", 0 },
                    { new Guid("ce528da7-1c4f-45ef-901d-21ca3230852c"), 0, new Guid("728c2f98-495a-4972-ba56-b1fd29aaa89a"), "Hunter's Dawn can be destroyed only by placing it on the funeral pyre of a dead god.", 0 },
                    { new Guid("39480606-c48d-473f-9125-41b43528a7e4"), 0, new Guid("824c96fe-298c-42c3-96f1-2c95728079bc"), "Using Aroden's Hearthstone to craft a cursed item results in a failed creation and causes the gemstone to split into five equal-sized but magically impotent pieces. Over the course of a year, four of theses pieces crumble to dust, while the fifth expands to the size of the original artifact and bears its powers anew. To destroy Aroden's Hearthstone, each of the separated pieces must be plunged into one of the five stars that compose the cosmic constellation known as the Follower.", 0 },
                    { new Guid("295e2a6d-e67d-4164-83bf-4363dedefa58"), 0, new Guid("abb06321-d119-48af-a60b-edac04a3ec43"), "Using the Forgefather’s seal ability to bring the dead back to life on an evil demigod causes it to shatter in a violent explosion that destroys the seal and the statue made as part of the sacrifice, erasing all knowledge of the user from existence. It does, however, bring the evil demigod back to life.", 0 },
                    { new Guid("5e6032a2-c210-4a2e-9095-a6ecc02c8df3"), 0, new Guid("7ff9f558-f18c-49f6-be41-5d9ba4644c4c"), "A deity who ascended to divinity via the Test of the Starstone can damage and destroy the Kortos Diamond as if it were not an artifact.", 0 },
                    { new Guid("ba10e6ee-5ba1-40db-9497-df8de114304a"), 0, new Guid("698dcef9-9c91-435c-9fc1-e81f0ec05113"), "If an orc beheads a dwarven king with the Axe of the Dwarven Lords, the axe rusts away to nothing.", 0 },
                    { new Guid("32224ae9-a2c3-453f-99be-120f985aeaf5"), 0, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "The memories and lessons that echo through the Tears of the Last Azlanti give clues about steps needed to destroy the artifact. After you have gained the power of each of the six aeon stones at least once, you are granted visions of six locations across Golarion. At each of these locations, you must replace one of the necklace's aeon stones with a dull gray aeon stone. Once the final stone is replaced, the powers of the necklace are drawn into its new stones. These stones become pieces of throneglass, and the chain and bails disintegrate.", 0 },
                    { new Guid("a53f9898-714c-42b1-a26e-d253e94d0baf"), 0, new Guid("564a769a-4de0-403f-ab79-acdd44224011"), "Trick the Grim Reaper into drawing the Skull card.", 0 },
                    { new Guid("e5844d5b-df9e-4da8-87cf-a33e0a7a3d2b"), 0, new Guid("180ce72b-c375-454c-8384-244901734ac5"), "The Flawed Orb of Gold Dragonkind is resilient, but its imperfect nature leaves it vulnerable. It can be damaged or even destroyed by mundane attacks (Hardness 40, HP 200, BT 100). It has weakness 30 to the Breath Weapons and Strikes of gold dragons.", 0 },
                    { new Guid("145d50a7-7cf1-49ff-855e-b7cbb14f2d84"), 0, new Guid("926863c7-4212-4b4c-9351-72a59548218a"), "No details are given on how to destroy blackaxe.", 0 },
                    { new Guid("f339df9f-1e03-45e1-8743-14f6de2d6a14"), 0, new Guid("5e4e2abd-2eb8-44ee-95e4-817d36a5b3c0"), "Forcing the essence prism to combine two incompatible demigods destroys the prism, though it might also result in a new divinity.", 0 },
                    { new Guid("a88ed5ed-69d7-4449-a29d-d28d9f13f236"), 0, new Guid("891ae18b-dc47-4426-9148-8aa4669ad0c7"), "The only way to destroy an elder sign is to use it to banish a Great Old One.", 0 },
                    { new Guid("3f0fc43a-cf93-445e-8fce-9485ee3687f0"), 0, new Guid("c718686d-6681-474a-8bfa-3d89c5040e11"), "The helm is utterly obliterated if crushed between the jaws of an ancient black dragon’s skull located in a desert while the sun is at its zenith.", 0 },
                    { new Guid("a7c35283-88d0-4c75-87ef-4a5b43c6c3a6"), 0, new Guid("bded304e-fe37-4721-ac02-f50e00ede945"), "The Mirror of Sorshen shatters into a thousand pieces if an intelligent but completely innocent creature resists the mirror’s attraction and then accidentally drops it.", 0 },
                    { new Guid("6325c40a-e3ea-4bad-8ebf-237d005fa1fa"), 0, new Guid("9df2074a-c20d-4472-be2d-4e4db1e267a1"), "When a gate spell is cast such that its rift overlaps a sphere of annihilation, roll d%. On a result of 1–50, the sphere is destroyed; on a 51–85, the spell is disrupted; and on a 86–100, everything within an 180-foot emanation of the sphere is pulled to another plane through a tear in the spatial fabric. If a rod of cancellation (Pathfinder Advanced Player’s Guide) touches the sphere, both items explode, dealing 14d6 bludgeoning damage (DC 35 basic Reflex save) to everything in a 60-foot burst from the point of their destruction.", 0 },
                    { new Guid("c14ec7a3-43c6-4b63-804b-1fca8041dfb6"), 0, new Guid("5b4598fe-c510-4e2c-9e47-937c9c8ec06b"), "Copies of The Whispering Reeds have no special protections and can be destroyed like any regular book, but doing so exposes the one who destroyed the book to the Empty Death.", 0 },
                    { new Guid("45ac4069-34d1-4d17-8362-1c7d9d67a580"), 0, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "An orb of dragonkind violently shatters and explodes when exposed to the Breath Weapon of a dragon who is a descendant of the dragon trapped within. The explosion deals damage as the 2-action activation above to all creatures within 90 feet.", 0 },
                    { new Guid("842290ee-f94b-4d1d-ad09-2f0622ab9246"), 0, new Guid("7b9cb35a-6622-4e64-ab2e-142cfa2e413f"), "Simultaneously feeding the philosopher’s extractor sizable portions of an aeon, angel, archon, azata, daemon, demon, devil, protean, and psychopomp, each of at least 14th level, along with a philosopher’s stone causes the device to jam, overheat, and explode. Creatures within 60 feet of the explosion must succeed at a DC 55 Reflex save or become covered in an alchemical slurry that transforms them into a horrifying amalgam of at least two of the creatures used to destroy the machine.", 0 },
                    { new Guid("08ea98e8-599f-4110-8bc7-d462485f9f68"), 0, new Guid("6d49f646-8b41-4a43-b9d8-7c730f97603e"), "If 10 shots of the First Vault are all fired at the same group of keketar or izfiitar proteans within 1 minute of each other, each shot was a hit, and the shots are then recalled, the shots collide as they attempt to re-form and crumble to dust.", 0 },
                    { new Guid("4245967d-66c2-4679-8e8f-efe217d9e9c9"), 0, new Guid("b4db8880-410e-4dbb-b645-c3f185eb05fd"), " If Belcorra's ghost is permanently destroyed, Gauntlight loses all of its magical properties and collapses in on itself all the way down to its base, leaving an incredibly deep pit in the Fogfen.", 0 },
                    { new Guid("c1a3fd03-36d4-4804-a9dc-8000d1e3ac84"), 0, new Guid("21c2c1f0-3464-4715-bb9b-6c826adab755"), "The talisman of the sphere is destroyed if touched by a sphere of annihilation.", 0 },
                    { new Guid("0752d5d3-e8f3-4974-bb1e-bbde74c9d4a5"), 0, new Guid("6876bf26-aa49-47df-93b8-0cf49c35c732"), "Trapping a lawful demigod in the hallucinatory terrain created by the cane and leaving it imprisoned for a year and a day causes a deific overload that destroys the artifact. When the artifact is destroyed, the terrain imprisoning the demigod crumbles away and the demigod is freed.", 0 },
                    { new Guid("1c0caf14-d3d9-4c1f-b338-b879a3c03b67"), 0, new Guid("f52c155f-6264-405c-a860-ca23f4c1fa0c"), "If Kazavon or a great wyrm shadow dragon who is a worshipper of Zon-Kuthon uses its breath weapon on Serithtial while she is unattended, the sword melts into a pool of mundane iron.", 0 },
                    { new Guid("109ee842-aca6-4772-b1da-4afff8808b5b"), 0, new Guid("331edf40-1407-4108-8dce-317d8b137902"), "An archfiend or evil demigod must willingly swap their essence with that of a celestial dominated or bound by the artifact, then critically fail the saving throw against having their essence consumed. This permanently destroys both the artifact and the fiend or demigod.", 0 }
                });

            migrationBuilder.InsertData(
                table: "Artifacts_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("19d49425-1575-403b-9b66-ac0c216116bd"), 7, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "3 - Resillience - Clear Spindle", 1 },
                    { new Guid("e527d499-a44d-4525-a3fe-05fa34d5b4bb"), 8, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Active Power: Worn armor gains the antimagic property rune.", 0 },
                    { new Guid("ef1730fe-0a53-45fc-b05e-1fd58b322ebd"), 9, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "4 - Tenactiy - Pink Rhomboid", 1 },
                    { new Guid("9679dece-dc9f-4b26-99c8-a948042e8d9b"), 0, new Guid("564a769a-4de0-403f-ab79-acdd44224011"), "These 22 cards of heavy vellum, usually stored in a box or a pouch, bear images or glyphs depicting symbols of magical power. Looking at a card without activating it shows the card face but has no magical effect. Once the deck is face down, the cards randomize themselves—if you look at the top card multiple times, you may find it changes. Any card removed from the deck goes missing after a few seconds, reappearing in the deck.", 0 },
                    { new Guid("b9c581cf-1675-4e79-9462-9124a9411acd"), 10, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Active Power: Wielded weapons gain the vorpal property rune.", 0 },
                    { new Guid("080d1d55-9b19-4c45-8474-09c43333ea86"), 1, new Guid("180ce72b-c375-454c-8384-244901734ac5"), "While carried, the Flawed Orb of Gold Dragonkind grants its owner resistance 30 to the Breath Weapons of gold dragons. The owner also can sense if there are any dragons within 10 miles, or any gold dragons within 100 miles. When within 1 mile of a dragon, they can determine the direction to the dragon and the dragon’s age category (such as young, ancient, or wyrm).", 0 },
                    { new Guid("c0bdbee5-9cf3-4ef1-9672-c8eed719efc3"), 0, new Guid("180ce72b-c375-454c-8384-244901734ac5"), "Each of the legendary Orbs of Dragonkind contains the essence and personality of a powerful dragon. The Orb of Gold Dragonkind was the most powerful of them all, until it was shattered by Mengkare’s draconic breath. Reconstructed at great expense by enslaved spellcasters toiling under the Scarlet Triad’s watch, the Flawed Orb of Gold Dragonkind is a shadow of its prior self, yet it remains a potent weapon against dragons of all types.", 0 },
                    { new Guid("9d6f43f2-8b54-4098-9a2f-c5710fcffbd2"), 12, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Active Power: SKill checks for downtime activities or to Recall Knowledge are one degree of success higher.", 0 },
                    { new Guid("9276c353-5fab-46da-b1bd-4aba3d42b668"), 6, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Active Power: Cast hypercognition at will.", 0 },
                    { new Guid("fa58cbc0-ac62-47c4-a059-4849a4bf2caa"), 13, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "6 - Invention - Lavender and Green Ellipsoid", 1 },
                    { new Guid("daf80aec-92da-40cb-8e51-2045bf1220c8"), 14, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Active Power: You can craft items up to 5 levels higher than your actual level.", 0 },
                    { new Guid("c7975322-bd0c-4c8f-9110-bac5f85370c1"), 0, new Guid("bded304e-fe37-4721-ac02-f50e00ede945"), "The silvery glass of this oval mirror displays alluring sights. Its dark wooden frame is studded with small green gems and is carved with the shapes of a male figure on one edge of the glass and a female figure on the other side.", 0 },
                    { new Guid("ca277f35-ec88-454a-8f06-3dc304030a85"), 0, new Guid("926863c7-4212-4b4c-9351-72a59548218a"), "This potent weapon used by Treerazer is a +4 greater corrosive major striking obsidian greataxe that grants a +4 item bonus to attack rolls, deals an extra 2d6 damage to plants, and has the properties of adamantine.", 0 },
                    { new Guid("d0975e36-96e2-4c27-b2a7-de8294c85386"), 3, new Guid("5b4598fe-c510-4e2c-9e47-937c9c8ec06b"), "The Whispering Reeds provides several abilities, but you can't activate any of them while you are stupefied unless you are a follower of Nhimbaloth.", 0 },
                    { new Guid("e4a13b45-ca83-445d-a62a-159de8bad762"), 2, new Guid("5b4598fe-c510-4e2c-9e47-937c9c8ec06b"), "The anonymous compiler wanted to produce an enormous print run of The Whispering Reeds, but after the initial run they realized the danger and scuttled those plans, instead attempting to destroy those copies already created. This crusade caught the attention of Nhimbaloth's cult, who swiftly assassinated the compiler. Fewer than two dozen copies of this rare tome are believed to still exist. The book's sinister nature causes all attempts to transcribe it to fail, resulting in bodies of gibberish, nonsense text.", 0 },
                    { new Guid("c46e7bb5-b68d-4c4b-b916-ea45c36d80e9"), 1, new Guid("5b4598fe-c510-4e2c-9e47-937c9c8ec06b"), "If a character understands the dangers of this book, however, moderated use can stall or even prevent such a fate from befalling them. If a character takes special care, they can even potentially use The Whispering Reeds for its original purpose—as a weapon against the cult of Nhimbaloth. Using the text too often or leveraging some of its more powerful effects, however, causes the user to feel an ominous chill. In these cases, the user is exposed to the tome's curse, Empty Death (see below).", 0 },
                    { new Guid("7c19c1a8-a09a-49f5-956a-1e8e8ec8ba54"), 0, new Guid("5b4598fe-c510-4e2c-9e47-937c9c8ec06b"), "This hefty tome was compiled centuries ago by an anonymous author who sought to collect all parables, myths, stories, and encounters with the Outer Goddess Nhimbaloth. According to the introduction, the author's original intent was to create a work that foes of the Empty Death could use to fight against her influence, but as one reads through the book, it becomes apparent that the opposite effect has been achieved—by compiling these stories, the author inadvertently generated a work that made it easier for Nhimbaloth to influence the world. Those who venerate the Empty Death seek copies of this book to use as a guide and religious text, while those who don't know better and peruse the book as though it were merely an anthology of stories find themselves unwittingly falling prey to Nhimbaloth's cult or agents of the entity herself. Those who study from The Whispering Reeds for too long are often cursed to rise as ghosts after death— though their existence never lasts for long, as they are inevitably consumed by Nhimbaloth.", 0 },
                    { new Guid("b9a020ed-856c-4dfa-ac67-63fe48b2fa20"), 11, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "5 - Wisdom - Orange Prism", 1 },
                    { new Guid("d0b46ed6-b4e3-43dc-84b6-540404d2be0b"), 5, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "2 - Remembrance - Tourmaline Sphere", 1 },
                    { new Guid("a6ed4e2f-1f38-4528-a041-00604b98d9d2"), 2, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Once per day, you can attempt to exchange the aeon stone in a given bail for another aeon stone with a successful DC 35 Arcana check.", 0 },
                    { new Guid("004c6bf1-53e1-4ded-baea-5d25d2d035b8"), 3, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "1 - Patience - Gold Nodule", 1 },
                    { new Guid("88fbfc31-ba17-4cb9-8413-22289a8ed5a1"), 1, new Guid("6d49f646-8b41-4a43-b9d8-7c730f97603e"), "Instead of rolling weapon damage dice, a shot of the First Vault deals 25 damage plus any bonuses or additional damage as if 25 were the result of the weapon’s damage dice; the damage type matches that normally dealt by the weapon. Upon damaging a creature, the shot of the First Vault shatters, and the fragments ricochet to hit any other enemies within 30 feet, making attack rolls with the same attack bonus. The shattered fragments remain lodged in the creatures they damage; the creatures are clumsy 2 while the fragments remain in place. A total of 3 actions, which have the manipulate trait, are required to remove the fragments from yourself or an adjacent creature; alternatively, a single action and a successful DC 30 Medicine check can be used. A critical failure on this Medicine check deals 10 persistent bleed damage to the creature with the embedded fragment.", 0 },
                    { new Guid("32aaf212-68dc-4678-a62a-7c46c7bea848"), 0, new Guid("6d49f646-8b41-4a43-b9d8-7c730f97603e"), "Legends claim that some long-forgotten god stole the original bundle of shots of the First Vault from Abadar’s repository. Since then, individual pieces have turned up throughout the multiverse. When you pick up a shot of the First Vault, it immediately reshapes itself to function with any ranged weapon and establishes you as its owner until another creature picks it up. As its owner, you can use the shot’s single-action activation after shooting it.", 0 },
                    { new Guid("1bd8a075-059d-4bcb-bad3-b6d372ddaf5d"), 0, new Guid("f0a73799-c5d5-4f5f-b530-aada27ca8baa"), "A shard of the Orb of Gold Dragonkind resembles a pointed length of crystal about the size and shape of a shortsword without a hilt. It functions as a +3 striking shortsword that deals 2d6 extra damage to dragons.", 0 },
                    { new Guid("92ad78b6-250c-4920-a728-0b89458eff84"), 1, new Guid("f0a73799-c5d5-4f5f-b530-aada27ca8baa"), "Each orb shard within 60 feet of the flawed orb of Gold Dragonkind increases the save DC against the orb by 1; thus, if all 13 remaining orb shards are in this area, the save DC against the flawed orb increases from DC 30 to DC 43. A talented spellcaster or crafter can integrate an orb shard back into the flawed orb to make this DC increase permanent.", 0 },
                    { new Guid("2e74da34-f6f2-4736-a7cc-b7ad4ba2c983"), 0, new Guid("824c96fe-298c-42c3-96f1-2c95728079bc"), "This coin-sized gemstone can be used on its own but must be included in the construction of a hearth in order to fully activate its magic.", 0 },
                    { new Guid("d8d3fb9a-9cae-4afc-8c95-576384d00feb"), 0, new Guid("9df2074a-c20d-4472-be2d-4e4db1e267a1"), "A sphere of annihilation is a floating black sphere that pulls any matter that comes into contact with it into a void, destroying it utterly. Anything or anyone destroyed by the sphere can be brought back only by a deity’s direct intervention. The sphere can’t be counteracted by dispel magic or similar effects.", 0 },
                    { new Guid("476e6b56-f4f4-49b1-ab4c-8cca9971ce19"), 1, new Guid("9df2074a-c20d-4472-be2d-4e4db1e267a1"), "The sphere stays entirely still until caused to move by a creature controlling it. Taking control of the sphere requires succeeding at an attempt to activate it. A talisman of the sphere makes it easier to control the sphere.", 0 },
                    { new Guid("29ee64e5-6151-4969-a9cb-1ecacb2916f9"), 0, new Guid("21c2c1f0-3464-4715-bb9b-6c826adab755"), "This loop of adamantine can be slung on a chain to be worn as a necklace, but must be held to convey its benefits. A creature that can’t cast either arcane or occult spells takes 8d6 mental damage just from picking up the item, and they take that damage again at the start of each of their turns if they continue to hold it.", 0 },
                    { new Guid("bb31e579-64ca-49d3-8353-a7b80b5d4fde"), 1, new Guid("21c2c1f0-3464-4715-bb9b-6c826adab755"), "If the wielder can cast arcane or occult spells, they can use the talisman of the sphere to more easily control a sphere of annihilation. This reduces the DC of the check to control the sphere or Sustain the Activation by 10.", 0 },
                    { new Guid("e1268c35-692c-4e4a-a0f9-4e320cf35a0a"), 0, new Guid("728c2f98-495a-4972-ba56-b1fd29aaa89a"), "Hunter's Dawn is a +3 greater striking speed ghost touch club. However, the notched head of the weapon marks it as an atlatl, an ancient tool used for throwing darts and javelins. You can use Hunter's Dawn with a mundane dart or javelin like you would use a bow with an arrow; when you do so, the range of the dart or javelin is doubled, and the dart or javelin uses Hunter's Dawn to determine its attack modifier and damage dice.", 0 },
                    { new Guid("4cb9737c-fb0a-486b-b3db-2583751a5cc4"), 0, new Guid("102f0cfa-a922-428b-b340-713c25efa512"), "A Large or smaller restrained or willing creature can be executed by a final blade. As an artifact, a final blade cannot be harmed by any but a very specific means.", 0 },
                    { new Guid("82640fc0-235c-42b2-a213-98018b734bf1"), 2, new Guid("f52c155f-6264-405c-a860-ca23f4c1fa0c"), "Serithtial is willing to work with a partner of almost any alignment as long as they are dedicated to defeating the great wyrm Kazavon and the forces of Zon-Kuthon. If you ignore those threats and pursue your own agenda instead, before long Serithtial attempts to seize control of your body (DC 45 Will save to resist her control), though she typically remains in control for only long enough to find a more worthy partner. You can attempt a new Will save each day to retake control of your body.", 0 },
                    { new Guid("4673df5f-7916-49ff-baba-3fd8846f5340"), 1, new Guid("f52c155f-6264-405c-a860-ca23f4c1fa0c"), "Serithtial was forged as a bastard sword, and she reverts to this shape when no one wields her, but she can also detect what sort of blade her current wielder prefers and transform into it (choosing from dagger, shortsword, longsword, scimitar, falchion, greatsword, rapier, or bastard sword) using an action, which she does when first held. The wielder can empathically tell Serithtial to transform at any time by using a single action, which has the concentrate trait, after which Serithtial uses an action to transform.", 0 },
                    { new Guid("27cf28aa-6ebb-47ca-86c6-a81244952b4b"), 0, new Guid("f52c155f-6264-405c-a860-ca23f4c1fa0c"), "The legendary blade Serithtial is said to have been forged by Iomedae, goddess of honor, justice, and valor. She is an intelligent +4 major striking holy bastard sword. Although the sword is made of steel, Serithtial is also treated as cold iron and silver, allowing her to deal more damage to certain supernatural creatures. She glows as bright as a torch, but you or Serithtial can suppress or resume this glow as a single action, which has the concentrate trait. In addition, Strikes with Serithtial deal an additional 2d6 damage against creatures that are worshippers of Zon-Kuthon, and while wielding Serithtial, you constantly benefit from death ward and freedom of movement spells that function only against effects created by followers of Zon-Kuthon.", 0 },
                    { new Guid("8efd9689-5eac-43fb-922a-4caf975cb2da"), 0, new Guid("7b9cb35a-6622-4e64-ab2e-142cfa2e413f"), "This bizarre machine is a complex arrangement of flasks, tubes, and other alchemical equipment. The philosopher’s extractor is designed to create the ultimate alchemical concoctions. The extractor functions as an exceptional set of alchemist’s tools, granting a +4 item bonus to Crafting checks related to alchemy. When using the extractor to Craft an alchemical item or with infused reagents as part of your daily preparations, you can create impeccable alchemical items. An impeccable alchemical item always uses the maximum numerical value possible for any rolls it requires, such as dealing maximum damage with alchemist’s fire or restoring the maximum number of Hit Points with an elixir of life. If the impeccable item has a duration, it lasts twice as long as normal. Finally, an impeccable alchemical item never has a drawback.", 0 },
                    { new Guid("d834fca2-601c-492d-bedf-3c6a6c08495d"), 0, new Guid("7ff9f558-f18c-49f6-be41-5d9ba4644c4c"), "The hilt of this +3 major striking axiomatic spell-storing longsword is simple and elegant. The blade itself is made of throneglass—a clear, jewellike crafting material with a razor-sharp edge, capable of absorbing psychic magic and redirecting it at the wielder's enemies. Whenever the Kortos Diamond is in an area of dim or brighter light, it glows faintly, as if reflecting the light of a setting sun.", 0 },
                    { new Guid("34bd4d93-1d52-4106-ab56-cd88e6d95960"), 1, new Guid("7ff9f558-f18c-49f6-be41-5d9ba4644c4c"), "While wielding the Kortos Diamond, you gain a +2 item bonus on saving throws against mental effects. You can never harm yourself with the Kortos Diamond, even if confused.", 0 },
                    { new Guid("746ff687-b0a3-4719-aa1d-20886670e0d1"), 2, new Guid("7ff9f558-f18c-49f6-be41-5d9ba4644c4c"), "If you ever travel farther than 100 miles from the Isle of Kortos while in possession of the Kortos Diamond, the sword becomes impossibly heavy; you are encumbered as long as you carry the sword and remain outside of this area. If you relinquish the Kortos Diamond while away from Kortos, the sword gradually makes its way back to the isle over the course of a year.", 0 },
                    { new Guid("06e94be7-eb11-4b79-853b-f2853628e951"), 0, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "This gold necklace sports six bails, each with a different aeon stone. The backside of each bail is engraved with a single ancient Azlanti rune: Patience, Remembrance, Resilience, Tenacity, Wisdom, Invention.", 0 },
                    { new Guid("b30711b0-b616-4073-a826-7fd886735ebb"), 1, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "While a bail is active, you recall pieces of childhood memories, brief stories and lessons spoken to you by Aroden. The knowledge imparted by each bail carries a specific power but also allows you to access the invested and resonant powers of the aeon stone in the active bail's slot as though the stone orbited your head. Each day at dawn, a new bail becomes active; roll 1d6 to determine which bail is active, determined by the table below. Only one bail can be active at any time.", 0 },
                    { new Guid("06dc3b48-0a47-4205-b8cf-ca57d93219d2"), 0, new Guid("891ae18b-dc47-4426-9148-8aa4669ad0c7"), "This stone tablet is carved with the symbol of a five-branched twig. There are only a limited number of elder signs, and each time one is destroyed, the universe’s doom creeps inexorably closer. Reciting one of three different occult mantras (DC 20 Occultism check to do so correctly) allows three different activations. All three abilities work only on a creature connected to the Elder Mythos or a cosmic horror, such as a wendigo or gug; the activations refer to them as “eldritch creatures.”", 0 },
                    { new Guid("03d6a790-e939-4e54-b8b5-47fa7bb37e16"), 4, new Guid("e18f640a-b8dc-42d2-8a31-15b2b31e6082"), "Active Power: Telepathy with a range of 100 feet.", 0 },
                    { new Guid("cf4b2572-15b2-46c4-80a2-87cfd0336fa9"), 1, new Guid("bded304e-fe37-4721-ac02-f50e00ede945"), "The mirror can form a bond with a spellcaster who has legendary proficiency in Arcana or Occultism, who becomes the mirror’s owner. Regardless of where the mirror is, as long as the bond remains, the owner is aware of everything the mirror is currently reflecting and can use the mirror’s activations.", 0 },
                    { new Guid("dc33df00-507e-4ffd-927b-6fc4859f38a2"), 5, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Brass Dragon - Speak with Animals", 2 },
                    { new Guid("3c772c10-e144-498e-b4e9-c8cd7c03eabd"), 0, new Guid("c718686d-6681-474a-8bfa-3d89c5040e11"), "This imposing helm bears the horns of a powerful black dragon. While wearing the Horns of Naraga, you gain greater darkvision and immunity to acid. If you are undead, you gain resistance 40 to positive damage. If you are not undead, the helm quickly saps the life from you, dealing 10d6 negative damage to you every round. If you die from this damage, you rise as an undead of an equal level in 1d4 rounds.", 0 },
                    { new Guid("14f5c069-e01c-42cc-bba6-852837ce6ab7"), 7, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Copper Dragon - Hideous Laughter", 2 },
                    { new Guid("602ffa00-2543-4898-8b60-63c7c07ecaa7"), 1, new Guid("abb06321-d119-48af-a60b-edac04a3ec43"), "A seal constantly rings with the quiet sound of a hammer striking an anvil when etched onto a runestone. A Forgefather’s seal can be etched only onto armor that can bear two or more property runes, and it is so powerful that it takes the place of two property runes. While wearing armor etched with a Forgefather’s seal, you gain fire resistance 40. You ignore the armor’s check penalty and Speed penalty (if any); if the armor is light or medium, increase its item bonus to AC by 1. In addition, any shield you wield automatically recovers 10 Hit Points at the start of your turn each round.", 0 },
                    { new Guid("dcc038e9-e37a-4dde-8500-315430bd9228"), 0, new Guid("68d3579e-e06f-49d1-90d6-d414cb6b38cc"), "This fist-sized, 12-rayed black star sapphire is sacred to Yuelral, the elven goddess of magic and jewels, and most accounts of its creation attribute its crafting to a circle of her worshippers. In addition to the abilities listed below, the gem functions as a portal key for Jewelgate at Alseta's Ring.", 0 },
                    { new Guid("f79c469b-f540-423c-a94f-0a6f124b5796"), 8, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Green Dragon - Entangle", 2 },
                    { new Guid("23c1524b-a78a-49fd-adae-ed9c66eee9fc"), 9, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Red Dragon - Wall of Fire", 2 },
                    { new Guid("e1fa14e3-8a5d-42b6-93fc-d4c28316d527"), 1, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "While holding an orb of dragonkind, you are immune to the breath weapon of the dragon variety associated with the orb. An orb of dragonkind also grants a number of additional senses. You can communicate verbally and visually with the bearers of other orbs as if you were in the same room with them. You know if there are any dragons within 10 miles of you at all times; this extends to 100 miles for dragons of the type associated with the orb. If an associated dragon is within 1 mile, you know which direction the dragon is from you and the dragon’s age, such as young, adult, or ancient. Each orb grants a 10th-level arcane innate spell that you can cast at will, determined by the specific orb.", 0 },
                    { new Guid("9d542198-3196-4001-a95b-723e2ee36c84"), 0, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Each of the legendary orbs of dragonkind contains the essence and personality of a powerful dragon, with each of the 10 most famous orbs preserving a different type of metallic or chromatic dragon’s spirit. It is believed that orbs for other types of true dragons exist, though that theory is yet to be confirmed.", 0 },
                    { new Guid("82de367f-d2e2-4783-9f68-78c6a9de3a72"), 4, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Blue Dragon -  Hallucinatory Terrain", 2 },
                    { new Guid("392e639b-bfb6-4e0b-8f51-43b60355d39b"), 0, new Guid("6876bf26-aa49-47df-93b8-0cf49c35c732"), "A large crystal of warpglass floats above the head of this silvery purple +3 anarchic greater striking club. If you successfully Strike a creature, the cane also affects the target with a warpwave. While you carry the cane, you hear a constant, distracting chorus of laughing, incoherent Protean whispers and sing-song voices in your mind. Blatant acts of self-indulgence or narcissism quell these whispers, from a few minutes up to a full day depending on the scope of the act, but they immediately return when you use the artifact's powers. The gradually rising chorus eventually drives away rational thought and renders the cane's owner insane, even if staved off from time to time with self-centered acts. As the artifact's abilities pull material from the Maelstrom, it doesn't function in areas where planar connections are severed.", 0 },
                    { new Guid("9b5cfe93-7dd0-42a1-bc69-bb62d636588a"), 0, new Guid("331edf40-1407-4108-8dce-317d8b137902"), "This shining prism is bound within a golden frame. The bright glow within the artifact is the gleaming essence of celestials bound within it in ancient times. Each activation consumes a bit of this celestial energy, projecting the screams of the celestials into your mind. While holding the Radiant Spark, you gain a +2 item bonus to saving throws against divine spells and effects and you are aware of its powers. If you are good, while holding the Radiant Spark, you are sickened 3 and can't recover from this condition.", 0 },
                    { new Guid("740c73e9-7624-4402-89be-75b7f1b0c358"), 0, new Guid("698dcef9-9c91-435c-9fc1-e81f0ec05113"), "The blade of this +4 major striking keen returning speed dwarven waraxe is carved with an intricate design depicting countless generations of great dwarven warriors and leaders. The axe has the thrown 30 feet weapon trait, in addition to the normal weapon traits for a dwarven waraxe. Strikes with the axe deal an additional 1d6 damage to orcs. While the axe is in your possession, you gain a +4 item bonus when Crafting armor, jewelry, metalworking, stonemasonry, snares, traps, and weapons. If you are a dwarf, you gain greater darkvision while holding the axe. If you are not a dwarf, you are stupefied 4 while holding the axe, and if you are an orc, you are also drained 4 and enfeebled 4 while holding it.", 0 },
                    { new Guid("167dac7c-57ee-4a7c-abe0-451610253f3a"), 10, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Silver Dragon - Detect Alignment (Evil Only)", 2 },
                    { new Guid("1c34a392-d6c7-4afd-9bed-045f8f73a67c"), 11, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "White Dragon - Wall of Ice", 2 },
                    { new Guid("168a2ff2-1a98-469a-af9f-696d03ddb7b8"), 12, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "The Orb of Gold Dragonkind can convey the innate spells of any of the other orbs, as well as their activated abilities, but it can grant each individual power only once per day. In addition, the bearer of the gold orb can use its 3-action activation to attempt to cast dominate on the bearer of another orb if they are within 1 mile, as if that bearer were a dragon of the associated type within 500 feet. The last reports of the Orb of Gold Dragonkind on Golarion indicate the orb has been destroyed, however. GMs running campaigns in settings other than the Age of Lost Omens might decide the gold orb is still intact for their campaigns.", 0 },
                    { new Guid("0fc0294d-916b-46ec-89bc-1c169be0921e"), 0, new Guid("abb06321-d119-48af-a60b-edac04a3ec43"), "This rune was created by Torag, god of the forge, protection, and strategy, and shared with his greatest artisans and warriors. Torag designed a small number of these seals as gifts to allied good deities; each one is nearly identical but has a different spell effect when using the reaction activation; for instance, Sarenrae’s seal casts sunburst instead of earthquake.", 0 },
                    { new Guid("45f5a2ef-ea83-4612-8a0a-6bc6264f565d"), 3, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Black Dragon - Darkness", 2 },
                    { new Guid("1600ee15-8184-43c9-a91b-0176a4652bf0"), 6, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Bronze Dragon - Control Water", 2 },
                    { new Guid("7324742d-6b8c-4cca-af95-6da429d593c2"), 13, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Bearing an orb of dragonkind earns you the enmity of all dragonkind forever because you profited from the enslavement of the dragon within the orb, even if you later lose the orb.", 0 },
                    { new Guid("2c286586-c351-43c1-9d36-0c7dba7a4c19"), 2, new Guid("bded304e-fe37-4721-ac02-f50e00ede945"), "Whenever an intelligent creature looks in the mirror, they see an image of a person, creature, or item they find irresistible—most often one they find attractive. The specific image varies depending on the observer, even when more than one creature is looking into the mirror at the same time. Observers are fascinated by the images in the mirror unless they succeed at a DC 35 Will save each round. On a failure, they stare blankly at the mirror for as long as it remains in view, and if it leaves their view, they stare toward the last place they saw the mirror for several minutes thereafter. This is an emotion, enchantment, incapacitation, and visual effect. Creatures that are fascinated by the mirror are so deeply entranced that they don’t end their fascinated condition automatically even if a creature uses hostile actions against them or their allies; instead, they can attempt a DC 30 Will save to end the fascination. At the GM’s discretion, a truly innocent creature or a creature that has renounced all worldly pleasures might be immune to the mirror’s fascination.", 0 }
                });

            migrationBuilder.InsertData(
                table: "Artifacts_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("369b9774-9f0c-402b-b623-4a4822cfddd8"), 3, new Guid("b4db8880-410e-4dbb-b645-c3f185eb05fd"), "To activate Gauntlight, a creature must be in the deepest portion of the artifact (this chamber is in the Temple level and is presented in “Eyes of Empty Death”). From this point, a creature can observe the world outside remotely through Gauntlight's lens, including any area Gauntlight's beam can reach.", 0 },
                    { new Guid("8d123bc6-d298-4886-948b-01d5cc061436"), 0, new Guid("5e4e2abd-2eb8-44ee-95e4-817d36a5b3c0"), "This enormous, multifaceted prism normally rests on a pedestal, eerily refracting many-colored lights even when no light source is present. In reality, the prism refracts the four magical essences into the visible spectrum. A creature adjacent to the prism can adjust its facets with an Interact action to change between two polarities. Two essences flow from two input streams into the prism, where the prism combines them into a single output stream; alternatively, a single essence flows from one input stream into the prism and is split into two output streams. A creature that enters and stays within an input essence stream for 1 minute is slowly encased in solid magic, at which point it is paralyzed until anyone reverses the prism’s flow or finishes activating the prism. A creature stepping into an output essence stream is gently pushed back and out of the stream.", 0 },
                    { new Guid("3e421240-dab3-4c28-a64c-43b19c62a867"), 2, new Guid("b4db8880-410e-4dbb-b645-c3f185eb05fd"), "In Gauntlight's current state of diminished functionality, it can be activated only in the two ways below. By swapping in a series of magical lighthouse lenses that focus Nhimbaloth's baleful gaze—lenses so powerful that even Belcorra takes special care with them—the artifact gains significantly greater power, including the ability to reach all the way to Absalom and to activate its effects every minute. These lenses are described in “Eyes of Empty Death,” the third adventure in the Abomination Vaults Adventure Path.", 0 },
                    { new Guid("9f0d6f61-9bba-47e5-b23f-fafb872fb9c3"), 1, new Guid("b4db8880-410e-4dbb-b645-c3f185eb05fd"), "As an artifact, Gauntlight can't be damaged by normal means. Its walls are impenetrable and impervious to any attempt to breach them by anybody except for followers of Nhimbaloth. They block effects that allow temporary passage, such as passwall, and also create a barrier against dimensional travel. The walls attempt to counteract teleportation effects and planar travel into or out of areas within Gauntlight and efforts to summon creatures into the area (using a +37 counteract modifier); this effect does not stop a summoned creature from departing when the summoning ends.", 0 },
                    { new Guid("8a36d614-6dba-4072-8429-815632f8ee42"), 0, new Guid("b4db8880-410e-4dbb-b645-c3f185eb05fd"), "Gauntlight is much more than a 115-foot-tall lighthouse rising from the heart of an old ruin in Fogfen—its pale stone walls extend far below the ruins, passing through eight different dungeon levels and finally terminating at the ninth level below the surface, where its deep foundation centers on an ominous chamber where, long ago, Nhimbaloth herself once physically brushed against this world. Once she finished its physical construction, the sorcerer Belcorra Haruvex used this spot as a source of power to infuse the walls, floors, and ceilings of each of Gauntlight's levels with eldritch power. The lens at the apex of the lighthouse would have, in time, been able to focus this lingering eldritch energy into a powerful beam, but Belcorra's plans were cut short before she could replace the mundane lenses with dangerous magical ones.", 0 },
                    { new Guid("a14bec0f-8fd8-4531-98ea-8dbf3ea3409f"), 2, new Guid("6aba5b09-40e2-4e95-99ce-1db9bf9b1c13"), "Spell Granted (DC 40)", 1 }
                });

            migrationBuilder.InsertData(
                table: "Conditions",
                columns: new[] { "Id", "ConditionCategoryId", "Name", "OverridesConditionId", "SourcePageId" },
                values: new object[,]
                {
                    { new Guid("ecb312a5-4e27-43b9-89ec-1a615d9f9dc2"), null, "Restrained", new Guid("918a03c5-27d2-458f-8bbf-2d1933738415"), new Guid("de1236fc-c4e3-4f46-b8e3-1f3e06b2314d") },
                    { new Guid("43bea701-97ae-4ab1-8e30-e42fcff51f41"), new Guid("d104a1f4-fb11-45c3-84b7-14880d673095"), "Unnoticed", new Guid("ff7b682f-13ff-464f-a230-89cc814186ea"), new Guid("6136be14-61d3-44fa-9e44-f2a5006a6098") },
                    { new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), new Guid("18744a3c-8c8d-4298-8be7-f5e7e5dc0a6b"), "Unconscious", new Guid("ff7b682f-13ff-464f-a230-89cc814186ea"), new Guid("5486ed38-3692-4186-80e4-1746c21c7130") },
                    { new Guid("4d045584-3a7f-433b-ad89-0f658c379923"), null, "Stunned", new Guid("f253f20f-d7d3-4fe6-bb19-8d521afd9436"), new Guid("81b59165-360f-4844-909f-bdff6fe8da0b") },
                    { new Guid("e9e00854-3d42-48b7-9724-017c8a46e3c0"), new Guid("224d0ea9-af56-49b9-946d-ce809b894701"), "Blinded", new Guid("ff7b682f-13ff-464f-a230-89cc814186ea"), new Guid("f743a373-99c3-4e37-973a-cd274745c865") }
                });

            migrationBuilder.InsertData(
                table: "Conditions_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("0b8cf255-bc93-4438-ad6d-efba1a02255e"), 1, new Guid("a263fc00-a122-416e-8213-a7214fa9a30f"), "Each time you get a full night’s rest, your drained value decreases by 1. This increases your maximum Hit Points, but you don’t immediately recover the lost Hit Points.", 0 },
                    { new Guid("d8350c52-3a4a-44e0-89d0-6c5cd546bd5e"), 0, new Guid("c674e766-939d-47fa-9c94-80173d59741f"), "You feel ill. Sickened always includes a value. You take a status penalty equal to this value on all your checks and DCs. You can’t willingly ingest anything—including elixirs and potions—while sickened.", 0 },
                    { new Guid("82673ddd-1dab-44ae-bb04-c8cc8c57d0a8"), 1, new Guid("c674e766-939d-47fa-9c94-80173d59741f"), "You can spend a single action retching in an attempt to recover, which lets you immediately attempt a Fortitude save against the DC of the effect that made you sickened. On a success, you reduce your sickened value by 1 (or by 2 on a critical success).", 0 },
                    { new Guid("631ddfce-8c66-467a-bb23-d5618e11b941"), 2, new Guid("b9c63a02-449e-43c2-a236-5a3f851f766f"), "Each time you take damage from an attack or spell, you can attempt a DC 11 flat check to recover from your confusion and end the condition.", 0 },
                    { new Guid("672f53e9-c341-4d76-befe-8f2f97c3d693"), 0, new Guid("d4d10f5f-e6cc-4acc-a8b3-3a29de451366"), "Someone else is making your decisions for you, usually because you’re being commanded or magically dominated. The controller dictates how you act and can make you use any of your actions, including attacks, reactions, or even Delay. The controller usually does not have to spend their own actions when controlling you.", 0 },
                    { new Guid("7577f633-3d1c-4a3d-a71b-6310daabf88e"), 0, new Guid("a9bb8a46-7442-4480-b008-c706d7d4ef2f"), "Your thoughts and instincts are clouded. Stupefied always includes a value. You take a status penalty equal to this value on Intelligence-, Wisdom-, and Charisma-based checks and DCs, including Will saving throws, spell attack rolls, spell DCs, and skill checks that use these ability scores. Any time you attempt to Cast a Spell while stupefied, the spell is disrupted unless you succeed at a flat check with a DC equal to 5 + your stupefied value.", 0 },
                    { new Guid("54bff588-112b-46db-a7b9-eeeaf955a417"), 0, new Guid("f253f20f-d7d3-4fe6-bb19-8d521afd9436"), "You have fewer actions. Slowed always includes a value. When you regain your actions at the start of your turn, reduce the number of actions you regain by your slowed value. Because slowed has its effect at the start of your turn, you don’t immediately lose actions if you become slowed during your turn.", 0 },
                    { new Guid("fae04dbc-8bb8-4771-b3a0-32b0b0da09f8"), 0, new Guid("ff7b682f-13ff-464f-a230-89cc814186ea"), "Your eyes are overstimulated. If vision is your only precise sense, all creatures and objects are concealed from you.", 0 },
                    { new Guid("99b1c88a-5271-4aab-bbb1-e5ec21a4b3b4"), 1, new Guid("b9c63a02-449e-43c2-a236-5a3f851f766f"), "You use all your actions to Strike or cast offensive cantrips, though the GM can have you use other actions to facilitate attack, such as draw a weapon, move so that a target is in reach, and so forth. Your targets are determined randomly by the GM. If you have no other viable targets, you target yourself, automatically hitting but not scoring a critical hit. If it’s impossible for you to attack or cast spells, you babble incoherently, wasting your actions.", 0 },
                    { new Guid("24e658a1-86a6-40da-86a3-6f67b13d4598"), 0, new Guid("3c3ce9f5-aceb-4db8-810a-1291035cf709"), "After you die, you can’t act or be affected by spells that target creatures (unless they specifically target dead creatures), and for all other purposes you are an object. When you die, you are reduced to 0 Hit Points if you had a different amount, and you can’t be brought above 0 Hit Points as long as you remain dead. Some magic can bring creatures back to life, such as the resurrect ritual or the raise dead spell.", 0 },
                    { new Guid("08040555-c8af-43ef-bd71-ba3500bf3ff4"), 0, new Guid("d7416bc0-79b9-42c0-9335-e420dd3e0f50"), "When you are undetected by a creature, that creature cannot see you at all, has no idea what space you occupy, and can’t target you, though you still can be affected by abilities that target an area. When you’re undetected by a creature, that creature is flat-footed to you.", 0 },
                    { new Guid("379e4285-0155-4d1d-a2e3-5fb70df0a394"), 1, new Guid("d7416bc0-79b9-42c0-9335-e420dd3e0f50"), "A creature you’re undetected by can guess which square you’re in to try targeting you. It must pick a square and attempt an attack. This works like targeting a hidden creature (requiring a DC 11 flat check, as described on page 466), but the flat check and attack roll are rolled in secret by the GM, who doesn’t reveal whether the attack missed due to failing the flat check, failing the attack roll, or choosing the wrong square.", 0 },
                    { new Guid("a411f8ea-e37b-4cc7-a8c2-0dfb167537f7"), 2, new Guid("d7416bc0-79b9-42c0-9335-e420dd3e0f50"), "A creature can use the Seek action to try to find you, as described on page 471.", 0 },
                    { new Guid("c738f0a6-bf21-43d4-a869-12019f22a359"), 0, new Guid("ca2e35fe-8529-4ba3-a860-1bbde1c1c8f8"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is unfriendly to a character dislikes and specifically distrusts that character. The unfriendly creature won’t accept Requests from the character.", 0 },
                    { new Guid("7101deb8-d849-472c-9ec6-13c6921c213e"), 0, new Guid("8f6d81d5-64f1-455e-80c8-7835accb6613"), "You have been seriously injured. If you lose the dying condition and do not already have the wounded condition, you become wounded 1. If you already have the wounded condition when you lose the dying condition, your wounded condition value increases by 1. If you gain the dying condition while wounded, increase your dying condition value by your wounded value.", 0 },
                    { new Guid("0bfacc23-4b09-44c1-a157-49a246b3d704"), 1, new Guid("8f6d81d5-64f1-455e-80c8-7835accb6613"), "The wounded condition ends if someone successfully restores Hit Points to you with Treat Wounds, or if you are restored to full Hit Points and rest for 10 minutes.", 0 },
                    { new Guid("a1b5f2c5-4799-468a-a3aa-7742b80487d5"), 1, new Guid("3c3ce9f5-aceb-4db8-810a-1291035cf709"), "This is not an official status condition, but a pf2e.io liberty to smooth out some of the inconsistencies in the rulesbooks.", 3 },
                    { new Guid("9403c4ab-8ecf-4cba-921d-33164c193893"), 0, new Guid("31b26b64-2616-4d23-93de-f3dbc0c81b7d"), "You can’t hear. You automatically critically fail Perception checks that require you to be able to hear. You take a –2 status penalty to Perception checks for initiative and checks that involve sound but also rely on other senses. If you perform an action with the auditory trait, you must succeed at a DC 5 flat check or the action is lost; attempt the check after spending the action but before any effects are applied. You are immune to auditory effects.", 0 },
                    { new Guid("8cf1621e-3546-4afa-a642-b9230fdb4738"), 0, new Guid("824a03c0-0108-4896-8c0a-8af3a09cd738"), "A powerful force has gripped your soul, calling you closer to death. Doomed always includes a value. The dying value at which you die is reduced by your doomed value. If your maximum dying value is reduced to 0, you instantly die. When you die, you’re no longer doomed.", 0 },
                    { new Guid("78319886-dc7a-4b52-bf06-737bd98c21e3"), 1, new Guid("824a03c0-0108-4896-8c0a-8af3a09cd738"), "Your doomed value decreases by 1 each time you get a full night’s rest.", 0 },
                    { new Guid("89509236-9bb3-418e-be29-e31380949594"), 0, new Guid("a263fc00-a122-416e-8213-a7214fa9a30f"), "When a creature successfully drains you of blood or life force, you become less healthy. Drained always includes a value. You take a status penalty equal to your drained value on Constitution-based checks, such as Fortitude saves. You also lose a number of Hit Points equal to your level (minimum 1) times the drained value, and your maximum Hit Points are reduced by the same amount. For example, if you’re hit by an effect that inflicts drained 3 and you’re a 3rd-level character, you lose 9 Hit Points and reduce your maximum Hit Points by 9. Losing these Hit Points doesn’t count as taking damage.", 0 },
                    { new Guid("ab4a8033-4de6-4f8c-bd8c-8576da289805"), 1, new Guid("48d6ee37-8a18-4162-9164-9f7892045d2d"), "You recover from fatigue after a full night’s rest.", 0 },
                    { new Guid("4747231a-c95e-488a-9cf8-6ebef9bfadfa"), 0, new Guid("64d1cfdc-8539-4bf7-95f2-60d53788079b"), "While you are concealed from a creature, such as in a thick fog, you are difficult for that creature to see. You can still be observed, but you’re tougher to target. A creature that you’re concealed from must succeed at a DC 5 flat check when targeting you with an attack, spell, or other effect. Area effects aren’t subject to this flat check. If the check fails, the attack, spell, or effect doesn’t affect you.", 0 },
                    { new Guid("cbf8d506-afc9-41c1-9d3f-22372c9a3bc3"), 0, new Guid("069fffa5-3fe0-4892-a04d-1bd28a6225a3"), "You are bleeding out or otherwise at death’s door. While you have this condition, you are unconscious. Dying always includes a value, and if it ever reaches dying 4, you die. If you’re dying, you must attempt a recovery check (page 459) at the start of your turn each round to determine whether you get better or worse. Your dying condition increases by 1 if you take damage while dying, or by 2 if you take damage from an enemy’s critical hit or a critical failure on your save.", 0 },
                    { new Guid("5a517c41-8680-4408-bbae-7bbc60409082"), 0, new Guid("33b600ff-067e-4a67-a1ce-c85cf2d2382c"), "You are compelled to focus your attention on something, distracting you from whatever else is going on around you. You take a –2 status penalty to Perception and skill checks, and you can’t use actions with the concentrate trait unless they or their intended consequences are related to the subject of your fascination (as determined by the GM). For instance, you might be able to Seek and Recall Knowledge about the subject, but you likely couldn’t cast a spell targeting a different creature. This condition ends if a creature uses hostile actions against you or any of your allies.", 0 },
                    { new Guid("d07b32ec-d323-4126-a929-b8205acfdbb8"), 0, new Guid("f0366047-21ca-4f51-971e-4f7c72629b74"), "You’re physically weakened. Enfeebled always includes a value. When you are enfeebled, you take a status penalty equal to the condition value to Strength-based rolls and DCs, including Strength-based melee attack rolls, Strength-based damage rolls, and Athletics checks.", 0 },
                    { new Guid("e1d864f8-5b68-4c68-b26a-b615fcddef91"), 0, new Guid("72287426-a2d9-4d8b-8b2a-9a696baa3f1d"), "You’re distracted or otherwise unable to focus your full attention on defense. You take a –2 circumstance penalty to AC. Some effects give you the flat-footed condition only to certain creatures or against certain attacks. Others— especially conditions—can make you universally flatfooted against everything. If a rule doesn’t specify that the condition applies only to certain circumstances, it applies to all of them; for example, many effects simply say “The target is flat-footed.”", 0 },
                    { new Guid("92d8268f-caec-4b0e-abe6-3d325bf3746e"), 0, new Guid("35e06ece-e68a-4201-a215-8e3a29f30840"), "You’re forced to run away due to fear or some other compulsion. On your turn, you must spend each of your actions trying to escape the source of the fleeing condition as expediently as possible (such as by using move actions to flee, or opening doors barring your escape). The source is usually the effect or caster that gave you the condition, though some effects might define something else as the source. You can’t Delay or Ready while fleeing.", 0 },
                    { new Guid("44d2d929-9e51-4618-b433-df0633852619"), 0, new Guid("87851575-72a5-4935-b284-7cb0551fadf2"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is friendly to a character likes that character. The character can attempt to make a Request of a friendly creature, and the friendly creature is likely to agree to a simple and safe request that doesn’t cost it much to fulfill. If the character or one of their allies uses hostile actions against the creature, the creature gains a worse attitude condition depending on the severity of the hostile action, as determined by the GM.", 0 },
                    { new Guid("b7dabd8d-11d5-4498-a799-c904741c3619"), 0, new Guid("06cdc6c0-2d59-414e-a1bf-1d1862bae2d7"), "You’re gripped by fear and struggle to control your nerves. The frightened condition always includes a value. You take a status penalty equal to this value to all your checks and DCs. Unless specified otherwise, at the end of each of your turns, the value of your frightened condition decreases by 1.", 0 },
                    { new Guid("91795d9e-e963-4fe4-98ab-bfc3f00b1b63"), 2, new Guid("8ecb38b2-d7fb-440f-b096-cf381652b2ff"), "If an effect makes an item broken automatically and the item has more HP than its Broken Threshold, that effect also reduces the item’s current HP to the Broken Threshold.", 0 },
                    { new Guid("d5009a32-f90e-465d-a23d-c0d1bf4957e7"), 1, new Guid("8ecb38b2-d7fb-440f-b096-cf381652b2ff"), "A broken item still imposes penalties and limitations normally incurred by carrying, holding, or wearing it. For example, broken armor would still impose its Dexterity modifier cap, check penalty, and so forth.", 0 },
                    { new Guid("355e56d4-13ed-47e0-a9ca-9a79ce8d41b9"), 0, new Guid("918a03c5-27d2-458f-8bbf-2d1933738415"), "You’re held in place by another creature, giving you the flat-footed and immobilized conditions. If you attempt a manipulate action while grabbed, you must succeed at a DC 5 flat check or it is lost; roll the check after spending the action, but before any effects are applied.", 0 },
                    { new Guid("38e865fe-53ed-43bd-b220-3c9498fca119"), 0, new Guid("170bff5c-bcac-433d-94a0-840da90112af"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is helpful to a character wishes to actively aid that character. It will accept reasonable Requests from that character, as long as such requests aren’t at the expense of the helpful creature’s goals or quality of life. If the character or one of their allies uses a hostile action against the creature, the creature gains a worse attitude condition depending on the severity of the hostile action, as determined by the GM.", 0 },
                    { new Guid("1b0fb05d-5c1a-429c-9a8e-65729fa82c9e"), 0, new Guid("4f1b10d8-98e2-43f2-b3a4-22e6b11ea699"), "While you’re hidden from a creature, that creature knows the space you’re in but can’t tell precisely where you are. You typically become hidden by using Stealth to Hide. When Seeking a creature using only imprecise senses, it remains hidden, rather than observed. A creature you’re hidden from is flat-footed to you, and it must succeed at a DC 11 flat check when targeting you with an attack, spell, or other effect or it fails to affect you. Area effects aren’t subject to this flat check.", 0 },
                    { new Guid("891ef18a-15d1-4256-b2b9-c67320503e38"), 1, new Guid("4f1b10d8-98e2-43f2-b3a4-22e6b11ea699"), "A creature might be able to use the Seek action to try to observe you, as described on page 471.", 0 },
                    { new Guid("c921983d-388a-4891-b90b-7f024cfc9b6b"), 0, new Guid("d56a5083-fa2f-4d9c-a968-0b7664e1c9cd"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is hostile to a character actively seeks to harm that character. It doesn’t necessarily attack, but it won’t accept Requests from the character.", 0 },
                    { new Guid("eebe0f58-737c-4da3-a349-45e68247f56b"), 0, new Guid("b335312b-5956-436b-a8df-c426704a41ba"), "You can’t use any action with the move trait. If you’re immobilized by something holding you in place and an external force would move you out of your space, the force must succeed at a check against either the DC of the effect holding you in place or the relevant defense (usually Fortitude DC) of the monster holding you in place.", 0 },
                    { new Guid("291d7186-938c-4caf-a163-8311f6fa9ce3"), 0, new Guid("f13e0f97-112a-4ffa-843a-00b406ee963d"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is indifferent to a character doesn’t really care one way or the other about that character. Assume a creature’s attitude to a given character is indifferent unless specified otherwise.", 0 },
                    { new Guid("1d7e6205-8464-4e8b-9909-0ddb38f7849d"), 0, new Guid("b9db96ae-7d84-4616-8831-477d614b4dbd"), "While invisible, you can’t be seen. You’re undetected to everyone. Creatures can Seek to attempt to detect you; if a creature succeeds at its Perception check against your Stealth DC, you become hidden to that creature until you Sneak to become undetected again. If you become invisible while someone can already see you, you start out hidden to the observer (instead of undetected) until you successfully Sneak. You can’t become observed while invisible except via special abilities or magic.", 0 },
                    { new Guid("0a8a7135-4b51-4671-963e-e1c99a28a9fe"), 0, new Guid("6f1426bc-454d-4796-a6b5-a1569dd39ee6"), "Anything in plain view is observed by you. If a creature takes measures to avoid detection, such as by using Stealth to Hide, it can become hidden or undetected instead of observed. If you have another precise sense instead of or in addition to sight, you might be able to observe a creature or object using that sense instead. You can observe a creature only with precise senses. When Seeking a creature using only imprecise senses, it remains hidden, rather than observed.", 0 },
                    { new Guid("0ecf6343-5513-4313-817c-2fee4c074167"), 0, new Guid("5007c3b2-b184-43b1-85d7-ad159d14ccb5"), "You are frozen in place. You have the flat-footed condition and can’t act except to Recall Knowledge and use actions that require only your mind (as determined by the GM). Your senses still function, but only in the areas you can perceive without moving, so you can’t Seek while paralyzed.", 0 },
                    { new Guid("9d44223c-e20f-49a7-b374-528d6c21e714"), 0, new Guid("740be8e2-cab8-4cbe-8065-fd71a6d2192e"), "Your movements become clumsy and inexact. Clumsy always includes a value. You take a status penalty equal to the condition value to Dexterity-based checks and DCs, including AC, Reflex saves, ranged attack rolls, and skill checks using Acrobatics, Stealth, and Thievery.", 0 },
                    { new Guid("b53d24af-320c-4f46-b25a-d65dd014713b"), 0, new Guid("48d6ee37-8a18-4162-9164-9f7892045d2d"), "You’re tired and can’t summon much energy. You take a –1 status penalty to AC and saving throws. You can’t use exploration activities performed while traveling, such as those on pages 479–480.", 0 },
                    { new Guid("61aba62f-6e0b-47e6-87dc-cf5d1f2958f3"), 0, new Guid("e224b6c0-c7aa-4a58-b00f-7c422a7c6250"), "Persistent damage comes from effects like acid, being on fire, or many other situations. It appears as “X persistent [type] damage,” where “X” is the amount of damage dealt and “[type]” is the damage type. Instead of taking persistent damage immediately, you take it at the end of each of your turns as long as you have the condition, rolling any damage dice anew each time. After you take persistent damage, roll a DC 15 flat check to see if you recover from the persistent damage. If you succeed, the condition ends.", 0 },
                    { new Guid("ed6d12ad-822b-45cb-89b3-4318fa50053a"), 0, new Guid("8d531baa-8a75-4090-83d0-fd8721b76ae7"), "You have been turned to stone. You can’t act, nor can you sense anything. You become an object with a Bulk double your normal Bulk (typically 12 for a petrified Medium creature or 6 for a petrified Small creature), AC 9, Hardness 8, and the same current Hit Points you had when alive. You don’t have a Broken Threshold. When you’re turned back into flesh, you have the same number of Hit Points you had as a statue. If the statue is destroyed, you immediately die. While petrified, your mind and body are in stasis, so you don’t age or notice the passing of time.", 0 },
                    { new Guid("39ddfdbd-c9a1-47eb-aa6b-96bc572fefda"), 0, new Guid("b680a37e-cf30-4c4b-886f-a713282892af"), "You’re lying on the ground. You are flat-footed and take a –2 circumstance penalty to attack rolls. The only move actions you can use while you’re prone are Crawl and Stand. Standing up ends the prone condition. You can Take Cover while prone to hunker down and gain greater cover against ranged attacks, even if you don’t have an object to get behind, gaining a +4 circumstance bonus to AC against ranged attacks (but you remain flat-footed).", 0 },
                    { new Guid("7fe8edf9-1e44-4603-bbab-612a53f2dbc8"), 1, new Guid("b680a37e-cf30-4c4b-886f-a713282892af"), "If you would be knocked prone while you’re Climbing or Flying, you fall (see pages 463–464 for the rules on falling). You can’t be knocked prone when Swimming.", 0 },
                    { new Guid("0df66944-a5b6-40d4-a9ce-d00c4d2a0edb"), 0, new Guid("fce417f7-0b9c-4d87-9f0a-45ae5d9a4e53"), "You gain 1 additional action at the start of your turn each round. Many effects that make you quickened specify the types of actions you can use with this additional action. If you become quickened from multiple sources, you can use the extra action you’ve been granted for any single action allowed by any of the effects that made you quickened. Because quickened has its effect at the start of your turn, you don’t immediately gain actions if you become quickened during your turn.", 0 },
                    { new Guid("29645e9c-1185-49a9-be03-ff02cd827421"), 0, new Guid("5da2ad79-54a0-429e-a52a-d654841fb268"), "You are carrying more weight than you can manage. While you’re encumbered, you’re clumsy 1 and take a 10-foot penalty to all your Speeds. As with all penalties to your Speed, this can’t reduce your Speed below 5 feet.", 0 },
                    { new Guid("83f9a4be-3255-4103-a0f9-d5517de0b245"), 1, new Guid("069fffa5-3fe0-4892-a04d-1bd28a6225a3"), "If you lose the dying condition by succeeding at a recovery check and are still at 0 Hit Points, you remain unconscious, but you can wake up as described in that condition. You lose the dying condition automatically and wake up if you ever have 1 Hit Point or more. Any time you lose the dying condition, you gain the wounded 1 condition, or increase your wounded condition value by 1 if you already have that condition.", 0 },
                    { new Guid("ca756fda-2864-47c4-92a2-46392a99aebb"), 0, new Guid("b9c63a02-449e-43c2-a236-5a3f851f766f"), "You don’t have your wits about you, and you attack wildly. You are flat-footed, you don’t treat anyone as your ally (though they might still treat you as theirs), and you can’t Delay, Ready, or use reactions.", 0 },
                    { new Guid("4ccf1630-ee1b-4a52-b41a-d80832acccc8"), 0, new Guid("8ecb38b2-d7fb-440f-b096-cf381652b2ff"), "Broken is a condition that affects objects. An object is broken when damage has reduced its Hit Points to equal or less than its Broken Threshold. A broken object can’t be used for its normal function, nor does it grant bonuses— with the exception of armor. Broken armor still grants its item bonus to AC, but it also imparts a status penalty to AC depending on its category: –1 for broken light armor, –2 for broken medium armor, or –3 for broken heavy armor.", 0 }
                });

