            migrationBuilder.InsertData(
                table: "Hazards",
                columns: new[] { "Id", "ArmorClass", "CanBeDetectedMagically", "ComplexityId", "Description", "Fortitude", "ImmunitiesId", "Level", "Name", "Reflex", "Reset", "RoutineActions", "SourcePageId", "Speed", "TraitsId", "TypeId" },
