                {
                    { new Guid("8bb8a7b1-c597-480b-8a23-5d28157c0310"), null, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "A 15-foot-wide patch of water and sand attempts to submerge creatures that step onto it.", null, null, 3, "Quicksand", null, "The hazard still submerges anyone who walks in, but the surface doesn’t become hidden again until it settles over the course of 24 hours", 1, new Guid("5285ad8d-011b-4404-861a-6c266475600f"), null, null, new Guid("6b56b0d2-5b30-4ccf-b72c-532c244d9b73") },
                    { new Guid("ff781a33-7aa2-426b-adf2-672bcf0e1681"), null, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "A magically contagious wail of the banshee spell is trapped in the larynx of an invisible, mummified elf.", null, null, 18, "Banshee's Symphony", null, "The trap ends when the trap is unable to make a creature scream (usually because no creature failed its save on the previous turn or because all creatures have critically succeeded in the past). It then resets over 24 hours, as a new scream builds up in the mummified larynx.", 1, new Guid("dae57ffc-a1ec-4a36-87fb-6188e72dbd2a"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("12cbc8b1-311a-4826-bf59-784c2a790e0f"), 33, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "Three innocuous decorations instilled with telekinetic magic pull objects and pieces of the room itself into spinning clouds of debris that attack all creatures in the room.", 24, null, 12, "Telekinetic Swarm Trap", 19, "The trap deactivates and resets 10 minutes after it has no target creatures (because the creatures either moved too far away or died).", 9, new Guid("766886e3-4c2d-407c-9691-d36cb4a21258"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("6f1cd8de-db91-4b60-9ae6-e9328c13cceb"), null, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "A cloud of invisible magical sensors in a 10-foot radius surrounds an invisible wall or floor rune the size of the creature to be summoned.", null, null, 1, "Summonining Rune", null, "The trap resets each day at dawn.", null, new Guid("d3f23187-4e4d-4989-9b34-40a4f42da1fe"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("e417fa19-f7e3-4372-988e-8e2ce524e804"), 21, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "A metal pole with three razor-sharp spinning blades is hidden in the floor, connected to trigger plates in up to eight floor tiles and a hidden control panel within 30 feet.", 10, null, 4, "Spinning Blade Pillar", 12, "The trap deactivates and resets after 1 minute.", 3, new Guid("b68c5ba3-4c51-4537-a72a-f1066c6b875f"), 10, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("d609d826-9840-4418-a0a4-9a9531e09f17"), 27, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "Countless holes to launch poison darts from line a long hallway with a hidden control panel on the far end.", 13, null, 8, "Poisoned Dart Gallery", 17, "The trap deactivates and resets after 1 minute.", 1, new Guid("800680a3-465d-4099-b20a-b66da308da97"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("3a554a92-f873-4560-9a1a-ad10916b7f1a"), 30, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "Four gated channels carved into stone allow lava to flow into a 15-foot-tall room; the floor can withdraw to allow the hardened lava to fall into a chamber beneath.", 20, null, 10, "Lava Flume Tube", 16, "The trap deactivates and resets after 1 hour by withdrawing the floor, cracking and dumping the hardened lava (and any creatures trapped inside) into the chamber. Creatures fall 40 feet, taking falling damage (typically 17 bludgeoning damage).", 4, new Guid("9c7423cd-e07c-4a28-8d25-3b3cc4578690"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("06b3ee8e-446d-49e5-8737-551f94484753"), 19, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "A trapdoor covers a 10-foot-square pit that’s 30 feet deep and has 5 feet of water at the bottom. Four water spouts in the walls connect to hidden water tanks. Each water spout extends out of a different wall, 6 inches from the top of the pit.", 8, null, 3, "Drowning Pit", 5, "The trap can be reset if the door is manually reengaged and the water tanks refilled; it can be reset without draining the pit, but doing so renders it less effective.", 4, new Guid("d08cc06e-0eb7-4f3e-b173-7dbb8dcb1b87"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("e3110eda-b8bf-4599-bfe6-d95ebaf43948"), 34, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "A magic mirror replaces characters with evil mirror duplicates from another dimension.", 25, null, 14, "Darkside Mirror", 20, "The mirror is always ready to absorb creatures into the other dimension. Ten minutes after a creature is sucked into the mirror, if an ally doesn’t rescue the creature with Thievery, it reaches the other dimension, where it might be captured or killed. In the mirror dimension, it counts as a mirror duplicate, so the denizens of the other dimension can’t destroy the mirror on their side while the absorbed creature is there. These dimensions are alternate realities, not planes, so even spells like plane shift can’t reach them.", 1, new Guid("6230e629-ec2b-40b4-ab4f-eb1bc6619473"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("3594dc7a-7749-4a92-8b2c-0dbe0ece4ce0"), 43, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A wickedly sharp saw blade descends and travels along grooves in a complex path throughout the room, attempting to decapitate everyone within.", 32, null, 19, "Vorpal Executioner", 32, "The trap resets over the course of the round and can be triggered again 1 round later.", null, new Guid("ca2171bd-fde9-4caf-9dd4-6f9ddc14ff5e"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("9acfc457-78d5-4af1-a8b1-a09f9f2d8312"), 18, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A wall socket loaded with a spear connects to a floor tile in one 5-foot square.", 11, null, 2, "Spear Launcher", 3, null, null, new Guid("ca5b006a-8d72-4b2f-827b-09a48cd3b690"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("504d33ef-0441-4972-b5f5-7019b895e2c6"), 16, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "Pressure-sensitive panels in the floor connect to a stone slab hidden in a hallway’s ceiling.", 10, null, 1, "Slamming Door", 2, null, null, new Guid("86cca78f-c85b-4691-b633-93f649675e00"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("c235d758-9aa7-42fe-93e0-c5ec36092fc4"), null, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "Powerful warding magic tied to an object or location tries to regress the ages of a creature and its allies.", null, null, 21, "Second Chance", null, null, null, new Guid("3aa273d4-ad98-4e64-8ea1-cad0af832e27"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("b658c798-2ef4-4040-9980-7828bbeeb523"), 21, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "Two blades, each hidden in a 15-foot-long ceiling groove, are both connected to a trip wire.", 12, null, 4, "Scythe Blades", 8, "The trap resets after 15 minutes.", null, new Guid("719ab320-45f1-4057-aaea-11055889b36a"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), 24, false, new Guid("dcc2b25e-1b95-401a-8fc6-17f1e1ee7cbb"), "An ornate wheel set into a wall—divided into six segments with colored runes on each—is controlled by a magical sensor that detects any creature within 100 feet in front of it.", 15, null, 6, "Wheel of Misery", 13, "The trap deactivates and resets if 1 minute passes without any creature moving within range of its sensor.", 2, new Guid("742d1efd-6216-4bc1-bbef-e05a55a90fcf"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("5f593e05-0197-4c12-9102-84501831aaf0"), 15, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A spring-loaded, poisoned spine is hidden near the keyhole of a lock. Disabling or breaking the trap does not disable or break the lock.", 8, null, 1, "Poisoned Lock", 4, null, null, new Guid("53f23a87-1e51-4eff-9c24-3a68f6f1a3e8"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("33cde414-62f3-455d-95a2-f0a63480a006"), 27, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "Poisonous mold spores assault nearby creatures.", 17, null, 8, "Yellow Mold", 13, null, null, new Guid("7fb587a3-cfa2-4098-8416-8e2eb615b325"), null, null, new Guid("6b56b0d2-5b30-4ccf-b72c-532c244d9b73") },
                    { new Guid("0b60cd6f-d1e8-4373-83f8-a14907af7e10"), null, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A Druidic glyph tries to transform a trespasser into an animal.", null, null, 12, "Polymorph Trap", null, null, null, new Guid("ae8ab02b-c174-4d9f-8d93-278c34756eea"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("58875d5f-9989-4476-bafe-451b2746e393"), null, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A curse is imbued on an entryway’s threshold.", null, null, 7, "Pharaoh's Ward", null, "The trap resets when the door is shut.", null, new Guid("375da921-2ed7-4ac7-87c5-c738a30e095c"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("db3fa1f2-4ecb-4bac-96bd-126552730b27"), null, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "An object haunted by the echoes of a vicious mind attempts to kill someone who comes near.", null, null, 10, "Bloodthirstt Urge", null, null, null, new Guid("0a8c30a8-ccbe-4e93-9e9e-fa12cc3f6c1f"), null, null, new Guid("9d0426d4-021e-4822-a114-04840f3bb9c4") },
                    { new Guid("6d810cbc-bf1f-4232-9517-cbb95e4b5a33"), 10, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A wooden trapdoor covers a pit that’s 10 feet square and 20 feet deep.", 1, null, 0, "Hidden Pit", 1, "Creatures can still fall into the trap, but the trapdoor must be reset manually for the trap to become hidden again.", null, new Guid("3bcc0fe0-0f4c-4d25-99e3-32db6fdfe7d1"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("e825d010-508c-4618-b2c1-7c8e54a14d96"), null, true, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A roiling red orb, forged from a drop of the god Rovagug’s blood, rains fire from the sky when a specified condition is met.", null, null, 23, "Armageddon Orb", null, null, null, new Guid("0e1b3b3d-aa2d-4963-8bb4-3485e14be099"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("3ad83166-b025-4e40-8e25-f82778e35c0b"), 28, true, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "An iron trapdoor covers an infinitely deep 10 - foot - square pit.", 12, null, 9, "Bottomless Pit", 12, "The trap still causes creatures to fall forever if they fall in, but the trapdoor must be reset manually for the trap to become hidden again.", null, new Guid("6ac226b9-1707-407a-b1cf-b5dce0b967ff"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("d88ecdc0-c9bd-4a42-8409-a215f4a5c034"), 32, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "An enormous hammer at an edifice’s entrance swings down in an attempt to damage a creature entering an area, push it back, and prevent it from going any further.", 24, null, 11, "Hammer of Forbiddance", 15, "The trap resets over the course of the round, and is ready to swing again 1 round later.", null, new Guid("7fe355f0-54eb-46b1-9472-7d4a53a4db08"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("cb9ff968-3115-412d-8f69-86b73d9a20c9"), 24, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A tube of hallucinogenic powder armed with a miniature explosive is connected to a doorknob or similar latch.", 0, null, 6, "Hallucination Powder Trap", 0, null, null, new Guid("a5a01655-41be-4e84-b464-fe3a76e4d1bd"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("53829d01-6277-47bd-9b7c-9f002c965664"), null, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "An invisible rune imprinted on a door latch releases a powerful electric discharge.", null, null, 3, "Electric Latch Rune", null, null, null, new Guid("a83b813a-4c84-482b-b232-30afec68d03b"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
                    { new Guid("d038f033-4ea9-45ee-b0fa-c5707d5eda89"), null, false, new Guid("bac94513-a759-47b1-843f-3acb4946e83b"), "A rift attempts to draw creatures into another plane(the GM chooses the specific plane).", null, null, 13, "Planar Rift", null, null, null, new Guid("4c0d2ac8-48f8-4612-b8ab-72db8b4aa831"), null, null, new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6") },
