            migrationBuilder.InsertData(
                table: "MysteryCurse_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("5eb05a3e-2cbf-4be1-bc67-64ddb0cf6a8a"), 0, new Guid("4141c69e-bc1c-41d9-88ec-af6a57190861"), "You see flames and smoke wherever you look. These flames might be imagined, or they might be a preternatural glimpse of the metaphorical fires that empower the entire multiverse—but you always see them. Fires flare noticeably (though not dangerously) in your presence, you occasionally smoke slightly, and your body is almost painfully hot to the touch.", 0 },
                    { new Guid("3eac266c-7762-41c8-b0a1-4bffcabf9fb0"), 0, new Guid("85727c5e-09d9-4327-a74a-5aaef5e9f3fa"), "You thrive while adrenaline flows and your life depends on your might alone, but holding the collective battle prowess of the ages within you leaves your body weakened after a fight. You smell faintly of steel and blood no matter how you try to remove or mask the scent, you appear more muscular than you actually are, and you hear the faint clash and clamor of battle in the distance at all times.", 0 },
                    { new Guid("d9167484-f379-4fcf-a037-87c8d64040da"), 0, new Guid("05e1db20-e0ed-4827-917e-47397da756cc"), "You have your head in the clouds—and not just figuratively. Your body is drawn toward the heavens, making you lighter and less substantial than you should be. Your eyes glow with starry light, and your hair and clothing float and drift around you.", 0 },
                    { new Guid("a1df679f-6eb9-48e2-91d2-ffa2fe340048"), 0, new Guid("ad233848-92de-4bf0-a8d7-237297aa5001"), "The ancestral spirits you commune with haunt you and meddle with your belongings and actions, either out of a well-intentioned (but ultimately detrimental) attempt to assist you, as punishment for your audacity in circumventing the traditional means of achieving divine power, for their own amusement, or a mixture of the above. Your hair, clothing, and belongings constantly shift and stir, seemingly of their own volition. ", 0 },
                    { new Guid("4c9bccc4-0ac6-488c-82bb-6e89944e554b"), 0, new Guid("c55a6e81-21e1-4496-8800-d8636afd7e79"), "Life energy flows outward from you and connects you to all living things, but you expend your vital essence to do so. Your presence comforts the ill and injured, causes scars to fade slightly, spurs new growth in plants, and otherwise infuses your surroundings with vitality.", 0 },
                    { new Guid("82a9d1b4-5ace-418c-a628-fa559985a06e"), 0, new Guid("e3e28a10-57e2-46e0-9c99-862cddbba90c"), "Your body is slowly decaying even though you are alive, and using your powers furthers this unnatural living death. You carry a touch of the grave about you, manifesting as bloodless pallor, a faint smell of earth, or deathly cold skin.", 0 },
                    { new Guid("fa35d31b-e15a-481b-a82b-eb9cdf264513"), 0, new Guid("89400a72-2d2b-447f-9614-a009afff3252"), "You are the center of your own tiny tempest, ever surrounded by wind and rain that worsens the more you tap into your elemental powers. Even when you are calm and at rest, your hair and clothing are blown about by gentle winds, you are slightly damp, and your touch often comes with a static shock.", 0 },
                    { new Guid("ad1887df-7608-4948-a701-f7eebae85769"), 0, new Guid("6127c7b5-b41e-4f2f-92de-fea98126712f"), "You have a link to true divine knowledge, but your mortal mind struggles to process and act on what you know. Loose materials around you, such as dust, grains of rice, and droplets of water, slowly shift to form strange runes or faint indecipherable writing, and you sometimes speak unintelligible truths or statements in unknown languages without realizing it.", 0 }
                });

