            migrationBuilder.InsertData(
                table: "PreciousMaterialArmors_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("f8ebd9fd-8cf4-4ba7-ae41-d9e9e79abdd9"), 0, new Guid("c6ea2f2a-8c94-4e44-83be-e1a8a728d30c"), "Darkwood armor is 1 Bulk lighter than normal (or light Bulk if its normal Bulk is 1, with no effect on armor that normally has light Bulk). It’s easier to wear than normal wood armor, reducing the Strength score necessary to ignore its check penalty by 2 and reducing its Speed penalty by 5 feet. (There are no types of wood armor in this book).", 0 },
                    { new Guid("5288c524-3508-48a0-86df-73addb0eb5b1"), 0, new Guid("fb952584-d9f7-405e-bab1-d518f3c63519"), "Cold iron armor sickens certain creatures that touch it. A creature with weakness to cold iron (such as most demons and fey) that critically fails an unarmed attack against a creature in cold iron armor becomes sickened 1. A creature with weakness to cold iron is sickened 1 as long as it wears cold iron armor.", 0 },
                    { new Guid("13483736-e390-494f-93ce-aa42d61ff128"), 0, new Guid("9c4884c6-39eb-4ed5-a3fb-d91f19e62f2f"), "Adamantine armor has a shiny, black appearance and is amazingly durable.", 0 },
                    { new Guid("29117c5a-d2ee-4f7c-b39e-2fab654a03b5"), 0, new Guid("afc82eed-f33e-43c6-af78-3c6c6406692f"), "Mithral armor is 1 Bulk lighter than normal (or light Bulk if its normal Bulk is 1, with no effect on armor that normally has light Bulk). It’s easier to wear than normal metal armor, reducing the Strength score necessary to ignore its check penalty by 2 and reducing its Speed penalty by 5 feet.", 0 },
                    { new Guid("e04ac5f2-e46c-4765-9ea3-62c9aabe95bd"), 0, new Guid("485becdc-d5e9-4ff1-a879-4419d9de8189"), "Silver armor sickens certain creatures that touch it. A creature with weakness to silver that critically fails an unarmed attack against a creature in silver armor becomes sickened 1. A creature with weakness to silver is sickened 1 as long as it wears silver armor.", 0 },
                    { new Guid("213a69bc-1e87-4418-99b0-3a994f95de5c"), 0, new Guid("1287dbd8-558a-4c7f-bf2a-37dbe34e802c"), "Orichalcum armor can be etched with four magic property runes instead of three due to the magical empowerment of orichalcum. If you are wearing armor made of orichalcum, the armor grants you insights into the future, granting you a +1 circumstance bonus to initiative rolls.", 0 },
                    { new Guid("bf939410-b553-4edc-a4e5-44e7cc82002f"), 0, new Guid("73db3bdd-bc32-4a6d-9c21-580d3301e6ec"), "Sovereign steel armor sickens certain creatures that touch it. A creature with weakness to cold iron that critically fails an unarmed attack against a creature in sovereign steel armor becomes sickened 1, and such a creature is sickened 1 as long as it wears sovereign steel armor. The noqual in sovereign steel armor provides protection against magic, granting you a +1 circumstance bonus to AC against spell attack rolls. If you Cast a Spell while wearing sovereign steel armor, you must succeed at a DC 5 flat check or the spell fails.", 0 }
                });

