                    { new Guid("067483c4-7d31-43f1-8faa-d57b1c9d42f9"), 0, new Guid("1baaf531-78b3-4cde-ad0c-225dae0e7891"), "This very small shield is a favorite of duelists and quick, lightly armored warriors. It’s typically made of steel and strapped to your forearm. You can Raise a Shield with your buckler as long as you have that hand free or are holding a light object that’s not a weapon in that hand.", 0 },
                    { new Guid("d6cd8f12-9dea-414e-9391-153c6bf81aeb"), 0, new Guid("ea71685d-64f3-4374-815d-2710b6a1579b"), "Like wooden shields, steel shields come in a variety of shapes and sizes. Though more expensive than wooden shields, they are much more durable.", 0 },
                    { new Guid("8fe16bba-3ac9-44cc-bf48-ba9406064f63"), 0, new Guid("e1e2e623-f1b9-4ca4-b5d3-c5841769cde3"), "These massive shields can be used to provide cover to nearly the entire body. Due to their size, they are typically made of wood reinforced with metal.", 0 },
                    { new Guid("9b600ffc-3d7d-43d1-8261-ea21bf96144f"), 1, new Guid("e1e2e623-f1b9-4ca4-b5d3-c5841769cde3"), "When using the Take Cover action while the shield is raised, the armor class bonus becomes +4 instead of +2.", 0 },
                    { new Guid("c4a8e664-b25a-4c2e-8365-4e1eb47723d7"), 0, new Guid("0d0453b0-fa8a-4bd5-abf2-a141e9f98514"), "Though they come in a variety of shapes and sizes, the protection offered by wooden shields comes from the stoutness of their materials. While wooden shields are less expensive than steel shields, they break more easily.", 0 }
                });

