            migrationBuilder.InsertData(
                table: "Spells_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("d2829321-35fc-46bf-a376-35f026ac41f3"), 2, new Guid("dbaf20d0-6fad-43a7-8379-62c32c7049ac"), "As part of your action to Sustain the Spell, you can choose to either destroy one of your pillars, causing it to immediately crumble into nothing, or create a new pillar, as long as doing so wouldn't exceed the total number of feet of pillar you can create. You can Sustain the Spell two or more times on a single turn to destroy or create a pillar.", 0 },
                    { new Guid("2e3e596e-ede0-45c6-adbe-aa8a13fb7de2"), 0, new Guid("9123b175-ae47-4b47-befc-fb57de128ca3"), "You whip up a small sandstorm around your body. When a creature starts its turn in the area or moves into the area, it must succeed at a Fortitude save or become dazzled for as long as it remains in the area; it is then temporarily immune to this dazzling effect for 10 minutes.", 0 },
                    { new Guid("00219cd1-5d3b-4e47-b9e0-218028d56b12"), 3, new Guid("9123b175-ae47-4b47-befc-fb57de128ca3"), "Sandblast - You direct a jet of sand at a single target. One creature of your choice within 30 feet takes 8d6 slashing damage (basic Reflex save). On a critical failure, the creature is also dazzled for 1 minute.", 2 },
                    { new Guid("300c2b4b-df87-445c-8e8d-9b802ff98616"), 0, new Guid("dbaf20d0-6fad-43a7-8379-62c32c7049ac"), "You raise one or more pillars of solid sand from the earth. The total height of the pillars is 30 feet, which must be used in 10-foot increments (for example, you could create three 10-foot-tall pillars, one 20-foot-tall pillar and one 10-foot-tall pillar, or one 30-foot-tall pillar). Each pillar is 5 feet by 5 feet in length and width. The pillars must be conjured on a relatively flat area of natural earthen terrain such as sand, dirt, stone, or clay. Regardless of the terrain, the pillars are always made of tightly compacted sand particles that together become as hard and solid as stone (DC 15 Athletics to Climb).", 0 },
                    { new Guid("49294284-5355-43ed-a062-92d144b75623"), 0, new Guid("2d9fa0b3-c9ba-4e4f-8c95-79a6366fdb61"), "You turn a fire into either a burst of blinding fireworks or a thick cloud of choking smoke, chosen when you Cast the Spell. The spell targets one fire source, which is immediately extinguished if it is a non-magical fire the size of a campfire or smaller. If the fire source is a creature, the creature takes 1d6 points of cold damage and is not extinguished.", 0 },
                    { new Guid("f4c3dfe4-247c-4c6d-8332-3b7adad8dc2e"), 0, new Guid("ff6c68a1-e60a-4f3a-8e3d-54c119af4841"), "You reproduce an imp's evil, poisonous sting, stabbing at an enemy and possibly affecting them with the devil's benumbing venom. You deal 1d4 piercing damage to the touched creature and afflict the creature with imp venom. If the target takes piercing damage, they also take 1d6 evil damage and must attempt a Fortitude save.", 0 },
                    { new Guid("09c36c38-903a-461e-84cb-7ca09fd03698"), 0, new Guid("bf2b8cba-4ec4-4e0e-909a-4271289b97d1"), "You channel a blast of powerful blightburn radiation from your hands. You deal 4d6 poison damage to creatures in the area. Creatures who fail their save are afflicted with stage 1 of blightburn sickness (on a critical failure, the creature moves immediately to stage 2). The level of blightburn sickness caused by this spell is equal to twice the spell's level, and the disease's save DC uses the caster's DC.", 0 },
                    { new Guid("6b482fdd-3b3f-481d-8e70-f5a7053892e5"), 1, new Guid("9123b175-ae47-4b47-befc-fb57de128ca3"), "Choose one of the following additional effects when you cast this spell. On subsequent rounds, you can switch to a different effect once per round as a free action triggered by sustaining the spell.", 0 },
                    { new Guid("15502b5f-65e4-40ee-a28e-ca87d6015ffb"), 2, new Guid("9123b175-ae47-4b47-befc-fb57de128ca3"), "Sand Shield - You create a magical shield made of sand. The sand shield provides no benefit to AC, but it does allow you to use the Shield Block reaction and acts as a shield for this purpose. The sand shield has Hardness 14, 21 Hit Points, and no Broken Threshold; when the shield's HP are reduced to 0, you can't use its Shield Block reaction again until the next time you Sustain the Spell and choose the sand shield effect.", 2 },
                    { new Guid("d8ce44f4-d0b5-4a05-9711-c53580128385"), 0, new Guid("8aa7ba58-13b1-4589-8d66-0e88a6083e7d"), "You manifest a swarm of disembodied wasp stingers that stab creatures in the area, possibly poisoning them. Creatures in the affected area take 1d6 piercing damage. Each creature that takes piercing damage must attempt a Fortitude save.", 0 },
                    { new Guid("ca6c4874-383f-42c0-957e-3309fa2078eb"), 1, new Guid("dbaf20d0-6fad-43a7-8379-62c32c7049ac"), "If a creature occupies the space where you cast this spell, it is carried upward atop the pillar. The creature can attempt a Reflex save (DC equal to the caster's spell DC); on a success, the creature can either attempt to Grab an Edge or move into an adjacent unoccupied square. If the pillar would rise higher than the ceiling, it firmly abuts the ceiling but does not rise any higher. A creature caught between a pillar and a ceiling takes no damage (subject to GM discretion, such as is in the case of stalactites or other hazards) but becomes immobilized. The creature can attempt an Escape check to free itself, but it must thereafter Grab an Edge, Climb down, or fall from the top of the pillar. The Grab an Edge and Escape DCs are the same as the Reflex save.", 0 },
                    { new Guid("669ab3aa-e8df-4854-ac37-7dd6111d2a67"), 4, new Guid("9123b175-ae47-4b47-befc-fb57de128ca3"), "Sandstorm - The area of the spell expands to a 30-foot emanation, and any creature that starts its turn in the area or moves into the area takes 6d4 slashing damage (basic Reflex save) and must hold its breath or begin suffocating.", 2 },
                    { new Guid("4e431de6-a3b5-4b6e-b615-1c10c9241c62"), 0, new Guid("5269d2c0-e102-469d-b5ba-b48c7fc38ab4"), "You grant the target corpse a semblance of life, which it uses to speak the answers to three questions posed to it. This spell calls on the physical body’s latent memories rather than summoning back the deceased’s spirit, so the corpse must be mostly intact for the spell to function. The more damage the corpse has taken, the more inaccurate or patchwork its answers are, and it must have a throat and mouth to speak at all. If anyone has previously cast this spell on the corpse in the last week, the spell automatically fails. The corpse can attempt a Will save to resist answering the questions using the statistics of the original creature at its time of death, with the following effects.", 0 },
                    { new Guid("2b7a891d-5e49-4e72-86e4-0d0d8fc5f99d"), 2, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "AC = 25 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("4ed9cd14-123d-4859-9255-c36eac8a062e"), 8, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "A massive wildfire burns in a sudden inferno, dealing 3d10 fire damage.", 2 },
                    { new Guid("be03e567-37d0-462d-ac5e-0d27bec12fe8"), 0, new Guid("7ca414c2-6185-4817-b1d7-9692d7a4433a"), "You discharge a powerful bolt of lightning at the target, dealing 8d12 electricity damage. The target must attempt a basic Reflex save. The electricity arcs to another creature within 30 feet of the first target, jumps to another creature within 30 feet of that target, and so on. You can end the chain at any point. You can’t target the same creature more than once, and you must have line of effect to all targets. Roll the damage only once, and apply it to each target (halving or doubling as appropriate for its saving throw outcome). The chain ends if any one of the targets critically succeeds at its save.", 0 },
                    { new Guid("b0627230-1b6f-41fa-b385-e9315448ce04"), 0, new Guid("41b3515e-c59f-4ac6-92a2-ef16195cd647"), "To the target, your words are honey and your visage seems bathed in a dreamy haze. It must attempt a Will save, with a +4 circumstance bonus if you or your allies recently threatened it or used hostile actions against it.", 0 },
                    { new Guid("1d038912-70a4-45ee-aa4b-c9b2cae4f931"), 1, new Guid("41b3515e-c59f-4ac6-92a2-ef16195cd647"), "You can Dismiss the spell. If you use hostile actions against the target, the spell ends. When the spell ends, the target doesn’t necessarily realize it was charmed unless its friendship with you or the actions you convinced it to take clash with its expectations, meaning you could potentially convince the target to continue being your friend via mundane means.", 0 },
                    { new Guid("2fa66aff-6516-439b-821c-a0e5aa52c2f5"), 0, new Guid("fc8ec088-6c8d-4d90-9293-9fc0720a3855"), "You shoot an utterly cold ray of darkness tinged with unholy energy. Make a ranged spell attack against the target. You deal 5d6 cold damage, plus 5d6 evil damage if the target is a celestial.", 0 },
                    { new Guid("1ae42c07-60c6-4292-a8b6-b06568f97f97"), 1, new Guid("fc8ec088-6c8d-4d90-9293-9fc0720a3855"), "If the ray passes through an area of magical light or targets a creature affected by magical light, chilling darkness attempts to counteract the light. If you need to determine whether the ray passes through an area of light, draw a line between yourself and the spell’s target.", 0 },
                    { new Guid("8375c268-b418-4cff-9dde-0d0e11f57a48"), 0, new Guid("4ab38c95-8b8a-4f7c-b260-1b842a91ace3"), "Siphoning negative energy into yourself, your hand radiates a pale darkness. Your touch weakens the living and disorients undead, possibly even causing them to flee. The effect depends on whether the target is living or undead.", 0 },
                    { new Guid("a08010bb-278e-457b-8a83-9bd955303460"), 1, new Guid("4ab38c95-8b8a-4f7c-b260-1b842a91ace3"), "Living Creature: The spell deals negative damage equal to 1d4 plus your spellcasting modifier. The target attempts a basic Fortitude save, but is also enfeebled 1 for 1 round on a critical failure.", 2 },
                    { new Guid("4ed0277b-81ff-4863-b844-79de8e86bc7e"), 7, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "An instant tsunami sweeps over creatures in the area, dealing 3d10 bludgeoning damage with the water trait (doubled for creatures swimming in the area).", 2 },
                    { new Guid("5a911837-34c2-47c2-b348-125d22fea173"), 2, new Guid("4ab38c95-8b8a-4f7c-b260-1b842a91ace3"), "Undead Creature: The target is flat-footed for 1 round on a failed Fortitude save. On a critical failure, the target is also fleeing for 1 round unless it succeeds at a Will save. Heightened (+1)", 2 },
                    { new Guid("5d6a8acb-12b1-425e-80f5-6166c16c1826"), 1, new Guid("8c5da2eb-3188-4c3b-82ab-cae8d4e3c300"), "Roll 1d4 to determine the color of the wall. Each color has a particular effect on items, effects, or creatures that attempt to pass through. Chromatic wall can’t be counteracted normally; rather, each color is automatically counteracted when targeted by a specific spell, even if that spell’s level is lower than that of chromatic wall.", 0 },
                    { new Guid("66f7ae40-6842-4482-b926-73b19f6dd8f9"), 2, new Guid("8c5da2eb-3188-4c3b-82ab-cae8d4e3c300"), "1 - Red: The wall destroys ranged weapon ammunition (such as arrows and crossbow bolts) that would pass through, and it deals 20 fire damage to anyone passing through, with a basic Reflex save. Cone of cold can counteract a red chromatic wall.", 2 },
                    { new Guid("6256a8a8-31ae-4576-aa8c-722662fa37d7"), 3, new Guid("8c5da2eb-3188-4c3b-82ab-cae8d4e3c300"), "2 - Orange: The wall destroys thrown weapons that would pass through, and it deals 25 acid damage to anyone passing through, with a basic Reflex save. Gust of wind can counteract an orange chromatic wall.", 2 },
                    { new Guid("02ad0292-99e0-42e1-a2f8-da387196a90c"), 4, new Guid("8c5da2eb-3188-4c3b-82ab-cae8d4e3c300"), "3 - Yellow :The wall stops acid, cold, electricity, fire, force, negative, positive, and sonic effects from passing through, and it deals 30 electricity damage to anyone passing through, with a basic Reflex save. Disintegrate can counteract a yellow chromatic wall.", 2 },
                    { new Guid("fc855a59-8d6c-44f2-978d-86551ac8ecbc"), 5, new Guid("8c5da2eb-3188-4c3b-82ab-cae8d4e3c300"), "4 - Green: The wall stops toxins, gases, and breath weapons from passing through. It deals 10 poison damage to anyone passing through and makes them enfeebled 1 for 1 minute. A basic Fortitude save reduces the damage and negates the enfeebled condition on a success. Passwall can counteract a green chromatic wall.", 2 },
                    { new Guid("46b66be4-d7be-4409-b1d9-39853f034475"), 0, new Guid("35ac23b0-0e3d-4aab-8217-116f931edcb7"), "You ward a creature and those nearby against a specified alignment. Choose chaotic, evil, good, or lawful; this spell gains the opposing trait. Creatures in the area gain a +1 status bonus to AC against attacks by creatures of the chosen alignment and to saves against effects from such creatures. This bonus increases to +3 against effects from such creatures that directly control the target and attacks made by summoned creatures of the chosen alignment. Summoned creatures of the chosen alignment can’t willingly enter the area without succeeding at a Will save; repeated attempts use the first save result.", 0 },
                    { new Guid("904c4278-3e9a-4846-8443-0b3aa0717974"), 0, new Guid("484d98ad-91d1-4b2d-86d0-ec997a6f772b"), "You create an invisible floating ear at a location within range (even if it’s outside your line of sight or line of effect). It can’t move, but you can hear through the ear as if using your normal auditory senses.", 0 },
                    { new Guid("fe688355-a855-421f-bb33-20b2fd2b25d1"), 0, new Guid("af9903ec-8e9e-4752-bae4-042aca73f91a"), "You create an invisible floating eye at a location within range (even if it’s outside your line of sight or line of effect). The eye can’t move, but you can see in all directions from that point as if using your normal visual senses.", 0 },
                    { new Guid("a7d606b3-9816-4cf5-ad29-fcbb589fa9c6"), 0, new Guid("8c5da2eb-3188-4c3b-82ab-cae8d4e3c300"), "You create an opaque wall of light in a single vibrant color. The wall is straight and vertical, stretching 60 feet long and 30 feet high. If the wall would pass through a creature, the spell is lost. The wall sheds bright light for 20 feet on each side, and dim light for the next 20 feet. You can ignore the wall’s effects.", 0 },
                    { new Guid("c8c78ca8-a307-42eb-bb47-0b63589ba7e3"), 6, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "Beating winds churn across the sky, dealing 3d10 bludgeoning damage to creatures flying in the area.", 2 },
                    { new Guid("077a48c4-a7b5-40db-8538-fc69166f8900"), 5, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "Incredible lightning lashes the area, dealing 3d10 electricity damage.", 2 },
                    { new Guid("6bd47ee1-f4dc-4c6c-97bf-04c1b84e55d1"), 4, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "A blast of freezing wind deals 3d10 cold damage.", 2 },
                    { new Guid("9b9d980a-4147-43bd-a3b7-90935943b1fe"), 0, new Guid("9d06d9f1-deaf-4fd0-8963-9ca6f5a645fa"), "You fill the minds of your enemies with doubt. Enemies in the area must succeed at a Will save or take a –1 status penalty to attack rolls as long as they are in the area. Once per turn, starting the turn after you cast bane, you can use a single action, which has the concentrate trait, to increase the emanation’s radius by 5 feet and force enemies in the area that weren’t yet affected to attempt another saving throw. Bane can counteract bless.", 0 },
                    { new Guid("d451add9-b4c2-45ea-84f3-b54202846d17"), 0, new Guid("3a8c5edf-e86c-431a-a25a-bb90d590eb35"), "You send the target back to its home plane. The target must attempt a Will save. You can spend an extra action while Casting this Spell and add a material component to give the creature a –2 circumstance penalty to its save. The component must be a specially gathered object that is anathema to the creature, and not from a material component pouch. This spell fails if you aren’t on your home plane when you cast it.", 0 },
                    { new Guid("d60b56d5-b4f6-4bb9-927b-5c26ebceaa33"), 0, new Guid("41fcd185-b9ba-41aa-96cf-1a8bcb65a64d"), "The target’s skin becomes covered in bark. The target gains resistance 2 to bludgeoning and piercing damage and weakness 3 to fire. After the target takes fire damage, it can Dismiss the spell as a free action triggered by taking the damage; doing so doesn’t reduce the fire damage the target was dealt.", 0 },
                    { new Guid("bc567753-dd14-46d2-969e-2fb187ae0fbb"), 0, new Guid("a0dc825d-78c6-4464-a62e-17d7001c258e"), "You wrench the target’s soul away before it can pass on to the afterlife and imprison it in a black sapphire.", 0 },
                    { new Guid("53346ab9-5ab3-45e8-8692-1d8f9b1249e0"), 1, new Guid("a0dc825d-78c6-4464-a62e-17d7001c258e"), "While the soul is in the gem, the target can’t be returned to life through any means, even powerful magic such as wish. If the gem is destroyed or bind soul is counteracted on the gem, the soul is freed. The gem has AC 16 and Hardness 10. A gem can’t hold more than one soul, and any attempt wastes the spell.", 0 },
                    { new Guid("ba4fb28f-c544-4e92-9c3c-540e371b0754"), 0, new Guid("b59d7490-542e-4d17-9463-2e384faf2c0f"), "With a word of necromantic power, you seize control of the target. It gains the minion trait. If you or an ally uses any hostile actions against the target, the spell ends.", 0 },
                    { new Guid("410bc6f5-72ec-4aae-9571-4305984478a9"), 0, new Guid("436d4b2a-846a-4ff1-ae57-63ecfe80f337"), "Oily black tentacles rise up and attempt to capture creatures in the area. Make spell attack rolls against the Fortitude DC of each creature in the area. Any creature you succeed againstis grabbed by a tentacle and takes 3d6 bludgeoning damage.Whenever a creature ends its turn in the area, the tentacles attempt to grab that creature if they haven’t already, and they deal 1d6 bludgeoning damage to any creature already grabbed. The tentacles’ Escape DC is equal to your spell DC. A creature can attack a tentacle in an attempt to release its grip. Its AC is equal to your spell DC, and it is destroyed if it takes 12 or more damage. Even if destroyed, additional tentacles continue to grow in the area until the duration ends. You can Dismiss the spell.", 0 },
                    { new Guid("87e23794-7ae6-427f-9d1b-9c4d7f32e72b"), 0, new Guid("54176cd6-c3a3-43fd-8d47-9283811b03bb"), "Blades of force form a churning wall. The wall is a straight line 20 feet high, 120 feet long, and 2 inches thick, and it provides cover. The wall deals 7d8 force damage to each creature that’s in the wall’s space when it is created, that attempts to pass through the wall, or that ends its turn inside the wall. A basic Reflex save reduces the damage. A creature that succeeds at this save when the wall is created is pushed to the nearest space on the side of its choice. Creatures trying to move through the wall fail to do so if they critically fail the save, ending their movement adjacent to the wall.", 0 },
                    { new Guid("84937ca3-5b7a-4529-9930-4145419e858b"), 0, new Guid("51df17bf-ef57-4eed-973c-55cf33285b61"), "Blessings from beyond help your companions strike true. You and your allies gain a +1 status bonus to attack rolls while within the emanation. Once per turn, starting the turn after you cast bless, you can use a single action, which has the concentrate trait, to increase the emanation’s radius by 5 feet. Bless can counteract bane.", 0 },
                    { new Guid("dd9e4d1c-d272-4b15-9eac-77518d6af7ab"), 0, new Guid("3a320d74-73e9-40ab-a972-eb6b571f21fd"), "You blind the target. The effect is determined by the target’s Fortitude save. The target then becomes temporarily immune for 1 minute.", 0 },
                    { new Guid("06487cd4-8f08-4bda-bbdb-74387d15734e"), 0, new Guid("e130e307-ede2-4a68-9667-cfc482855d95"), "You blink quickly between the Material Plane and the Ethereal Plane. You gain resistance 5 to all damage (except force). You can Sustain the Spell to vanish and reappear 10 feet away in a random direction determined by the GM; the movement doesn’t trigger reactions. At the end of your turn, you vanish and reappear as above.", 0 },
                    { new Guid("de383eb7-ec7f-460b-8b53-87dafd843c6e"), 0, new Guid("4f77cd26-f3f0-4e6a-8424-b01480daadc4"), "The target’s form appears blurry. It becomes concealed. As the nature of this effect still leaves the target’s location obvious, the target can’t use this concealment to Hide or Sneak.", 0 },
                    { new Guid("dad7233b-d058-464a-a3b2-94820cc93d6d"), 0, new Guid("27b176c3-a4ac-425b-b7f1-9e6b7c25063f"), "Your blessing revives a creature at the moment of its death. You prevent the target from dying and restore Hit Points to the target equal to 4d8 plus your spellcasting ability modifier. You can’t use breath of life if the triggering effect was disintegrate or a death effect.", 0 },
                    { new Guid("1158bbf7-f745-4c30-9a1f-d7833f60fda4"), 0, new Guid("ea3e3b79-80ab-4ef4-9dc7-6fb38561a935"), "Gouts of flame rush from your hands. You deal 2d6 fire damage to creatures in the area.", 0 },
                    { new Guid("1c1b6683-6bf3-4d9a-849c-9bf062facf3c"), 0, new Guid("3a2a1f6e-f8d9-465d-94cc-1253a5c42062"), "You forcibly calm creatures in the area, soothing them into a nonviolent state; each creature must attempt a Will save.", 0 },
                    { new Guid("b14accb0-bbb3-4cef-8c2f-0d42c209292d"), 0, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "You call upon the unimaginable power of world-ending cataclysms, ripping a small piece of each cataclysm and combining them together into one horrifically powerful attack. The following effects come down upon all creatures in the area. Treat the resistances of creatures in the area as if they were 10 lower for the purpose of determining the cataclysm’s damage.", 0 },
                    { new Guid("cf2e53f8-3cc3-4b6a-b9b4-c923c6d7aacb"), 1, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "Each creature attempts one basic Reflex save that applies to all five types of damage.", 0 },
                    { new Guid("381ec139-c96a-41af-8fce-22ca8c5dbeb2"), 2, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "Flesh-dissolving acid rain deals 3d10 acid damage.", 2 },
                    { new Guid("dcd40c58-78c7-4be6-8ba9-8ab86f679fb3"), 3, new Guid("75ed7032-7a88-407c-a7d5-a4bd3e905ba1"), "A roaring earthquake shakes and bludgeons creatures on the ground, dealing 3d10 bludgeoning damage.", 2 },
                    { new Guid("9a5617f3-f18c-407c-98f5-f0092737c1cf"), 0, new Guid("2c2d2218-3a46-4075-899c-c4e9353aaec3"), "A cloak of swirling colors shrouds the target. Creatures are dazzled while adjacent to it, and attacking the target causes a brilliant flash of light. A creature that hits the target with a melee attack must attempt a Will save.", 0 },
                    { new Guid("e7e7b126-33a9-4112-b380-f01b86254c61"), 0, new Guid("1030f973-aee2-4c2f-8cc5-a98aa4594de4"), "You conjure a poisonous fog. This functions as obscuring mist (page 355), except the area moves 10 feet away from you each round. You deal 6d8 poison damage to each breathing creature that starts its turn in the spell’s area. You can Dismiss the spell.", 0 },
                    { new Guid("2861855c-e59b-403c-932b-0cdbe922a37f"), 0, new Guid("f3fa6c93-ee1d-4da1-982d-55c015c0eeaa"), "You teleport the targets to new positions within the area. The creatures must each be able to fit in their new space, and their positions must be unoccupied, entirely within the area, and in your line of sight. Unwilling creatures can attempt a Will save.", 0 },
                    { new Guid("b9e2dd3a-42e7-4693-afee-fd55fc5c68c5"), 0, new Guid("060ba321-f5b9-4ac8-907c-fec7bb740713"), "Swirling colors affect viewers based on their Will saves.", 0 },
                    { new Guid("6cd65a55-a167-4782-b67e-4233a73f6cb0"), 0, new Guid("236cd0a3-a07b-4c9f-ba11-e3c113d91634"), "You snuff the life out of a creature on the brink of death. The target must attempt a Will save. If this kills it, you gain 10 temporary HP and a +1 status bonus to attack and damage rolls for 10 minutes.", 0 },
                    { new Guid("f42c2728-6212-4aea-a67f-0c87c746330a"), 0, new Guid("3c902d87-38ff-4aad-acb3-266811986252"), "You shield a creature from the ravages of negative energy. It receives a +4 status bonus to saves against death and negative effects, gains negative resistance 10, and suppresses the effects of the doomed condition.", 0 },
                    { new Guid("d37d719b-1a7d-4c17-bfcf-be3fbd1d9e64"), 0, new Guid("54d80001-c58b-4524-b23d-3962bb5f7ed4"), "Your eyes glow as you sense aligned auras. Choose chaotic, evil, good, or lawful. You detect auras of that alignment. You receive no information beyond presence or absence. You can choose not to detect creatures or effects you’re aware have that alignment.", 0 },
                    { new Guid("93b29669-1b66-422e-96be-17a1c795e34f"), 1, new Guid("54d80001-c58b-4524-b23d-3962bb5f7ed4"), "Only creatures of 6th level or higher—unless divine spellcasters, undead, or beings from the Outer Sphere—have alignment auras.", 0 },
                    { new Guid("c254ca49-adf5-438e-bf37-13157c04912d"), 0, new Guid("1e7838ee-f64d-4806-8d3d-e55ba4261c03"), "You send out a pulse that registers the presence of magic. You receive no information beyond the presence or absence of magic. You can choose to ignore magic you’re fully aware of, such as the magic items and ongoing spells of you and your allies.", 0 },
                    { new Guid("ba775672-2c5d-43a3-a002-e1214d439f7e"), 1, new Guid("1e7838ee-f64d-4806-8d3d-e55ba4261c03"), "You detect illusion magic only if that magic’s effect has a lower level than the level of your detect magic spell. However, items that have an illusion aura but aren’t deceptive in appearance (such as an invisibility potion) typically are detected normally.", 0 },
                    { new Guid("5c2ce407-d0ba-4516-9420-836238b172c1"), 0, new Guid("8e4669af-e67c-42a4-bd0f-9e117496cb6c"), "You detect whether a creature is venomous or poisonous, or if an object is poison or has been poisoned. You do not ascertain whether the target is poisonous in multiple ways, nor do you learn the type or types of poison. Certain substances, like lead and alcohol, are poisons and so mask other poisons.", 0 },
                    { new Guid("cfb7389d-5dcb-4251-9f63-8285f2e85105"), 0, new Guid("2ef1bfc9-3ca3-45b8-804a-ba9d948224de"), "By tapping into trace divinatory auras, you detect the presence of scrying effects in the area. If detect scrying is higher level than a scrying effect, you gain a glimpse of the scrying creature and learn its approximate distance and direction.", 0 },
                    { new Guid("e47d375a-7490-4544-81be-809b2bd3cbf8"), 0, new Guid("c1546cbd-ec60-459f-b7f5-e29d51beb5f2"), "You interfere with the target’s ability to teleport and travel between dimensions. Dimensional anchor attempts to counteract any teleportation effect, or any effect that would move the target to a different plane. The duration is determined by the target’s Will save.", 0 },
                    { new Guid("0d3057c9-fcc9-4949-a17e-9aa46a0dcd6f"), 0, new Guid("1e745c5e-5d8f-4abd-b66c-e0e582833257"), "You create a shimmering barrier that attempts to counteract teleportation effects and planar travel into or out of the area, including items that allow access to extradimensional spaces (such as a bag of holding). Dimensional lock tries to counteract any attempt to summon a creature into the area but doesn’t stop the creature from departing when the summoning ends.", 0 },
                    { new Guid("bc66f243-805d-4d6f-93c2-8e9c12d6cf52"), 0, new Guid("73180f19-0c26-4f90-b377-8ae1d3df6525"), "Opening a door that bypasses normal space, you instantly transport yourself and any items you’re wearing and holding from your current space to a clear space within range you can see.If this would bring another creature with you—even if you’re carrying it in an extradimensional container—the spell is lost.", 0 },
                    { new Guid("d69e2d90-662f-4af8-8740-a5de98a94469"), 0, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "You channel the primal forces of nature to transform into a Large animal battle form, specifically that of a powerful and terrifying dinosaur. You must have space to expand or the spell is lost. When you cast this spell, choose ankylosaurus, brontosaurus, deinonychus, stegosaurus, triceratops, or tyrannosaurus. You can decide the specific type of animal, but this has no effect on the form’s Size or statistics. While in this form, you gain the animal and dinosaur traits. You can Dismiss the spell.", 0 },
                    { new Guid("d6d57c2a-5593-4664-a1ce-669c612f62ca"), 1, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("53e6b7c7-4384-4ac0-b0df-5a786b6016cb"), 2, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "AC = 18 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("5a80550b-1451-46d0-b80a-a28bc7fbdca5"), 3, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "15 temporary Hit Points.", 2 },
                    { new Guid("f8d811ef-2e56-4548-9127-c1ded8842548"), 4, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Low-light vision and imprecise scent 30 feet.", 2 },
                    { new Guid("ce26e35f-f33b-4e20-bf3a-1e1d58bb2802"), 5, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +16, and your damage bonus is +9. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If your unarmed attack modifier is higher, you can use it instead.", 2 },
                    { new Guid("d09af233-4775-4202-a171-23a8b3489dd9"), 6, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Athletics modifier of +18, unless your own is higher.", 2 },
                    { new Guid("4772e504-4fd7-45fb-a47b-8693e6e2fdd2"), 7, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "You also gain specific abilities based on the form you choose:", 0 },
                    { new Guid("4957d652-3659-4c6f-b259-ea076a4a861b"), 0, new Guid("509c9a55-433c-4f99-8a7a-609d38f23ed1"), "The target loses hearing; it must attempt a Fortitude save. The target is then temporarily immune for 1 minute.", 0 },
                    { new Guid("435f323d-f2ba-4a44-b7fb-05738ce88cdd"), 0, new Guid("79fbdd8a-c496-4974-af00-14c3640841ab"), "You transform the target creature into a harmless animal appropriate to the area, with effects based on its Fortitude save.", 0 },
                    { new Guid("47e75e5c-6ee0-4c24-bb1e-b51bad67e26a"), 0, new Guid("2d8be059-3a79-4d4d-a7e8-31dee66680cc"), "You cloud the target’s mind and daze it with a mental jolt. The jolt deals mental damage equal to your spellcasting ability modifier; the target must attempt a basic Will save. If the target critically fails the save, it is also stunned 1.", 0 },
                    { new Guid("3d55aeb6-b47c-4221-a8b0-7117c09da7fe"), 0, new Guid("0f86cd9a-76b2-4bb4-bebe-ea638643fc3e"), "You create a shroud of darkness that prevents light from penetrating or emanating within the area. Light does not enter the area and any non-magical light sources, such as a torch or lantern, do not emanate any light while inside the area, even if their light radius would extend beyond the darkness. This also suppresses magical light of your darkness spell’s level or lower. Light can’t pass through, so creatures in the area can’t see outside. From outside, it appears as a globe of pure darkness.", 0 },
                    { new Guid("eecbd562-747c-437b-8fb7-ede447f95cb2"), 0, new Guid("4d709d69-ddde-487c-94a3-c876b4e79969"), "You shout a command that’s hard to ignore. You can command the target to approach you, run away (as if it had the fleeing condition), release what it’s holding, drop prone, or stand in place. It can’t Delay or take any reactions until it has obeyed your command. The effects depend on the target’s Will save.", 0 },
                    { new Guid("cfb924de-ffd6-4655-a15a-c9b12e7fce35"), 0, new Guid("6505b7e2-7c35-45ed-8fda-ff4bf3dd2822"), "The target can understand the meaning of a single language it is hearing or reading when you cast the spell. This doesn’t let it understand codes, language couched in metaphor, and the like (subject to GM discretion). If the target can hear multiple languages and knows that, it can choose which language to understand; otherwise, choose one of the languages randomly.", 0 },
                    { new Guid("febabf42-20fa-4193-8215-b9c24c6fc140"), 0, new Guid("2a4b767b-27d0-4519-b1f7-c554837d0c73"), "Icy cold rushes forth from your hands. You deal 12d6 cold damage to creatures in the area.", 0 },
                    { new Guid("1d9ca856-2b8d-40b2-acd8-de53e723931d"), 0, new Guid("068fc3bd-e1ac-4069-8a29-13bd1a0b92f2"), "You befuddle your target with strange impulses, causing it to act randomly. The effects are determined by the target’s Will save. You can Dismiss the spell.", 0 },
                    { new Guid("78cf606d-3b0d-4fe9-91d2-e53b758b869b"), 0, new Guid("94beacae-4765-499c-b93e-934fff8585a4"), "You prepare a spell that will trigger later. While casting contingency, you also cast another spell of 4th level or lower with a casting time of no more than 3 actions. This companion spell must be one that can affect you. You must make any decisions for the spell when you cast contingency, such as choosing a damage type for resist energy. During the casting, choose a trigger under which the spell will be cast, using the same restrictions as for the trigger of a Ready action. Once contingency is cast, you can cause the companion spell to come into effect as a reaction with that trigger. It affects only you, even if it would affect more creatures. If you define complicated conditions, as determined by the GM, the trigger might fail. If you cast contingency again, the newer casting supersedes the older.", 0 },
                    { new Guid("105c17e6-07ad-43f7-9868-476bb1f9d1c0"), 0, new Guid("d253d16d-cbac-4673-a25f-0a3c33173cd1"), "A magical flame springs up from the object, as bright as a torch. It doesn’t need oxygen, react to water, or generate heat.", 0 },
                    { new Guid("ecde9a96-ca65-4f65-85aa-9500e8417229"), 0, new Guid("b2cc63b2-466a-478a-b024-b785f2b722de"), "By imposing your will upon the water, you can raise or lower the level of water in the chosen area by 10 feet. Water creatures in the area are subjected to the effects of slow.", 0 },
                    { new Guid("c1648108-d584-408c-a9e0-395e9411b398"), 0, new Guid("2d0fa5a4-eab0-4eca-85cb-23241e5ef814"), "You create enough food to feed six Medium creatures for a day. This food is bland and unappealing, but it is nourishing. After 1 day, if no one has eaten the food, it decays and becomes inedible. Most Small creatures eat one-quarter as much as a Medium creature (one-sixteenth as much for most Tiny creatures), and most Large creatures eat 10 times as much (100 times as much for Huge creatures and so on).", 0 },
                    { new Guid("3197459e-c6bc-431b-9a5e-45973bd75f1b"), 0, new Guid("c5bd7524-e3f5-46b6-b1de-527896978d1c"), "As you cup your hands, water begins to flow forth from them. You create 2 gallons of water. If no one drinks it, it evaporates after 1 day.", 0 },
                    { new Guid("10f19591-1df1-4976-802c-12a27265350f"), 0, new Guid("311b0146-7b80-4594-800f-b0046237d47f"), "You conjure a temporary object from eldritch energy. It must be of vegetable matter (such as wood or paper) and 5 cubic feet or smaller. It can’t rely on intricate artistry or complex moving parts, never fulfills a cost or the like, and can’t be made of precious materials or materials with a rarity of uncommon or higher. It is obviously temporarily conjured, and thus can’t be sold or passed off as a genuine item.", 0 },
                    { new Guid("06dc06f4-c454-423d-9791-25b2e2fb90e3"), 0, new Guid("b7157338-c1de-4e79-a90c-e0f62abd709c"), "You assault the target’s faith, riddling the creature with doubt and mental turmoil that deal 6d6 mental damage, or 6d8 mental damage if it can cast divine spells. The effects are determined by its Will save.", 0 },
                    { new Guid("858468ee-88f6-495c-8cf5-542d9209b061"), 1, new Guid("b7157338-c1de-4e79-a90c-e0f62abd709c"), "To many deities, casting this spell on a follower of your own deity without significant cause is anathema.", 0 },
                    { new Guid("df3cba14-93f8-43ef-b3fa-076419919259"), 0, new Guid("e4568cde-13d1-4684-81b2-180bc291198f"), "You issue a divine mandate or proclaim a cause to the targets. It can be to attain an item, claim a patch of land, slay a creature, war with a group, or be entirely peaceful. Your cause can’t force the targets to harm one another or themselves. The targets become completely dedicated to that cause, depending on their levels. They choose their own actions, but they favor direct action over inaction or indirect action.", 0 },
                    { new Guid("9e535072-b4b7-428e-94c3-898de6ca0ab6"), 1, new Guid("e4568cde-13d1-4684-81b2-180bc291198f"), "13th or Lower: The target is so dedicated to the cause that it pursues the cause to the death (unless you say otherwise).", 2 },
                    { new Guid("45983a64-0a25-4eba-9eaf-d050a4b49d11"), 2, new Guid("e4568cde-13d1-4684-81b2-180bc291198f"), "14th: The target is dedicated to the cause, but the spell ends for the target if it’s reduced to half its maximum Hit Points or fewer.", 2 },
                    { new Guid("f3e7e74b-556d-46f8-87fe-861544c2331b"), 3, new Guid("e4568cde-13d1-4684-81b2-180bc291198f"), "15th: As 14th, plus the target can attempt a Will save at the end of each of its turns to end the spell for itself.", 2 },
                    { new Guid("c474670c-dd98-40b0-a6fc-f5d19f51fec1"), 4, new Guid("e4568cde-13d1-4684-81b2-180bc291198f"), "The spell ends for all creatures if you or one of your allies uses a hostile action against a target, or when the cause is completed. The GM might determine this spell has alignment traits befitting the cause.", 0 },
                    { new Guid("6f718d20-6acf-4bcf-a4e1-efebf668f6d7"), 0, new Guid("2665ca32-131c-43cd-b30b-c763eb024a08"), "You inflict despair on creatures in the area. The effects for each creature are determined by its Will save.", 0 },
                    { new Guid("b68ff7f1-51e6-44b8-b9c3-0af52ed1082c"), 0, new Guid("7b0f3283-1f79-4a64-a697-eb842bb776b2"), "You create up to four floating lights, no two of which are more than 10 feet apart. Each sheds light like a torch. When you Sustain the Spell, you can move any number of lights up to 60 feet. Each light must remain within 120 feet of you and within 10 feet of all others, or it winks out.", 0 },
                    { new Guid("c9a23b3f-b2ed-40b3-87cc-431369d6297a"), 0, new Guid("66172098-6cdb-4587-89bb-24fe1a8faf7c"), "You grant yourself supernatural sight in areas of darkness. You gain darkvision.", 0 },
                    { new Guid("7c9dd7f8-02bd-4213-affe-ae981c11b182"), 8, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Ankylosaurus: Speed 25 feet; Melee [one-action] tail (backswing, reach 10 feet), Damage 2d6 bludgeoning; Melee [one-action] foot, Damage 2d6 bludgeoning.", 2 },
                    { new Guid("d7fbbf0f-05e2-416d-960a-ced70a90df6f"), 27, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Zon-Kuthon: Speed 70 feet, air walk, ignore difficult terrain and greater difficult terrain; Melee [one-action] spiked chain (disarm, trip, reach 15 feet), Damage 6d8+6 slashing; Ranged [one-action] midnight pain (mental, nonlethal, range 120 feet), Damage 6d6+3 mental.", 2 },
                    { new Guid("802fe062-ca5f-431f-ae6e-23726d5feac2"), 25, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Torag: Speed 50 feet, burrow Speed 30 feet, immune to immobilized; shield (15 Hardness, can’t be damaged); Melee [one-action] warhammer (bull rush, reach 15 feet), Damage 6d8+6 bludgeoning.", 2 },
                    { new Guid("9b6100f0-8551-4d82-b8a8-c642e5e859cd"), 6, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "At the GM’s discretion, you can try to produce greater effects, but this is dangerous and the spell may have only a partial effect.", 0 },
                    { new Guid("a2732bb4-f4c8-4186-b3a5-cda174bebd7c"), 0, new Guid("dcadfb92-e8c7-47a4-a6cc-4de6eefb7c3c"), "You punish a creature that transgresses against your deity, drawing upon the anguish you feel upon seeing one of your deity’s anathema committed.", 0 },
                    { new Guid("d4987992-bbdd-4122-8baa-db244671e460"), 1, new Guid("dcadfb92-e8c7-47a4-a6cc-4de6eefb7c3c"), "You can cast this spell only when a creature actively commits a unique act of anathema. For example, if creating undead were anathema to your deity, you could use anathematic reprisal on a necromancer who had just created undead in front of you, but not on an undead creature just for existing.", 0 },
                    { new Guid("c4da2067-3e39-45c0-afa3-0300488a2ad4"), 2, new Guid("dcadfb92-e8c7-47a4-a6cc-4de6eefb7c3c"), "You deal 4d6 mental damage to the target, but a basic Will save can reduce this damage. If it fails, it is also stupefied 1 for 1 round. The creature is then temporarily immune for 1 minute.", 0 },
                    { new Guid("940f05c8-e8af-4d50-b8a5-388b20075193"), 0, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "You call upon primal energy to transform yourself into a Medium animal battle form. When you first cast this spell, choose ape, bear, bull, canine, cat, deer, frog, shark, or snake. You can decide the specific type of animal (such as lion or snow leopard for cat), but this has no effect on the form’s Size or statistics. While in this form, you gain the animal trait. You can Dismiss the spell.", 0 },
                    { new Guid("300ba168-764f-491e-a447-df9f3c2f3c3c"), 1, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("861b2972-0bf6-4ac7-87cf-d7200caf3872"), 2, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "AC = 16 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("ade20fbb-a1e0-4cb8-8b63-4ed7306f1427"), 3, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "5 temporary Hit Points.", 2 },
                    { new Guid("2e8f36e1-e005-43fd-9ed9-26b6e8710a44"), 5, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "Reverse certain effects that refer to the wish spell", 2 },
                    { new Guid("ca7be53b-5b0d-4002-b2be-f5dfd5db9854"), 0, new Guid("194ae206-fd26-4e82-9389-f409d2e9c4a9"), "You mystically transpose your current location with another. While in a wilderness environment, you transport yourself and items you’re holding to a clear space you can see within range. If you have Favored Terrain and both your starting and ending position are in your favored terrain, the range increases to 180 feet. If you have an animal companion and it is adjacent to you, you can transport it along with you to an adjacent open space, but if this spell would bring any other creature with you, even in an extradimensional container, the spell is lost.", 0 },
                    { new Guid("54acdc29-8944-49a8-b38b-3bd5bf590358"), 5, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +9, and your damage bonus is +1. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If your unarmed attack bonus is higher, you can use it instead.", 2 },
                    { new Guid("59c4fe59-3095-446e-b43f-34a001f7afd3"), 6, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Athletics modifier of +9, unless your own modifier is higher.", 2 },
                    { new Guid("0a3de3aa-3e97-4f6b-a661-88f0f8477e82"), 7, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "You also gain specific abilities based on the type of animal you choose:", 0 },
                    { new Guid("c7873354-5805-4c8a-8831-1d82a30ee8ed"), 8, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Ape Speed 25 feet, climb Speed 20 feet; Melee [one-action] fist, Damage 2d6 bludgeoning.", 2 },
                    { new Guid("66e1d25e-9eb7-42dc-b412-220923879e98"), 9, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Bear Speed 30 feet; Melee [one-action] jaws, Damage 2d8 piercing; Melee [one-action] claw (agile), Damage 1d8 slashing.", 2 },
                    { new Guid("dcbaa11d-7b56-43d2-a72e-13ec97f14e3f"), 10, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Bull Speed 30 feet; Melee [one-action] horn, Damage 2d8 piercing.", 2 },
                    { new Guid("e79c445d-4649-4cc9-b427-dbfb754c1ad3"), 11, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Canine Speed 40 feet; Melee [one-action] jaws, Damage 2d8 piercing.", 2 },
                    { new Guid("46f110c3-3c5a-4319-b725-e7ea9a52528a"), 12, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Cat Speed 40 feet; Melee [one-action] jaws, Damage 2d6 piercing; Melee[one - action] claw(agile), Damage 1d10 slashing.", 2 },
                    { new Guid("a2575b6e-2f53-4c64-92ca-a2e2006809cf"), 4, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Low-light vision and imprecise scent 30 feet.", 2 },
                    { new Guid("dadf406b-366a-4ca6-8624-d4f315438b58"), 4, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "Produce any effect whose power is equivalent to any occult spell 9th level or lower, or non - occult spell 7th level or lower.", 2 },
                    { new Guid("18c4ba08-3dcf-4336-b349-bc3929058dc5"), 3, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "Duplicate any non-occult spell of 7th level or lower.", 2 },
                    { new Guid("b56cb637-0b05-4b5e-a9c8-41d717987cf7"), 2, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "Duplicate any occult spell of 9th level or lower.", 2 },
                    { new Guid("f9a0898b-9cf0-41d2-ba7c-5706a7109e71"), 0, new Guid("e6dec1cf-3b35-4abc-9267-4a30e44df08c"), "You splash a glob of acid that splatters your target and nearby creatures. Make a spell attack. If you hit, you deal 1d6 acid damage plus 1 splash acid damage. On a critical success, the target also takes 1 persistent acid damage.", 0 },
                    { new Guid("7f853b09-3cc4-4c89-a92d-9ecc67fabddb"), 0, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "You harness your mastery of primal forces to reshape your body into a Medium flying animal battle form. When you cast this spell, choose bat, bird, pterosaur, or wasp. You can decide the specific type of animal (such as an owl or eagle for bird), but this has no effect on the form’s Size or statistics. While in this form, you gain the animal trait. You can Dismiss the spell.", 0 },
                    { new Guid("887e893d-9fcc-497b-8919-8042b3cdc1ec"), 1, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("567dee10-2303-414d-98fa-56f7716db07d"), 2, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- AC = 18 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("5ff96a2e-a6ea-4517-aba3-0fe377bae9d5"), 3, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- 5 temporary Hit Points.", 2 },
                    { new Guid("f75b792f-043d-41cf-b6a9-56f7bd20ba1f"), 4, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- Low-light vision.", 2 },
                    { new Guid("f70c57db-900e-463b-b89a-c2bd7fe6cf56"), 5, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +16, and your damage bonus is +5. These attacks are Dexterity based (for the purpose of the clumsy condition, for example). If your attack modifier for Dexterity-based unarmed attacks is higher, you can use it instead.", 2 },
                    { new Guid("ebc22a9b-b423-46ad-a966-0e1681936c64"), 6, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- Acrobatics modifier of +16, unless your own modifier is higher.", 2 },
                    { new Guid("ee30e7f9-5884-4454-955c-1da78755dab9"), 7, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "You also gain specific abilities based on the form you choose:", 0 },
                    { new Guid("1aec42b4-675b-4d61-8575-0115a42e52cc"), 8, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- Bat Speed 20 feet, fly Speed 30 feet; precise echolocation 40 feet; Melee [one-action] fangs, Damage 2d8 piercing; Melee [one-action] wing (agile), Damage 2d6 bludgeoning.", 2 },
                    { new Guid("d96945ba-09d9-4b78-acc7-5b09c7afab4c"), 9, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- Bird Speed 10 feet, fly Speed 50 feet; Melee [one-action] beak, Damage 2d8 piercing; Melee [one-action] talon (agile), Damage 1d10 slashing.", 2 },
                    { new Guid("7c3a524d-46bf-4367-941d-bc97e7c55be8"), 10, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- Pterosaur Speed 10 feet, fly Speed 40 feet; imprecise scent 30 feet; Melee[one-action] beak, Damage 3d6 piercing.", 2 },
                    { new Guid("f34e506c-12c8-4dad-9cbf-9e543170d9f1"), 11, new Guid("aee1f3ae-7c4d-4032-883c-73d4d903b2d9"), "- Wasp Speed 20 feet, fly Speed 40 feet; Melee [one-action] stinger, Damage 1d8 piercing plus 1d6 persistent poison.", 2 },
                    { new Guid("3a2d3a72-630c-4423-9c65-3778ff433cff"), 0, new Guid("23bf8fed-66e0-4e3b-b0bc-629ddf8dddfc"), "You channel the allure of your nymph bloodline into a terribly beautiful glance. Each enemy in the area must attempt a Will saving throw.", 0 },
                    { new Guid("eba305d2-2565-417f-8bf4-41ec967add47"), 0, new Guid("fbb8d7cc-6793-484c-80a8-4fafb137e01e"), "A bubble of pure air appears around the target’s head, allowing it to breathe normally.The effect ends as soon as the target returns to an environment where it can breathe normally.", 0 },
                    { new Guid("6c32648f-499d-4392-aed9-194555267d3c"), 0, new Guid("5c0b6313-4951-4dc4-9289-0ec20210643d"), "The target can walk on air as if it were solid ground. It can ascend and descend in this way at a maximum of a 45 - degree angle.", 0 },
                    { new Guid("7ee60bac-8c15-4585-ba13-ddabd9564658"), 0, new Guid("558a6ae1-fc9f-4e11-9c93-18d52be7f5aa"), "You ward an area to alert you when creatures enter without your permission. When you cast alarm, select a password. Whenever a Small or larger corporeal creature enters the spell’s area without speaking the password, alarm sends your choice of a mental alert (in which case the spell gains the mental trait) or an audible alarm with the sound and volume of a hand bell (in which case the spell gains the auditory trait). Either option automatically awakens you, and the bell allows each creature in the area to attempt a DC 15 Perception check to wake up. A creature aware of the alarm must succeed at a Stealth check against the spell’s DC or trigger the spell when moving into the area.", 0 },
                    { new Guid("56f45e68-032c-4929-a269-978e6d27a77c"), 0, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "You use your occult lore and the power of your mind to manipulate the spiritual multiverse", 0 },
                    { new Guid("f2b10f10-1854-4e8b-b052-304b6fe58f9f"), 1, new Guid("5cffbfee-9c91-4c00-a8e5-d24c75200deb"), "The spell has the following effects:", 0 },
                    { new Guid("19cb8dc2-bef1-4622-b4e2-786de8f85b81"), 13, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Deer Speed 50 feet; Melee [one-action] antler, Damage 2d6 piercing.", 2 },
                    { new Guid("b63c6577-1c20-42ef-8bf4-4fd87ec3f16a"), 14, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Frog Speed 25 feet, swim Speed 25 feet; Melee [one-action] jaws, Damage 2d6 bludgeoning; Melee [one-action] tongue (reach 15 feet), Damage 2d4 bludgeoning.", 2 },
                    { new Guid("69870368-0e1e-43a6-9939-de554f70b183"), 15, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Shark swim Speed 35 feet; Melee [one-action] jaws, Damage 2d8 piercing; breathe underwater but not in air.", 2 },
                    { new Guid("f388440c-c3bf-46ed-8048-109135a6e719"), 16, new Guid("1facaf2c-11ad-43fc-a69c-6e18e3e81b4d"), "Snake Speed 20 feet, climb Speed 20 feet, swim Speed 20 feet; Melee[one - action] fangs, Damage 2d4 piercing plus 1d6 poison.", 2 },
                    { new Guid("90f30a66-c2fc-441e-9f77-5b0054606681"), 7, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "You also gain the specific abilities listed for your deity below:", 0 },
                    { new Guid("18cfb804-b63c-42c2-8de5-57f110ed13f3"), 8, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Abadar: Speed 50 feet, burrow Speed 30 feet, immune to immobilized; Ranged[one - action] crossbow(range increment 120 feet, reload 1), Damage 6d10 + 3 piercing.", 2 },
                    { new Guid("a0746a57-ce84-495e-b5c9-b41c0161607c"), 9, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Asmodeus: Speed 70 feet, air walk; Melee [one-action] mace (reach 15 feet), Damage 6d10+6 bludgeoning; Ranged [one-action] hellfire (range 120 feet), Damage 6d6+3 fire.", 2 },
                    { new Guid("e0460453-86b5-447b-b407-f5568d63f4a6"), 10, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Calistria: Speed 30 feet, fly Speed 70 feet; Melee [one-action] whip (disarm, finesse, nonlethal, reach 20 feet), Damage 6d4+6 slashing; Ranged [one-action] savored sting (range 60 feet), Damage 6d6+3 poison.", 2 },
                    { new Guid("7abfa2fb-aac3-48fd-81c6-1e6522b70c15"), 11, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Cayden Cailean: Speed 70 feet, air walk, ignore difficult terrain and greater difficult terrain; Melee [one-action] rapier (deadly, reach 15 feet), Damage 6d6+6 piercing; Ranged [one-action] ale splash (range 120 feet), Damage 6d6+3 poison.", 2 },
                    { new Guid("5ffa2d79-74e2-4327-9f08-4f3216cd2417"), 12, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Desna: Speed 30 feet, fly Speed 70 feet; Melee [one-action] starknife (agile, deadly, finesse, reach 15 feet, silver, thrown 60 feet), Damage 6d4+6 piercing; Ranged [one-action] moonbeam (range 120 feet, silver), Damage 6d6+3 fire.", 2 },
                    { new Guid("b78b210e-6ae9-4f99-8a09-9d77e4859e6b"), 13, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Erastil: Speed 70 feet, air walk, ignore difficult terrain and greater difficult terrain; Ranged[one - action] longbow(deadly d8, range increment 150 feet), Damage 6d8 + 3 piercing.", 2 },
                    { new Guid("799ce61b-2cdb-4ec9-9036-649d279e9c08"), 14, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Gorum: Speed 70 feet, immune to immobilized; Melee [one-action] greatsword (versatile P, reach 15 feet), Damage 6d12+6 slashing.", 2 },
                    { new Guid("615ce084-3dba-407b-9239-3b7008af1d76"), 15, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Gozreh: No land Speed, fly Speed 70 feet, swim Speed70 feet, ignore difficult terrain and greater difficult terrain; Melee [one-action] waves (bull rush, reach 15 feet, thrown 20 feet), Damage 6d8+6 bludgeoning; Ranged [one-action] wind (versatile electricity, range 120 feet), Damage 6d6+3 bludgeoning.", 2 },
                    { new Guid("039876d3-70a2-4c24-a3a8-ebd2fd3d2504"), 16, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Iomedae: Speed 70 feet, air walk; shield (15 Hardness, can’t be damaged); Melee [one-action] longsword (versatile P, reach 15 feet), Damage 6d8+6 slashing.", 2 },
                    { new Guid("a0ba7a4e-2f91-4988-ab24-505e68e7d734"), 17, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Irori: Speed 80 feet, air walk; Melee [one-action] unfettered strike (agile, versatile P or S, finesse, reach 15 feet), Damage 6d8+6 bludgeoning; Ranged [one-action] wind strike (range 60 feet), Damage 6d4+6 bludgeoning.", 2 },
                    { new Guid("d21692fa-cd36-4823-80c9-f47bff9b8412"), 18, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Lamashtu: Speed 30 feet, fly Speed 70 feet; Melee [one-action] falchion (forceful, reach 15 feet), Damage 6d10+6 slashing; Ranged [one-action] waters of Lamashtu (range 120 feet), Damage 6d6 + 3 poison.", 2 },
                    { new Guid("ef3ff3a5-bf5b-4e95-89b2-4a96fc08f719"), 19, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Nethys: Nethys Speed 70 feet, air walk; Ranged [one-action] raw magic (range 120 feet; versatile cold, electricity, or fire), Damage 6d6 force.", 2 },
                    { new Guid("a443f87b-292a-437b-a60a-c327af9c27e9"), 20, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Norgorber: Speed 70 feet, air walk, ignore difficult terrain and greater difficult terrain; Melee [one-action] shortsword (agile, finesse, versatile S, reach 15 feet), Damage 6d6+6 piercing; Ranged [one-action] blackfinger toss (range 120 feet), Damage 6d6+3 poison.", 2 },
                    { new Guid("1f160434-ebe0-4fee-8fc1-ad761d54f891"), 21, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Pharasma: Speed 70 feet, air walk; Melee [one-action] dagger (agile, finesse, reach 15 feet, thrown 40 feet), Damage 6d6+6 slashing; Ranged [one-action] spiral blast (range 120 feet, damages only undead), Damage 6d8+3 positive.", 2 },
                    { new Guid("60c7c9ae-9867-4419-9c3b-1fe678d0a0a3"), 0, new Guid("e186ebc1-8e33-4b62-a0cf-f0ceddee726a"), "Your target glows with a magical aura visible only to you and those who follow your lead. Your target is visible to you and others sharing your Hunt Prey benefits even if it wouldn’t normally be due to lighting or the concealed or invisible conditions, though cover from opaque objects still blocks your sight. You ignore the flat check against the target due to the concealed condition, and the target isn’t automatically hidden from you due to darkness or being invisible.", 0 },
                    { new Guid("d23a21c8-3019-441b-9cbb-85aa284751c5"), 22, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Rovagug: Speed 50 feet, burrow Speed 30 feet, immune to immobilized; Melee [one-action] jaws (reach 15 feet), Damage 6d12+6 piercing; Melee [one-action] leg (agile, versatile P, reach 15 feet), Damage 6d8+6 bludgeoning.", 2 },
                    { new Guid("2259126a-45a5-4687-9821-c15ce1b70cab"), 23, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Sarenrae: Speed 30 feet, fly Speed 70 feet; Melee [one-action] scimitar (forceful, nonlethal, reach 15 feet), Damage 6d6+6 slashing; Ranged [one-action] everflame (nonlethal, range 120 feet), Damage 6d6+3 fire.", 2 },
                    { new Guid("d1ec7d7c-0749-465f-8582-565703093c6d"), 24, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Shelyn: Speed 70 feet, air walk, ignore difficult terrain and greater difficult terrain; Melee [one-action] glaive (deadly d8, nonlethal, reach 20 feet), Damage 6d8+6 slashing; Ranged [one-action] melody of inner beauty, (nonlethal, range 120 feet), Damage 6d6+3 sonic.", 2 },
                    { new Guid("498b0a9a-0524-49bc-877f-3140eac68339"), 6, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Athletics modifier of +35, unless your own is higher.", 2 },
                    { new Guid("a3beeee6-be5e-478b-bc1e-09f401eb8aa7"), 26, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Urgathoa: Speed 70 feet, air walk; Melee [one-action] scythe (deadly d10, trip, reach 15 feet), Damage 6d10+6 slashing; Ranged [one-action] pallid plague (range 120 feet), Damage 6d6+3 negative.", 2 },
                    { new Guid("87ae08fa-7ec5-4c5e-99e3-918c6530e65b"), 5, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "One or more attacks specific to your deity’s battle form, which are the only attacks you can use. You’re trained with them. Your attack modifier is +33, and you use the listed damage. Melee attacks are Strength based (for the purposes of the enfeebled condition, for example) unless they have the finesse trait, and all ranged attacks are Dexterity based. Attacks that deal positive or negative damage don’t heal creatures.", 2 },
                    { new Guid("95d2bd40-775a-43e7-b421-e46792dd7ebc"), 3, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "30 temporary Hit Points.", 2 },
                    { new Guid("1b0611b5-02a7-40ca-9245-23b738f2e6fc"), 0, new Guid("5ca21ccd-2ccc-4900-99fe-40480d6103f2"), "You offer food, and an ordinary Tiny animal within range approaches to eat it. You imprint the image, direction, and distance of an obvious place or landmark well known to you within the animal. You can also attach a small object or note up to light Bulk to it. The animal does its best to reach the destination; if it makes it there, it waits nearby and allows nonhostile creatures to approach and remove the attached object. The spell ends after the message is delivered or after 24 hours, whichever comes first.", 0 },
                    { new Guid("53d9891f-038b-459c-a98a-76577a5aac33"), 1, new Guid("5ca21ccd-2ccc-4900-99fe-40480d6103f2"), "If there are no Tiny wild animals in range, the spell is lost.", 0 },
                    { new Guid("c34b4717-1df9-49f9-9da9-2f91e2891167"), 0, new Guid("9ebcaed3-689b-4886-939d-a8b0399180c5"), "You tap into the target’s senses, allowing you to see, hear, and otherwise sense whatever it senses for the spell’s duration.If the target wishes to prevent you from doing so, it can attempt a Will save, negating the spell on a success, but most animals don’t bother to do so.While tapping into the target’s senses, you can’t use your own body’s senses, but you can change back and forth from your body’s senses to the target’s senses using a single action, which has the concentrate trait.", 0 },
                    { new Guid("a17c6df8-7c8b-49a9-97d1-fb7dfb379964"), 0, new Guid("2bf89058-1276-4f86-a62c-f41b8a6a8dfa"), "You call forth a magical mist of positive energy that envelops a creature. The mist restores 2d8 Hit Points to a target living creature and ends one source of persistent acid, bleed, fire, negative, or poison damage affecting it. If the creature is taking persistent damage from multiple sources, you select which one is removed. Against an undead target, you deal 2d8 positive damage (basic Fortitude save); if it fails the save, it also takes 2 persistent positive damage.", 0 },
                    { new Guid("98a390ff-738d-47a8-9075-9215dca4ed30"), 0, new Guid("d18284dc-9d89-44a0-9910-57fb647d50b0"), "You may not have placed your snare in the right place, but you can magically move it there. You teleport the target snare to another unoccupied location in range.", 0 },
                    { new Guid("ade21048-8486-494e-9484-a769e6747031"), 0, new Guid("1995d493-43cd-476a-81ea-8d76076888ff"), "You cause plants in the area to entangle your foes, with the effects of entangle. A creature that critically fails the save takes 2d4 persistent bleed damage in addition to being immobilized. Escaping your bramble doesn’t end the bleed damage.", 0 },
                    { new Guid("82850481-04c2-4bbd-9b05-13956acaa0f0"), 0, new Guid("001dcfdb-d978-498b-a101-1d13c57b67f2"), "You reinforce the target’s musculoskeletal system to bear more weight. The target can carry 3 more Bulk than normal before becoming encumbered and up to a maximum of 6 more Bulk.", 0 },
                    { new Guid("ec44766f-0b53-4071-a7e1-d5e25e7b1ea8"), 0, new Guid("3e91401a-203c-4d1e-9a76-0012e2617cd8"), "You repel all magic from the target area, preventing spells and other magic from functioning. Spells can’t penetrate the area, magic items cease to function within it, and no one inside can cast spells or use magic abilities. Likewise, spells— such as dispel magic—can’t affect the field itself unless they are of a higher level. Magic effects resume the moment they pass outside the field. For example, a ray fired from one side of the field could target a creature on the other side (as long as caster and target are both outside the field). A summoned creature winks out of existence but reappears if the field moves or ends. Invested magic items cease to function, but they remain invested and resume functioning when they exit the field; the ability boost from an apex item isn’t suppressed within the field. Spells of a higher level than the antimagic field overcome its effects, and can even be cast by a creature within the field.", 0 },
                    { new Guid("644e4608-c84d-411d-89c4-365b34b755a3"), 1, new Guid("3e91401a-203c-4d1e-9a76-0012e2617cd8"), "The field disrupts only magic, so a +3 longsword still functions as a longsword. Magically created creatures (such as golems) function normally within an antimagic field.", 0 },
                    { new Guid("252c9500-8bda-4a59-ab54-fec870f557e9"), 0, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "You gain a vague glimpse of the future. During the casting of this spell, ask about the results of a particular course of action.", 0 },
                    { new Guid("7f34d0c1-10ae-4937-a9fb-aae94c21ff6e"), 1, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "The spell can predict results up to 30 minutes into the future and reveals the GM’s best guess among the following outcomes:", 0 },
                    { new Guid("62aac3fd-dc88-4275-b479-964d0e390ef0"), 2, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "Weal: The results will be good.", 2 },
                    { new Guid("a360bbe1-1f56-4bac-b1b5-a8dab82d5659"), 3, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "Woe: The results will be bad.", 2 },
                    { new Guid("ef5d40a9-0203-48f4-9744-f411c7a97342"), 4, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "Weal and Woe: The results will be a mix of good and bad.", 2 },
                    { new Guid("ba4c847a-4c45-4d7b-adb4-41a03b562606"), 5, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "Nothing: There won’t be particularly good or bad results.", 2 },
                    { new Guid("702a5b5e-0fad-48db-b126-02b58069b5f7"), 6, new Guid("cfb3f479-70d2-4275-890f-27920ec70d3d"), "The GM rolls a secret DC 6 flat check. On a failure, the result is always “nothing.” This makes it impossible to tell whether a “nothing” result is accurate. If anyone asks about the same topic as the first casting of augury during an additional casting, the GM uses the secret roll result from the first casting. If circumstances change, though, it’s possible to get a different result.", 0 },
                    { new Guid("fe2d955b-f3ef-43eb-9ae2-e42430f0a0d0"), 0, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "You transform into an avatar of your deity, assuming a Huge battle form.You must have space to expand or the spell is lost. You have hands in this battle form and can take manipulate actions.", 0 },
                    { new Guid("c11e0547-ec12-4c4b-a40b-bc5177fa1527"), 1, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "You gain the following statistics and abilities regardless of which deity’s battle form you assume:", 0 },
                    { new Guid("1c8298db-ca49-4a61-b2fa-0e3896de1f1c"), 0, new Guid("baa6d8fe-d863-41f1-8087-9d9725bb4a81"), "Your animal companion grows a thicker hide, matted fur, or a harder shell, granting it a +1 status bonus to AC.", 0 },
                    { new Guid("0e46e684-dda7-4d66-9a64-0ae231eda72f"), 4, new Guid("f708a194-3783-46f4-8cb0-bb512ed08727"), "Darkvision.", 2 },
                    { new Guid("451a5567-b1ed-4573-84d6-abd04ee44351"), 9, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Brontosaurus: Speed 25 feet; Melee [one-action] tail (reach 15 feet), Damage 2d6 bludgeoning; Melee [one-action] foot, Damage 2d8 bludgeoning.", 2 },
                    { new Guid("fcd2be86-8f04-4d01-bbda-ebea7dec2614"), 10, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Deinonychus: Speed 40 feet; Melee [one-action] talon (agile), Damage 2d4 piercing plus 1 persistent bleed; Melee [one-action] jaws, Damage 1d10 piercing.", 2 },
                    { new Guid("5c1d6d32-a8a9-4d35-8a55-a75492ce165e"), 11, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Stegosaurus: Speed 30 feet; Melee [one-action] tail (reach 10 feet), Damage 2d8 piercing.", 2 },
                    { new Guid("91932a40-ad2c-48ee-93f3-9990a45df282"), 1, new Guid("9af2e49e-f7ff-4df5-9218-d68b57a7bd70"), "Creatures that succeed at their save take no damage (instead of half).", 0 },
                    { new Guid("9ca1cbe4-94be-4166-98c5-b71ec3bb34ad"), 0, new Guid("8a8ce851-b4e8-4a92-ab16-bb0d3de4be6a"), "You gain a +30-foot status bonus to your Speed.", 0 },
                    { new Guid("f0e52ed1-3a6a-4c03-aa5b-691b1b1db4e8"), 0, new Guid("03533db6-d74d-43cc-84e0-ec5f1c0177b8"), "You try to turn the target’s flesh into stone. The target must attempt a Fortitude save.", 0 },
                    { new Guid("b197b408-2b0b-4afa-bd40-1c27e994e335"), 0, new Guid("f6c88aa0-9627-4eac-815c-41c4a31acd9e"), "A disk of magical force materializes adjacent to you. This disk is 2 feet in diameter and follows 5 feet behind you, floating just above the ground. It holds up to 5 Bulk of objects (though they must be able to fit and balance on its surface). Any objects atop the disk fall to the ground when the spell ends.", 0 },
                    { new Guid("750ac885-e20b-4032-8027-ba7e81eb4cd3"), 1, new Guid("f6c88aa0-9627-4eac-815c-41c4a31acd9e"), "The spell ends if a creature tries to ride atop the disk, if the disk is overloaded, if anyone tries to lift or force the disk higher above the ground, or if you move more than 30 feet away from the disk.", 0 },
                    { new Guid("3959e792-180e-4911-b739-408651fb1c8d"), 0, new Guid("6f7a283d-9e82-4c37-b0f5-adef6633636c"), "The target can soar through the air, gaining a fly Speed equal to its Speed or 20 feet, whichever is greater.", 0 },
                    { new Guid("ea9ab626-e12b-4189-a847-b4ddebcdc28c"), 0, new Guid("4ccee2aa-e572-4c5c-b117-870c1870b06d"), "You ward an ally against the attacks and hostile spells from the target enemy. The target ally gains a +1 status bonus to Armor Class and saving throws against the target enemy’s attacks, spells, and other effects.", 0 },
                    { new Guid("ece0054d-ed1f-4e65-8984-e425f7e7446d"), 0, new Guid("e6ec03cd-0356-4e8f-9cc6-661e477e5dea"), "You gain a sixth sense that warns you of danger that might befall the target of the spell. If you choose a creature other than yourself as the target, you create a psychic link through which you can inform the target of danger. This link is a mental effect. Due to the amount of information this spell requires you to process, you can’t have more than one foresight spell in effect at a time. Casting foresight again ends the previous foresight. While foresight is in effect, the target gains a +2 status bonus to initiative rolls and isn’t flat-footed against undetected creatures or when flanked. In addition, you gain the following reaction.", 0 },
                    { new Guid("2b1fea4a-cb84-4261-ae81-a27a01bf5c07"), 0, new Guid("9af2e49e-f7ff-4df5-9218-d68b57a7bd70"), "You create a sphere of flame in a square within range. The sphere must be supported by a solid surface, such as a stone floor. The sphere deals 3d6 fire damage to each creature in the square where it first appears; each creature must attempt a basic Reflex save. On subsequent rounds, the first time you Sustain this Spell each round, you can leave the sphere in its square or roll it to another square within range. It deals 3d6 fire damage (basic Reflex save) to each creature in that square.", 0 },
                    { new Guid("b961480b-38e6-4356-aa02-c9ff234e2d10"), 0, new Guid("355246e2-8eea-42f1-8d4d-95c7df288737"), "You repel effects that would hinder a creature or slow its movement. While under this spell’s effect, the target ignores effects that would give them a circumstance penalty to Speed. When they attempt to Escape an effect that has them immobilized, grabbed, or restrained, they automatically succeed unless the effect is magical and of a higher level than the freedom of movement spell.", 0 },
                    { new Guid("fa39e9af-2830-4121-a306-162feee935e6"), 0, new Guid("7b790e8c-c322-4424-b92d-4835b0efb5d5"), "You tear open a rift to another plane, creating a portal that creatures can travel through in either direction. This portal is vertical and circular, with a radius of 40 feet. The portal appears at a location of your choice on the destination plane, assuming you have a clear idea of both the destination’s location on the plane and what the destination looks like. If you attempt to create a gate into or out of the realm of a deity or another powerful being, that being can prevent the gate from forming.", 0 },
                    { new Guid("52bebb48-1118-4e3c-871c-462b380a6e78"), 0, new Guid("e8ad8bb3-0f0f-41ed-a1f1-7d9904ce11fa"), "The targeted corpse doesn’t decay, nor can it be transformed into an undead. If the corpse is subject to a spell that requires the corpse to have died within a certain amount of time (for example, raise dead), do not count the duration of gentle repose against that time. This spell also prevents ordinary bugs and pests (such as maggots) from consuming the body.", 0 },
                    { new Guid("ae60b301-4edf-450c-8c89-f943631706b0"), 0, new Guid("08388049-8e6b-4622-a4fd-c6f6d5d7e335"), "The target weapon becomes translucent and ghostly, and it can affect material and incorporeal creatures and objects. It can be wielded by a corporeal or incorporeal creature and gains the effects of the ghost touch property rune.", 0 },
                    { new Guid("476eacdf-a8f5-4fd7-bbfd-e59f0cbafcfd"), 0, new Guid("9a93f513-7f09-48b1-b645-a650564aba41"), "You create an auditory illusion of simple sounds that has a maximum volume equal to four normal humans shouting. The sounds emanate from a square you designate within range. You can’t create intelligible words or other intricate sounds (such as music).", 0 },
                    { new Guid("5dfeb81a-e86d-43d5-a819-51e92f45af81"), 0, new Guid("a0084011-a907-40e8-bdc9-928161a4f95e"), "You touch the target to afflict it with ghoul fever, infesting it with hunger and a steadily decreasing connection to positive energy; the target must attempt a Fortitude save.", 0 },
                    { new Guid("e6a559e6-ea69-4847-8e66-76ca556036dd"), 0, new Guid("eb0b0979-ee50-4a1a-af2c-8baeb58f06dd"), "Falsehoods pass your lips as smoothly as silk. You gain a +4 status bonus to Deception checks to Lie and against Perception checks to discern if you are telling the truth, and you add your level even if you’re untrained. If the implausibility of your lies prompts a circumstance penalty or a DC increase, reduce that penalty or increase by half.", 0 },
                    { new Guid("aa8d4562-e838-4b9a-b604-86757bbb7f58"), 0, new Guid("58aae6ec-5f9a-4e70-bc80-c1e40d093d62"), "Creatures in the area are outlined by glittering dust. Each creature must attempt a Reflex save. If a creature has its invisibility negated by this spell, it is concealed instead of invisible. This applies both if the creature was already invisible and if it benefits from new invisibility effects before the end of the invisibility negation effect from this spell.", 0 },
                    { new Guid("f5492ed6-bfa9-441b-aeb5-162f18329a21"), 0, new Guid("947b3dff-8f60-4b2b-86e0-d17ccdd87f86"), "You create an immobile globe around yourself that attempts to counteract any spell from outside the globe whose area or targets enter into the globe, as if the globe were a dispel magic spell 1 level lower than its actual spell level. If the counteract attempt succeeds, it prevents only the portion of the spell that would have entered the globe (so if the spell also has targets outside the globe, or part of its area is beyond the globe, those targets or that area is affected normally). You must form the sphere in an unbroken open space, so its edges don’t pass through any creatures or objects, or the spell is lost (though creatures can enter the globe after the spell is cast).", 0 },
                    { new Guid("39e7fe07-6959-418e-9847-46ec55c3a3ba"), 0, new Guid("ec8d1e61-aa9d-4cdb-9e12-4c3cc8fa29c0"), "The target transforms into a vaporous state. In this state, the target is amorphous. It loses any item bonus to AC and all other effects and bonuses from armor, and it uses its proficiency modifier for unarmored defense. It gains resistance 8 to physical damage and is immune to precision damage. It can’t cast spells, activate items, or use actions that have the attack or manipulate trait. It gains a fly Speed of 10 feet and can slip through tiny cracks. The target can Dismiss the spell.", 0 },
                    { new Guid("fdbd0f89-b9d6-4141-83dc-bb8769f2fbc6"), 0, new Guid("b8952f75-68a9-4ca2-a257-6022d2f36803"), "You call a rain of divine fire that plummets down from above, dealing 8d6 fire damage. Because the flame is infused with divine energy, creatures in the area apply only half their usual fire resistance. Creatures that are immune to fire, instead of gaining the usual benefit of immunity, treat the results of their saving throws as one degree of success better.", 0 },
                    { new Guid("c93c3fcf-3ce0-478a-b7cd-6e791fbd230c"), 0, new Guid("fee3de9b-978f-4f95-b5f6-12241d27bbc4"), "You wreathe yourself in ghostly flames, gaining cold resistance 5. Additionally, adjacent creatures that hit you with a melee attack, as well as creatures that touch you or hit you with an unarmed attack, take 2d6 fire damage each time they do.", 0 },
                    { new Guid("8bcade86-bae2-4100-8b26-a4720c4746ba"), 2, new Guid("81520f05-c7b8-457c-9396-7546f8079826"), "When the spell ends, any remaining acorns rot and turn to ordinary soil.", 0 },
                    { new Guid("2ecd12cd-65a0-4450-91b3-e1af6da7308b"), 1, new Guid("f91f37ef-2139-4dc1-9827-512f7f7b4907"), "When the spell ends, you return to the Material Plane. If you’re in the air, you fall (unless you can fly), and if you’re inside an object, you’re pushed into the nearest open space and take 1d6 damage per 5 feet you were pushed.", 0 },
                    { new Guid("579747e9-a052-4a85-b39a-52146ccc554f"), 2, new Guid("f91f37ef-2139-4dc1-9827-512f7f7b4907"), "If you cast this spell when not on the Material Plane, it is lost.", 0 },
                    { new Guid("d6851e65-92d7-442e-9e4e-31d1702f0fd5"), 0, new Guid("5c62dfd4-3483-4fbd-84b0-e3482e32a63c"), "Choose a single statement you want the targets to believe. The fact could be narrow, such as “a dragon is circling overhead and wants to kill me”; wide-reaching, such as “all humanoids are disguised abominations”; or conceptual, such as “if I don’t live a kinder life, I’ll be punished in the afterlife.” The targets’ experiences color how they react to this “truth” and how their behavior changes. If the statement changes what they perceive, they treat the change as a sudden revelation.", 0 },
                    { new Guid("747d0275-7ecd-45cd-ae5f-e6268161d8af"), 1, new Guid("5c62dfd4-3483-4fbd-84b0-e3482e32a63c"), "The effect of the spell depends on the targets’ Will saves. If a target is already subject to fabricated truth, your spell tries to counteract it. If the counteract check fails, the outcome of the target’s saving throw can’t be worse than a success.", 0 },
                    { new Guid("794778ac-97d6-4031-940d-9b576265d5a4"), 0, new Guid("e43cda60-97f0-4147-8b5d-948251706bc4"), "All creatures in the area when you cast the spell are limned in colorful, heatless fire of a color of your choice for the duration. Visible creatures can’t be concealed while affected by faerie fire. If the creatures are invisible, they are concealed while affected by faerie fire, rather than being undetected.", 0 },
                    { new Guid("e928a4b3-0b13-4d33-93da-508862449e0a"), 0, new Guid("4719507f-5377-4d5a-b25f-3cf5c51b16fb"), "You create a reservoir of vitality from necromantic energy, gaining a number of temporary Hit Points equal to 6 plus your spellcasting ability modifier.", 0 },
                    { new Guid("a6470b54-3138-4b7f-80f1-dbd5be077a09"), 0, new Guid("10642f60-a69a-468c-9c5c-7e8669c7794c"), "You create a false image that fools any attempts to scry on an area. Any scrying spell sees, hears, smells, and otherwise detects whatever you wish within the area, rather than what is actually in the area. You can Sustain the Spell each round to change the illusion as you desire, including playing out a complex scene. If the scrying spell is of a higher level than false vision, the scryer can attempt a Perception check to disbelieve the illusion, though even if they’re successful, they can’t learn what’s truly going on in the area.", 0 },
                    { new Guid("31029dc9-cb07-4824-acf9-861da965e686"), 0, new Guid("eee187bd-5654-4215-b042-56e537a49410"), "You plant fear in the target; it must attempt a Will save.", 0 },
                    { new Guid("942c6ce2-d0fc-4b0a-a879-31565f3316e6"), 0, new Guid("a9f6569c-4d19-498f-8340-51e00af222e0"), "You cause the air itself to arrest a fall. The target’s fall slows to 60 feet per round, and the portion of the fall during the spell’s duration doesn’t count when calculating falling damage. If the target reaches the ground while the spell is in effect, it takes no damage from the fall. The spell ends as soon as the target lands.", 0 },
                    { new Guid("5b9f96c1-8c20-403c-9d9d-4244ebc4c92a"), 0, new Guid("20718a32-54fb-47d6-a948-6d4c006633ec"), "You drastically reduce the target’s mental faculties. The target must attempt a Will save. The effects of this curse can be removed only through remove curse or another effect that targets curses.", 0 },
                    { new Guid("bd2e07d5-5c99-4934-9033-c4208643cc14"), 0, new Guid("dbcc2afe-172f-4a67-bfb1-1db59d4c94f7"), "The target’s feet transform into fins, improving mobility in the water but reducing it on land. The target gains a swim Speed equal to its normal land Speed, but its land Speed becomes 5 feet.", 0 },
                    { new Guid("01608f5d-09ad-4203-aa86-69767650e971"), 0, new Guid("0b3f4499-6345-4a38-8c98-b00a6f71fc2b"), "A field of positive energy fills the area, exuding warmth and rejuvenating those within. Each living creature that starts its turn in the area regains 1d8 Hit Points, and any undead creature that starts its turn in the area takes 1d8 positive damage.", 0 },
                    { new Guid("1d6460b5-2aad-452b-b9b5-3af92ec6e3c7"), 0, new Guid("625096f8-608a-4d87-9874-729312b0f9f4"), "You become living flame, giving you fire immunity, resistance 10 to precision damage, and weakness 5 to cold and to water. Any creature that touches you or damages you with an unarmed attack or non-reach melee weapon takes 3d6 fire damage.", 0 },
                    { new Guid("7d57413c-6819-4db6-b579-84c09c41bcdc"), 1, new Guid("625096f8-608a-4d87-9874-729312b0f9f4"), "Your unarmed attacks deal 1d4 additional fire damage, and your fire spells deal one additional die of fire damage (of the same damage die the spell uses). You can cast produce flame as an innate spell; the casting is reduced from 2 actions to 1.", 0 },
                    { new Guid("adefd748-7267-46aa-89dd-a206103d0f5c"), 2, new Guid("625096f8-608a-4d87-9874-729312b0f9f4"), "In fire form, you have a fly Speed of 40 feet and don’t need to breathe.", 0 },
                    { new Guid("d79044a2-4629-4714-8548-42eccb8dd5b6"), 0, new Guid("cdc2f5a9-7700-4eb0-9666-2db04f3cdbdf"), "You point your finger toward the target and speak a word of slaying. You deal 70 negative damage to the target. If the damage from finger of death reduces the target to 0 Hit Points, the target dies instantly.", 0 },
                    { new Guid("a4b64034-31c8-440b-8370-64e81109ab66"), 0, new Guid("f2b268fd-8556-4ada-863e-4e078fb6e3a4"), "A roaring blast of fire appears at a spot you designate, dealing 6d6 fire damage.", 0 },
                    { new Guid("7d21d819-56fe-41c7-a0be-4a71db93456c"), 0, new Guid("81520f05-c7b8-457c-9396-7546f8079826"), "Four acorns grow in your hand, their shells streaked with pulsing red and orange patterns. You or anyone else who has one of the acorns can toss it up to 30 feet with an Interact action. It explodes in a 5-foot burst, dealing 4d6 fire damage. The save uses your spell DC, even if someone else throws the acorn.", 0 },
                    { new Guid("ed0082a2-cf17-4ef4-b15c-bfff7da31567"), 1, new Guid("81520f05-c7b8-457c-9396-7546f8079826"), "Flames continue to burn on the ground in the burst for 1 minute, dealing 2d6 fire damage to any creature that enters the flames or ends its turn within them. A creature can take damage from the continuing flames only once per round, even if it’s in overlapping areas of fire created by different acorns.", 0 },
                    { new Guid("8da739e3-7e84-4501-8678-fc6ce384da1b"), 0, new Guid("dd917eeb-693d-4b5c-95b8-15d653318eb5"), "You craft a trap by binding a hostile spell into a symbol. While Casting this Spell, you also Cast a Spell of a lower spell level to store in the glyph. The stored spell must take 3 actions or fewer to cast, have a hostile effect, and target one creature or have an area. You can set a password, a trigger, or both for the glyph. Any creature that moves, opens, or touches the target container or enters the target area that doesn’t speak the password or that matches the trigger activates the glyph, releasing the harmful spell within.", 0 },
                    { new Guid("8d18abf7-e3eb-4827-aac3-695a98063233"), 1, new Guid("dd917eeb-693d-4b5c-95b8-15d653318eb5"), "Once a spell is stored in the glyph, the glyph gains all thetraits of that spell. If the stored spell targets one or more creatures, it targets the creature that set off the glyph. If it has an area, that area is centered on the creature that set off the glyph. Glyph of warding’s duration ends when the glyph is triggered. The glyph counts as a magical trap, using your spell DC for both the Perception check to notice it and the Thievery check to disable it; both checks require the creature attempting them to be trained in order to succeed.", 0 },
                    { new Guid("6fae1a53-67c2-4ce0-b994-4103e9766305"), 2, new Guid("dd917eeb-693d-4b5c-95b8-15d653318eb5"), "You can Dismiss glyph of warding. The maximum number of glyphs of warding you can have active at a time is equal to your spellcasting ability modifier.", 0 },
                    { new Guid("8f1607c0-81e6-460c-ae69-ca8ee9b8a3f8"), 0, new Guid("4e7cb1a5-efac-4f03-96a4-525c1892dff2"), "Your touch afflicts the target with goblin pox, an irritating allergenic rash.The target must attempt a Fortitude save.", 0 },
                    { new Guid("3d027236-8796-4bc2-aef2-d251d4076bbc"), 0, new Guid("d0d30141-0e90-4703-bbdc-4ceb661e6689"), "You rapidly catalog and collate information relevant to your current situation. You can instantly use up to 6 Recall Knowledge actions as part of Casting this Spell. For these actions, you can’t use any special abilities, reactions, or free actions that trigger when you Recall Knowledge.", 0 },
                    { new Guid("07339e45-5280-4aad-b960-d15d5d01ac75"), 0, new Guid("b8e5314c-6a86-4dba-88ec-26ca65b8edb3"), "You create a pattern of shifting colors that hovers in the air in a geometric cloud. Creatures are dazzled while inside the pattern. In addition, a creature must attempt a Will saving throw if it is inside the pattern when you cast it, when it enters the pattern, when it ends its turn within the pattern, or if it uses a Seek or Interact action on the pattern. A creature currently fascinated by the pattern doesn’t attempt new saves.", 0 },
                    { new Guid("4572b136-f51c-4384-b39d-564d1cac5519"), 0, new Guid("ddf1c0a5-80cd-418e-bf75-6012de4cf508"), "You create an illusory image of a Large or smaller creature. It generates the appropriate sounds, smells, and feels believable to the touch. If you and the image are ever farther than 500 feet apart, the spell ends.", 0 },
                    { new Guid("400445db-e4f5-4963-9784-aaa2fd8460c0"), 1, new Guid("ddf1c0a5-80cd-418e-bf75-6012de4cf508"), "The image can’t speak, but you can use your actions to speak through the creature, with the spell disguising your voice as appropriate. You might need to attempt a Deception or Performance check to mimic the creature, as determined by the GM. This is especially likely if you’re trying to imitate a specific person and engage with someone that person knows.", 0 },
                    { new Guid("d37629b1-c0ab-46df-9e31-bd4a5f65d2d9"), 2, new Guid("ddf1c0a5-80cd-418e-bf75-6012de4cf508"), "In combat, the illusion can use 2 actions per turn, which it uses when you Sustain the Spell. It uses your spell attack roll for attack rolls and your spell DC for its AC. Its saving throw modifiers are equal to your spell DC – 10. It is substantial enough that it can flank other creatures. If the image is hit by an attack or fails a save, the spell ends.", 0 },
                    { new Guid("48685123-c565-4abf-beb9-da1b0656da26"), 3, new Guid("ddf1c0a5-80cd-418e-bf75-6012de4cf508"), "The illusion can cause damage by making the target believe the illusion’s attacks are real, but it cannot otherwise directly affect the physical world. If the illusory creature hits with a Strike, the target takes mental damage equal to 1d4 plus your spellcasting ability modifier. This is a mental effect. The illusion’s Strikes are nonlethal. If the damage doesn’t correspond to the image of the monster—for example, if an illusory Large dragon deals only 5 damage—the GM might allow the target to attempt an immediate Perception check to disbelieve the spell. Any relevant resistances and weaknesses apply if the target thinks they do, as judged by the GM. For example, if the illusion wields a warhammer and attacks a creature resistant to bludgeoning damage, the creature would take less mental damage. However, illusory damage does not deactivate regeneration or trigger other effects that require a certain damage type. The GM should track illusory damage dealt by the illusion.", 0 },
                    { new Guid("29be0ae7-81fd-4621-a19b-d6df6a336edb"), 4, new Guid("ddf1c0a5-80cd-418e-bf75-6012de4cf508"), "Any creature that touches the image or uses the Seek action to examine it can attempt to disbelieve your illusion. When a creature disbelieves the illusion, it recovers from half the damage it had taken from it (if any) and doesn’t take any further damage from it.", 0 },
                    { new Guid("42f8392e-8533-4b32-82ad-f22347c82f94"), 0, new Guid("c781e61a-fb77-4a64-9b4c-88dd8c740f93"), "You create an illusion that causes you to appear as another creature of the same body shape, and with roughly similar height (within 6 inches) and weight (within 50 pounds), as yourself. The disguise is typically good enough to hide your identity, but not to impersonate a specific individual. The spell doesn’t change your voice, scent, or mannerisms. You can change the appearance of your clothing and worn items, such as making your armor look like a dress. Held items are unaffected, and any worn item you remove returns to its true appearance.", 0 },
                    { new Guid("52d6978a-5855-4cb5-8171-a9985acd5558"), 1, new Guid("c781e61a-fb77-4a64-9b4c-88dd8c740f93"), "Casting illusory disguise counts as setting up a disguise for the Impersonate use of Deception; it ignores any circumstance penalties you might take for disguising yourself as a dissimilar creature, it gives you a +4 status bonus to Deception checks to prevent others from seeing through your disguise, and you add your level even if you’re untrained. You can Dismiss this spell.", 0 },
                    { new Guid("92d0dffc-6cb3-4b94-916b-6bb20a8d0a4e"), 0, new Guid("45e1514e-a300-4c68-8853-3ad4902b9a5a"), "You create an illusory visual image of a stationary object. The entire image must fit within the spell’s area. The object appears to animate naturally, but it doesn’t make sounds or generate smells. For example, water would appear to pour down an illusory waterfall, but it would be silent.", 0 },
                    { new Guid("1d323474-d269-4551-831c-213b67e821f8"), 1, new Guid("45e1514e-a300-4c68-8853-3ad4902b9a5a"), "Any creature that touches the image or uses the Seek action to examine it can attempt to disbelieve your illusion.", 0 },
                    { new Guid("c3b73320-5387-4514-9fd0-1239eb887164"), 0, new Guid("78c42004-5f32-428c-8d6c-707bff4bc431"), "You form an imaginary scene that includes up to 10 discrete creatures or objects of various sizes, all of which must be within the spell’s area. These elements generate appropriate sounds and smells, and they feel right to the touch. Elements of an illusory scene are incapable of speech. Unlike with the illusory creature spell, creatures in your scene lack combat abilities and statistics. Your scene doesn’t include changes to the environment around it, though you can place your scene within the illusory environment of a hallucinatory terrain spell.", 0 },
                    { new Guid("35534e8b-d294-48d3-a9d7-47278a67b926"), 1, new Guid("78c42004-5f32-428c-8d6c-707bff4bc431"), "When you create the scene, you can choose to have it be static or follow a program. Though a static scene is stationary, it includes basic natural movement. For example, wind blowing on an illusory piece of paper would rustle it. A program can be up to 1 minute long and repeats when finished. For instance, you could create a scene of two orcs fighting each other, and the fight would go the same way for each repetition. If you create a loop, the two fighters end up in the same place at the start of the scene and at the end of it, but you can smooth the program so it’s hard to tell when the loop ends and begins. Anyone observing the scene for more than a few minutes almost always notices it looping. You’re unable to alter the program after you create the illusion.", 0 },
                    { new Guid("a7dead75-0040-4c46-a398-bbc701e754d7"), 2, new Guid("78c42004-5f32-428c-8d6c-707bff4bc431"), "Any creature that touches any part of the image or uses the Seek action to examine it can attempt to disbelieve your illusion. If they interact with a portion of the illusion, they disbelieve only that portion. They disbelieve the entire scene only on a critical success.", 0 },
                    { new Guid("e5e934a2-7bf8-47fc-a081-1af1a6d28808"), 0, new Guid("4d827030-0f40-496b-a73f-4477ed978bce"), "You crush the target by causing it to collapse in on itself, dealing 75 damage. The first time each round you Sustain the Spell, you must choose a new target to be subject to the same effect; the same creature can never be targeted more than once with a single casting of this spell. You also can’t affect more than one creature per turn with implosion. You can’t target a creature that’s incorporeal, gaseous, or liquid, or otherwise lacking a solid form.", 0 },
                    { new Guid("5a8f3bcc-4061-464c-9641-325e44ed2d29"), 0, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "You envision a simple bug and transform into a Medium animal battle form. When you cast this spell, choose ant, beetle, centipede, mantis, scorpion, or spider. You can decide the specific type of animal (such as such as a ladybug or scarab for beetle), but this has no effect on the form’s Size or statistics. While in this form, you gain the animal trait. You can Dismiss this spell.", 0 },
                    { new Guid("4b9726a2-e3aa-4427-9a04-3b6e00919145"), 1, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("ab060a35-3548-4252-9832-0d39fd62c27b"), 2, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "AC = 18 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("460c6749-007f-4c19-ab8d-832e25bd6ecc"), 3, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "10 temporary Hit Points.", 2 },
                    { new Guid("004690f2-010d-4c71-98e1-aedf82b45e2f"), 0, new Guid("0808337e-3acb-4275-ab1c-50ded0240984"), "A swirling torrent of water manifests along a straight line, battering creatures and unattended objects in its path and possibly pushing them away from you. The torrent deals 8d6 bludgeoning damage. Each creature in the area must attempt a basic Fortitude save; unattended objects automatically fail. Creatures and objects that fail the save are also knocked back 5 feet (10 feet on a critical failure).", 0 },
                    { new Guid("b527f78c-c4c7-4626-9262-1b360dfbfc39"), 0, new Guid("f91f37ef-2139-4dc1-9827-512f7f7b4907"), "You travel to the Ethereal Plane, which overlaps the Material Plane. Material Plane creatures can’t see you, and you can move through things on the Material Plane. You move at half your normal Speeds, but can move in any direction (including up and down). You can see onto the Material Plane within a radius of 60 feet; it is gray, hazy, and concealed from you. You can’t affect the Material Plane, and you can’t be affected by the Material Plane except by force effects and abjurations originating there.", 0 },
                    { new Guid("036694bd-3506-4731-b174-163d514a3044"), 0, new Guid("39319090-baf5-4ecf-89e9-151a26522d3d"), "You call forth a powerful blast of pressurized water that bludgeons the target and knocks it back. Make a ranged spell attack roll.", 0 },
                    { new Guid("3d98e32e-c316-4339-b3c8-da732e8248c0"), 0, new Guid("8566d394-5233-444e-ad39-4a8beb9a7f53"), "You transform your appearance to that of a Small or Medium humanoid, such as a dwarf, elf, goblin, halfling, human, orc, or lizardfolk. You gain the humanoid trait in addition to your other traits while in this form, as well as any trait related to the creature’s kind (such as goblin or human). If this transformation reduces your size, it reduces your reach accordingly (as the shrink spell). This transformation doesn’t change your statistics in any way, and you don’t gain any special abilities of the humanoid form you assume. You can still wear and use your gear, which changes size (if necessary) to match your new form. If items leave your person, they return to their usual size.", 0 },
                    { new Guid("7fb666a5-a4b8-4550-abfb-66d6851ac640"), 0, new Guid("46458699-2c06-4320-9e77-b8e73f1a987a"), "You conjure grease, with effects based on choosing area or target.", 0 },
                    { new Guid("bc2688da-50d0-4056-91fe-663a1c550433"), 1, new Guid("46458699-2c06-4320-9e77-b8e73f1a987a"), "Area", 1 },
                    { new Guid("4217e8dc-4d26-4a69-83f9-9e4c5db4006a"), 2, new Guid("46458699-2c06-4320-9e77-b8e73f1a987a"), "All solid ground in the area is covered withgrease. Each creature standing on the greasy surface must succeed at a Reflex save or an Acrobatics check against your spell DC or fall prone. Creatures using an action to move onto the greasy surface during the spell’s duration must attempt either a Reflex save or an Acrobatics check to Balance. A creature that Steps or Crawls doesn’t have to attempt a check or save.", 0 },
                    { new Guid("f2ec067f-3e05-4c93-ae80-606b192a9416"), 3, new Guid("46458699-2c06-4320-9e77-b8e73f1a987a"), "Target", 1 },
                    { new Guid("2f908506-a4d8-4782-8215-6bb3e9c6d715"), 4, new Guid("46458699-2c06-4320-9e77-b8e73f1a987a"), "If you cast the spell on an unattended object, anyone trying to pick up the object must succeed at an Acrobatics check or Reflex save against your spell DC to do so. If you target an attended object, the creature that has the object must attempt an Acrobatics check or Reflex save. On a failure, the holder or wielder takes a –2 circumstance penalty to all checks that involve using the object; on a critical failure, the holder or wielder releases the item. The object lands in an adjacent square of the GM’s choice. If you cast this spell on a worn object, the wearer gains a +2 circumstance bonus to Fortitude saves against attempts to grapple them.", 0 },
                    { new Guid("2bf37083-1d28-4bc5-8d78-ee5d7ff7411c"), 0, new Guid("dee50182-70ca-460e-8610-91cf21943170"), "Tendrils of darkness curl out from your fingertips and race through the air. You deal 2d4 negative damage and 1 persistent bleed damage to living creatures in the line. Each living creature in the line must attempt a Fortitude save.", 0 },
                    { new Guid("4352ca51-487b-48b8-83dd-26bd7cd31b5d"), 0, new Guid("0793bce3-602c-4176-b4ff-31471af78ed9"), "You ask for divine guidance, granting the target a +1 status bonus to one attack roll, Perception check, saving throw, or skill check the target attempts before the duration ends. The target chooses which roll to use the bonus on before rolling. If the target uses the bonus, the spell ends. Either way, the target is then temporarily immune for 1 hour.", 0 },
                    { new Guid("8cb0a97e-b278-4a4e-bd77-039a29c97718"), 0, new Guid("182823a4-0b66-4bfe-a4fa-79dfd4fb5abf"), "A violent wind issues forth from your palm, blowing from the point where you are when you cast the spell to the line’s opposite end. The wind extinguishes small non-magical fires, disperses fog and mist, blows objects of light Bulk or less around, and pushes larger objects. Large or smaller creatures in the area must attempt a Fortitude save. Large or smaller creatures tha", 0 },
                    { new Guid("b564e15e-4a2b-4622-84a4-64d90e74671a"), 0, new Guid("ba088a8d-3acd-4ae3-b661-9043201478b5"), "The target consistently detects one thing as another, can’t detect something that’s there, or detects something that’s not there, though it doesn’t alter their beliefs. You choose which of these effects applies, and you determine the specifics of the hallucination. For example, you could make the target see all elves as humans, be unable to detect the presence of their brother, see their beloved pocket watch on their person even when it isn’t, or see a tower in the center of town.", 0 },
                    { new Guid("c5c6d878-ba21-4d16-b633-2afd65d3fe11"), 1, new Guid("ba088a8d-3acd-4ae3-b661-9043201478b5"), "The target can attempt an initial Will save, with effects below. They also receive a Will save to disbelieve the hallucination every time they Seek or directly interact with the hallucination. For example, the target could attempt to disbelieve the hallucination each time they interacted with an elf, bumped into their brother accidentally, tried to check their pocket watch, or studied the tower. The target can attempt to disbelieve with a large circumstance bonus in situations determined by the GM, such as if the target attempted to climb the nonexistent tower.", 0 },
                    { new Guid("317d519e-75c2-4cb2-96a3-3ab65926c0af"), 0, new Guid("00331151-20c7-4dfb-9198-eb1726b68b73"), "You create an illusion that causes natural terrain to look, sound, feel, and smell like a different kind of terrain. This doesn’t disguise any structures or creatures in the area.", 0 },
                    { new Guid("74f79956-e3fa-46f2-a76f-61ed5c54d1d6"), 1, new Guid("00331151-20c7-4dfb-9198-eb1726b68b73"), "Any creature that touches the illusion or uses the Seek action to examine it can attempt to disbelieve your illusion.", 0 },
                    { new Guid("430292f7-5d21-4c7b-84c0-a68c3d3de175"), 0, new Guid("82963894-a9f4-443c-af8e-504e256fda94"), "You channel negative energy to harm the living or heal the undead. If the target is a living creature, you deal 1d8 negative damage to it, and it gets a basic Fortitude save. If the target is a willing undead creature, you restore that amount of Hit Points. The number of actions you spend when Casting this Spell determines its targets, range, area, and other parameters.", 0 },
                    { new Guid("e2a67324-858d-44e7-a6b8-cf5c8a3548e3"), 0, new Guid("00ef5f27-7761-4b7e-a158-f7ef102eb585"), "Magic empowers the target to act faster. It gains the quickened condition and can use the extra action each round only for Strike and Stride actions.", 0 },
                    { new Guid("c5d0f7d3-9071-4d43-9d84-dad18c884b07"), 0, new Guid("3539f142-4c87-4dc0-86df-040ba5e56b2c"), "You channel positive energy to heal the living or damage the undead. If the target is a willing living creature, you restore 1d8 Hit Points. If the target is undead, you deal that amount of positive damage to it, and it gets a basic Fortitude save. The number of actions you spend when Casting this Spell determines its targets, range, area, and other parameters.", 0 },
                    { new Guid("629e6bc8-2c82-41d1-a7fc-2f0bab24bb9a"), 0, new Guid("e8c9c276-8fac-4aa9-bb37-f41fbc66cbd1"), "You tap into the target’s inner heroism, granting it a +1 status bonus to attack rolls, Perception checks, saving throws, and skill checks.", 0 },
                    { new Guid("ca66e456-57da-4b4c-8401-5e89ebb5fa85"), 0, new Guid("3f5aac9a-03cd-4c4b-8504-d6d3597e95a8"), "The target is overtaken with uncontrollable laughter. It must attempt a Will save.", 0 },
                    { new Guid("0a84479a-eedb-4129-bb27-a62406e9fa9f"), 0, new Guid("9ced7a87-4222-49e4-8501-a2007b107199"), "You call upon sacred energy to amplify a vial of holy water, tossing it an incredible distance. It explodes in an enormous burst that deals 3d6 bludgeoning damage to creatures in the area from the cascade of water. The water deals an additional 6d6 positive damage to undead and 6d6 good damage to fiends.", 0 },
                    { new Guid("28c84572-505d-475d-9a38-4c74c8fe0ebd"), 0, new Guid("969b3331-855c-4d0e-94dc-ed9f9bc9219c"), "You pull the moisture from the targets’ bodies, dealing 10d10 negative damage. Creatures made of water (such as water elementals) and plant creatures use the outcome for one degree of success worse than the result of their saving throw. Creatures whose bodies contain no significant moisture (such as earth elementals) are immune to horrid wilting.", 0 },
                    { new Guid("81664c45-eb8d-4dcc-b87f-dd54016bf758"), 1, new Guid("8566d394-5233-444e-ad39-4a8beb9a7f53"), "Humanoid form grants you a +4 status bonus to Deception checks to pass as a generic member of the chosen ancestry, and you add your level even if you’re untrained, but you can’t make yourself look like a specific person. If you want to Impersonate an individual, you still need to create a disguise, though the GM won’t factor in the difference in ancestry when determining the DC of your Deception check. You can Dismiss this spell.", 0 },
                    { new Guid("ea317430-421c-4cb3-9ff1-9f438186110a"), 1, new Guid("bb133e97-c0be-4c85-bce1-efd4f4cee979"), "Each creature that comes within range has to attempt a save when you Sustain the Spell. If you’re speaking, enthrall gains the linguistic trait.", 0 },
                    { new Guid("87c7cd27-5fd2-40c1-b985-d192409bc2b5"), 0, new Guid("bb133e97-c0be-4c85-bce1-efd4f4cee979"), "Your words fascinate your targets. You speak or sing without interruption throughout the casting and duration. Targets who notice your speech or song might give their undivided attention; each target must attempt a Will save. The GM might grant a circumstance bonus (to a maximum of +4) if the target is of an opposing religion, ancestry, or political leaning, or is otherwise unlikely to agree with what you’re saying.", 0 },
                    { new Guid("b72ecf42-66d3-4d4e-a854-9f26a2ecafdc"), 0, new Guid("1472aa71-14ec-4a01-a4ec-f82cbebdb1ed"), "Plants in the area entangle creatures. The area counts as difficult terrain. Each round that a creature starts its turn in the area, it must attempt a Reflex save. On a failure, it takes a –10-foot circumstance penalty to its Speeds until it leaves the area, and on a critical failure, it is also immobilized for 1 round. Creatures can attempt to Escape at entangle’s DC to remove these effects.", 0 },
                    { new Guid("32014b54-ab8b-4c60-be4e-2ab72ae18ea0"), 1, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "If you were Medium or smaller, you become Large, as the effects of enlarge. You must have space to expand into, or the spell is lost. You also gain the following benefits.", 0 },
                    { new Guid("e38e0b0c-dd32-4e48-8f7c-b5dd74371b98"), 2, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "40 temporary Hit Points.", 2 },
                    { new Guid("efab6a65-c298-4b9e-a580-9ff3726bb950"), 3, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "A fly Speed equal to your Speed.", 2 },
                    { new Guid("e25b180f-db39-4c21-9ed3-6d808c006020"), 4, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "Weakness 10 to the alignment opposite the one you chose.", 2 },
                    { new Guid("08a3e3f0-9d91-4c27-87b8-df3ff705ca2d"), 5, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "A +1 status bonus to saves against spells.", 2 },
                    { new Guid("c16c0f4b-da16-4d0f-9cb2-baab4ba1667c"), 6, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "Darkvision.", 2 },
                    { new Guid("e13e5c33-fa04-43d2-9430-8ee5988e2e62"), 7, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "Your unarmed attacks and weapons deal 1 additional damage of the chosen alignment type.", 2 },
                    { new Guid("37ac6077-a033-413b-b8f6-1120ec70cb14"), 8, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "One or more unarmed melee attacks. If you chose good or lawful, your fist attacks deal 2d8 damage. If you chose chaotic, you gain a bite unarmed attack that deals 2d10 piercing damage. If you chose evil, you gain a claws unarmed attack that deals 2d8 slashing damage and has the agile and finesse traits.", 2 },
                    { new Guid("226067e2-ba86-46de-a932-e1f1087b94fa"), 0, new Guid("ca290cb0-c098-416f-b5dd-186fae2d6e18"), "You can channel the fury of your deity against foes of opposed alignment. Choose an alignment your deity has (chaotic, evil, good, or lawful). You can’t cast this spell if you don’t have a deity or your deity is true neutral. This spell gains the trait of the alignment you chose. You deal 4d10 damage of the alignment you chose; each creature in the area must attempt a Fortitude save. Creatures that match the alignment you chose are unaffected. Those that neither match nor oppose it treat the result of their saving throw as one degree better.", 0 },
                    { new Guid("854f9ba4-d984-4022-a611-0308695b7280"), 0, new Guid("f60c59d1-d117-4f9a-8ef1-ef4defab2bf8"), "You take command of the target, forcing it to obey your orders. If you issue an obviously self-destructive order, the target doesn’t act until you issue a new order. The effect depends on its Will save.", 0 },
                    { new Guid("7e89d29f-4afa-45ad-b724-f7421e49e4d0"), 0, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Calling upon powerful transformative magic, you gain a Large dragon battle form. You must have space to expand or the spell is lost. When you cast this spell, choose one type of chromatic or metallic dragon. While in this form, you gain the dragon trait. You have hands in this battle form and can take manipulate actions. You can Dismiss the spell.", 0 },
                    { new Guid("4be6ccab-950d-42ad-9198-1ddcbdba496b"), 1, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("3de57955-8442-48c1-99c4-bdd80b874202"), 2, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "AC = 18 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("51faf1cb-f741-43cf-85ca-92e1d938d3fb"), 3, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "10 temporary Hit Points.", 2 },
                    { new Guid("04867e4b-307e-4cd9-add2-6b300f4458f0"), 4, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Speed 40 feet, fly Speed 100 feet.", 2 },
                    { new Guid("c64bea22-c15d-4875-8c1f-aac233ffeaee"), 5, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Resistance 10 against the damage type of your breath weapon(see below).", 2 },
                    { new Guid("6a3eff7e-e769-49a2-9a08-4f830ed0f215"), 6, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Darkvision and imprecise scent 60 feet.", 2 },
                    { new Guid("a7604574-4a30-495a-bc3c-3e87e2db3ad1"), 7, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +22, and your damage bonus is +6. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If your unarmed attack modifier is higher, you can use it instead. See below for more on these attacks.", 2 },
                    { new Guid("3fc36139-62f3-4b07-b63e-d3883f161c04"), 8, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Athletics modifier of +23, unless your own modifier is higher.", 2 },
                    { new Guid("79f7c04c-7f10-4574-ae4c-5ea1c9921ef0"), 0, new Guid("6e689573-2fdb-409f-abd2-a27135775498"), "You accept otherworldly energies into your body; while you are still recognizably yourself, you gain the features of one of your deity’s servitors. Choose an alignment your deity has (chaotic, evil, good, or lawful). You can’t cast this spell if you don’t have a deity or your deity is true neutral. This spell gains the trait of the alignment you chose.", 0 },
                    { new Guid("64973dc5-5633-4745-896c-415c5a7e82e5"), 9, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Breath Weapon [two-actions] (arcane, evocation) The shape, damage, and damage type of your breath weapon depend on your specific dragon form (see below). A creature in the area attempts a basic save against your spell DC. This is a Reflex save unless stated otherwise in the special ability description for your specific dragon form. Once activated, your breath weapon can’t be used again for 1d4 rounds. Your breath weapon has the trait corresponding to the type of damage it deals.", 0 },
                    { new Guid("cf9b3fa4-e400-4e53-8e3b-61fa8da555f4"), 0, new Guid("eb816f67-17d1-439b-badb-2657b57f64e2"), "You unleash a beam of divine energy. Choose an alignment your deity has (chaotic, evil, good, or lawful). You can’t cast this spell if you don’t have a deity or if your deity is true neutral. Make a ranged spell attack roll against the target’s AC. On a hit, the target takes damage of the chosen alignment type equal to 1d4 + your spellcasting ability modifier (double damage on a critical hit). The spell gains the trait of the alignment you chose.", 0 },
                    { new Guid("d03cdf8c-3ba5-4729-b1e1-f3ab158d80db"), 3, new Guid("7ebf76e9-a8fb-49a1-956c-f97f784dcbb9"), "The first time you Sustain the Spell each round, the divine aura’s radius grows 10 feet.", 0 },
                    { new Guid("59abdf72-d40a-4b6c-93d2-2a91bb5e4784"), 12, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Triceratops: Speed 30 feet; Melee [one-action] horn, Damage 2d8 piercing, plus 1d6 persistent bleed on a critical hit; Melee [one-action] foot, Damage 2d6 bludgeoning.", 2 },
                    { new Guid("151544d1-c8dd-4dfe-99de-643f7f4476a9"), 13, new Guid("55780227-9986-4a2e-aa35-93a105314818"), "Tyrannosaurus: Speed 30 feet; Melee [one-action] jaws (deadly, reach 10 feet), Damage 1d12 piercing; Melee [one-action] tail (reach 10 feet), Damage 1d10 bludgeoning.", 2 },
                    { new Guid("2d77c0d6-b1c3-4787-a506-6f1b01bfdce1"), 0, new Guid("614267ca-482a-4435-bcea-127594ea342f"), "You shroud a creature from others’ senses. The target becomes undetected, not just to sight but to all senses, allowing the target to count as invisible no matter what precise and imprecise senses an observer might have. It’s still possible for a creature to find the target by Seeking, looking for disturbed dust, hearing gaps in the sound spectrum, or finding some other way to discover the presence of an otherwise-undetectable creature", 0 },
                    { new Guid("cdd7d66f-a83c-40bb-ba6e-ae203c64829a"), 0, new Guid("d8cf6802-13fb-4518-a463-538b28bed2da"), "Falsehoods ring in your ears like discordant notes. You gain a +4 status bonus to Perception checks when someone Lies.", 0 },
                    { new Guid("621e7e81-5364-4a90-9ed2-085bd438af31"), 0, new Guid("31f6e676-dbee-4c8f-9f17-a842afab35e3"), "You learn the name of the target’s exact location (including the building, community, and country) and plane of existence.", 0 },
                    { new Guid("3f43ac0e-e9bf-431b-adad-1e38650be56e"), 1, new Guid("31f6e676-dbee-4c8f-9f17-a842afab35e3"), "You can target a creature only if you’ve seen it in person, have one of its significant belongings, or have a piece of its body. To target an object, you must have touched it or have a fragment of it. Discern location automatically overcomes protections against detection and divination of lower level than this spell, even if they would normally have a chance to block it.", 0 },
                    { new Guid("c8d1996c-4bea-42d7-b28a-754df9d5b744"), 0, new Guid("8280e542-c9e9-41d9-b152-aff2f054d447"), "You fire a green ray at your target. Make a spell attack. You deal 12d10 damage, and the target must attempt a basic Fortitude save. On a critical hit, treat the save result as one degree worse. A creature reduced to 0 HP is reduced to fine powder; its gear remains.", 0 },
                    { new Guid("a36f0b28-ae6d-43ea-8671-40f6db86733c"), 1, new Guid("8280e542-c9e9-41d9-b152-aff2f054d447"), "An object you hit is destroyed (no save), regardless of Hardness, unless it’s an artifact or similarly hard to destroy. A single casting can destroy no more than a 10-foot cube of matter. This automatically destroys any force construct, such as a wall of force.", 0 },
                    { new Guid("d5e2bbdd-edd9-4905-8c2c-1f8f08305001"), 0, new Guid("05375af9-4bc5-4eab-8731-2fb74c2062d9"), "Crackling energy disjoins the target. You attempt to counteract it (page 458). If you succeed, it’s deactivated for 1 week. On a critical success, it’s destroyed. If it’s an artifact or similar item, you automatically fail.", 0 },
                    { new Guid("06d14c23-0dc1-457d-8c49-3fdab5484171"), 0, new Guid("5d1503f3-0176-4480-93b5-c4b4fef56dd3"), "You unravel the magic behind a spell or effect. Attempt a counteract check against the target (page 458). If you successfully counteract a magic item, the item becomes a mundane item of its type for 10 minutes. This doesn’t change the item’s non-magical properties. If the target is an artifact or similar item, you automatically fail.", 0 },
                    { new Guid("906d1df1-2636-4767-b5e1-f828b458d2c3"), 0, new Guid("9627d10b-e488-4299-9e1b-2c3a511ec007"), "You infuse weapons with positive energy. Attacks with these weapons deal an extra 1d4 positive damage to undead.", 0 },
                    { new Guid("ac325502-59d1-4250-91b4-917dab957ede"), 0, new Guid("db143e7b-8212-4350-a09f-09205811470e"), "You lance the target with energy. You deal 1d6 positive damage plus your spellcasting ability modifier. The target must attempt a basic Fortitude save.", 0 },
                    { new Guid("97f6d208-ccae-4703-8e06-4f807304db67"), 0, new Guid("b6f25115-9358-44eb-bfc2-37b01c3863f4"), "Divine power wards the targets, granting each a +1 status bonus to AC and saves while in the area.", 0 },
                    { new Guid("fd081fec-24f3-4bde-a6c4-44c031947a4a"), 1, new Guid("b6f25115-9358-44eb-bfc2-37b01c3863f4"), "Choose an alignment your deity has (chaotic, evil, good, or lawful). You can’t cast this spell if you don’t have a deity or your deity is true neutral. This spell gains the trait of the alignment you chose. The bonuses granted by the spell increase to +2 against attacks by—and effects created by—creatures with an alignment opposite to the spell (lawful if you chose chaotic, evil if you chose good). These bonuses increase to +4 against effects created by such creatures that attempt to impose the controlled condition on a target of your divine aura, as well as against attacks made by creatures summoned by anything opposite in alignment to your divine aura.", 0 },
                    { new Guid("dc1ca729-0d82-4e6e-8464-01e612e2d9bd"), 2, new Guid("b6f25115-9358-44eb-bfc2-37b01c3863f4"), "When a creature of opposite alignment hits a target with a melee attack, the creature must succeed at a Will save or be blinded for 1 minute. It’s then temporarily immune for 1 minute.", 0 },
                    { new Guid("766add6f-238c-4106-ae46-8595907ce970"), 3, new Guid("b6f25115-9358-44eb-bfc2-37b01c3863f4"), "The first time you Sustain the Spell each round, the divine aura’s radius grows 10 feet.", 0 },
                    { new Guid("a12047e1-53c7-401d-9ce8-360d8f29ca8b"), 0, new Guid("7ebf76e9-a8fb-49a1-956c-f97f784dcbb9"), "You utter a potent litany from your faith, a mandate that harms those who oppose your ideals. Choose an alignment your deity has (chaotic, evil, good, or lawful). You can’t cast this spell if you don’t have a deity or your deity is true neutral. This spell gains the trait of the alignment you chose. You deal 7d10 damage to creatures in the area; each creature must attempt a Fortitude save. Creatures with an alignment that matches the one you chose are unaffected by the spell. Those that neither match nor oppose it treat the result of their saving throw as one degree better and don’t suffer effects other than damage.", 0 },
                    { new Guid("af0a1742-904c-4467-a3a8-510bff8e19d7"), 1, new Guid("7ebf76e9-a8fb-49a1-956c-f97f784dcbb9"), "Choose an alignment your deity has (chaotic, evil, good, or lawful). You can’t cast this spell if you don’t have a deity or your deity is true neutral. This spell gains the trait of the alignment you chose. The bonuses granted by the spell increase to +2 against attacks by—and effects created by—creatures with an alignment opposite to the spell (lawful if you chose chaotic, evil if you chose good). These bonuses increase to +4 against effects created by such creatures that attempt to impose the controlled condition on a target of your divine aura, as well as against attacks made by creatures summoned by anything opposite in alignment to your divine aura.", 0 },
                    { new Guid("99d2bb14-6f2f-43d1-b317-3d62407948b0"), 2, new Guid("7ebf76e9-a8fb-49a1-956c-f97f784dcbb9"), "When a creature of opposite alignment hits a target with a melee attack, the creature must succeed at a Will save or be blinded for 1 minute. It’s then temporarily immune for 1 minute.", 0 },
                    { new Guid("38e98f06-3ff1-423c-9e98-429fc3eaf7b4"), 0, new Guid("69990f1a-b209-4efd-883e-7c93fab9f129"), "You infuse a target with spiritual energy, refreshing its magic. If it prepares spells, it recovers one 6th-level or lower spell it previously cast today and can cast that spell again. If it spontaneously casts spells, it recovers one of its 6th-level or lower spell slots. If it has a focus pool, it regains its Focus Points, as if it had Refocused.", 0 },
                    { new Guid("ab27ff6e-2d8a-4928-a6ea-88b7d0504011"), 0, new Guid("9ff794c4-74a1-412e-9d44-06d64f1570b1"), "You conjure an arrow of acid that keeps corroding the target after it hits. Make a spell attack against the target. On a hit, you deal 3d8 acid damage plus 1d6 persistent acid damage. On a critical hit, double the initial damage, but not the persistent damage.", 0 },
                    { new Guid("c36f0655-dd63-4aca-99fd-3978ca6c37fc"), 10, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "You also gain specific abilities based on the type of dragon:", 0 },
                    { new Guid("fbc4d94d-7195-48bf-8198-61fa87cb535c"), 12, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Blue - Burrow Speed 20 feet; Melee [one-action] jaws, Damage 2d10 piercing plus 1d12 electricity; Melee [one-action] claw (agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] horns (reach 10 feet), Damage 3d8 piercing; breath weapon 80-foot line, 6d12 electricity.", 2 },
                    { new Guid("f578d8fe-e494-414c-9a6c-b8d071de0721"), 1, new Guid("72bb1ec1-42b6-4da3-9109-00a1475da7cb"), "If the globe overlaps with an area of magical light or affects a creature affected by magical light, eclipse burst attempts to counteract the light effect.", 0 },
                    { new Guid("7e84d2e4-544f-4ef7-be5e-f53273ab7576"), 0, new Guid("927d7988-999b-4c72-a7bd-63abe7d2d0b5"), "An arc of lightning leaps from one target to another. You deal electricity damage equal to 1d4 plus your spellcasting ability modifier.", 0 },
                    { new Guid("e2f79409-8bb7-4534-ba98-1cc72a3a7c39"), 0, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "You call upon the power of the planes to transform into a Medium elemental battle form. When you cast this spell, choose air, earth, fire, or water. While in this form, you gain the corresponding trait and the elemental trait. You have hands in this battle form and can take manipulate actions. You can Dismiss the spell.", 0 },
                    { new Guid("9bdbe944-8fb6-4c74-b463-717ac6fe75dd"), 1, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("cb231204-8630-43d1-aa76-4dfbab4acb6a"), 2, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "AC = 19 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("c1f8d062-a6ab-4d30-90dd-4a38f77f0eff"), 3, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "10 temporary Hit Points.", 2 },
                    { new Guid("39346108-e17b-470b-9e58-a37aa41dc683"), 4, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "Darkvision.", 2 },
                    { new Guid("0718cb1c-7203-4dbe-b971-d8dc91b1eb9f"), 5, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +18, and your damage bonus is +9. These are Dexterity based (air or fire) or Strength based (earth or water). If your corresponding unarmed attack modifier is higher, you can use it instead.", 2 },
                    { new Guid("f6b68e0c-9951-4a5a-81e6-31c0c53426db"), 6, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "Acrobatics (air or fire) or Athletics (earth or water) modifier of +20; ignore this change if your own modifier is higher.", 2 },
                    { new Guid("1fa3a821-ed30-43c1-a6b1-210820587ce8"), 7, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "You also gain specific abilities based on the type of elemental you choose:", 0 },
                    { new Guid("78c8cf83-b9fe-48eb-a519-17d191f0cf8d"), 8, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "Air - fly Speed 80 feet, movement doesn’t reactions; Melee [one-action] gust, Damage 1d4 bludgeoning.", 2 },
                    { new Guid("bdeeef1a-2c0f-4aa9-9d2a-3d854433ed9e"), 9, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "Earth - Speed 20 feet, burrow Speed 20 feet; Melee [one-action] fist, Damage 2d10 bludgeoning.", 2 },
                    { new Guid("07b758f5-9e8d-4666-9b8d-9b267eb5cb42"), 10, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "Fire - Speed 50 feet; fire resistance 10, weakness 5 to cold and 5 to water; Melee [one-action] tendril, Damage 1d8 fire plus 1d4 persistent fire.", 2 },
                    { new Guid("51ff48e1-ad18-4c32-8a62-028b9816a45b"), 11, new Guid("ddbafc4d-bafa-4b57-ac6c-52d1ddab1304"), "Water - Speed 20 feet, swim Speed 60 feet; fire resistance 5; Melee [one-action] wave, Damage 1d12 bludgeoning, and you can spend an action immediately after a hit to push the target 5 feet with the effects of a successful Shove.", 2 },
                    { new Guid("1afd34c2-61f4-4d49-98fb-8f6f199be704"), 0, new Guid("9aa8b0d8-a0d7-4bab-8469-a670ca7820bb"), "You shield the target against dangerous temperatures. Choose severe cold or heat. The target is protected from the temperature you chose (but not extreme cold or heat).", 0 },
                    { new Guid("04dc88e4-e9e5-449b-931c-19731fddf1c2"), 0, new Guid("a6f78806-31f1-4032-9ae8-0489b239cb9e"), "You protect the target with a powerful, long-lasting energy barrier. The target gains resistance 5 to acid, cold, electricity, fire, force, negative, positive, and sonic damage.", 0 },
                    { new Guid("e2b92456-bacd-4cd6-be7e-dc83cf12d700"), 0, new Guid("969a5d86-e921-4432-a6b4-996a0e7ef07c"), "You transform the target into delicious fare, changing water into wine or another fine beverage or enhancing the food’s taste and ingredients to make it a gourmet treat.", 0 },
                    { new Guid("da3c267d-086c-477d-b09d-93c9f656beb4"), 1, new Guid("969a5d86-e921-4432-a6b4-996a0e7ef07c"), "Prior to the transformation, the spell attempts to counteract any poisons in the food or water. The food turns back to normal if not consumed before the duration expires, though any poisons that were counteracted are still gone.", 0 },
                    { new Guid("94c569ee-eac6-4372-8788-7fa8f49a3602"), 0, new Guid("c2ee9ea9-0ebb-4fb3-9fde-c001f9a0f7ed"), "Bolstered by magical power, the target grows to size Large. Its equipment grows with it but returns to natural size if removed. The creature is clumsy 1. Its reach increases by 5 feet (or by 10 feet if it started out Tiny), and it gains a +2 status bonus to melee damage. This spell has no effect on a Large or larger creature.", 0 },
                    { new Guid("796bb7c5-c37a-49b4-b5f3-56f422d80695"), 0, new Guid("72bb1ec1-42b6-4da3-9109-00a1475da7cb"), "A globe of freezing darkness explodes in the area, dealing 8d10 cold damage to creatures in the area, plus 8d4 additional negative damage to living creatures. Each creature in the area must attempt a Reflex save.", 0 },
                    { new Guid("c3082737-85e4-4c28-96e5-87214eb79995"), 11, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Black - Swim Speed 60 feet; Melee [one-action] jaws, Damage 2d12 piercing plus 2d6 acid; Melee[one - action] claw(agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] horns (reach 10 feet), Damage 3d8 piercing; breath weapon 60-foot line, 11d6 acid.", 2 },
                    { new Guid("3d56ff19-9b3d-4f02-8c64-f30d2cf8cbd1"), 4, new Guid("92b36046-a4b4-40ab-97c4-9df1bd3f4281"), "Collapse - Structures and ceilings might collapse. The GM rolls a flat check for each (DC 16 for a sturdy structure, DC 14 for an average structure and most natural formations, DC 9 for a shoddy structure, all adjusted higher or lower as the GM sees fit). A collapse deals 11d6 bludgeoning damage; each creature caught in a collapse must attempt a Reflex save to avoid it.", 2 },
                    { new Guid("3c9cea57-71af-4d7c-a642-b3fa8bcce08a"), 0, new Guid("4804b806-7a8f-42aa-9ba7-81e2aa62ac4f"), "You materialize a handheld musical instrument in your grasp. The instrument is typical for its type, but it plays only for you. The instrument vanishes when the spell ends. If you cast summon instrument again, any instrument you previously summoned disappears.", 0 },
                    { new Guid("e581b646-3ed1-4e2a-a259-02441b14eef0"), 13, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Green - Swim Speed 40 feet, ignores difficult terrain from non-magical foliage; Melee [one-action] jaws, Damage 2d12 piercing plus 2d6 poison; Melee [one-action] claw (agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] horns (reach 10 feet), Damage 3d8 piercing; breath weapon 30-foot cone, 10d6 poison (Fortitude save instead of Reflex).", 2 },
                    { new Guid("6889f1d0-db09-46ed-a916-59c42f369592"), 14, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Red - Ignore concealed from smoke; Melee [one-action] jaws, Damage 2d12 piercing plus 2d6 fire; Melee [one-action] claw (agile), Damage 4d6 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] wing (reach 10 feet), Damage 3d8 bludgeoning; breath weapon 30-foot cone, 10d6 fire.", 2 },
                    { new Guid("a6311062-79c8-4662-8b92-c8785cb6b949"), 15, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "White - Climb Speed 25 feet on ice only; Melee [one-action] jaws, Damage 3d6 piercing plus 2d6 cold; Melee [one-action] claw (agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; breath weapon 30-foot cone, 10d6 cold.", 2 },
                    { new Guid("33dd751e-72d6-4a6c-97a9-64368eb5aeb6"), 16, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Brass - Burrow Speed 20 feet; Melee [one-action] jaws, Damage 3d8 piercing plus 2d4 fire; Melee [one-action] claw (agile), 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] spikes (reach 10 feet), Damage 3d8 piercing; breath weapon 60-foot line, 15d4 fire.", 2 },
                    { new Guid("3b886593-72c7-41b2-8fde-38e642b2befc"), 17, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Bronze - Swim Speed 40 feet; Melee [one-action] jaws, Damage 2d10 piercing plus 1d12 electricity; Melee [one-action] claw (agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] wing (reach 10 feet), Damage 3d8 slashing; breath weapon 80-foot line, 6d12 electricity.", 2 },
                    { new Guid("40bc5081-e54f-4419-afff-690e3c887141"), 18, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Copper - climb Speed 25 feet on stone only; Melee [one-action] jaws, Damage 2d12 piercing plus 2d6 acid; Melee [one-action] claw (agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] wing (reach 10 feet), Damage 3d8 bludgeoning; breath weapon 60-foot line, 10d6 acid.", 2 },
                    { new Guid("a26fecc8-36f4-4f3f-8186-e8b979223e26"), 19, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Gold - Swim Speed 40 feet; Melee [one-action] jaws, Damage 2d12 piercing plus 2d6 fire; Melee [one-action] claw (agile), Damage 4d6 slashing; Melee [one-action] tail (reach 10 feet), Damage 3d10 bludgeoning; Melee [one-action] horns (reach 10 feet), Damage 3d8 piercing; breath weapon 30-foot cone, 6d10 fire.", 2 },
                    { new Guid("1e1ef312-f8bb-4fac-9edf-52ca4dcdab5b"), 20, new Guid("13754f33-7150-46a1-adaf-7e9eaaf147d2"), "Silver - Cloud walk; Melee [one-action] jaws, Damage 2d12 piercing plus 2d6 cold; Melee [one-action] claw (agile), Damage 3d10 slashing; Melee [one-action] tail (reach 10), Damage 3d10 bludgeoning; breath weapon 30-foot cone, 8d8 cold.", 2 },
                    { new Guid("c2da22f8-00ee-4116-9bf5-0ec7f5f8beef"), 0, new Guid("8f57f735-9139-4582-b54f-75bc96dbd515"), "When you Cast this Spell, any targets (including you) can choose to immediately fall asleep. The spell ends for any creatures that don’t choose to fall asleep. Sleepers join a shared dream, where they can communicate with one another as though they were in the same room. Individual targets leave this shared dream upon awakening, and if all the targets awaken, the spell ends.", 0 },
                    { new Guid("5bbdbace-de72-4cfe-8512-185541e45a36"), 0, new Guid("299bd621-5766-49ce-bc04-2a55df46db48"), "You draw the target into a lucid dream where it can explore the endless possibilities of its own potential within the everchanging backdrop of its dreamscape. If it sleeps the full 8 hours uninterrupted, when it wakes, it counts as having spent a day of downtime retraining, though it can’t use dreaming potential for any retraining that would require either an instructor or specialized knowledge it can’t access within the dream.", 0 },
                    { new Guid("14679c7d-85dc-480a-9f9f-c2287ea952e9"), 0, new Guid("7d2dc84f-87d0-4a13-96c4-26833523439a"), "You send a message to your target’s dream. The message is one-way, up to 1 minute of speech (roughly 150 words). If the target is asleep, they receive the message instantly. If not, they receive it the next time they sleep. As soon as they receive it, the spell ends, and you know the message was sent.", 0 },
                    { new Guid("ec852bcb-fe33-43d3-8de8-e07b8d889f7c"), 0, new Guid("6d11a1a1-ff34-468a-8850-caa78f305429"), "The target appears to fall down dead, though it actually turns invisible. Its illusory corpse remains where it fell, complete with a believable fatal wound. This illusion looks and feels like a dead body. If the target’s death seems absurd—for instance, a barbarian at full health appears to be slain by 2 damage—the GM can grant the attacker an immediate Perception check to disbelieve the illusion. If the target uses hostile actions, the spell ends. This ends the entire spell, so the illusory corpse disappears too.", 0 },
                    { new Guid("edb82d85-b8af-449f-ae62-4041a2fa6651"), 0, new Guid("8d0dae0a-a031-4fd3-87e8-8e15da2d633a"), "You try to create a temporary duplicate of an enemy to fight on your behalf. The target can attempt a Fortitude save to disrupt the spell. The duplicate appears in an unoccupied space adjacent to the target and has the target’s attack modifier, AC, saving throw modifiers, Perception, and skill modifiers, but it has only 70 Hit Points and lacks the target’s special abilities, including immunities, resistances, and weaknesses. It has no magic items except weapon potency runes.", 0 },
                    { new Guid("f755c2b2-589f-4a49-adff-46e33d8c43e0"), 1, new Guid("8d0dae0a-a031-4fd3-87e8-8e15da2d633a"), "The duplicate gains the minion trait, and it can only Stride and Strike. Its Strikes deal the target’s normal damage but don’t apply added effects, since it doesn’t have special abilities. The spell automatically ends if the duplicate’s Hit Points drop to 0.", 0 },
                    { new Guid("edf27434-6f5f-4543-bcf0-7ba6d1530c22"), 2, new Guid("8d0dae0a-a031-4fd3-87e8-8e15da2d633a"), "The duplicate attacks your enemies to the best of its abilities. You can also try to give it additional instructions; when you Sustain the Spell, you can also Command a Minion as part of your action, but the GM determines whether the duplicate follows your command.", 0 },
                    { new Guid("964c4f82-7857-49f6-80f7-6ce05788cc78"), 3, new Guid("8d0dae0a-a031-4fd3-87e8-8e15da2d633a"), "The duplicate is unstable, so each turn after it takes its actions, it loses 4d6 Hit Points. It’s not a living creature, and it can never regain its lost Hit Points in any way.", 0 },
                    { new Guid("97fee1b6-f6d5-46f7-bc67-d44b4556468c"), 0, new Guid("e5258901-d960-4efd-ba40-638b73841ccb"), "Using the weight of earth, you hamper a target’s flight, with effects based on its Fortitude save. If the creature reaches the ground safely, it doesn’t take falling damage.", 0 },
                    { new Guid("41f2dc44-e9dc-422f-9130-53c9587e9b6f"), 0, new Guid("92b36046-a4b4-40ab-97c4-9df1bd3f4281"), "You shake the ground, topple creatures into fissures, and collapse structures.", 0 },
                    { new Guid("35ed4648-9551-4fab-a20e-f61f308efc1a"), 1, new Guid("92b36046-a4b4-40ab-97c4-9df1bd3f4281"), "The GM might add additional effects in certain areas. Cliffs might collapse, causing creatures to fall, or a lake might drain as fissures open up below its surface, leaving a morass of quicksand.", 0 },
                    { new Guid("b184719b-3e04-4c16-ac93-9ff98c46fac0"), 3, new Guid("92b36046-a4b4-40ab-97c4-9df1bd3f4281"), "Fissures - Each creature on the ground must attempt a Reflex save at the start of its turn to keep its footing and avoid falling into 40-foot-deep fissures that open beneath it. The fissures are permanent, and their sides require successful DC 15 Athletics checks to Climb.", 2 },
                    { new Guid("d3c3fea0-9363-4659-a888-2196a2e88b29"), 0, new Guid("328dda55-0bc8-461f-a3d3-686df512438c"), "Your touch afflicts the target with Abyssal plague, which siphons fragments of their soul away to empower the Abyss. The effect is based on the target’s Fortitude save.", 0 },
                    { new Guid("0f014427-4fe8-49c6-b0d8-fd0829f9ade2"), 0, new Guid("4fce97c0-4714-4c52-a6a3-8e044af502c4"), "You gain a fly Speed equal to your Speed. You must end your turn on solid ground, or you fall.", 0 },
                    { new Guid("13b5c8c5-e7f2-4fbb-a43f-b89f8217b244"), 1, new Guid("e089b11e-d249-4e4a-bf20-2e91bca8fa84"), "While in wild winds stance, you gain a +2 circumstance bonus to AC against ranged attacks.", 0 },
                    { new Guid("be520334-5c65-4790-b4c6-028a81094041"), 2, new Guid("cfdf59f3-be1e-47b3-a367-0b7416297ab9"), "A creature that fails its save is pulled into the orb. It becomes grabbed, moves along with the orb, and must hold its breath or begin suffocating (unless it can breathe in water). An engulfed Medium or smaller creature and anyone trying to affect that creature follow the normal rules for aquatic battles (Core Rulebook 478). An engulfed Large creature is usually big enough that parts of it stick out from the water, and it can reach out of the water. An engulfed creature can get free either by Swimming with a successful DC 10 Athletics check or by Escaping against your spell DC. A creature that critically failed its Reflex save is further stuck and must attempt to Escape instead of Swim. A freed creature exits the orb’s space and can immediately breathe. The orb can contain as many creatures as can fit in its space.", 0 },
                    { new Guid("ef1e6450-3311-40b5-a15f-547086132d72"), 1, new Guid("cfdf59f3-be1e-47b3-a367-0b7416297ab9"), "The orb can also collect creatures it moves through. Any Large or smaller creature whose space the orb tries to move through can attempt a Reflex save against your spell DC to avoid being engulfed. If a creature succeeds at this save, it can either let the orb pass (remaining in its space or moving out of the orb’s path into a space of the creature’s choice) or allow itself to be pushed in front of the orb to the end of the orb’s movement. The orb can try to Engulf the same creature only once per turn, even if you roll it onto a creature’s space more than once.", 0 },
                    { new Guid("9d41e09c-0e1f-49de-950a-04d8875f3b49"), 0, new Guid("cfdf59f3-be1e-47b3-a367-0b7416297ab9"), "A sphere of water 10 feet in diameter forms in an unoccupied space in range, either on the ground or on the surface of a liquid. When you Cast the Spell and each time you Sustain the Spell, you can roll the orb, moving it up to 10 feet along the ground or the surface of a liquid. Unlike most spells, you can gain this effect multiple times in the same round by Sustaining the Spell multiple times. The orb can move through the spaces of any creatures or obstacles that wouldn’t stop the flow of water. It extinguishes non-magical fires it moves through of its size or smaller, and it attempts to counteract any magical fires it moves through. If it fails to counteract a given fire, it can’t counteract that fire for the duration of the spell.", 0 },
                    { new Guid("9617bd0e-dbc3-48c1-af5b-aa2e3971086e"), 0, new Guid("455a8767-4d85-45aa-a6eb-e39ad05640fe"), "You utter phrases in an unknown tongue, assaulting the minds of those nearby. Each target must attempt a Will save. Regardless of the result of its save, each target is then temporarily immune for 1 minute. You can increase the number of actions it takes to Cast the Spell (to a maximum of 3 actions total). For each additional action, increase the emanation’s radius by 5 feet, to a maximum of 10 extra feet for 3 actions.", 0 },
                    { new Guid("f11673ac-a819-461d-b764-f857b8054c44"), 0, new Guid("dd002216-32c2-4d4b-800c-9236c39feebd"), "You evoke the energy of an Abyssal realm. The damage types of the spell (one energy and one physical) are based on the result of rolling on the table below.", 0 },
                    { new Guid("4dc0ac21-cf43-4744-9247-b4fffabf54ba"), 0, new Guid("ecb524f1-68fc-418e-9239-19d7fddc7284"), "The memories of long-dead spellcasters grant you knowledge in a specific skill. Choose any non-Lore skill, or a Lore skill related to the ancient empire from which your bloodline sprang. You temporarily become trained in that skill and might gain other memories associated with an ancestor who was trained in that skill. If you attempt a task or activity that lasts beyond this spell’s duration, use the lower proficiency modifier.", 0 },
                    { new Guid("81ff5de4-fb8d-4da8-8ca5-247d18a1d951"), 0, new Guid("d7ab83e4-1413-4bbb-bfdc-17eeba1b8108"), "You gain an angelic halo with an aura that increases allies’ healing from the heal spell. Allies in your halo’s emanation who are healed by a heal spell gain a status bonus to Hit Points regained equal to double the heal spell’s level.", 0 },
                    { new Guid("f8bdeb20-938d-4e88-b020-1f18578ca5e3"), 0, new Guid("656f109a-6b34-4ceb-8e24-04545b5f537b"), "Wings of pure light spread out from your back, granting you a fly Speed equal to your Speed. Your wings cast bright light in a 30-foot radius. When this spell’s duration would end, if you’re still flying, you float to the ground, as feather fall.", 0 },
                    { new Guid("68d2b647-d6a4-44dc-b640-e7c942991cec"), 3, new Guid("cfdf59f3-be1e-47b3-a367-0b7416297ab9"), "When the spell ends, all creatures the orb has engulfed are automatically released.", 0 },
                    { new Guid("a4ef6d5e-6e25-4611-9cc3-10681463f4bb"), 0, new Guid("e55208da-89f5-4826-95b0-d06033055d12"), "You undermine the target spell, making it easier to defend against. You reduce the spell’s level by 1, and targets of the spell gain a +2 status bonus to any saving throws, skill checks, AC, or DC against it.", 0 },
                    { new Guid("a91faef5-2149-4eda-9ee7-db7ceee75f83"), 0, new Guid("22e6cf81-cf00-491e-b9dd-911d737d4436"), "A blazing symbol appears on the target, cursing it to face divine justice. You and your allies receive a +1 status bonus to your attack rolls and skill checks against it. Anytime a good creature damages it, the good creature deals an additional 1d4 good damage. The target is then temporarily immune for 1 minute.", 0 },
                    { new Guid("716a9919-6355-42fd-89a3-37e7e453d185"), 0, new Guid("7f8f42d4-01fb-4e31-ab71-f7d546c1afab"), "You issue a diabolic edict, demanding the target perform a particular task and offering rewards for its fulfillment. It gains a +1 status bonus to attack rolls and skill checks related to performing the task. If it refuses to perform the task you proclaimed, it instead takes a –1 status penalty to all its attack rolls and skill checks.", 0 },
                    { new Guid("92f065ff-4e7b-46d3-b9bc-4fa5be53d80e"), 0, new Guid("0c2b9b3a-9489-4f8b-88ef-8633d2cd214d"), "You spew energy from your mouth, dealing 5d6 damage. The area, damage type, and save depend on the dragon type in your bloodline.", 0 },
                    { new Guid("56d382eb-341d-44e6-aaf1-0a5665eb538c"), 0, new Guid("979b1764-d560-4ff0-945a-2f2f26e9acbc"), "Vicious claws grow from your fingers. They are finesse unarmed attacks that deal 1d4 slashing damage and 1d6 extra damage of a type determined by the dragon in your bloodline (see the table in dragon breath). Your scales from blood magic glow with faint energy, giving you resistance 5 to the same damage type.", 0 },
                    { new Guid("161d3313-a15e-4985-aab9-b6f4d582d4e7"), 0, new Guid("f170eec2-9c80-4ac2-a25e-bf347b06c095"), "Leathery wings sprout from your back, giving you a fly Speed of 60 feet or your Speed, whichever is faster. When this spell’s duration would end, if you’re still flying, you float to the ground, as feather fall. You can increase the Focus Point cost by 1 to gain the effects of dragon claws as long as the wings last.", 0 },
                    { new Guid("d80acd8d-65c9-4f7a-9027-5764acf65b49"), 0, new Guid("e2bbeff8-a090-4f1b-918a-84aa2041a44b"), "You close your hand and pull life energy from another creature into yourself. This deals 3d4 negative damage; the target must attempt a basic Fortitude save. You gain temporary Hit Points equal to the damage the target takes, after resolving its save and applying your blood magic if applicable. If the target’s Hit Points were lower than the damage you dealt, you gain temporary Hit Points equal to their remaining Hit Points instead. The temporary Hit Points last for 1 minute.", 0 },
                    { new Guid("bb056b7c-7bab-4b7a-9e2d-836a0305385e"), 0, new Guid("a390f67c-f2f5-47f4-98dd-40f0c53b481c"), "You gather elemental energy and blast your foes in one of the various listed shapes of your choosing, dealing 8d6 bludgeoning damage (or fire damage if your element is fire). This spell has your element’s trait.", 0 },
                    { new Guid("feb6ca01-9f29-4b6a-8737-5131a55bcce8"), 0, new Guid("480fa2b9-938d-4877-9f61-86d049b61233"), "You call upon your element to propel you, improving your Speed depending on your element. This spell has your element’s trait.", 0 },
                    { new Guid("bb4070a4-d683-4a04-852b-c4e435447513"), 1, new Guid("e55208da-89f5-4826-95b0-d06033055d12"), "You can’t reduce the spell’s level below its minimum. For example, a 5th-level cone of cold would remain 5th-level, but a 5th-level fireball would become 4th-level. Targets still gain all the other benefits, even if you don’t reduce the spell’s level.", 0 },
                    { new Guid("4dd1a06e-ad32-4b9f-9c1d-16b8848c1033"), 0, new Guid("8aa48e8c-3054-445f-93e4-d45c5f8dfce3"), "You tap into the target’s inner being and curse it to become a bestial version of itself. The effect is based on its Fortitude save.", 0 },
                    { new Guid("86b509bb-c558-4256-b23e-614ba304fc12"), 0, new Guid("757e9c07-44df-4da9-8f1a-746fb2f7b296"), "A flowing cloak of utter darkness drapes over you, filled with pinpricks of light like distant stars. It imparts the stillness of the cosmos to you, granting you a +2 status bonus to Stealth checks to Hide and Sneak. While outside under a starry night sky, you’re also invisible as long as you remain still. When moving under a starry night sky, you are concealed instead.", 0 },
                    { new Guid("c004523f-bccb-4814-ac16-0e8a8eaead8f"), 1, new Guid("757e9c07-44df-4da9-8f1a-746fb2f7b296"), "Gazing too closely into the stars is disorienting. Any creature that ends its turn adjacent to you must attempt a Will save; this is a mental, visual effect.", 0 },
                    { new Guid("23dc6bf3-9768-4946-8346-6d4f558bab07"), 0, new Guid("36127701-f08d-4ab3-8dd7-d7530a1b782c"), "You touch an object, and it immediately disassembles itself into its component pieces. The spell fails if the target lacks component pieces (such as a statue carved from one block of stone), and using it on a dangerous object like a snare or trap typically triggers it. The object gains the broken condition, and the component pieces become small enough to be hidden under normal clothing and armor. You can Dismiss the spell.", 0 },
                    { new Guid("1ac2096a-6156-4919-a395-7c0ca8fcf045"), 1, new Guid("22d38c1e-6536-4f90-8fb0-3cd0f651062b"), "If the target can’t repeat an action, such as Casting a Spell that has been exhausted or needing to target a creature that has died, it can act as it chooses for that action but becomes stupefied 1 until the end of its turn.", 0 },
                    { new Guid("621917f5-860c-4113-aec2-9604b113e9db"), 0, new Guid("22d38c1e-6536-4f90-8fb0-3cd0f651062b"), "You loop a thought process in the target’s mind, forcing it to repeat the same actions over again. The target must attempt a Will save. If the target fails, whatever actions the target uses on its next turn, it must repeat on its following turn. The actions must be repeated in the same order and as close to the same specifics as possible. For example, if the target makes an attack, it must repeat the attack against the same creature, if possible, and if the target moves, it must move the same distance and direction, if possible, on its next turn.", 0 },
                    { new Guid("1f32fd20-3a87-4d3a-ab0f-01b42891d1e8"), 3, new Guid("ddb80bc6-bafe-4cd7-8005-b490eccf9b82"), "Living - Creature The living creature must attempt a Fortitude save. Ageless creatures are immune.", 2 },
                    { new Guid("2ab7703a-7d70-4738-a5cc-e12de56a8e45"), 2, new Guid("ddb80bc6-bafe-4cd7-8005-b490eccf9b82"), "Construct - The construct takes 4d6 damage (basic Fortitude save). On a failure, for 1 hour the construct is clumsy 1, is enfeebled 1, and can’t be Repaired, and the curse attempts to counteract any spell that would restore the construct’s Hit Points. On a critical failure, these effects have an unlimited duration.", 2 },
                    { new Guid("1a491cca-93d5-4e67-bda8-8854bb0dce10"), 1, new Guid("ddb80bc6-bafe-4cd7-8005-b490eccf9b82"), "Object - If the object is attended, its bearer can attempt a Fortitude save. If the bearer fails or the object is unattended, the object immediately takes 4d6 damage (applying Hardness normally) and the item is cursed with an unlimited duration. Until the curse ends, the item becomes shoddy and can’t be Repaired, and the curse attempts to counteract any spell that would restore the object’s Hit Points. Remove curse can target an item affected by this spell.", 2 },
                    { new Guid("9eb49bc4-f8a7-431e-8380-39d6e5094a13"), 0, new Guid("ddb80bc6-bafe-4cd7-8005-b490eccf9b82"), "You mimic the process of aging or erosion on the target. The effect depends on whether the target is an object, a construct, or a living creature. Artifacts and objects and constructs made of precious materials, as determined by the GM, are immune.", 0 },
                    { new Guid("84747b55-88c8-4372-a278-634ba8c5b85d"), 0, new Guid("7e59cb74-38b6-4a01-a669-ba04d1bcf4a7"), "You summon a crashing wave that sweeps away from you. You deal 6d6 bludgeoning damage to creatures in the area. The water also extinguishes non-magical fires in the area.", 0 },
                    { new Guid("14a68088-3471-4197-97c7-b86b87f249c5"), 1, new Guid("99e445a2-b97d-41b7-81dd-7b0aea1e35b9"), "The interior contains three cots, one chamber pot, and a small fireplace holding a magical fire. The interior is lit with a small magical light that you can light or extinguish at will using a single action, which has the concentrate trait. The climate inside the hut is comfortable and allows creatures inside it to withstand most hostile weather conditions, but incredible heat or cold, powerful storms, and winds of hurricane force or greater destroy the hut. Other creatures can freely enter and exit the hut without damaging it, but if you exit the hut, the spell ends. You can Dismiss the spell.", 0 },
                    { new Guid("c4ab7172-9b47-4f13-83d3-ea87ce9af004"), 0, new Guid("99e445a2-b97d-41b7-81dd-7b0aea1e35b9"), "You shape a cabin 20 feet on each side and 10 feet high. This cabin has the structure trait and the same restrictions as magic items that create structures. The walls of the hut are simple and wooden, with small, square glass windows, and it has one wooden door. It doesn’t include its own lock, but it has a fastener to which a lock can be applied.", 0 },
                    { new Guid("fa2e65b7-f7aa-44c8-8b79-a411a1d8f2a0"), 0, new Guid("a31c7d26-6f99-4242-908f-a667d0ca0524"), "Eyes form across the touched creature’s body, allowing it to see in all directions at once. The subject can’t be flanked for the spell’s duration. In addition, when the subject Seeks, it can Seek in a 30-foot burst centered on itself or up to four 15-foot bursts within line of sight.", 0 },
                    { new Guid("2a20c4e5-aad6-4aa4-a3e6-fe3a716621c9"), 0, new Guid("b0e36984-8d28-4b95-a9af-fd163fb1b05c"), "Your hand glows with impossible colors from beyond the stars, and your touch saps both color and vitality from the living. The target must attempt a Fortitude save; creatures with the gnome trait take a –2 circumstance penalty to this save.", 0 },
                    { new Guid("59825ba9-8c1e-4a46-ab99-8f8eddb25c75"), 0, new Guid("99025d40-d031-4e17-8f6e-4c1f95732557"), "A cone of icy shards bursts from your spread hands and coats the targets in a layer of frost. You deal 2d4 cold damage to creatures in the area; they must each attempt a Reflex save.", 0 },
                    { new Guid("0a297eef-c502-4394-b44a-0e9c0596795d"), 0, new Guid("55c19e3c-6035-49cd-adf7-4de4f6a72961"), "You speak on the virtue of charity, compelling the target to give away its possessions. The target must attempt a Will save. If the target has no items on its person, the spell fails.", 0 },
                    { new Guid("f6ef7b51-e38a-4533-92be-8e77327fad5f"), 0, new Guid("fb8c796d-469a-460f-a597-a8cd12c20861"), "You shift the colors of the targets’ outermost layer of clothing and gear to be closer to their environment when they remain still. Creatures affected by the spell gain a +3 status bonus to Stealth checks to Hide. The changed color granted by the spell always shifts to match the environment, even if there are drastic changes. If any piece of gear or clothing affected by the spell is removed from a creature, the spell ends for that creature.", 0 },
                    { new Guid("9f40c16e-b4f5-4664-bd96-5d7ec3479bae"), 0, new Guid("4857d481-64c1-48ab-a938-c879775e6904"), "You curse the target, punishing it for having the audacity to spill your blood. The target takes 2d6 persistent bleed damage and must attempt a Will save.", 0 },
                    { new Guid("9fa8a077-7f07-431d-9b97-291c8fe326e5"), 0, new Guid("9ad5da73-93c5-4435-9cae-ad6c62ddccf9"), "A heap of insults and invectives spew from your mouth— words so devastating your foes burn from the intensity of your diatribe. Your words deal 2d6 persistent fire damage, and the target must attempt a Will save. If the target doesn’t understand the language or you’re not speaking a language, it gains a +4 circumstance bonus to its save.", 0 },
                    { new Guid("ab8c55b6-3253-4e40-90a6-f313b4db8766"), 0, new Guid("94850785-73d1-4280-a54b-a9db22a2f46b"), "You point at a target in range, and its skin grows searing blisters filled with caustic fluid. The target must attempt a Fortitude save.", 0 },
                    { new Guid("6d528992-e963-42bf-bed9-a09903b64d67"), 0, new Guid("3cf65deb-73f3-4696-b6ef-f117c2c84297"), "You curse the target with your outrage at being attacked. The effect is determined by the target’s Will save.", 0 },
                    { new Guid("c03e0350-dc8e-4eba-8650-a3e96a70e474"), 1, new Guid("480fa2b9-938d-4877-9f61-86d049b61233"), "Air - You gain a fly Speed equal to your Speed.", 2 },
                    { new Guid("2088ca38-c9ec-441d-9a4f-33cf6ff4a448"), 2, new Guid("480fa2b9-938d-4877-9f61-86d049b61233"), "Earth - You gain a burrow Speed of 10 feet.", 2 },
                    { new Guid("15f5126b-6a91-4296-9048-2dccf58020c8"), 3, new Guid("480fa2b9-938d-4877-9f61-86d049b61233"), "Fire - You gain a fly Speed equal to your Speed.", 2 },
                    { new Guid("8749b21d-9c8f-443f-860d-f27e99bdbad8"), 4, new Guid("480fa2b9-938d-4877-9f61-86d049b61233"), "Water - You gain a swim Speed equal to your Speed and can breathe underwater.", 2 },
                    { new Guid("1e23b600-2f70-4950-a46a-68dfc418c0c1"), 0, new Guid("ad3f682d-cc88-4e3d-9de7-c25acecb7a9d"), "Foes within the area are frightened 1. They can’t reduce their frightened value below 1 while they remain in the area.", 0 },
                    { new Guid("852b6d36-49af-4196-b35a-c7ecf4ac297e"), 0, new Guid("d010a61c-f397-450d-b0dc-c3db26a6d4da"), "You perform music so perfect that the target may die of joy or sorrow. Once targeted, the creature becomes temporarily immune for 1 minute. The effect of the spell depends on the target’s level and current Hit Points.", 0 },
                    { new Guid("2d471fa3-c7aa-4b92-aad8-4c191a59a53c"), 1, new Guid("d010a61c-f397-450d-b0dc-c3db26a6d4da"), "16th or Lower - The target dies instantly.", 2 },
                    { new Guid("1d289340-b0ab-4eb8-96c4-1534d35ae050"), 2, new Guid("d010a61c-f397-450d-b0dc-c3db26a6d4da"), "17th - If the target has 50 Hit Points or fewer, it dies instantly; otherwise, it drops to 0 Hit Points and becomes dying 1.", 2 },
                    { new Guid("49fd8951-0944-4a79-86c0-8fb822bb2b4c"), 3, new Guid("d010a61c-f397-450d-b0dc-c3db26a6d4da"), "18th or Higher - The target takes 50 damage. If this brings it to 0 Hit Points, it dies instantly.", 2 },
                    { new Guid("a90611dd-3cf2-4b0c-9fda-a74cc8db8f99"), 0, new Guid("b388b870-f2ff-4d79-9078-8889ac259f22"), "You mime an invisible 10-foot-by-10-foot wall adjacent to you and within your reach. The wall is solid to those creatures that don’t disbelieve it, even incorporeal creatures. You and your allies can voluntarily believe the wall exists to continue to treat it as solid, for instance to climb onto it. A creature that disbelieves the illusion is temporarily immune to your house of imaginary walls for 1 minute. The wall doesn’t block creatures that didn’t see your visual performance, nor does it block objects. The wall has AC 10, Hardness equal to double the spell’s level, and HP equal to quadruple the spell’s level.", 0 },
                    { new Guid("f2019fa3-b8ef-49d8-847f-e4931b28ef92"), 0, new Guid("49ba65ec-e814-4299-8d10-79e3f2f0d141"), "Your encouragement inspires your ally to succeed at a task. This counts as having taken sufficient preparatory actions to Aid your ally on a skill check of your choice, regardless of the circumstances. When you later use the Aid reaction, you can roll Performance instead of the normal skill check, and if you roll a failure, you get a success instead. If you are legendary in Performance, you automatically critically succeed.", 0 },
                    { new Guid("d617189f-c52e-4555-9712-4a2fd2f5d4fd"), 1, new Guid("49ba65ec-e814-4299-8d10-79e3f2f0d141"), "The GM might rule that you can’t use this ability if the act of encouraging your ally would interfere with the skill check (such as a check to Sneak quietly or maintain a disguise).", 0 },
                    { new Guid("05c4e965-ff79-4e53-ae15-c61335228100"), 0, new Guid("7bdedbc0-e87c-4649-979b-1f9be7fc80ff"), "You inspire yourself and your allies with words or tunes of encouragement. You and all allies in the area gain a +1 status bonus to attack rolls, damage rolls, and saves against fear effects.", 0 },
                    { new Guid("ffe6a820-2c09-47f6-8479-e2d9d9bc6ba7"), 0, new Guid("41cc7828-aa79-42a3-a7de-5a64f77cc30f"), "You inspire yourself and your allies to protect themselves more effectively. You and all allies in the area gain a +1 status bonus to AC and saving throws, as well as resistance equal to half the spell’s level to physical damage.", 0 },
                    { new Guid("e7ed9b86-460a-4d22-9821-2e3b3631eb71"), 0, new Guid("d6c30411-708d-4f50-ad18-ff30380f2138"), "You call upon your muse to greatly increase the benefits you provide with your inspire courage or inspire defense composition. If your next action is to cast inspire courage or inspire defense, attempt a Performance check. The DC is usually a very hard DC of a level equal to that of the highest-level target of your composition, but the GM can assign a different DC based on the circumstances. The effect of your inspire courage or inspire defense composition depends on the result of your check.", 0 },
                    { new Guid("42799097-6345-4966-94b6-ef51622b4a20"), 0, new Guid("0e4908a4-698a-4010-8598-333efc7d6acd"), "You add a flourish to your composition to extend its benefits. If your next action is to cast a cantrip composition with a duration of 1 round, attempt a Performance check. The DC is usually a standard-difficulty DC of a level equal to the highest-level target of your composition, but the GM can assign a different DC based on the circumstances. The effect depends on the result of your check.", 0 },
                    { new Guid("437f0fc5-4c7f-4f18-88de-4c76a9cdecd2"), 0, new Guid("96a33e5e-8662-4342-86f3-c3bebd52b541"), "You call upon your muse’s deep mysteries, granting the target a greater ability to think and recall information. Roll the triggering Recall Knowledge skill check twice and use the better result.", 0 },
                    { new Guid("b52dcfc9-f612-46f5-b83e-a56a6f34dfcf"), 0, new Guid("d1ce3fe1-464d-458c-a96a-fec58a31d4d5"), "You draw upon your muse to soothe your allies. Choose one of the following three effects:", 0 },
                    { new Guid("daeab516-76dc-4955-907d-8f0a6d455f04"), 1, new Guid("d1ce3fe1-464d-458c-a96a-fec58a31d4d5"), "The spell attempts to counteract fear effects on the targets.", 2 },
                    { new Guid("469dfce2-2174-4474-a599-9a2318a35d76"), 2, new Guid("d1ce3fe1-464d-458c-a96a-fec58a31d4d5"), "The spell attempts to counteract effects imposing paralysis on the targets.", 2 },
                    { new Guid("2949c592-d6fd-401b-a226-47fcf0a9ce4d"), 3, new Guid("d1ce3fe1-464d-458c-a96a-fec58a31d4d5"), "The spell restores 7d8 Hit Points to the targets.", 2 },
                    { new Guid("03d8285b-7c02-495a-b95f-f3134ed1fecf"), 0, new Guid("e3bf6e5b-5f56-460a-a75d-0f66f784aad1"), "You dance at a lively tempo, speeding your allies’ movement. You and all allies in the area gain a +10-foot status bonus to all Speeds for 1 round.", 0 },
                    { new Guid("574f56ad-0fb6-490a-8e0d-4d9cc392dbbe"), 0, new Guid("c089cb28-19b1-4e86-a2fd-42a4182fe91f"), "You form a link with an ally, allowing you to take harm in their stead. All the effects of the hit or failed save are applied to you instead of the ally. For example, if the target critically fails a saving throw against a fireball, you would take double damage. These effects ignore any resistances, immunities, or other abilities you have that might mitigate them in any way, although those of the target apply before you take the effect.", 0 },
                    { new Guid("1705a317-25fc-4364-abb6-50fd83cb393c"), 0, new Guid("b6aa72a7-3729-4c21-9047-b4e50f8b16a7"), "Your performance protects you and your allies. Roll a Performance check for a type you know: an auditory performance if the trigger was auditory, or a visual one for a visual trigger. You and allies in the area can use the better result between your Performance check and the saving throw.", 0 },
                    { new Guid("b72031b9-01a9-474f-84a1-ed81bdbf7826"), 1, new Guid("36127701-f08d-4ab3-8dd7-d7530a1b782c"), "When the spell ends, the object reassembles itself into its original form, appearing in your hand or hands if you have them free, or on the ground in front of you otherwise. Once reassembled, the object loses the broken condition and its Hit Points return to the value the object had when you Cast the Spell.", 0 },
                    { new Guid("3a146f87-7db4-4e9b-b486-a5d02154f1ea"), 0, new Guid("8a7a6e25-7506-4477-87e5-3bb8477f2616"), "You perform rapidly, speeding up your ally. The ally becomes quickened and can use the additional action to Strike, Stride, or Step.", 0 },
                    { new Guid("4e7363d0-6262-46c6-8507-f845dc270538"), 3, new Guid("d1c5821c-ebac-49cf-8403-7835a6e99e47"), "Acid oozes from your skin. Any creature that hits you with an unarmed attack or with a non-reach melee weapon takes 2d6 acid damage.", 2 },
                    { new Guid("60037700-5384-4bd4-ae26-b4209e1d8cef"), 0, new Guid("ed49874f-ba31-44ce-9a62-4c4481c176c5"), "With a flick of your wrist, you fling a chunk of your elemental matter at your foe. Make a spell attack roll, dealing 1d8 bludgeoning damage (or fire damage if your element is fire) on a success, and double damage on a critical success. This spell has your element’s trait.", 0 },
                    { new Guid("77984545-797d-458c-88c2-38a0dce04535"), 0, new Guid("c06f8857-f848-468d-a6db-5fc09d0db53d"), "Devil horns grow from your skull, and your skin takes on features of the devil responsible for your diabolic bloodline. You gain resistance 5 to evil, fire, and poison, and resistance 1 to physical damage (except silver). You can take good damage, even if you aren’t evil, and you gain weakness 5 to good damage.", 0 },
                    { new Guid("5aefd9cf-d729-4b9a-a992-04a8dcdf4593"), 0, new Guid("03c07d79-4b6f-4cf2-bcbd-a265ab9082fc"), "You call upon your blood’s knowledge of the ancients to extend your magic. If your next action is to Cast a Spell with a duration of 1 minute and a single target, the spell instead lasts 10 minutes. You can extend a spell only if you cast it from a spell slot lower than your highest spell slot, and you can have only one active spell at a time extended in this way.", 0 },
                    { new Guid("eeaf4af4-f117-41b9-b492-a48951c8508a"), 0, new Guid("f7bb400c-ad59-4d72-8623-0de050005121"), "You sprinkle magical dust in the spell’s area, making those within easier to trick. Each creature in the area must attempt a Will save. For each additional action you use Casting the Spell, the burst’s radius increases by 5 feet.", 0 },
                    { new Guid("be79b667-af55-4eca-8557-c74e1175381e"), 0, new Guid("fb03cb86-9c97-4223-9f5b-ece6db58f301"), "You become invisible and ignore natural difficult terrain (such as underbrush). Any hostile action you use ends this invisibility, but you still ignore natural difficult terrain.", 0 },
                    { new Guid("eb3e1387-aa64-433c-9f52-59ee3bcdfa90"), 0, new Guid("50084c79-74b7-4ffd-905b-2c080940fafd"), "You call upon fey glamours to cloak an area or the targets in illusion. This has the effect of either illusory scene on the area or veil on the creatures, as if heightened to a level 1 level lower than fey glamour, using fey glamour’s range and duration.", 0 },
                    { new Guid("1231c6c1-f32a-4bd6-99f5-2fd3edd61a39"), 0, new Guid("d176fc28-4eab-4064-bc8b-c6966642e362"), "Your mouth transforms into a shadowy maw bristling with pointed teeth. These jaws are an unarmed attack with the forceful trait dealing 1d8 piercing damage. If you hit with your jaws and deal damage, you gain 1d6 temporary Hit Points.", 0 },
                    { new Guid("051437af-4edb-4781-ac61-3723d2669ab5"), 0, new Guid("1fc9723e-f16c-408e-bbc6-bb3f2640d92f"), "Hundreds of skeletal arms erupt from the ground in the area, clawing at creatures within and attempting to hold them in place. The skeletal arms deal 6d6 slashing damage. Each creature in the area must attempt a Reflex save.", 0 },
                    { new Guid("1a3db4e2-76e4-4f72-a7ec-052b4d96e1c5"), 0, new Guid("ce60a626-8eca-4893-9329-6518d60f1bea"), "You call forth a plume of hellfire that erupts from below, dealing 4d6 fire damage and 4d6 evil damage.", 0 },
                    { new Guid("32ef1adb-9aa8-474c-a48d-40c9cf607fac"), 0, new Guid("4f04b1d5-321d-4271-a93d-6049c64883c8"), "You briefly transform your features into the horrific visage of a hag, striking fear into your enemies. Foes in the area must attempt a Will save.", 0 },
                    { new Guid("8f6d8400-e9b0-46cf-b0c8-badfda6f87ee"), 0, new Guid("ec613e4a-7d8a-4081-822f-cb21d81bcbcc"), "You draw forth a hag’s innate jealousy to deny a target its greatest attribute. The target is cursed with an adverse condition depending on its highest ability modifier: Strength (enfeebled); Dexterity (clumsy); Constitution (drained); or Intelligence, Wisdom, or Charisma (stupefied). On a tie, the creature decides which of the conditions associated with the tied ability modifiers to take. The target must attempt a Will save.", 0 },
                    { new Guid("e057d88a-f0eb-489d-88a5-3ab44688b70e"), 1, new Guid("ec613e4a-7d8a-4081-822f-cb21d81bcbcc"), "At the start of each of your turns, the target can attempt another Will save, ending the effect on a success.", 0 },
                    { new Guid("b2e74c60-17da-4539-861a-08e2e962fb39"), 0, new Guid("d8dd0aaa-37e1-4196-babb-23edb266f372"), "Ground in the area turns swampy and fetid. The area is difficult terrain. The sludge at the bottom of the morass animates into diminutive sludge beasts that have a demonic appearance. These don’t function as normal creatures, but they swarm over creatures in the swamp and exude a noxious stench. The swamp deals 1d6 poison damage; creatures that end their turn in the area must attempt a basic Fortitude save. You can increase the number of actions it takes to Cast the Spell. For each additional action, increase the burst’s radius by 5 feet.", 0 },
                    { new Guid("f054a874-b24c-466a-8036-20c14ee267fe"), 0, new Guid("7a91b60f-ae3b-4ccc-8f72-f9639a0c34dc"), "Your arms turn into long, pliable tentacles, increasing your reach when you’re delivering touch range spells and making unarmed Strikes with your arms (such as fist and claw Strikes) to 10 feet. This doesn’t change the reach of your melee weapon attacks. During the duration, whenever you Cast a Spell, you can add an additional action to that spell’s casting to temporarily extend your reach to 20 feet to deliver that spell.", 0 },
                    { new Guid("6c4a3188-2efd-4877-a1b1-048e7eb8e818"), 0, new Guid("85845094-40e3-40cf-8295-8c8e49a4b6fd"), "You instill within a creature the touch of the grave. For the duration, harm spells treat the creature as undead and heal spells treat the creature as living. In addition, harm spells gain a +2 status bonus to the Hit Points restored to the target.", 0 },
                    { new Guid("8e8ce519-7b05-4515-aea3-53e690208892"), 1, new Guid("85845094-40e3-40cf-8295-8c8e49a4b6fd"), "If the target wishes to avoid the spell, it can attempt a Will save to reduce the effects.", 0 },
                    { new Guid("1ee77545-d18d-4e4c-b6c9-275bdccd5bcc"), 0, new Guid("d1c5821c-ebac-49cf-8403-7835a6e99e47"), "You transform your flesh and organs into a bizarre amalgam of glistening skin, rough scales, tufts of hair, and tumorous protuberances. This has three effects:", 0 },
                    { new Guid("64091158-1c38-4811-a13a-d62d83663063"), 1, new Guid("d1c5821c-ebac-49cf-8403-7835a6e99e47"), "You gain resistance 10 to precision damage and resistance 10 to extra damage from critical hits. If the resistance is greater than the extra damage, it reduces the extra damage to 0 but doesn’t reduce the attack’s normal damage.", 2 },
                    { new Guid("2e31a000-50ab-4baa-83f0-38c100b3446c"), 2, new Guid("d1c5821c-ebac-49cf-8403-7835a6e99e47"), "You gain darkvision.", 2 },
                    { new Guid("e0ecc4f7-2529-407b-b50a-2e1f41a1828e"), 0, new Guid("19e92d7b-67bf-4f5b-9085-1bef9545602e"), "You manipulate the target’s emotions, potentially allowing you to control it for a brief instant. The target must attempt a Will save.", 0 },
                    { new Guid("3f0732b8-53f2-4a7e-96ac-a327e42d8026"), 0, new Guid("d63d0e3a-03d7-4cd1-9aea-b47a2b61ad77"), "Extending a finger, you fire a beam of negative energy that weakens the life force of any creature it touches. Each living creature in the line must attempt a Fortitude save.", 0 },
                    { new Guid("8e522316-d9c5-4f54-b3a8-a76e3513db65"), 0, new Guid("8da6f3ae-84ed-48d2-b86c-89cbb90f0576"), "The target becomes a scrying sensor, allowing you to see through its eyes, smell what it smells, and similarly use its other senses. If you can cast a spell with the revelation trait that affects your senses, such as see invisibility, while this spell is active, you gain the benefit of the spell through the target’s senses instead of your own. You can also speak through the target, with a voice much like yours, though it takes on some of the timbre and character of the target’s growls or squawks. You can use Command an Animal on the target as part of Sustaining this Spell. You don’t need line of sight or line of effect to your target when you Cast this Spell.", 0 },
                    { new Guid("22aaf18c-63b6-482f-a939-14fe3a6bec0b"), 0, new Guid("915dfc99-cb73-4b63-a70a-fec412833cfc"), "You channel disruptive energies through the bond between you and your minion, causing it to violently explode. The target is immediately slain, and creatures within 20 feet of it take 6d6 fire damage (basic Reflex save).", 0 },
                    { new Guid("f36dd9cb-ba2d-4e09-bab2-04b07d96ccef"), 0, new Guid("77282857-0f07-4d74-b842-8039ed9d8f4c"), "You temporarily bolster the target’s vitality. The target gains fast healing equal to double the spell’s level.", 0 },
                    { new Guid("f869249a-40b1-49c9-adb4-f460967fde25"), 0, new Guid("5c8c44a7-34b1-4758-8008-c6c5f0603091"), "You reshape the target’s shadow into a deadly form, such as strangling hands, a dangerous weapon, harrying runes, or the like, and command it to attack the target. When you Cast the Spell, and each time you Sustain the Spell, the shadow makes a Strike against the target. The shadow moves along with the foe, always remaining within reach. If you Sustain the Spell multiple times in a round, you gain this effect each time. The shadow uses and contributes to your multiple attack penalty.", 0 },
                    { new Guid("905301cf-93ac-4e10-881e-b61974e8baf6"), 1, new Guid("5c8c44a7-34b1-4758-8008-c6c5f0603091"), "The shadow’s Strikes are melee spell attacks. Regardless of its shape, the shadow’s Strikes deal damage equal to 1d10 plus your spellcasting ability modifier. You choose the type of damage when you Cast the Spell, choosing from bludgeoning, piercing, or slashing damage. The shadow doesn’t take up space, grant flanking, or have any other attributes a creature would. The shadow can’t make any attacks other than its Strike.", 0 },
                    { new Guid("1b08ca69-45d9-4f25-8fc7-17a56e606636"), 2, new Guid("5c8c44a7-34b1-4758-8008-c6c5f0603091"), "The shadow vanishes if the target moves into an area of complete darkness or enters an area with light from all directions such that the target doesn’t cast a shadow. If another effect is controlling the target’s shadow when you cast malicious shadow, you can attempt to counteract that effect to temporarily take control of the shadow, but the original effect resumes when malicious shadow ends.", 0 },
                    { new Guid("8d7d06a2-8a79-4602-b894-1b919af6cb1a"), 0, new Guid("ad99267f-97a8-411d-8f85-898742a2975d"), "A long, jagged needle jabs into the target foe’s psyche whenever it tries to attack a specifically forbidden creature. Name yourself or one of your allies. The target takes 2 mental damage any time it uses a hostile action against the named creature.", 0 },
                    { new Guid("b9a353eb-67d3-4942-afe9-8c01ac761512"), 0, new Guid("207bad5c-0b66-46d8-a598-e96728a9704c"), "You read slightly into the future and give fate a tiny push to achieve the result you desire. Once during the duration, when the target fails an attack roll, skill check, or saving throw and a +1 status bonus would turn a critical failure into a failure, or failure into a success, you grant the target a +1 status bonus to the check retroactively, changing the outcome appropriately. The spell then ends, and the target is temporarily immune for 1 minute.", 0 },
                    { new Guid("3452e813-0bef-4552-b5dc-87d4cc7bf795"), 1, new Guid("207bad5c-0b66-46d8-a598-e96728a9704c"), "If you cast nudge fate while a previous casting of this hex is still in effect, the previous effect ends.", 0 },
                    { new Guid("5f51ff63-e319-4e18-baa5-400a920c1089"), 0, new Guid("09174920-3fb3-4bf3-a380-7779901e35af"), "You summon an isolated blizzard of obscuring, scouring ice to follow your target. The target attempts a Fortitude save.", 0 },
                    { new Guid("bd018b03-581e-4f86-a7c6-3170cb9ee1b6"), 0, new Guid("1fe7d56b-da4a-4c42-9de0-cfbd82fff361"), "You draw upon your patron’s power to momentarily shift your familiar from its solid, physical form into an ephemeral version of itself shaped of mist. Your familiar gains resistance 5 to all damage and is immune to precision damage. These apply only against the triggering damage.", 0 },
                    { new Guid("bea0f3bf-906f-4444-89ef-513355776af4"), 0, new Guid("e687d3d1-2a13-43ff-9e32-43dff9664ee8"), "You manipulate the threads of time around the target, giving them some of the benefits of a day’s passage. The target decreases the values of any doomed and drained conditions it has by 1 and can immediately attempt one saving throw against each affliction it has with a stage length of 1 day or less. The target is then temporarily immune for 1 day.", 0 },
                    { new Guid("d6317af0-9b81-4a27-b565-7f4359d70ab7"), 0, new Guid("5bc3a789-1e57-4e0a-b1a2-c495e1fa3942"), "Drawing your hand in a sweeping gesture, you shroud the target in a veil of night. The target’s eyes are blanketed in darkness. If you cast this hex on a willing ally (for instance, one with light blindness), the ally can choose which result it gets without rolling. Regardless of the outcome, the target is then temporarily immune for 1 minute.", 0 },
                    { new Guid("15cb4163-2e1a-40f6-9418-13cb5a79797a"), 0, new Guid("51551c5f-f153-4c9a-9367-b51f79eb223b"), "Intense fervor fills the target creature, empowering their blows. The target gains a +2 status bonus to damage rolls. Once this spell ends, the target becomes temporarily immune for 1 minute.", 0 },
                    { new Guid("460a27e2-c4e7-4ebc-8e65-0907c279f9f7"), 0, new Guid("4563a251-40f7-4063-8615-9ad2f3fa79b9"), "You draw the target into a drowsy state, causing daydreams and sluggishness. The target must attempt a Will save.", 0 },
                    { new Guid("dd28266f-ac02-48fa-b74c-ca3aa65efc48"), 0, new Guid("629c7f74-0650-4646-8ff9-71e6fb5d4ec2"), "With a few words, you convince a wild creature you are a kindred spirit, making it reluctant to harm you. The target must attempt a Will save. Regardless of the outcome, the target is then temporarily immune for 1 minute.", 0 },
                    { new Guid("bba81d76-2d1a-48f9-9c23-b6b113749f13"), 0, new Guid("3f22d282-205c-4f1d-9a11-464c7b7f503d"), "You open your mind to the metaphysical, enabling you to sense nearby spirits. Even if you aren’t Searching, you get a check to find haunts and spirits in the area. You gain a +1 status bonus to the following checks regarding haunts or spirits: Perception checks to Seek, attempts to Recall Knowledge, skill checks to determine the reason for their existence, and skill checks to disable a haunt. You also gain a +1 status bonus to AC and saving throws against haunts and spirits.", 0 },
                    { new Guid("bacd66e0-4624-4fdf-a5f4-4ef7c5639f37"), 0, new Guid("64a51156-d351-467a-b4ea-64b6474f40e8"), "Long, sharp spikes of solid rock thrust up from the ground in the area. The area becomes difficult terrain and hazardous terrain. A creature that moves on the ground through the area takes 3 piercing damage for every square of that area it moves into.", 0 },
                    { new Guid("25d78c45-51bc-4aa0-af87-b6d54be1d955"), 1, new Guid("c1ec98bb-0aa6-4599-86e8-e9a4f4673183"), "You can Dismiss the spell to return the chest to your current location. If the spell ends by any other means, the container is lost on the Ethereal Plane and you can no longer recall it with this spell, though you could search for it in other ways.", 0 },
                    { new Guid("4b519c18-068d-49cb-8b91-49b0dbdffd8d"), 0, new Guid("c1ec98bb-0aa6-4599-86e8-e9a4f4673183"), "You banish a container and its contents to the Ethereal Plane,where you can retrieve it from later. The container’s physical properties—the material from which it is made, any locks, or other features—are irrelevant to the casting of this spell, but the container can’t contain any creatures. When you Cast this Spell, the container and all its contents are transported to a random location deep in the Ethereal Plane. Time passes normally for the container and its contents, and the environmental effects of the Ethereal Plane apply to it. Though very unlikely, it’s possible for a creature on the Ethereal Plane to stumble upon the chest.", 0 },
                    { new Guid("b8c87372-0ec1-4724-9863-c697a6376a34"), 0, new Guid("c7f662a7-c1ae-42dd-b213-909077f87f5d"), "You utter a curse that a creature will meet a certain end—a death by freezing, stabbing, or another means you devise. Choose one type of damage from the following list: acid, bludgeoning, cold, electricity, fire, negative, piercing, slashing, or sonic. The effect is based on the target’s Fortitude save.", 0 },
                    { new Guid("f2c7628d-2b2d-4250-aee8-25d6ead5a5f6"), 0, new Guid("5357885a-fcae-43c9-bfa0-61e6e41a2e6e"), "Your fix your eye on the target, imposing a malevolent hex. The target becomes frightened based on the results of its Will save. This condition value can’t be reduced below 1 while the spell is active and you can see the target. Regardless of the outcome, the target is then temporarily immune for 1 minute.", 0 },
                    { new Guid("05de2699-f509-4cfd-97df-9e2cb1bead6e"), 1, new Guid("5921d0aa-6dd2-4dae-bb5e-ee4bf98bda81"), "Because this spell obscures sound instead of preventing it, using the spell to quiet a creature doesn’t prevent that creature from using verbal spell components, though it does prevent most auditory effects that rely on another creature hearing them accurately. An unwilling target can attempt a Will save.", 0 },
                    { new Guid("362fb7fc-fd58-4fdb-8e7f-e61a7e9a715d"), 0, new Guid("a8e86e86-6313-4f24-b0ca-97b3992a3965"), "You call upon the elements to undermine your foe. When you Cast this Spell, choose air, earth, fire, or water. Each time the target takes damage from a spell or effect with the chosen trait, it takes an additional 2 damage of one damage type dealt by the spell or effect. If you chose fire or water, the target also takes this additional damage when taking fire or cold damage, respectively, from effects or spells without the chosen trait.", 0 },
                    { new Guid("dafce631-7753-4a98-ad17-af73f22969f7"), 0, new Guid("09588bf2-d5cc-40d1-ae56-868479d5f64a"), "You wrap yourself in a cloak of illusion, appearing as another creature of the same body shape with roughly similar height and weight as yourself. This has the effects of a 3rd-level illusory disguise.", 0 },
                    { new Guid("13e49035-8698-43ed-a8a2-d73e6193048e"), 0, new Guid("acf134b9-edf8-49e8-bb1a-b57668cb8504"), "You teleport one object of light or negligible Bulk held in your hand to the target. The object appears instantly in the target’s hand, if they have a free hand, or at their feet if they don’t. The target knows what object you are attempting to send them. If the target is unconscious or refuses to accept your gift, or if the spell would teleport a creature (even if the creature is inside an extradimensional container), the spell fails.", 0 },
                    { new Guid("2fba28ba-4e4b-47c6-9c02-e98a3503a3ce"), 0, new Guid("7ad26f80-b20a-4bf7-8f18-30d371004712"), "This spell allows you to change between three versions of yourself of different ages: a maiden (young adult), a mother (adult), or a matriarch (elderly). Choose one when you Cast the Spell. While the spell lasts, you can change the age to any of the three or to your natural age with a single action, which has the concentrate trait. Your form always looks like you regardless of the age, and creatures who know you still recognize you and can tell your age is different.", 0 },
                    { new Guid("085c198d-f819-4a2a-a7c8-351cbf0a488b"), 0, new Guid("ca24f0d7-be39-45e0-9595-bdb1ac2ca7c4"), "You accelerate the processes of decay in the area. Each living creature in the area takes 2d10 negative damage (basic Fortitude save). A creature afflicted by a disease takes a –2 circumstance penalty to this save.", 0 },
                    { new Guid("37a716cd-2455-4801-b4a8-686e3be2c13a"), 0, new Guid("378b0c20-9a8b-43cb-a1c6-b669b301dbdf"), "You cause the areas to appear to swell, bend, and break, twisting together in a bizarre spatial geometry. The cubes of the spell’s area can’t be adjacent to one another. A creature must attempt a Will save if it’s in one of the cubes when you Cast the Spell, or if it later enters one of the areas, with the following effects. A creature interacting with the illusion can also attempt a Will save to disbelieve the illusion, as normal.", 0 },
                    { new Guid("909ed4b9-0756-4528-a32c-97325ca2f26e"), 1, new Guid("7ad26f80-b20a-4bf7-8f18-30d371004712"), "Threefold aspect alters your physical appearance and personality to present an authentic version of yourself at various ages. This grants you a +4 status bonus to Deception checks to pass as the chosen age, and you can add your level as a proficiency bonus to these checks even if you’re untrained. Furthermore, unless a creature specifically uses a Seek action or otherwise carefully examines you, it doesn’t get a chance to notice that you aren’t at your true age. You can Dismiss this spell.", 0 },
                    { new Guid("a6357d94-7881-4567-bc92-dbf702ba7be2"), 0, new Guid("82a0f171-2478-45fe-8e98-5c7a355a26fa"), "You warp the structure of earthen material, turning rock into mud or mud into rock. Choose one of these two options when you Cast the Spell.", 0 },
                    { new Guid("04e8d96b-f285-4e65-bd96-aaab7ba43ab4"), 1, new Guid("82a0f171-2478-45fe-8e98-5c7a355a26fa"), "Rock to Mud - You transform non-magical, unworked, and unattended stone in the area into an equal volume of mud. If you Cast this Spell on a stone floor, it becomes difficult terrain; if the resulting mud is at least 3 feet deep, it is greater difficult terrain, or the creature can try to Swim through it (DC 10 Athletics). If the mud is deep enough that a creature can’t reach the bottom, the creature must Swim to move through it. If you Cast this Spell on a ceiling, the falling mud deals 8d6 bludgeoning damage (basic Reflex save) and spreads out, creating difficult terrain in an area 10 feet larger in radius than the original spell’s area. Once the rock is transformed into mud, the mud is non-magical and remains until natural conditions cause it to dry out or otherwise disperse.", 2 },
                    { new Guid("269f5c5d-ac89-45a1-b440-9a0418d42eb3"), 2, new Guid("82a0f171-2478-45fe-8e98-5c7a355a26fa"), "Mud to Rock - Mud in the area turns into unworked stone. If creatures are in the mud when it is transformed to stone, they must attempt a Reflex saving throw.", 2 },
                    { new Guid("f3d99d81-8a75-4f0e-92f3-254b0fdecda3"), 0, new Guid("2dcb92ab-b738-415b-9213-6ccb9b8d9e89"), "A ghostly iron maiden snaps shut on the target and drains its vitality for your gain. This deals 4d4 piercing damage and 4d4 negative damage, and the target must attempt a Fortitude save. You gain temporary HP equal to the negative damage the target takes (after applying resistances, weaknesses, and the like). You lose any remaining temporary HP after 1 minute.", 0 },
                    { new Guid("ea50d52f-0149-43b9-a551-d495594b9097"), 0, new Guid("7b5a076e-72a8-46e6-9263-83ff5a861433"), "You belch forth a swarm of magical vermin. You evoke and shape the creatures from your own imagination, allowing you to change the appearance of the creatures (typically a mix of centipedes, roaches, wasps, and worms), but this doesn’t change the effect of the spell. The vermin swarm over anyone in the area, their bites and stings dealing 2d8 piercing damage (basic Reflex save). A creature that fails its saving throw also becomes sickened 1. Once the spell ends, the swarm disappears.", 0 },
                    { new Guid("37ac3ca6-68ea-4c88-b79e-bf89bd970d9d"), 0, new Guid("7b672b18-9650-4808-92ba-fcab53f51b94"), "You craft a 20-foot-tall wall of living flesh in a straight line up to 30 feet long. The wall is 3 feet thick, and each 5-foot-long section has AC 10 and 75 HP. If you wish, the wall can be of a smaller length or height. You must create the wall in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost. The wall can’t be Repaired but can be healed by positive energy and healing spells and abilities.", 0 },
                    { new Guid("d10bbe6f-5f5e-4ee5-8e2e-4693054a0133"), 1, new Guid("7b672b18-9650-4808-92ba-fcab53f51b94"), "When you Cast the Spell, choose one of the following features for your wall.", 0 },
                    { new Guid("c5991f8b-1f0c-49b5-8e17-cfd0052d3b1a"), 2, new Guid("7b672b18-9650-4808-92ba-fcab53f51b94"), "Mouths -The wall has countless toothy mouths along its surface. The mouths Strike any creature that ends its turn within 5 feet of the wall, using your spell attack roll for these Strikes and dealing piercing damage equal to 1d6 + your spellcasting ability modifier. The mouths are capable of consuming potions; since the wall is alive, it can recover Hit Points from a potion of healing, but it can’t benefit from any effect that would give it the ability to move. Otherwise, the GM determines which potions can affect the wall.", 2 },
                    { new Guid("6d66f288-38d6-4401-96f7-c4598bd18f4a"), 3, new Guid("7b672b18-9650-4808-92ba-fcab53f51b94"), "Eyes - The wall sprouts hundreds of unblinking eyes. You can see through these eyes, gaining a +2 circumstance bonus to visual Perception checks within the wall’s line of sight. You can also use the eyes for determining line of sight for ranged attacks and spells, but you don’t have line of effect through the wall.", 2 },
                    { new Guid("0a836626-2650-48b7-93cc-3e21c0e633d0"), 4, new Guid("7b672b18-9650-4808-92ba-fcab53f51b94"), "Arms - The wall is a mass of grasping arms. Any creature that ends its turn within 5 feet of the wall must attempt a Reflex save.", 2 },
                    { new Guid("623104e0-0621-4b0e-a0d3-a59375705e56"), 0, new Guid("6e28a86d-191a-4d9c-92d1-9a7a62916f45"), "You consolidate warding energies with a gesture, guarding a creature against attacks from a certain type of foe. Designate one of the following creature traits: aberration, animal, beast, celestial, construct, dragon, elemental, fey, fiend, fungus, monitor, ooze, plant, or undead. The target gains a +1 status bonus to its saving throws and AC against creatures with that trait. The target is temporarily immune for 10 minutes.", 0 },
                    { new Guid("458b21d7-e634-4698-bee9-d61c834d4218"), 0, new Guid("21c06ba3-1e8b-4b82-a6d7-da1251d311af"), "With a quick burst of laughter, you prolong a magical effect you created. You Sustain a Spell.", 0 },
                    { new Guid("1d8dbc57-75cb-43cd-b439-c103928f601d"), 0, new Guid("8a559f6c-9fa7-49d8-bd98-29ff051260cd"), "Freezing sleet and heavy snowfall collect on the target’s feet and legs, dealing 1d4 cold damage and other effects depending on its Reflex save. Once this spell ends, the target becomes temporarily immune for 1 minute.", 0 },
                    { new Guid("7b39e399-5b1d-4ad3-9094-b0dcbd25ca15"), 0, new Guid("6ca21150-65e1-4ef9-892d-9bda656316af"), "You focus your malevolent gaze on a target, causing their heart to seize in dread. The target must attempt a Fortitude saving throw. Regardless of the result, the target is temporarily immune to further castings of curse of death for 1 day.", 0 },
                    { new Guid("40b0aa62-eaab-42f7-8931-6feaa486d522"), 0, new Guid("21210ee4-3b48-4550-ac21-e3ba8f3408a9"), "You call upon your patron’s power to better uncover secrets. When you Cast the Spell, the target can Recall Knowledge, Seek, or Sense Motive. The target gains a +1 status bonus to the skill or Perception used for the roll, and this bonus remains as long as you Sustain the Spell. The target is temporarily immune to discern secrets for 1 minute.", 0 },
                    { new Guid("2361ccc1-2b69-41a6-b7cc-5d0f6602e5ce"), 0, new Guid("3559859d-517e-45ae-a5b8-34e5b7c49e48"), "You shout in defiance, filling you with a sudden burst of healing. Just before applying the attack’s damage, you recover 10d4+20 Hit Points. If this is enough to prevent the attack from bringing you to 0 Hit Points, you don’t become unconscious or dying. Either way, cheating death is difficult, and you can’t use hero’s defiance again until you Refocus or the next time you prepare. Hero’s defiance cannot be used against effects with the death trait or that would leave no remains, such as disintegrate.", 0 },
                    { new Guid("95d259d2-46db-43d6-a19f-4888000eab22"), 0, new Guid("5921d0aa-6dd2-4dae-bb5e-ee4bf98bda81"), "You change the sounds made by a creature or object. Choose how you’re altering the sounds when you Cast the Spell; you can’t alter it later. You can cause something that didn’t create a sound to make sound, alter the voice of a creature, amplify or deaden a sound, or transform one sound into another. A creature who succeeds at a Perception check against your spell DC can determine that the sound was altered by an illusion, including hearing faint sounds if you deadened the sound, but they can’t determine the true sound unless they critically succeed at the Perception check. You can Dismiss the spell.", 0 },
                    { new Guid("23c66b8a-71cb-4c67-a915-989a796079ab"), 1, new Guid("a81fcdf7-416e-4f72-8bdc-6e2f84329f20"), "Safe passage protects only against harm, not inconvenience, and it doesn’t reduce difficult terrain, remove the concealed condition caused by precipitation, or the like, nor does it protect against creatures within the spell’s area.", 0 },
                    { new Guid("41794c01-bc1b-480f-9b54-6b852bdf60d1"), 0, new Guid("85044b94-8c53-4d9f-8be4-64fdb38c9ac1"), "You create a black, rumbling storm cloud and call down one lightning bolt. The bolt is a vertical line from the storm cloud to the ground below, dealing 4d12 electricity damage to creatures in the spell’s area (basic Reflex save). The first time you Sustain the Spell each round, you can call another lightning bolt within the area. If you Cast this Spell outdoors, you can create two non-overlapping clouds instead of one, though you can still call down only one bolt per turn.", 0 },
                    { new Guid("afd13f69-1a3d-4491-9a1d-8571e69866a2"), 0, new Guid("8b3068e3-a4a3-4a39-ac17-b516d872836f"), "You make the object invisible. This makes it undetected to all creatures, though the creatures can attempt to find the target, making it hidden to them instead if they succeed. If the item is used as part of a hostile action, the spell ends after that hostile action is completed. Making a weapon invisible typically doesn’t give any advantage to the attack, except that an invisible thrown weapon or piece of ammunition can be used for an attack without necessarily giving information about the attacker’s hiding place unless the weapon returns to the attacker.", 0 },
                    { new Guid("03babf6a-179f-45a8-b511-7f2cae0b3e76"), 0, new Guid("ee670296-650a-47c6-bcab-801782182e05"), "You can’t be affected by anything unless you choose to be. For the duration of the spell, you are immune to any effect or damage that would harm you, excluding effects caused by artifacts, deific power, and similarly powerful sources. You can still be affected by anything you’re willing to have affect you.", 0 },
                    { new Guid("9d4d6fda-9360-40f9-9e02-95f486533597"), 1, new Guid("790be85c-4568-4987-b951-a1a1a848bdea"), "If the object is targeted with read aura of a higher spell level than imprint message, the caster learns that the object has been magically modified. When you Cast this Spell, any prior vibrations placed on an object by previous castings of imprint message fade.", 0 },
                    { new Guid("daa8435c-eca0-4d4e-8fbb-4fed3621c106"), 0, new Guid("790be85c-4568-4987-b951-a1a1a848bdea"), "You project psychic vibrations onto the target object, imprinting it with a short message or emotional theme of your design. This imprinted sensation is revealed to a creature who casts object reading (page 222) on the target object, replacing any emotional events the item was present for. If the object is in the area of a retrocognition spell, the imprinted messages appear as major events in the timeline, but they don’t interfere with any other visions.", 0 },
                    { new Guid("a4dd2296-50c4-4e04-8015-714f04935ee7"), 0, new Guid("021b449e-942e-4664-84d3-ecd2827d701c"), "You conjure a spike that thrusts up from the earth beneath a target creature, potentially impaling it. The spike is made of cold iron and deals 8d6 piercing damage. The target must attempt a Reflex save.", 0 },
                    { new Guid("63daedcb-712b-4430-b5f6-e7a3dc399bfb"), 0, new Guid("6e6315c3-5c27-44a5-9127-fad940826632"), "The target is struck with misfortune, which throws it off balance. The target must attempt a Will save.", 0 },
                    { new Guid("670a6062-1614-4924-a8ed-a52b0a1b425c"), 0, new Guid("856ea565-22c6-4106-b69a-57471fd7c315"), "You create a gray storm cloud that pelts creatures with an icy deluge. When you Cast the Spell, a burst of magical hail deals 2d8 bludgeoning damage and 2d8 cold damage to each creature in the area below the cloud (basic Reflex save). Snow and sleet continue to rain down in the area for the remainder of the spell’s duration, making the area difficult terrain, causing creatures in the storm to be concealed, and making creatures outside the storm concealed from those inside the storm. Any creature that ends its turn in the storm takes 4 cold damage. If you Cast this Spell outdoors, you can create two non-overlapping clouds instead of one.", 0 },
                    { new Guid("199ca86e-f67f-4dd7-ae12-741acbd56d95"), 1, new Guid("1a02e573-b5c3-4c90-a480-b5bfbb84cfac"), "If you target an item held by the creature, the creature can Release the item to improve their degree of success by one step from the result of their saving throw. The persistent damage is associated with the object and damages whichever creature is holding or wearing it. It has no effect if no one is holding the item, but you continue to attempt flat checks to end the persistent damage as normal, since the item remains hot and can sear someone who picks it up.", 0 },
                    { new Guid("bd5504dc-652e-4327-9957-3f748bb3dc96"), 0, new Guid("1a02e573-b5c3-4c90-a480-b5bfbb84cfac"), "This spell heats the targeted metal to become red-hot for a moment. This is usually harmless to an unattended metal item, which doesn’t get a saving throw, though the GM might rule that flammable materials connected to the object catch fire or melt. If you target an item worn or carried by a creature, or you target a creature made primarily of metal, the heat deals 4d6 fire damage and 2d4 persistent fire damage to the creature, which must attempt a Reflex saving throw.", 0 },
                    { new Guid("4e966edd-acbd-46ab-b5f7-8ba038a751d1"), 1, new Guid("f029e544-0b60-4ea9-9278-279be637acb1"), "In addition, unless the initial target critically succeeds, creatures within 30 feet of the target, including the target, must attempt Will saves, after which they are temporarily immune to this secondary effect of grisly growths for 1 hour. This additional effect is a mental and visual effect.", 0 },
                    { new Guid("e42c2058-a63c-4882-8130-a75a6b3b827c"), 0, new Guid("f029e544-0b60-4ea9-9278-279be637acb1"), "This gruesome spell causes the target to grow excess limbs and organs, whether it be fingers multiplying until hands resemble bushes, eyes popping open in bizarre places, legs sprouting from the side of the body, or some other result. The target takes 10d6 piercing damage (basic Fortitude save) as the new features erupt. This spell has no effect on a target with a mutable anatomy or no limbs, such as an ooze or a protean. The growths rot rapidly and fall away after 1 round.", 0 },
                    { new Guid("e4cc18a6-829c-4da7-8d39-ea365b56a5b0"), 1, new Guid("3073eb33-645c-4198-a229-80e74125530b"), "Once the scene ends, you take 2d6 negative damage for each ghostly apparition that participated in the scene (typically equal to the number of creatures involved other than the victim). Any creature that observed the ghostly recreation, including you, can attempt checks to investigate the event to discover new clues and information.", 0 },
                    { new Guid("a82577e0-d2e0-4a79-beaf-d886c8d9b208"), 0, new Guid("3073eb33-645c-4198-a229-80e74125530b"), "This spell compels local spirits to reenact a violent event of the recent past that you’re aware of and name as you Cast the Spell. You take the role of the primary victim. The reenactment plays out the final 9 minutes leading up to the death or injury of the victim and the minute after their death or injury. The spirits don’t change form, so this doesn’t help determine perpetrators by their look. Spiritual forms of missing creatures necessary for the event manifest as needed, and missing items appear as shadowy outlines.", 0 },
                    { new Guid("3e3181cf-329d-4065-a054-76523c9db66f"), 0, new Guid("4d55fa92-d467-461b-9788-2b0d9e803677"), "Toxic spores swarm over creatures in the area, causing them to erupt in grotesque fungal growths. These noxious growths deal 2d6 persistent poison damage, and each creature must attempt a Fortitude save.", 0 },
                    { new Guid("252a1aff-f1de-4e56-9cd1-0f92e2f6bf76"), 2, new Guid("02016d09-cbe1-48c9-b7ab-e89d7c7a78e6"), "Force cage is immune to counteracting effects of its level or lower, but it is automatically destroyed by a disintegrate spell of any level, or by contact with a rod of cancellation (page 262) or sphere of annihilation (Gamemastery Guide 113).", 0 },
                    { new Guid("9d14b815-8fdf-4b71-ae1e-5bb0d1047305"), 1, new Guid("02016d09-cbe1-48c9-b7ab-e89d7c7a78e6"), "The cage has AC 10, Hardness 20, and 40 Hit Points, and it’s immune to critical hits and precision damage. A creature capable of passing through the space between the bars (typically a Tiny creature) can leave; all others are confined within. Attacks with a weapon too large to fit between the bars can’t pass through the cage, and the bars provide standard cover even against attacks that can pass through the gaps. Spells and breath weapons can pass through the cage uninhibited.", 0 },
                    { new Guid("efd882f0-0941-4281-b850-a0801d922a62"), 0, new Guid("02016d09-cbe1-48c9-b7ab-e89d7c7a78e6"), "You create an immobile, invisible prison of sheer force. The cage is a 20-foot cube made of bands of force, each a half inch thick and a half inch apart, that extend to the Ethereal Plane. Each creature in the area where you create the cage must attempt a Reflex save. If such a creature fails, it becomes trapped inside the cage. If it succeeds, it’s pushed outside the cage into a space of its choice. If a creature in the area is too big to fit inside the prison, the spell automatically fails.", 0 },
                    { new Guid("9c1a07c4-eb8b-4284-a8ce-508085ac37b1"), 1, new Guid("915dfc99-cb73-4b63-a70a-fec412833cfc"), "If the target has the cold or water trait, the spell instead deals cold damage and gains the cold trait in place of the fire trait. If used on a creature that isn’t mindless, this spell has the evil trait. Attempting to cast this spell targeting a creature that you temporarily seized control of, such as an undead commanded by command undead, automatically fails and breaks the controlling effect.", 0 },
                    { new Guid("319bfe94-796a-48af-a70f-00d81248aeea"), 0, new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), "Magical monkey spirits fill the area as they pile and climb on top of one another. Because the monkeys are magical spirits, they can’t be attacked or hurt. Casting calm emotions or a similar effect over the monkeys makes them docile, causing them to cease making mischief for the duration of mad monkeys.", 0 },
                    { new Guid("6dc2e100-44e5-4de3-909a-6c0ef2dba1c8"), 0, new Guid("43379e31-324a-464c-9c6f-095fddcdcf31"), "A sparkling magical barrier envelops each target, shielding them against the triggering effect. Choose one type of physical or energy damage the triggering effect deals. Each target gains resistance 10 against that damage type for the triggering effect. The resistance applies only against the initial damage, not against any persistent damage or other lingering effects of the effect.", 0 },
                    { new Guid("a3b4bb03-8d44-481d-8dd5-e6e891fcbf9b"), 1, new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), "Choose the kind of mischief your monkeys make when you Cast the Spell. They produce the effect listed for that mischief when you Cast the Spell and each round when you Sustain the Spell. When you Sustain the Spell, you can move the area of the monkeys by 5 feet.", 0 },
                    { new Guid("37662457-a99b-454b-b315-176505eda5ec"), 3, new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), "Raucous Din - The monkeys screech loudly, potentially deafening creatures in the spell’s area. Each creature in the spell’s area must attempt a Fortitude save.", 2 },
                    { new Guid("b7496181-7f02-467a-a0a2-153266044b2f"), 0, new Guid("a81fcdf7-416e-4f72-8bdc-6e2f84329f20"), "You repel dangers from all around you, making passage through the chosen area safe for a brief amount of time. Anyone passing through the area gains the following benefits against harmful effects of the terrain and environment, including environmental damage, hazardous terrain, and hazards in the area. The spell grants a +2 status bonus to AC and saves against such effects, and resistance 5 to all damage from such effects. Furthermore, the spell prevents anything in the area that’s prone to collapse, such as a rickety bridge or an unstable ceiling, from collapsing, except under extreme strain that would collapse a normal structure of its type.", 0 },
                    { new Guid("9e0828f1-e6ad-46eb-bf23-8ab5028e5d32"), 4, new Guid("f2809213-61ae-4e90-b0fd-74feada4fdc7"), "When targeting armor someone is wearing, its Bulk is 1 higher than the listed value, since carrying armor is more cumbersome than wearing it. Thin iron or steel items, such as weapons, have 20 HP and a Broken Threshold of 10, and thicker iron or steel items, such as most suits of armor, have 36 HP and a Broken Threshold of 18. Other materials’ statistics can be found on pages 577–579 of the Core Rulebook.", 0 },
                    { new Guid("146b63d1-84f6-4819-bb5a-41931a200ece"), 3, new Guid("f2809213-61ae-4e90-b0fd-74feada4fdc7"), "Item - The rust deals 2d6 damage, subject to a basic Reflex save by the creature wearing or holding the item; if the item is unattended, it automatically gets a critical failure. On a failed save, the item also takes 1d6 persistent damage. For an attended item, this persistent damage occurs at the end of the attending creature’s turns; if the item was unattended when you Cast the Spell, the damage happens at the end of your turns.", 2 },
                    { new Guid("3d599076-4b8d-4fa0-bf00-d67f615f458b"), 2, new Guid("f2809213-61ae-4e90-b0fd-74feada4fdc7"), "Creature or Hazard - A creature or hazard must be made of all or mostly metal to be affected (this includes many mechanical traps). It takes 8d6 damage (basic Fortitude save), plus 2d6 persistent damage on a failed save. Touching a hazard to affect it with this spell might trigger the hazard, as determined by the GM.", 2 },
                    { new Guid("a30a2ae3-6611-41b9-8f99-b8f45c1729a2"), 1, new Guid("f2809213-61ae-4e90-b0fd-74feada4fdc7"), "All damage from this spell ignores Hardness. If the spell causes persistent damage from rust, a creature can attempt to scrape off the rust to assist the target in recovering from the persistent damage (reducing the DC of the flat check to end persistent damage to 10 and granting an immediate flat check). The effect of the spell depends on its target.", 0 },
                    { new Guid("3e245d98-4737-4ab8-9834-b0505562ec19"), 0, new Guid("f2809213-61ae-4e90-b0fd-74feada4fdc7"), "You cause the target to rapidly rust. This magical rust can affect nonferrous materials, but the target must be all or mostly metal. Skymetals such as adamantine and orichalcum are immune to this rust, and the GM might determine other precious materials are similarly resilient. Ultimately, the GM decides if an object or creature can be targeted with this spell.", 0 },
                    { new Guid("8c41b70e-17a4-4fd6-b223-ba57f28955d4"), 1, new Guid("e50acbc3-bb22-4c29-9b74-c9ffb2d7d13e"), "Once per turn, starting on the turn after you cast reaper’s lantern, you can use a single action, which has the concentrate trait, to increase the emanation’s radius by 5 feet. When you do so, you force creatures in the area that haven’t yet attempted a save against reaper’s lantern to attempt one.", 0 },
                    { new Guid("ba8683f5-4629-482b-99f6-d92efc68a298"), 0, new Guid("e50acbc3-bb22-4c29-9b74-c9ffb2d7d13e"), "You call forth a ghostly lantern that guides the living toward death and the undead toward true death. It sheds bright light in the spell’s area, and dim light to twice that area. Though the lantern is insubstantial, you must keep a hand free to hold it or the spell ends (though using the hand for somatic spell components doesn’t end the spell). Living creatures and undead in the area when you Cast the Spell, or that enter the area later, must attempt Fortitude saves. Living creatures that fail their Fortitude saves gain only half the normal benefit from healing effects while within the area. Undead targets that fail their Fortitude saves become enfeebled 1 while within the area. Once a creature attempts a save against reaper’s lantern, it uses the same outcome if it leaves the area and enters it again.", 0 },
                    { new Guid("90ad2eab-c5ed-4c79-b7ae-3c0431a5b955"), 2, new Guid("88ce9924-4af8-4bef-9e32-487063854cb6"), "If you have the Counterspell reaction, you can use quench to counter any spell with the fire trait instead of needing to have the triggering fire spell prepared or in your repertoire.", 0 },
                    { new Guid("7f54bf14-43eb-4582-ace0-2a41a21ea46a"), 1, new Guid("88ce9924-4af8-4bef-9e32-487063854cb6"), "When you Sustain this Spell, you can move the area of vapor anywhere within range, but the only effect when you do so is to automatically extinguish non-magical fires.", 0 },
                    { new Guid("ffae1f80-35a5-49ef-9e5b-3363e621cc46"), 0, new Guid("88ce9924-4af8-4bef-9e32-487063854cb6"), "You cause the air in the area to become supersaturated with water vapor. Non-magical fires within the area are automatically extinguished. Fire creatures within the area take 4d8 damage (basic Fortitude save). Choose one magical fire, fire spell, or fire item in the area and attempt to counteract it. If you succeed against an item, the item loses its fire properties for 10 minutes (for instance, a +1 flaming longsword would become a +1 longsword). If the target is an artifact or similarly powerful item, you automatically fail to counteract it.", 0 },
                    { new Guid("ba0921b7-c2c8-413b-8696-6f3c121a7ed5"), 0, new Guid("a3135b79-cbae-4247-9498-c673d0ef1f19"), "A spray of heavy rocks flies through the air in front of you. The rubble deals 2d4 bludgeoning damage to each creature in the area. Each creature must attempt a Reflex save.", 0 },
                    { new Guid("1544f4b4-4eaa-47a6-a9df-6da4d945ab1b"), 0, new Guid("e3c259f7-11a8-4b23-a512-29afd7cffe68"), "A phantasmal image of the most precious thing imaginable to the target appears in a location of your choice within the spell’s range. Only the spell’s target can see the treasure, though you can see the vague shape of the treasure—be it a pile of items, a deific avatar, or a cherished loved one or hero. The target’s response to the treasure is based on the outcome of the target’s Will save.", 0 },
                    { new Guid("6f961c46-c835-473c-9245-89bf5f6b768c"), 1, new Guid("c8c32ec6-c79f-4197-9423-22c9ab174711"), "You can Dismiss the spell. The spell also ends if you die or enter an extradimensional space. When the spell ends, the target reappears in the nearest unoccupied space (outside of any extradimensional space you may have entered).", 0 },
                    { new Guid("37fa3590-08b2-4d8f-ad86-1cd6e301af3b"), 0, new Guid("c8c32ec6-c79f-4197-9423-22c9ab174711"), "You open your cloak or create a gap with your hands, drawing the target into a pocket dimension just large enough for its basic comfort. No other creature can enter this extradimensional space, and the target can bring along objects only if they were designed to be worn by a creature of its kind. The space has enough air, food, and water to sustain the target for the duration.", 0 },
                    { new Guid("023aa018-ad1b-4d43-86bf-5bf127e4fabb"), 0, new Guid("97490ac8-c0dd-4857-a1c7-e93ecc436a02"), "You place a hand on an object to learn a piece of information about an emotional event that occurred involving the object within the past week, determined by the GM. If you cast object reading on the same item multiple times, you can either concentrate on a single event to gain additional pieces of information about that event, or gain a piece of information about another emotional event in the applicable time frame.", 0 },
                    { new Guid("2a0f38d9-4c01-438b-828b-ae0086fad7b7"), 0, new Guid("a97c8c23-59ca-4523-909d-15f56c873eb5"), "You emit a cloud of toxic smoke that temporarily obscures you from sight. Each creature except you in the area when you Cast the Spell takes 1d6 poison damage (basic Fortitude save). A creature that critically fails the saving throw also becomes sickened 1. All creatures in the area become concealed, and all creatures outside the smoke become concealed to creatures within it. This smoke can be dispersed by a strong wind.", 0 },
                    { new Guid("15143952-1094-45b8-9407-40fc8db3216c"), 0, new Guid("4b942432-9074-417e-863b-29f29b8f335d"), "You pour positive energy into ordinary stones, granting them temporary magical properties. You can target 1 non-magical stone or sling bullet for every action you use Casting this Spell. The stones must be unattended or carried by you or a willing ally. The stones become +1 striking disrupting sling bullets. Each stone can be used only once, after which it crumbles to dust.", 0 },
                    { new Guid("8dbcf777-aa5f-443f-a568-7a612f612536"), 4, new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), "Tumultuous Gymnastics - The monkeys jump and climb all over creatures in the spell’s area, interfering with complex movements. Each creature in the spell’s area must attempt a Reflex save.", 2 },
                    { new Guid("e2fb6492-39e4-4fdf-9daa-4a2781670c51"), 2, new Guid("ef1451f0-1c42-46d5-bcb8-4583f52d491a"), "Flagrant Burglary - The monkeys try to Steal any one item from one creature in the area. Use your spell DC – 10 as the monkeys’ Thievery modifier. Their attempt relies more on distraction than subtlety, so the victim knows what item the monkeys were trying to take and whether it was taken. Getting a stolen item from the monkeys— even for the caster—requires Stealing it from them or Disarming them, using your spell DC. When the spell ends, any stolen items fall to the ground in any square of the spell’s area you choose.", 2 },
                    { new Guid("e2c85dfe-6eb4-43d2-b57b-0aeb38aeee45"), 4, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Low-light vision.", 2 },
                    { new Guid("7604721d-c2e0-4f7d-a0be-ff61e0e41f77"), 0, new Guid("5b36f993-0b0f-497f-8c23-33e3bf785a4e"), "Your hands become infused with positive energy, healing a living creature or damaging an undead creature with a touch. If you use lay on hands on a willing living target, you restore 6 Hit Points; if the target is one of your allies, they also gain a +2 status bonus to AC for 1 round. Against an undead target, you deal 1d6 damage and it must attempt a basic Fortitude save; if it fails, it also takes a –2 status penalty to AC for 1 round.", 0 },
                    { new Guid("13ded45e-51fb-447a-b505-09210b2ef9e3"), 0, new Guid("3c9d8bd6-264b-42d3-8e6f-1639918cf707"), "Your litany rails against the sin of wrath, punishing the target for attacking good creatures. The target must attempt a Will save. A particularly wrathful creature, such as a wrath demon, uses the outcome one degree of success worse than the result of its saving throw. The target then becomes temporarily immune to all of your litanies for 1 minute.", 0 },
                    { new Guid("8fb0157e-39c5-40ee-9c33-c534d6bd2a46"), 1, new Guid("8b3f9e90-b622-4643-9bb7-7b44587b6aeb"), "If the triggering ability did not have both a critical success and critical failure condition, tempt fate fails, but you don’t expend the Focus Point for Casting this Spell.", 0 },
                    { new Guid("721ca1ca-588a-493d-ba3b-45106088814c"), 0, new Guid("b81a1364-8a8a-45b6-9a13-5f6432dda10b"), "You call forth a tremendous wave to move the target either in a body of water or on the ground. The target must attempt a Fortitude save.", 0 },
                    { new Guid("390eafe6-30d1-4930-8481-c17d06fa5f89"), 0, new Guid("f8843f30-1ace-4783-8eab-1cd5c4ab752e"), "Your imperious touch erodes the target’s willpower, making it easier to control. The target attempts a Will save.", 0 },
                    { new Guid("498b552c-4d08-4731-8e8b-10ffce0ddb07"), 0, new Guid("4d0adf49-b2bb-45d1-8bce-8fedf205c50d"), "When you touch the target, a symbol of the moon appears on its forehead, glowing with soft moonlight. The target glows with dim light in a 20-foot radius. It also gets a benefit based on a phase of the moon, starting with the new moon and changing to the next phase at the end of each of its turns.", 0 },
                    { new Guid("f78dc9d9-344c-4bad-9342-cafb167511e4"), 1, new Guid("4d0adf49-b2bb-45d1-8bce-8fedf205c50d"), "New Moon - The target receives no benefit.", 2 },
                    { new Guid("b0043cd0-889f-4d13-9b77-61743a6e3b2d"), 2, new Guid("4d0adf49-b2bb-45d1-8bce-8fedf205c50d"), "Waxing Moon - The target gains a +1 status bonus to attack rolls and a +4 status bonus to damage rolls.", 2 },
                    { new Guid("29b0c8bd-0ce7-4bdd-9d2d-c840cb90f291"), 3, new Guid("4d0adf49-b2bb-45d1-8bce-8fedf205c50d"), "Full Moon - The target gains a +1 status bonus to attack rolls, AC, and saves, and a +4 status bonus to damage.", 2 },
                    { new Guid("98de71e2-f3fe-42ef-9ff2-e8b61c13bbe9"), 4, new Guid("4d0adf49-b2bb-45d1-8bce-8fedf205c50d"), "Waning Moon - The target gains a +1 status bonus to AC and saving throws. After this phase, return to the new moon.", 2 },
                    { new Guid("9265abd3-63c0-4d11-98cc-2688433b9f94"), 0, new Guid("8b3f9e90-b622-4643-9bb7-7b44587b6aeb"), "You twist the forces of fate to make a moment dire or uneventful, with no in-between. The target gains a +1 status bonus to the triggering saving throw. If the saving throw’s result is a success, it becomes a critical success. If it’s a failure, it becomes a critical failure, and the critical failure can’t be reduced by abilities that usually reduce critical failure, such as improved evasion.", 0 },
                    { new Guid("0440bd0b-82e8-4929-8665-4ebb7199cbf7"), 0, new Guid("7cdc2806-fe9a-4f0d-98ba-d4f8a1a406d0"), "You attack the target’s life force with undeath, dealing 1d6 negative damage. The target must attempt a Fortitude save.", 0 },
                    { new Guid("da2bfeb6-0f5f-49f0-9acf-b5d6fbcf9104"), 0, new Guid("4842cf39-f574-4e0e-b473-216cb4abfc46"), "You rarely settle for being in just one place. Choose a location within 100 feet of the target that the target can see. You create an illusion of yourself there that only it can see and that mimics all your actions. The target must attempt a Will save.", 0 },
                    { new Guid("92d6b0c4-24b5-4578-8e1a-688109ff834f"), 0, new Guid("09c0cd36-f201-4891-8de5-6cfc6cc063df"), "Nothing can hold you in place. You immediately escape from every magical effect that has you immobilized or grabbed unless the effect is of a higher level than your unimpeded stride spell. You then Stride. During this movement, you ignore difficult terrain and any circumstance or status penalties to your Speed.", 0 },
                    { new Guid("1b81a409-7126-4d71-9341-c55d52603d16"), 0, new Guid("891c75f8-0588-453f-a807-e0f1dde5a995"), "You put up a united defense. Each ally can use your saving throw modifier instead of its own against the triggering spell. Each ally decides individually which modifier to use.", 0 },
                    { new Guid("d1df2451-4a4b-4ef7-abf8-fdadd8e8aa30"), 0, new Guid("5aa20247-696a-40c0-89ff-6b9de4da1a5b"), "You surround yourself in a veil of confidence. You reduce your current frightened condition by 1, and whenever you would become frightened during the duration, reduce the amount by 1.", 0 },
                    { new Guid("19f41470-69c9-4f57-bdad-4b49ea367da2"), 1, new Guid("5aa20247-696a-40c0-89ff-6b9de4da1a5b"), "If you critically fail a save against fear, veil of confidence ends immediately, and you increase any frightened condition you gain from the critical failure by 1 instead of decreasing it.", 0 },
                    { new Guid("5571deb3-1589-43ce-81cc-a78a94183440"), 0, new Guid("9ff44d68-af4d-46db-8ecb-9196c27dcc89"), "Your body sprouts a coat of brambly thorns that harm those that strike you and thrive on life magic. Adjacent creatures that hit you with a melee attack, as well as creatures that hit you with unarmed attacks, take 1 piercing damage each time they do. Anytime you cast a positive spell, the damage from your thorns increases to 1d6 until the start of your next turn.", 0 },
                    { new Guid("be99c269-5795-40aa-b766-d1c271946226"), 0, new Guid("5563c71a-59ae-42d3-8d5a-a6d70106135b"), "You fill the creature’s mind with a terrifying vision out of its nightmares. The target must attempt a Will save.", 0 },
                    { new Guid("5d0a6d19-7b6f-4623-aaea-cccccbcffb4a"), 1, new Guid("5563c71a-59ae-42d3-8d5a-a6d70106135b"), "If the target is unconscious when you Cast this Spell on it, it immediately wakes up before attempting its save, and if it fails its save, it gains the fleeing condition for 1 round in addition to the effects noted above.", 0 },
                    { new Guid("d4b7a4c9-93ec-4688-b1de-e124675e625e"), 0, new Guid("39c444d7-449b-481e-8c53-a66e85b8b79b"), "You add power to your muscles, allowing you to swim or climb walls with ease. When you cast this spell, you gain either a climb Speed or a swim Speed. The Speed is equal to your land Speed.", 0 },
                    { new Guid("ea1a8266-45c2-4ed4-924e-d1d775da4c31"), 3, new Guid("1e5d845b-fab2-4def-954c-8865767ee28e"), "Persistent - Poison You can cause the target take the persistent poison damage immediately when you Cast this Spell (in addition to taking it at the end of its next turn). Whether or not you do so, the target attempts an additional flat check against the persistent poison damage. You can set the DC of that flat check to 5 or 20 instead of the normal DC.", 2 },
                    { new Guid("cebac031-42ae-4230-aa42-193256954a64"), 2, new Guid("1e5d845b-fab2-4def-954c-8865767ee28e"), "Affliction - The target immediately attempts its next saving throw against the affliction. You can grant the creature your choice of a +2 status bonus or a –2 status penalty to its saving throw against the affliction.", 2 },
                    { new Guid("ed9c674a-d7a5-47d5-b366-f81e0c648553"), 1, new Guid("1e5d845b-fab2-4def-954c-8865767ee28e"), "The effect of this spell depends on whether you’re attempting to end an affliction or persistent poison damage, and whether you are attempting to help or hinder the target’s recovery.", 0 },
                    { new Guid("e2c25e0c-9793-4fdd-a055-120cbf048ce1"), 0, new Guid("33cedd4d-f022-42b8-ad1d-7b09e254bc0b"), "You attempt to learn more about the target’s fate in the short term, usually within the next day for most prosaic creatures, or the next hour or less for someone likely to have multiple rapid experiences, such as someone actively adventuring.", 0 },
                    { new Guid("279570b1-5324-4be5-9442-d7bd5dc3ff58"), 1, new Guid("33cedd4d-f022-42b8-ad1d-7b09e254bc0b"), "You learn a single enigmatic word connected to the creature’s fate in that time frame. Fate is notoriously inscrutable, and the word isn’t necessarily meant to be taken at face value, so the meaning is often clear only in hindsight. The GM rolls a secret DC 6 flat check. If the creature’s fate is too uncertain, or on a failed flat check, the spell yields the word “inconclusive.” Either way, the creature is then temporarily immune for 24 hours.", 0 },
                    { new Guid("190ae005-1b51-41ba-93a6-054a4e92fd75"), 0, new Guid("37d8a761-64d0-45fc-8861-ec08368cd27c"), "You snatch creatures from the jaws of death. You can spend 1 to 3 actions Casting this Spell, and you can target a number of creatures equal to the actions spent. Each target regains 3d6 Hit Points. If the target had the dying condition, coming back from dying due to this healing doesn’t increase its wounded condition.", 0 },
                    { new Guid("444b3e59-ca86-4ebc-a2b0-8f9493fc3173"), 0, new Guid("26c6bd1b-0b78-4b6a-9fbf-ea95af5776fe"), "You vengefully reflect your pain upon your tormentor. The target takes mental damage equal to half the amount it dealt to you when it triggered the spell.", 0 },
                    { new Guid("f6d5f3a6-ce11-40dd-8e1c-c3f59aadf640"), 0, new Guid("95ee850b-bf3d-47ec-8228-94467052a6df"), "You ensure a secret remains safe from prying spies. Choose one piece of information that at least some of the targets know; you can target a creature only if it remains within range for the full minute during which you Cast the Spell. The spell grants those who know the piece of knowledge you have chosen a +4 status bonus to skill checks (typically Deception checks) to conceal this knowledge and to saving throws against spells that specifically attempt to obtain this knowledge from them and effects that would force them to reveal it.", 0 },
                    { new Guid("bf1d8655-86f5-40ab-a083-9c5ee2f10210"), 1, new Guid("95ee850b-bf3d-47ec-8228-94467052a6df"), "If you Cast this Spell again, any previous safeguard secret you had cast ends.", 0 },
                    { new Guid("4f3b3211-80d2-41b2-8981-292b02cfb500"), 0, new Guid("2ae88ff7-9177-406b-99ec-05fdd4263943"), "You inflict pain upon the target and revel in their anguish. This deals 1d4 mental damage and 1d4 persistent mental damage; the target must attempt a Will save. As long as the target is taking persistent damage from this spell, you gain a +1 status bonus to attack rolls and skill checks against the target.", 0 },
                    { new Guid("39f32fbc-fb17-45d3-bbda-9eb51e7ca2f4"), 0, new Guid("c81d5fbd-890c-4bd8-97a6-d94e210229af"), "Speaking a short prayer as you gather your thoughts, you’re blessed to find that your deity gave you just the right bit of information for your situation. Roll the triggering check twice and use the better result.", 0 },
                    { new Guid("6693f7dd-046e-40b4-a98c-7069b8257cec"), 0, new Guid("c481cb2f-cd45-4d1c-9088-ecc88e2cdd5d"), "Merging minds with the target, you swap disorienting visions from one another’s nightmares. One of you will become confused, but which it’ll be depends on the target’s Will save.", 0 },
                    { new Guid("3fe2d807-2d11-46d8-9d76-646373023e83"), 0, new Guid("c431e47e-b879-4772-b9a9-082f686f8292"), "You attempt to calm the target by uttering soothing words in a calm and even tone. The target gains a +1 status bonus to Will saving throws. This bonus increases to +2 against emotion effects.", 0 },
                    { new Guid("c9f2bc73-a77d-48a4-9175-632c1f4e32f1"), 1, new Guid("c431e47e-b879-4772-b9a9-082f686f8292"), "In addition, when you Cast this Spell, you can attempt to counteract one emotion effect on the target.", 0 },
                    { new Guid("3c18f999-1631-4ec7-bb23-9b48a1d7b66c"), 0, new Guid("ff4b0053-15f7-4b25-8795-43dbc59e15de"), "A deluge of colorful illusory paint, tools, or other symbols of art and artisanship drift down in the area. Roll 1d4 to determine the color of the illusion. Each creature in the area must attempt a Will save. A creature is unaffected on a success. On a failure or critical failure, the creature takes the results listed on the table relevant to the color.", 0 },
                    { new Guid("9053f612-071b-4d9e-97eb-3afac193e029"), 0, new Guid("bbc7ea5b-753a-45b4-86fa-be2a891a8b69"), "You swiftly move from a dangerous spot and veil yourself. You Step and become concealed.", 0 },
                    { new Guid("5792b854-3225-4742-be9a-ecc77ef3d197"), 0, new Guid("90f111cc-f4a8-4c26-bfb1-a6ac79d98539"), "With soothing song or tales, you lull the target into an enchanting dream. When you cast the spell, the target falls unconscious if it wasn’t already. While unconscious, it experiences a dream of your choice. If it sleeps for at least 1 minute, it gains the benefit of the dream for the remainder of the spell’s duration.", 0 },
                    { new Guid("cbdc06b0-4b9c-4944-9202-5280e95021a8"), 1, new Guid("90f111cc-f4a8-4c26-bfb1-a6ac79d98539"), "Dream of Insight - +1 status bonus to Intelligence-based skill checks.", 2 },
                    { new Guid("021979d7-33b0-462c-b375-28c0ec7dea46"), 2, new Guid("90f111cc-f4a8-4c26-bfb1-a6ac79d98539"), "Dream of Glamour - +1 status bonus to Charisma-based skill checks.", 2 },
                    { new Guid("f521a944-b1d4-4353-974d-ca5a0fd9b7f3"), 3, new Guid("90f111cc-f4a8-4c26-bfb1-a6ac79d98539"), "Dream of Voyaging - +5-foot status bonus to Speed.", 2 },
                    { new Guid("1a8ce36f-d599-4b3c-8190-f01078a4173e"), 4, new Guid("90f111cc-f4a8-4c26-bfb1-a6ac79d98539"), "If you Cast this Spell again, the effects of any previous sweet dream you cast end.", 0 },
                    { new Guid("94446fe4-aa8a-4fef-b6c2-71fa1d158d00"), 0, new Guid("1e5d845b-fab2-4def-954c-8865767ee28e"), "When someone has overindulged, you can hasten them past the worst of their affliction or intensify their misery. This spell attempts to progress a disease affliction, a poison affliction, or persistent poison damage affecting the target. If the target is affected by more than one of these, you can choose from among those you are aware of; otherwise the GM chooses randomly. An unwilling target can attempt a Will save to negate take its course.", 0 },
                    { new Guid("c8ff9313-fbf3-4056-871d-c8e01401728c"), 0, new Guid("7b3b4fc4-1b9d-4cd2-9e8b-abdde2a036f0"), "Holding your weapon aloft, you fill it with divine energy. On your next Strike with that weapon before the start of your next turn, you gain a +1 status bonus to the attack roll and the weapon deals an additional die of damage. If the weapon has a striking rune, this instead increases the number of dice from the striking rune by 1 (to a maximum of 3 extra weapon dice).", 0 },
                    { new Guid("5936895c-4b6c-4065-8aab-f9f2018201b5"), 1, new Guid("7b3b4fc4-1b9d-4cd2-9e8b-abdde2a036f0"), "If the target weapon leaves your possession, weapon surge immediately ends.", 0 },
                    { new Guid("21c9d5a8-d2db-415b-9a8f-9634dbc2c0ba"), 0, new Guid("e9aee3ed-b52d-425f-89c6-e557c7cc0cc4"), "You utter a liberating word of power that frees a creature. You suppress one of the following conditions of your choice: confused, frightened, grabbed, or paralyzed. The target isn’t affected by the chosen condition, and if you suppress the grabbed condition, the target automatically breaks free from any grab affecting it when you Cast the Spell.", 0 },
                    { new Guid("0bb480e3-2efa-43f9-87e3-d1d5ab1552a3"), 1, new Guid("e9aee3ed-b52d-425f-89c6-e557c7cc0cc4"), "If you don’t remove the effect that provided the condition, the condition returns after the spell ends. For example, if a spell was making the target confused for 1 minute, word of freedom would let the target act normally for a round, but the confused condition would return afterward.", 0 },
                    { new Guid("660aed99-247f-4f87-a8f2-25c25d69e984"), 0, new Guid("d3a60ed6-b434-4f80-a3a0-9579481617a7"), "Powerful winds carry you smoothly through the air, giving you a fly Speed equal to your Speed. When this spell’s duration would end, if you’re still flying, you float to the ground, as feather fall.", 0 },
                    { new Guid("d8e56efd-1c89-46b4-8857-c33a1c931c77"), 0, new Guid("01f09cc1-08fc-461b-a98c-cda84eb402f1"), "You surround a foe in a swirling storm of violent winds, roiling clouds, and crackling lightning. The storm deals 1d12 electricity damage. The target must attempt a basic Reflex save. On a failure, the target also is clumsy 2 for 1 round and takes 1 persistent electricity damage.", 0 },
                    { new Guid("d798f79b-3ddd-4bd6-82e5-288129ab2e1a"), 0, new Guid("b6163b08-508b-4f67-8816-c8887b97575f"), "You morph your body based on your training, choosing one of the following effects based on your wild order feats.", 0 },
                    { new Guid("cdefe147-9113-426a-b73a-82d9227ead89"), 1, new Guid("b6163b08-508b-4f67-8816-c8887b97575f"), "If you have Wild Shape, you can morph your hands into wild claws. Your hands transform into incredibly sharp claws. These claws are an unarmed attack you’re trained in and deal 1d6 slashing damage each (agile, finesse). You can still hold and use items with your hands while they’re transformed by this spell, but you cannot hold an item while attacking. If you have Insect Shape, you can instead transform your mouth into wild jaws, an unarmed attack you’re trained in that deals 1d8 piercing damage.", 2 },
                    { new Guid("db0f83b1-27eb-4c7c-97bc-fabe2d1c50fa"), 2, new Guid("b6163b08-508b-4f67-8816-c8887b97575f"), "If you have Elemental Shape, you can morph your body to be partially composed of elemental matter, granting you resistance 5 to critical hits and precision damage.", 2 },
                    { new Guid("52adf9d1-c371-47d9-b7da-576aeb6e468f"), 3, new Guid("b6163b08-508b-4f67-8816-c8887b97575f"), "If you have Plant Shape, you can morph your arms into long vines, increasing your reach to 10 feet (or 15 feet with a reach weapon).", 2 },
                    { new Guid("fe0e1a99-af43-4076-91a6-12478045749a"), 4, new Guid("b6163b08-508b-4f67-8816-c8887b97575f"), "If you have Soaring Shape, you can cast the spell as a two-action activity ([two-actions] somatic, verbal) to grow wings from your back. These wings allow you to fly with a fly Speed of 30 feet.", 2 },
                    { new Guid("de2d7f60-60db-417a-a990-a994d71e1c9c"), 0, new Guid("bd42cf13-9815-4ae6-bc48-9697640bd2cd"), "You infuse yourself with primal essence and transform into another form. You can polymorph into any form listed in pest form, which lasts 10 minutes. All other wild shape forms last 1 minute. You can add more forms to your wild shape list with druid feats; your feat might grant you some or all of the forms from a given polymorph spell. When you transform into a form granted by a spell, you gain all the effects of the form you chose from a version of the spell heightened to wild shape’s level. Wild shape allows you to use your own shapeshifting training more easily than most polymorph spells. When you choose to use your own attack modifier while polymorphed instead of the form’s default attack modifier, you gain a +2 status bonus to your attack rolls.", 0 },
                    { new Guid("855f00b1-aad9-4bbc-b465-5776b396b113"), 0, new Guid("86700caa-5237-4fc5-a256-a1bd919676ff"), "You move so fast you blur across planar boundaries. You teleport up to a distance equal to your Speed within your line of sight.", 0 },
                    { new Guid("065d97d9-9db4-4b7a-9c06-34704fe09c8c"), 0, new Guid("2848c34e-d587-452e-a123-c10dae2674d7"), "You turn ethereal, with the effects of ethereal jaunt, but you don’t need to concentrate.", 0 },
                    { new Guid("649e5e60-fb4d-464d-a514-21b313f628b6"), 0, new Guid("534d8987-816c-49a1-a46f-08887f855b83"), "You unleash your ki as a powerful blast of force that deals 2d6 force damage. If you use 2 actions to cast ki blast, increase the size of the cone to 30 feet and the damage to 3d6. If you use 3 actions to cast ki blast, increase the size of the cone to 60 feet and the damage to 4d6. Each creature in the area must attempt a Fortitude saving throw.", 0 },
                    { new Guid("8f83dfd9-bbdc-4bcc-b37f-2a8c89bf7bab"), 0, new Guid("d090e3ba-5f24-4495-9367-3042410b8ff2"), "Accelerated by your ki, you move with such speed you become a blur. Move two times: two Strides, two Steps, or one Stride and one Step (in either order). You gain the concealed condition during this movement and until the start of your next turn.", 0 },
                    { new Guid("aa193a73-1625-432c-a26a-201458cd89a1"), 0, new Guid("ca078fe4-0c34-4343-9cd2-6d61eabb0a9b"), "You focus your ki into magical attacks. Make an unarmed Strike or Flurry of Blows (this doesn’t change the limit on using only one flourish per turn). You gain a +1 status bonus to your attack rolls with the Strikes, and the Strikes deal 1d6 extra damage. This damage can be any of the following types of your choice, chosen each time you Strike: force, lawful (only if you’re lawful), negative, or positive.", 0 },
                    { new Guid("2f074011-6509-415a-8296-76ed1d4317df"), 0, new Guid("a0300663-253b-4a61-a986-adfc0dd8022f"), "Make a melee unarmed Strike. If you hit and the target is alive, anytime during the duration, you can spend a single action, which has the auditory and concentrate traits, to speak a word of death that could instantly slay it. The target must attempt a Fortitude save.", 0 },
                    { new Guid("51c554c2-a641-4b7f-894f-62050e33cb99"), 1, new Guid("a0300663-253b-4a61-a986-adfc0dd8022f"), "If you cast quivering palm again, the effects of any quivering palm you had previously cast end.", 0 },
                    { new Guid("a870683d-8597-4e03-ba8d-aa288bd01b45"), 0, new Guid("d734caad-4618-439d-a6ca-21522f5f82f4"), "You heal yourself in one of the following ways, chosen by you when you cast the spell.", 0 },
                    { new Guid("f618cddd-fb56-49b5-95b5-3a44e35ac9ff"), 1, new Guid("d734caad-4618-439d-a6ca-21522f5f82f4"), "You regain 8 Hit Points.", 2 },
                    { new Guid("0b89d019-c404-4e85-8f24-775f9b611ad7"), 2, new Guid("d734caad-4618-439d-a6ca-21522f5f82f4"), "You attempt to cure one poison or disease afflicting you; attempt to counteract the affliction.", 2 },
                    { new Guid("a8a07992-739d-48aa-b134-e21e582abf54"), 0, new Guid("e089b11e-d249-4e4a-bf20-2e91bca8fa84"), "You take on the stance of the flowing winds, sending out waves of energy at a distance. You can make wind crash unarmed Strikes as ranged Strikes against targets within 30 feet. These deal 1d6 bludgeoning damage, use the brawling group, and have the agile, nonlethal, propulsive, and unarmed traits. Wind crash Strikes ignore concealment and all cover.", 0 },
                    { new Guid("a60f4956-d43b-4501-9757-4076fcf6f9c5"), 5, new Guid("6e915e86-4958-40eb-a661-ef6e6e4daf03"), "In addition, once per round you can use a single action, which has the concentrate and manipulate traits, to call down a bolt of lightning, striking any target in range that you can see. You deal 10d6 electricity damage to the target; it must attempt a basic Reflex save. On a failure, it is also deafened for 1 round.", 0 },
                    { new Guid("61a44a33-b2ed-4021-ab9e-d29ed24fe47f"), 0, new Guid("8ba9e8e6-7902-49c0-8d3a-aff76bcd8a9b"), "Giving the air a push, you buffet the target with a powerful gust of wind; it must attempt a Fortitude save.", 0 },
                    { new Guid("3d58fb86-0b71-4f4b-97c8-963343a7bc4e"), 4, new Guid("6e915e86-4958-40eb-a661-ef6e6e4daf03"), "Wind - Powerful winds buffet the area in all directions. Ranged attacks take a –4 circumstance penalty, and all flying is against the wind and counts as moving through difficult terrain.", 2 },
                    { new Guid("19d5214a-81d5-4d59-9598-eb6adaf621b5"), 2, new Guid("6e915e86-4958-40eb-a661-ef6e6e4daf03"), "Fog - Heavy fog rolls in, concealing the area with the effects of obscuring mist.", 2 },
                    { new Guid("511b62e8-30aa-4c9f-8a6a-0649506f3f7f"), 0, new Guid("501214f3-f47e-4efb-9a3f-e1f3acd7b700"), "You speak a statement you believe to be true and that is free of any attempt to deceive through twisting words, omission, and so on. The statement must be 25 words or fewer. A symbol of your deity glows above your head, and anyone who sees you and hears your statement knows that you believe it to be true.", 0 },
                    { new Guid("55050491-0fc7-465d-aaeb-0787cb92fb78"), 1, new Guid("501214f3-f47e-4efb-9a3f-e1f3acd7b700"), "Each time you Sustain this Spell, you can repeat this effect.", 0 },
                    { new Guid("76af82dc-6434-44f6-851c-77e3585b11fe"), 0, new Guid("c8ee2806-085a-4c67-8f9d-930cd091180b"), "You stoke the righteous anger within yourself and an ally. You and the target ally each roll a d20 and use the higher result for both your initiative rolls. You each still use your own Perception modifier or other statistic to determine your results.", 0 },
                    { new Guid("65942fcb-79db-47ef-81c0-655bda22575b"), 0, new Guid("71c4ee4f-6eff-4d2c-91d8-ce47bee76a11"), "You imbue the target berry with the bounty of nature. A creature can eat the berry with an Interact action to regain 1d6+4 HP. A berry not consumed during the duration withers away. Every six goodberries consumed gives as much nourishment as one square meal for a typical human.", 0 },
                    { new Guid("980b6d6c-efa8-4c88-bba0-bf40de62d090"), 0, new Guid("3db9b6ca-f709-478e-8687-0a1a2f976299"), "You heal an animal’s wounds, restoring 1d8 Hit Points to the target. The number of actions spent Casting this Spell determines its effect.", 0 },
                    { new Guid("90ea1170-4f91-4335-aede-e662f1022afb"), 1, new Guid("3db9b6ca-f709-478e-8687-0a1a2f976299"), "[one-action] Somatic - The spell has a range of touch.", 2 },
                    { new Guid("ddc9439f-bc13-42ab-97f0-8f2d3996983a"), 2, new Guid("3db9b6ca-f709-478e-8687-0a1a2f976299"), "[two-actions] Somatic, Verbal - The spell has a range of 30 feet and restores an additional 8 Hit Points to the target.", 2 },
                    { new Guid("3b3dded3-4342-434a-8d86-5a5567e6d60f"), 0, new Guid("8e4c52b9-d093-4066-82fb-9a0f21b14abe"), "The ground within the area transforms into a mass of dangerous briars that assault and impede your foes. The first time each round you Sustain the Spell, you can select one of the following effects to occur in the area.", 0 },
                    { new Guid("4adb9aee-1b88-4ab8-8c18-9dee868f2c42"), 1, new Guid("8e4c52b9-d093-4066-82fb-9a0f21b14abe"), "Ensnare - The briars clump around your foes, attempting to hold them in place. A foe within the area (or flying at most 20 feet above the area) must attempt a Reflex save. On a failure, it takes a –10-foot circumstance penalty to all Speeds for 1 round, and on a critical failure, it is immobilized for 1 round unless it Escapes.", 2 },
                    { new Guid("e66fcbba-94df-47f9-9c16-3fced0285790"), 2, new Guid("8e4c52b9-d093-4066-82fb-9a0f21b14abe"), "Impede - The briars twist and writhe, making the entire area difficult terrain.", 2 },
                    { new Guid("44948da4-9036-47a9-bfbc-6435441c5204"), 3, new Guid("8e4c52b9-d093-4066-82fb-9a0f21b14abe"), "Wall - A wall of thorns appears in the area, lasting for 1 round. The wall is greater difficult terrain instead of difficult terrain.", 2 },
                    { new Guid("fcc7cf18-07bf-462d-98c0-0090db9c269d"), 4, new Guid("8e4c52b9-d093-4066-82fb-9a0f21b14abe"), "In addition, once per round you can direct the briars to impale any target in the area (or flying up to 20 feet above the area) that you can see by using a single action, which has the concentrate and manipulate traits. Make a spell attack roll. On a success, the target takes 10d6 piercing damage and takes a –10-foot circumstance penalty to all Speeds for 1 round; on a critical success, the target is immobilized for 1 round unless it Escapes.", 0 },
                    { new Guid("35997cda-93ce-4310-bf7b-c801325c0a3c"), 0, new Guid("498f92df-8e2f-40a3-b93c-963ce144a79c"), "You enhance a summoned creature with the power of the elements. If your next action is to cast either summon animal or summon plant or fungus, choose air, earth, fire, or water, and the creature you summon gains the corresponding abilities.", 0 },
                    { new Guid("4850e664-3902-406d-8748-9439c18475c9"), 1, new Guid("498f92df-8e2f-40a3-b93c-963ce144a79c"), "Air - The creature gains a fly Speed of 60 feet.", 2 },
                    { new Guid("3c474e17-dbe5-4d42-9f96-78bf69285d90"), 2, new Guid("498f92df-8e2f-40a3-b93c-963ce144a79c"), "Earth - The creature gains a burrow Speed of 20 feet, reduces its land Speed by 10 feet (minimum 5 feet), and gains resistance 5 to physical damage.", 2 },
                    { new Guid("51c6c4e7-0ba4-4b47-8041-4d487c86dc58"), 3, new Guid("498f92df-8e2f-40a3-b93c-963ce144a79c"), "Fire - The creature’s attacks deal 1d6 extra fire damage, and it gains resistance 10 to fire and weakness 5 to cold and water.", 2 },
                    { new Guid("93cd51b6-da22-412a-b9d7-b690991c4fd7"), 4, new Guid("498f92df-8e2f-40a3-b93c-963ce144a79c"), "Water - The creature gains a swim Speed of 60 feet, can spend 1 action after a melee attack to attempt a Shove (ignoring multiple attack penalty), and gains resistance 5 to fire.", 2 },
                    { new Guid("9ebd1aa4-b563-460f-8590-f4441506b3de"), 0, new Guid("6e915e86-4958-40eb-a661-ef6e6e4daf03"), "The sky above you darkens in a matter of moments, swirling with ominous clouds punctuated by flashes of lighting. The first time each round you Sustain the Spell, you can select one of the following effects to occur in the area.", 0 },
                    { new Guid("e3ebcefc-3129-4d33-b300-01b934c52a0e"), 1, new Guid("6e915e86-4958-40eb-a661-ef6e6e4daf03"), "Calm - No additional effect.", 2 },
                    { new Guid("4dddead1-1c10-4835-baab-2bc615e241bf"), 3, new Guid("6e915e86-4958-40eb-a661-ef6e6e4daf03"), "Rain - Torrential rain falls from the sky, dousing ordinary flames. Creatures in the area take a –2 circumstance penalty to Acrobatics and Perception checks.", 2 },
                    { new Guid("39c62e48-adcb-4b8d-ab0c-66d48ad33b2c"), 5, new Guid("e2f1fa09-874f-44d3-9ad8-bb11f469bae4"), "Pulse of the city reveals only publicly available or observable information. You never learn clandestine movements or other details people are specifically trying to hide. The spell is also notoriously bad at overcoming magic meant to avoid detection; it automatically fails to reveal information about events involving creatures, places, or objects affected by spells that could prevent or counteract pulse of the city (such as nondetection).", 0 },
                    { new Guid("b6148581-249b-4af9-8ac8-984d6b6f859b"), 4, new Guid("e2f1fa09-874f-44d3-9ad8-bb11f469bae4"), "When uttering your word, you can exclude events you already know about, whether you know about them from this spell or from other experiences. If you cast pulse of the city again within 24 hours, you can say “echo” instead of another word to get an update on the event you learned about the last time you Cast the Spell.", 0 },
                    { new Guid("f2ad1e07-b3bb-435f-b16f-f7952d7d03f3"), 3, new Guid("e2f1fa09-874f-44d3-9ad8-bb11f469bae4"), "Masses - Common folk and merchants (gathering mobs, major sales)", 2 },
                    { new Guid("09073233-3689-4b8b-87c4-2b1bb66319d6"), 0, new Guid("461798c1-5e2c-4cfd-83bd-397308a6539b"), "After taking the triggering damage, you transform into air. Until the end of the current turn, you can’t be attacked or targeted, you don’t take up space, you can’t act, and any auras or emanations you have are suppressed. At the end of the turn, you re-form in any space you can occupy within 15 feet of where you were when you dispersed. Any auras or emanations you had are restored as long as their duration didn’t run out while you were dispersed.", 0 },
                    { new Guid("5ae5bd16-ee7d-46ba-853c-5f8b9a535629"), 0, new Guid("8c2d28f7-2b1d-4dbd-8f5b-481038cb7f5c"), "You call forth a torrential downpour, which extinguishes nonmagical flames. Creatures in the area are concealed and gain fire resistance 10. Creatures outside the area are concealed to those inside the area. Creatures with weakness to water that end their turns in the area take damage equal to their weakness.", 0 },
                    { new Guid("dad501c9-9412-43bf-98e3-5ee79a0097e0"), 0, new Guid("43383a1a-43cb-4de9-aa14-6d1915175e62"), "The target becomes distracted and suggestible, inundated by vivid daydreams.", 0 },
                    { new Guid("2d2bae60-3c75-4f67-a95c-8869407eec0a"), 0, new Guid("f1f36fab-0f37-4db1-b527-bc4d62cc0f21"), "Your own might mingles with divine power to protect you. You gain resistance equal to 8 plus your Strength modifier against all damage from the triggering attack or effect.", 0 },
                    { new Guid("db1dd925-57f7-408a-bb9a-6b73dda883a8"), 0, new Guid("fd891d12-a7c1-4fc6-826e-0d862175d4fd"), "A massive deluge of life energy causes the undead to fall apart. Each undead creature in the area takes 4d12 positive damage.", 0 },
                    { new Guid("9ee01086-1ee3-4d80-889e-97e4cc73ca20"), 0, new Guid("5a4ec9f8-4e49-47e2-8cbc-6cc766759271"), "While in a crowd of roughly similar creatures, your appearance becomes bland and nondescript. You gain a +2 status bonus to Deception and Stealth checks to go unnoticed among the crowd, and you ignore difficult terrain caused by the crowd.", 0 },
                    { new Guid("e592b767-da46-48f3-821a-96c3439278fb"), 0, new Guid("790901b2-edb3-46e3-bfcc-fdef8c10efaf"), "A blazing band of fire arcs through the air. Make a spell attack roll. The ray deals 2d6 fire damage.", 0 },
                    { new Guid("c4cfeee0-9d24-4ab7-8a34-a6971c265f40"), 0, new Guid("d841d8d6-8dbe-42a4-bd92-d4533302ce1a"), "You swiftly deflect incoming flames. The target gains fire resistance 15 against the triggering effect.", 0 },
                    { new Guid("2e12497d-6af4-4ff1-8c63-41d67b86579d"), 0, new Guid("0c342b5d-8f99-466b-8f45-dc92f0c539cd"), "You quiet the target’s voice, preventing it from giving away valuable secrets. This doesn’t prevent the target from talking or providing verbal spell components, but no creature more than 10 feet away can hear its whispers without succeeding at a Perception check against your spell DC, which might interfere with auditory or linguistic effects as well as communication. The spell’s duration depends on the target’s Fortitude save. After attempting its save, the target becomes temporarily immune for 24 hours.", 0 },
                    { new Guid("23ead71d-4f43-4e24-94ff-8aa5b1ebfdcd"), 0, new Guid("25ada8e9-89ac-4106-aa58-7dab9d690629"), "Divine insight lets you see things as they truly are. The GM attempts a secret counteract check against each illusion that is at least partially within the area. Instead of counteracting the illusion, you see through it (for instance, if the check succeeds against an illusory disguise spell, you see the creature’s true form but illusory disguise doesn’t end).", 0 },
                    { new Guid("30bc0221-72ba-414f-9cc1-2c17459da25a"), 1, new Guid("25ada8e9-89ac-4106-aa58-7dab9d690629"), "The area moves with you for the duration of the spell, and the GM attempts a secret counteract check each time a new illusion is within the area.", 0 },
                    { new Guid("ac356683-d3cc-48b4-944e-6cd7d7a9744f"), 0, new Guid("9f884f0c-0795-42e8-8389-5993e0fcea4c"), "Your words bless a creature with an enhanced connection to positive energy. When the target regains Hit Points from a healing spell, it regains 2 additional Hit Points.", 0 },
                    { new Guid("2e9dda41-cda9-49df-b53d-fef01907e0a3"), 1, new Guid("9f884f0c-0795-42e8-8389-5993e0fcea4c"), "The target regains additional Hit Points from healer’s blessing only the first time it regains HP from a given healing spell, so a spell that heals the creature repeatedly over a duration would restore additional Hit Points only once.", 0 },
                    { new Guid("93d8782b-10ea-4989-bf52-7bf9a92bde46"), 0, new Guid("0808dc98-d5f9-4a23-b82e-7d7161418675"), "You evoke a magical stone and throw it, with your god’s presence guiding your aim. Make a spell attack roll against the target. The stone deals bludgeoning damage equal to 1d6 plus your Strength modifier.", 0 },
                    { new Guid("5f1933d7-ca3c-4034-9127-84bbe463d0fb"), 0, new Guid("5377e30c-90c3-4782-9684-7f460c199538"), "You quickly remind yourself of useful information. Use a Recall Knowledge action, rolling the appropriate skill check to identify the triggering creature’s abilities. You can roll your check twice and use the better result.", 0 },
                    { new Guid("9097a856-798e-40e5-a9e2-71c19dfd5a0c"), 7, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Undo - The rope undoes one of its knots, ties, or bindings.", 2 },
                    { new Guid("b4494f03-6d3b-4d2f-8ed0-8c7a28c58a9a"), 6, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Tie - The rope ties itself around a willing creature or an object that’s unattended or attended by a willing creature.", 2 },
                    { new Guid("36eebd9d-09df-4a2d-92b8-e26976330dd2"), 5, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Loop - The rope forms a simple loop at one or both ends, or straightens itself back out.", 2 },
                    { new Guid("6e544307-5cee-4b13-bbb2-5d874aedf86f"), 4, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Knot - The rope ties a sturdy knot in itself.", 2 },
                    { new Guid("a87c1fec-149d-46ee-879f-c5df4c750b89"), 0, new Guid("4c09c609-8f31-4dd4-a809-35e8372d978d"), "Swirling sands of divine devastation surround you, weakening the defenses of all they touch. Reduce the resistances of yourself and creatures in the area by 2.", 0 },
                    { new Guid("8615309c-8bcc-4d24-976c-26157b6058f3"), 3, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Crawl - The rope inches along the ground like a snake, moving one of its ends 10 feet. The rope must move along a surface, but that surface doesn’t need to be horizontal.", 2 },
                    { new Guid("08a0579d-e71d-4c5a-a073-c85951ff21d3"), 0, new Guid("965001ca-132d-4647-94c7-5502677056df"), "You make the target overconfident, leading it to ascribe failure to external factors. If the target fails at an attack roll or skill check, it takes a –1 status penalty to attack rolls and skill checks until the end of its turn (or the end of its next turn, if it attempted the roll outside its turn). If the creature fails a second time while taking this penalty, the penalty increases to –2. The duration depends on the target’s Will save. After attempting its save, the creature becomes temporarily immune for 24 hours.", 0 },
                    { new Guid("2f1b7a2c-71e2-46b6-8529-b03d43016e5c"), 0, new Guid("dd619009-2808-4069-8d47-f65cafe32de7"), "You raise your religious symbol and create a blinding flash of light. Each creature in the area must attempt a Fortitude save.", 0 },
                    { new Guid("9f341db5-becc-475f-9864-558b48c2bf5b"), 0, new Guid("23939a89-110d-4b11-be4d-42d9d5ea2f92"), "Your litany denounces an evildoer, rendering it susceptible to the powers of good. The target gains weakness 7 to good. The target then becomes temporarily immune to all of your litanies for 1 minute.", 0 },
                    { new Guid("8f7fba5f-96f8-4c39-8243-9173143deb9c"), 0, new Guid("d7c54b2d-8134-4394-ba84-9a8200e3a906"), "The blessings of your god make your feet faster and your movements more fluid. You gain a +5-foot status bonus to your Speed and ignore difficult terrain. As part of casting agile feet, you can Stride or Step; you can instead Burrow, Climb, Fly, or Swim if you have the appropriate Speed.", 0 },
                    { new Guid("28e5b8d0-21c9-46f1-b346-1f5a70a64dae"), 0, new Guid("87972b11-0738-4bfe-8ce2-54a9a1353e43"), "You create a brief vision of immense wealth filling the spell’s area. Each creature within 20 feet of the area that could be enticed by material wealth must attempt a Will saving throw. A creature that enters the area automatically disbelieves the illusion, and disbelieving the illusion ends any fascinated condition imposed by the spell. As long as you Sustain the Spell, other creatures react to the treasure like they would any other illusion, but they are not at risk of becoming fascinated.", 0 },
                    { new Guid("d1861d8d-f488-4d53-b7b3-1b2bec0fdb8c"), 0, new Guid("c52a8124-b2ad-42f4-9716-2a3862a80bb3"), "You transform the target to make it match your artisanal and artistic vision. If you have expert proficiency in Crafting, the item grants a +1 item bonus to attack rolls if it’s a weapon or skill checks if it’s a skill tool. The target is a beautiful and impressive piece for its new quality, but the effect is obviously temporary, so its monetary value doesn’t change.", 0 },
                    { new Guid("d25e4d33-ec61-418f-bb45-ef9d8848e598"), 1, new Guid("c52a8124-b2ad-42f4-9716-2a3862a80bb3"), "When you cast this spell, any previous artistic flourish you had cast ends.", 0 },
                    { new Guid("14df23ce-9c2f-4acd-860e-31c1edf92de8"), 0, new Guid("c64c83c7-6c0d-4321-a93a-bfb597bed961"), "Your body fills with physical power and skill. You gain a +10- foot status bonus to Speed and a +2 status bonus to Athletics checks. As a part of Casting this Spell, you can use a Stride, Leap, Climb, or Swim action. The spell’s bonuses apply during that action.", 0 },
                    { new Guid("9b962b42-8441-47b4-b19d-7b5319df1f81"), 0, new Guid("3364c015-16b1-425d-986c-e93f5974a25e"), "You tilt the scales of luck slightly to protect a creature from disaster. When the target would attempt a saving throw, it can roll twice and use the better result. Once it does this, the spell ends.", 0 },
                    { new Guid("2ace6c08-8e19-4ba3-8183-79aed4016fb8"), 1, new Guid("3364c015-16b1-425d-986c-e93f5974a25e"), "If you cast bit of luck again, any previous bit of luck you cast that’s still in effect ends. After a creature has been targeted with bit of luck, it becomes temporarily immune for 24 hours.", 0 },
                    { new Guid("6e6c12d7-bd68-4c3e-baeb-d0694991b992"), 0, new Guid("a77e9671-1f54-4594-8b24-6dbfe6f9ddae"), "You strengthen a target’s ambition, increase its resentment of allies, and make its allegiances more susceptible to change. The target must attempt a Will save.", 0 },
                    { new Guid("7684a9a2-0391-481c-97fd-381a3764d20e"), 0, new Guid("dc2be0a2-7409-4d88-8449-8b9557854c1a"), "You become intensely entrancing, and creatures are distracted by you as long as they remain within the area. You can exclude any creatures you choose from the effects.", 0 },
                    { new Guid("8d6f3de3-30e7-4401-881a-483a5f4ce195"), 1, new Guid("dc2be0a2-7409-4d88-8449-8b9557854c1a"), "When a creature enters the area for the first time, it must attempt a Will saving throw. If a creature leaves and reenters, it uses the results of its original save.", 0 },
                    { new Guid("8f42e1a0-c76a-46a4-8e54-fef92a9447d6"), 0, new Guid("0441689e-2d5a-48fc-ae13-2ce811e11a1a"), "You infuse your target with attraction, causing it to act friendlier toward you. The target attempts a Will save. It gains a +4 circumstance bonus to this save if you or your allies recently threatened or were hostile to it.", 0 },
                    { new Guid("847dd537-df9a-474e-ac76-3c29384ae53e"), 1, new Guid("0441689e-2d5a-48fc-ae13-2ce811e11a1a"), "You can Dismiss the spell. If you use hostile actions against the target, the spell ends. After the spell ends, the target doesn’t necessarily realize it was charmed unless its friendship with you or the actions you convinced it to take clash with its expectations, which could potentially allow you to convince the target to continue being your friend via mundane means.", 0 },
                    { new Guid("4d6cfb4d-d866-410a-a470-2dfc1e883b3c"), 0, new Guid("8726f5f3-20ee-4612-87e9-d17e867962b3"), "You drape the target in a mantle of swirling shadows that make it harder to see. The cloak reduces bright light within a 20-foot emanation to dim light. This is a form of magical darkness and can therefore overcome non-magical light or attempt to counteract magical light as described on page 458 of the Core Rulebook.", 0 },
                    { new Guid("a1641e3d-6ed9-46df-b4fe-a44e62f2f3ea"), 1, new Guid("8726f5f3-20ee-4612-87e9-d17e867962b3"), "The target can use concealed condition gained from the shadows to Hide, though observant creatures can still follow the moving aura of shadow, making it difficult for the target to become completely undetected. The target can use an Interact action to remove the cloak and leave it behind as a decoy, where it remains, reducing light for the rest of the spell’s duration. If anyone picks up the cloak after it’s been removed by the original target, the cloak evaporates and the spell ends.", 0 },
                    { new Guid("91d21191-eee1-4700-b812-b716e84c5126"), 0, new Guid("181e6ff7-3975-474a-afc8-0134b64eb336"), "With the threat of more pain, you compel a creature you’ve recently harmed. You issue a command to the target, with the effects of the spell command.", 0 },
                    { new Guid("d7e64c98-103b-457e-8a7a-97603fa8ccdb"), 0, new Guid("9bf07bd2-5619-4669-aff9-6dee9f939629"), "Your competitiveness drives you to prove yourself against the opposition. You gain a +1 status bonus to attack rolls and skill checks. If an enemy within 20 feet critically succeeds at an attack roll or skill check, your status bonus increases to +3 attack rolls or that specific skill check (whichever the foe critically succeeded at) for 1 round.", 0 },
                    { new Guid("7d3c13bb-010a-49fd-97d5-b0abb0fdcd7a"), 0, new Guid("799acd96-bf9f-44ea-b9e0-fb0adf452fd2"), "Your voice booms, smashing what’s in front of you. Each creature and unattended object in the area takes 1d8 sonic damage. If you already dealt damage to an enemy this turn with a Strike or spell, increase the damage dice from this spell to d12s.", 0 },
                    { new Guid("0d4fe2f8-c5aa-448c-beae-61e60d910bd1"), 0, new Guid("b84325e2-a86f-4202-b268-ab755204d7e1"), "You infuse a creature’s vision with darkness. After attempting its save, the target becomes temporarily immune for 24 hours.", 0 },
                    { new Guid("07eddc65-7da8-45f3-b294-72069a9abbea"), 0, new Guid("10a5b873-c7bf-48cf-96cc-3afe69d7664b"), "Seeing another pass from this world to the next invigorates you. You gain temporary Hit Points equal to the triggering creature’s level plus your spellcasting ability modifier. If the triggering creature was undead, double the number of temporary Hit Points you gain . These last for the duration of the spell, and the spell ends if all the temporary Hit Points are depleted earlier.", 0 },
                    { new Guid("4c108a13-0b1e-4bce-9655-fb15a599553a"), 0, new Guid("43cd8c45-8865-4690-bddd-0f8401e88ba9"), "Your litany rails against the sin of sloth, interfering with the target’s ability to react. The target must attempt a Will save. A particularly slothful creature, such as a sloth demon, uses the outcome one degree of success worse than the result of its saving throw. The target becomes temporarily immune to all of your litanies for 1 minute.", 0 },
                    { new Guid("5a507497-a087-40c3-a857-248933c2d816"), 2, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Coil - The rope forms a tidy, coiled stack.", 2 },
                    { new Guid("afc0dee8-afa8-4305-ba16-16683aa509c7"), 0, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "You cause a length or section of rope or a rope-like object to animate and follow simple commands. You can give it two commands when you Cast the Spell, and one command each time you Sustain the Spell.", 0 },
                    { new Guid("9511d280-6294-4066-a476-5c96b395c7ec"), 0, new Guid("cfbc43c2-20e0-4693-bb22-6cea19de9663"), "You shine a ray of moonlight. Make a spell attack roll. The beam of light deals 1d6 fire damage. Moonbeam deals silver damage for the purposes of weaknesses, resistances, and the like.", 0 },
                    { new Guid("8dbc8a0b-889d-45cc-9166-8160d5b4fa89"), 0, new Guid("60c7b403-9464-4305-921f-0fd8445f1fe0"), "The next damaging or healing spell the target casts before the start of your next turn deals damage or restores Hit Points as if the spell were heightened 1 level higher than its actual level. The spell otherwise functions at its actual level. Once the target casts the spell, mystic beacon ends.", 0 },
                    { new Guid("8df347e0-eb22-412a-9368-d0afa84c86c6"), 0, new Guid("19431276-6477-437a-a6a6-04b51b29cd18"), "A palm-sized raw fruit or vegetable appears in your open hand. You choose the specific type of food. A creature can consume the food with an Interact action to regain 3d10+12 Hit Points and be nourished as if it had eaten a meal. If uneaten, the food rots and crumbles to dust after 1 minute.", 0 },
                    { new Guid("b306b8c5-a272-4278-b7c8-bfa40c406882"), 0, new Guid("ed10a7d4-1078-4d14-af96-b4ed9a03a5ab"), "Huge amounts of food and drink fill the target. It receives a full meal’s worth of nourishment and must attempt a Fortitude save.", 0 },
                    { new Guid("bf085581-8105-4736-ac8a-42b8a99ca37c"), 1, new Guid("ed10a7d4-1078-4d14-af96-b4ed9a03a5ab"), "A target sickened by this spell takes a –10-foot status penalty to its Speed until it’s no longer sickened.", 0 },
                    { new Guid("97f6203f-83db-4301-98db-0abe72b0b346"), 0, new Guid("97fde3d9-4ac8-4ad7-9813-fdc8cd1b149b"), "Reroll the saving throw and use the better result.", 0 },
                    { new Guid("024367a6-53de-4752-afae-2409c7611b70"), 0, new Guid("162dc2ed-c6c0-4af2-a9d3-225eac826afe"), "You meditate upon perfection to remove all distractions from your mind. Attempt a new Will save against one mental effect currently affecting you that required a Will save. Use the result of this new save to determine the outcome of the mental effect, unless the new save would have a worse result than the original save, in which case nothing happens. You can use perfected mind against a given effect only once.", 0 },
                    { new Guid("98c8deed-43b8-474a-a0f6-254a49a7bc45"), 0, new Guid("d2439bc1-10f4-48d4-859c-bbc9ba5c7acd"), "Drawing life force into yourself, you become a beacon of positive energy. You glow with bright light in a 10-foot emanation, and you gain an internal pool of light called a luminance reservoir, which begins with a value of 4. At the start of each of your turns, you can use a free action to increase the luminance reservoir by 4. If you do, the radius of your light increases by 10 feet.", 0 },
                    { new Guid("3452cac0-7512-4ff3-9ce4-7bd150f1714a"), 1, new Guid("d2439bc1-10f4-48d4-859c-bbc9ba5c7acd"), "If an undead creature damages you with an attack or spell while it’s within the area of your light, that creature takes positive damage equal to half your luminance reservoir value. It takes this damage only the first time it damages you in a round.", 0 },
                    { new Guid("a344aa7c-8122-43d1-9601-deae344cbc16"), 2, new Guid("d2439bc1-10f4-48d4-859c-bbc9ba5c7acd"), "You can Dismiss this Spell. When you do, you can target a creature within your light and direct the positive energy into it. The target must be a willing living creature or an undead creature. This heals a living target or damages an undead target by an amount equal to your luminance reservoir’s value.", 0 },
                    { new Guid("5f7f9bcd-1a9b-47bc-bfb2-4d464da4217f"), 3, new Guid("d2439bc1-10f4-48d4-859c-bbc9ba5c7acd"), "When you cast positive luminance, any other positive luminance spell you already had in effect ends.", 0 },
                    { new Guid("fb8fcb88-0c4d-45f8-a5d3-2bc17bdc6f94"), 0, new Guid("c8a339ea-1f88-4d4c-aea8-945599b99cfd"), "Your deity blesses base metals to transform them into precious materials. The target item transforms from its normal metal into cold iron, copper, gold, iron, silver, or steel (the details for these metals are found on pages 577–579). An item transmuted in this way deals damage according to its new material. For example, a steel sword transmuted to cold iron would deal additional damage to a creature with a weakness to cold iron.", 0 },
                    { new Guid("d7cbecd5-384e-42ad-a688-5730e4a45f9b"), 1, new Guid("c8a339ea-1f88-4d4c-aea8-945599b99cfd"), "This change is clearly magical and temporary, so the item’s monetary value doesn’t change; you couldn’t transmute copper coins to gold and use those coins to purchase something or as a cost for a spell.", 0 },
                    { new Guid("2befd5cf-8db5-4c7d-b3bb-b7bfa9e9b018"), 0, new Guid("3378bac9-961e-47fe-ba8b-5a169ad7f879"), "You protect your ally by suffering in their stead. Reduce the damage the triggering ally would take by 3. You redirect this damage to yourself, but your immunities, weaknesses, resistances and so on do not apply.", 0 },
                    { new Guid("bab2821a-408e-45df-8a18-373362a08c28"), 1, new Guid("3378bac9-961e-47fe-ba8b-5a169ad7f879"), "You aren’t subject to any conditions or other effects of whatever damaged your ally (such as poison from a venomous bite). Your ally is still subject to those effects even if you redirect all of the triggering damage to yourself.", 0 },
                    { new Guid("68dd6f78-7681-41af-905f-a2388286f3f1"), 0, new Guid("bd0e4e43-3d47-4e47-8d4a-d60607fef58e"), "A protective aura emanates out from you, safeguarding you and your allies. You gain resistance 3 to all damage. Your allies also gain this resistance while they are within the area.", 0 },
                    { new Guid("28ca78ff-adb7-494e-85a7-ffd3eacb2768"), 0, new Guid("e2f1fa09-874f-44d3-9ad8-bb11f469bae4"), "You tap into the zeitgeist of the nearest settlement in range (if any). You learn the name of the settlement, and you can utter a special word to learn a brief summary of one significant event happening in the settlement. Choose one of the following words, which indicates the type of people involved and type of event you learn about.", 0 },
                    { new Guid("63d2c516-9366-4782-8770-3ae357ae52b9"), 1, new Guid("e2f1fa09-874f-44d3-9ad8-bb11f469bae4"), "Wardens - City guards, barristers, and judges (criminal reports, busts, changes in routines, legal trials)", 2 },
                    { new Guid("0e761880-475f-4fb2-8cce-9ae2cf4a97e8"), 2, new Guid("e2f1fa09-874f-44d3-9ad8-bb11f469bae4"), "Titles - Nobles and politicians (high society weddings, elite soirees, political rallies)", 2 },
                    { new Guid("3ce9640b-20df-4548-a55e-427148d7ff52"), 0, new Guid("c65f18e1-0073-486d-bc04-4793f8539bae"), "You embed a seed of negative energy in an undead creature, restoring its unnatural vigor. The target gains fast healing 7. This healing comes from negative energy, so it heals the undead rather than damaging it.", 0 },
                    { new Guid("cf5e76ef-7194-49da-a89d-bf8bac8e05dc"), 1, new Guid("759f85fa-7a3f-47da-a242-b699ee09c07b"), "Bind - (attack) The rope attempts to partially bind a creature. Attempt a spell attack roll against the target’s Reflex DC. If you succeed, the target takes a –10-foot circumstance penalty to its Speed (–20-foot on a critical success). This ends if the target Escapes against your spell DC or breaks the rope. (A standard adventuring rope has Hardness 2, HP 8, and a Broken Threshold of 4.)", 2 },
                    { new Guid("2e6bff71-0f0a-457f-bf36-ddae1c077a56"), 0, new Guid("8414f0b4-31c1-473e-a44b-cdb6c10a8ab0"), "A creature becomes a receptacle for pure magical energy sentby your deity. The target gains a +1 status bonus to saving throws. Each time you Cast a Spell from your spell slots, you automatically Sustain this Spell and grant its target resistance to damage from spells until the start of your next turn. This resistance is equal to the level of the spell you cast.", 0 },
                    { new Guid("96942c90-ad6d-474f-93bf-faaecaafae58"), 0, new Guid("192b652f-92d5-4fd6-83b8-9001e2d7ae3e"), "You shake the earth, toppling nearby creatures. Choose whether the spell’s area is a 15-foot emanation or a 15-foot cone when you cast it. Each creature in the area standing on solid ground may take 4d6 bludgeoning damage and must attempt a Reflex saving throw.", 0 },
                    { new Guid("bbc6ae9c-5a1d-4de2-9904-4814c40cdfdd"), 0, new Guid("e3b20a74-a9ee-4040-845b-9a8952da99b4"), "Your magic dredges up a corpse or skeleton and fills it with necromantic life, and you force the dead to fight at your command. You summon a common creature that has the undead trait and whose level is –1; this creature gains the summoned trait. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("09fd8ec7-ce0c-4d6d-8a79-b43f3dbacf29"), 0, new Guid("d410d3c1-fc7f-413e-9485-40d55d01b5ab"), "You use your mind to manipulate unattended objects in the area, temporarily animating them to attack. The objects hover in the air, then hurl themselves at nearby creatures in a chaotic flurry of debris. This assault deals 2d10 bludgeoning damage (basic Reflex save) to each creature in the area. On subsequent rounds, you can Sustain this Spell, dealing 1d10 bludgeoning damage (basic Reflex save) to each creature in the area.", 0 },
                    { new Guid("3c6182fb-7575-4228-9ea3-e320836380f4"), 0, new Guid("28398964-187e-44ff-89e7-8d58042832c7"), "Your target’s mind tumbles down a deep well of dread, dwelling so intently on deep-seated fears that it’s painful. The target takes 4d6 mental damage with a Will saving throw.", 0 },
                    { new Guid("168f9784-bdee-49c2-8215-a8b8b58965ed"), 4, new Guid("b7240ad4-33a6-4720-848e-ef942b1139d7"), "The target takes a –1 status penalty to its saving throws.", 2 },
                    { new Guid("f30038b8-e268-4879-ae15-57a09a3968dd"), 3, new Guid("b7240ad4-33a6-4720-848e-ef942b1139d7"), "The target takes a –10-foot status penalty to all its Speeds.", 2 },
                    { new Guid("5dad7b84-b24e-4643-9a40-ce363fb85665"), 2, new Guid("b7240ad4-33a6-4720-848e-ef942b1139d7"), "The target’s resistances are reduced by 5.", 2 },
                    { new Guid("c16db883-a368-457e-9a5d-f70fb4067dc0"), 1, new Guid("b7240ad4-33a6-4720-848e-ef942b1139d7"), "The target gains weakness 5 to one energy type of your choice.", 2 },
                    { new Guid("0a0a168d-340d-4b53-8866-fe2a98c129b2"), 0, new Guid("b7240ad4-33a6-4720-848e-ef942b1139d7"), "You focus your magic upon an enemy, wishing for their defenses to fail and turning their strengths into weaknesses. The target must attempt one Will saving throw for all of the following effects.", 0 },
                    { new Guid("14d04320-bf8d-4ba3-a58f-d6c1eb38b5d9"), 0, new Guid("da0e4506-bacf-4e0d-9f16-508d69f27450"), "You steal a creature’s shadow, leaving it weakened and vulnerable.The target must attempt a Fortitude save.", 0 },
                    { new Guid("ef9423d2-c839-4814-b506-116eb6459bfe"), 0, new Guid("ea651e8d-ff1d-4b4b-93c1-8b0b429a5157"), "You draw an occluding veil of spirits around yourself, blocking yourself especially well from undead eyes. You become concealed to all creatures, and you are hidden from undead creatures regardless of what precise senses they have; this grants the effects of invisibility, but against all the undead creature’s precise senses. If you physically interact with an undead creature or use a hostile action, the spell ends.", 0 },
                    { new Guid("d82064ba-78ea-4c4f-a57c-c63351b0d821"), 0, new Guid("d938da98-9d48-4d3c-a94e-f28c260fbe97"), "You stay the hand of fate for one not yet destined to die, sacrificing some of your own vitality to heal them. You lose up to 15 Hit Points as a sacrifice, and the target reduces the damage by twice the number of Hit Points sacrificed. If this reduction exceeds the amount of damage, the target recovers Hit Points equal to the excess amount.", 0 },
                    { new Guid("f528a113-5021-4e36-8408-41569947e728"), 0, new Guid("7d43752d-dbc7-4401-8260-0f3db0d3eb6f"), "You manifest a supernatural funerary mask, granting you a +1 status bonus to Will saving throws against emotion effects for 1 minute. Its somber countenance forces your foes to confront their regrets and sins. Each enemy in the area when you Cast the Spell or that starts its turn in the area takes 1d4 mental damage and must attempt a Will save.", 0 },
                    { new Guid("e9d3392d-696b-4ea4-b87a-69dc6847621b"), 0, new Guid("3001e7d6-960a-4118-9d3b-a971b83c51cb"), "You grant an ally a token of favor. You create a token, such as a lock of your hair or a flower, that persists for the spell’s duration; as part of Casting the Spell, you can Interact to pass the token to an ally within your reach. As long as the ally has the token on their person, they gain a +1 status bonus to Performance checks and Will saves. You can Dismiss the spell as a free action.", 0 },
                    { new Guid("f76739b4-a175-4edf-b50f-e4a286ad8f2e"), 0, new Guid("12b35d4a-e05c-476d-a7d6-57a7beddeb28"), "You surround your target with wondrous illusions of their greatest desires, which distract them from reality. The target must attempt a Will save.", 0 },
                    { new Guid("2b7f86a9-5332-47ab-a209-f59bde3b053f"), 0, new Guid("96f8d568-d477-42dc-ac59-0ac64b7ee25e"), "With a flourish, you fulfill a creature’s wish for protection, bending reality to keep them from harm. The target vanishes in a burst of brightly colored smoke and sparkles, reappearing an instant later. They become concealed against the triggering attack and until the end of the current creature’s turn.", 0 },
                    { new Guid("d8e5760f-99bd-42a3-97ed-2842ff3206ab"), 1, new Guid("d7fae3da-a6ec-4a1d-a907-62786bd02dd0"), "Upon Casting the Spell, you can immediately make a single nature’s wrath Strike. You are quickened while inside the ward, and can use the additional action only to make nature’s wrath Strikes. You are slowed 1 while outside the area.", 0 },
                    { new Guid("e0580045-3e46-427d-8308-397250cd880f"), 0, new Guid("d7fae3da-a6ec-4a1d-a907-62786bd02dd0"), "You bind a part of your essence to your surroundings, creating a warded area that grants you power within it, but drains you outside of it. While within the area, you can make nature’s wrath Strikes by commanding plants, wind, rocks, and other natural features to attack enemies. These are melee Strikes that use your spell attack modifier, can target any creature within the ward, and deal bludgeoning, piercing, or slashing damage equal to 2d8 plus your spellcasting ability modifier.", 0 },
                    { new Guid("2b89c636-fa36-45a1-b4a6-d3d2dadcb0d5"), 0, new Guid("c2d250d7-a185-4ff7-9ab8-aded8d0bdcf4"), "You magnify the darkness from the triggering effect, causing the ambient light level to flicker briefly so you can slip from sight. You can immediately attempt a Stealth check to Hide, and you can become hidden to a creature even if you don’t have cover and aren’t otherwise concealed from that creature. You cease being hidden at the end of your turn unless you move into cover or become concealed before then.", 0 },
                    { new Guid("f16f25e0-bf73-4cab-b018-7af2daba561c"), 0, new Guid("7012c0eb-05c1-453e-8b87-411bcde2ec1a"), "Your shadow wriggles before spreading out from you, forming a gateway of clinging, consuming shadow through which the horrors of another plane can barely be seen. The first time each turn you Sustain the Spell, the radius increases by 5 feet. Each enemy that enters the area or begins its turn in the area takes 2d6 negative damage and must attempt a Reflex save.", 0 },
                    { new Guid("9c839c7d-2805-46f2-9c9a-6ab1b843a27e"), 0, new Guid("f000b642-63af-4e5a-b206-ad0e96936b43"), "Reroll the saving throw and use the better result. You then become temporarily immune for 10 minutes.", 0 },
                    { new Guid("1110786e-2e86-40f3-89de-b04391623a6c"), 5, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "One or more attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +13, and your damage bonus is +2. These attacks are Strength based (for the purpose of the enfeebled condition). If your unarmed attack modifier is higher, you can use it instead.", 2 },
                    { new Guid("2db2817f-1538-4da6-a3b8-07f79e1101ab"), 2, new Guid("92b36046-a4b4-40ab-97c4-9df1bd3f4281"), "Shaking Ground - The ground is difficult terrain, and creatures on it take a –2 circumstance penalty to attack rolls, AC, and skill checks.", 2 },
                    { new Guid("0ce9ab24-b192-489e-ae3b-65b59df128b2"), 7, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "You also gain specific abilities based on the form you choose:", 0 },
                    { new Guid("ff6ab978-65d2-4673-b87d-01e26c93898b"), 0, new Guid("3ba05e95-d555-4604-be1e-7dc79909d3c2"), "You conjure a celestial to fight for you. You summon a common creature that has the celestial trait and whose level is 5 or lower, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("696556a2-d986-42a0-bb8d-8c530c52e0fc"), 0, new Guid("b010e111-5fcd-40c1-9271-3443906af0f5"), "You conjure an animal to fight for you. You summon a common creature that has the animal trait and whose level is –1, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("4f31c4c5-2c3a-4b83-b6e8-8c60d9219756"), 0, new Guid("e3535989-0eca-4992-84dc-48515ad2edf3"), "Your honeyed words are difficult for creatures to resist. You suggest a course of action to the target, which must be phrased in such a way as to seem like a logical course of action to the target and can’t be self-destructive or obviously against the target’s self-interest. The target must attempt a Will save.", 0 },
                    { new Guid("cce13644-36ce-4b3a-951e-f4f16184fcd2"), 0, new Guid("fd5cb944-c8a1-45b5-88b3-169c48550720"), "You implant a subconscious suggestion deep within the target’s mind for them to follow when a trigger you specify occurs (as described on page 305). You suggest a course of action to the target. Your directive must be phrased in such a way as to seem like a logical course of action to the target, and it can’t be selfdestructive or obviously against the target’s self-interest. The target must attempt a Will save.", 0 },
                    { new Guid("1c86472c-fa6f-45e6-aaf7-e4cd5bef036e"), 5, new Guid("94086e1d-52d0-4b8f-89c6-af6597fcd75c"), "Thunderclap - Each creature in the storm must succeed at a Fortitude save or be deafened for 10 minutes. A creature that succeeds is temporarily immune to thunderclaps from storm of vengeance for 1 hour.", 2 },
                    { new Guid("0f9e8d44-5d43-4b60-9926-1d811b1f98fb"), 4, new Guid("94086e1d-52d0-4b8f-89c6-af6597fcd75c"), "Rain and Wind - Heavy rain and whipping wind reduce visibility and mobility, making the area under the storm cloud difficult terrain and making everything seen within or through the area concealed.", 2 },
                    { new Guid("1264c103-896b-496b-a32d-47c76bbfa42c"), 3, new Guid("94086e1d-52d0-4b8f-89c6-af6597fcd75c"), "Lightning - Up to 10 bolts of lightning strike down, targeting creatures of your choice in the storm. No more than one bolt can target any one creature. Each bolt deals 7d6 electricity damage (basic Reflex save).", 2 },
                    { new Guid("cc5d3c24-f5f3-4ede-a9aa-6baa4934785d"), 2, new Guid("94086e1d-52d0-4b8f-89c6-af6597fcd75c"), "Hail - The storm deals 4d10 bludgeoning damage to creatures beneath it(basic Fortitude save).", 2 },
                    { new Guid("e935ce38-d203-4bac-94fd-35d15e4e4c99"), 1, new Guid("94086e1d-52d0-4b8f-89c6-af6597fcd75c"), "Acid Rain - Each creature in the storm takes 4d8 acid damage with no saving throw.", 2 },
                    { new Guid("fe040b5e-64f9-4328-ae35-e7122e26a024"), 0, new Guid("94086e1d-52d0-4b8f-89c6-af6597fcd75c"), "A massive storm cloud forms in the air in a 360-foot burst. Beneath it, rain begins to fall, and gales impose a –4 circumstance penalty to physical ranged attacks and weapon ranged attacks, and the air in the area becomes greater difficult terrain for flying creatures. When you Cast this Spell and the first time each round you Sustain the Spell, you can choose one of the following storm effects. You can’t choose the same effect twice in a row.", 0 },
                    { new Guid("9374ed73-e410-426d-9175-e04b4237a7b9"), 0, new Guid("568227e8-aaba-4cbd-9db1-6278cb9c3e9b"), "Manipulating the fundamental particles of matter, you convert stone into flesh and blood. You restore a petrified creature to its normal state or transform a stone object into a mass of inert flesh (without stone’s Hardness) in roughly the same shape.", 0 },
                    { new Guid("1d613f3f-d1fb-4d11-a215-1fed8828a60b"), 0, new Guid("181717d7-fbb3-448c-9d15-91d5e9c74b77"), "You can ask questions of and receive answers from natural or worked stone. While stone is not intelligent, you speak with the natural spirits of the stone, which have a personality colored by the type of stone, as well as by the type of structure the stone is part of, for worked stone. A stone’s perspective, perception, and knowledge give it a worldview different enough from a human’s that it doesn’t consider the same details important. Stones can mostly answer questions about creatures that touched them in the past and what is concealed beneath or behind them.", 0 },
                    { new Guid("304ef339-78c1-4448-8e98-f6a082763331"), 0, new Guid("0cf744a4-ce77-44f4-8dab-48679fa1ebea"), "You conjure an construct to fight for you. You summon a common creature that has the construct trait and whose level is –1, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("73a841fd-02f4-40d5-a0ee-7dbd631288a7"), 0, new Guid("fdba9c6f-2d28-4d82-b275-713e6b118cd0"), "The target’s skin hardens like stone. It gains resistance 5 to physical damage, except adamantine. Each time the target is hit by a bludgeoning, piercing, or slashing attack, stoneskin’s duration decreases by 1 minute.", 0 },
                    { new Guid("7d2779d2-610e-4afc-888a-14d72eb1bbcb"), 0, new Guid("f66871da-39f0-4faf-9d75-04cbddbe301e"), "As long as you and the target are on the same plane ofexistence and both alive, you remain aware of its present state. You know the target’s direction from you, distance from you, and any conditions affecting it.", 0 },
                    { new Guid("67ce3858-4860-4366-8ba7-9140cb36e280"), 0, new Guid("547992e6-0651-48b5-b1bc-3ffdf18a996f"), "Positive energy shuts death’s door. The target loses the dying condition, though it remains unconscious at 0 Hit Points.", 0 },
                    { new Guid("5d1473f8-70e7-4243-a430-fc9bb5085af1"), 3, new Guid("3fa5699a-c4fb-48be-a845-c3153120c75a"), "The weapon doesn’t take up space, grant flanking, or have any other attributes a creature would. The weapon can’t make any attack other than its Strike, and feats or spells that affect weapons do not apply to it.", 0 },
                    { new Guid("272756e1-6e9a-4e23-b45e-6915791faacc"), 2, new Guid("3fa5699a-c4fb-48be-a845-c3153120c75a"), "The weapon’s Strikes are melee spell attacks. Regardlessof its appearance, the weapon deals force damage equal to 1d8 plus your spellcasting ability modifier. You can deal damage of the type normally dealt by the weapon instead of force damage (or any of the available damage types for a versatile weapon). No other statistics or traits of the weapon apply, and even a ranged weapon attacks adjacent creatures only. Despite making a spell attack, the spiritual weapon is a weapon for purposes of triggers, resistances, and so forth.", 0 },
                    { new Guid("003f0157-31df-4db4-b3bf-df829726abbd"), 1, new Guid("3fa5699a-c4fb-48be-a845-c3153120c75a"), "When you cast the spell, the weapon appears next to a foe you choose within range and makes a Strike against it. Each time you Sustain the Spell, you can move the weapon to a new target within range (if needed) and Strike with it. The spiritual weapon uses and contributes to your multiple attack penalty.", 0 },
                    { new Guid("8a5d689b-0c55-4134-a648-0345562df7ff"), 0, new Guid("3fa5699a-c4fb-48be-a845-c3153120c75a"), "A weapon made of pure magical force materializes and attacks foes you designate within range. This weapon has a ghostly appearance and manifests as a club, a dagger, or your deity’s favored weapon.", 0 },
                    { new Guid("6b6d8fc6-3854-43b9-9e95-e6aba8f892e6"), 3, new Guid("3996b2d8-3b3e-4ecf-94de-0e016f04d3aa"), "The guardian takes up space and allies can use it when flanking, but it doesn’t have any other attributes a creature would normally have aside from Hit Points, and creatures can move through its space without hindrance. The guardian can’t make any attack other than its Strike, and feats or spells that affect weapons or enhance allies do not apply to the guardian.", 0 },
                    { new Guid("a24bf511-c04b-4e31-8456-2c6a62d87373"), 2, new Guid("3996b2d8-3b3e-4ecf-94de-0e016f04d3aa"), "The guardian’s Strikes are melee spell attacks. Regardless of the appearance of the guardian’s weapon, the guardian deals force damage equal to 2d8 plus your spellcasting ability modifier, but you can deal damage of the type normally dealt by the weapon it holds instead of force damage. No other traits or statistics of the weapon apply, and even a ranged weapon attacks adjacent creatures only. Despite making a spell attack, the spiritual guardian’s weapon is a weapon for the purposes of triggers, resistances, and so forth.", 0 },
                    { new Guid("fba47960-aef2-4a9b-bcf3-230f218a252e"), 1, new Guid("3996b2d8-3b3e-4ecf-94de-0e016f04d3aa"), "When you Cast the Spell, the spiritual guardian appears in an unoccupied space next to a foe of your choice within range and makes a Strike against it. Each time you Sustain the Spell, you can move the spiritual guardian to an unoccupied space next to a target within range (if necessary) and make a Strike with it. The guardian uses and contributes to your multiple attack penalty. Alternatively, when you Sustain the Spell, you can have the guardian move adjacent to an ally and protect that ally. If you do, each time the ally would take damage, the guardian takes the first 10 damage instead of your ally. It continues to do so until you move the guardian to attack an enemy or defend a different ally, or until the guardian is destroyed (it has 50 Hit Points and can’t recover Hit Points by any means). The guardian can’t usually take damage except when protecting an ally, though disintegrate automatically destroys it if it hits the spiritual guardian’s AC of 25.", 0 },
                    { new Guid("26563168-1879-4c6a-a614-f9d936b7d259"), 0, new Guid("3996b2d8-3b3e-4ecf-94de-0e016f04d3aa"), "A Medium guardian made of magical force appears and attacks foes you designate within range. The spiritual guardian is translucent and appears to be holding your deity’s favored weapon.", 0 },
                    { new Guid("a3cd5495-7d48-49c2-8f10-1247469886d5"), 0, new Guid("b501a600-3a18-4ce7-8cf7-12ae21ab2c78"), "You curse the target, sapping its spirit and leaving a contagious trap in its essence. The target must attempt a Will save. Any creature that casts a divine or occult spell on the target while it’s affected is targeted by spiritual epidemic and must also attempt a Will save. The curse continues to spread in this way.", 0 },
                    { new Guid("0a58c5cc-1e3f-46ee-a1e9-cf1445e45fb4"), 0, new Guid("cd8243b1-6bea-41a0-b8d9-b7bdc4dc7004"), "Your eldritch song sends pulsing waves of ethereal energy to attack creatures’ spirits in the area, dealing 18d6 force damage. Because spirit song affects creatures’ spirits, it can damage a target projecting its consciousness (such as via project image) or possessing another creature even if the target’s body is elsewhere. The vibrating waves of spiritual song penetrate into, but not through, solid barriers, damaging incorporeal creatures hiding in solid objects in the area but not passing onward to damage creatures in other rooms. Possessed creatures aren’t harmed by the song. The song doesn’t harm creatures that have no spirit, such as constructs.", 0 },
                    { new Guid("a4d51a2e-2242-4461-9521-16ace2bd7885"), 0, new Guid("f460a7f0-7171-4fcd-973f-1a96b47d00ef"), "You create a cloud of putrid mist in the area. The cloud functions as obscuring mist (page 355) except it sickens creatures that end their turns within the cloud. (The concealed condition is not a poison effect.)", 0 },
                    { new Guid("f67e85b9-d939-4b23-967e-ba5e775245ba"), 0, new Guid("761f2b0a-adb8-4648-8b89-05160d314c85"), "You conjure a dragon to fight for you. You summon a common creature that has the dragon trait and whose level is 5 or lower, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("5dbae9c5-5c9c-408c-92cf-b52631191467"), 0, new Guid("acdb05b9-cd32-4ffd-8b7e-d13a8ade61b1"), "You conjure an elemental to fight for you. You summon a common creature that has the elemental trait and whose level is –1, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("89a48eb0-970b-43d8-8564-29fb00e2a89e"), 0, new Guid("e6d92b4b-b0ca-4d41-addc-8a8a3f3326b7"), "You conjure an aberration to fight for you. You summon a common creature that has the aberration trait and whose level is 5 or lower, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("a2c47671-4eb9-4517-96d0-ee6c29733604"), 0, new Guid("bd9dd966-305f-4fc5-a945-28fd2984fe85"), "You forge a connection of life energy between you and your target, distributing harm between both of you. When you first Cast the Spell, the target recovers 1d4 Hit Points. The first time each round that the target takes damage, reduce the damage it takes by 3 (to a minimum of 0 damage). You lose 3 Hit Points each time, or the total damage dealt, if less than 3; this damage ignores any immunities or resistances you have and can’t otherwise be mitigated in any way.", 0 },
                    { new Guid("5cdbf67b-48c5-4758-9a31-57a7ca0e485b"), 0, new Guid("9374514e-bdad-4483-9123-7267445ba464"), "You dull the target’s mind; the target must attempt a Will save.", 0 },
                    { new Guid("17965ba8-55ed-468e-aaa1-04f793753449"), 0, new Guid("f0583901-0af4-4771-9a6e-a033f62b9cdc"), "The target can understand all words regardless of language and also speak the languages of other creatures. When in a mixed group of creatures, each time the target speaks, it can choose a creature and speak in a language that creature understands, even if the target doesn’t know what language that is.", 0 },
                    { new Guid("52e27b81-075b-4a02-8061-90fba5e7358c"), 1, new Guid("bd9dd966-305f-4fc5-a945-28fd2984fe85"), "The spell ends immediately if you fall unconscious. You can Dismiss the spell.", 0 },
                    { new Guid("f449dccf-c2b6-46a5-bda9-b6f8680bcca4"), 0, new Guid("bdc919fe-cf21-4155-9b1a-8022d338067c"), "You temporarily stop time for everything but yourself, allowing you to use several actions in what appears to others to be no time at all. Immediately after casting time stop, you can use up to 9 actions in 3 sets of up to 3 actions each. After each set of actions, 1 round passes, but only for you, effects specifically targeting or affecting you, and effects you create during the stoppage. All other creatures and objects are invulnerable to your attacks, and you can’t target or affect them with anything. Once you have finished your actions, time begins to flow again for the rest of the world. If you created an effect with a duration that extends beyond the time stop’s duration, such as wall of fire, it immediately affects others again, but it doesn’t have any of the effects that happen only when you first cast the spell.", 0 },
                    { new Guid("8669b621-a19b-4b74-8b99-57beba49e92d"), 0, new Guid("d32fdf82-8fc3-48e4-98f2-708402cb0409"), "You and the targets are instantly transported to any location within range, as long as you can identify the location precisely both by its position relative to your starting position and by its appearance (or other identifying features). Incorrect knowledge of the location’s appearance usually causes the spell to fail, but it could instead lead to teleporting to an unwanted location or some other unusual mishap determined by the GM. Teleport is not precise over great distances. The targets appear at a distance from the intended destination equal to roughly 1 percent of the total distance traveled, in a direction determined by the GM. For short journeys, this lack of precision is irrelevant, but for long distances this could be up to 1 mile.", 0 },
                    { new Guid("4d88183d-1a85-4305-9b64-352e6d634806"), 0, new Guid("b1337486-1102-44da-a9e7-77e592d51a6e"), "You can communicate telepathically with creatures within 30 feet. Once you establish a connection by communicating with a creature, the communication is two-way. You can communicate only with creatures that share a language with you.", 0 },
                    { new Guid("72766628-c338-4240-8429-5b9f4fdd5d13"), 0, new Guid("e3d0c355-6a89-4b7a-91c5-5aba4d45ff64"), "You send the target a message of 25 words or fewer, and it can respond immediately with its own message of 25 words or fewer. Your message is insidious and has the effect of suggestion (page 374), with the message substituting for the spoken suggestion. On a successful save, the target is temporarily immune for 1 day, and on a critical success, the target is temporarily immune for 1 month. You can target a creature only if you have previously been in telepathic contact with it before, such as via the telepathy spell.", 0 },
                    { new Guid("7cf3c40a-ccfd-4af5-965b-001b0186a22b"), 0, new Guid("c6625e80-92f2-44d9-8ad7-671ae34c1035"), "The targets can communicate telepathically with any or all of the other targets from any point on the same planet.", 0 },
                    { new Guid("47f11264-dd44-4415-a93e-a32aa23b2eac"), 0, new Guid("ab61bcac-bdca-4fb7-825d-c0529831b049"), "You hurl a loose, unattended object that is within range and that has 1 Bulk or less at the target. Make a spell attack roll against the target. If you hit, you deal bludgeoning, piercing, or slashing damage—as appropriate for the object you hurled—equal to 1d6 plus your spellcasting ability modifier. No specific traits or magic properties of the hurled item affect the attack or the damage.", 0 },
                    { new Guid("d5870d50-d831-4937-921e-8c299d84f5e8"), 0, new Guid("e469dd5e-ca1a-4149-8c10-5fe8ea042da6"), "With a rush of telekinetic power, you move a foe or something they carry. You can attempt to Disarm, Shove, or Trip the target using a spell attack roll instead of an Athletics check.", 0 },
                    { new Guid("866afc06-8e16-48f8-9aa7-f4aef885b5e5"), 0, new Guid("3940186e-7fc4-4ee4-b88b-950aa185ce64"), "You move the target up to 20 feet, potentially suspending it in midair. When you Sustain the Spell, you can do so again, or you can choose a different eligible target to move.", 0 },
                    { new Guid("59b2ea93-6ebb-4fdb-bcbf-ccedf43f774e"), 0, new Guid("a6a3e6b3-df80-4fa9-8875-a7c960e61b39"), "Dense, twitching creepers sprout from every surface and fill any bodies of water in the area. Any creature moving on the land, or Climbing or Swimming within the creepers, takes a –10-foot circumstance penalty to its Speeds while in the area. Once per round, you can make a vine lash out from any square within the expanse of creepers by using a single action, which has the concentrate trait. This vine has a 15-foot reach. Make a melee spell attack roll against the target; on a success, the vine pulls the target into the creepers and makes it immobilized for 1 round or until the creature Escapes (against your spell DC), whichever comes first.", 0 },
                    { new Guid("f1cb16f5-c104-4d48-91c9-393ae8975d5c"), 0, new Guid("06fbe767-a12b-4030-97c7-ba82c1f75f4f"), "You summon a bridge of radiant, shimmering moonlight. The 10-foot-wide span must start at the ground on a point within range, and it extends as a horizontal plane, either in a straight line or at any angle up to 45 degrees upward or downward, for up to 120 feet. This bridge has AC 10, Hardness 30, and 60 Hit Points, and it’s immune to critical hits and precision damage. You and your allies can cross the bridge normally, but other creatures simply pass through it if they try to do so. The bridge blocks physical, ethereal, and incorporeal attacks from crossing, whether from above or below. You can Dismiss the spell.", 0 },
                    { new Guid("17e82c6e-02ee-43c7-a911-4d5446438dfa"), 0, new Guid("de8437fe-a9a2-4e25-b69a-9af413281871"), "You siphon off a portion of the target’s soul to bolster your own vitality. The target must attempt a Fortitude save or take 1d4 negative damage. You gain temporary Hit Points equal to the total amount of HP the target loses, including the HP lost from becoming drained.", 0 },
                    { new Guid("f947e402-d119-4072-9c0f-491696eb44d3"), 0, new Guid("22b530d2-3cf0-40d3-8833-5c85a8e981d7"), "A vine covered in sticky sap appears from thin air, flicking from your hand and lashing itself to the target. Attempt a spell attack against the target.", 0 },
                    { new Guid("85832a0e-4d20-48ac-9b98-9baee0063141"), 3, new Guid("c2da85e4-3cdb-4f3c-8ad9-dc19db1341d6"), "The creature has trouble moving, making it clumsy 3 and giving it a –10-foot status penalty to its Speeds.", 2 },
                    { new Guid("4132f993-15c9-46a8-990a-d258f6e23986"), 2, new Guid("c2da85e4-3cdb-4f3c-8ad9-dc19db1341d6"), "The target’s difficulty processing visual input makes all creatures and objects concealed from it.", 2 }
                });

            migrationBuilder.InsertData(
                table: "Spells_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("7326260c-2f75-485e-a481-806208e86856"), 1, new Guid("c2da85e4-3cdb-4f3c-8ad9-dc19db1341d6"), "Due to the distraction, the target must succeed at a DC 5 flat check each time it uses a concentrate action, or the action fails and is wasted.", 2 },
                    { new Guid("3ea9d9b8-8527-4510-8c0e-7bcd8f780ed7"), 0, new Guid("c2da85e4-3cdb-4f3c-8ad9-dc19db1341d6"), "The target’s senses are suddenly rewired in unexpected ways, causing them to process noises as bursts of color, smells as sounds, and so on. This has three effects, and the target must attempt a Will save.", 0 },
                    { new Guid("f2daafe7-70ca-4761-8c8f-a5e51ff0e517"), 0, new Guid("2c83b759-23b2-4368-a7a5-a451c3f85b76"), "You emit a pulsating mental blast that penetrates the minds of all enemies in the area. Each creature in the area must attempt a Will save.", 0 },
                    { new Guid("30e0e59a-4535-44dc-8937-a7396ec7d822"), 1, new Guid("4c4f275c-b1e8-448b-a1aa-66bb2af4fe08"), "If the globe overlaps with an area of magical darkness, sunburst attempts to counteract the darkness effect.", 0 },
                    { new Guid("3ce8a6b8-8691-4f26-ae41-70bd27381706"), 0, new Guid("4c4f275c-b1e8-448b-a1aa-66bb2af4fe08"), "A powerful globe of searing sunlight explodes in the area, dealing 8d10 fire damage to all creatures in the area, plus 8d10 additional positive damage to undead creatures. Each creature in the area must attempt a Reflex save.", 0 },
                    { new Guid("3da28ebe-7867-4576-bc29-ea331ba187b0"), 0, new Guid("a170f0db-8755-4bdb-a119-34d2cc09457b"), "You conjure an plant or fungus to fight for you. You summon a common creature that has the plant or fungus trait and whose level is –1, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("a8d03b5f-9e29-4049-bc22-1090565aac82"), 0, new Guid("9c7839e6-bafb-4978-a026-1c48e12d1d6f"), "You conjure a giant to fight for you. You summon a common creature that has the giant trait and whose level is 5 or lower, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("7890ba15-a712-4518-961c-f241c14adc47"), 0, new Guid("e478263d-50fe-4e76-b926-417ce2e9395c"), "You conjure a fiend to fight for you. You summon a common creature that has the fiend trait and whose level is 5 or lower, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon. You can’t summon a creature unless its alignment is one of your deity’s preferred alignments (or, if you don’t have a deity, is within one step of your alignment). At the GM’s discretion, some deities might restrict specific types of fiends, even if their alignments match.", 0 },
                    { new Guid("2959bdd1-bef6-42ae-8a6f-a683757057e7"), 0, new Guid("4b567885-82ec-4c86-bbe3-4c04f343198f"), "You conjure an fey to fight for you. You summon a common creature that has the fey trait and whose level is –1, such as those found in Pathfinder Bestiary volumes. Heightening the spell increases the maximum level of creature you can summon.", 0 },
                    { new Guid("aca045a9-ccee-4372-a55d-52c42ced44f2"), 1, new Guid("4850d749-4412-4255-9906-be1cd69cafa7"), "This is a spiritual transfer, so no effects apply that would increase the Hit Points the target regains or decrease the Hit Points you lose. This transfer also ignores any temporary Hit Points you or the target have. Since this effect doesn’t involve positive or negative energy, spirit link works even if you or the target is undead. While the duration persists, you gain no benefit from regeneration or fast healing. You can Dismiss this spell, and if you’re ever at 0 Hit Points, spirit link ends automatically.", 0 },
                    { new Guid("22a688f2-2be2-4965-a0b2-07965d30f797"), 0, new Guid("abd09dc0-7486-407a-aa13-d1ae5fde0e5d"), "You transform into a Large tree. Perception checks don’t reveal your true nature, but a successful Nature or Survival check against your spell DC reveals that you appear to be a tree that is strangely new to the area. While in tree form, you can observe everything around you, but you can’t act other than to end the spell, and your turn, by using a single action, which has the concentrate trait. As a tree, your AC is 20, and only status bonuses, status penalties, circumstance bonuses, and circumstance penalties affect you. Any successes and critical successes you roll on Reflex saves are failures.", 0 },
                    { new Guid("6efad0cb-ab8b-43e5-bc75-50ca5e4d5bab"), 0, new Guid("4850d749-4412-4255-9906-be1cd69cafa7"), "You form a spiritual link with another creature, taking in its pain. When you Cast this Spell and at the start of each of your turns, if the target is below maximum Hit Points, it regains 2 Hit Points (or the difference between its current and maximum Hit Points, if that’s lower). You lose as many Hit Points as the target regained.", 0 },
                    { new Guid("29ad5637-e0d6-42fe-80ca-9847989751b9"), 0, new Guid("a8a90053-90d2-4969-a70f-4724b37f7a57"), "You magically duplicate a spider’s venomous sting. You deal 1d4 piercing damage to the touched creature and afflict it with spider venom. The target must attempt a Fortitude save.", 0 },
                    { new Guid("ba79ea8e-2611-429b-83c7-d53cd49d6e76"), 0, new Guid("42c5b56f-3497-474d-9902-80f2eda13778"), "You can see invisible creatures and objects. They appear to you as translucent shapes, and they are concealed to you.", 0 },
                    { new Guid("ca0ff2c1-468d-44e9-abb8-643410446353"), 0, new Guid("3df0714b-20ce-42da-902c-eb08d5f2fd1d"), "You change the target’s text to different text entirely. If the text is a spellbook or a scroll, you can change it to show a spell you know of secret page’s level or lower. The replacement spell cannot be cast or used to prepare a spell. You can also transform the text into some other text you have written or have access to. You can specify a password that allows a creature touching the page to change the text back and forth. You must choose the replacement text and the password, if any, when you Cast the Spell.", 0 },
                    { new Guid("50d699d6-13f6-4c9c-a24c-0e07fb56485c"), 1, new Guid("20b5399e-43d6-4d0b-8ab4-182f32d3b72b"), "If the light passes through an area of magical darkness or targets a creature affected by magical darkness, searing light attempts to counteract the darkness. If you need to determine whether the light passes through an area of darkness, draw a line between yourself and the spell’s target.", 0 },
                    { new Guid("71bed422-4dcd-4443-a9f4-9ab968aed5ad"), 0, new Guid("20b5399e-43d6-4d0b-8ab4-182f32d3b72b"), "You shoot a blazing ray of light tinged with holy energy. Make a ranged spell attack. The ray deals 5d6 fire damage. If the target is a fiend or undead, you deal an extra 5d6 good damage.", 0 },
                    { new Guid("320fedd5-e8a7-458b-8e5d-0807ecf72343"), 1, new Guid("a6a36041-739b-4107-b7fe-a00d7790f455"), "The effect of scrying depends on the target’s Will save.", 0 },
                    { new Guid("c8f0078c-8b19-4296-97ae-b61d090689a8"), 0, new Guid("a6a36041-739b-4107-b7fe-a00d7790f455"), "You magically spy on a creature of your choice. Scrying works like clairvoyance (page 324), except that the image you receive is less precise, insufficient for teleport and similar spells. Instead of creating an eye in a set location within 500 feet, you instead create an eye that manifests just above the target. You can choose a target either by name or by touching one of its possessions or a piece of its body. If you haven’t met the target in person, scrying’s DC is 2 lower, and if you are unaware of the target’s identity (perhaps because you found an unknown creature’s fang at a crime scene), the DC is instead 10 lower.", 0 },
                    { new Guid("c06b220f-8d39-4d78-8121-a29d0880816c"), 0, new Guid("b4565c07-e74e-4651-be58-dee1715a470b"), "A field of cascading, ever-changing colors manifests in the air. Creatures are dazzled while inside the pattern, as are those within 20 feet of the pattern’s area. A creature must attempt a Will save if it is inside the pattern when you cast it, enters the pattern, ends its turn within the pattern, or uses a Seek or Interact action on the pattern. A creature currently affected by the pattern doesn’t need to attempt new saves.", 0 },
                    { new Guid("c756c99c-e162-459f-9f7e-e1a66f407620"), 0, new Guid("86dabd01-ccd5-45e6-adac-c7677bb0000c"), "You ward a creature with protective energy that deters enemy attacks. Creatures attempting to attack the target must attempt a Will save each time. If the target uses a hostile action, the spell ends.", 0 },
                    { new Guid("ebcb3f9d-0dad-4e0c-ba4f-f6a2ccdbcebd"), 0, new Guid("7de9fc25-8163-4dc8-a4b2-d8dfc9105864"), "You sanctify the area, sprinkling it with holy water and warding it against your foes. Choose aberrations, celestials, dragons, fiends, monitors, or undead. All creatures in the area gain a +1 status bonus to AC, attack rolls, damage rolls, and saving throws against the chosen creatures.", 0 },
                    { new Guid("57903f39-d69b-4e84-a08b-f884b3c3bf2b"), 2, new Guid("5be41a41-9a8b-42af-b0f9-3a50b33e6e79"), "If the rope is detached or destroyed, or if a creature attempts to enter the space that would put it over its capacity, the space begins to unravel. It disappears in 1d4 rounds, depositing the creatures within safely on the ground below.", 0 },
                    { new Guid("c05ba948-60e5-4d63-a58c-a2f8a4c5d396"), 1, new Guid("5be41a41-9a8b-42af-b0f9-3a50b33e6e79"), "The entrance to the space can’t be seen, and it can be pinpointed only by the presence of the rope. The rope can’t be removed or hidden, though it can be detached from the extradimensional space by pulling it with 16,000 pounds of weight, critically succeeding at an Athletics check against the spell’s DC, or destroying the rope. The space holds up to eight Medium creatures and their gear. A Large creature counts as two Medium creatures, a Huge creature counts as four Medium creatures, and a Gargantuan creature fills the space on its own.", 0 },
                    { new Guid("6a98cd4b-d44c-4601-bd0a-f37b9e163105"), 0, new Guid("5be41a41-9a8b-42af-b0f9-3a50b33e6e79"), "You cause the target rope to rise vertically into the air. Where it ends, an extradimensional space opens, connected to the top of the rope. This space can be reached only by climbing the rope.", 0 },
                    { new Guid("cff51bed-0e6e-4fc7-aa2f-99f7ac5e3205"), 0, new Guid("2f7a2088-4d0e-40d1-aa35-bd9105582fa1"), "You send the creature a mental message of 25 words or fewer, and it can respond immediately with its own message of 25 words or fewer.", 0 },
                    { new Guid("a498c048-67ef-428a-8d28-f3779bb7bb6d"), 8, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "Athletics modifier of +23, unless your own modifier is higher.", 2 },
                    { new Guid("ab5a6f3d-8168-4dce-bc55-f2e4ecd07451"), 6, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "Darkvision.", 2 },
                    { new Guid("90afa4d1-a7c0-4ae9-9f6b-ff1af4789d5c"), 5, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "Resistance 3 against physical damage.", 2 },
                    { new Guid("bb74dfeb-7629-43a3-82cb-1eccddbcb42b"), 4, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "Speed 40 feet.", 2 },
                    { new Guid("2770955e-4bac-4950-ba42-0408341d10c5"), 3, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "10 temporary Hit Points.", 2 },
                    { new Guid("678b0001-9be3-475d-bf37-03760753d142"), 2, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "AC = 20 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("710ff1eb-039f-4782-98b3-ad25eaccbf70"), 1, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "You gain the following statistics and abilities:", 0 },
                    { new Guid("70d8e973-f45f-45c8-9883-9d5e5d0affc7"), 0, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "You focus all your divine energy and transform yourself into a Medium battle form, similar to your normal form but armed with powerful divine armaments granted by your deity. While in this form, you gain the statistics and abilities listed below. You have hands in this battle form and can use manipulate actions. You can Dismiss the spell.", 0 },
                    { new Guid("0fc930bf-d764-4996-96d0-e378ae188cf3"), 0, new Guid("44f0f796-c02f-467c-973a-e328f284bfe1"), "A burst of healing energy soothes living creatures and temporarily rouses those recently slain. All living targets regain 10d8+40 Hit Points. In addition, you return any number of dead targets to life temporarily, with the same effects and limitations as raise dead (page 362). The raised creatures have a number of temporary Hit Points equal to the Hit Points you gave living creatures, but no normal Hit Points. The raised creatures can’t regain Hit Points or gain temporary Hit Points in other ways, and once revival’s duration ends, they lose all temporary Hit Points and die. Revival can’t resurrect creatures killed by disintegrate or a death effect. It has no effect on undead.", 0 },
                    { new Guid("964a22e4-3812-494b-9041-4c4edfb0f9dd"), 1, new Guid("6404a5b3-90a1-425d-abc5-b87d531b5bdc"), "When reverse gravity ends, all creatures and objects caught in the area fall back down. Likewise, anything that moves beyond the spell’s area is subjected to normal gravity again.", 0 },
                    { new Guid("4e78afe2-837a-4536-98a5-fe31ee2f395c"), 0, new Guid("6404a5b3-90a1-425d-abc5-b87d531b5bdc"), "You reverse gravity in the area. Creatures and objects that aren’t secured to the ground immediately fall upward to the top of the area. A creature might be able to Grab an Edge to arrest its fall if it falls past an appropriate surface. If a creature falls against a solid object (such as a ceiling), it takes the appropriate amount of falling damage and lands on the surface. Once an object or creature reaches the top of the area, it floats, caught between the normal and reversed gravity. The creature can move along the plane where the two forms of gravity meet. Creatures that can levitate or fly can use those abilities to mitigate the effects of reverse gravity.", 0 },
                    { new Guid("9a08bac0-8d90-43a0-a5f1-d5553a72266f"), 0, new Guid("6c7cbf51-796d-4a50-b824-8c0a3acfbcaf"), "Opening your mind to occult echoes, you gain impressions from past events that occurred in your current location. Retrocognition reveals psychic impressions from events that occurred over the course of the last day throughout the first minute of the duration, followed by impressions from the next day back the next minute, and so on. These echoes don’t play out like a vision but instead reveal impressions of emotions and metaphors that provide cryptic clues and details of the past. If you witness a traumatic or turbulent event through an impression, the spell ends unless you succeed at a Will save with a DC of at least 30 and possibly as much as 50, depending on the severity of the event. The GM determines whether an event is traumatic and chooses the DC.", 0 },
                    { new Guid("6875ad1f-90f6-4ce4-9cd8-e222beb0b256"), 0, new Guid("3245f53c-d857-4bf3-964e-0ef6dbfafb79"), "You attempt to counteract a single effect imposing the blinded or deafened conditions on the target, restoring its vision or hearing. This can counteract both temporary magic and permanent consequences of magic, but it doesn’t cure someone who does not have the sense due to some natural state or effect, such as from birth or from a non-magical wound or toxin.", 0 },
                    { new Guid("c1d7959e-22f9-453f-98c9-849906db47af"), 7, new Guid("98daab63-ed2d-48d4-addf-680826d12a68"), "A special attack with a righteous armament version of your favored weapon, which is the only attack you can use. Your attack modifier with the special weapon is +21, and your damage bonus is +8 (or +6 for a ranged attack). If your attack modifier with your deity’s favored weapon is higher, you can use it instead. You deal three of your weapon’s normal damage dice, or three damage dice of one size larger if your weapon is a simple weapon with a d4 or d6 damage die. The weapon has one of the following properties that matches your deity’s alignment: anarchic, axiomatic, holy, unholy. If your deity is true neutral, you instead deal an extra 1d6 precision damage.", 2 },
                    { new Guid("e4776335-839d-4ca9-b082-0362ec6ea3ef"), 0, new Guid("6ef98fbc-537b-47fb-876a-6c9bec29fe98"), "You shape the quasi-real substance of the Shadow Plane into a blast. Choose acid, bludgeoning, cold, electricity, fire, force, piercing, slashing, or sonic damage, and choose a 30-foot cone, a 15-foot burst within 120 feet, or a 50-foot line. The blast deals 5d8 damage of the type you chose to each creature in the area.", 0 },
                    { new Guid("d45fd659-908e-480c-8e5a-c430c0d83f78"), 0, new Guid("b6e4013e-d7c1-40b2-8a8a-c16ce0eff337"), "Exchanging material energy with that of the Shadow Plane, you transform the triggering spell into a partially illusory version of itself. Attempt to counteract the target spell. If the attempt is successful, any creatures that would be damaged by the spell instead take only half as much damage, but the spell otherwise works as normal. Treat shadow siphon’s counteract level as 2 higher for this attempt.", 0 },
                    { new Guid("712ee70b-612d-4398-814c-c7d1ef59627d"), 0, new Guid("b84acd00-95a3-4ad2-bb2b-51268626ca31"), "You access the Shadow Plane, using its warped nature to spread your travels. The targets enter the edge of the Shadow Plane where it borders the Material Plane. Targets can’t see the Material Plane while on the Shadow Plane (although elements of that plane can sometimes be a hazy reflection of the Material Plane). While on the Shadow Plane, the targets are exposed to potential encounters with that plane’s denizens. The shadows on the border between the planes bend space, speeding up your movement with respect to the Material Plane. Every 3 minutes the targets travel along this border, they move as far as they would through the Material Plane in 1 hour. At any point, a target can Dismiss the spell’s effects, although this affects only that target. The shadow bending is inexact, so when the spell ends, the targets appear roughly 1 mile from their intended location on the Material Plane (though those who are traveling together and Dismiss the spell at the same point on the Plane of Shadow appear together).", 0 },
                    { new Guid("a4674f5b-95ac-4a64-b387-bdb201883e97"), 0, new Guid("378e003f-daf7-4083-aff0-fa89ce625e8d"), "Tiny clinging hairs sprout across the creature’s hands and feet, offering purchase on nearly any surface. The target gains a climb Speed equal to its Speed.", 0 },
                    { new Guid("4b24bcfe-ecbb-40c1-acb0-91d4e3aaf5b0"), 0, new Guid("174f6b71-7b37-4563-8912-b13434bf930b"), "You cause any spells cast on the target to spill out their energy in harmful surges. The target must attempt a Will save.", 0 },
                    { new Guid("0f32ca73-1e49-474a-93f7-442f37d2551a"), 1, new Guid("ec2778da-6da2-49ef-8b81-90aa386efaf8"), "If spell turning reflects a spell back at a caster who is also under the effect of spell turning, their spell turning can attempt to reflect their own spell back at you again; if they do so, their counteract attempt automatically succeeds.", 0 },
                    { new Guid("9317afe9-244c-4d18-b1be-571698f3fa71"), 0, new Guid("ec2778da-6da2-49ef-8b81-90aa386efaf8"), "This abjuration reflects spells cast at you back at their caster. When a spell targets you, you can spend a reaction to attempt to reflect it. This uses the rules for counteracting the spell, but if the spell is successfully counteracted, the effect is turned back on the caster. Whether or not the counteract attempt is successful, spell turning then ends. Spell turning can’t affect spells that aren’t targeted (such as area spells).", 0 },
                    { new Guid("45a3b160-448c-442d-bce7-586d2858daeb"), 0, new Guid("cf7057ec-301d-435b-904f-f4938c87e4bc"), "You ward a creature against the effects of a single spell. Choose a spell and name it aloud as part of the verbal component. Spell immunity attempts to counteract that spell whenever spell immunity’s target is the target of the named spell or in that spell’s area. Successfully counteracting a spell that targets an area or multiple targets with spell immunity negates the effects only for the target affected by spell immunity.", 0 },
                    { new Guid("157deae1-cb56-4eb9-9df0-c0deeb9de2cc"), 0, new Guid("b2146d32-371c-40a7-847e-982000bc2b5b"), "You create a semicorporeal hand out of your essence that delivers touch spells for you. Whenever you Cast a Spell with a range of touch, you can have the hand crawl to a target within range along the ground, touch it, and then crawl back to you. When making a melee spell attack with the hand, you use your normal bonuses. The hand can move as far as it needs to within range. The hand has your AC and saves, but any damage to the hand destroys it and causes you to take 1d6 damage.", 0 },
                    { new Guid("7fd2d6fe-b453-460e-93ef-926ec445be5d"), 0, new Guid("f1ab3438-9952-4921-ab1c-07faebeda112"), "You can ask questions of and receive answers from plants, but the spell doesn’t make them more friendly or intelligent than normal. Most normal plants have a distinctive view of the world around them, so they don’t recognize details about creatures or know anything about the world beyond their immediate vicinity. Cunning plant monsters are likely to be terse and evasive, while less intelligent ones often make inane comments.", 0 },
                    { new Guid("f7b97001-bfed-4ae5-b038-a2bc48b8a688"), 0, new Guid("f773ca02-3d69-4845-be81-624f445fca91"), "You can ask questions of, receive answers from, and use the Diplomacy skill with animals. The spell doesn’t make them more friendly than normal. Cunning animals are likely to be terse and evasive, while less intelligent ones often make inane comments.", 0 },
                    { new Guid("086a81c2-906f-4425-8859-811d6c32b979"), 0, new Guid("039ee5fe-341b-4de5-bdec-462a495fce1d"), "A cacophonous noise blasts out, dealing 2d10 sonic damage. Each creature must attempt a Fortitude save.", 0 },
                    { new Guid("af924638-0cce-4fbd-b764-eb4e4de6a0aa"), 0, new Guid("9a8d198a-8bd7-49bf-93f0-452564f9540a"), "You grace the target’s mind, boosting its mental defenses and healing its wounds. The target regains 1d10+4 Hit Points when you Cast the Spell and gains a +2 status bonus to saves against mental effects for the duration.", 0 },
                    { new Guid("35c406a7-7da2-45e4-84d9-64ee6c9c9278"), 0, new Guid("8b91ccee-e2ad-45dc-9865-ea17b1623142"), "You conjure a bank of fog so thick it impedes movement as well as sight. This functions as obscuring mist (page 355), except that the area is also difficult terrain. You can Dismiss the spell.", 0 },
                    { new Guid("0cf9c516-07ed-46e1-b5d4-14c2e9a29e20"), 0, new Guid("5f8ef3e1-99e9-44c8-b043-c4fa50c98b4e"), "You dilate the flow of time around the target, slowing its actions.", 0 },
                    { new Guid("68810aee-e637-4b91-bd8d-75ace196b201"), 0, new Guid("a2b0b58b-19a9-454d-9cf0-81c74d1301a2"), "Each creature in the area becomes drowsy and might fall asleep. A creature that falls unconscious from this spell doesn’t fall prone or release what it’s holding. This spell doesn’t prevent creatures from waking up due to", 0 },
                    { new Guid("9936245d-7832-41e9-9933-5732dd390ade"), 0, new Guid("5903b11d-1660-440b-88f5-36af62e32738"), "The target makes no sound, preventing creatures from noticing it using hearing or other senses alone. The target can’t use sonic attacks, nor can it use actions with the auditory trait. This prevents it from casting spells that include verbal components.", 0 },
                    { new Guid("48cdd021-2c7c-4dfc-87ba-0f50ce63e956"), 0, new Guid("912e35d7-ae91-44c2-8a21-239580a614d0"), "You harmlessly place your unique magical sigil, which is about 1 square inch in size, on the targeted creature or object. The mark can be visible or invisible, and you can change it from one state to another by using an Interact action to touch the target. The mark can be scrubbed or scraped off with 5 minutes of work. If it’s on a creature, it fades naturally over the course of a week. The time before the mark fades increases depending on your heightened level.", 0 },
                    { new Guid("4d1b85ca-b824-431a-a0ea-a29fb9a55b35"), 0, new Guid("fda456f7-c79c-486f-b6b8-0f054565deac"), "You shrink the target to roughly the size of a coin. This reducesit to negligible Bulk. You can Dismiss the spell, and the spell ends if you toss the object onto a solid surface. The object can’t be used to attack or cause damage during the process of it returning to normal size. If there isn’t room for the object to return to normal size when the spell ends, the spell’s duration continues until the object is in a location large enough to accommodate its normal size.", 0 },
                    { new Guid("54b56fa0-5746-4448-bdce-2851d8b351c2"), 0, new Guid("b50bbfc8-6c9a-4398-ab83-eb5d525a90e8"), "You warp space to make a creature smaller. The target shrinks to become Tiny in size. Its equipment shrinks with it but returns to its original size if removed. The creature’s reach changes to 0 feet. This spell has no effect on a Tiny creature.", 0 },
                    { new Guid("edf4a6d4-ebbf-4c42-af6b-5ec20e596f1e"), 0, new Guid("5a176a38-8438-4f5b-be5d-50f41adcfd4e"), "You shroud your hands in a crackling field of lightning. Make a melee spell attack roll. On a hit, the target takes 2d12 electricity damage. If the target is wearing metal armor or is made of metal, you gain a +1 circumstance bonus to your attack roll with shocking grasp, and the target also takes 1d4 persistent electricity damage on a hit. On a critical hit, double the initial damage, but not the persistent damage.", 0 },
                    { new Guid("e7bb7a0f-5e48-4040-bdc2-75c79857df31"), 0, new Guid("e7c926f9-36e7-42a3-bd12-16f03c965b86"), "The target grows vines and leaves, brimming with primal energy. The target becomes a +1 striking weapon while in your hands, gaining a +1 item bonus to attack rolls and increasing the number of weapon damage dice to two. Additionally, as long as you are on your home plane, attacks you make with the target against aberrations, extraplanar creatures, and undead increase the number of weapon damage dice to three.", 0 },
                    { new Guid("985b5df8-c4e9-4878-b4e7-c37ce9453e10"), 0, new Guid("41cdcd6c-9068-47d4-ad9b-889d7f0430f9"), "You forge a temporary link between the target’s life essence and your own. The target takes half damage from all effects that deal Hit Point damage, and you take the remainder of the damage. When you take damage through this link, you don’t apply any resistances, weaknesses, or other abilities you have to that damage; you simply take that amount of damage. The spell ends if the target is ever more than 30 feet away from you. If either you or the target is reduced to 0 Hit Points, any damage from this spell is resolved and then the spell ends.", 0 },
                    { new Guid("73f02d3b-208c-4a58-857b-d6c2d7392a5a"), 2, new Guid("5e0b7844-0a77-42f6-ab60-1d03d9f83310"), "Heightening the spell increases the shield’s Hardness.", 0 },
                    { new Guid("84e52283-6dd1-4f39-ac80-e164f482011c"), 1, new Guid("5e0b7844-0a77-42f6-ab60-1d03d9f83310"), "While the spell is in effect, you can use the Shield Block reaction with your magic shield (see the sidebar). The shield has Hardness 5. After you use Shield Block, the spell ends and you can’t cast it again for 10 minutes. Unlike a normal Shield Block, you can use the spell’s reaction against the magic missile spell.", 0 },
                    { new Guid("d7ae1970-d90f-40bc-b317-91cfa5a47d9b"), 0, new Guid("5e0b7844-0a77-42f6-ab60-1d03d9f83310"), "You raise a magical shield of force. This counts as using the Raise a Shield action, giving you a +1 circumstance bonus to AC until the start of your next turn, but it doesn’t require a hand to use.", 0 },
                    { new Guid("1344f717-2d4b-4346-8a5a-ac2c9ff6b140"), 0, new Guid("c902051a-93c6-4cb1-94d6-b9e95d2df8a5"), "A high-frequency sonic attack shatters a nearby object. You deal 2d10 sonic damage to the object, ignoring the object’s Hardness if it is 4 or lower.", 0 },
                    { new Guid("eee09187-7c0e-4ffb-8a71-cf7a2331427b"), 0, new Guid("28ca5d12-0669-4835-9ae8-fb3f90b47c2f"), "You shape the wood into a rough shape of your choice. The shaping power is too crude to produce with intricate parts, fine details, moving pieces, or the like. You cannot use this spell to enhance the value of the wooden object you are shaping.", 0 },
                    { new Guid("a701f81e-40bf-4db0-85c2-ffe6858045bb"), 0, new Guid("49d1911d-7153-4a01-9e0e-cb89bb62d0ab"), "You shape the stone into a rough shape of your choice. The shaping process is too crude to produce intricate parts, fine details, moving pieces, or the like. Any creatures standing atop the stone when you reshape it must each attempt a Reflex save or Acrobatics check. Success The creature is unaffected.", 0 },
                    { new Guid("3b28ed13-3ec9-4a63-a850-027636a2af06"), 0, new Guid("c0720771-9eed-4062-9465-abcb312cb589"), "Harnessing your mastery of transformative magic, you take on a mutable form. You transform yourself into any form you could choose with a polymorph spell in your spell repertoire or that you could prepare of 8th level or lower (including any 8th-level or lower heightened versions of spells you know). You choose the type of creature as you Cast the Spell rather than when you prepare it. You can change your form to any other form you could choose with this spell by using a single action, which has the concentrate trait. You can Dismiss this spell.", 0 },
                    { new Guid("c68f8897-c511-4cd9-9d23-cbd9359f23f5"), 0, new Guid("05c8ccda-0aaa-4b9e-92d8-219e0a80b395"), "You concentrate ethereal energy and attack a creature’s spirit, dealing 16d6 force damage. Because spirit blast affects the creature’s spirit, it can damage a target projecting its consciousness (such as via project image) or possessing another creature even if the target’s body is elsewhere. The possessed creature isn’t harmed by the blast. The blast doesn’t harm creatures that have no spirit, such as constructs.", 0 },
                    { new Guid("6dcf1a44-9039-4ddb-a84d-bd3f821ddf37"), 0, new Guid("349ed613-7398-4320-8d2f-456481a6d593"), "You step into a living tree with a trunk big enough for you to fit inside it and instantly teleport to any tree of the same species within 5 miles that also has a sufficiently large trunk. Once you enter the first tree, you instantly know the rough locations of other sufficiently large trees of the same species within range and can exit from the original tree, if you prefer. You can’t carry extradimensional spaces with you; if you attempt to do so, the spell fails.", 0 },
                    { new Guid("43810ed1-6b68-4256-ae7a-f15e6a2ba52c"), 0, new Guid("52f71378-b21c-4efb-a0d7-64981b5618e5"), "You see things within 60 feet as they actually are. The GM rolls a secret counteract check against any illusion or transmutation in the area, but only for the purpose of determining whether you see through it (for instance, if the check succeeds against a polymorph spell, you can see the creature’s true form, but you don’t end the polymorph spell).", 0 },
                    { new Guid("70f45247-dee7-42ef-81fe-8152eed0a354"), 0, new Guid("82e5887d-a419-48a4-9c65-b795b15cd7c2"), "A glimpse into the future ensures your next blow strikes true. The next time you make an attack roll before the end of your turn, roll the attack twice and use the better result. The attack ignores circumstance penalties to the attack roll and any flat check required due to the target being concealed or hidden.", 0 },
                    { new Guid("11f0fa7a-9e28-4ca5-8d0a-6ff1eb04a6d3"), 0, new Guid("8ae2add9-cf35-4cac-95f0-dea69b4eeaf4"), "Your spellcasting surrounds you in a storm of elemental energy. If the next action you take is to Cast a Spell from your wizard spell slots that’s an evocation spell dealing acid, cold, electricity, or fire damage, a 10-foot emanation of energy surrounds you as you cast the spell. Foes in the area take 1d6 damage per spell level of the spell you just cast of the same damage type the spell deals (choose one if it deals multiple types). Combine the damage from both elemental tempest and the other spell against foes who take damage from both before applying bonuses, penalties, resistance, weakness, and the like.", 0 },
                    { new Guid("db5c707c-8105-4336-a503-33d265c574cb"), 1, new Guid("914cab4d-07f4-422e-9c00-32be4e544665"), "In your ki form, your emotions surge to the forefront and it’s difficult to moderate your attacks. Your weapons and unarmed attacks lose the nonlethal trait. You take a –2 status penalty to saves against emotion effects but gain a +2 status bonus to saves against all other mental effects.", 0 },
                    { new Guid("dd628605-b20e-4f1a-8e3b-eeae23e07f95"), 0, new Guid("a5609f28-d70a-4ee1-a530-dfbd26dd4102"), "You make an attack filled with a medusa’s petrifying power. Make an unarmed Strike with the following additional effects.", 0 },
                    { new Guid("ad138776-3ae1-47fe-949c-ba130167bd0e"), 0, new Guid("c8d6fe54-f66e-4bc6-8d5c-9441e04ab7db"), "You emit an aura of terror. Foes in the area are frightened 1 and unable to reduce the condition.", 0 },
                    { new Guid("230e7f4d-e11a-48bd-ac0f-06c8f2178bf6"), 0, new Guid("aa010c6e-dbb6-4c32-9206-6affd35f77a9"), "You glimpse into the target’s future. Roll a d20; when the target attempts a non-secret saving throw or skill check, it can use the number you rolled instead of rolling, and the spell ends. Alternatively, you can instead reveal the result of the die roll for one of the target’s secret checks during the duration, and the spell ends. Casting it again ends any active diviner’s sight you have cast, as well as any active diviner’s sight on the target.", 0 },
                    { new Guid("de0cd043-c400-4940-9dab-6aba37d4260e"), 0, new Guid("bb70a364-2242-498f-86f3-8d6d07c0c7d9"), "You teleport to a location up to 20 feet away within your line of sight.", 0 },
                    { new Guid("d50755a9-dee2-4926-9207-35dbd6a635aa"), 0, new Guid("ae7b3742-f94d-46e5-9a3f-858748bdc91d"), "You whisper enchanting words to deflect your foe’s ire. The target must attempt a Will save.", 0 },
                    { new Guid("a3f4fd4b-027d-48ac-b19c-407c1842dfad"), 0, new Guid("2fed231b-fe88-4fdb-92b9-ab355e578dcc"), "You fire a ray of sickening energy. Make a spell attack roll.", 0 },
                    { new Guid("5c6f929a-4740-4a62-9c54-bf0f9dbcca4b"), 0, new Guid("c985c9f7-e3ab-4c52-95ed-7bf788633852"), "You augment the abilities of a summoned creature. The target gains a +1 status bonus to all checks (this also applies to the creature’s DCs, including its AC) for the duration of its summoning, up to 1 minute.", 0 },
                    { new Guid("2aa1d392-5a57-44b2-8f01-4b68d85790fa"), 0, new Guid("a1dc26d2-2300-40b1-a592-8e002bdad6f5"), "You designate an area in which creatures are compelled to speak only truth. Creatures within or entering the area have difficulty lying. Each potentially affected creature must attempt a Will save when the spell is cast or when the creature first enters the area. It uses the results of this initial save if it leaves and reenters the area. Affected creatures are aware of this enchantment; therefore, they can avoid answering questions to which they would normally respond with a lie, or they can be evasive as long as they remain within the boundaries of the truth.", 0 },
                    { new Guid("65aa12a6-e8a1-44d5-b8db-290a3b15fd8f"), 0, new Guid("1a9f7c2c-03d9-487d-b4a2-1f64d4227e38"), "You bypass your targets’ rational minds, instilling them with unshakable conviction and zeal. The targets each gain 12 temporary Hit Points and a +2 status bonus to Will saves against mental effects, as their faith overrides the signals from their own bodies and minds. If you tell a target to do something, it must comply with your request, though if it would normally find the task repugnant, it can attempt a Will save at the end of its turn each round due to the cognitive dissonance. On a success, it ends the spell’s effects on itself entirely.", 0 },
                    { new Guid("7cfd35a8-58d6-4c26-b9c2-e110209769ac"), 5, new Guid("98b4f7a4-5a66-4fee-bc6e-74c2b32fe49f"), "The GM might allow you to try using wish to produce greater effects than these, but doing so might be dangerous or the spell might have only a partial effect.", 0 },
                    { new Guid("7814c7cb-d635-4d14-87aa-c6a958c29337"), 0, new Guid("c7149a09-fabf-4ceb-a035-df6dab1f5c92"), "You gain resistance 15 to acid, cold, electricity, or fire damage from the triggering effect (one type of your choice). The resistance applies only to the triggering effect’s initial damage.", 0 },
                    { new Guid("6b057c6e-e0c7-47cc-875d-1737d61512b0"), 4, new Guid("98b4f7a4-5a66-4fee-bc6e-74c2b32fe49f"), "Reverse certain effects that refer to the wish spell.", 2 },
                    { new Guid("63419a2b-fe11-45ad-ad14-9dcb4442c96a"), 2, new Guid("98b4f7a4-5a66-4fee-bc6e-74c2b32fe49f"), "Duplicate any non-arcane spell of 7th level or lower.", 2 },
                    { new Guid("44d05e01-6aa2-401c-b17a-201c70989be0"), 1, new Guid("98b4f7a4-5a66-4fee-bc6e-74c2b32fe49f"), "Duplicate any arcane spell of 9th level or lower.", 2 },
                    { new Guid("c0daf1c4-85bb-4110-a1fe-fe28b2c6638c"), 0, new Guid("98b4f7a4-5a66-4fee-bc6e-74c2b32fe49f"), "You state a wish, making your greatest desire come true. A wish spell can produce any one of the following effects.", 0 },
                    { new Guid("c8d2d31d-d086-42cf-8fe8-5c7a299cef8a"), 0, new Guid("6d457742-ca7d-454c-8389-190800109e95"), "When you cast this spell, each target transforms into a vaguely cloud-like form and is picked up by a wind moving in the direction of your choice. You can change the wind’s direction by using a single action, which has the concentrate trait. The wind carries the targets at a Speed of 20 miles per hour, but if any of the targets make an attack, Cast a Spell, come under attack, or otherwise enter encounter mode, the spell ends for all targets just after they roll initiative, and they drift gently to the ground.", 0 },
                    { new Guid("7993003e-e01e-4096-bcf6-3578035b2971"), 0, new Guid("695c1bb5-5c88-4344-902a-d02e6ab7ce45"), "You fill the targets’ minds with terrifying images of fearsome creatures, each drawn from the targets’ worst fears. Only the targets can see their assailants. Each target takes 16d6 mental damage and must attempt a Will save.", 0 },
                    { new Guid("68e60de5-116b-48f0-a9b8-15b954854b49"), 1, new Guid("d1767a35-390b-496c-b78d-b2dae7e06391"), "Each time a creature in the web begins to use a move action or enters the web during a move action, it must attempt an Athletics check or Reflex save against your spell DC to avoid taking a circumstance penalty to its Speeds or becoming immobilized. A creature that gets out of the web ceases to take a circumstance penalty to its Speed from the web.", 0 },
                    { new Guid("1c57e46a-a24e-4749-8c77-b406aacd8297"), 0, new Guid("d1767a35-390b-496c-b78d-b2dae7e06391"), "You create a sticky web in the area that impedes creatures’ movement each time they try to move through it. Squares filled with the web are difficult terrain. Each square can be cleared of the web by a single attack or effect that deals at least 5 slashing damage or 1 fire damage. A square has AC 5, and it automatically fails its saving throws.", 0 },
                    { new Guid("50f5918f-2d7e-4c4f-9a62-c1941b6f3ea2"), 0, new Guid("68cc985a-d2bb-4d53-8f2c-afc1911c887f"), "You swing a weapon you’re holding, and the weapon magically multiplies into duplicates that swipe at all creatures in either a cone or an emanation. This flurry deals four dice of damage to creatures in the area. This damage has the same type as the weapon and uses the same die size. Determine the die size as if you were attacking with the weapon; for instance, if you were wielding a two-hand weapon in both hands, you’d use its two-hand damage die.", 0 },
                    { new Guid("9ee7d4f2-71cf-44e4-b6ae-4a41df71b5bf"), 5, new Guid("44587a27-1340-41c9-971f-60fa21be2cc2"), "The weapon doesn’t take up space, grant flanking, or have any other attributes a creature would. The weapon can’t make any attack other than its Strike, and feats or spells that affect weapons do not apply to this weapon.", 0 },
                    { new Guid("d314cc21-ae49-44f7-8ca7-f9f43a896c46"), 4, new Guid("44587a27-1340-41c9-971f-60fa21be2cc2"), "When the weapon Strikes, you can deal damage of the normal damage type of the weapon instead of force damage (or any of the available damage types, for a versatile weapon). No other statistics or attributes of the weapon apply, and even a ranged weapon attacks adjacent creatures only. A weapon of judgment is a weapon for the purposes of triggers, resistances, and so forth.", 0 },
                    { new Guid("d0b8b581-3361-46d3-a191-307cd4dc1b96"), 3, new Guid("44587a27-1340-41c9-971f-60fa21be2cc2"), "Strikes with the weapon are melee weapon attacks, but they use your spell attack modifier. Regardless of its appearance, the weapon deals force damage equal to 3d10 plus your spellcasting ability modifier. The weapon takes a multiple attack penalty, which increases throughout the target’s turn, but its penalty is separate from yours.", 0 },
                    { new Guid("b2f5f94a-f030-409d-bf5e-ada21e118fcd"), 2, new Guid("44587a27-1340-41c9-971f-60fa21be2cc2"), "If you name “peace,” mentally choose up to five allies. The target instinctively knows who those allies are. The weapon Strikes the target each time the target uses a hostile action against you or one of your allies. The weapon Strikes only once per action, even if the action targets multiple allies (such as for a fireball or a Whirlwind Strike).", 0 },
                    { new Guid("1a6beafa-11c0-45c1-ae50-eee35869af29"), 3, new Guid("98b4f7a4-5a66-4fee-bc6e-74c2b32fe49f"), "Produce any effect whose power level is in line with the above effects.", 2 },
                    { new Guid("3b4d92e2-6ca9-472d-94ef-63b3f26df254"), 0, new Guid("20ce2bd7-99f8-4247-b9ff-4ff06d534a26"), "You fire an unerring dart of force from your fingertips. It automatically hits and deals 1d4+1 force damage to the target.", 0 },
                    { new Guid("c9facd51-cbe5-4bfd-88eb-0acbb2a12b45"), 0, new Guid("a5d8f9d2-b600-4663-9354-8318e717c0f0"), "You hurl a held melee weapon with which you are trained at the target, making a spell attack roll. On a success, you deal the weapon’s damage as if you had hit with a melee Strike, but adding your spellcasting ability modifier to damage, rather than your Strength modifier. On a critical success, you deal double damage, and you add the weapon’s critical specialization effect. Regardless of the outcome, the weapon flies back to you and returns to your hand.", 0 },
                    { new Guid("4a53ba84-6949-4eab-aa4b-c8d4f8800a0a"), 0, new Guid("f503eac1-c815-415f-978b-7bf2732abe4e"), "You become invisible, with the same restrictions as the 2nd-level invisibility spell.", 0 },
                    { new Guid("16ae0af7-99af-4be4-8334-79dc5f11cacf"), 0, new Guid("912602ab-1cb3-4388-bb9f-c43b234f9359"), "Your divine singing mends wounds and provides a temporary respite from harm. The target gains fast healing 2. When you Cast the Spell and each time you Sustain the Spell, the target gains 2 temporary Hit Points, which last for 1 round.", 0 },
                    { new Guid("4d141a0f-93d6-48ef-a607-01554a481807"), 0, new Guid("41923abd-01b6-44e1-9591-e76f9ccd65e4"), "Your ode temporarily staves off death. The target’s dying condition remains 1 below the value at which it dies. This doesn’t help prevent death from effects that kill the target without increasing its dying condition, such as disintegrate and death effects.", 0 },
                    { new Guid("30d1976d-17a2-48a9-a820-5af8b70f906e"), 0, new Guid("64ec1a63-ef3c-4461-bab0-7a3ea3f6a598"), "Your performance enraptures those who hear it, compelling them to follow you about in admiration. Each creature within the emanation must attempt a Will save when you Cast the Spell or the first time they enter the area, after which they become temporarily immune for 1 day. Once per turn, you can spend a single action, which has the concentrate trait, to increase the emanation’s radius by 5 feet. You can Dismiss the spell.", 0 },
                    { new Guid("166f8df4-8f51-435a-ae56-ad90536b8fd9"), 0, new Guid("bb2135a7-3976-496d-80d4-7e4043c4c336"), "You maintain a brisk performance that keeps allies on the move. You and your allies in the area can Hustle for the spell’s duration, even though you are also Sustaining the Spell. You and your allies then become temporarily immune for 1 day.", 0 },
                    { new Guid("1dcf5217-ebc4-49e2-be67-5ef904508085"), 0, new Guid("22696413-6532-4ce7-8654-0eaf8016fe09"), "You bolster your allies’ physical strength with a hearty exhortation. You and your allies gain a +1 status bonus to Athletics checks and to their DCs against Athletics skill actions such as Disarm, Shove, and Trip.", 0 },
                    { new Guid("56ebfff1-2351-4788-b92f-6bb07371a737"), 1, new Guid("22696413-6532-4ce7-8654-0eaf8016fe09"), "Special - If you have the inspire heroics composition spell, you can use that composition to improve the bonus granted by song of strength in the same way as inspire courage or inspire defense.", 2 },
                    { new Guid("fad31499-2398-422c-897c-2b71d0028514"), 0, new Guid("db9e969f-0a3e-43a9-bac9-b2a672751a30"), "Your symphony lifts listeners from their worldly concerns. Attempt a Performance check to counteract one of the following conditions affecting the target: grabbed, immobilized, paralyzed, restrained, slowed, or stunned. If you fail, you can’t target that effect on the target for 1 day. Use the condition’s source to determine the counteract DC (for example, the Escape DC for grabbed).", 0 },
                    { new Guid("75e05a10-b66f-4093-84d6-2bb6351f0b1f"), 0, new Guid("0f2863be-3c17-450b-9197-a2e7e47d5127"), "Your litany calls into question the morals your foe claims to hold dear. The target gains weakness 7 to evil, then becomes temporarily immune to all your litanies for 1 minute.", 0 },
                    { new Guid("cde541e4-870e-4d6b-a046-f5a6096a7aab"), 0, new Guid("3000a92d-b7e9-477e-8d60-06bec208fbe2"), "You give a speech that fills your target with a drive to improve themself to the exclusion of assisting others. A creature that wants to gain the benefit of this spell and doesn’t care about its limitations can voluntarily fail the save. The target then becomes temporarily immune to all your litanies for 1 minute.", 0 },
                    { new Guid("e2416503-07a9-41fe-9d60-6872faec7726"), 0, new Guid("9c98348b-94c5-4ed2-95cd-80352113e938"), "You infuse the target with negative energy. If the target is living, this deals 1d6 negative damage (basic Fortitude save); on a failed save, the target also takes a –2 status penalty to AC for 1 round.", 0 },
                    { new Guid("a0ec8ee6-4431-46be-927a-2f475341c7e2"), 1, new Guid("9c98348b-94c5-4ed2-95cd-80352113e938"), "If the target is a willing undead creature, the target instead regains 6 Hit Points, and if you are the undead target, you also gain a +2 status bonus to damage rolls for 1 round.", 0 },
                    { new Guid("ee2a2892-36ff-47b0-a1ce-d039764ebdab"), 0, new Guid("4932ec96-cb32-4b48-ade2-68d3e9d6d030"), "You adopt the stance of clinging shadows. You can make shadow grasp Strikes. These deal 1d4 negative damage; are in the brawling group; and have the agile, grapple, reach, and unarmed traits.", 0 },
                    { new Guid("d875794d-fef2-441f-9ef9-3574efe26446"), 1, new Guid("4932ec96-cb32-4b48-ade2-68d3e9d6d030"), "While in clinging shadows stance, you gain a +2 circumstance bonus to Athletics checks to Grapple, and to the DC for creatures to Escape from you.", 0 },
                    { new Guid("d1372d74-d82f-4d76-a3e2-51ee6b554541"), 0, new Guid("914cab4d-07f4-422e-9c00-32be4e544665"), "Drawing from deep wells of spiritual power, you take on a special ki form. In your ki form, your hair, feathers, skin, or scales change color and begin to glow. In this form you gain a fly Speed equal to your land Speed. Choose force, lawful (only if you are lawful), negative, or positive damage. All your Strikes deal 1d6 additional damage of the chosen type. Your entire body is also surrounded by a glowing corona of the same color as your inner ki; this is a light effect. Your corona is a 5-foot emanation that deals 2d6 damage of the chosen type to creatures who start their turn within the emanation. If the emanation overlaps with a darkness effect, the corona’s glow attempts to counteract the darkness effect. Regardless of the outcome, the corona can’t attempt to counteract that effect again for 1 day. As a single action, which has the concentrate trait, you can flare your corona out to become a 30-foot emanation.", 0 },
                    { new Guid("231555a6-aceb-4337-8dde-216968d989ef"), 6, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Athletics modifier of +13, unless your own is higher.", 2 },
                    { new Guid("25872de5-0044-4d23-b17d-b8ad20779569"), 0, new Guid("6246ae7b-b91f-4ae4-a70b-9604f0ecfc8c"), "You create illusory hazards that cover all surfaces in the area (typically the ground). Any creature moving through the illusion treats the squares as difficult terrain. A creature can attempt to disbelieve the effect as normal after using a Seek action or otherwise spending actions interacting with the illusion. If it successfully disbelieves, it ignores the effect for the remaining duration. For each additional action you use casting the spell, the burst’s radius increases by 5 feet, to a maximum of 10 extra feet for 3 actions.", 0 },
                    { new Guid("23df727e-014c-4a99-adbf-584d61e6899a"), 1, new Guid("e09acd1c-36c5-482d-be8f-300b90a92a2a"), "When the spell’s duration ends, you can spend 1 Focus Point as a free action to extend the duration for another hour, though as normal, it ends immediately during your next daily preparations.", 0 },
                    { new Guid("fd5f857c-2087-4e88-b59b-2d12b1a67d83"), 0, new Guid("e09acd1c-36c5-482d-be8f-300b90a92a2a"), "You create an invisible eye sensor, as clairvoyance (page 324). When created, this eye must be in your line of sight.", 0 },
                    { new Guid("f014b191-fe50-411d-ba4d-5bcad4416be9"), 5, new Guid("8c889ff7-c2b6-4c13-84f3-ebe934d07176"), "You gain scent 60 feet (imprecise).", 2 },
                    { new Guid("a1257232-a85f-4392-b71b-3ff60b77c492"), 4, new Guid("8c889ff7-c2b6-4c13-84f3-ebe934d07176"), "You gain a pair of claws. These are agile finesse unarmed attacks that deal 1d8 slashing damage.", 2 },
                    { new Guid("915c86c6-17c5-4b9c-a3bc-60684727951f"), 3, new Guid("8c889ff7-c2b6-4c13-84f3-ebe934d07176"), "You gain darkvision.", 2 },
                    { new Guid("a2c46a4a-94a7-43d1-ae98-28d123616365"), 2, new Guid("8c889ff7-c2b6-4c13-84f3-ebe934d07176"), "You gain a climb or swim Speed equal to half your Speed.", 2 },
                    { new Guid("868cef53-da5a-4c06-afc0-8200ec8172c6"), 1, new Guid("8c889ff7-c2b6-4c13-84f3-ebe934d07176"), "You gain a 20-foot status bonus to your Speed.", 2 },
                    { new Guid("84122d03-7e6a-4bc1-bef7-7754aed15c0f"), 0, new Guid("8c889ff7-c2b6-4c13-84f3-ebe934d07176"), "You gain one of the following abilities of your choice. You can Dismiss this spell.", 0 },
                    { new Guid("8d05189a-7002-49b1-bfea-fddf7cd1e7c3"), 0, new Guid("12be19ae-8cac-40b8-834e-8ac1a582024b"), "You emanate a shimmering aura of protective magic. You and any allies in the area gain a +1 status bonus to AC. Each time you Sustain the Spell, the emanation’s radius increases by 5 feet, to a maximum of 30 feet.", 0 },
                    { new Guid("b0bd2e8d-0ad8-4dc5-aaf1-00a7385314af"), 0, new Guid("681a87e9-9b6d-4188-b3b2-35e7f5dd69b5"), "You temporarily improve the target’s physique. The target gains a +2 status bonus to the next Acrobatics check, Athletics check, Fortitude save, or Reflex save it attempts.", 0 },
                    { new Guid("74d506fe-cae9-4d97-9f45-886a3206cd00"), 0, new Guid("52cde738-bac5-48e6-a245-3f51ff948fa4"), "You use some of the spell’s magic to heal yourself, regaining 1d8 Hit Points per level of the spell.", 0 },
                    { new Guid("116c71dd-0041-47b2-996a-04d6ca06d64f"), 1, new Guid("44587a27-1340-41c9-971f-60fa21be2cc2"), "If you name “war,” mentally choose one creature. This must be a creature both you and the target can see. The target instinctively knows which creature this is. At the end of each of the target’s turns, if the target did not use a hostile action against the creature you chose during that turn, the weapon Strikes the target.", 0 },
                    { new Guid("82ea5417-c9a8-459b-97c0-967f1daaa2e3"), 0, new Guid("44587a27-1340-41c9-971f-60fa21be2cc2"), "An immense weapon of force appears, hovering in the air above the target. The weapon has the ghostly visual appearance of your deity’s favored weapon. Name war or peace when you cast this spell.", 0 },
                    { new Guid("832f8f39-2be7-4702-8dd9-68b9375b4e2e"), 0, new Guid("51ebdb5b-77c4-4039-94b3-1ff8f22cf63f"), "The target can walk on the surface of water and other liquids without falling through. It can go underwater if it wishes, but in that case it must Swim normally. This spell doesn’t grant the ability to breathe underwater.", 0 },
                    { new Guid("59d58dcc-9da2-4c18-b825-6c8ea481298d"), 0, new Guid("0a2a8d57-780a-4221-9135-44163b82d0a3"), "Grasping darkness surges from you, dealing 14d4 negative damage. Each creature in the area must attempt a Fortitude save.", 0 },
                    { new Guid("09131262-ebb4-4b73-af25-6369b51e5d9a"), 0, new Guid("5f26aaa9-b610-4e1b-a10a-106f36f14f43"), "Vitality radiates outward from you, allowing others to supplicate and receive healing. Once per round, either you or an ally can use an Interact action to supplicate and lay hands upon you to regain Hit Points. Each time the beacon heals someone, it decreases in strength. It restores 4d10 Hit Points to the first creature, 4d8 Hit Points to the second, 4d6 Hit Points to the third, and 4d4 Hit Points to the fourth, after which the spell ends. You can have only one vital beacon active at a time.", 0 },
                    { new Guid("9da8b2d7-d553-4123-b778-de348cda1f26"), 0, new Guid("6473f72f-e3e2-4376-ae87-a05bead11615"), "An illusion of horrific creatures fills the spell’s area. The creatures look like Tiny swarming monsters with a specific appearance of your choice, such as Hellish flies or animated saw blades. The burst deals 8d8 mental damage (basic Will save) to each creature that’s inside the burst when it’s created, enters the burst, or starts its turn inside the burst. A creature that critically succeeds at its Will save can immediately attempt to disbelieve the illusion. A creature that tries to Interact with the monsters or observes one with a Seek action can attempt to disbelieve the illusion. Creatures that disbelieve the illusion take no damage from the illusion thereafter.", 0 },
                    { new Guid("51cb811e-7a24-456a-8451-b5ff28641856"), 1, new Guid("f6c126fd-db6b-49bf-8439-7da6cf8b442f"), "In addition, a creature must attempt a Will saving throw if it’s inside the pattern when you cast it, enters the pattern, ends its turn within the pattern, or uses a Seek or Interact action on the pattern. A creature currently blinded by the pattern doesn’t need to attempt new saving throws.", 0 },
                    { new Guid("5d4699d0-7437-4684-b08f-b8fec907ea61"), 0, new Guid("f6c126fd-db6b-49bf-8439-7da6cf8b442f"), "You create a pattern of lights that pulses with intensity. Creatures are dazzled while inside the pattern.", 0 },
                    { new Guid("5dc678cb-ff9a-474f-bc06-d6e19324f79e"), 0, new Guid("20c4195e-1a05-4f56-9128-cfe66887f95c"), "Whenever you speak or make any other sound vocally, you can make your vocalization seem to originate from somewhere else within 60 feet, and you can change that apparent location freely as you vocalize. Any creature that hears the sound can attempt to disbelieve your illusion.", 0 },
                    { new Guid("9c216e85-c937-49e5-b62b-b4f11ebb40c0"), 1, new Guid("68695461-f97b-4eec-a786-24c53ccbcade"), "Casting veil counts as setting up a disguise for the purpose of the Impersonate action. It allows the target to ignore any circumstance penalties they might take for being disguised as dissimilar creatures, and it gives the targets a +4 status bonus to Deception checks to prevent others from seeing through their disguises, and add their level even if untrained. You can Dismiss any or all of these disguises.", 0 },
                    { new Guid("e992d4a8-f065-4ec0-bc76-6f60c1c07713"), 0, new Guid("68695461-f97b-4eec-a786-24c53ccbcade"), "You disguise the targets as other creatures of the same body shape and roughly similar height (within 6 inches) and weight (within 50 pounds). The disguise can hide the targets’ identities or let them appear to be of another ancestry, but it’s not precise enough to impersonate specific individuals. The spell doesn’t change voice, scent, or mannerisms. You choose the disguise for each target; for example, you could make one target appear to be a dwarf and another an elf.", 0 },
                    { new Guid("e1a0c52b-5ec6-422a-a7e4-65efb924c388"), 0, new Guid("64be4389-bc36-4e72-a569-0eaf700fb16d"), "Your touch leeches the lifeblood out of a target to empower yourself. You deal 6d6 negative damage to the target. You gain temporary Hit Points equal to half the negative damage the target takes (after applying resistances and the like). You lose any remaining temporary Hit Points after 1 minute.", 0 },
                    { new Guid("8ecd9ec1-e07a-4792-ba73-7e6dcf0498db"), 0, new Guid("233f2ea3-dcd8-4e66-8fd4-23c3da97f7ae"), "You call upon an endless barrage of flames, producing miniature fireballs in your hands to hurl at foes. You cast produce flame as part of casting flaming fusillade. For the duration of flaming fusillade, produce flame’s casting time is reduced from 2 actions to 1.", 0 },
                    { new Guid("72a6ea55-0958-44e4-9f97-ac092f7072bb"), 1, new Guid("2464670c-7c98-4fc8-9489-b1aeaf23ba8f"), "You gain temporary Hit Points equal to half the damage a single creature takes from this spell; calculate these temporary Hit Points using the creature that took the most damage. You lose any remaining temporary Hit Points after 1 minute.", 0 },
                    { new Guid("c94c47e7-9583-478a-99c3-b338ca02df20"), 0, new Guid("2464670c-7c98-4fc8-9489-b1aeaf23ba8f"), "You draw in the blood and life force of other creatures through your outstretched arms. You deal 12d6 negative damage to living creatures in the area.", 0 },
                    { new Guid("6a6fcd00-d9ab-44ee-bae8-1db47cc1a469"), 0, new Guid("12480683-3983-4868-9856-bacbcaf58396"), "You summon an unseen servant (see the sidebar), which you can command as part of Sustaining the Spell. It serves you until its Hit Points are reduced to 0, at which point the spell ends, or until you stop Sustaining the Spell. The unseen servant gains the summoned trait.", 0 },
                    { new Guid("4e2f1757-b5ac-438f-a72b-b668b77cfd9c"), 2, new Guid("a8a04331-d5c1-4fa7-b1d1-33dd89f0106e"), "If the target to be tracked is willing, the duration is 1 hour. If you try to track an unwilling creature, the target must attempt a Will save.", 0 },
                    { new Guid("8aa3b15b-e964-4776-b8bb-516139044c80"), 1, new Guid("a8a04331-d5c1-4fa7-b1d1-33dd89f0106e"), "The tracking creatures can see the tracked creature or object through all barriers other than lead or running water, which block their vision. Distance doesn’t matter, though the creature or object might move so far away it becomes too small to perceive. The tracking creatures don’t see any of the environment around the target, though they do see any gear a creature is wearing or holding, and they can tell if it removes objects from its person.", 0 },
                    { new Guid("f5521c85-ee87-44a8-b9c2-dcc7b0c21f64"), 0, new Guid("d273f2b3-f03a-4647-8eb8-3b9bbd3add82"), "You gain the ability to perform a specialized combat technique from the vast wealth of martial knowledge your mystery provides. When you Cast this Spell, you use the action granted by one common fighter feat from pages 144–153 of the Core Rulebook or pages 126–127 of this book (your GM might add feats to this list). If you Cast this Spell using 2 actions, the granted action must be a single action, and if you Cast this Spell using 3 actions, you can instead choose a feat that grants a 2-action activity. The chosen feat’s level can be no higher than heroic feat’s spell level. The feat can’t have a Frequency entry, and you must meet its prerequisites and requirements in order to select it.", 0 },
                    { new Guid("01ccffb6-31fc-412a-b895-be3d609c976d"), 0, new Guid("9dee4209-a50f-45fe-afb7-50a6119f1a1e"), "You surround yourself with a combustible aura. Each time a creature within the emanation takes fire damage, it catches on fire, taking 2d4 persistent fire damage.", 0 },
                    { new Guid("d43ae96b-8e79-428f-ab6c-8748347092d1"), 0, new Guid("4e39b70b-f8b5-49b8-a73f-6b8c5e06a64b"), "You call upon the frigid depths of outer space to bring a terrible chill to your enemy. The target is cloaked in the freezing void, which deals 3d6 cold damage immediately and when you Sustain the Spell on future turns, with a basic Fortitude save. The target is fatigued for as long as the effect persists.", 0 },
                    { new Guid("3410d23e-286d-4f61-810e-eb9548c36868"), 0, new Guid("a8a04331-d5c1-4fa7-b1d1-33dd89f0106e"), "This spell grants perfect sight based on scrying, allowing several willing targets to track the exact movements or position of one creature or object. Choose one target creature or object in the area to be tracked. It becomes the sensor for the spell. Up to five willing creatures of your choice in the area can see a ghostly image of this creature or object when it’s out of their sight. They can perceive the creature or object perfectly, allowing them to ignore the concealed or invisible condition, though physical barriers still provide cover.", 0 },
                    { new Guid("8b675cff-cc03-4767-8ae8-0dd74c96c97f"), 0, new Guid("828aa492-5c0a-4c77-8a3c-8bdb17a8f611"), "You free those who travel alongside you from environmental hindrances. Targets don’t take circumstance penalties to Speed from vegetation, rubble, winds, or other properties of the environment, whether or not the environment is magical, and they ignore difficult terrain from such environmental properties.", 0 },
                    { new Guid("8bbc1694-0ec7-4ac8-ab8a-31af421579ce"), 1, new Guid("71731631-7fb9-4bea-8b7e-d2c4ddcd655c"), "If a target creature fails or critically fails their saving throw, the table below can be referenced for the result of the 1d4 roll.", 0 },
                    { new Guid("6c64ff08-0d8e-4714-baf0-5bb7dab9ffce"), 0, new Guid("71731631-7fb9-4bea-8b7e-d2c4ddcd655c"), "Fleeting notes of a strange and unnatural song fill the air, overtaking the mind. Each target must attempt a Will save when you cast the spell, and again the first time you Sustain the Spell each round. A creature needs to attempt only one save against the song each round, and you have to keep the same targets when you Sustain the Spell.", 0 },
                    { new Guid("52689e64-c838-4577-9dd6-0935fec93ca4"), 0, new Guid("f8888403-d4a1-4ac5-8946-deaad02e66e5"), "You transcend your physical form, becoming a beacon of healing energy. Your body exudes bright light like a torch. You gain resistance 5 to precision damage and weakness 5 to negative damage, and your unarmed Strikes deal an extra 1d4 positive damage.", 0 },
                    { new Guid("bbae0a4a-00a9-4aba-b0b5-7c047065aa61"), 1, new Guid("f8888403-d4a1-4ac5-8946-deaad02e66e5"), "You can touch a living creature with an Interact action to restore 6d8 Hit Points to it, and when a creature touches you with an Interact action you can allow it to gain the same healing; either way, the creature becomes temporarily immune to life-giving form’s healing for 1 minute. This is a positive healing effect. You can’t heal yourself with life-giving form. A creature harmed by positive damage (such as an undead) that touches you or damages you with an unarmed attack or non-reach melee weapon instead takes 3d4 positive damage, and it doesn’t become temporarily immune.", 0 },
                    { new Guid("d1e21fdd-c1b5-4b2e-962b-30900d47e734"), 2, new Guid("f8888403-d4a1-4ac5-8946-deaad02e66e5"), "You can Dismiss this spell.", 0 },
                    { new Guid("4ee4a1e5-a47c-49b2-a793-9e6a0044a8fa"), 0, new Guid("c81cc083-9d1c-4e09-8777-ae07e067b3bd"), "You shroud a creature or object in wards that hide its alignment. The target appears to be neutral to all effects that would detect its alignment.", 0 },
                    { new Guid("7dce0a95-c087-454b-a52a-3d6ffba0fe0e"), 0, new Guid("4ee5fbc3-1c55-45fb-be27-97de76109c27"), "The target is overcome with an all-consuming urge to dance. For the duration of the spell, the target is flat-footed and can’t use reactions. While affected, the creature can’t use actions with the move trait except to dance, using the Stride action to move up to half its Speed.", 0 },
                    { new Guid("d3ce3d44-56b2-4c5a-963c-1a3918442c81"), 0, new Guid("014fc787-f0a9-41ec-a59e-835b07ee0245"), "You delve into the possible futures of the next few seconds to understand all the ways your foe might avoid harm, then cast out a vision of that future to those around you. Designate a creature. The first time each target makes an attack roll against that creature during true target’s duration, the attacker rolls twice and uses the better result. The attacker also ignores circumstance penalties to the attack roll and any flat check required due to the designated creature being concealed or hidden.", 0 },
                    { new Guid("3bd83d19-4071-43d5-a369-9e0970685e7b"), 0, new Guid("120f7798-342f-42f8-a213-8053fbc4f6bf"), "The ground opens up, spraying a column of lava high into the air in a vertical cylinder, dealing 14d6 fire damage to creatures in the area. The lava rapidly cools and encases creatures in the area. A creature encased in rock is clumsy 1 and takes a –10-foot status penalty to its Speeds. All normal terrain is difficult terrain to a flying creature, and such creatures immediately descend 20 feet the moment they’re encased, but they don’t take damage from this fall. A creature encased in rock can attempt to Escape against your spell DC to end the effect. Otherwise, the creature remains encased until it takes a total of 50 damage, freeing it from the rock.", 0 },
                    { new Guid("f6a06002-c567-4c5d-8133-dbed8a879807"), 0, new Guid("849ede9e-7dd9-434e-89e7-a2f10636bb08"), "You fling a spray of tiny shooting stars, dealing 1d4 fire damage. Each creature in the area must attempt a Reflex save.", 0 },
                    { new Guid("308a052a-de86-425c-84ab-8972fe579ae6"), 1, new Guid("120f7798-342f-42f8-a213-8053fbc4f6bf"), "Additionally, creatures in the area and those within 5 feet of the lava column automatically take 3d6 fire damage from the intense heat, regardless of the results of their saving throws.", 0 },
                    { new Guid("23c39a69-ffbd-4406-b1b1-29558f0a8f5e"), 0, new Guid("d401091b-7d19-46c6-aa97-a510fb2d8cc7"), "You raise a blazing wall that burns creatures passing through it. You create either a 5-foot-thick wall of flame in a straight line up to 60 feet long and 10 feet high, or a 5-foot-thick, 10-foot-radius ring of flame with the same height. The wall stands vertically in either form; if you wish, the wall can be of a shorter length or height. Everything on each side of the wall is concealed from creatures on the opposite side. Any creature that crosses the wall or is occupying the wall’s area at the start of its turn takes 4d6 fire damage.", 0 },
                    { new Guid("a0e5bd38-57d0-42e0-86c8-7d68b169b205"), 0, new Guid("df05c559-44c5-4780-bbdd-ae3e8df0587a"), "The targets can breathe underwater.", 0 },
                    { new Guid("8bca2147-27ca-4e2c-9470-4bdd9f4446a1"), 0, new Guid("8dd7a3d1-736c-49fb-bf06-019fb7f530ca"), "You sift through the multiverse’s divine knowledge, seeking out tidbits related to a particular subject. Choose one Lore skill. You temporarily gain the same proficiency rank in that Lore skill as your proficiency rank for your oracle spellcasting.", 0 },
                    { new Guid("8180da6b-0c6f-4da5-a819-d11356e95cf4"), 0, new Guid("f9448ab0-82fe-4cd1-a2d7-91ae71b6ed5a"), "Your ancestor protects you against those who would bend your will. You roll the triggering save twice and use the better result. If you’re in an encounter when you cast this spell, you immediately roll to change your predominant ancestor.", 0 },
                    { new Guid("ccc09e3b-c6f2-4fde-a925-186ed1f57dd5"), 0, new Guid("e37e394e-c9a8-423d-8ad0-34b8f628226e"), "You take the form of your ancestral spirits, becoming invisible and quasi-corporeal. You gain resistance 10 to all damage (except force and damage from Strikes with the ghost touch property rune), and this resistance is doubled against non-magical and precision damage. You gain a fly Speed equal to your land Speed; when Flying, moving upward isn’t difficult terrain for you. You can’t move through solid objects, but you can float through tiny gaps. You can’t Cast Spells (but you can Sustain a Spell), activate items, or use actions that have the attack or manipulate trait.", 0 },
                    { new Guid("0d5303bc-ad15-435b-b98c-5bce486020d6"), 0, new Guid("161689fc-881b-4888-b108-46f0bab8373c"), "You touch a creature and force them to see and feel the ancestors surrounding you. The target takes 1d4 mental damage, with results depending on a Will save.", 0 },
                    { new Guid("4c5ba88e-35d9-44f9-b64f-a8a855e83cdf"), 0, new Guid("17af2ab4-8d16-46bf-a26a-dc1865b7fb68"), "You ossify your physical form, mimicking the durability of bone. You gain resistance 3 to cold, electricity, fire, piercing, and slashing damage.", 0 },
                    { new Guid("a40b7714-5bd4-4aa7-a14a-4be9ce4efdb7"), 0, new Guid("ec9aaa24-7288-4ab5-9f9f-f8c964f554b8"), "You scramble a creature’s mental faculties and sensory input. The target must attempt a Will saving throw. Regardless of the result of that save, the target is then temporarily immune for 10 minutes. Warp mind’s effects happen instantly, so dispel magic and other effects that counteract spells can’t counteract them. However, alter reality, miracle, primal phenomenon, restoration, or wish can still counteract the effects.", 0 },
                    { new Guid("48113ea8-b072-49f0-92b2-ada6a7733c11"), 0, new Guid("81b02bc3-d60d-48f0-9f1c-4f4f8de06254"), "You call upon the beyond to guide your route. When you Cast this Spell, choose a destination; you receive an inspired route to that destination, allowing you and allies who travel overland with you to reduce the movement penalty from difficult terrain by half for the duration, as long as you don’t deviate from the inspired route. This doesn’t have any effect on movement during encounters. If you use this ability again before the duration is over, this effect ends and is replaced by that of the new route.", 0 },
                    { new Guid("e1c5327a-a42c-4772-8a9b-58a6c7d7f153"), 3, new Guid("82285375-7f60-4f6e-953c-747f79584516"), "A creature that attempts to fly through the wall using a move action must attempt a Fortitude save.", 2 },
                    { new Guid("0f14535a-97e5-4d2f-b561-59e10229a299"), 2, new Guid("82285375-7f60-4f6e-953c-747f79584516"), "The wall is difficult terrain to creatures attempting to move overland through it. Gases, including creatures in gaseous form, can’t pass through the wall.", 2 },
                    { new Guid("5f0062cc-68cd-4569-857e-c88e1b0c2389"), 1, new Guid("82285375-7f60-4f6e-953c-747f79584516"), "Ammunition from physical ranged attacks—such as arrows, bolts, sling bullets, and other objects of similar size—can’t pass through the wall. Attacks with bigger ranged weapons, such as javelins, take a –2 circumstance penalty to their attack rolls if their paths pass through the wall. Massive ranged weapons and spell effects that don’t create physical objects pass through the wall with no penalty.", 2 },
                    { new Guid("dde7d37a-3e6f-44ec-b584-aaa35bef6899"), 0, new Guid("82285375-7f60-4f6e-953c-747f79584516"), "You create a barrier of gusting winds that hinders anything moving through it. The wall of swirling winds is 5 feet thick, 60 feet long, and 30 feet high. The wall stands vertically, but you can shape its path. Though the wall of wind distorts the air, it does not hamper sight. The wall has the following effects.", 0 },
                    { new Guid("e235e8e0-1909-4c19-83bb-42345cc9b8a6"), 0, new Guid("ce8baedc-c775-4830-82b0-f22d82de0666"), "You’re difficult to remove from battle. You gain a +2 status bonus to the triggering save, and if the triggering save is against an incapacitation effect, it treats you as if you were 2 levels higher.", 0 },
                    { new Guid("ecb325a7-4e62-424c-b7c6-7bd5a7aca599"), 1, new Guid("4d610239-1c59-4fc5-a16a-a5aef7f89b29"), "Each 5-foot-by-5-foot section of the wall has AC 10, Hardness 10, and 20 Hit Points. It’s immune to critical hits and precision damage. A destroyed section can be moved through freely.", 0 },
                    { new Guid("a329e62e-abf9-4fdf-87ea-8508e59f03d2"), 0, new Guid("4d610239-1c59-4fc5-a16a-a5aef7f89b29"), "Over the course of a minute, you cause a thick wall of thorny brambles to grow from the ground. You create a 5-foot-thick wall of brambles and thorns in a straight line up to 60 feet long and 10 feet high. You must create the wall in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost. The wall stands vertically. If you wish, the wall can be of a shorter length or height. Everything on each side of the wall has cover from creatures on the opposite side, and the wall’s spaces are difficult terrain. For every move action a creature uses to enter at least one of the wall’s spaces, that creature takes 3d4 piercing damage.", 0 },
                    { new Guid("31e01a97-a11a-4953-93d2-3bed2260b5bd"), 1, new Guid("5a043675-fed0-4aa8-86d4-1fc30eb28c12"), "Each 5-foot-by-5-foot section of the wall has AC 10, Hardness 14, and 50 Hit Points, and it’s immune to critical hits and precision damage. A destroyed section of the wall can be moved through, but the rubble created from it is difficult terrain.", 0 },
                    { new Guid("0d39792e-04e6-4de7-929f-1da88ffe66bc"), 0, new Guid("5a043675-fed0-4aa8-86d4-1fc30eb28c12"), "You shape a wall of solid stone. You create a 1-inch-thick wall of stone up to 120 feet long, and 20 feet high. You can shape the wall’s path, placing each 5 feet of the wall on the border between squares. The wall doesn’t need to stand vertically, so you can use it to form a bridge or set of stairs, for example. You must conjure the wall in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost.", 0 },
                    { new Guid("be994b46-706c-4c89-b69a-8619961877c4"), 1, new Guid("d6e7d875-4fe9-4647-a05b-bd7edfd02e01"), "Each 10-foot-by-10-foot section of the wall has AC 10, Hardness 10, and 40 Hit Points, and it’s immune to critical hits, cold damage, and precision damage. A section also has weakness to fire 15; a section of the wall destroyed by fire melts, evaporating into water and steam. A section destroyed by means other than fire leaves behind a chilling mass of ice that is difficult terrain and deals 2d6 cold damage to any creature passing through it.", 0 },
                    { new Guid("b9e5b198-1a39-4aa4-ae73-b2e639510c18"), 0, new Guid("f53d6411-c7c8-49c0-a707-c241d0fd287d"), "You probe the target’s mind to glean knowledge. This deals 1d8 mental damage with a basic Will save. If the target fails the save, you sort through the stolen memories to attempt a single check to Recall Knowledge. Choose a skill that has the Recall Knowledge action, and use the target’s skill modifier for the check.", 0 },
                    { new Guid("70688af2-20e4-487a-ac58-8c908ac3cb6f"), 0, new Guid("bb25bf00-0614-4a04-838d-0d3a53149a13"), "You cry out a call to arms, inspiring your allies to enter the fray. Each ally in the area gains a +2 status bonus to their initiative roll and gains temporary Hit Points equal to the spell’s level; these temporary Hit Points last for the spell’s duration.", 0 },
                    { new Guid("ed17ba9f-b289-488d-a411-00add20ccdb5"), 0, new Guid("d6e7d875-4fe9-4647-a05b-bd7edfd02e01"), "You sculpt an ice barrier that blocks sight and, once shattered, freezes foes. You create either a 1-foot-thick wall of ice in a straight line up to 60 feet long and 10 feet high (the wall doesn’t have to be vertical, but it must be anchored on both sides to a solid surface) or a 1-foot-thick, 10-foot radius hemisphere of ice. The ice that makes up the wall is opaque. If you wish, the wall can be of a smaller length, height, or radius. You must create the wall in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost.", 0 },
                    { new Guid("f37a65bf-c439-421e-9d04-fe98e3e42733"), 1, new Guid("fb7595af-080a-45c9-a0fe-122b638af1ef"), "Wall of force is immune to counteracting effects of its level or lower, but the wall is automatically destroyed by a disintegrate spell of any level or by contact with a rod of cancellation or sphere of annihilation.", 0 },
                    { new Guid("48924ea5-f7a0-481b-8315-769294f81889"), 0, new Guid("fb7595af-080a-45c9-a0fe-122b638af1ef"), "You form an invisible wall of pure magical force up to 50 feet long and up to 20 feet high. The wall has no discernible thickness. You must create the wall in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost. The wall has AC 10, Hardness 30, and 60 Hit Points, and it’s immune to critical hits and precision damage. The wall blocks physical effects from passing through it, and because it’s made of force, it blocks incorporeal and ethereal creatures as well. Teleportation effects can pass through the barrier, as can visual effects (since the wall is invisible).", 0 },
                    { new Guid("21e99787-61af-442e-bb57-3d0d34854ccf"), 0, new Guid("669facf8-143b-42c8-8ffe-07f6461fce0a"), "You attempt to wrest control of a target undead or force it to recognize you as its master. If the target is controlled by another creature, that controller attempts a Will saving throw to retain control; otherwise, the target must attempt a Will save.", 0 },
                    { new Guid("b6104694-07f5-4cb4-9727-e109e1c51b1f"), 0, new Guid("39c1e512-ad76-4e16-a2ed-3d9c6f437b3d"), "You reveal a glimpse of the impossible conflicts between the divine anathema behind your curse, forcing you to reckon with another’s conflicts as well. You and the target each take 9d6 mental damage with a basic Will save, and the target is stunned 1 if it critically fails its save. You get a degree of success one better than you rolled for your saving throw.", 0 },
                    { new Guid("4c096d15-ee2e-465d-b643-9ef68c89243b"), 0, new Guid("15df34e2-0c94-44cd-98a5-6f73fed08d59"), "With a surge of healing energy, you push back against an affliction threatening the target and grant a small amount of healing. The target recovers 3d8 Hit Points. You attempt to counteract any one affliction you are aware the target has, suspending its effects for 1 hour on a success rather than removing it. The target is then temporarily immune to delay affliction for 1 day. You don’t need to have identified the name of the specific affliction, but you do need to be aware of it; for instance, you couldn’t delay an ingested poison during its onset period unless you were aware of the poison.", 0 },
                    { new Guid("0e70b211-e1b8-4a23-aeab-3a43ba818ebb"), 0, new Guid("1ff088f8-98f6-4a8e-b15d-bedfe91cb20c"), "You utter a powerful secret at odds with the fundamental nature of the target creatures. Choose a specific resistance or weakness that you believe one or more of the targets have due to Recall Knowledge or previous experience with the targets, such as resistance to fire or weakness to silver. If the information is incorrect for a given target, the spell has no effect on that target. Affected targets must attempt a Will saving throw.", 0 },
                    { new Guid("a7da0299-b2d8-4a99-9fbb-942841ee95d6"), 0, new Guid("26e26a2a-c825-4d3c-91d4-abf053a5a19c"), "Your scream chills the souls of enemies that hear it. Each living enemy in the area takes 8d10 negative damage and must attempt a Fortitude save.", 0 },
                    { new Guid("9dcb0a12-39a5-4269-baa6-51b58ebe8421"), 2, new Guid("79da888e-0a2e-4268-b3ec-b42e0023ee38"), "Lessen a Toxin - Reduce the stage of one toxin the target suffers from by one stage. This can’t reduce the stage below stage 1 or cure the affliction.", 2 },
                    { new Guid("de9a51ed-b319-4fd8-9ec6-cc4c594b57b8"), 1, new Guid("ca24f0d7-be39-45e0-9595-bdb1ac2ca7c4"), "You can also direct the blight to rot all Small and Tiny non-creature plants in the area, eliminating non-magical undergrowth and any resulting difficult terrain, cover, and concealment. Sudden blight attempts to counteract any magical effect on the plants before withering them.", 0 },
                    { new Guid("918f29e5-879a-44eb-88d8-57521d2bff77"), 0, new Guid("79da888e-0a2e-4268-b3ec-b42e0023ee38"), "Restorative magic counters the effects of toxins or conditions that prevent a creature from functioning at its best. When you cast restoration, choose to either reduce a condition or lessen the effect of a toxin. A creature can benefit from only one restoration spell each day, and it can’t benefit from restoration more than once to reduce the stage of the same exposure to a given toxin.", 0 },
                    { new Guid("bee36d06-49f2-4710-acff-7ba60c265f24"), 9, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "Kaiju - Speed 50 feet; resistance 5 to physical damage; Melee [one‑action] jaws (reach 30 feet), Damage 6d10+10 piercing; Melee [one‑action] claws (agile, reach 30 feet), Damage 6d8+8 slashing; Melee [one‑action] foot (agile, reach 15 feet), Damage 6d6+10 bludgeoning; Unstoppable You are immune to being immobilized and ignore difficult terrain and greater difficult terrain; Trample [three‑actions] You move up to double your Speed and move through the spaces of Huge or smaller creatures, trampling each creature whose space you enter. A trampled creature takes foot damage with a basic Reflex save against your spell DC.", 2 },
                    { new Guid("bc61c9e6-89e7-4f9d-a645-3438c92a988d"), 8, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "Green Man - Speed 40 feet, climb Speed 40 feet; Melee [one‑action] vines (reach 30 feet, versatile P), Damage 6d8+12 bludgeoning; Ranged [one‑action] thorns (range 100 feet), Damage 6d6+6 piercing; Green Caress (aura, primal, transmutation) 60 feet. Enemies other than plants must succeed at a Fortitude save against your spell DC or become clumsy 1 for 1 round (clumsy 2 on a critical failure).", 2 },
                    { new Guid("8e633454-53cc-40ce-8787-cc6f8d18a464"), 7, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "You also gain specific abilities based on the type of incarnation you choose:", 0 },
                    { new Guid("dd79e694-87f7-4bd6-9ae3-bb2f62269016"), 6, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "Athletics modifier of +36, unless your own modifier is higher.", 2 },
                    { new Guid("b5b3aa04-9fe3-4443-b14b-1ae19a2c51e3"), 5, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "One or more attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +34, and you use the listed damage. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If your unarmed attack modifier is higher, you can use it instead.", 2 },
                    { new Guid("36a8edba-88b7-4136-9809-52ab5901ceea"), 4, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "Darkvision.", 2 },
                    { new Guid("90c8c3ea-3897-4923-be6b-3beae9ea60f2"), 3, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "30 temporary Hit Points.", 2 },
                    { new Guid("c6145e7a-b870-474f-b15b-b6db5083f816"), 2, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "AC = 25 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("0c2726e8-3d16-4a9e-8322-9e88cc19862d"), 1, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("0d296056-30ad-4438-859c-180323dc76fe"), 0, new Guid("79fa61d9-0d18-4e2f-90b2-bc7bea5af121"), "The primal power of the world flows through you. You transform into an incarnation of nature, either a green man or a kaiju. Your battle form is Medium for a green man or Gargantuan (30-foot-by-30-foot space) for a kaiju. You must have enough space to expand into or the spell is lost. While in this form, you gain the plant trait (for a green man) or the beast trait (for a kaiju). You can Dismiss the spell.", 0 },
                    { new Guid("9aa529ac-774f-4a26-b652-ba4b859b646d"), 2, new Guid("ea580e26-250c-48ee-83ee-c611d49cf2c9"), "If a target is in the light of a full moon, it also grows by one size if it were Medium or smaller. This increases the reach of a Medium or Tiny creature by 5 feet.", 0 },
                    { new Guid("36ed9152-bfd7-4e5d-aca3-25dd14281c51"), 1, new Guid("ea580e26-250c-48ee-83ee-c611d49cf2c9"), "The targets can’t use concentrate actions unless those actions also have the rage trait, with the exception of Seek. A creature can attempt to end the spell’s effect on itself by using a single action, which has the rage trait, to attempt a Will save against your spell DC; on a success, it ends the spell’s effect on itself.", 0 },
                    { new Guid("dc0838d7-976b-43f7-822a-9b3a95d4c885"), 0, new Guid("68c02829-5dff-4f8c-9c7a-048f14c522be"), "Animals and plants in the area turn against the targets. Each target suffers from the following effects as long as it remains in the area.", 0 },
                    { new Guid("c45b379f-ea80-4147-bdd9-c1ed9ef97bfd"), 0, new Guid("ea580e26-250c-48ee-83ee-c611d49cf2c9"), "A feral aspect overcomes the targets, making them tough and savage. Targets gain 5 temporary Hit Points, a +10-foot status bonus to their Speeds, and weakness 5 to silver. They also grow vicious fangs and claws, which are unarmed attacks. The fangs deal 2d8 piercing damage; the claws deal 2d6 slashing damage and have the agile and finesse traits. The targets use their highest weapon or unarmed attack proficiency with these attacks, and if they have weapon specialization or greater weapon specialization, they add this damage as well. On a critical hit with one of these unarmed attacks, the creature struck takes 1d4 persistent bleed damage.", 0 },
                    { new Guid("d49058cc-8c0c-4088-929f-ec1b608feea3"), 9, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "Purple - Worm Speed 40 feet, burrow Speed 30 feet, swim Speed 20 feet; Melee [one-action] jaws (reach 10 feet), Damage 2d12+20 piercing; Melee [one-action] stinger (agile, reach 10 feet), Damage 2d8+15 piercing plus 2d6 persistent poison; Melee [one-action] body (reach 10 feet) Damage 2d8+20 bludgeoning; Inexorable You automatically recover from the paralyzed, slowed, and stunned conditions at the end of each of your turns. You’re also immune to being immobilized and ignore difficult terrain and greater difficult terrain.", 2 },
                    { new Guid("85d739d7-4fde-4300-a34e-d27d240896a7"), 8, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "Phoenix - Speed 30 feet, fly Speed 90 feet; Melee [one-action] beak (reach 15 feet), Damage 2d6+12 piercing plus 2d4 fire and 2d4 persistent fire; Melee [one-action] talon (agile, reach 15 feet), Damage 2d8+12 slashing; Shroud of Flame (aura, evocation, fire, primal) 20 feet. You gain an aura of fire that extends out from you. A creature that enters or ends its turn within the aura takes 2d6 fire damage. A creature can take this damage only once per turn. You can use a single action, which has the concentrate trait, to activate or deactivate this aura.", 2 },
                    { new Guid("352b1b14-f0cc-41f0-a580-bba64966ed4f"), 7, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "You also gain specific abilities based on the type of monster you choose:", 0 },
                    { new Guid("52b4c118-732f-48ad-a9a3-9fdcd3cf931a"), 6, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "Athletics modifier of +30, unless your own modifier is higher.", 2 },
                    { new Guid("19c23f03-e43c-4de4-b918-da3a8d0fdcb7"), 5, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +28, and you use the listed damage. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If your unarmed attack modifier is higher, you can use it instead.", 2 },
                    { new Guid("ab2a60f5-19af-4d59-b7e7-533dd484eff4"), 4, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "Darkvision.", 2 },
                    { new Guid("962fcdbc-a252-4b31-bde9-55d63bf2a517"), 3, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "20 temporary Hit Points.", 2 },
                    { new Guid("44c7d028-b5b7-4681-b2c7-36ea77a059af"), 2, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "AC = 20 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("144ab58b-73e0-44b9-8330-10a937d28520"), 1, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("51e8b2c9-fd2f-448c-9929-58180abe6ebc"), 0, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "You transform into the shape of a legendary monster, assuming a Huge battle form. You must have enough space to expand into or the spell is lost. When you cast this spell, choose phoenix, purple worm, or sea serpent. While in this form, you gain the beast trait (for phoenix) or the animal trait (for purple worm or sea serpent). You can Dismiss the spell.", 0 },
                    { new Guid("79a4b64c-bdf3-454f-bd35-035f6638aec4"), 0, new Guid("69971a2a-214a-487a-8441-e7e11e94ed5e"), "The targets experience a day’s worth of recovery in an instant. Any detrimental effects that would be gone after 24 hours end, though this doesn’t shorten the duration of any active spells affecting the targets. The targets regain Hit Points and recover from conditions as if they had taken 24 hours of rest, but they do not make their daily preparations again or gain any benefits of rest other than healing. The targets are then temporarily immune for 1 day.", 0 },
                    { new Guid("57ba153d-ea60-476b-94de-4c339f4601ff"), 1, new Guid("fc4b9cfa-3ce9-4135-a9dc-0314313dfb80"), "Any memories you’ve altered remain changed as long as the spell is active. If the target moves out of range before the 5 minutes is up, you can’t alter any further memories.", 0 },
                    { new Guid("380fdd50-b84e-414e-9abe-3befc4e39e69"), 10, new Guid("e6ef743d-f6a5-4210-bee6-23d4e561d491"), "Sea Serpent - Speed 20 feet, swim Speed 90 feet; Melee [one-action] jaws (reach 15 feet), Damage 2d12+20 piercing; Melee [one-action] tail (reach 25 feet), Damage 2d8+20 bludgeoning; Spine Rake [two-actions] (move) You extend your spines and Swim or Stride. Each creature you’re adjacent to at any point during your movement takes 4d8+10 slashing damage (basic Reflex against your spell DC).", 2 },
                    { new Guid("9573dec5-c138-461f-a8f9-a72bcfad32a6"), 1, new Guid("68c02829-5dff-4f8c-9c7a-048f14c522be"), "Vegetation springs up from every surface, giving each target a –10-foot circumstance penalty to its Speed any time it’s adjacent to the plants.", 2 },
                    { new Guid("31c4954a-ebec-4019-a9bb-a1256f3f9353"), 2, new Guid("68c02829-5dff-4f8c-9c7a-048f14c522be"), "Aggressive animals attack unpredictably. At the start of its turn, each target rolls a DC 8 flat check. On a failure, it’s attacked by swarming creatures that deal 2d10 slashing damage. The target attempts a basic Reflex save, and it is flat-footed for 1 round on any outcome other than a critical success.", 2 },
                    { new Guid("44cf8de2-083c-4a79-89f9-d1af40bedf48"), 3, new Guid("68c02829-5dff-4f8c-9c7a-048f14c522be"), "The target loses any connection to nature or natural creatures. The target has to succeed at a DC 5 flat check when casting any primal spell or the spell fails. Furthermore, animal or plant creatures become hostile to it, even one with a strong bond to the target, such as an animal companion.", 2 },
                    { new Guid("6879e330-6450-4a93-839e-81776f601b03"), 0, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Taking inspiration from verdant creatures, you transform into a Large plant battle form. You must have space to expand into or the spell is lost. When you cast this spell, choose arboreal, flytrap, or shambler. You can substitute a similar specific plant to turn into (such as a pitcher plant instead of a flytrap), but this has no effect on the form’s Size or statistics. While in this form, you gain the plant trait. You can Dismiss the spell.", 0 },
                    { new Guid("01a3a694-dea8-4801-9a84-632e236610fd"), 1, new Guid("e9e68a2b-1994-4584-9421-29c1d564ba6c"), "The spell is highly imprecise, and you appear 1d20×25 miles from the last place one of the targets (of your choice) was located the last time that target traveled to the plane. If it’s the first time traveling to a particular plane for all targets, you appear at a random location on the plane. Plane shift doesn’t provide a means of return travel, though casting plane shift again allows you to return to your previous plane unless there are extenuating circumstances.", 0 },
                    { new Guid("9fa49cc3-4f29-404a-a75d-86b2361386e8"), 0, new Guid("e9e68a2b-1994-4584-9421-29c1d564ba6c"), "You and your allies traverse the barriers between planes of existence. The targets move to another plane, such as the Plane of Fire, the Shadow Plane, or the Abyss. You must have specific knowledge of the destination plane and use a magic tuning fork created from material from that plane as a focus for the spell. While the tuning forks for most prominent planes are uncommon, just like the spell plane shift, more obscure planes and demiplanes often have rare tuning forks.", 0 },
                    { new Guid("b6851595-88ae-40ca-a699-0ae4b9239993"), 0, new Guid("c2a06c80-ed09-45aa-8a2f-25949cdc6ae9"), "You conjure a Large, magical, equine creature that only you (or another Medium or Small creature you choose) can ride. The horse is clearly phantasmal in nature, has 20 AC and 10 Hit Points, and automatically fails all saves. If it’s reduced to 0 Hit Points, it disappears and the spell ends. The steed has a Speed of 40 feet and can hold its rider’s body weight, plus 20 Bulk.", 0 },
                    { new Guid("ccd49ccb-de97-4605-a376-8af98bf20d5d"), 0, new Guid("ece946f0-28b2-4b5c-a886-0bfd5d2e00b8"), "Illusory pain wracks the target, dealing 2d4 mental damage and 1d4 persistent mental damage. The target must attempt a Will save.", 0 },
                    { new Guid("20651acb-48f1-4b99-8c49-1409a71892fb"), 0, new Guid("e0288efb-73eb-4baf-97fa-fe63518290a5"), "You create a phantasmal image of the most fearsome creature imaginable to the target. Only the spell’s target can see the killer, though you can see the vague shape of the illusion as it races forth to attack. The effect of the killer is based on the outcome of the target’s Will save.", 0 },
                    { new Guid("bdee741a-5916-4dca-9699-1dbdabc86607"), 0, new Guid("5c1a1d48-2a29-441a-b29b-d43a93905e6d"), "A vision of apocalyptic destruction fills the mind of each creature in the area. The vision deals 11d6 mental damage (basic Will save). On a critical failure, the creature must also succeed at a Reflex save or believe it’s trapped (stuck in a fissure, adrift at sea, or some other fate in keeping with its vision). If it fails the second save, it’s also stunned for 1 minute. It can attempt a new Will save at the end of each of its turns, and on a success, it disbelieves the illusion and recovers from the stunned condition.", 0 },
                    { new Guid("333e7324-22c2-458d-9808-756f33be753c"), 6, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "Acrobatics and Stealth modifiers of +10, unless your own modifier is higher; Athletics modifier –4.", 2 },
                    { new Guid("0e61a117-937d-4044-a13c-648394a42871"), 5, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "Low-light vision and imprecise scent 30 feet.", 2 },
                    { new Guid("8d8337ba-17e7-4a1a-b284-00ee075ee314"), 4, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "Weakness 5 to physical damage. If you take physicaldamage in this form, you take 5 additional damage.", 2 },
                    { new Guid("9775396d-bdd9-48bf-82a9-6a326928347f"), 3, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "Speed 10 feet.", 2 },
                    { new Guid("057a2488-2f2c-432f-b92d-231980372ac1"), 2, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "AC = 15 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("3d24d758-0043-4b4d-8106-595d9f5b64d0"), 1, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "You gain the following statistics and abilities:", 0 },
                    { new Guid("b1ded820-723a-4c52-9cc1-0d1848e6b67a"), 0, new Guid("3203cdc7-f538-44b4-b0f5-502a6b30134f"), "You transform into the battle form of a Tiny animal, such as a cat, insect, lizard, or rat. You can decide the specific type of animal (such as a rat or praying mantis), but this has no effect on the form’s Size or statistics. While in this form, you gain the animal trait. You can Dismiss the spell.", 0 },
                    { new Guid("738f3b98-0304-4f08-84d5-0acf1fb12076"), 0, new Guid("241077f3-8780-446d-83f7-b2ea3d8b92cc"), "You obscure the tracks you leave behind and make it harder for others to find you. The DC of checks to Track you gains a +4 status bonus or is equal to your spell DC, whichever results in a higher DC. You can benefit from only one pass without trace spell at a time.", 0 },
                    { new Guid("2e877aaf-95a1-4bb0-9091-6c0425dfb4d6"), 0, new Guid("d52d7b40-155d-479a-810e-8fcacba938dd"), "You create a visible tunnel through the wall in the chosen area, replacing the area with empty space. If the wall is thicker than 10 feet, the tunnel ends 10 feet in. Even a small layer of metal in the wall prevents this spell from functioning. This spell doesn’t reduce the integrity of the structure. When the spell ends, anyone inside the tunnel is shunted to the nearest exit.", 0 },
                    { new Guid("4bc1c82c-1488-4836-8495-82fb7717b33c"), 0, new Guid("4ef54f62-e2b5-4230-9279-82e61be830a8"), "You cause the target to see all other creatures as dire threats. The target is stricken by intense paranoia toward all creatures around it and must attempt a Will save.", 0 },
                    { new Guid("15c15918-675a-401b-a53a-0c568fa818ab"), 0, new Guid("a99f55f3-63c7-4db8-8b0f-9f452a58e240"), "You block the target’s motor impulses before they can leave its mind, threatening to freeze the target in place. The target must attempt a Will save.", 0 },
                    { new Guid("d3448213-6a58-4bb5-9b8b-769e3de92933"), 1, new Guid("1f6026bc-7381-477d-a61c-70769fbf8fab"), "Paying tribute is a manipulate action or move action, as chosen by the creature paying tribute. A creature under this effect must pay tribute to you at least once on each of its turns if possible. While affected by this spell, a creature is fascinated by you and can’t use hostile actions against you. The target is then temporarily immune for 1 minute.", 0 },
                    { new Guid("8f4291ff-7d81-4784-920a-7df03917b47a"), 0, new Guid("1f6026bc-7381-477d-a61c-70769fbf8fab"), "You surround yourself with supernatural splendor, appearing to be a god or similarly majestic being. You choose the aspects of your new majestic appearance. This causes the targets to pay tribute to you by bowing or using some other action in keeping with your appearance. The number of times a target must do this depends on the result of their Will save.", 0 },
                    { new Guid("c031f36b-0a46-44d2-8f4c-2d863b8c3842"), 0, new Guid("4462f1ea-ffe2-4087-b1c2-7d3a56afbb3e"), "You afflict the target with a curse that makes its presence abrasive and off-putting. The target must attempt a Will save.", 0 },
                    { new Guid("5ae2b71d-f9da-443b-9429-8a00403f5ab9"), 0, new Guid("9844abe7-e51e-4b8c-877d-1dbdb41801f3"), "You call forth a cloud of mist. All creatures within the mist become concealed, and all creatures outside the mist become concealed to creatures within it. You can Dismiss the cloud.", 0 },
                    { new Guid("a9ee48e9-0f64-4f37-8a57-260052036b32"), 0, new Guid("76d552d4-9c62-4875-b920-095c64beb01d"), "You erect protective wards that make the target difficult to detect via magic. Nondetection attempts to counteract all detection, revelation, and scrying divinations made against the target or the target’s gear throughout the duration, counting cantrips as 1st-level spells for this purpose. Successfully counteracting a divination that targets an area or multiple targets negates the effects only for nondetection’s target.", 0 },
                    { new Guid("03e05465-b49e-4c91-a757-94d1dc286716"), 0, new Guid("083d1186-7e18-46d7-81c1-baceb222ef4b"), "You send disturbing nightmares to your target. The next time the target falls asleep, it must attempt a Will save. If you know the target only by name and have never met them, the target gets a +4 circumstance bonus to the Will save.", 0 },
                    { new Guid("73442b3d-3937-494f-8777-d4fdf8af4d27"), 0, new Guid("8813eb2e-1128-4dfb-b926-5b0ee4b4f910"), "You pour healing magic through the target in an attempt to cure one poison afflicting it. Attempt a counteract check against the poison.", 0 },
                    { new Guid("6a708c7e-f042-444d-94e7-cb78ba8794b5"), 0, new Guid("32c8a05d-6244-4e13-8a1b-1b74de2970d6"), "The target loses its odor, preventing creatures from passively noticing its presence via smell alone, even if the creatures have precise or imprecise scent. A creature attempting a Perception check to Seek with scent and other senses might notice the lack of natural scent. If the target has any abilities that result from its smell, such as an overpowering scent, those abilities are also negated.", 0 },
                    { new Guid("466f27f1-870d-4683-a1b3-f5ef776c520b"), 4, new Guid("68c02829-5dff-4f8c-9c7a-048f14c522be"), "The GM might decide that you can’t subject some creatures, such as an emissary of a nature deity, to the ire of nature.", 0 },
                    { new Guid("76accefa-5de2-4591-9ba7-6e195ec309c7"), 0, new Guid("fc4b9cfa-3ce9-4135-a9dc-0314313dfb80"), "You alter the target’s memories, either erasing a memory, enhancing a memory’s clarity, altering a memory, or adding a false memory. The target can attempt a Will save to resist the spell.", 0 },
                    { new Guid("d4168f66-4fe4-44b2-9586-2e369f1fceb8"), 1, new Guid("356ae5e4-90ea-4484-9aee-489a161afebf"), "If you Cast a Spell, attack, or otherwise interact with another creature, as a part of that action you can attempt a Deception check against observers’ Perception DCs to convince them your duplicate used that action. This doesn’t fool anyone who’s aware your duplicate is an illusion, nor does it work if the attack obviously couldn’t have come from the duplicate. For instance, if you fired a ray, you could make it look like it came from the duplicate as long as the duplicate was positioned appropriately, but if you attacked with a sword and your duplicate was across the room from the target, your Deception check would automatically fail.", 0 },
                    { new Guid("8cf0b7e2-eaf5-432e-bc51-ffcaba6142af"), 0, new Guid("356ae5e4-90ea-4484-9aee-489a161afebf"), "You turn yourself invisible and create an illusory duplicate of yourself. When you Sustain the Spell, you can mentally dictate a course of action for your duplicate to follow that round. Your duplicate acts as though it had your full number of actions, though it can’t actually affect anything in the environment. Both the duplicate and your invisibility persist for the spell’s duration. Performing a hostile action doesn’t end mislead’s invisibility, just like a 4th-level invisibility spell. A creature that determines the duplicate is an illusion doesn’t necessarily know you’re invisible, and one that can see your invisible form doesn’t necessarily know your duplicate is an illusion.", 0 },
                    { new Guid("1b0d5462-7d23-4e5d-a663-54e2944557db"), 0, new Guid("5a7e9082-570d-4795-ad83-934b17d8bc5e"), "You reshape the magic aura of one creature or object to resemble that of another. You designate one target as the primary target and the other as the secondary target. Effects that would detect auras on the primary target instead detect the same types of auras from the secondary target. A creature reading the aura can attempt to disbelieve the illusion. You can Dismiss the spell from up to a mile away.", 0 },
                    { new Guid("d46b82f8-e349-4519-93b7-d781199db2ff"), 0, new Guid("6a0f152d-21cb-4add-a0d7-4a6210ef69f6"), "You send a dart of force streaking toward a creature that you can see. It automatically hits and deals 1d4+1 force damage. For each additional action you use when Casting the Spell, increase the number of missiles you shoot by one, to a maximum of three missiles for 3 actions. You choose the target for each missile individually. If you shoot more than one missile at the same target, combine the damage before applying bonuses or penalties to damage, resistances, weaknesses, and so forth.", 0 },
                    { new Guid("216e6d5a-d147-4982-83b2-6fd711da9a9a"), 0, new Guid("dcfd1a3e-e976-4943-b6d3-b7ea695f5ba7"), "Choose one of the target’s unarmed attacks. You cause that unarmed attack to shine with primal energy. The unarmed attack becomes a +1 striking unarmed attack, gaining a +1 item bonus to attack rolls and increasing the number of damage dice to two if it had only one.", 0 },
                    { new Guid("be5f5b34-6542-4ae3-8a17-18b3735f9d3a"), 1, new Guid("279fd825-1008-48ee-b9ee-828e32db254a"), "A caster using detect magic or read aura of an equal or higher spell level can attempt to disbelieve the illusion from magic aura. Magic aura doesn’t mask the aura of spells that are 9th level or higher or of items that are 19th level or higher.", 0 },
                    { new Guid("873c4345-0752-45a5-9997-31fab58fc356"), 0, new Guid("279fd825-1008-48ee-b9ee-828e32db254a"), "You alter the appearance of an item’s magic aura. You can choose to have the target’s aura appear as that of a common magic item of twice magic aura’s level or lower, or to have it register as being under the effects of a spell of your choice of magic aura’s level or lower. If the target is magical, you can instead choose to have it appear as entirely non-magical.", 0 },
                    { new Guid("0cb91f4b-39b3-4eff-bbca-bf304ea89a20"), 0, new Guid("e7fd46a8-8455-4324-8bde-4fef118e207d"), "You create a single magical hand, either invisible or ghostlike, that grasps the target object and moves it slowly up to 20 feet. Because you’re levitating the object, you can move it in any direction. When you Sustain the Spell, you can move the object an additional 20 feet. If the object is in the air when the spell ends, the object falls.", 0 },
                    { new Guid("b78109a0-8e71-474c-b6ac-60059a4a93f8"), 0, new Guid("6176512c-2c29-445f-885b-b4929a886fb9"), "You ward yourself with shimmering magical energy, gaining a +1 item bonus to AC and a maximum Dexterity modifier of +5. While wearing mage armor, you use your unarmored proficiency to calculate your AC.", 0 },
                    { new Guid("85f1c6e3-2526-4fdd-b2f9-f62ef626ce07"), 0, new Guid("683a0193-0a17-49f8-b90e-5fc121fac80a"), "You lengthen your stride beyond what should be possible. You gain a + 10 - foot status bonus to your Speed.", 0 },
                    { new Guid("01c80245-9ff1-4d94-9c91-b821cc6933f7"), 1, new Guid("4d43a965-8383-4cf7-a31d-57dd72a2a5a4"), "If the target is opened, the spell ends. Assuming the target is not barred or locked in some additional way, you can unlockand open it with an Interact action during which you touch the target. This does not end the spell. You can Dismiss this spell at any time and from any distance.", 0 },
                    { new Guid("fabaf608-b4e1-4783-982a-b7862fbfac48"), 0, new Guid("4d43a965-8383-4cf7-a31d-57dd72a2a5a4"), "The target’s latch mechanism clinks shut, held fast by unseen magical restraints. When you magically lock a target, you set an Athletics and Thievery DC to open it equal to your spell DC or the base lock DC with a +4 status bonus, whichever is higher. Any key or combination that once opened a lock affected by this spell does not do so for the duration of the spell, though the key or combination does grant a +4 circumstance bonus to checks to open the door.", 0 },
                    { new Guid("bf813ba0-278c-43d7-900c-3538924fd4d3"), 0, new Guid("9ef85c45-46e6-4ca1-b396-1826bac8d772"), "You learn the direction to the target (if you picked a specific object, such as “my mother’s sword”) or the nearest target (if you picked a type of object, such as “swords”). If the target is a specific object, you must have observed it directly with your own senses. If it’s a type of object, you still need to have an accurate mental image of the type of object. If there’s lead or running water between you and the target, this spell can’t locate the object. This means you might find a type of object farther away if the nearest one is behind lead or running water.", 0 },
                    { new Guid("44293f2b-0eb5-4909-83a9-f6e92a950803"), 0, new Guid("c6a647e0-e06b-4a5d-a91a-5efb18b9e159"), "A bolt of lightning strikes outward from your hand, dealing 4d12 electricity damage.", 0 },
                    { new Guid("c62508b2-21cf-4c6e-ab23-14d66976d6ca"), 0, new Guid("87a6b8cf-e243-435c-a31e-ba70f8d73c70"), "The object glows, casting bright light in a 20-foot radius (and dim light for the next 20 feet) like a torch. If you cast this spell again on a second object, the light spell on the first object ends.", 0 },
                    { new Guid("628c1667-7caa-4552-96c4-b4eee80b3d1d"), 0, new Guid("edbae7a9-ae44-4f36-99a6-89c4470b2287"), "You defy gravity and levitate the target 5 feet off the ground. For the duration of the spell, you can move the target up or down 10 feet with a single action, which has the concentrate trait. A creature floating in the air from levitate takes a –2 circumstance penalty to attack rolls. A floating creature can spend an Interact action to stabilize itself and negate this penalty for the remainder of its turn. If the target is adjacent to a fixed object or terrain of suitable stability, it can move across the surface by climbing (if the surface is vertical, like a wall) or crawling (if the surface is horizontal, such as a ceiling). The GM determines which surfaces can be climbed or crawled across.", 0 },
                    { new Guid("de95fe4c-a212-41aa-8b81-bd18458a0d39"), 0, new Guid("13443716-6941-4cc8-b031-13ea8b0c428d"), "In your mind’s eye, you see a path northward. You immediately know which direction is north (if it exists at your current location).", 0 },
                    { new Guid("59a6a59e-7f5a-4274-86e8-0e1b5f4f270e"), 1, new Guid("d4b189b3-2307-4092-8e64-dcdfbe6ee5e7"), "Knock counteracts lock.", 0 },
                    { new Guid("ed640758-61af-4c49-90b7-ba3a1bb6ee63"), 1, new Guid("79da888e-0a2e-4268-b3ec-b42e0023ee38"), "Reduce a Condition - Reduce the value of the target’s clumsy, enfeebled, or stupefied condition by 2. You can instead reduce two of the listed conditions by 1 each.", 2 },
                    { new Guid("12e8e61c-0c25-401d-989e-1d9870807efa"), 0, new Guid("787457e2-ad8a-4ae5-96e5-48225cf53686"), "Your legs surge with strength, ready to leap high and far. You jump 30 feet in any direction without touching the ground. You must land on a space of solid ground within 30 feet of you, or else you fall after using your next action.", 0 },
                    { new Guid("3c3b8e98-a33b-440b-8b62-6545d6d4d943"), 0, new Guid("0711d92f-7807-4e29-86d7-713215d6c9e4"), "You make the target object look and feel as though it were in much better or worse physical condition. When you cast this spell, decide whether you want to make the object look decrepit or perfect. An item made to look decrepit appears broken and shoddy. An intact item made to look better appears as though it’s brand new and highly polished or well maintained. A broken item appears to be intact and functional. Destroyed items can’t be affected by this spell. A creature that Interacts with the item can attempt to disbelieve the illusion.", 0 },
                    { new Guid("00133eb4-6fd3-44d9-9ae4-352539d6c817"), 1, new Guid("01e7386b-81a0-4b7b-81dc-1ae9bab7a439"), "While exploring, it’s easy to move together slowly and remain invisible. This is untenable in a battle, however. Once an encounter begins, creatures remain invisible until at most the end of the first round, at which point the spell ends.", 0 },
                    { new Guid("129be4c7-9d5f-4d05-a66e-bffd1031ea3d"), 0, new Guid("01e7386b-81a0-4b7b-81dc-1ae9bab7a439"), "You and all targets are invisible except to each other as long asyou remain within the spell’s area. If a creature made invisible by this spell leaves the spell’s area, it becomes visible and remains so even if it returns to the spell’s area. If any creature made invisible by this spell uses a hostile action, the spell ends after the hostile action is completed.", 0 },
                    { new Guid("6d318dcd-196c-4f8f-b038-0f2bfca4fd78"), 0, new Guid("c70083c6-9775-40f9-81f9-dd222d99236c"), "Cloaked in illusion, the target becomes invisible. This makes it undetected to all creatures, though the creatures can attempt to find the target, making it hidden to them instead (page 466). If the target uses a hostile action, the spell ends after that hostile action is completed.", 0 },
                    { new Guid("5d7aea58-e3dc-46c6-ada0-ff46b112450c"), 13, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Spider - Speed 25 feet, climb Speed 25 feet; darkvision; Melee [one-action] fangs, Damage 1d6 piercing plus 1d4 persistent poison; Ranged [one-action] web (range increment 20 feet), Damage entangles the target for 1 round.", 2 },
                    { new Guid("73690b19-0ada-4c27-a16f-31f4d09e1794"), 12, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Scorpion - Speed 40 feet; darkvision, imprecise tremorsense 60 feet; Melee [one-action] stinger, Damage 1d8 piercing plus 1d4 persistent poison; Melee [one-action] pincer (agile), Damage 1d6 bludgeoning.", 2 },
                    { new Guid("574bcc50-d89b-4bcf-8b3a-3e99275a3aaf"), 11, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Mantis - Speed 40 feet; imprecise scent 30 feet; Melee [one-action] foreleg, Damage 2d8 bludgeoning.", 2 },
                    { new Guid("dd27287c-8c69-4501-822b-93e4ce45c962"), 10, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Centipede - Speed 25 feet, climb Speed 25 feet; darkvision; Melee [one-action] mandibles, Damage 1d8 piercing plus 1d4 persistent poison.", 2 },
                    { new Guid("0ad86451-8dc7-4cff-939a-dc9212d18fa0"), 9, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Beetle - Speed 25 feet; Melee [one-action] mandibles, Damage 2d10 bludgeoning.", 2 },
                    { new Guid("3f418231-5dea-4e92-b4b3-7276e287164e"), 8, new Guid("faee97be-896d-4f90-ac8d-7b62a6f67767"), "Ant - Speed 30 feet, climb Speed 30 feet; Melee [one-action] mandibles, Damage 2d6 bludgeoning.", 2 },
                    { new Guid("87047c4a-edbe-4dec-9a3c-c73a68337680"), 0, new Guid("6b8f348c-88e8-41bc-8336-9098fa0854c6"), "You specify a trigger (described on page 305) and a message up to 25 words long. When the specified trigger occurs within 30 feet of the target, an illusory mouth appears on the target and speaks the message, and the magic mouth spell ends.", 0 },
                    { new Guid("1d53cf41-52a3-4b3f-b2f2-f518c55c1f84"), 1, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "You gain the following statistics and abilities regardless of which battle form you choose:", 0 },
                    { new Guid("84b5d34a-652c-436f-8427-c3703c15fda6"), 0, new Guid("09c3ee06-587b-4e7a-9a64-bf06fad7cdfd"), "The weapon glimmers with magic and energy. The target becomes a +1 striking weapon, gaining a +1 item bonus to attack rolls and increasing the number of weapon damage dice to two.", 0 },
                    { new Guid("f0388a5a-9840-4cc2-afde-decf2089fdcd"), 1, new Guid("d3d0920b-9de1-4752-bf0a-dabdfc6671ee"), "Inside, the demiplane appears to be a mansion featuring a magnificent foyer and numerous opulent chambers. The mansion can have any floor plan you imagine as you Cast the Spell, provided it fits within a space 40 feet wide, 40 feet deep, and 30 feet tall. While the entrance to the mansion is closed, effects from outside the mansion fail to penetrate it, and vice versa, except for plane shift, which can be used to enter the mansion. You can use scrying magic and similar effects to observe the outside only if they’re capable of crossing planes.", 0 },
                    { new Guid("e1f4ca9b-3600-42fd-8382-d6677a3b8fd2"), 1, new Guid("83a9e5eb-3f02-4ffd-9d35-82f3308de234"), "Once an image is hit, it is destroyed. If an attack roll fails to hit your AC but doesn’t critically fail, it destroys an image but has no additional effect (even if the attack would normally have an effect on a failure). If an attack roll is a critical success and would hit one of the images, one of the images is destroyed and the attack roll becomes a success against you. Once all the images are destroyed, the spell ends.", 0 },
                    { new Guid("fb288801-5e30-44ec-8646-2e89a4197e05"), 0, new Guid("83a9e5eb-3f02-4ffd-9d35-82f3308de234"), "Three illusory images of you swirl about your space, potentially causing those who attack you to hit one of the images instead of you. Any attack that would hit you has a random chance of hitting one of your images instead of you. If all three images remain, there is a 1 in 4 chance of hitting you (1 on 1d4). With two images remaining, there is a 1 in 3 chance of hitting you (1–2 on 1d6). With only one image, the chances are 1 in 2 (1–3 on 1d6).", 0 },
                    { new Guid("ff4213a3-131c-46fe-89b0-111bede985aa"), 5, new Guid("10cc85a3-13bd-4f39-91cb-c08c4673300c"), "The GM might allow you to try using miracle to produce greater effects than these, but doing so may be dangerous, or the spell may have only a partial effect.", 0 },
                    { new Guid("dec561e9-0a6b-4813-b005-a7f5135a39e6"), 4, new Guid("10cc85a3-13bd-4f39-91cb-c08c4673300c"), "Reverse certain effects that refer to the wish spell.", 2 },
                    { new Guid("9e0727f7-295d-4bd5-93d2-8f08d04e831c"), 3, new Guid("10cc85a3-13bd-4f39-91cb-c08c4673300c"), "Produce any effect whose power level is in line with the above effects.", 2 },
                    { new Guid("7cac6eac-daf5-4680-8a0c-e3e97a72c9de"), 2, new Guid("10cc85a3-13bd-4f39-91cb-c08c4673300c"), "Duplicate any non-divine spell of 7th level or lower.", 2 },
                    { new Guid("2a62846b-203e-4155-8a56-b3bdbe83a4f0"), 1, new Guid("10cc85a3-13bd-4f39-91cb-c08c4673300c"), "Duplicate any divine spell of 9th level or lower.", 2 },
                    { new Guid("2a8e6434-e450-4377-b562-edaf1b8cc953"), 0, new Guid("10cc85a3-13bd-4f39-91cb-c08c4673300c"), "You request aid directly from your divine source. Your divine source always refuses a request out of line with its nature, and it might grant a different request (potentially more powerful or better fitting its nature) than the one you asked for. A casting of miracle can do any of the following things.", 0 },
                    { new Guid("11d3185c-3f56-4d66-b6dc-22a8b35ac810"), 0, new Guid("92db312e-0dc1-4fa8-badb-8e5ab99951f4"), "With a cursory mental touch, you attempt to read the target’s mind. It must attempt a Will save. The target then becomes temporarily immune to your mind reading for 1 hour.", 0 },
                    { new Guid("a29583ec-df58-41df-89c6-504f078012e3"), 0, new Guid("50520c01-24e6-4434-a687-b324bcd0fe85"), "You cast your thoughts through a creature’s mind, sifting for information. You access the target’s memories and knowledge unless it fends you off with a Will save.", 0 },
                    { new Guid("d6be0dc9-468f-4cc2-8186-94777e2d1232"), 0, new Guid("106437f4-e6d0-49cc-b271-f057e2c13f68"), "You link your mind to the target’s mind and mentally impart to that target an amount of information in an instant that could otherwise be communicated in 10 minutes.", 0 },
                    { new Guid("a2e43dfb-c5e3-4c62-b44d-4ccfb65ecd5d"), 0, new Guid("2c81268e-b04c-45d1-b250-bab3819c9542"), "Powerful wards hide a creature from divination magic. The target gains a +4 status bonus to saves against mental effects. Mind blank attempts to counteract any detection, revelation, and scrying effects as if its spell level were 1 higher than its actual level. On a success, the divination effect functions normally except that it detects nothing about the target and its possessions. For instance, detect magic would still detect other magic in the area, but not any magic on the target.", 0 },
                    { new Guid("2c974f1b-c9b3-4c29-8652-42229a9b7ea9"), 0, new Guid("0eb99f7f-3a8b-4769-bcd7-06203011c84e"), "You call down four meteors that explode in a fiery blast. Each meteor deals 6d10 bludgeoning damage to any creatures in the 10-foot burst at the center of its area of effect before exploding, dealing 14d6 fire damage to any creatures in its 40-foot burst. The meteors’ central 10-foot bursts can’t overlap, and a creature takes the same amount of fire damage no matter how many overlapping explosions it’s caught in. The saving throw applies to both the bludgeoning and the fire damage.", 0 },
                    { new Guid("e8e6ca9e-564b-4320-bb83-8cfa32076ffb"), 0, new Guid("d1e5c7ca-1ebb-4168-ba75-4a8f1951a63b"), "You mouth words quietly, but instead of coming out of your mouth, they’re transferred directly to the ears of the target. While others can’t hear your words any better than if you normally mouthed them, the target can hear your words as if they were standing next to you. The target can give a brief response as a reaction, or as a free action on their next turn if they wish, but they must be able to see you and be within range to do so. If they respond, their response is delivered directly to your ear, just like the original message.", 0 },
                    { new Guid("9427d1d8-f2a9-4479-b2d1-df79e114d8e1"), 0, new Guid("ea92b250-fc6d-43d9-aee0-f1fbb92111ab"), "You repair the target item. You restore 5 Hit Points per spell level to the target, potentially removing the broken condition if this repairs it past the item’s Broken Threshold. You can’t replace lost pieces or repair an object that’s been completely destroyed.", 0 },
                    { new Guid("a13e2fdb-9934-44a3-b316-2be6b08dca4d"), 1, new Guid("673fb99e-1fa7-40e7-b9e5-23bccf075cef"), "Significant physical damage to the stone while you are inside it expels you and deals 10d6 damage to you. Passwall expels you without dealing damage and ends meld into stone. You can Dismiss this spell.", 0 },
                    { new Guid("54e609fa-82d3-4e0c-a712-be22fc1ecbde"), 0, new Guid("673fb99e-1fa7-40e7-b9e5-23bccf075cef"), "You merge with an adjacent block of stone with enough volume to fit you and your worn and held possessions. You must touch the stone when you Cast the Spell. You can hear, but not see, what’s going on outside the stone, and you can cast spells while in the stone as long as they don’t require line of effect beyond the stone.", 0 },
                    { new Guid("ebd83dab-97c8-4aaf-acaa-cbcc9577830d"), 1, new Guid("1f7e556d-254c-4761-aac0-d891fe93671e"), "Teleportation magic doesn’t help the creature escape unless the magic can transport across planes, such as plane shift. When the spell ends, either because the target escaped or the duration ran out, the target returns to the space it occupied when it was banished, or to the nearest space if the original is now filled.", 0 },
                    { new Guid("55c2746d-8954-4b1a-a790-fe3b793983a2"), 0, new Guid("1f7e556d-254c-4761-aac0-d891fe93671e"), "You transport the target into an extradimensional maze of eldritch origin and trap it there. Once each turn, the target can spend 1 action to attempt a Survival check or Perception check against your spell DC to escape the maze. The possible outcomes are as follows.", 0 },
                    { new Guid("90e2870d-a329-47cf-8d6d-8ecbbd7c72f5"), 0, new Guid("e51bf1f2-92f8-4c61-89c0-1350472a8bd5"), "You unleash a wave of necromantic energy to snuff out the life force of those in its path. Each living creature of 17th level or lower in the line must attempt a Fortitude save. If the damage from massacre reduces a creature to 0 Hit Points, that creature dies instantly. If massacre doesn’t kill even a single creature, the negative energy violently explodes back toward you, dealing an additional 30 negative damage to every living creature in the line (even those above 17th level) and 30 negative damage to you.", 0 },
                    { new Guid("c591c946-6270-43dd-863d-818cebc532cf"), 1, new Guid("3710ee0e-bee7-42fa-8469-cce73389e447"), "When any creature attempts a hostile action against the target, the creature must attempt a Will save. It is then temporarily immune until the end of its next turn.", 0 },
                    { new Guid("f6ec0bfa-286f-44ef-9a59-00282f4d5657"), 0, new Guid("3710ee0e-bee7-42fa-8469-cce73389e447"), "The target appears to be a gruesome and terrifying creature. The effect is unique to each observer, so a human viewing the target might see a demon with bloody fangs, but a demon observing the target might see a glowing angelic visage.", 0 },
                    { new Guid("960d497a-188d-4817-8905-bc6f1d61b21c"), 0, new Guid("117860b5-a1af-46fc-80fb-26d7e2bc6fb1"), "You afflict the target with the curse of the roiling, unforgiving sea. The target must attempt a Will save.", 0 },
                    { new Guid("34002694-962c-4aa6-a3e0-565b6f3ffad8"), 1, new Guid("8fddb4d4-0f53-465e-8995-00671c2e9806"), "[one-action] Somatic - The spell has a range of touch.", 2 },
                    { new Guid("2bc41f04-e8e2-4212-afef-4f1fb3e47645"), 2, new Guid("8fddb4d4-0f53-465e-8995-00671c2e9806"), "[two-actions] Verbal - The spell has a range of 30 feet and restores an additional 8 Hit Points to the target.", 2 },
                    { new Guid("fa2448d1-5f33-4249-bd0a-a8c4f3ff3132"), 0, new Guid("1a4d0c2e-af2c-4f4e-b974-16beb3fe7955"), "You have a preternatural ability to remember details about your foes. Roll the triggering check twice and use the better result.", 0 },
                    { new Guid("53e43570-a5b5-46e3-b677-b9316f87fcaf"), 2, new Guid("d3d0920b-9de1-4752-bf0a-dabdfc6671ee"), "A staff of up to 24 servants attends to anyone within the mansion. These are like the servant created by the unseen servant spell, though they’re visible, with an appearance you determine during casting. The mansion is stocked with enough food to serve a nine-course banquet to 150 people.", 0 },
                    { new Guid("6ff7411a-d558-4f8c-9a06-a559307fbf38"), 0, new Guid("d3d0920b-9de1-4752-bf0a-dabdfc6671ee"), "You conjure an extradimensional demiplane consisting of a spacious dwelling with a single entrance. The entrance connects to the plane where you Cast the Spell, appearing anywhere within the spell’s range as a faint, shimmering, vertical rectangle 5 feet wide and 10 feet high. You designate who can enter when you cast the spell. Once inside, you can shut the entrance, making it invisible. You and the creatures you designated can reopen the door at will, just like opening a physical door.", 0 },
                    { new Guid("309ae535-4c4d-43de-921f-e21b5d074e94"), 2, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "AC = 19 + your level. Ignore your armor’s check penalty and Speed reduction.", 2 },
                    { new Guid("2a938e2d-48bc-4330-977c-d91e89b75f5f"), 0, new Guid("d4b189b3-2307-4092-8e64-dcdfbe6ee5e7"), "You make the target easier to open. Knock grants a +4 status bonus to any creature that tries to open the target door, lock, or container with an Athletics or a Thievery check. You can attempt a Thievery check to open the target as part of casting knock, and you add your level even if you’re untrained.", 0 },
                    { new Guid("045a027f-d518-46bf-86c7-05a60726148c"), 4, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Resistance 10 to poison.", 2 },
                    { new Guid("b8f7d2eb-8cb1-4457-950a-8e404b5c6370"), 0, new Guid("5d06dded-2209-4d4c-93f7-cea29784ce1e"), "You ward a creature against a specified alignment. Choose chaotic, evil, good, or lawful when you cast this spell. The target gains a +1 status bonus to Armor Class and saving throws against creatures and effects of the chosen alignment. This bonus increases to +3 against effects from such creatures that would directly control the target and against attacks made by summoned creatures of the chosen alignment.", 0 },
                    { new Guid("11d02568-6243-4b28-bdd5-0fdcf845b6f2"), 0, new Guid("0d977f3d-7ee1-4691-a8a8-2e4f47af3f27"), "You project an illusory image of yourself. You must stay within range of the image, and if at any point you can’t see the image, the spell ends. Whenever you Cast a Spell other than one whose area is an emanation, you can cause the spell effect to originate from either yourself or the image. Because the image is an illusion, it can’t benefit from spells, though visual manifestations of the spell appear. The image has the same AC and saves as you. If it is hit by an attack or fails a save, the spell ends.", 0 },
                    { new Guid("f1b5871a-4266-4915-82e7-37e51cf02b2e"), 0, new Guid("a6374c8f-0a48-42b8-80a9-5c9f39447e3b"), "A small ball of flame appears in the palm of your hand, and you lash out with it either in melee or at range. Make a spell attack roll against your target’s AC. This is normally a ranged attack, but you can also make a melee attack against a creature in your unarmed reach. On a success, you deal 1d4 fire damage plus your spellcasting ability modifier. On a critical success, the target takes double damage and 1d4 persistent fire damage.", 0 },
                    { new Guid("7a46fed6-33e9-4369-85ba-8e334e33f548"), 0, new Guid("ba66525f-674c-4658-a4f2-295e2ee6c12f"), "From outside, the area looks like a bank of impenetrable black fog. Sensory stimuli (such as sounds, smells, and light) don’t pass from inside the area to outside the area. Scrying spells can’t perceive any stimuli from the area, and mind-reading effects don’t work in the area.", 0 },
                    { new Guid("746c666e-1596-4a84-b309-7fbaefccd507"), 2, new Guid("18adb9ed-5e8b-4823-931b-170ae462ce05"), "The wall as a whole is immune to counteracting effects of the wall’s level or lower; each color must be counteracted by its specific spell, as described in chromatic wall. This must be done in order (red, orange, yellow, green, blue, indigo, then violet). A given color can’t be affected until the previous color is counteracted. Counteracting a color wall removes that color’s effect from the wall, and counteracting them all ends prismatic wall. You can Dismiss the spell.", 0 },
                    { new Guid("d9fe499e-54bc-4b86-890e-eeb7784280c1"), 1, new Guid("18adb9ed-5e8b-4823-931b-170ae462ce05"), "A prismatic wall has seven different layers, each a different color. Red, orange, yellow, and green have the effect of a 5th-level chromatic wall (page 323) spell of that color, and the others have the effect of a 7th-level chromatic wall spell of that color. A creature that tries to pass through the wall must attempt a saving throw against each component wall. The effects take place simultaneously, so a creature turned to stone by the blue wall is still treated as a creature for the indigo and violet walls.", 0 },
                    { new Guid("e7c2cd66-a2f0-4333-9a9c-2ae2992d0fc8"), 0, new Guid("18adb9ed-5e8b-4823-931b-170ae462ce05"), "You create an opaque wall of shimmering, multicolored light. The wall is straight and vertical, stretching 60 feet long and 30 feet high. You must form the wall in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost. You can pass through the wall and ignore its effects. The wall sheds bright light out to 20 feet on each side (and dim light to the next 20 feet). Creatures other than you that come into the wall’s light must attempt a Will save; they’re dazzled for 1 round on a success, blinded for 1 round on a failure, and blinded for 1 minute on a critical failure. They are then temporarily immune to the blinding effect for 1 hour.", 0 },
                    { new Guid("964bc83a-72e9-40c7-9458-576ec905df98"), 0, new Guid("d29d675a-c1ed-40c0-b706-77a857f574e4"), "A spray of rainbow light beams cascades from your open hand. Each creature in the area must roll 1d8 on the table below to see which beam affects it, then attempt a saving throw of the indicated type. The table notes any additional traits that apply to each type of ray. If a creature is struck by multiple beams, it uses the same d20 result for all its saving throws. For all rays, a successful saving throw negates the effect for that creature.", 0 },
                    { new Guid("ada20c61-75c9-459c-bfe4-84506e0f7914"), 0, new Guid("3e624275-8104-4d82-922c-648e109f648a"), "You create a seven-layered sphere to protect an area. This multicolored sphere functions like a prismatic wall but is shaped in a 10-foot burst centered on a corner of your space. You must form the sphere in an unbroken open space so its edges don’t pass through any creatures or objects, or the spell is lost.", 0 },
                    { new Guid("36dedd30-17e9-417a-b451-e2d3b1047d05"), 5, new Guid("6c4dede5-87ad-4a90-a7a8-52dd2fc5e46b"), "At the GM’s discretion, you can try to use primal phenomenon to produce greater effects than these, but doing so may be dangerous, or the spell may have only a partial effect.", 0 },
                    { new Guid("3adeabd6-c190-4b1e-b6b0-f0038c7b4540"), 4, new Guid("6c4dede5-87ad-4a90-a7a8-52dd2fc5e46b"), "Reverse certain effects that refer to the wish spell.", 2 },
                    { new Guid("09339164-3ddb-4d0f-8425-a99dbbcabef9"), 3, new Guid("6c4dede5-87ad-4a90-a7a8-52dd2fc5e46b"), "Produce any effect whose power level is in line with the above effects.", 2 },
                    { new Guid("78eb7243-2497-4d8c-9b10-5150bfdb0b2d"), 2, new Guid("6c4dede5-87ad-4a90-a7a8-52dd2fc5e46b"), "Duplicate any non-primal spell of 7th level or lower.", 2 },
                    { new Guid("8851196d-59a6-444d-8470-1e4c8a87d556"), 1, new Guid("6c4dede5-87ad-4a90-a7a8-52dd2fc5e46b"), "Duplicate any primal spell of 9th level or lower.", 2 },
                    { new Guid("d53db610-a666-4ab2-873a-9850f91cca27"), 0, new Guid("6c4dede5-87ad-4a90-a7a8-52dd2fc5e46b"), "You request a direct intercession from the natural world. Nature always refuses unnatural requests and might grant a different request (potentially more powerful or better fitting its character) than the one you asked for. A primal phenomenon spell can do any of the following things.", 0 },
                    { new Guid("12133f1b-e9b6-468e-8ccc-44ce31982a64"), 7, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "Trample [three‑actions] You move up to twice your Speed and move through the space of Large or smaller creatures, trampling each creature whose space you enter. A trampled creature takes damage from its foot Strike based on a basic Reflex save (DC = 19 + the target’s level).", 2 },
                    { new Guid("06d4cf6b-2a4f-47b4-a31a-a8f70e797fbe"), 0, new Guid("cbbfa8a9-29f5-4f00-ab8d-a8091b26c82e"), "Your touch grants a reprieve to a cursed creature. You attempt to counteract one curse afflicting the target. If the curse comes from a cursed item or other external source, a success indicates that the target creature can rid itself of the cursed item, but it doesn’t remove the curse from the item.", 0 },
                    { new Guid("f92e1b0a-72ff-415b-8c6d-7ac595e73351"), 5, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "The following unarmed melee attacks, which are the only attacks the target can use. They’re trained with them. When attacking with these attacks, the target uses their attack modifier with the proficiency and item bonuses of their most favorable weapon or unarmed Strike, and the damage is listed for each attack. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If the target’s unarmed attack modifier is higher, they can use it instead. Melee [one‑action] tusk (reach 15 feet), Damage 4d8+19 piercing; Melee [one‑action] trunk (agile, reach 15 feet), Damage 4d6+16 bludgeoning; Melee [one‑action] foot (agile, reach 15 feet), Damage 4d6+13 bludgeoning.", 2 },
                    { new Guid("46a149ee-5355-44b6-b01e-5b7a00151482"), 4, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "Low-light vision.", 2 },
                    { new Guid("aa6d28d3-4466-426f-8458-2743e5c0dc8e"), 3, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "Speed 40 feet.", 2 },
                    { new Guid("225ada54-c1ef-4a3b-9a70-d1347d62d754"), 2, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "20 temporary Hit Points.", 2 },
                    { new Guid("5d1d71ea-cfef-4e7e-9046-1d7de045f00b"), 1, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "AC = 22 + the target’s level. Ignore any armor check penalty and Speed reduction.", 2 },
                    { new Guid("25742ad7-797e-41df-8e31-87b5dcb061ee"), 3, new Guid("41d86bba-5c5a-466a-8818-1cbf4c94081b"), "Water - You gain a swim Speed of 20 feet and become invisible while you are in the water. You can electrically charge yourself by taking a single action, which has the manipulate trait. If you do, you are no longer invisible in the water due to electricity indicating your location, but any creature that makes a melee attack against you takes 1d6 electricity damage; if it touches you, this is cumulative with the damage from your major curse.", 2 },
                    { new Guid("fc397103-1210-4b49-99b6-6189bc825d58"), 0, new Guid("63252b43-57d0-40fc-a734-b871d24d7fef"), "Your touch calls forth a churning mass of icy water that clings to your target, dealing 1d4 bludgeoning damage and 1d4 cold damage. The target must attempt a Fortitude save.", 0 },
                    { new Guid("ac07b494-8238-4570-9054-54799c67564b"), 0, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "Summoning the power of the natural world, you transform the targets into a herd of mammoths, and they each assume a Huge battle form. Each target must have enough space to expand into or the spell fails for that target. Each target gains the animal trait. Each target can Dismiss the spell’s effects on themself. Each target gains the following while transformed:", 0 },
                    { new Guid("2139c3e4-89c2-4478-a01c-bd03f43993e7"), 1, new Guid("5d06dded-2209-4d4c-93f7-cea29784ce1e"), "This spell gains the trait that opposes the alignment you chose—if you choose chaos, this spell gains the lawful trait, and vice versa; if you choose evil, this spell gains the good trait, and vice versa.", 0 },
                    { new Guid("cead21a7-ec4b-4637-9df3-3595ea6248d9"), 0, new Guid("01319058-8d1e-44bd-9f9a-400b34827c1a"), "You create an invisible, floating eye, 1 inch in diameter, at a location you can see within 500 feet. It sees in all directions with your normal visual senses and continuously transmits what it sees to you.", 0 },
                    { new Guid("4498cce9-94cc-4431-af3c-28751fbc16a4"), 1, new Guid("7fd2f417-ea8b-4016-ab47-d96198be53c6"), "The item reassembles in perfect condition. Even if your mental image was of a damaged or weathered object, the new one is in this perfected form. If the object was magical, this spell typically restores its constant magical properties, but not any temporary ones, such as charges or one-time uses. An item with charges or uses per day has all of its uses expended when remade, but it replenishes them normally thereafter.", 0 },
                    { new Guid("cae1b934-e117-49ac-b08e-4414a0f75462"), 2, new Guid("be1eb08b-e713-4d5f-b80f-bcd86592d274"), "Each of the mansion’s exterior doorways and windows are protected by alarm spells. You choose whether each alarm is audible or mental as you Cast the Spell, and each has a different sound (for an audible alarm) or sensation (for a mental one), allowing you to instantly determine which portal has been used.", 0 },
                    { new Guid("ee5be692-8ab3-4ab7-b7b6-d810796a6af1"), 0, new Guid("be19cf0a-bdde-4460-9753-ac2b7baf0f04"), "Healing magic purges disease from a creature’s body. You attempt to counteract one disease afflicting the target.", 0 },
                    { new Guid("18a93616-f712-4d75-9e2c-d7fcd461444f"), 2, new Guid("41d86bba-5c5a-466a-8818-1cbf4c94081b"), "Mist - You gain a fly Speed of 20 feet, and it becomes hard to see through you. Any creature on one side of your space who is targeted by a creature on the opposite side is concealed to the targeting creature.", 2 },
                    { new Guid("2d447c2a-fb83-4616-be54-c04fd321a47a"), 0, new Guid("ff672805-46a4-459d-881a-41bd1aee7d2b"), "With a touch, you ease a creature’s fears. You can attempt to counteract a single fear effect that the target suffers from. This frees only the target, not any other creatures under the fear effect.", 0 },
                    { new Guid("8c32fc5e-0167-4f91-a67a-ac502f5266ab"), 0, new Guid("9dd0a647-ed3c-458c-8486-ddd748e880ff"), "A surge of energy frees a paralyzed creature. You can attempt to counteract a single effect imposing the paralyzed condition on the target. This does not cure someone who is paralyzed from some natural state or effect, such as paralysis caused by non-magical wounds or toxins.", 0 },
                    { new Guid("6385c041-a840-422c-b3d5-00a229fd7527"), 0, new Guid("2e2c7320-6610-44fe-8e06-18950089fce1"), "You manifest an aura that prevents creatures from approaching you. When casting the spell, you can make the area any radius you choose, up to 40 feet. A creature must attempt a Will save if it’s within the area when you cast the spell or as soon as it enters the area while the spell is in effect. Once a creature has attempted the save, it uses the same result for that casting of repulsion. Any restrictions on a creature’s movement apply only if it voluntarily moves toward you. For example, if you move closer to a creature, it doesn’t then need to move away.", 0 },
                    { new Guid("09185ac4-2fc9-4e4f-91eb-8d76ea9a5021"), 0, new Guid("6007e524-204d-451d-87b1-7f3fc7646ee5"), "You create an immobile sphere of force to either trap or protect the target, blocking anything that would pass through the sphere. The sphere has AC 5, Hardness 10, and 40 Hit Points. It’s immune to critical hits and precision damage. Disintegrate destroys the sphere instantly. If the target is unwilling, the effects of the sphere depend on the target’s Reflex save.", 0 },
                    { new Guid("56f77a74-82df-4a85-a4ac-79eb0b99ff16"), 0, new Guid("79ff21e7-4e97-4aa8-bc7f-101572960965"), "A shield of elemental energy protects a creature against one type of energy damage. Choose acid, cold, electricity, fire, or sonic damage. The target and its gear gain resistance 5 against the damage type you chose.", 0 },
                    { new Guid("39878ea1-fef3-4010-9e75-e78df7c6d1e2"), 0, new Guid("be1eb08b-e713-4d5f-b80f-bcd86592d274"), "You conjure a towering mansion up to four stories tall and up to 300 feet on a side. While Casting the Spell, you hold an image of the mansion and its desired appearance in your mind. The mansion can contain as many or as few rooms as you desire, and it is decorated as you imagine it. You can imagine a purpose for each room of the mansion, and the proper accouterments appear within. Any furniture or other mundane fixtures function normally for anyone inside the mansion, but they cease to exist if taken beyond its walls. No fixture created with this spell can create magical effects, but magical devices brought into the mansion function normally.", 0 },
                    { new Guid("f7b5b85a-4fdc-47e9-b38b-c0088580988c"), 1, new Guid("41d86bba-5c5a-466a-8818-1cbf4c94081b"), "Air - You gain a fly Speed of 20 feet and become invisible while you are in the air. You can create the effects of a gust of wind from your space as a 2-action activity, which has the manipulate trait.", 2 },
                    { new Guid("6f9564e0-c47d-4192-9cbe-f41fe253cb24"), 0, new Guid("41d86bba-5c5a-466a-8818-1cbf4c94081b"), "Your body becomes fluid to better suit your surroundings. When you Cast this Spell, choose whether to become air, water, or mist. The spell gains the air trait if you choose air or mist, and the water trait if you choose water or mist. You become amorphous, as does your armor. You lose any item bonus to AC and use your proficiency bonus for unarmored defense to determine your AC. You also gain resistance 10 to physical damage and become immune to precision damage. You can slip through tiny cracks and don’t need to breathe. You can’t cast spells, activate items, or use actions that have the attack or manipulate trait. You also gain the following effects based on your form.", 0 },
                    { new Guid("35c7cf11-efc5-45db-adcd-b025a3a1236e"), 1, new Guid("be1eb08b-e713-4d5f-b80f-bcd86592d274"), "Your mansion contains the same types and quantities of foodstuffs and servants as created by the magnificent mansion spell.", 0 },
                    { new Guid("f09d5747-ddab-4304-a43b-97994033dbe0"), 0, new Guid("7fd2f417-ea8b-4016-ab47-d96198be53c6"), "You fully re-create an object from nothing, even if the object was destroyed. To do so, you must be able to picture the object in your mind. Additionally, the material component must be a remnant of the item, no matter how small or insignificant (even a speck of dust that remains from disintegrate is enough). The spell fails if your imagination relied on too much guesswork; if the object would be too large to fit in a 5-foot cube; if the object still exists and you were simply not aware of it; or if the object is an artifact, has a level over 20, or has similar vast magical power.", 0 },
                    { new Guid("4f5fcee9-1300-4dd5-a021-8804b1b50116"), 5, new Guid("e08d32af-b2da-42a3-89f2-fc6df9cf0b91"), "Prestidigitation can’t deal damage or cause adverse conditions. Any actual change to an object (beyond what is noted above) persists only as long as you Sustain the Spell.", 0 },
                    { new Guid("f7d901be-ad0b-4d23-be85-e72e431d96eb"), 1, new Guid("becd7da8-c65e-479a-92c2-788a9c863662"), "Each time the creature regains Hit Points from regeneration, it also regrows one damaged or ruined organ (if any). During the spell’s duration, the creature can also reattach severed body parts by spending an Interact action to hold the body part to the area it was severed from.", 0 },
                    { new Guid("784ea015-2dff-4fcf-8e59-a29fc8fdce90"), 0, new Guid("74baea8f-7f2f-4486-adaa-d924b667c512"), "You peek into the future. Choose a particular goal or activity you plan to engage in within 1 week, or an event you expect might happen within 1 week. You learn a cryptic clue or piece of advice that could help with the chosen event, often in the form of a rhyme or omen.", 0 },
                    { new Guid("d9e2d969-2f03-429e-aa39-73e198a8e0e2"), 1, new Guid("94291c89-b56a-423e-b66f-bf04f06e1c97"), "If the object is illusory, you detect this only if the effect’s level is lower than the level of your read aura spell.", 0 },
                    { new Guid("3733aa65-fc2f-4a07-838f-ea693b534ff7"), 0, new Guid("94291c89-b56a-423e-b66f-bf04f06e1c97"), "You focus on the target object, opening your mind to perceive magical auras. When the casting is complete, you know whether that item is magical, and if it is, you learn the school of magic (pages 297–298 of the Core Rulebook).", 0 },
                    { new Guid("941fed5e-7238-4f90-917e-0a57426b5b36"), 0, new Guid("c5479bd0-14c5-4df7-bca5-017566cfd5b5"), "You blast an icy ray. Make a spell attack roll. The ray deals cold damage equal to 1d4 + your spellcasting ability modifier.", 0 },
                    { new Guid("06db64b1-3aa9-4b9a-9c28-ab8b19869359"), 0, new Guid("f0d15a0d-0fe1-4bfc-a63e-1f4937d34871"), "A ray that saps a foe’s strength flashes from your hand. Attempt a ranged spell attack against the target. If you succeed, that creature attempts a Fortitude save to determine the spell’s effect. If your attack roll is a critical success, use the outcome for one degree of success worse than the result of its save.", 0 },
                    { new Guid("16d7d4b6-39dc-407b-8270-4c9143b9e312"), 1, new Guid("e7194559-f3b8-445a-83d6-5fca096668c8"), "If the spell is successful, the creature returns to life with 1 Hit Point, no spells prepared or spell slots available, no points in any pools or any other daily resources, and still with any long-term debilitations of the old body. The time spent in the Boneyard leaves the target temporarily debilitated, making it clumsy 2, drained 2, and enfeebled 2 for 1 week; these conditions can’t be removed or reduced by any means until the week has passed. The creature is also permanently changed by its time in the afterlife, such as a slight personality shift, a streak of white in the hair, or a strange new birthmark.", 0 },
                    { new Guid("78794f12-b6af-40f2-a60e-55168b03acce"), 0, new Guid("e7194559-f3b8-445a-83d6-5fca096668c8"), "You attempt to call forth the dead creature’s soul, requiring the creature’s body to be present and relatively intact. The creature must have died within the past 3 days. If Pharasma has decided that the creature’s time has come (at the GM’s discretion), or if the creature doesn’t wish to return to life, this spell automatically fails, but the diamonds aren’t consumed in the casting.", 0 },
                    { new Guid("34280ebf-7a8a-4cda-b7c3-92d65f0e901c"), 0, new Guid("c4507279-ec9c-4506-8f37-94e94744dbda"), "You replicate the attack of a deadly purple worm. You deal 3d6 piercing damage to the touched creature and afflict it with purple worm venom. The target must attempt a Fortitude save.", 0 },
                    { new Guid("4fdd948c-9083-4ba2-a1f4-bb7d3137b9ca"), 0, new Guid("c4e90b06-cae9-4c8e-9dcb-69aa89084597"), "You remove toxins and contaminations from food and drink, making them safe to consume. This spell doesn’t prevent future contamination, natural decay, or spoilage. One cubic foot of liquid is roughly 8 gallons.", 0 },
                    { new Guid("27a36046-97dd-440d-bfb2-71c2331c03c6"), 1, new Guid("4a3691c4-497f-4009-aaf7-2ecf804feb9b"), "The squares at the outside vertical edges of the cylinder prevent creatures from leaving. These squares are greater difficult terrain, and a creature attempting to push through must succeed at an Athletics check or Acrobatics check to Maneuver in Flight against your spell DC to get through. A creature that fails ends its current action but can try again.", 0 },
                    { new Guid("8d8505b5-dfe4-48b6-b8bf-c633d7f9c473"), 0, new Guid("4a3691c4-497f-4009-aaf7-2ecf804feb9b"), "Violent winds and a powerful downdraft fill the area, forming a cyclone. All flying creatures in the area descend 40 feet. The entire area is greater difficult terrain for Flying creatures, and difficult terrain for creatures on the ground or Climbing. Any creature that ends its turn Flying within the area descends 20 feet. Any creature pushed into a surface by this spell’s winds takes bludgeoning damage as though it had fallen.", 0 },
                    { new Guid("ecfe31e3-e00d-4ac4-bfa9-d1c50f0c5b0a"), 1, new Guid("01319058-8d1e-44bd-9f9a-400b34827c1a"), "The first time you Sustain the Spell each round, you can either move the eye up to 30 feet, seeing only things in front of the eye, or move it up to 10 feet, seeing everything in all directions around it. There is no limit to how far from you the eye can move, but the spell ends immediately if you and the eye ever cease to be on the same plane of existence. You can attempt Seek actions through the eye if you want to attempt Perception checks with it. Any damage dealt to the eye destroys it and ends the spell.", 0 },
                    { new Guid("f1393166-031e-4f6a-8254-1b23b118228a"), 0, new Guid("becd7da8-c65e-479a-92c2-788a9c863662"), "An infusion of positive energy grants a creature continuous healing. The target temporarily gains regeneration 15, which restores 15 Hit Points to it at the start of each of its turns. While it has regeneration, the target can’t die from damage and its dying condition can’t increase to a value that would kill it (this stops most creatures from going beyond dying 3), though if its wounded value becomes 4 or higher, it stays unconscious until its wounds are treated. If the target takes acid or fire damage, its regeneration deactivates until after the end of its next turn.", 0 },
                    { new Guid("7bc6898c-63fa-48be-a57b-a29543696ec8"), 4, new Guid("e08d32af-b2da-42a3-89f2-fc6df9cf0b91"), "Tidy - Color, clean, or soil an object of light Bulk or less. You can affect an object of 1 Bulk with 10 rounds of concentration, and a larger object a 1 minute per Bulk.", 2 },
                    { new Guid("fc3e5a7e-0848-4680-ad41-a857c673f891"), 6, new Guid("129a3bd8-23de-40ac-98c7-1a6301fd1c22"), "Athletics modifier of +30, unless the target’s own modifier is higher.", 2 },
                    { new Guid("47e06c3b-ccac-4eb7-9c66-1f63538cd5fd"), 2, new Guid("e08d32af-b2da-42a3-89f2-fc6df9cf0b91"), "Lift - Slowly lift an unattended object of light Bulk or less 1 foot off the ground.", 2 },
                    { new Guid("448b4d91-a838-4727-8ab0-5b01312e9001"), 0, new Guid("55a2e6d4-d58f-4cba-b5ff-77f54aa4e48b"), "You can look at currents in the air and water and see tracks that you can follow just as you would on land. You can use Survival to Track through both air and water, noticing aerial or aquatic “tracks” of all creatures who passed nearby in the last hour. It’s more difficult to Track in this way: the DC to Track through air or water is always at least 30, or higher after precipitation or wind (in the air) or heavy tides or currents (in the water). It’s possible to Cover Tracks against this spell, but creatures might not realize they need to do so.", 0 },
                    { new Guid("4fd44b45-7f1a-41f2-ad71-32f73d80e1f5"), 3, new Guid("e08d32af-b2da-42a3-89f2-fc6df9cf0b91"), "Make - Create a temporary object of negligible Bulk, made of congealed magical substance. The object looks crude and artificial and is extremely fragile—it can’t be used as a tool, weapon, or spell component.", 2 },
                    { new Guid("e4c39da0-52d6-4f8b-b1ca-b45a411161fa"), 2, new Guid("af9e64ed-a4a9-42bd-8b4a-e8adccffb4fc"), "14th to 15th - The target is stunned for 1 round.", 2 },
                    { new Guid("8d0011e6-c38e-4863-95e8-101d185517b9"), 1, new Guid("af9e64ed-a4a9-42bd-8b4a-e8adccffb4fc"), "13th or Lower - The target is stunned for 1d6 rounds.", 2 },
                    { new Guid("cd8f0729-d6b6-41cc-a6e0-b3c0fe90fc2f"), 0, new Guid("af9e64ed-a4a9-42bd-8b4a-e8adccffb4fc"), "You stun the target with an arcane word of power. Once targeted, the target is then temporarily immune for 10 minutes. The effect of the spell depends on the target’s level.", 0 },
                    { new Guid("94ee3100-fddb-4574-b5bf-a34ba59260c4"), 3, new Guid("20800ebc-bea0-420b-b492-0aab5ceb3a9d"), "16th or higher - The target takes 50 damage; if this brings the target to 0 Hit Points, the target dies instantly.", 2 },
                    { new Guid("a03b2257-35fd-46f8-b877-092e329dc828"), 2, new Guid("20800ebc-bea0-420b-b492-0aab5ceb3a9d"), "15th - If the target has 50 Hit Points or fewer, it dies instantly; otherwise, it drops to 0 Hit Points and becomes dying 1, or increases its dying condition by 1 if it’s already dying.", 2 },
                    { new Guid("b25f8da9-db2d-4305-acf9-3b7f0eb81e84"), 1, new Guid("20800ebc-bea0-420b-b492-0aab5ceb3a9d"), "14th or lower - The target dies instantly.", 2 },
                    { new Guid("d6bc5ff8-b0cc-4f79-9186-cf7e5f759bd1"), 0, new Guid("20800ebc-bea0-420b-b492-0aab5ceb3a9d"), "You utter the most powerful arcane word of power. Once targeted, the target is then temporarily immune for 10 minutes. The effect of the spell depends on the target’s level.", 0 },
                    { new Guid("98a6d70d-119d-45fb-ae75-4bad5d20dda9"), 3, new Guid("422d220b-faf1-4380-865a-94f4becabb91"), "14th or higher -  The target is dazzled for 1 minute.", 2 },
                    { new Guid("452c3bc6-0c9d-4856-8153-7a44e99fbbb7"), 2, new Guid("422d220b-faf1-4380-865a-94f4becabb91"), "12th to 13th -  The target is blinded for 1d4 minutes.", 2 },
                    { new Guid("02bce5e7-5369-4955-8f47-9bfa75055b96"), 1, new Guid("422d220b-faf1-4380-865a-94f4becabb91"), "11th or lower - The target is blinded permanently.", 2 },
                    { new Guid("27fc90ca-993f-4b02-a531-212cba2e486f"), 0, new Guid("422d220b-faf1-4380-865a-94f4becabb91"), "You utter an arcane word of power that can make the target blinded upon hearing it. Once targeted, the target is then temporarily immune for 10 minutes. The effect of the spell depends on the target’s level.", 0 },
                    { new Guid("48814a28-dad7-4daa-b93e-b410e72d83d3"), 1, new Guid("de5f1b30-7c64-4cb3-94d6-78a70ec916e5"), "While you’re possessing a target, your own body is unconscious and can’t wake up normally. You can sense everything the possessed target does. You can Dismiss this spell. If the possessed body dies, the spell ends and you must succeed at a Fortitude save against your spell DC or be paralyzed for 1 hour, or 24 hours on a critical failure. If the spell ends during an encounter, you act just before the possessed creature’s initiative count.", 0 },
                    { new Guid("34efb63b-9dd1-4f72-b620-e7bc8cae6cfd"), 0, new Guid("de5f1b30-7c64-4cb3-94d6-78a70ec916e5"), "You send your mind and soul into the target’s body, attempting to take control. The target must attempt a Will save. You can choose to use the effects of a degree of success more favorable to the target if you prefer.", 0 },
                    { new Guid("20efbc1e-0d19-46ab-929f-546f2985bc77"), 0, new Guid("d38967b5-1db4-4d11-b804-196bf9dcc574"), "You fire a blue-white ray of freezing air and sleet that deals 10d8 cold damage. Make a spell attack roll against the target.", 0 },
                    { new Guid("c34177aa-5173-4541-aabf-601fabd0d7e2"), 0, new Guid("fb5e5e4f-8c14-405c-8f91-dd5c6e56ff4d"), "You build up gravitational force and funnel it into your blows, leading to more powerful attacks with blade and bow alike. On your first weapon Strike each round, you gain a status bonus to damage equal to twice the number of weapon damage dice.", 0 },
                    { new Guid("062e69ff-671b-4c15-9f6b-d11232cc2990"), 0, new Guid("8fddb4d4-0f53-465e-8995-00671c2e9806"), "You harness positive energy to heal your animal companion’s wounds. You restore 1d10 Hit Points to your animal companion. The number of actions you spend Casting this Spell determines range and other parameters.", 0 },
                    { new Guid("07974ebc-cffa-4066-9dc9-050f58436607"), 11, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Shambler - Speed 20 feet, swim Speed 20 feet; resistance 10 to electricity; Melee [one‑action] vine (reach 15 feet), Damage 2d8 slashing.", 2 },
                    { new Guid("b00dcdfa-eb67-4d0c-bcd5-c4e0596528bd"), 10, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Flytrap - Speed 15 feet; resistance 10 to acid; Melee [one‑action] leaf (reach 10 feet), Damage 2d8 piercing, and you can spend an action after a hit to Grab the target.", 2 },
                    { new Guid("1b10930e-dc6e-45e6-9764-94f57c2db837"), 9, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Arboreal - Speed 30 feet; Melee [one‑action] branch (reach 15 feet), Damage 2d10 bludgeoning; Melee [one‑action] foot, Damage 2d8 bludgeoning; you can speak in this form, but you still can’t Cast a Spell or supply verbal components.", 2 },
                    { new Guid("288df902-223a-4253-9322-c8af1e414ba1"), 8, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "You also gain specific abilities based on the type of plant you choose:", 0 },
                    { new Guid("cc10b95a-7c9e-4bdd-87b4-5e938a2f9d7e"), 7, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Athletics modifier of +19, unless your own modifier is higher.", 2 },
                    { new Guid("c5e8ec87-a1b1-458b-9c6c-6cd56145e0b2"), 6, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "One or more unarmed melee attacks specific to the battle form you choose, which are the only attacks you can use. You’re trained with them. Your attack modifier is +17, and your damage bonus is +11. These attacks are Strength based (for the purpose of the enfeebled condition, for example). If your unarmed attack modifier is higher, you can use it instead.", 2 },
                    { new Guid("ea5661dc-1e85-498b-adf5-7647f5caa542"), 5, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "Low-light vision.", 2 },
                    { new Guid("d46d2901-16b4-4808-a625-4caa8629b738"), 0, new Guid("8ab5854e-77ab-4fd1-a64e-096bcff92f07"), "Your animal companion grows much larger, towering over its foes in battle. Your animal companion becomes Huge, gaining the effects of a 4th-level enlarge spell.", 0 },
                    { new Guid("4e3a0bc1-4a55-40c1-91e5-ad57f850f011"), 3, new Guid("49f819b2-863c-4072-b031-18b8c8d0d214"), "Jaws - You gain a jaws attack that deals 1d8 piercing damage and has the unarmed trait.", 2 },
                    { new Guid("4c893f47-5fdf-410d-8b5d-1b681d8893a3"), 3, new Guid("af9e64ed-a4a9-42bd-8b4a-e8adccffb4fc"), "16th or Higher - The target is stunned 1.", 2 },
                    { new Guid("e735b9d3-7d52-4649-ba9e-24585ec37c28"), 3, new Guid("23360ea6-7814-4686-b26f-bda76ce19c8b"), "12 temporary Hit Points.", 2 },
                    { new Guid("ae1e30db-aec5-4126-a111-41adfe69ccaf"), 2, new Guid("49f819b2-863c-4072-b031-18b8c8d0d214"), "Claws - You gain a claw attack that deals 1d6 slashing damage and has the agile, finesse, and unarmed traits.", 2 },
                    { new Guid("37fa1355-33f1-4d97-bf7a-513a1437fb93"), 1, new Guid("49f819b2-863c-4072-b031-18b8c8d0d214"), "Cat Eyes - You gain low-light vision.", 2 },
                    { new Guid("b5d57eaf-c157-4ed4-97d5-0e5fd6010dc1"), 0, new Guid("d9b56679-1f96-415d-aa40-a833baf1cfea"), "You create a powerful blast of air and a loud peal of thunder, dealing 2d6 bludgeoning damage and 2d6 sonic damage. Each creature in the area must attempt a Fortitude save.", 0 },
                    { new Guid("92ca33d6-8310-4706-af7c-da1815a0fc08"), 0, new Guid("8fcfc44b-127f-4ff8-958f-915cc73c973f"), "You focus your gaze on a creature and gain a flash of divine insight into its nature. If the creature has any weaknesses, you learn them, as well as which of its three saving throw modifiers is lowest. You also learn an inherent understanding of its movements and gain a +2 status bonus to your next attack roll (or skill check made as part of an attack action) against that foe before the end of your turn. The target is then temporarily immune to vision of weakness for 1 day.", 0 },
                    { new Guid("57e95279-193c-4a08-b603-3ab49969adbf"), 1, new Guid("e08d32af-b2da-42a3-89f2-fc6df9cf0b91"), "Cook - Cool, warm, or flavor 1 pound of nonliving material.", 2 },
                    { new Guid("a14fafcd-3535-49df-8045-5fcee62c98c5"), 0, new Guid("e08d32af-b2da-42a3-89f2-fc6df9cf0b91"), "The simplest magic does your bidding. You can perform simple magical effects for as long as you Sustain the Spell. Each time you Sustain the Spell, you can choose one of four options.", 0 },
                    { new Guid("38d4480b-e74a-4cb9-9ded-e9514eff230e"), 0, new Guid("49f819b2-863c-4072-b031-18b8c8d0d214"), "Without fully transforming your body, you gain one animalistic feature, which you select from the list below each time you Cast the Spell.", 0 },
                    { new Guid("867a9083-044b-477e-b557-baa5f6c6f03d"), 0, new Guid("44b564a0-37be-4ef7-b8b5-cae2f9ae7d77"), "You call forth a storm of whirling flames, engulfing all creatures in that area and dealing 5d6 fire damage with a basic Reflex save.", 0 }
                });

