                    { new Guid("6ae69ff8-919d-4a88-a8a6-b0292096d4cc"), new Guid("f0366047-21ca-4f51-971e-4f7c72629b74"), "ConditionEffect", false, 2, new Guid("0b046df0-35c7-4ce5-9e8a-ef267997af29") },
                    { new Guid("e53047c7-b2c6-49d3-ab62-efa783987154"), new Guid("f0366047-21ca-4f51-971e-4f7c72629b74"), "ConditionEffect", false, 2, new Guid("d566e2ff-1134-475d-b4f8-a7a3724c29d2") },
