                    { new Guid("903e1d6d-379c-4223-8032-88bc21d562e6"), new Guid("48d6ee37-8a18-4162-9164-9f7892045d2d"), "ConditionEffect", false, null, new Guid("8dc1ed03-ff8b-49a0-bbf3-6ccabf16b382") },
