            migrationBuilder.InsertData(
                table: "Stave_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("00b51ddc-2440-4e29-a4f5-982b1e4c1348"), 0, new Guid("6946135b-4041-47c6-84aa-2af8dfb87282"), "A large, stylized symbol of an eye adorns the top of this wooden staff, representing the watchful eye of the divine powers. The bearer of the staff can guide and protect, seeing bounties and tragedies that could befall them in the future. When wielding this staff, you gain a +1 item bonus on Survival checks to Sense Direction or Subsist, and to Religion checks to Recall Knowledge.", 0 },
                    { new Guid("082a3705-031c-46f1-8520-de72ece3332a"), 0, new Guid("49477d23-5bfe-4148-8545-a10cc7b690ba"), "This stout staff is made from gnarled hawthorn. When used as a weapon, a staff of nature's vengeance permanently has the effects of shillelagh. ", 0 },
                    { new Guid("8179200f-aa5a-40f0-b249-ddf1fdb170b5"), 0, new Guid("c6e92b4d-5564-4bf9-8cf8-e3d254c06786"), "This staff is topped with carved animal and monster heads. While wielding the staff, you gain a +2 circumstance bonus to Nature checks to identify animals.", 0 },
                    { new Guid("1a6f52bb-1aec-4fb2-8444-b7b84ca5776d"), 0, new Guid("e9e7ca52-dbd8-438f-929f-366dc6667216"), "This gnarled staff is covered with thorns and coated with a glistening lacquer that acts as a minor irritant. While holding the staff, you aren't affected by its coating or thorns, and you reduce the DC of your flat checks to overcome persistent poison damage.", 0 },
                    { new Guid("d4835746-ba17-4c3a-ad28-eee3601d92a5"), 0, new Guid("55e574b7-e8dc-4db3-8e07-75a7c8f236a0"), "This adamantine staff is fitted with mithral plates resembling battlements on a castle. Lesser cover, cover, and greater cover don't grant any bonus against your spell attacks or to saving throws against your spells that you cast from the staff.", 0 },
                    { new Guid("46bb791f-15df-4d28-8935-574c8372a59e"), 0, new Guid("deb6c4dd-109d-43bf-9397-2f2b48e44053"), "This polished wooden staff bears a swirling motif reminiscent of the folds of a brain. While wielding the staff, you gain a +2 circumstance bonus to checks to identify mental magic.", 0 },
                    { new Guid("cf003da9-73d4-4a5d-a143-0b141793d64f"), 0, new Guid("1784527f-e3d8-4cfc-a3fd-9f15222ae211"), "his rough metal staff is pitted and sandblasted, with thousands of nigh-imperceptible sand crystals embedded in its surface. While carrying the staff, you gain a +2 circumstance bonus to Occultism checks to identify aberrations and oozes native to the Darklands.", 0 },
                    { new Guid("9044ef68-350f-4c8f-93f9-6a777964e9a3"), 0, new Guid("20bc189e-5cf1-4b4d-99b6-062952146eb3"), "This bizarre staff is made from oak, capped with a cluster of eye-shaped gemstones that seem to move and undulate at the corner of your vision. While wielding the staff, you can peer through the eyes, using your normal visual senses (including any benefits of spells affecting your vision, like see invisibility). You can maneuver the staff to see things around corners, at higher elevations, or in places where the staff can fit but your head can't. This doesn't provide sufficient line of effect to target creatures around corners. The eyes are as vulnerable as your eyes and can be affected by anything that alters your vision, such as a blinding flash of light.", 0 },
                    { new Guid("8a7b6786-fe4c-4bf8-9daf-8204f786b689"), 0, new Guid("7e5e3c63-4054-46a2-a209-2262f07d2e5e"), "This ornately designed metal staff shines with precious inlays of gold. When you Cast a Spell from the staff, the illusory image of something you desire flashes across its surface. While wielding the staff, you gain a +2 circumstance bonus to checks to identify illusion magic.", 0 },
                    { new Guid("6c20923d-9951-45dc-8b8c-ec751501bce2"), 0, new Guid("efd9ac9d-3ca5-4736-9fe4-76b99043f84e"), "This intricately carved wooden staff is warm to the touch and thrums with inner energy. While wielding the staff, you gain a +2 circumstance bonus to checks to identify abjuration magic.", 0 },
                    { new Guid("5b455a3e-bf03-4535-8d20-f89e675fd6a1"), 0, new Guid("7bb4740b-c530-49e3-97ad-e2bec15a475a"), "This highly polished black wooden staff resembles an aristocrat’s oversized walking cane, complete with a silver head shaped like a large circus animal such as a horse or elephant. Ringmasters or announcers use ringmaster’s staves to draw attention from their audiences or to salvage acts that fall flat mid-performance. While wielding a ringmaster’s staff, your normal voice can be clearly heard by all creatures within 300 feet regardless of intervening barriers or ambient noise, although your voice can’t penetrate magical silence and you can’t use this to extend an auditory or sonic effect through barriers that would otherwise block it.", 0 },
                    { new Guid("167e1f8a-97f1-4c3c-ad9d-4ca54924adc1"), 0, new Guid("c0d7e91e-f22f-45d6-b506-214bf7f32883"), "Semiprecious gemstones emerge, seemingly at random, from the surface of this gnarled wooden staff. While wielding it, you gain a +2 circumstance bonus to checks to identify divination magic.", 0 },
                    { new Guid("fbc2eace-cdf2-4435-8eee-9b5df9ef751f"), 0, new Guid("0bda6552-d25a-4dc2-9b4b-8e26e2a34bdd"), "This ash staff is decorated with animals; wielding it, you gain a +2 circumstance bonus to checks to identify conjuration magic.", 0 },
                    { new Guid("c52e913e-7408-49de-84ae-d3f812bf23a6"), 0, new Guid("33cfe402-9370-4a89-9bc1-c7daaa59c542"), "A glass orb atop this metal staff contains fine, undulating sand. While wielding the staff, you gain a +2 circumstance bonus to checks to identify transmutation magic.", 0 },
                    { new Guid("61a7357e-a2a4-42ae-a586-34e5e1ba21de"), 0, new Guid("9798577c-6e68-4cd6-bf8c-bd9923a2e683"), "This staff resembles a blackened and burned length of ashen wood. It smells faintly of soot and glows as if lit by embers. You can use an Interact action to touch the tip of this staff to a torch, tinder, or a flammable substance to ignite a flame.", 0 },
                    { new Guid("74c3b504-4c48-47f3-b392-50b7a6ee42e9"), 0, new Guid("a00e7823-576a-4c7e-91cc-7f3dc7b288e6"), "This oak branch grows leaves in spring that change color in autumn and shed in winter. While wielding it, you gain a +2 circumstance bonus to Nature checks to identify plants.", 0 },
                    { new Guid("37ba2630-5ba5-49da-9af1-c5d9d555f2db"), 0, new Guid("06990eb6-99e6-4f28-a33c-dc1eadd99cf6"), "This staff of magically hardened wood is topped with a silver sculpture depicting magical runic symbols. When used as a weapon, a staff of power is a +2 greater striking staff.", 0 },
                    { new Guid("0188c989-de29-444b-aeb6-efcc2c4c17b4"), 1, new Guid("5f046522-54b0-4afb-94f4-5cfc2c914546"), "Voluntarily destroying a staff of the magi unleashes a truly devastating wave of arcane energy that surges out, dissipating with distance. When wielding the staff, you can break it using an Interact action. This releases a 30-foot‑burst magical explosion centered on the staff. This deals 2d10 force damage per charge remaining in the staff (DC 40 basic Reflex save), You automatically critically fail your save. The explosion continues to echo beyond the initial blast zone, dealing half as much damage to creatures beyond 30 feet but within a 60-foot burst. A creature reduced to 0 Hit Points by this damage dies instantly; this is a death effect.", 0 },
                    { new Guid("5ec547f0-1ed7-4cf3-bcb8-f9dd4d40e617"), 0, new Guid("0d2991dc-30ed-4fc9-8c61-7c21897a95ee"), "This twisted and grim-looking staff is adorned with hideous skull and bone motifs. While wielding the staff, you gain a +2 circumstance bonus to checks to identify necromancy magic.", 0 },
                    { new Guid("bb2b3277-0920-4742-99e2-4bcd11ba51fa"), 0, new Guid("aa970d4a-5183-439c-bbf0-fbebd9bfa612"), "A mesmerizing gemstone caps the head of this handsomely crafted wooden staff. While wielding the staff, you gain a +2 circumstance bonus to checks to identify enchantment magic.", 0 },
                    { new Guid("a6fa75b3-8fc3-4932-89fe-8b674917d80d"), 1, new Guid("06990eb6-99e6-4f28-a33c-dc1eadd99cf6"), "Voluntarily destroying a staff of power unleashes an incredible blast of energy. When wielding the staff, you can Interact to break it. This releases a 30-foot-burst magical explosion centered on the staff. This deals 2d8 force damage per charge remaining in the staff (DC 40 basic Reflex save). You automatically critically fail your save. A creature reduced to 0 Hit Points by this damage dies instantly; this is a death effect.", 0 },
                    { new Guid("057755af-3d7c-4222-9767-7aa122acbaa5"), 0, new Guid("50a5910a-0be2-485a-8940-0720b1406d72"), "This simple iron staff is capped with a faceted, clear gem.", 0 },
                    { new Guid("f325d179-14a1-447d-b9ee-5e624663d58a"), 0, new Guid("7df574ec-0a8a-40f1-9ff0-d43b341ce224"), "Made of smooth, white wood, this staff is capped at each end with a golden cross adorned with a multitude of ruby cabochons. A staff of healing grants an item bonus to the Hit Points you restore anytime you cast the heal spell using your own spell slots or using charges from the staff.", 0 },
                    { new Guid("d516587f-39c5-41b5-a076-da4febaefbf3"), 0, new Guid("5f046522-54b0-4afb-94f4-5cfc2c914546"), "Sigils and runes of ancient and powerful magic cover the iron cladding on this long wooden staff. A staff of the magi is a +3 major striking staff, and when wielding it you gain a +1 circumstance bonus to saving throws against spells.", 0 },
                    { new Guid("cdcb4e1f-d231-4398-bd53-48749e6bfdd2"), 0, new Guid("50e1e89d-8578-4fb9-a3c1-af9205a8968b"), "This staff is tapered at the base and carved into a gem-studded twist at the top. While wielding the staff, you gain a +2 circumstance bonus to checks to identify evocation magic.", 0 }
                });

