                    { new Guid("aec8ff2c-14fc-4cc8-81af-3cd75de33eb4"), 5, new Guid("5e2f27d1-6b8b-41a0-8f58-095a4bb926d3"), 15000, null, new Guid("28896ad6-948f-4a6d-943d-40daa0d11b80"), null },
                    { new Guid("b0fddee5-3b99-44a0-b38b-603c6b91442a"), 6, new Guid("5e2f27d1-6b8b-41a0-8f58-095a4bb926d3"), 22500, null, new Guid("327ed57b-80ae-431c-8611-310c9e4667f1"), null },
                    { new Guid("5841519c-7f2e-4954-aa13-47b6fc1e7a62"), 8, new Guid("5e2f27d1-6b8b-41a0-8f58-095a4bb926d3"), 47500, null, new Guid("5bef5cb1-6cc2-4540-9224-6200bb40d217"), null }
                });

            migrationBuilder.InsertData(
