            migrationBuilder.InsertData(
                table: "Armors_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("a86ab0c4-63d1-4ec2-891b-f308291731a5"), 1, new Guid("abee6439-3461-45f5-b234-8e155921fc95"), "Few armors in the Inner Sea region are as memorable as the iconic Hellknight plate. While each order has its own flourishes, Hellknight plate is instantly recognizable to any who know of the Hellknights. Hellknights go to extreme measures to punish non-Hellknights who get their hands on Hellknight plate, and the reward is not usually worth the risk, since for non-Hellknights, the armor is functionally similar to full plate.", 0 },
                    { new Guid("6c2f2ed3-13f6-4efe-be8c-70b921cd99e6"), 0, new Guid("abee6439-3461-45f5-b234-8e155921fc95"), "A character who is a member of the Hellknights has access to this uncommon armor.", 0 },
                    { new Guid("fac46981-86cf-43fb-8baa-f2eb63dd18fb"), 0, new Guid("b19fb537-a420-4506-a444-fc9f58db5c11"), "Half plate consists of most of the upper body plates used in full plate, with lighter or sparser steel plate protection for the arms and legs. This provides some of the protection of full plate with greater flexibility and speed. A suit of this armor comes with an undercoat of padded armor and a pair of gauntlets.", 0 },
                    { new Guid("87d33432-9b15-4be9-a08f-33059cc6b7d2"), 0, new Guid("ee6f41ed-1e5b-4ef9-8f4d-a2720aa9e477"), "Plate mail consists of interlocking plates that encase nearly the entire body in a carapace of steel. It is costly and heavy, and the wearer often requires help to don it correctly, but it provides some of the best defense armor can supply. A suit of this armor comes with an undercoat of padded armor and a pair of gauntlets.", 0 },
                    { new Guid("7f9f4ce5-04a8-4c1f-84e4-9dac5e1fb616"), 0, new Guid("653970e9-fa6d-492a-a58e-36d505a38657"), "This leather armor is reinforced with metal studs and sometimes small metal plates, providing most of the flexibility of leather armor with more robust protection.", 0 },
                    { new Guid("f5334a06-4882-4033-8af1-043303b472d9"), 0, new Guid("ee976251-119d-4b17-b47b-eea1fafb1fdf"), "A mix of flexible and molded boiled leather, a suit of this type of armor provides some protection with maximum flexibility.", 0 },
                    { new Guid("4332249c-d32b-4dfe-9025-2a1f4bbb6f88"), 0, new Guid("e376e538-e4c3-49b8-bff2-239a76012ec9"), "Though referred to as a breastplate, this type of armor consists of several pieces of plate or half-plate armor that protect the torso, chest, neck, and sometimes the hips and lower legs. It strategically grants some of the protection of plate while allowing greater flexibility and speed.", 0 },
                    { new Guid("8d94c1d8-41d5-416d-b928-40bc00950de3"), 0, new Guid("e95aa60c-9410-40f5-9c26-7d33be653193"), "This type of armor is chain mail reinforced with flexible, interlocking metal plates, typically located on the wearer’s torso, upper arms, and legs. A suit of this armor comes with an undercoat of padded armor and a pair of gauntlets.", 0 },
                    { new Guid("247c9d0a-b5a0-41a7-a93d-5d31230b68fc"), 0, new Guid("e238440f-34b9-4583-b0df-467bf3a19319"), "Scale mail consists of many metal scales sewn onto a reinforced leather backing, often in the form of a long shirt that protects the torso, arms, and legs.", 0 },
                    { new Guid("d8d5ca54-b095-4db0-a98b-a7eb2be10d34"), 0, new Guid("cb7b819d-3ddc-4819-bdb1-a0bafa47ead0"), "This armor is simply a layer of heavy, quilted cloth, but it is sometimes used because it’s so inexpensive. Padded armor is easier to damage and destroy than other types of armor. Heavy armor comes with a padded armor undercoat included in its Price, though it loses the comfort trait when worn under heavy armor. You can wear just that padded armor undercoat to sleep in, if your heavy armor is destroyed, or when otherwise not wearing the full heavy armor. This allows you to keep the armor invested and benefit from the power of any runes on the associated heavy armor, but no one else can wear your heavy armor without the padded undercoat.", 0 },
                    { new Guid("915c591a-6d4e-4a6c-9ad1-8ee619a7ffd8"), 0, new Guid("6fbffdfc-1443-4f6b-980b-a3d17412ac93"), "Adventurers who don’t wear armor travel in durable clothing. Though it’s not armor and uses your unarmored defense proficiency, it still has a Dex Cap and can grant an item bonus to AC if etched with potency runes.", 0 },
                    { new Guid("c85e39dd-a871-4c16-8448-790b3d7c822c"), 0, new Guid("9d419b32-9b59-4a20-9909-8485ae52f637"), "Sometimes called a hauberk, this is a long shirt constructed of the same metal rings as chainmail. However, it is much lighter than chainmail and protects only the torso, upper arms, and upper legs of its wearer.", 0 },
                    { new Guid("8513e4e9-1ea1-4da2-ad65-74830ab74d2e"), 0, new Guid("6c357ddd-162b-4fc0-b2a1-23ec6f1bbef4"), "A suit of chain mail consists of several pieces of armor composed of small metal rings linked together in a protective mesh. It typically includes a chain shirt, leggings, a pair of arms, and a coif, collectively protecting most of the body.", 0 },
                    { new Guid("ee0c4c90-254a-4a19-9443-664d45d21730"), 0, new Guid("36116598-e497-42fa-a206-f7971f09acc3"), "A mix of furs, sturdy hide, and sometimes molded boiled leather, this armor provides protection due to its layers of leather, though its bulkiness slows the wearer down and decreases mobility.", 0 }
                });

            migrationBuilder.InsertData(
                table: "ArtifactAction_Effects",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("f3441de6-b82a-47c4-8900-a40cfb05ceee"), 12, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Knight - A palace guard arrives and swears unfailing loyalty to you.", 2 },
                    { new Guid("c12386e0-788a-4870-97fd-cb6d076444d1"), 13, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Moon - Roll 1d4 to determine how many wishes the card grants you, which also affects the phase of the moon depicted on the card (1: crescent moon; 2: half moon; 3: gibbous moon; 4: full moon). These wishes each take one action to speak and have the effect of a wish spell.", 2 },
                    { new Guid("4e2985d4-0965-4fd3-a78c-c35166f48223"), 14, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Rogue - One NPC ally becomes filled with hatred and immediately turns against you forever. The NPC might keep this hatred secret until an opportune moment.", 2 },
                    { new Guid("9a3ecfc4-209f-42da-adbe-b0c0751e7f82"), 15, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Ruin - You lose all your nonmagical possessions, including any wealth and property.", 2 },
                    { new Guid("e1884dc4-e163-4c5f-8e87-f40f3058effa"), 16, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Skull - You must immediately battle a lesser death. If slain in the battle, you can never be revived, except by a deity.", 2 },
                    { new Guid("c387c5ec-78b3-46a9-95e4-c68a4c7fb7a5"), 19, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Talons - All your magic items disappear permanently, except for the deck and any artifact of higher level than the deck.", 2 },
                    { new Guid("72f3de70-80b7-42e5-b5a1-8f3c0ac22484"), 18, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Sun - Gain 1,000 XP and a beneficial permanent magic item of 6th to 11th level, chosen by the GM.", 2 },
                    { new Guid("4e729a2c-7537-4aec-981a-fb8fb0b4e1b7"), 20, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Throne - You gain a permanent +4 status bonus to Diplomacy checks, and you now own a small castle in any open area you wish. You must choose its location within 1 hour.", 2 },
                    { new Guid("afdc9b9a-6944-4b29-9fe3-9e3cd54e1eee"), 21, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Vizier - Upon request, you can learn the solution to any one problem or the correct answer to any one question, unless that information is obscured by a deity. This doesn't necessarily give you the means to act on that solution. You have 1 year to take the vizier's advice or lose its benefits.", 2 },
                    { new Guid("265ec20d-9794-4491-ab84-ba051040dc9d"), 11, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Key - Gain a magic weapon of 12th level or higher. The GM determines the item and what runes it has, if any.", 2 },
                    { new Guid("2c29c9ab-8e81-4835-8e59-b4517e609dfa"), 17, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Star - Gain an ability boost you must use immediately on one ability score of your choice.", 2 },
                    { new Guid("585c3a9c-3a4b-4413-9dd2-8a57b968bb53"), 10, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Jester - You can either draw two more cards or gain 1d10×100 XP. The card then disappears forever.", 2 },
                    { new Guid("b19c23a3-c7ef-4675-a962-33ea95e0e9dd"), 0, new Guid("79fab3e8-5c85-48b2-8597-9487f2cd2c60"), "You execute a creature restrained beneath the blade. The executed creature takes 11d10 slashing damage and must succeed at a DC 45 Fortitude save or be decapitated as though it suffered a critical hit with a natural 20 from a +3 major striking vorpal scythe. The soul of a creature executed with a final blade is trapped, and the creature can’t be returned to life through any means, even a miracle or similar magic. A final blade can hold any number of souls in this way, and they can be released only through a complex ritual known only to the Gray Gardeners or through the destruction of the final blade.", 0 },
                    { new Guid("9a8139e2-2aa0-45cd-bccc-9331b15aec66"), 8, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Fool - You lose 1d10×100 XP unless you choose to draw two more cards.", 2 },
                    { new Guid("67013058-c964-465c-be8a-ab662f3ed0b1"), 7, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Flames - A fiend becomes filled with anger, jealousy, envy, or some other reason to despise you. Its hatred for you doesn't cease until either it or you is dead. It attacks you or otherwise attempts to foil you within 1d20 days. The GM determines the specifics of the fiend.", 2 },
                    { new Guid("e7b2c9d7-5623-4ceb-ae21-e23bd60f0f2c"), 6, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "The Fates - The Fates respin the fabric of reality to save you from any situation you choose. This can reverse even a past event, and you can make the decision instantly even if the event would slay you. This intervention saves only you, not anyone else affected by the event. There's no limit on how long you can wait before using this effect.", 2 },
                    { new Guid("43c6afc1-40f7-42ff-82f9-101f81635a04"), 5, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Euryale - (curse) A medusa's image curses you with a permanent –1 status penalty to all saving throws. This can be removed by only a deity or the Fates card.", 2 },
                    { new Guid("d9b6215f-b5cb-4234-9519-d48256a195ec"), 4, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Dullard - Immediately reduce your Intelligence score by 1d4+1. You can then draw an additional card, and the Dullard card then disappears forever.", 2 },
                    { new Guid("ca6d0818-3323-4f4e-9247-f34f35ee54ab"), 3, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Donjon - You're imprisoned by a 10th-level imprisonment ritual. This uses the prison option, typically sequestering you in a distant part of the world. You also lose all your items. Cease drawing cards.", 2 },
                    { new Guid("d0c62ece-5781-47ef-ae80-516cd53284e5"), 2, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Comet - If you alone defeat the next low-threat or harder hostile enemy or enemies you encounter, you gain enough XP to reach the next level. Otherwise, you gain no benefit.", 2 },
                    { new Guid("71465159-4a85-4e6d-b4b9-aceb992b3e7a"), 1, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Balance - Your alignment changes to a radically different one. If you fail to adhere to that alignment, you lose a level and all the benefits you gained at that level. Your XP total doesn't change when you lose a level this way.", 2 },
                    { new Guid("b697d6ab-decb-4a53-a5ad-ae9df2f74733"), 0, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "You declare how many cards you will draw facedown from the deck, then draw your first card. The card takes effect immediately. Any further cards must be drawn within the next hour, and any card you don’t voluntarily draw flits off the deck and affects you anyway. You can never activate the same deck of many things again. Once a card is drawn, it produces its effect immediately and then disappears back into the deck, which immediately shuffles itself. (The Dullard and Jester are exceptions, as described in their entries below.) The effects of each card are as follows.", 0 },
                    { new Guid("0820e64c-31ca-4c14-b80b-99724bf66342"), 0, new Guid("21e49cbb-ab50-4035-a15e-fde6a0832c4a"), "The axe casts a 10th-level summon elemental spell to conjure an elite elemental avalanche. The spell is automatically sustained, requiring no action on your part but still allowing you to command the elemental on each of your turns. You can Dismiss the Spell.", 0 },
                    { new Guid("63a015d5-e196-4cd7-aebc-a8afcde821e3"), 22, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "The Void - Your mind becomes trapped forever. This card is fickle, but it often throws the psyche into a prison in an object on a distant plane or planet. Wish or similarly powerful magic can reveal your psyche's location, but it doesn't bring you back. Your comatose body continues to function. Cease drawing cards.", 2 },
                    { new Guid("a8c1aaf6-409c-4b31-b1d5-dec133ee04cc"), 0, new Guid("b300bad6-b1b0-4f67-a343-197d13322b4c"), "Make a Strike against a living tree with Blackaxe. If it hits, the tree withers to ash and you heal 250 Hit Points and gain the benefit of restoration (6th) and restore senses.", 0 },
                    { new Guid("4491450d-2b0c-4f2b-9696-5af12e34f3ef"), 9, new Guid("e833f07b-3c0e-400a-9d21-e568b2234a95"), "Gem - Gain your choice of 25 pieces of jewelry worth 200 gp each or 50 gems worth 100 gp each.", 2 },
                    { new Guid("c0755216-c588-47e0-b217-f0bd4f39f3d9"), 0, new Guid("0c37b3ea-002f-414e-b674-d37519246087"), "Blackaxe appears in your hands, teleporting instantly from its prior location.", 0 },
                    { new Guid("650c5752-e8e3-4737-a190-1a37baebbfe8"), 0, new Guid("21a00b42-f9bc-4482-9200-1158558dad95"), "The elder sign casts a 10th-level banishment spell on an eldritch creature. Even if the creature isn’t extraplanar, the elder sign can still banish it, sending it back to the part of the Material Plane from which it originated. If the creature is a Great Old One, the elder sign banishes it automatically (as if it critically failed its save) but is then forever destroyed.", 0 },
                    { new Guid("7cd71ff0-ec4e-4e77-9742-7c9235417d17"), 0, new Guid("1b990d52-6b74-430e-9630-1ae9005328c8"), "The elder sign casts dimensional lock, though it wards against travel by only eldritch creatures. Each time the elder sign casts dimensional lock in this way, the previous dimensional lock spell ends.", 0 },
                    { new Guid("e655417e-dd66-41c6-9eab-78ccc685535b"), 0, new Guid("e8ea0b0e-8827-4ab0-a3a2-e92239009f4e"), "Aroden's Hearthstone draws in heat from the world itself, causing the ambient temperature within 100 miles to drop below 0°F. Within 1 mile of the Hearthstone, the temperature drops to –200°F, rivaling the frigid cold of outer space and dealing 4d6 cold damage each round to every creature in the area. This effect lasts 1 minute, during which time the nearest moon (probably Golarion's) appears an eerie blue color to any observers within 100 miles of the hearthstone. At the end of 1 minute, the hearthstone emits a blast of concentrated heat that deals 25d6 fire damage to creatures and objects within 150 feet.", 0 },
                    { new Guid("84aa85e7-7894-47e2-abb4-87cc6d5428c5"), 0, new Guid("f842c9b5-61fd-49ea-a297-34d2be6bdd4e"), "You swing Hunter's Dawn and launch a magically conjured javelin at a target within 60 feet, making a ranged Strike. The javelin has the statistics of a javelin but gains the magical properties of Hunter's Dawn and disappears immediately after hitting or missing its target. On a successful hit, you deal damage (3d6 piercing, due to the atlatl's greater striking rune, plus your Strength modifier); in addition, a gazelle leaps from the hit target to one or more targets within 20 feet of the first, dealing 2d6 piercing damage plus your Strength modifier. The number of additional targets hit in this way is equal to the number of actions you spend to activate this ability (one additional target if you used one action, two additional targets for two actions, and so forth).", 0 },
                    { new Guid("4419d9dc-5953-4ee7-b3e2-6a78ce314541"), 0, new Guid("1ce275a4-86a3-4311-adea-8dcba6483cdf"), "The target is marked. Once per day, you can cast a 5th-level locate spell on the marked target, regardless of its distance from you or your ability to cast spells. This effect persists until it is dispelled (counterspell DC 46), the creature dies, or a new target is marked.", 0 },
                    { new Guid("d9edfb63-4891-4602-afb8-818420c88948"), 0, new Guid("45feabb5-9f12-4eee-b741-ba29f7c4f5db"), "You shave a curl of wood from Hunter's Dawn and create a roaring fire within 15 feet. You can choose one of the following shapes for the fire to take: a 10-foot square, a 20-foot line, or a 15-foot cone. Each creature in the affected squares take 6d6 fire damage (DC 46 basic Reflex save).", 0 },
                    { new Guid("58854733-4136-4e02-b1de-d2f9fad10a00"), 0, new Guid("134aec75-3c9d-44a0-9233-a91b377167b8"), "You attempt a melee Strike with the Kortos Diamond against a creature within reach. On a hit, you deal damage as normal and the target's mind is inflicted with a powerful disruptive energy. When the creature attempts to Cast a Spell, it must attempt a DC 44 Will save; on a failure, the spell fails and both the spell and the actions spent to cast it are lost. This effect lasts for up to 1 minute.", 0 },
                    { new Guid("fe84aa36-6102-491b-9dee-c7e7ec267699"), 0, new Guid("01a25c9c-b250-42fd-8893-6132362f4487"), "You deal an additional 2d8 force damage to the struck creature.", 0 },
                    { new Guid("134ed8b1-cc9f-4c01-9a94-729fe4251ff0"), 0, new Guid("98bb490c-bf5b-4cd3-afa5-41b0f24b9a41"), "You hold the Kortos Diamond aloft and proclaim your might in a booming voice. You cast overwhelming presence (DC 42).", 0 },
                    { new Guid("744dac82-97e4-46f9-ba6a-91493d29ca9b"), 0, new Guid("fb27b55d-9b89-44a7-9365-bc5ad95f9325"), "You draw a temporary shield of chaotic turbulence with a cerulean flash. You gain a +3 circumstance bonus to AC against the triggering attack.", 0 },
                    { new Guid("e078704a-8b1d-4cc6-9a38-ee220614a933"), 0, new Guid("4e84e886-4a8a-4daa-baf3-ff4b4e9c1f34"), "The Cane of the Maelstrom casts a 5th-level hallucinatory terrain spell and infuses the illusion with quasi-real substance drawn from the primal chaos of the Maelstrom. Creatures that don't disbelieve the illusion treat structures and terrain created through the spell as though they were real, ascending illusory stairs, becoming trapped by illusory quicksand, and so on. If no creature disbelieves the illusion during its duration, the changes become wholly real and permanent when its duration expires.", 0 },
                    { new Guid("356d28ce-6dc9-43fe-995a-cdd55eceaf6a"), 0, new Guid("ed064ae6-c820-403f-89d3-dece3f1d6c3f"), "The Cane of the Maelstrom casts a 5th-level creation spell, except the duration is unlimited and you can create delicate or complex objects by succeeding at an applicable Crafting skill check when you activate this ability.", 0 },
                    { new Guid("aa6ccf33-9b97-4bc4-ad56-1f8cc5654f7f"), 0, new Guid("ce29489a-c373-4f35-b5df-1fe3b9bb3774"), "The Radiant Spark casts a 10th-level dominate spell (DC 49) on a creature that isn't from the Material Plane. Celestials get an outcome one degree of success worse than the result of their save.", 0 },
                    { new Guid("6585b523-d5e3-41a9-80fb-c69d8fb5a076"), 0, new Guid("1a7967cb-e6c0-47ae-8b34-5744cee8c1ec"), "The Radiant Spark reduces the casting time of the ritual to 1 hour, and you don't need secondary casters for this ritual.", 0 },
                    { new Guid("15e7587a-9b92-4152-8746-ef592e6342a7"), 0, new Guid("3ea00a55-9847-4305-b64f-0213e3b41698"), "The target must attempt a DC 49 Will save and is immune to further attempts for 24 hours.", 0 },
                    { new Guid("9f6c3d2e-8ab1-492b-bf50-8d209b6424fa"), 0, new Guid("79d034b0-dd32-4be4-b943-10d34f8e7d50"), "A pale blue beam shines from Gauntlight's lens and illuminates a 30-foot-radius burst centered on any point within 1 mile. The light saturates the region, causing any corpses in the area or within 10 feet of the surface of the illuminated area to animate as level –1 undead (typically as skeleton guards or zombie shamblers). Once animated, the undead remain active until slain. Until then, they remain uncontrolled and are driven only by the desire to slaughter the living. If Gauntlight is fully restored, the undead instead animate as any Common undead of 15th level or less, as the user wishes.", 0 },
                    { new Guid("7778b8c7-8514-44df-a33c-1b0128b3219f"), 0, new Guid("5b89399e-0a7a-47e7-841b-b98c38f799cf"), "A pale blue beam shines from Gauntlight's lens and illuminates a 30-foot-radius burst centered on any point within 1 mile. The user chooses one creature of 4th level or less that is physically located within Gauntlight; this creature is then is teleported to any point within this illumination radius. If Gauntlight is fully restored, any number of creatures within Gauntlight of 15th level or lower can be transported. This is a teleportation effect.", 0 },
                    { new Guid("1aa4e733-dd23-4d1b-822c-327925bbd71c"), 0, new Guid("fc118b2f-6e83-455c-a62d-84f60f75494a"), "You gain a +2 item bonus to skill checks to Recall Knowledge about Nhimbaloth, her faith, or creatures associated with her (such as incorporeal undead, vampiric mists, wisps, and other incorporeal creatures associated with death). Each time you use this ability after the first in a 24-hour period, you are exposed to the Empty Death.", 0 },
                    { new Guid("cfd6b0f5-8be5-4aa7-97db-fd75d788e395"), 0, new Guid("0cc9bab7-3eac-48b4-861b-b2f16dba1c35"), "You read aloud a phrase from the book and target a single incorporeal undead creature within 30 feet. That undead creature takes 5d6 positive damage (DC 27 basic Will save) as portions of their incorporeal being are consumed in patches of seven equally spaced holes. Each time you use this ability after the first in a 24-hour period, you are exposed to the Empty Death.", 0 },
                    { new Guid("1b3870c8-1ba5-4967-bb98-4580cc1deed3"), 0, new Guid("47ae5fbf-8621-4e6b-84d4-3c98c7387f98"), "You invoke a tale from The Whispering Reeds that parallels the situation, environment, or creatures nearby. Eerie mists and indistinct whispers rise in a 20-foot emanation around you, and clusters of seven perfectly spaced divots manifest in the ground, vegetation, and flesh of creatures in the emanation other than yourself and up to three creatures you designate at the time of activation. Creatures afflicted with these divots suffer from agonizing mental anguish in the form of crippling despair and take 4d6 mental damage (DC 27 basic Will save). The mists, whispers, and strange divots fade away at the end of the round, but any creature that takes mental damage from the effect also takes a –1 penalty to saving throws against effects with the emotion trait for 1 minute. You are exposed to the Empty Death each time you use this ability.", 0 },
                    { new Guid("f86702a2-4d68-4b27-ac92-f96ef4bbc3a9"), 0, new Guid("fe8ae67c-a86f-4445-941b-0a226c0ddea2"), "You cast one of the following spells at the lowest level possible (unless otherwise specified): crushing despair (one target within 30 feet only), fear (3rd), paranoia, or phantasmal killer. You are exposed to the Empty Death each time you use this ability.", 0 },
                    { new Guid("39c315bd-a1aa-411d-842a-1dbdab708f75"), 0, new Guid("3c4bcde6-3b6d-4066-8e5d-790cac0612f8"), "The elder sign casts dispel magic on an effect from an eldritch creature, using a counteract level of 10 and +30 modifier for the roll.", 0 },
                    { new Guid("18db2077-f59d-41b0-a222-b78ba9b6dcdd"), 0, new Guid("166a6ae1-4c1a-4942-8fe5-6cd825b31538"), "You attempt to overwhelm a dragon’s mind—while you cannot control the dragon, you can render it immobile for a short time. Choose a dragon within 60 feet; the dragon can attempt to resist the orb with a DC 30 Will saving throw (or higher with orb shards). Gold dragons take a –4 circumstance penalty to this saving throw. Any stun from this activation ends if the dragon is attacked or otherwise subject to a hostile act other than that of the orb.", 0 },
                    { new Guid("b42fcb22-569c-4f33-ac51-d6cfaea154e5"), 0, new Guid("26a07a06-6274-4f90-bd22-107e088649ab"), "ou craft a magical weapon or armor of up to 20th level. You must attempt a Crafting check as usual to create the item, but you need supply only raw materials worth a quarter of the item's Price, and you need not pay the remaining portion of the item's Price or spend additional downtime days working on it. While Aroden's Hearthstone is active, the stars in the sky, including Golarion's sun, appear to glow brighter within a 100-mile radius of the hearthstone.", 0 },
                    { new Guid("f30a0a33-3689-48ab-8ad3-c3eb38949d53"), 0, new Guid("2d1bc28d-1b4e-408d-8070-ed1e5be6f3ce"), "You touch the Eye of the Wise to a gem worth at least 10 gp, whereupon the Eye of the Wise assumes the appearance of the touched gemstone. While this connection is active, the carriers of the Eye of the Wise and of the other gemstone can communicate telepathically with one another over any distance, as long as both are on the same plane. This connection is broken if the other gemstone is damaged, if the Eye of the Wise becomes attuned to another gemstone, or if the bearer of the Eye of the Wise Dismisses the activation.", 0 },
                    { new Guid("52360ff5-47b3-4e11-a87a-91a444a598b0"), 0, new Guid("fd1bb5d1-e5d4-45a5-bbf1-b1559e81d240"), "You alter and rearrange the facets of the essence prism, adjusting the essences to select for a single quality, which might be associated with mental essence, like a personality trait; material essence, like a physical quality; vital essence, like a belief or instinct; or spiritual essence, like an alignment component such as good or lawful. You must succeed at a secret DC 30 skill check with a skill associated with a magical tradition that uses the essence you chose (for instance, Arcana or Occultism for mental essence, as arcane and occult magic both use mental essence). On a failure, you accidentally set the prism for some other quality.", 0 },
                    { new Guid("bacf08cd-633f-4bc3-b824-510a5b9476c9"), 0, new Guid("31005c6f-88f3-4a6b-8266-e26341a980e0"), "Over the course of the next hour, the creature in the input stream has its essences refracted through the prism, creating two cocoons of magic in the output streams that each contain a new creature. At the end of the process, the original creature is gone, and the two new creatures break free of their cocoons. Each creature is part of the original, separated from the rest based on the last quality set by the prism’s first activation. For instance, if you set the prism to “good,” one creature would have all the original creature’s good aspects and the other would be the original creature’s evil side. Unless you selected a physical quality, both new creatures look just like the original. The new creatures are usually 2 levels lower than the original, but if the original creature was strongly biased with respect to the quality you chose (for instance, if splitting out the good and evil side of a redeemer), the stronger creature is 1 level lower and the weaker creature is 3 or more levels lower. If calibrated correctly, this activation can also reverse the effect of the third activation.", 0 },
                    { new Guid("63ab1eaa-09b9-4368-ab66-fc94bcd86161"), 0, new Guid("8edfe177-96be-4e73-a572-d31bd61160b7"), "Over the course of the next hour, the essences of both creatures in the input streams are refracted through the prism, creating a cocoon of magic in the output stream that contains a new creature. At the end of the process, the original creatures are gone, and the new creature breaks free of its cocoon. The new creature is an amalgam of the originals, with a new personality blended from both, and is usually 1 or 2 levels higher than the higher level of the original creatures unless the lower-level creature was much weaker. This activation also reverses the effect of the second activation.", 0 },
                    { new Guid("606dc3d9-d0a2-4de7-9f1b-8c33619ca9be"), 0, new Guid("47df6f9c-d990-4700-b193-56d0f5a5648f"), "The Forgefather’s seal glows and your armor shakes as it absorbs the blow. The attack’s damage is reduced by 100 and you cast earthquake (DC 40), centered directly on the triggering creature. You decide the area of the earthquake when you Cast the Spell, from as small as the size of the creature and up to a 60-foot burst.", 0 },
                    { new Guid("94eaf58d-ef4d-4f49-931e-0416823bed8c"), 0, new Guid("396e2173-b3a9-4c83-92e6-0928eff79bb4"), "You call upon on the restorative powers of the seal to repair an item within reach. The rune instantly restores the item to full Hit Points, even if the item was destroyed, using the effects of the remake spell, so long as the majority of the item is available for the repair. The seal can restore even magic items and artifacts of its level or lower. Once you have used this ability, the seal’s ability to automatically repair shields becomes inactive until the next time you make your daily preparations.", 0 },
                    { new Guid("8242ca8f-1943-4ed3-b208-576b4a3cea50"), 0, new Guid("c3c4bfd4-1578-4bcb-ab20-142465ec754a"), "You call upon Torag to defend your allies and those around you, sacrificing yourself in the process. Creatures of your choosing within 60 feet recover all their Hit Points. If any of the creatures are dead, they are instead brought back to life with half of their maximum Hit Points. The chosen creatures also gain a +4 status bonus to AC and saving throws, and fast healing 15 for 1 hour. You can use this ability to bring back to life a creature that requires a miracle spell or divine intervention to raise from the dead, as long as you choose no other creatures within 60 feet to recover. Once you use this activation, you are turned into a perfect statue made from stone or metal that depicts you in a glorious pose honoring your sacrifice, and you can never be restored. The Forgefather’s seal remains on this statue and can be transferred to another suit of armor or a runestone as normal.", 0 },
                    { new Guid("03356da7-c9d9-4627-b3e7-dd72da589b9e"), 0, new Guid("c65e81aa-a1fd-43f3-a97f-e3fa36fc61dd"), "The creature takes 5d6 negative damage. If you are an undead, you regain Hit Points equal to the negative damage the creature took.", 0 },
                    { new Guid("cd759e79-e988-4d07-8f55-16e08196f23b"), 0, new Guid("9867095f-815a-487e-953a-e564ca0e34d7"), "You hold the Eye of the Wise up to your own eye and peer through it. The Eye of the Wise grows transparent and grants you a +2 item bonus to attempts to Decipher Writing, Disable a Device, Identify Magic, Pick a Lock, Seek, or Sense Motive. You can Sustain this activation as long as you hold the gem in place.", 0 },
                    { new Guid("e16805b1-b157-4841-8e72-91f541d5b768"), 0, new Guid("3dbb98c7-85be-493e-abc8-faef4b2eab6e"), "You force a creature looking at the mirror to attempt an additional Will save against the mirror’s fascination effect, even if they succeeded at their save.", 0 },
                    { new Guid("9585273c-9413-447b-a537-4eaaaa483c87"), 0, new Guid("0d217364-a4c4-42fc-a7e8-02c5e7435348"), "You control the target for 30 days, with the effect of a critically failed saving throw against dominate. If the victim sees the mirror again at any point before this duration expires, the control extends for an additional 30 days from the moment it looked at the mirror again. While there is no initial saving throw, the DC to break free due to commands against the creature’s nature is 35.", 0 },
                    { new Guid("97a22ccf-affe-470e-ab0b-2c373d3dff8e"), 0, new Guid("b25e7a3f-5ab4-425c-8da2-4ada7094cd82"), "The Horns of Naraga transform into Naraga, an ancient black dragon. Naraga appears in an adjacent appropriate space, and if no such space is available, she does not appear. Naraga follows your commands without question. She remains for up to 1 hour or until you use an Interact action to dismiss her, after which she reverts back to the helm. If Naraga is slain, she immediately reverts back to the helm and can’t be summoned for 1 week. You don’t receive any of the helm’s other benefits while it is transformed.", 0 },
                    { new Guid("526c3fe6-e4af-4ee5-be47-bc57a1a0e0d1"), 0, new Guid("2b62a10d-7c12-4736-9c0c-70c6c40e291a"), "You breathe an elemental blast that deals 25d6 damage (DC 40 basic Reflex save) in either a 60-foot cone or a 100-foot line (your choice). The breath’s damage type matches the Breath Weapon of the dragon type associated with the orb of dragonkind (acid for the black orb, electricity for the blue orb, and so on).", 0 },
                    { new Guid("538565fe-5267-4a72-bc1a-a18fb4a9f2a9"), 0, new Guid("e9e1579f-d07d-4ef9-8017-5cc4ba739a42"), "You use the extractor to produce an alchemical item of your level or lower whose formula you know. The extractor can create 56 levels’ worth of items per day in this way. For example, the extractor could create two true elixirs of life (19th level) and two moderate elixirs of life (9th level), or eight comprehension elixirs (7th level), and so on.", 0 },
                    { new Guid("575d4f2b-fcde-42c4-9a44-a3110f0a5158"), 0, new Guid("e3bb1e33-abaa-45ba-a001-297875d2b602"), "You take a sizable portion of a creature (at least two-thirds of its original mass) and filter it through the mechanisms of the extractor. After the end of the process, the philosopher’s extractor creates a transmogrifying mutagen that imparts the essence of the creature to the drinker. The extractor can make several transmogrifying mutagens simultaneously using the same activation if enough mass is provided at once, up to a maximum of 10 concurrent mutagens. Drinking a transmogrifying mutagen imparts you with one of the creature’s unique abilities for 1 hour. This could grant one of several abilities such as a dragon’s Breath Weapon, darkvision, flight, frightful presence, or immunity to sleep. The ability functions as it did for the original creature, except it uses your class DC or your spell DC (whichever is higher) instead of the creature’s DC. The mutagen grants only abilities based on a creature’s physiology and never grants magic-related abilities such as innate spells or spellcasting ability. The GM ultimately decides what ability a transmogrifying mutagen grants.", 0 },
                    { new Guid("c8d7b7c0-41cf-487d-aa74-6d4892600b31"), 1, new Guid("e3bb1e33-abaa-45ba-a001-297875d2b602"), "Unlike normal for mutagens and effects, you can drink multiple transmogrifying mutagens and gain benefits from each. When you drink transmogrifying mutagens made from different creatures, you receive abilities from each creature. When you drink multiple transmogrifying mutagens made from the same type of creature, such as multiple mutagens made from trolls, you gain an additional ability for each transmogrifying mutagen you drink, and the duration of the abilities from that creature type increases by 1 hour for each additional concoction you drink.", 0 },
                    { new Guid("68162d70-bf62-4e51-9bd1-4aa46b357977"), 2, new Guid("e3bb1e33-abaa-45ba-a001-297875d2b602"), "However, these additional benefits come with a risk; if you drink a transmogrifying mutagen while at least one other is active, after drinking it, you must succeed at a flat check with a DC equal to the total number of active transmogrifying mutagens you’ve consumed. On a failure, you fully transform into a member of the species of the latest transmogrifying mutagen you drank, and you almost always go berserk from your change. The transformation may leave some amount of your personality and memories intact, at the GM’s discretion.", 0 },
                    { new Guid("00682ecb-0194-4558-a68f-971f6f3d8535"), 0, new Guid("bad32aba-a5a3-4d86-b11f-4be79bb2cad1"), "Serithtial spends the appropriate number of actions and casts a 9th level heal or zone of truth spell (DC 45 for either of the two spells).", 0 },
                    { new Guid("6d5849c7-5a14-4029-add2-e87113a5b784"), 0, new Guid("240918f8-e501-46d0-824d-11bc93abb51c"), "You recall the shot of the First Vault, which automatically reloads itself into your weapon. If the shot had fragmented, the fragments violently dislodge themselves, dealing 15 persistent bleed damage to each creature in which they were embedded. The fragments then unite to re-form the shot of the First Vault, which automatically reloads itself into your weapon.", 0 },
                    { new Guid("3b2fe04f-3994-4665-906d-1132b2d0891b"), 0, new Guid("f7d637df-294b-418d-b058-6de02620a003"), "You line up a perfectly aimed attack directly toward the First Vault. You Strike a creature, then the shot of the First Vault attempts to bring your target with it as it returns to the First Vault. Unless your attack roll is a critical failure, the creature must attempt a DC 45 Reflex save; this effect has the incapacitation trait. Regardless, the shot of the First Vault returns to the First Vault.", 0 },
                    { new Guid("569b9d0d-9449-41f8-9601-3a089033b55f"), 0, new Guid("c7b0749b-7de5-4270-a5d6-16a4d7f4e850"), "You attempt a DC 30 Arcana or Occultism check to take control of the sphere. If someone else already controls the sphere, this check uses their Will DC if higher. If you succeed, you take control of the sphere. If you fail, the sphere moves 10 feet closer to you (or 20 feet on a critical failure). You keep control as long as you remain within 80 feet of the sphere and Sustain the Activation each round. When you Sustain the Activation, you must attempt a DC 30 Arcana or Occultism check. If you succeed, you direct the sphere to move up to 10 feet in a straight line (or up to 20 feet on a critical success). On a failure, you lose control of the sphere, and it moves 10 feet closer to you in a straight line (or 20 feet on a critical failure).", 0 },
                    { new Guid("35383177-e9b5-4c4c-a49c-8d879c6714c9"), 0, new Guid("e71528ee-38f3-4ca7-80b9-f27866b446ba"), "You cast a 10th-level dominate spell (DC 40) on a dragon of the type associated with the orb within 500 feet, except the effect lasts for 1 month rather than unlimited. The dragon does not receive its status bonus to saving throws against magic. The dragon is then temporarily immune to further domination via the orb for 24 hours.", 0 },
                    { new Guid("42791d95-bda6-468f-bfdd-ca6ddc1a38e3"), 0, new Guid("1bab1fef-7fa2-426c-8445-c920a26b4056"), "You sense the world around Blackaxe as though you were in its location and can use any of your innate spells through the link as if it were the source of the spell. If another creature is wielding Blackaxe, it must succeed at a DC 50 Will save or be slowed 2 until it relinquishes the weapon.", 0 }
                });

