            migrationBuilder.InsertData(
                table: "ArtifactDestructionEffect_Effects",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[] { new Guid("cd9d0ec6-9e38-4e81-bd9e-fad42feb6432"), 0, new Guid("7250a5b4-b24e-4734-a020-a136de5a2a20"), " If you activate The Whispering Reeds and are not a worshipper of Nhimbaloth, you become stupefied 2 for 24 hours as your thoughts fill with paranoia that something is watching you from the other side of death. If you die while affected by the Empty Death, you immediately become a chaotic evil ghost. Every 7 days that pass after you become a ghost, you must succeed at a DC 2 flat check— failure indicates that you are consumed by Nhimbaloth. A creature whose ghost is consumed in this way does not travel to the River of Souls and is utterly annihilated; this creature can only be restored to life via a 10th-level spell effect or ritual like wish.", 0 });

