                    { new Guid("887db397-373f-4699-b9d0-eff69bfb4c5a"), 0, new Guid("1ba885fe-9179-4e22-96d0-a4076da92527"), "An unseen servant’s physical body is made of force. It can’t use attack actions. It can move and use Interact actions to do things such as fetch objects, open unstuck or unlocked doors, hold chairs, and clean. It can’t pass through solid objects.", 0 }
