            migrationBuilder.InsertData(
                table: "Mysteries_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("fcc67e88-9d62-4e8f-ac74-d82d715db235"), 0, new Guid("27eab9f4-e610-4eaa-8288-2b531cb6bcee"), "The voices of generations past speak to you, and you hear their words. You might resent the constant interruption, or you might revere the spirits of those who came before. Perhaps you hail from a culture with strong ancestral traditions, such as the Shoanti Skoan-Quah (Skull Clan), a traditional dwarven community that worships Torag's family pantheon, or a group that reveres Erastil or Pharasma. You might commune with powerful psychopomps who shepherd souls to the afterlife, with the River of Souls itself, or with those spirits who have become trapped outside of the great cycle of spiritual rebirth. You learn from their whispers and the fragments of their memories, but opening your mind to their knowledge and experience also allows them to meddle in your worldly affairs.", 0 },
                    { new Guid("fc4c9d2e-ec4b-45cf-8c7d-7f718b760dde"), 0, new Guid("30b7795f-c380-43f1-8f32-330f532225dd"), "Fire lives at the center of the world, the center of the sun, and the center of civilization. You might revere this elemental force, siphon power from the Elemental Plane of Fire, or venerate a collection of deities such as Asmodeus, Sarenrae, the Tian goddess of disasters and volcanoes Lady Nanbyo, or the elemental lord of fire Ymeri.", 0 },
                    { new Guid("7438d154-cb04-4c08-bc6f-477c04b0915e"), 0, new Guid("95d646cf-1720-4c5b-ae7f-44879200011d"), "Warlike forces fill you with physical might and tactical knowledge, aiming to have you uphold the glory of combat, fight to improve the world, prepare against the necessity of conflict, or endure the inevitability of war. You might draw upon deities such as Gorum, Iomedae, Rovagug, the Horseman of War Szuriel, the Queen of the Night Eiseth, the Vudrani god Diomazul, and others, or you might find power in the unending conflict between the armies of Heaven and Hell, the Elemental Planes, the Outer Gods, or even the collective spirits of those who fought in wars over the ages.", 0 },
                    { new Guid("949f0bd4-628e-438b-8dd0-97a09c5a93b8"), 0, new Guid("1814b4e8-edc9-4dd8-958d-3dbe7e3fe3b1"), "Knowledge and information come freely to you. You might use this lore to gain power or perhaps to understand the divine mysteries of the multiverse. You might have a conduit to the fabled Akashic Record, maintain a subtle telepathic connection to the collective subconscious of all living creatures, or follow in the footsteps of deities such as Abadar, Irori, Nethys, Irori's scholarly nephew Gruhastha, the fey triune goddess of fate Magdh, or the lawful aeon god-figure known as the Monad.", 0 },
                    { new Guid("8701e1d8-2ae2-4d05-8939-3603602c58e8"), 0, new Guid("4875ca50-6a42-4025-bb6d-d8d978dfe0fc"), "The fury of the wind and waves pounds in your heart, whether your power flows from natural storms, a conduit to the elemental Planes of Air and Water, or through reverence of deities such as Gozreh, the tengu god of storms Hei Feng, the demon lord Dagon, or the elemental lords of air and water.", 0 },
                    { new Guid("d2f612f4-6c77-450d-83cb-7f12562153d9"), 0, new Guid("b0b78c19-7a13-49fb-9a34-7d04765b78cf"), "The never-ending flow of positive energy within living beings is palpable to you. You might uphold the sanctity of life, or perhaps you seek to undermine it. You might draw power from the collective vitality of the world's living creatures, hold some connection to the Positive Energy Plane, or revere a collection of deities including Irori, Pharasma, Sarenrae, and the god of medicine Qi Zhong.", 0 },
                    { new Guid("18b42df5-2d06-4fff-96b0-b70487ea09d6"), 0, new Guid("aff38e17-5143-4499-9a7b-eeadf5205495"), "Celestial bodies great and small exert influence on you, giving you sublime cosmic power. Perhaps you see the glittering stars as a divine blessing, or perhaps you feel drawn to the infinitely dark spaces between. You might uphold deities like Desna, Sarenrae, or the deific lovers Shizuru and Tsukiyo who represent the sun and the moon—or you might draw power from dark entities from beyond the stars, like certain Outer Gods, or destructive gods of the night like Zon-Kuthon or the rat goddess Lao Shu Po.", 0 },
                    { new Guid("5c50fd1d-ebd4-483d-b353-9175ebf42dad"), 0, new Guid("9ca06a26-bfe0-4599-abac-9050dec1a9a9"), "Your mystery imparts an understanding of death and undeath in all their macabre complexity. You might have had a brush with death yourself—maybe even dying and returning to life—or carry the touch of undeath in your blood. If you commune with deities, you might speak with guardians of death like Pharasma and the psychopomp ushers (the most powerful among creatures that guide souls through the afterlife); a bringer of death like the Mantis God Achaekek or the Horseman of the Apocalypse Charon; or a herald of undeath such as Urgathoa.", 0 }
                });

            migrationBuilder.InsertData(
                table: "Mysteries_MysteryBenefits",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("1696e194-5fea-4e53-bec3-efafc8ae1116"), 0, new Guid("aff38e17-5143-4499-9a7b-eeadf5205495"), "Your body is as much an astronomical one as it is physical. You gain resistance equal to 2 + half your level against all physical damage.", 0 },
                    { new Guid("eb2dc91c-a278-4b7a-ac1d-a83b855a63c7"), 0, new Guid("1814b4e8-edc9-4dd8-958d-3dbe7e3fe3b1"), "You hold more mystical knowledge within you than most. You have one additional spell in your repertoire of each level you can cast.", 0 },
                    { new Guid("f7ed2c4a-ce1f-4d8a-a95a-0fa3acad9a0a"), 0, new Guid("30b7795f-c380-43f1-8f32-330f532225dd"), "Like fire itself, you flicker and dance, avoiding effects that would quench your vitality. You have expert proficiency in Reflex saves. At 13th level, if you gain the lightning reflexes class feature, your proficiency rank for Reflex saves increases to master, and when you roll a success on a Reflex save, you get a critical success instead.", 0 },
                    { new Guid("a941cf6e-eea5-4b8d-b19a-e661b21ee0b0"), 1, new Guid("95d646cf-1720-4c5b-ae7f-44879200011d"), "Choose one weapon group that embodies your mystery. You are trained in all martial weapons of that group. At 11th level, if you gain the weapon expertise class feature, you also gain expert proficiency for martial weapons in your chosen group, and you become trained in advanced weapons in that group.", 0 },
                    { new Guid("a9c23bd7-9605-4568-9197-98b1caa1101c"), 0, new Guid("95d646cf-1720-4c5b-ae7f-44879200011d"), "You are no stranger to the trappings of warfare. You are trained in medium and heavy armor. At 13th level, if you gain the light armor expertise class feature, you also gain expert proficiency in these armors.", 0 },
                    { new Guid("69ff1f3f-cd63-40f9-8a6c-a5bf88d23ab5"), 0, new Guid("4875ca50-6a42-4025-bb6d-d8d978dfe0fc"), "You can see perfectly through wind and water, and you send electric charges through both air and water. You never take penalties to Perception from wind, rain, fog, or other precipitation, or from looking through water or being underwater, and such conditions don't cause anything to be concealed from you.", 0 },
                    { new Guid("c1509858-4554-4c0b-89a0-f68bd1c2781d"), 0, new Guid("b0b78c19-7a13-49fb-9a34-7d04765b78cf"), "Your body is a deep reservoir of life energy. At each level, you gain Hit Points equal to 10 + your Constitution modifier from the oracle class, instead of 8 + your Constitution modifier.", 0 },
                    { new Guid("7caedfb9-0fc3-4947-a71c-f48432ae3e8f"), 0, new Guid("27eab9f4-e610-4eaa-8288-2b531cb6bcee"), "The whispers of your ancestors have bestowed additional knowledge upon you. You gain an additional ancestry feat at 1st level and another additional ancestry feat at 11th level. These feats can't be ones that grant physiological effects, such as additional senses or unarmed attacks.", 0 },
                    { new Guid("ff77ccf3-c383-4e5e-bc34-1b290d21e5b2"), 1, new Guid("4875ca50-6a42-4025-bb6d-d8d978dfe0fc"), "When you deal physical damage with a non-cantrip air or water spell, you deal an additional 1 electricity damage per spell level.", 0 },
                    { new Guid("692d688c-38e6-4e87-b5cc-2bc78c17ec3f"), 0, new Guid("9ca06a26-bfe0-4599-abac-9050dec1a9a9"), "You can cleverly leverage the subtleties of life and death to your benefit. Each day during your preparations, you can choose to align yourself in the confluence of positive and negative energy so as to gain negative healing, which means you are harmed by positive damage and healed by negative effects as if you were undead. If you already have negative healing, instead the DC of your recovery checks is equal to 9 + your current dying value.", 0 }
                });

            migrationBuilder.InsertData(
                table: "MysteryCursePotency_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("71193f5e-96d2-4a63-8121-9342d26404ec"), 0, new Guid("5cf40f93-3146-457f-ad00-f97a7de1d6ef"), "Bones protrude through your skin and your flesh rots, combining with a stench of decay and an unearthly chill. Non-magical effects that would restore your Hit Points only grant you half as many HP as normal.", 0 },
                    { new Guid("e6af43b8-904b-40b4-86f4-1f55df8e5170"), 1, new Guid("9923a516-847d-454e-857c-1e8f6b1f99a5"), "Whenever you finish casting a non-cantrip spell, you restore Hit Points equal to the spell level to your choice of either one target of the spell or the creature nearest to you. You can't heal yourself in this way. This healing has the healing, necromancy, and positive traits, as well as the tradition trait of the spell.", 0 },
                    { new Guid("2f5f1468-b46e-47ac-a77e-fa5649011684"), 0, new Guid("c8f27630-ab7f-4132-b14d-328a2c6761c6"), "Life energy tears through you to empower your magic. Some of your spells carry positive energy with them. Each time you use a spell slot to cast a 5th-level or higher spell that takes 2 or more actions to cast, you disperse positive energy in a 30-foot burst with the effects of a 3-action heal spell with a level 4 lower than that of the spell you cast. This healing occurs immediately after you finish Casting the Spell. You don't benefit from this healing. Instead, you lose double the number of Hit Points rolled for the heal spell.", 0 },
                    { new Guid("e97a5b8c-045e-4474-96df-3f147ebabf07"), 0, new Guid("79166a3f-1b4a-490f-85f4-0e56798b68b2"), "The flat check DC to use other actions is 6, and you get the moderate curse benefit listed for your predominant ancestor in Table 2–4.", 0 },
                    { new Guid("64cb77dc-00c4-4568-b7b8-d86af155cb32"), 0, new Guid("dc0d9aaa-846f-4fb1-be19-ddf7e674e385"), "You take a –4 penalty to initiative, as trying to process a surge of information about what's happening around you slows your ability to respond to it.", 0 },
                    { new Guid("a5b8f040-c3a0-4974-99fb-7ba38cf48d59"), 1, new Guid("89d439b4-1844-4431-aff0-f86a47037a42"), "During combat or another tense, round-by-round encounter, other ancestors wrestle for control of your actions. When you roll initiative, and then at the end of each of your turns during the encounter, roll 1d4 and change your predominant ancestor appropriately. Once the encounter ends, you return to the influence of the ancestor you first rolled for the day.", 0 },
                    { new Guid("2380d3fd-169d-4c81-9cae-20ba1ceeec58"), 0, new Guid("89d439b4-1844-4431-aff0-f86a47037a42"), "One of your ancestors becomes predominant in their meddling. The first time you gain this effect each day, roll 1d4 on Table 2–4: Ancestral Influence to determine which type of ancestor becomes predominant. This predominant ancestor guides you to use their preferred type of action. When you try to use one of the types of actions listed for the other ancestors, you must succeed at a DC 4 flat check. On a failure, you spend the action but gain no effect (though you don't lose the spell if you were Casting a Spell). If your action would take 1 minute or longer, it's long enough that you can overcome the meddling, and you don't need to attempt a flat check.", 0 },
                    { new Guid("55b12b00-667d-4bc1-83f6-370a8839c76f"), 0, new Guid("8a9d4535-35e3-4fc0-889d-72baefc744da"), "An aura of a whirling storm whips up in a 5-foot emanation around you and in your space. The aura puts out small non-magical fires 1 round after they're lit or brought into your aura.", 0 },
                    { new Guid("0b20de39-4828-4255-b6c6-32b1fd0e2216"), 1, new Guid("8a9d4535-35e3-4fc0-889d-72baefc744da"), "Electrical energy builds up within your storm, turning you into a lightning rod; you gain weakness 2 to electricity, and electricity spells or effects that have additional effects for a creature wearing or holding metal treat you as though you were wearing metal.", 0 },
                    { new Guid("0f5dc49b-c080-41fb-963a-11240509aea3"), 0, new Guid("28c9cb53-f4a3-4978-87e9-29a6a0ec92af"), "Your minor curse's aura expands to a 10- foot emanation and carries rain on the winds. The whirling winds impose a –2 circumstance penalty on ranged attack rolls using physical ammunition that target you or originate from you. Your weakness to electricity increases to 5 or half your level, whichever is greater, but torrential rain grants you an equal amount of fire resistance.", 0 },
                    { new Guid("cab28f44-e479-42cb-a99a-3551ae300006"), 0, new Guid("804e2102-9653-4d38-acc4-9ed2fea7566a"), "Your minor curse's aura expands to a 15-foot emanation and grows stronger. High winds blowing outward in the aura impede creatures' progress. The aura is difficult terrain for Large and smaller creatures on the ground, and for Huge or smaller flying creatures. You aren't affected by this difficult terrain.", 0 },
                    { new Guid("b11a478e-e3ea-4c62-8861-11eb91dd8d37"), 0, new Guid("f9a9d796-733e-483e-8d8a-7f244f122252"), "The flow of information through your mind grows. The attention you divert to process this huge influx of information means you are always flat-footed. At the start of each of your turns, you automatically make one check to Recall Knowledge as a free action. This uses a skill of your choice that has the Recall Knowledge action, using a result equal to 10 + your proficiency bonus in that skill (with no other bonuses, penalties, or modifiers).", 0 },
                    { new Guid("9462bbd7-6333-42a9-bd5c-0c5701c5cc7f"), 0, new Guid("9923a516-847d-454e-857c-1e8f6b1f99a5"), "The flow of life energy away from you can't be reversed. In addition to the effects of your minor curse, you can't be healed by magical effects originating from other creatures. However, if you are unconscious, magical effects can restore you to 1 HP (but no higher). You are affected normally by healing elixirs, potions, and other items. When you cast heal and all your targets are living creatures, you roll d12s instead of d8s for the amount of healing.", 0 },
                    { new Guid("e2a4245d-3975-46a5-a1e5-95cd49d60a52"), 1, new Guid("b692168c-f6f7-4721-876c-5fe36fc358fd"), "You can suppress your aura until the start of your next turn by spending a single action, which has the concentrate trait, to diminish the flames, causing neither you nor anyone in the aura to take damage. While Refocusing to reduce your curse, you are continually diminishing the flames, so you don't lose HP. The flames subside if you fall unconscious, but they resume when you wake up unless you rested for long enough to reset your curse. As usual for oracular curses, you can't mitigate or reduce the lost Hit Points in any way, though you can still heal the lost HP normally after the fact.", 0 },
                    { new Guid("37d4aaaf-0bba-43db-affa-7de5c9c11c49"), 0, new Guid("b692168c-f6f7-4721-876c-5fe36fc358fd"), "The flames surrounding you are no longer simply visions. An aura of fire surrounds you in a 10-foot emanation, dealing 4d6 fire damage (basic Reflex save) to all other creatures in the aura at the end of each of your turns. You lose 1d6 Hit Points at the end of your turn each round, with no save; if you have a weakness to fire, increase the number of HP you lose by that weakness.", 0 },
                    { new Guid("6e40c84d-8702-413d-bea6-01189cfd2dc7"), 1, new Guid("0745de90-4be5-4185-aa36-dd69139ad96b"), "All your senses become imprecise beyond 30 feet, meaning everything past 30 feet that you'd normally be able to see is hidden from you.", 0 },
                    { new Guid("c4ff4867-633a-4f68-8b4b-9abd318310ce"), 0, new Guid("cda98ae6-3480-41f1-bb85-de92c42feb53"), "The flat check DC is 8, and you get the major curse benefit listed for your predominant ancestor instead of the moderate curse benefit.", 0 },
                    { new Guid("e715952d-03c2-4ba0-873e-567614ff31a5"), 0, new Guid("0745de90-4be5-4185-aa36-dd69139ad96b"), "Smoke and flickering visions of flame fill your senses more completely, and harmless flickers of obscuring flames also fill your space. You are concealed from other creatures, though as the other creatures aren't cursed themselves, they can benefit from effects that would allow them to ignore or mitigate the concealed condition, as normal. All other creatures and objects are concealed from you regardless of distance; however, when casting a fire spell, you automatically succeed at the flat check for this concealed condition for targets within 30 feet.", 0 },
                    { new Guid("44b342d6-6e38-4b23-bdd5-5acc0da914ad"), 0, new Guid("dc7cd972-dc34-4383-9027-280a8373e97f"), "The smoke, heat, and crackling flames of your curse fill your vision and all your other senses. Creatures further than 30 feet are concealed from you. You can't benefit from effects that would allow you to ignore or mitigate this concealment, as normal for effects of an oracular curse.", 0 },
                    { new Guid("56f4fa71-ff0d-49b1-b5a4-dd3398b993cd"), 0, new Guid("0d131a1c-5951-4909-a5e2-62ee3b370d6a"), "As your body rises, you float just above the ground beneath you. You become enfeebled 4, and the penalty from your minor curse increases to –4. You can walk on liquids as if they were solid; you gain the effects of the Cloud Jump skill feat; and you don't leave tracks, trigger weight-sensitive pressure plates, or otherwise connect with the ground below you.", 0 },
                    { new Guid("3e280ec0-19b9-4096-a069-410f8c6252ff"), 0, new Guid("4a57b852-aa91-47fa-8137-c2a6b0ca851e"), "Your body is drawn further skyward. You are enfeebled 2, and the penalty from your minor curse increases to –3. You are treated as one size smaller for wind effects. You gain a +2 status bonus against Trip attempts, you only take half as much damage from falls, and you gain the effects of the Powerful Leap and Quick Jump skill feats. You weigh only half as much, and your Bulk, should someone need to carry you, is also half as much.", 0 },
                    { new Guid("c8db508d-e966-42ea-8621-190e05f14822"), 0, new Guid("25b83e5a-63b5-4a4e-b1ee-4bb6fb7d628f"), "Your unnatural lightness makes it hard to keep your footing and interact with other physical objects. You are enfeebled 1 and take a –2 penalty to saves and DCs against Grapple, Shove, and other forms of forced movement.", 0 },
                    { new Guid("495e09da-1753-46d7-978f-e06fc70a19cc"), 0, new Guid("53a25cc7-3ad6-422b-b99e-77fafcc592b9"), "You stand just steps from the grave. You become wounded 1. This wounded condition is removed only when you Refocus; effects that normally remove the wounded condition reduce your wounded condition to wounded 1 instead. When you would attempt a recovery check, you can choose to get an automatic success instead of rolling, and if you roll a critical failure on a save against a disease, poison, or death effect, you get a failure instead.", 0 },
                    { new Guid("8b2d81e6-e6a5-4947-8ab5-64d6b2db9418"), 0, new Guid("1025db72-41b6-4772-8498-e2742f985d3a"), "Your dead flesh continues to rot, affecting your health. You become drained 1, and this drained condition is cumulative with any other drained conditions you gain. This drained condition is removed only when you Refocus; effects that normally remove the drained condition reduce your drained condition to drained 1 instead. In addition, you gain resistance to poison equal to half your level. You gain a +4 status bonus to saves against diseases, poisons, and death effects, and if you roll a success on such a save, you get a critical success instead.", 0 },
                    { new Guid("0b2e5506-d47b-4d53-80a4-0c64af10541a"), 0, new Guid("d9fc7ff0-2b5f-48eb-9588-9ce7690d215a"), "Your body languishes when you aren't bringing harm to your foes. You take a –2 status penalty to AC and saving throws, but each time you make a Strike, you can suspend these penalties until the start of your next turn.", 0 },
                    { new Guid("7206f308-6289-4942-87d2-f147258dde60"), 0, new Guid("85493ff7-09fc-43eb-a5c4-06f465d92a80"), "The strain of conflict wears upon your body, even though you gain vitality from it. Making a Strike reduces the penalty from your minor curse to –1 rather than suspending it entirely. You gain a +2 status bonus to weapon and unarmed damage rolls. You also gain fast healing equal to half your level while in a non-trivial combat encounter.", 0 },
                    { new Guid("7dfe06b3-37d9-4b6c-aac7-bb09869504ed"), 0, new Guid("1ddb07db-6c9e-4054-9c40-bd771cc69ecf"), "Your body proves capable of truly heroic feats, but doing so interferes with your mental focus. Your moderate curse's fast healing is equal to your level, and its damage bonus is +6. You gain a +1 status bonus to weapon and unarmed attack rolls, but you are stupefied 2.", 0 }
                });

            migrationBuilder.InsertData(
                table: "MysteryCursePotency_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("2e07c324-6bfc-402f-8813-388506567244"), 0, new Guid("86a4a3b5-2575-4e6a-9b7f-ca5983ac22da"), "As your life force seeps outward, it becomes more difficult to keep your body functioning. Effects that restore Hit Points to you take a status penalty equal to half your level (minimum 1) to the number of HP you recover.", 0 },
                    { new Guid("d8331838-4d95-4a24-b4ec-f42b56c1ba41"), 1, new Guid("804e2102-9653-4d38-acc4-9ed2fea7566a"), "The electricity arcing through you becomes dangerous. Any creature that touches you, including with a touch spell or a melee unarmed attack, takes 1d6 electricity damage.", 0 },
                    { new Guid("470b2884-6871-4da2-ac25-e27474837dd3"), 0, new Guid("cdb44a44-0d29-4d10-b7e8-ae3ad7c9f8db"), "The massive flow of information clouding your mind overwhelms your ability to communicate with others. You can understand all languages, but you can't speak, use linguistic effects, or otherwise communicate with your allies. If you Cast a Spell with a verbal component, you must succeed at a DC 5 flat check or the spell is lost. You gain a +4 status bonus on saving throws against linguistic effects.", 0 }
                });

            migrationBuilder.InsertData(
                table: "RangedWeapon",
                columns: new[] { "Id", "AmmunitionId", "BulkId", "Damage", "DamageTypeId", "Description", "Hands", "Level", "Name", "Price", "Range", "Reload", "SourcePageId", "TraitsId", "WeaponCategoryId", "WeaponGroupId" },
                values: new object[,]
                {
                    { new Guid("d093010f-0b1b-41d0-b76e-c5532a2d99a5"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This shortbow is made from horn, wood, and sinew laminated together to increase the power of its pull and the force of its projectile. Its compact size and power make it a favorite of mounted archers. Any time an ability is specifically restricted to a shortbow, it also applies to composite shortbows unless otherwise stated.", "1+", null, "Composite Shortbow", 1400, 60, 0, new Guid("fb97184c-4af3-4ac7-9bb4-3eb3d5999ab6"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("c532d9bd-cc75-4a16-bb46-b63c06fa9917"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This projectile weapon is made from horn, wood, and sinew laminated together to increase the power of its pull and the force of its projectile. Like all longbows, its great size also increases the bow’s range and power. You must use two hands to fire it, and it cannot be used while mounted. Any time an ability is specifically restricted to a longbow, such as Erastil’s favored weapon, it also applies to composite longbows unless otherwise stated.", "1+", null, "Composite Longbow", 2000, 100, 0, new Guid("f98fded2-6dfb-43ef-9ef1-2a0b9a9d6dae"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("4db58af2-e60f-44f7-b8b3-88a1a74c3120"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d10", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This large crossbow is harder to load and more substantial than a regular crossbow, but it packs a greater punch.", "2", null, "Heavy Crossbow", 400, 120, 2, new Guid("6cafd971-2575-43f8-861b-9c1024a3ac11"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("26d5e7ba-84a2-46d5-966d-c8eeda6cf9a4"), new Guid("550fe4e4-da65-4660-93bb-03676930ac11"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "Little more than a leather cup attached to a pair of straps, a sling can be used to fling smooth stones or sling bullets at a range.", "1", null, "Sling", 0, 50, 1, new Guid("95ea6700-cabd-4454-8926-4e4a75a55b59"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("92c0ebe3-618f-45e8-b9e2-cbd47a96ea96") },
                    { new Guid("957a55d1-dbc4-4060-ac98-aa4523175510"), new Guid("550fe4e4-da65-4660-93bb-03676930ac11"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d10", new Guid("4712d8c3-ffe6-4db2-b28e-f94065b005bc"), "This staff ends in a Y-shaped split that cradles a sling. The length of the staff provides excellent leverage when used two‑handed to fling rocks or bullets from the sling.", "2", null, "Halfling Sling Staff", 500, 80, 1, new Guid("cd06d5ba-e50c-461f-ac71-3271d52c9c3f"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("92c0ebe3-618f-45e8-b9e2-cbd47a96ea96") },
                    { new Guid("f7462ef0-62d3-48ad-bc24-e80318b98455"), new Guid("9230c1f0-09ea-4dd2-b6d4-bb0cfcbeabdd"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This long, narrow tube is used for shooting blowgun darts, using only the power of a forcefully exhaled breath.", "1", null, "Blowgun", 10, 20, 1, new Guid("00860b13-76fc-42d7-a5d7-00a6591e21dc"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("79516d2f-0c2d-47d3-b411-5b02ae26022f") },
                    { new Guid("bc6f549d-1db3-4414-8f4f-899691cff93d"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "Sometimes referred to as an alley bow by rogues or ruffians, this small crossbow fires small bolts that are sometimes used to deliver poison to the target. It’s small enough to be shot one-handed, but it still requires two hands to load.", "1", null, "Hand Crowssbow", 300, 60, 1, new Guid("037182fa-7919-4787-b078-cc6508c4fd0d"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("c5272f9b-93f4-42d6-baa1-7262fb6cd1ec"), new Guid("5ee1520e-e377-4855-8e73-81ebee4c146d"), new Guid("978d32f8-10b7-4150-bd9f-b8f037220542"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This weapon features an ingeniously designed catch mechanism at the top of the flight grove, just in front of the latch, which automatically loads a bolt from a magazine and resets the string each time the weapon is fired. A typical repeating hand crossbow magazine holds five bolts.", "1", null, "Repeating Hand Crossbow", 1000, 60, 0, new Guid("f97d2f26-6130-4d23-aac8-015e07958054"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("2ff08622-f9b8-4a19-8cf0-0f6c957762ee"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This ranged weapon has a bow-like assembly mounted on a handled frame called a tiller. The tiller has a mechanism to lock the bowstring in place, attached to a trigger mechanism that releases the tension and launches a bolt.", "2", null, "Crossbow", 300, 120, 1, new Guid("e6d8ee85-bb06-4d89-abf3-4a3ba7fae0d6"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("7c36bcfe-e828-43ca-baca-1a49be7ebfba"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d6", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This smaller bow is made of a single piece of wood and favored by skirmishers and cavalry.", "1+", null, "Shortbow", 300, 60, 0, new Guid("49b660af-5244-401f-8802-973448c4f7bd"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("59fa141b-7ef8-4ae5-b006-925a1a5e4fc3"), new Guid("e784b731-7bb1-4e51-b438-3e88eb542a41"), new Guid("28310eb8-9bee-46f0-9b93-e0965207169a"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This 5-foot-tall bow, usually made of a single piece of elm, hickory, or yew, has a powerful draw and is excellent at propelling arrows with great force and at an extreme distance. You must use two hands to fire a longbow, and it can’t be used while mounted.", "1+", null, "Longbow", 600, 100, 0, new Guid("ef9133cf-1818-4e73-9608-d3ed4c5cc288"), null, new Guid("2f7d0afa-d5fd-4b5a-96ae-94d0d788448f"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("fc7b92de-da67-4924-8ee2-b07bfbec720d"), new Guid("c51ef03b-db9b-44ac-92ac-39a0c7834b95"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d8", new Guid("8095023e-8d92-4cdd-b294-846dc71fdb21"), "This crossbow can deliver alchemically infused bolts. The strange weapon has a metal bracket mounted on the side of the stock near the lath. As an action, you can load a single lesser alchemical bomb into the bracket; this bomb must be one that deals energy damage (such as an acid flask, alchemist’s fire, bottled lightning, frost vial, or thunderstone). The next three attacks made with the crossbow deal 1d6 damage of the bomb’s damage type in addition to the crossbow’s normal damage. If the second and third attacks are not all made within 1 minute of the first attack, the bomb’s energy is wasted. These attacks never deal splash damage or other special effects of the bomb and are not modified by any abilities that add to or modify a bomb’s effect. The addition of the bracket serves to unbalance the weapon, reducing its range to 30 feet. It otherwise functions as a crossbow (when determining damage, reload, and so on). Creatures use their crossbow proficiency when using the alchemical crossbow. The alchemical crossbow costs 25 gp.", "2", null, "Alchemical Crossbow", 2500, 30, 1, new Guid("538738b0-b51d-4e95-9468-2954f72fedba"), null, new Guid("59366b6b-ef53-4be4-97e4-2311301393bd"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") },
                    { new Guid("7f5df152-e9a8-4918-a561-2aae39f0938b"), new Guid("2981098c-b7f9-40bd-83a4-624eec7ef483"), new Guid("8ad6f1e7-1ac2-47fd-b374-bb4f077a2545"), "1d10", new Guid("3f2fe0bc-7952-4593-b9a6-d24b8aede62d"), "Designed by conrasu warriors, this complex device resembles a crossbow and fires small wooden bullets known as taws. A system of blades within the launcher can rapidly reshape a taw as it's loaded, allowing the launcher to fire taws of different shapes, such as fléchettes.", "2", null, "Taw Launcher", 1000, 100, 1, new Guid("8c2cadd3-1f2e-442b-a75c-2cdfa563852e"), null, new Guid("f2115c27-5192-40f2-a41a-3ddbb8cb16b2"), new Guid("ed766d26-c252-4a47-8e6c-44031f691653") }
                });

