                    { new Guid("57b64ace-afe9-4b49-81ad-0e48b0347890"), 0, new Guid("8446dd11-5f2d-4216-ad48-85c285a1977b"), "The spell effect emanates from the touched creature, silencing all sound in or passing through a 10-foot radius and preventing any auditory and sonic effects in the affected area. While within the radius, creatures are subject to the same effects as the target. Depending upon the position of the effect, a creature might notice the lack of sound reaching it (blocking off the noise coming from a party, for example).", 0 },
