                    { new Guid("7ebed77a-cd19-4c03-ac0d-4cf9eaa438a3"), 0, new Guid("d523848c-c447-477b-b8f3-48dc196055ef"), "The target can also speak the language.", 0 },
                    { new Guid("e524c2fd-7a86-4c19-b8ea-3d8b0734620c"), 0, new Guid("fd04a9d3-8d55-49b6-ab6f-863cfda50de7"), "The spell is more difficult to counteract and resist, but the cost is increased to 16gp.", 0 },
                    { new Guid("baf914d7-0d96-40cb-aac0-fe72bbb3fb37"), 0, new Guid("dae11cb9-b62c-4073-827c-635821ed5e74"), "You can target up to 10 creatures.", 0 },
                    { new Guid("186fc125-7b6f-4519-94f4-a2e13d192f61"), 0, new Guid("d5f956fa-1486-461c-9ff5-94db3f1f5cdd"), "You can feed 200 Medium creatures.", 0 },
                    { new Guid("654e55bf-4a75-436b-a793-20451384ad00"), 0, new Guid("ae249d83-3fe3-4e38-8154-4d6b07924f3c"), "The damage increases by 2d6 (or by 2d8 if the target is a divine spellcaster).", 0 },
                    { new Guid("8bb751c4-64ba-4146-97fd-b2cac56abf29"), 0, new Guid("25598434-fc72-4c97-b895-060cada42dda"), "The damage increases to 2d4 damage.", 0 },
                    { new Guid("86437516-b358-41b6-81ff-63f6d142fae3"), 0, new Guid("3ce62722-4290-4b4b-949f-d0698ff70202"), "The damage increases by 2d10.", 0 },
                    { new Guid("e04f8289-1338-415a-be15-14689980e913"), 0, new Guid("a7a1d25e-fd89-4602-8322-e796cc091afd"), "Your battle form is Gargantuan and your attacks have 20-foot reach, or 25-foot reach if they started with 15-foot reach. You instead gain AC = 21 + your level, 25 temporary HP, an attack modifier of +25, a damage bonus of +15, double the damage dice, and Athletics +25.", 0 },
                    { new Guid("8686aa9a-88d3-4976-8731-8401612d3964"), 0, new Guid("2f7a2dd1-f158-490c-9ffe-b67b3a085a5c"), "Your battle form is Huge and your attacks have 15-foot reach, or 20-foot reach if they started with 15-foot reach. You instead gain 20 temporary HP, an attack modifier of +18, a damage bonus of +6, double the damage dice, and Athletics +21.", 0 },
                    { new Guid("730ac659-7199-4a9f-a784-76fa50311b10"), 0, new Guid("4d38efb2-763a-44c6-97d6-f67dccc6e8c2"), "The range increases to 1 mile. You don’t need to be able to see your destination, as long as you have been there in the past and know its relative location and distance from you. You are temporarily immune for 1 hour.", 0 },
                    { new Guid("bf8ce5df-06bb-49f9-9c3f-7b0af705fff0"), 0, new Guid("9e4831ac-5cfe-4a20-9583-6d18d37fa4d2"), "The duration is until the next time you make your daily preparations.", 0 },
                    { new Guid("ff710d1a-0b56-42b5-8e50-3892de1914bb"), 0, new Guid("5f67a8e9-f9f4-4b40-a9b6-f651f6b07886"), "You learn the number and types of poison.", 0 },
                    { new Guid("10273eee-70b6-4b64-9119-e1ca2dc37a7f"), 0, new Guid("480f3fc8-55c9-4961-8572-5cc86cc4ca85"), "The item is metal and can include common minerals, like feldspar or quartz.", 0 },
                    { new Guid("a1ef296a-a8d5-40bd-94cf-6d2ed7f47ebe"), 0, new Guid("0e4f844c-c605-4423-9321-ca5241df1950"), "As 3rd level, but you also pinpoint the source of the highest-level magic. Like for an imprecise sense, you don’t learn the exact location, but can narrow down the source to within a 5-foot cube (or the nearest if larger than that).", 0 },
                    { new Guid("a5619aec-d3da-4d3e-baaa-fb27eae58a13"), 0, new Guid("be4200a2-c623-4146-890a-bddb87f620cf"), "You learn each aura's location and strength.", 0 },
                    { new Guid("ef8617df-09c3-4aca-b07d-4e61bd26ed06"), 0, new Guid("aa381ca0-7a43-4e1b-9d5d-2ad73be5255d"), "The damage increases by 1d6.", 0 },
                    { new Guid("58b96894-4f49-442f-977c-482e7dd65f1c"), 0, new Guid("3d32cc67-f66b-4b7d-a267-ff050108114c"), "The spell’s range is touch and it targets 1 willing creature.The duration is until the next time you make your daily preparations.", 0 },
                    { new Guid("12971af1-dc37-4275-8caa-f1b40df0c206"), 0, new Guid("b2fd64f9-51d7-42fb-b78d-fd29bf47f508"), "The spell’s range is touch and it targets 1 willing creature.", 0 },
                    { new Guid("179d71a1-ba70-4709-bf82-5905bf06341f"), 0, new Guid("9d5aaa18-2a33-4468-b219-bf3429228901"), "Even creatures with darkvision (but not greater darkvision) can barely see through the darkness. They treat targets seen through the darkness as concealed.", 0 },
                    { new Guid("86662ee0-fcca-4c22-ba32-12225ae67d54"), 0, new Guid("cecf2b46-be78-406a-ab01-b1bff4d3917a"), "The area increases to a 60-foot cone.", 0 },
                    { new Guid("8f48fd63-265e-421f-9393-46220ae44b5c"), 0, new Guid("7c4a2e8b-867f-4b2b-816a-535e3eb0fc79"), "The level for each category increases by 2.", 0 },
                    { new Guid("86320f63-c48b-4b85-86fc-1fe0acef448e"), 0, new Guid("c9d1c03b-32b0-4182-ad71-89f87576f5a7"), "You learn the school of magic for the highestlevel effect within range that the spell detects. If multiple effects are equally strong, the GM determines which you learn.", 0 },
                    { new Guid("b76a367e-5acb-4939-af0e-e955b770a0d0"), 0, new Guid("8e38a5fc-f74d-4c0a-b653-4bc2c4610d9e"), "The number of targets increases by 1.", 0 },
                    { new Guid("b1598565-4cb0-4656-bfcb-16b7b5d336fa"), 0, new Guid("5da315c4-0930-4154-803d-1d618e8073a4"), "The duration increases to 1 hour.", 0 },
                    { new Guid("64fd4ed4-03f0-43e9-9b80-e5bc8a5d28a4"), 4, new Guid("070c4a22-2028-4361-89b5-ef690dd3fa6b"), "8 - Reroll, and creatures that pass through the wall take a –2 circumstance penalty to their saves.", 2 },
                    { new Guid("24b63a1a-f410-4c85-b5c4-a11feab9fde1"), 0, new Guid("a7a384da-ca83-4941-969f-668d59f18cb5"), "The initial damage increases to 4d6 + your spellcasting ability modifier, the persistent damage increases to 5, and the splash damage increases to 4.", 0 },
                    { new Guid("cc25bc79-a18b-4e1e-81bc-e63aa1a91cfa"), 0, new Guid("107e9a96-572d-40b9-87d9-bf36b2302260"), "The initial damage increases to 3d6 + your spellcasting ability modifier, the persistent damage increases to 4, and the splash damage increases to 3.", 0 },
                    { new Guid("9a0f3e61-e70a-43d8-b9b8-83be2811e5a3"), 0, new Guid("07445e05-eccc-4463-b72a-ab813e961d2e"), "The initial damage increases to 2d6 + your spellcasting ability modifier, the persistent damage increases to 3, and the splash damage increases to 2.", 0 },
                    { new Guid("672a2316-1939-4b9f-9cfb-624830f43fce"), 0, new Guid("9da22e21-d1e7-43d1-88e8-e95065c242db"), "The initial damage increases to 1d6 + your spellcasting ability modifier, and the persistent damage increases to 2.", 0 },
                    { new Guid("aab0c30f-4a1b-499f-bd9c-8a26f616fb98"), 0, new Guid("ce2df890-5896-491e-a1f2-18a9808e1682"), "The initial damage increases by 2d8, and the persistent acid damage increases by 1d6.", 0 },
                    { new Guid("0e2d5fc4-bc4c-4965-861b-afeeb609d66b"), 0, new Guid("7ad6e589-73fd-47e8-b3a3-dd048a2c5374"), "At the end of your turn, you can attempt a DC 30 Acrobatics check to find purchase in midair. If you succeed, you don’t fall.", 0 },
                    { new Guid("c342ace1-2628-4a72-af0c-98c5446d0283"), 0, new Guid("3a499db3-6fd1-4cf8-aa21-0b78c08e7b65"), "If you choose to regain Hit Points, the Hit Points regained increase by 8.", 0 },
                    { new Guid("18b5fdc3-37cc-47e3-ae30-9e510ba66979"), 0, new Guid("461c1a6c-d9e9-4c24-82df-9799e0001811"), "Your battle form is Large and your fly Speed gains a +10-foot status bonus. You must have enough space to expand into or the spell is lost. You instead gain 10 temporary HP, attack modifier +18, damage bonus +8, and Acrobatics +20.", 0 },
                    { new Guid("b2d00346-8099-4239-9761-4f99afc92003"), 0, new Guid("50413b59-c2ef-4c2d-83f7-a2c0aa68167e"), "The damage increases by 10 on a failure, or 5 on a success.", 0 },
                    { new Guid("4eb5ed89-5f4b-4937-a560-e9ae5fc43027"), 0, new Guid("3d7b2050-b3bf-44cf-8cfd-fb0d60384585"), "The damage increases by 1d6, or by 2d6 if you use 2 or 3 actions.", 0 },
                    { new Guid("ce529000-04c0-4fa6-8bd6-e4cc41a0578e"), 0, new Guid("115a84a3-2c4b-4369-9dfb-f9d22da3fa95"), "You can also wild shape into the forms listed in animal form.", 0 },
                    { new Guid("faf8a9d0-e8ef-41aa-9ffe-ce59e1702e10"), 0, new Guid("f950ba32-efea-4a03-a6e2-c2e857eff0ed"), "You can choose up to three of the effects from the list. Wild claws deal 4d6 persistent bleed damage on a hit, and wild jaws deal 4d6 persistent poison damage on a hit.", 0 },
                    { new Guid("230fd890-1d09-4bdd-8a9e-1083e9a7b9f4"), 0, new Guid("3d9cb393-886d-481a-b33e-1619e6a59395"), "You can choose up to two of the effects from the list. Wild claws leave terrible, ragged wounds that also deal 2d6 persistent bleed damage on a hit, and wild jaws are envenomed, also dealing 2d6 persistent poison damage on a hit.", 0 },
                    { new Guid("71ffb91c-dc6a-459a-90ad-b90d1200b32a"), 0, new Guid("2d6a2cf6-00ff-40d4-91a9-ef790695c8a2"), "The initial damage increases by 1d12, and the persistent electricity damage on a failure increases by 1.", 0 },
                    { new Guid("ef01260a-2504-4d87-a743-a51a1331d5a5"), 0, new Guid("e96c9d70-88ef-4e98-9117-92ed469f7d88"), "When you fly using stormwind flight, you don’t count flying against the wind as difficult terrain.", 0 },
                    { new Guid("434abe8f-ce98-4bb1-9f68-1cfa0a1e470a"), 0, new Guid("4ae1bb3a-803b-460d-9af4-8c1f226c4198"), "The amount of healing increases by 1d8, and the additional healing for the 2-action version increases by 8.", 0 },
                    { new Guid("8f2cb8b4-6ef1-4dc1-9ae4-31519cb32fb1"), 0, new Guid("b1bd15c2-46d2-436a-acc8-cece1b824bb0"), "The extra damage increases by 1d6.", 0 },
                    { new Guid("3bf1bb14-bdfd-440d-9066-045783f6932c"), 0, new Guid("0b4eadbc-0ed2-444c-997f-0e248309b869"), "Your battle form is Huge, your fly Speed gains a +15-foot status bonus, and your attacks have 10-foot reach. You must have enough space to expand into or the spell is lost. You instead gain AC = 21 + your level, 15 temporary HP, attack modifier +21, damage bonus +4 and double damage dice (including persistent damage), and Acrobatics +23.", 0 },
                    { new Guid("569c330e-2a24-4278-ab38-f238d36ce0b3"), 0, new Guid("730097a4-0886-4c81-a15e-b00fc7ec40c9"), "You can specify criteria for which creatures sound the alarm spell—for instance, orcs or masked people.", 0 },
                    { new Guid("6454be59-729b-4090-b4c6-642db9481178"), 0, new Guid("96d6be16-ee49-4b00-aa7e-7b364bd363bc"), "The damage increases by 1d6.", 0 },
                    { new Guid("f9b3866a-ab6c-4138-880c-b1922c5a29fc"), 3, new Guid("070c4a22-2028-4361-89b5-ef690dd3fa6b"), "7 - Violet: The wall prevents spells from targeting the other side (area effects still cross as normal). Creatures passing through must succeed at a Will save or they are slowed 1 for 1 minute; on a critical failure, the creature is instead sent to another plane, with the effect of plane shift. Dispel magic can counteract a violet chromatic wall.", 2 },
                    { new Guid("84a5c2bc-0363-4a18-8b1e-db9d15ec5bd2"), 2, new Guid("070c4a22-2028-4361-89b5-ef690dd3fa6b"), "6 - Indigo: The wall stops divination and mental effects from passing through, and those passing through are subject to the effects of warp mind. Searing light can counteract an indigo chromatic wall.", 2 },
                    { new Guid("452116b2-0f16-4406-bad2-f58af1c80800"), 1, new Guid("070c4a22-2028-4361-89b5-ef690dd3fa6b"), "5 - Blue: The wall stops auditory, petrification, and visual effects from passing through, and creatures passing through are subject to the effects of flesh to stone. Magic missile can counteract a blue chromatic wall.", 2 },
                    { new Guid("10b435c4-4477-4d2c-87fd-cbaf49922875"), 0, new Guid("070c4a22-2028-4361-89b5-ef690dd3fa6b"), "The spell’s duration increases to 1 hour. Roll 1d8 to determine the wall’s color; the results for 5–8 are below.A red, orange, yellow, or green wall deals an extra 10 damage.", 0 },
                    { new Guid("e508583c-8cdb-4634-91ff-dd70e33fd411"), 0, new Guid("4c4341f2-16d9-4a55-b504-418231e4b9fe"), "The negative damage to living creatures increases by 1d4.", 0 },
                    { new Guid("85866a6b-4934-4b35-b98e-0f99876fe455"), 0, new Guid("4e928728-b53f-43e2-acbe-7b93732500e9"), "The cold damage increases by 2d6, and the evil damage against celestials increases by 2d6.", 0 },
                    { new Guid("470cd40d-caa3-4188-8862-a59f41eff543"), 0, new Guid("99a5bbf6-51c5-4e42-ba6b-e1155c40d500"), "The duration lasts until the next time you make your daily preparations, and you can target up to 10 creatures.", 0 },
                    { new Guid("02e87545-e884-4321-8b76-fc41fbb44bd2"), 0, new Guid("8fad2d3e-740c-4f51-bb8d-8abe84a24783"), "The duration lasts until the next time you make your daily preparations.", 0 },
                    { new Guid("87d75997-6b09-4e5d-9adc-df001c60a730"), 0, new Guid("e7d4ce94-e923-43fb-bcc9-e34987534372"), "The damage increases by 1d12.", 0 },
                    { new Guid("e40d5cb9-53ed-44ed-a996-e81ba3b76103"), 0, new Guid("0433232e-b381-4a6d-bd3c-404bfdedb535"), "The damage increases by 2d6.", 0 },
                    { new Guid("74827007-1d12-462a-a927-1324a4bf22ae"), 0, new Guid("84e120a3-6dd6-4348-9a07-934858f71840"), "The resistance increases by 3.", 0 },
                    { new Guid("9f8a17ee-eb90-4fca-b9a5-345a645fde4f"), 0, new Guid("3a1aa8fe-d985-4af4-a664-e7ceed761d9d"), "The damage increases by 1d8.", 0 },
                    { new Guid("03056dae-e94d-4ffd-8cf1-f06172f6380c"), 0, new Guid("4a665729-f77d-4c8c-8f00-dd3fe078e3d8"), "The resistances increase by 2, and the weakness increases by 3.", 0 },
                    { new Guid("d8510f7f-7901-415d-970e-68f0949a82b7"), 0, new Guid("62d6f3f0-5ae7-4ceb-b943-d716a9d05586"), "You can target up to 10 creatures. The extra material component affects targets to which it is anathema.", 0 },
                    { new Guid("50f4a710-bd37-412d-bd42-75ccf627066e"), 0, new Guid("7bd4ff03-9047-4baa-939e-312c7924b42d"), "Your battle form is Huge and your attacks have 15-foot reach. You must have enough space to expand into or the spell is lost. You instead gain 20 temporary HP, AC = 18 + your level, attack modifier +18, damage bonus +7 and double the number of damage dice, and Athletics +20.", 0 },
                    { new Guid("81f48c2e-9615-4236-980b-f982843d0ae7"), 0, new Guid("62d0851a-cc5e-462c-aee1-1b5e812ac054"), "Your battle form is Large and your attacks have 10-foot reach. You must have enough space to expand into or the spell is lost. You instead gain 15 temporary HP, AC = 18 + your level, attack modifier +16, damage bonus +9, and Athletics +16.", 0 },
                    { new Guid("0a64260a-8855-434a-a9b7-1d3ea34ead92"), 0, new Guid("63371eec-c1ea-4dcb-8c53-e72fe03224a8"), "You instead gain 10 temporary HP, AC = 17 + your level, attack modifier +14, damage bonus +5, and Athletics +14.", 0 },
                    { new Guid("239f5167-8c42-4002-99cd-8447f93db2dd"), 0, new Guid("766b8628-93b0-4a8f-baf9-d7be6eb4e957"), "Target up to three weapons, and the damage increases to 3d4 damage.", 0 },
                    { new Guid("b80d3ed5-a258-46bf-aba7-9f4623cac77a"), 0, new Guid("637c1c9a-e2f9-497d-85fc-9ca72fbba552"), "The damage increases by 1d6.", 0 },
                    { new Guid("4cd9a795-3ecc-42e2-81e7-157af0a80bd6"), 0, new Guid("18cca2c1-2c7b-4486-b085-734cebf5f52d"), "The damage increases by 1d10, and the level of creatures that must attempt a second save on a critical failure increases by 2.", 0 },
                    { new Guid("44d1af8e-b3a2-4726-863e-8669acd62fe3"), 0, new Guid("94452491-58bd-487f-b187-8525fe6a0160"), "The damage increased by 1d4.", 0 },
                    { new Guid("8cd0e665-f13d-418b-b22a-3c02e2b9c4ca"), 0, new Guid("869bb731-4868-42fb-be87-e7fb3f751530"), "As the 2nd-level version, but the duration is unlimited.", 0 },
                    { new Guid("e46c70c1-5307-4f1b-bd87-10aa53a28b80"), 0, new Guid("3fa9139d-a19c-4235-9e7a-bf242c9a26ad"), "Your image makes appropriate sounds, generates normal smells, and feels right to the touch. The spell gains the auditory and olfactory traits. The duration increases to 1 hour.", 0 },
                    { new Guid("9e3988e9-11b0-439b-a04c-b4dea9c04717"), 0, new Guid("e29e8d03-1a45-40ae-8981-4052a954d4b8"), "You can appear as any creature of the same size, even a specific individual. You must have seen an individual to take on their appearance. The spell also disguises your voice and scent, and it gains the auditory trait.", 0 },
                    { new Guid("e56f234b-ebd8-4f3a-986c-d974d73d9eed"), 0, new Guid("15f25d1c-8ef1-442f-9c38-1060b42ee736"), "The spell also disguises your voice and scent, and it gains the auditory and olfactory traits.", 0 },
                    { new Guid("2dcf6ec2-cb8d-4ab4-bf4f-ddf4edf63362"), 0, new Guid("0b5f879c-6657-43d5-a86b-dcbe74eb1b6e"), "The damage of the image’s Strikes increases by 1d4, and the maximum size of creature you can create increases by one (to a maximum of Gargantuan).", 0 },
                    { new Guid("708106df-fd45-4701-bb9e-52bbdbf51501"), 0, new Guid("9f6a9758-fe0e-4f9d-b24d-15ba72528465"), "The damage increases by 2d6.", 0 },
                    { new Guid("0e17b926-9d50-4132-a1da-f2fc7ad4eea4"), 0, new Guid("b15f5c5b-fe78-45e4-a5ed-a2b780376218"), "The damage increases by 2d6.", 0 },
                    { new Guid("fc9c5991-c12f-48ef-a401-823531491782"), 0, new Guid("30f3a7e9-decc-4b69-bd1b-7ea1613840f6"), "Creatures or objects in your scene can speak. You must speak the specific lines for each actor when creating your program. The spell disguises your voice for each actor.", 0 },
                    { new Guid("5e28c471-3245-43ae-b39f-3b4f11d853b1"), 0, new Guid("dbfae4ee-2e5e-4413-a4a1-b5c9aed0d8ca"), "You can take on the appearance of a Large humanoid. If this increases your size, you gain the effects of the enlarge spell.", 0 },
                    { new Guid("abc7d61f-203a-4ccb-8869-48f0472ffb5b"), 0, new Guid("3bf91ab1-bd8b-4637-95be-6acf226a0e9f"), "The damage increases by 1d10.", 0 },
                    { new Guid("a3a53f28-12f5-42bf-87be-385135544457"), 0, new Guid("0df6e647-ec71-4e03-9023-992c826c4152"), "The bludgeoning damage increases by 1d6, and the additional positive and good damage each increase by 2d6.", 0 },
                    { new Guid("54a2d29a-a003-49a4-a195-05f67ecf6154"), 0, new Guid("174103ee-a012-4259-a93b-8715b1c5d1a9"), "The status bonus increases to +3.", 0 },
                    { new Guid("f63e94a0-b65e-43c7-89c0-046a08ee3598"), 0, new Guid("d7c2b155-f6c4-422b-97b3-57d3fa2a4741"), "The status bonus increases to +2.", 0 },
                    { new Guid("2b155efd-5b2b-4297-9d10-a5725ed3ee6d"), 0, new Guid("dad6622d-9b36-46d3-8273-904a69d0e2c6"), "The amount of healing or damage increases by 1d8, and the extra healing for the 2-action version increases by 8.", 0 },
                    { new Guid("375aeafe-a037-4482-9f3c-450263efce64"), 0, new Guid("ef4e6ef0-301a-4447-bc20-3dfd8fc69e1c"), "You can target up to 6 creatures.", 0 },
                    { new Guid("4c5d1fd8-a2b9-4325-bd46-ea098d019ec9"), 0, new Guid("7ed06502-393d-4b18-8093-cc77defbf123"), "The amount of healing or damage increases by 1d8, and the extra healing for the 2-action version increases by 8.", 0 },
                    { new Guid("ab95e947-7736-430a-80bd-7d0a2dc55bb8"), 0, new Guid("c103e51f-7098-419e-80ae-d0ce3a89e7a5"), "You gain darkvision or low-light vision if the form you assume has that ability.", 0 },
                    { new Guid("3679ee77-2188-404b-aaa0-327180b9558c"), 0, new Guid("1763b47c-23f2-4ac7-bc07-8373e301e1d3"), "As the 6th-level version, and the duration is unlimited.", 0 },
                    { new Guid("04622cfb-62de-4cee-a784-a8272c354e01"), 0, new Guid("af3c4630-79b1-427e-afbb-37f4cf342a52"), "The damage increases by 10.", 0 },
                    { new Guid("326b418c-ec27-4d2b-bfe2-883723ae6b00"), 0, new Guid("d043fdc9-cb8d-4035-89fe-8a8715034fcc"), "Your battle form is Large, and your attacks have 10-foot reach. You must have enough space to expand into or the spell is lost. You instead gain 15 temporary HP, attack modifier +16, damage bonus +6, and Athletics +16.", 0 },
                    { new Guid("687ab638-b9f5-425e-b7ae-aa35f84df3d4"), 0, new Guid("af79a569-6faf-4f9f-9da1-777f925f2606"), "You can target an unattended object with a Bulk of 1 or less.", 0 },
                    { new Guid("03476483-67a5-48a4-8eb8-9803d62b3ea7"), 0, new Guid("3e7ad9a5-2a98-4a6d-96bd-7a9c01c4bbe4"), "The item bonus to AC increases to +3, and you gain a +3 item bonus to saving throws.", 0 },
                    { new Guid("e60efb6c-6a95-4c75-9686-51357b3cf4de"), 0, new Guid("518cd078-8775-4a04-ba26-c0516f7437a5"), "The item bonus to AC increases to +2, and you gain a +2 item bonus to saving throws.", 0 },
                    { new Guid("d303a6ae-7e3f-40fa-baf4-4ce60fff9c83"), 0, new Guid("302f0377-c00f-4cf9-b3f8-dc6601d2655f"), "The item bonus to AC increases to +2, and you gain a +1 item bonus to saving throws.", 0 },
                    { new Guid("213d6522-4a42-4838-8031-c1bd83cf4064"), 0, new Guid("c4596fa3-5395-4c0e-bc2b-00acefeca908"), "You gain a +1 item bonus to saving throws.", 0 },
