                    { new Guid("e9cf21f3-2585-40e8-bce5-685abb3c4339"), 0, new Guid("bd53069f-597a-4cd3-a4cc-37c9854ffe05"), "The spell’s area increases to a 20-foot burst, and its range increases to 60 feet.", 0 },
