                    { new Guid("9fed9ca9-7989-4dc5-a8ad-abae1965ffa9"), 0, new Guid("c7ff1d88-1574-45d3-a73e-3e0ae9fd21ca"), "The spell’s range increases to 30 feet, the duration increases to 1 hour, and you can target up to 10 creatures.", 0 },
