                    { new Guid("edb4e96d-2949-4309-9cb0-f475438fde22"), 0, new Guid("8c388f53-394f-46f0-b797-3ff02f9de5ff"), "The spell’s duration increases to 1 hour, and you can also change the tone, quality, and other aspects of your voice. Before a creature can attempt to disbelieve your illusion, it must actively attempt a Perception check or otherwise use actions to interact with the sound.", 0 },
                    { new Guid("91465c05-35f4-4633-b491-d884759d2d6b"), 0, new Guid("d3a61078-5da9-47ea-9939-869bda5001a7"), "The force damage increases by 1d10.", 0 },
